(28, 45, 'bagian terbaiknya mungkin ada di pertarungan tangan kosongnya dan penampilan apik hwang jung-min yang baru-baru ini juga tampil bagus di thriller gangster new world meskipun tidak memiliki banyak variasi tetapi setiap duelnya digarap dengan editing dan visual yang baik dan terasa realistis ketika ada campur tangan koreografer jung doo-hong yang tahun ini juga menggarap aksi di the berlin file klimaksnya mungkin tidak yang seperti kita harapkan tetapi bisa jadi itu adalah penutup yang pantas untuk menebalkan semua tema-temanya sementara di tempat lain karakter-karakter utamanya dibuat cukup menarik', 'terbaiknya pertarungan tangan kosongnya penampilan apik hwang jung-min baru-baru tampil bagus thriller gangster new world memiliki variasi duelnya digarap editing visual realistis campur tangan koreografer jung doo-hong menggarap aksi the berlin file klimaksnya harapkan penutup menebalkan tema-temanya karakter-karakter utamanya menarik', 'baik tarung tangan kosong tampil apik hwang jung min baru tampil bagus thriller gangster new world milik variasi duel garap editing visual realistis campur tangan koreografer jung doo hong garap aksi the lin file klimaks harap tutup tebal tema karakter utama tarik'),
(29, 46, 'sama seperti pendahulunya footloose versi craig brewer ini masih tetap menjadi sebuah guilty pleasure yang menyenangkan dengan segala melodrama yang corny termasuk tarian-tarian klasiknya yang abadi itu yang menarik adalah bagaimana brewer berusaha tetap setia menghadirkan pernak pernik di dalamnya sebagai sebuah penghormatan besar untuk versi orisinalnya ya footloose mungkin akan disukai oleh penonton-penonton remajanya', 'pendahulunya footloose versi craig brewer guilty pleasure menyenangkan melodrama corny tarian-tarian klasiknya abadi menarik brewer berusaha setia menghadirkan pernak pernik dalamnya penghormatan versi orisinalnya ya footloose disukai penonton-penonton remajanya', 'dahulu footloose versi craig brewer guilty pleasure senang melodrama corny tarian klasik abadi tarik brewer usaha setia hadir pernak pernik dalam hormat versi orisinal ya footloose suka penonton remaja'),
(30, 47, 'seperti judulnya yang secara harfiah berarti perangkap rubah miller sudah menyiapkan jebakan untuk membuat penontonnya yang tidak siap terperosok ke dalam sebuah lubang berisi proses dari sebuah kisah nyata kelam yang berjalan lambat serta ditempeli oleh studi karakter yang kompleks dengan memposisikan kita seperti karakter lugu mark schultz yang tidak tahu apa-apa tentu saja dengan asumsi kamu juga tidak pernah tahu kisah aslinya sebelumnya foxcatcher akan memberi kejutan-kejutan dalam perjalanannya terutama ketika ia menutup kisahnya dengan sebuah momen shocking yang menghentak', 'judulnya harfiah perangkap rubah miller jebakan penontonnya terperosok lubang berisi proses kisah nyata kelam berjalan lambat serta ditempeli studi karakter kompleks memposisikan karakter lugu mark schultz apa-apa asumsi kisah aslinya foxcatcher kejutan-kejutan perjalanannya menutup kisahnya momen shocking menghentak', 'judul harfiah perangkap rubah miller jebak tonton perosok lubang isi proses kisah nyata kelam jalan lambat serta tempel studi karakter kompleks posisi karakter lugu mark schultz apa asumsi kisah asli foxcatcher kejutan jalan tutup kisah momen shocking menghentak'),
(31, 48, 'tanpa bisa memamerkan wajahnya di nyaris durasinya dedikasi michael fassbender dalam memerankan frank yang punya pesona unik sekaligus rapuh patut diacungi jempol tentu saja kita tidak pernah bisa melihat ekspresi wajahnya yang keras kebanyakan emosinya diungkapkan secara verbal yang terkadang sering mengganggu karakter lainnya tetapi gestur tubuh fassbender sudah berbicara banyak sangat banyak malah dalam usahanya menciptakan karakter salah satu karakter paling ikonis dalam perjalanan kariernya', 'memamerkan wajahnya durasinya dedikasi michael fassbender memerankan frank pesona unik rapuh patut diacungi jempol ekspresi wajahnya keras kebanyakan emosinya verbal terkadang mengganggu karakter gestur tubuh fassbender berbicara usahanya menciptakan karakter salah karakter ikonis perjalanan kariernya', 'pamer wajah durasi dedikasi michael fassbender peran frank pesona unik rapuh patut acung jempol ekspresi wajah keras banyak emosi verbal terkadang ganggu karakter gestur tubuh fassbender bicara usaha cipta karakter salah karakter ikonis jalan karier'),
(32, 49, 'frankenweenie mungkin saja membuat mereka bermimpi buruk meskipun masih ada sisi menyentuh tentang persahabatan seorang anak dengan anjingnya di dalamnya tetapi jika kamu adalah penonton dewasa yang pernah merasakan kejayaan horor-horor jadul atau setidaknya sedikit mengenalnya maka kamu akan terpuaskan dengan apa yang sudah dilakukan tim burton kali ini ya ini bukan sekedar parodi dari kisah klasik frankenstein yang legendaris itu saja ini seperti sebuah persembahan untuk semua horor-horor klasik', 'frankenweenie bermimpi buruk sisi menyentuh persahabatan anak anjingnya dalamnya penonton dewasa merasakan kejayaan horor-horor jadul mengenalnya terpuaskan tim burton kali ya sekedar parodi kisah klasik frankenstein legendaris persembahan horor-horor klasik', 'frankenweenie mimpi buruk sisi sentuh sahabat anak anjing dalam tonton dewasa rasa jaya horor jadul nal puas tim burton kali ya sekedar parodi kisah klasik frankenstein legendaris sembah horor klasik'),
(33, 50, 'friends with benefits mungkin tidak sekuat dan secerdas easy a sebagai sebuah komedi seks dewasa tapi untuk ukuran romcom ringan ia jelas lucu enjoyable menghibur dan sekaligus satir disaat bersamaan dengan segala dukungan hebat dari chemistry yang dibangun timberlake-kunis plus kehadiran karakter-karakter pendukungnya yang menarik sepertinya seorang will gluck patut bernafas lega karena ia kembali berhasil menorehkan pekerjaan bagus di film ketiganya kali ini', 'friends with benefits sekuat secerdas easy a komedi seks dewasa ukuran romcom ringan lucu enjoyable menghibur satir disaat bersamaan dukungan hebat chemistry dibangun timberlake-kunis plus kehadiran karakter-karakter pendukungnya menarik will gluck patut bernafas lega berhasil menorehkan pekerjaan bagus film ketiganya kali', 'friends with benefits kuat cerdas easy a komedi seks dewasa ukur romcom ringan lucu enjoyable hibur satir saat sama dukung hebat chemistry bangun timberlake kunis plus hadir karakter dukung tarik will gluck patut nafas lega hasil toreh kerja bagus film tiga kali'),
(34, 51, 'fright night mungkin tidak sedalam let the right one in tapi saya percaya ia tidak akan dihina habis-habisan seperti saga twilight oleh para vampir mania ya untuk ukuran remake gillespie bisa dibilang sukses membawa horor klasik milik holland itu ke ranah modern tanpa harus menghilangkan segala aspek-aspek vampir tradisionalnya termasuk juga humor-humor gelapnya yang mampu berpadu padan dengan baik dengan horor mencekamnya dan ceritanya yang ringan', 'fright night sedalam let the right one in percaya dihina habis-habisan saga twilight vampir mania ya ukuran remake gillespie dibilang sukses membawa horor klasik milik holland ranah modern menghilangkan aspek-aspek vampir tradisionalnya humor-humor gelapnya berpadu padan horor mencekamnya ceritanya ringan', 'fright night dalam let the right one in percaya hina habis saga twilight vampir mania ya ukur remake gillespie bilang sukses bawa horor klasik milik holland ranah modern hilang aspek vampir tradisional humor gelap padu padan horor cekam cerita ringan'),
(35, 52, 'selain adegan-adegan aksinya from paris with love benar-benar tertolong dengan penampilan dynamic duo yang tampil kompak sepertinya semenjak true lies yang kontroversial itu sudah cukup lama tidak ada lagi film bertema aksi terorisme yang menyenangkan untuk ditonton untung saja ada luc besson dengan from paris with love yang hadir memberikan sebuah sajian film aksi yang benar-benar menghibur', 'adegan-adegan aksinya from paris with love benar-benar tertolong penampilan dynamic duo tampil kompak semenjak true lies kontroversial film bertema aksi terorisme menyenangkan ditonton untung luc besson from paris with love hadir sajian film aksi benar-benar menghibur', 'adegan aksi from paris with love benar tolong tampil dynamic duo tampil kompak semenjak true lies kontroversial film tema aksi terorisme senang tonton untung luc besson from paris with love hadir saji film aksi benar hibur'),
(36, 53, 'penampilan cemerlang jebolan fiksi ilmiah chronicle dan serial televisi friday night lights michael b jordan turut menjadi alasan mengapa film yang diproduseri oleh forest whitaker ini tampil meyakinkan mungkin kita tidak mengenal siapa oscar tetapi apa yang dilakukan jordan sedikit banyak sudah mendekatkan kita pada sosok pemuda tahun itu termasuk bagaimana keseharian dan pribadinya tetapi tidak hanya jordan yang bagus ada melonie diaz yang memainkan kekasih oscar sophina mesa dan octavia spencer sebagai sang ibu yang tampil sama kuatnya memberikan kehangatan sebuah keluarga dalam menemani hari-hari terakhir oscar yang malang', 'penampilan cemerlang jebolan fiksi ilmiah chronicle serial televisi friday night lights michael b jordan alasan film diproduseri forest whitaker tampil mengenal oscar jordan mendekatkan sosok pemuda keseharian pribadinya jordan bagus melonie diaz memainkan kekasih oscar sophina mesa octavia spencer sang tampil kuatnya kehangatan keluarga menemani hari-hari oscar malang', 'tampil cemerlang jebol fiksi ilmiah chronicle serial televisi friday night lights michael b jordan alas film produser forest whitaker tampil nal oscar jordan dekat sosok pemuda keseharian pribadi jordan bagus melonie diaz main kasih oscar sophina mesa octavia spencer sang tampil kuat hangat keluarga teman hari oscar malang'),
(37, 54, 'sebagai karya jenius stanley kubrick full metal jacket bukanlah film perang berskala besar namun jarang ada film perang dengan kualitas seperti ini menurut saya dari film film perang vietnam yang membanjiri bioskop pada era hingga full metal jacket merupakan film anti perang yang mengesankan bahkan dengan segala kesalahannya film ini merupakan salah satu yang terbaik', 'karya jenius stanley kubrick full metal jacket film perang berskala jarang film perang kualitas film film perang vietnam membanjiri bioskop era full metal jacket film anti perang mengesankan kesalahannya film salah terbaik', 'karya jenius stanley kubrick full metal jacket film perang skala jarang film perang kualitas film film perang vietnam banjir bioskop era full metal jacket film anti perang kesan salah film salah baik'),
(38, 55, 'sebagai sebuah film kecil untuk ukuran sebuah fiksi ilmiah gattaca jelas menyimpan segudang potensi luar biasa yang berhasil diterjemahkan dengan sangat baik dan cantik oleh andrew niccol tidak hanya menjadi sebuah sajian fiksi ilmiah yang sarat dengan teknologi-teknologi canggihnya namun gattaca juga sarat dengan pesan-pesan moral serta inspirasi yang kuat tentang perjuangan seorang manusia dalam mencapai cita-citanya', 'film ukuran fiksi ilmiah gattaca menyimpan segudang potensi berhasil diterjemahkan cantik andrew niccol sajian fiksi ilmiah sarat teknologi-teknologi canggihnya gattaca sarat pesan-pesan moral serta inspirasi kuat perjuangan manusia mencapai cita-citanya', 'film ukur fiksi ilmiah gattaca simpan gudang potensi hasil terjemah cantik andrew niccol saji fiksi ilmiah sarat teknologi canggih gattaca sarat pesan moral serta inspirasi kuat juang manusia capai cita'),
(39, 56, 'dengan cerita terbilang cukup berat dan dalam ini dibutuhkan sedikit kesabaran dan pemikiran lebih untuk menontonnya namun bukan berarti girl interrupted adalah film yang membosankan malah sebaliknya film ini mampu memberikan sebuah tontonan yang menarik dengan segala konflik-konflik didalamnya apalagi dengan dukungan akting yang luar biasa dari para aktrisnya', 'cerita terbilang berat dibutuhkan kesabaran pemikiran menontonnya girl interrupted film membosankan film tontonan menarik konflik-konflik didalamnya dukungan akting aktrisnya', 'cerita bilang berat butuh sabar pikir tonton girl interrupted film bosan film tonton tarik konflik dalam dukung akting aktris'),
(40, 57, 'gone girl tidak hanya menyajikan sebuah thriller kriminal paling solid dan paling rapi tahun ini tetapi yang mengejutkan adalah bagaimana ia bisa membuat si blonde cantik rosamund pike keluar dari zona nyamannya bertransformasi menjadi sesuatu yang sama sekali berbeda dari peran-perannya sebelumnya amy adalah karakter yang kompleks sama kompleksnya dengan kebanyakan karakter dalam film-film fincher untuk sebuah film tentang istri hilang tokoh pike malah bisa dibilang lebih mendominasi tidak hanya dengan aktingnya yang patut diganjar setidaknya nominasi oscar namun juga porsi secara keseluruhan', 'gone girl menyajikan thriller kriminal solid rapi mengejutkan si blonde cantik rosamund pike zona nyamannya bertransformasi berbeda peran-perannya amy karakter kompleks kompleksnya kebanyakan karakter film-film fincher film istri hilang tokoh pike dibilang mendominasi aktingnya patut diganjar nominasi oscar porsi', 'gone girl saji thriller kriminal solid rapi kejut si blonde cantik rosamund pike zona nyaman transformasi beda peran amy karakter kompleks kompleks banyak karakter film fincher film istri hilang tokoh pike bilang dominasi akting patut ganjar nominasi oscar porsi'),
(41, 58, 'sudah selayaknya sebuah trilogi hebat ditutup pula dengan kisah yang hebat dan pun berhasil menjadi akhir kisah manis dari trilogi patah hati yang berjarak tahun ini melalui ini sekali lagi wong kar wai membuktikan bahwa ia adalah sutradara luar biasa yang selalu berhasil menghasilkan karya-karya seninya yang indah unik dan sangat berkesan bagi para penggemarnya', 'selayaknya trilogi hebat ditutup kisah hebat berhasil kisah manis trilogi patah hati berjarak kar wai membuktikan sutradara berhasil menghasilkan karya-karya seninya indah unik berkesan penggemarnya', 'layak trilogi hebat tutup kisah hebat hasil kisah manis trilogi patah hati jarak kar wai bukti sutradara hasil hasil karya seni indah unik kesan gemar'),
(42, 59, 'satu hal lain yang menonjol dalam  cloverfield lane selain kualitas narasi dan penyutradaraan yang menyimpang adalah casting yang sempurna ia hanya punya tiga orang pemain utama dan semua bermain fantastis kudos terutama patut diberikan kepada aktor senior john goodman dalam salah satu penampilan terbaiknya berperan sebagai howard sang penyelamat goodman bisa menghadirkan sebuah kompleksitas karakter yang menarik', 'menonjol  cloverfield lane kualitas narasi penyutradaraan menyimpang casting sempurna orang pemain utama bermain fantastis kudos patut aktor senior john goodman salah penampilan terbaiknya berperan howard sang penyelamat goodman menghadirkan kompleksitas karakter menarik', 'tonjol  cloverfield lane kualitas narasi sutradara simpang casting sempurna orang main utama main fantastis kudos patut aktor senior john goodman salah tampil baik peran howard sang selamat goodman hadir kompleksitas karakter tarik'),
(43, 60, 'dialog-dialog cerdas dan kekuatan akting prima dari para pemainnya yang memang menjadi senjata andalan film yang diadaptasi dari drama televisi tahun berjudul sama ini hanya dengan mendengar percakapan yang keluar dari mulut para pemainnya saja kita sudah diajak seakan-akan terlibat langsung menjadi juri ke dan juga ikut membayangkan kejadian-kejadian secara kronologis yang pada filmnya sendiri tidak pernah ditampilkan hasilnya adalah sebuah pengalaman menonton yang menyenangkan dimana banyak kejutan demi kejutan menarik bermunculan sepanjang menit film berlangsung', 'dialog-dialog cerdas kekuatan akting prima pemainnya senjata andalan film diadaptasi drama televisi berjudul mendengar percakapan mulut pemainnya diajak seakan-akan terlibat langsung juri membayangkan kejadian-kejadian kronologis filmnya ditampilkan hasilnya pengalaman menonton menyenangkan dimana kejutan kejutan menarik bermunculan menit film', 'dialog cerdas kuat akting prima main senjata andal film adaptasi drama televisi judul dengar cakap mulut main ajak akan libat langsung juri bayang kejadian kronologis film tampil hasil alam tonton senang mana kejut kejut tarik muncul menit film'),
(44, 61, 'tidak hanya menawarkan perjalanan seorang budak yang menjadi bagian sejarah suram dengan segala momen kebrutalannya mcqueen juga tahu bagaimana menghadirkan sisi lain yang bermain dengan rasa ironi dan situasi dilematis hebat yang menghinggapi setiap karakter termasuk karakter majikan kulit putih di mana seperti manusia tidak semuanya digambarkan jahat sayang mereka terjebak dalam situasi serba salah bahkan yang jahat pun tidak lepas dari beban moral ketika harus menyiksa budak yang diam-diam disukainya dan segala kegalauan hebat itu berhasil dibawakan apik oleh para pemainnya', 'menawarkan perjalanan budak sejarah suram momen kebrutalannya mcqueen menghadirkan sisi bermain ironi situasi dilematis hebat menghinggapi karakter karakter majikan kulit putih manusia digambarkan jahat sayang terjebak situasi serba salah jahat lepas beban moral menyiksa budak diam-diam disukainya kegalauan hebat berhasil dibawakan apik pemainnya', 'tawar jalan budak sejarah suram momen brutal mcqueen hadir sisi main ironi situasi dilematis hebat hinggap karakter karakter majikan kulit putih manusia gambar jahat sayang jebak situasi serba salah jahat lepas beban moral siksa budak diam suka galau hebat hasil bawa apik main'),
(45, 62, 'di tahun  ini film  assassin mempunyai adegan pertarungan paling epik yang pernah saya tonton tensi pertarungannya benar-benar terjaga mengingatkan saya pada film jadul samurai seven karya master akira kurosawa hampir semua karakternya mempunyai chemistry yang sama akan tetapi sayangnya skenario film ini tidak terlalu menonjol untuk ukuran film samurai setelah selesai menonton saya sendiri merasa agak ada yang kurang di film ini sebagai seorang sutradara predikat cult takashi miike sudah berhasil mengembalikan jiwa film-film samurai yang telah lama hilang lewat  assassins sudah sepantasnya film ini masuk ke jajaran film samurai terbaik sepanjang masa', ' film  assassin adegan pertarungan epik tonton tensi pertarungannya benar-benar terjaga film jadul samurai seven karya master akira kurosawa karakternya chemistry sayangnya skenario film menonjol ukuran film samurai selesai menonton film sutradara predikat cult takashi miike berhasil mengembalikan jiwa film-film samurai hilang  assassins film masuk jajaran film samurai terbaik', ' film  assassin adegan tarung epik tonton tensi tarung benar jaga film jadul samurai seven karya master akira kurosawa karakter chemistry sayang skenario film tonjol ukur film samurai selesai tonton film sutradara predikat cult takashi miike hasil kembali jiwa film samurai hilang  assassins film masuk jajar film samurai baik'),
(46, 63, ' a space odyssey adalah salah satu film terbaik yang pernah dibuat dalam sejarah manusia sebuah film yang lebih tepat disebut maha karya seni sebuah art cosmic dari seorang stanley kubrick seorang sutradara dengan ide-ide jenius yang berhasil mengubah cara pandang kita menonton sebuah film', ' a space odyssey salah film terbaik sejarah manusia film maha karya seni art cosmic stanley kubrick sutradara ide-ide jenius berhasil mengubah pandang menonton film', ' a space odyssey salah film baik sejarah manusia film maha karya seni art cosmic stanley kubrick sutradara ide jenius hasil ubah pandang tonton film'),
(47, 64, ' hari untuk selamanya jelas merupakan salah satu film indonesia terbaik sepanjang masa versi saya dan melalui film ini sekali lagi duet mira lesmana dan riri riza membuktikan bahwa mereka adalah film maker terbaik bangsa ini yang berani menghasilkan karya-karya fresh dan berkualitas tanpa harus terjebak dalam komersialisme belaka', ' salah film indonesia terbaik versi film duet mira lesmana riri riza membuktikan film maker terbaik bangsa berani menghasilkan karya-karya fresh berkualitas terjebak komersialisme belaka', ' salah film indonesia baik versi film duet mira lesmana riri riza bukti film maker baik bangsa berani hasil karya fresh kualitas jebak komersialisme belaka'),
(48, 65, 'di separuh awalnya nafas likas begitu terasa personal narasinya yang mengalir baik dalam balutan visual-visual cantik kamera hani pradigya membawa penonton ke masa kecil likas melihat kesederhanaan hidupnya mengulik pribadinya yang cerdas sekaligus keras dalam halnya mencoba menembus batasan adat dan budaya patriarki karo yang kental', 'separuh nafas likas personal narasinya mengalir balutan visual-visual cantik kamera hani pradigya membawa penonton likas kesederhanaan hidupnya mengulik pribadinya cerdas keras halnya mencoba menembus batasan adat budaya patriarki karo kental', 'paruh nafas likas personal narasi alir balut visual cantik kamera hani pradigya bawa tonton likas sederhana hidup ulik pribadi cerdas keras hal coba tembus batas adat budaya patriark karo kental'),
(49, 66, ' dengan balutan animasi pencahayaan super detail dan sinematografi yang super indah serta iringan musik penuh emosi dari tenmon kisah percintaan dua manusia yang terpisahkan oleh jarak dan waktu ini digambarkan secara realistis tidak ada unsur-unsur fantasi ataupun petualangan-petualangan seru yang melibatkan monster-monster dan kisah-kisah kepahlawanan semuanya digambarkan layaknya seperti kehidupan percintaan remaja jepang dengan segala suka dukanya ', ' balutan animasi pencahayaan super detail sinematografi super indah serta iringan musik penuh emosi tenmon kisah percintaan manusia terpisahkan jarak digambarkan realistis unsur-unsur fantasi petualangan-petualangan seru melibatkan monster-monster kisah-kisah kepahlawanan digambarkan layaknya kehidupan percintaan remaja jepang suka dukanya ', ' balut animasi cahaya super detail sinematografi super indah serta iring musik penuh emosi tenmon kisah cinta manusia pisah jarak gambar realistis unsur fantasi petualangan seru libat monster kisah pahlawan gambar layak hidup cinta remaja jepang suka duka ');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(50, 67, 'kredit plus juga pantas diberikan oleh kedua pemain utamanya baik joseph gordon levitt maupun zooey deschanel tampaknya benar-benar sangat menikmati peran mereka disini sebagai pasangan ttm yang serasi menyenangkan memang melihat bagaimana kedua karakter ini berinteraksi satu sama lain apalagi dengan chemistry yang dibangun dengan sangat kuat walaupun bukan akting terbaik dari keduanya namun tetap saja kedua aktor-aktris ini mampu memesona penontonnya aroma indie juga tampak pada soundrack yang keren dan emosional jangan terlalu percaya dengan narasi richard mcgonagle yang mengatakan bahwa days of summer bukanlah sebuah kisah cinta malahan bisa dibilang film ini adalah salah satu cerita cinta terbaik dan terkeren yang pernah dibuat oleh perfilman modern saat ini', 'kredit plus pemain utamanya joseph gordon levitt zooey deschanel benar-benar menikmati peran pasangan ttm serasi menyenangkan karakter berinteraksi chemistry dibangun kuat akting terbaik aktor-aktris memesona penontonnya aroma indie soundrack keren emosional percaya narasi richard mcgonagle days of summer kisah cinta dibilang film salah cerita cinta terbaik terkeren perfilman modern', 'kredit plus main utama joseph gordon levitt zooey deschanel benar nikmat peran pasang ttm serasi senang karakter interaksi chemistry bangun kuat akting baik aktor aktris pesona tonton aroma indie soundrack keren emosional percaya narasi richard mcgonagle days of summer kisah cinta bilang film salah cerita cinta baik keren film modern'),
(51, 68, 'tidak ada soundtrack atau scoring sama sekali disini sepertinya daniel grou sengaja membungkus penontonnya dalam kesunyian dengan tujuan agar penontonnya lebih dapat merasakan bagaimana terasa realistisnya ketegangan dan atmosfer kelam nan dingin yang dibangun sepanjang menit ini dan semuanya terasa lengkap ketika para pemerannya bermain dengan sangat baik', 'soundtrack scoring daniel grou sengaja membungkus penontonnya kesunyian tujuan penontonnya merasakan realistisnya ketegangan atmosfer kelam nan dingin dibangun menit lengkap pemerannya bermain', 'soundtrack scoring daniel grou sengaja bungkus tonton sunyi tuju tonton rasa realistis tegang atmosfer kelam nan dingin bangun menit lengkap peran main'),
(52, 69, 'simpel namun padat berisi dengan segala filosofi hidup tanpa harus terkesan berdakwah membumi dengan segala kesederhanaan bertutur dalam balutan teknis solid dan juga sentimentil tanpa harus jatuh menjadi tontonan cengeng nan mendayu-dayu', 'simpel padat berisi filosofi hidup terkesan berdakwah membumi kesederhanaan balutan teknis solid sentimentil jatuh tontonan cengeng nan mendayu-dayu', 'simpel padat isi filosofi hidup kesan dakwah bumi sederhana balut teknis solid sentimentil jatuh tonton cengeng nan dayu'),
(53, 70, 'apa yang terjadi di a copy of my mind adalah murni sebuah observasi langsung kepada para karakternya seperti tidak ada jarak yang memisahkan antara setiap tokoh dengan penontonnya satu hal yang menonjol adalah teknisnya kamera dari ical tanjung seperti begitu setia tidak hanya menguntit sara dan alex dari belakang namun bagaimana juga ia menangkap sisi lain kota metropolitan yang kumuh sesak bising dan suram dalam balutan visual yang kasar dan mentah termasuk di dalamnya departemen penata suara yang jempolan', 'a copy of my mind murni observasi langsung karakternya jarak memisahkan tokoh penontonnya menonjol teknisnya kamera ical tanjung setia menguntit sara alex menangkap sisi kota metropolitan kumuh sesak bising suram balutan visual kasar mentah dalamnya departemen penata suara jempolan', 'a copy of my mind murni observasi langsung karakter jarak pisah tokoh tonton tonjol teknis kamera ical tanjung setia kuntit sara alex tangkap sisi kota metropolitan kumuh sesak bising suram balut visual kasar mentah dalam departemen tata suara jempol'),
(54, 71, 'plotnya sendiri berjalan lambat seperti kebanyakan drama arthouse namun jung juga membuatnya begitu memesona ketika ia mampu membungkusnya dengan kelembutan sekaligus aroma depresi yang begitu kuat bersama kekuatan akting bae doona dan kim sae-ron yang memikat mampu menggerakkan naskahnya yang berisi pesan-pesan ambigu yang bernada provokatif', 'plotnya berjalan lambat kebanyakan drama arthouse jung membuatnya memesona membungkusnya kelembutan aroma depresi kuat kekuatan akting bae doona kim sae-ron memikat menggerakkan naskahnya berisi pesan-pesan ambigu bernada provokatif', 'plot jalan lambat banyak drama arthouse jung buat pesona bungkus lembut aroma depresi kuat kuat akting bae doona kim sae ron mikat gerak naskah isi pesan ambigu nada provokatif'),
(55, 72, 'lee tahu bagaimana membuat sebuah drama romantis indah dengan balutan visualnya yang cantik plus dukungan musik latar klasik yang mendayu-dayu apalagi alih-alih menggunakan kematian sebagai konflik utama pengaduk-aduk emosi a moment to remember lebih memilih alzheimer yang bisa secara perlahan namun pasti menyiksa penontonnya hati siapa yang tidak terenyuh melihat kondisi kim su jin ya pelan namun pasti ia mulai melupakan orang-orang yang dicintainya khususnya cheol su suaminya keberhasilan a moment to remember menyentuh penontonnya juga tidak lepas dari kekuatan chemistry yang dihasilkan son ye jin dan jung woo sung dalam membawakan karakter mereka masing-masing keduanya benar-benar pas dipasangkan satu sama lain', 'lee drama romantis indah balutan visualnya cantik plus dukungan musik latar klasik mendayu-dayu alih-alih kematian konflik utama pengaduk-aduk emosi a moment to remember memilih alzheimer perlahan menyiksa penontonnya hati terenyuh kondisi kim su jin ya pelan melupakan orang-orang dicintainya cheol su suaminya keberhasilan a moment to remember menyentuh penontonnya lepas kekuatan chemistry dihasilkan son ye jin jung woo sung membawakan karakter benar-benar pas dipasangkan', 'lee drama romantis indah balut visual cantik plus dukung musik latar klasik dayu alih mati konflik utama aduk emosi a moment to remember pilih alzheimer perlahan siksa tonton hati terenyuh kondisi kim su jin ya pelan lupa orang cinta cheol su suami keberhasilan a moment to remember sentuh tonton lepas kuat chemistry hasil son ye jin jung woo sung bawa karakter benar pas pasang'),
(56, 73, 'relasi tak biasa antara sosok monster dan conor tentu menjadi pusat gravitasi buat a monster calls melihat bagaimana kombinasi penyutradaraan lembut bayona dan patrick ness yang ditunjuk untuk mengurus naskahnya mampu bersinergi dengan sempurna dalam usahanya mengeksplorasi sisi terdalam sang bocah dalam menghadapi problematikanya yang diwakili melalui dongeng-dongeng depresif yang diceritakan si monster pohon setiap cerita divisualisasikan oleh presentasi cantik animasi stop motion dengan sentuhan gaya cat air penuh imajinasi setiap cerita punya pesan-pesan kuat yang merepresentasikan kehidupan conor', 'relasi sosok monster conor pusat gravitasi a monster calls kombinasi penyutradaraan lembut bayona patrick ness mengurus naskahnya bersinergi sempurna usahanya mengeksplorasi sisi terdalam sang bocah menghadapi problematikanya diwakili dongeng-dongeng depresif diceritakan si monster pohon cerita divisualisasikan presentasi cantik animasi stop motion sentuhan gaya cat air penuh imajinasi cerita pesan-pesan kuat merepresentasikan kehidupan conor', 'relasi sosok monster conor pusat gravitasi a monster calls kombinasi sutradara lembut bayona patrick ness urus naskah sinergi sempurna usaha eksplorasi sisi dalam sang bocah hadap problematikanya wakil dongeng depresif cerita si monster pohon cerita visualisasi presentasi cantik animasi stop motion sentuh gaya cat air penuh imajinasi cerita pesan kuat representasi hidup conor'),
(57, 74, 'dibuka dan diakhiri dengan luar biasa itulah a separation sebuah drama tentang perpisahan dalam sebuah keluarga menengah iran yang juga membahas arti lain dari nilai-nilai kejujuran yang mampu berjalan berdampingan dengan manisnya elemen-elemen agama moralitas sosial bahkan court room drama sekalipun tanpa harus berat sebelah tanpa terlihat overdramatis ya semuanya itu disajikan dengan naskah dan penyutradaraan brilian oleh asghar farhadi menjadikan a separation masterpiece dari sutradara asal iran itu dan salah satu yang terbaik tahun ini', 'dibuka a separation drama perpisahan keluarga menengah iran membahas arti nilai-nilai kejujuran berjalan berdampingan manisnya elemen-elemen agama moralitas sosial court room drama berat sebelah overdramatis ya disajikan naskah penyutradaraan brilian asghar farhadi menjadikan a separation masterpiece sutradara iran salah terbaik', 'buka a separation drama pisah keluarga tengah iran bahas arti nilai jujuran jalan damping manis elemen agama moralitas sosial court room drama berat sebelah overdramatis ya saji naskah sutradara brilian asghar farhadi jadi a separation masterpiece sutradara iran salah baik'),
(58, 75, 'a stranger of mine jelas akan terdengar asing maklum saja film kecil satu ini memang jauh dari hingar-bingar dan promosi besar-besaran lihat saja di situs sebesar imdb pun tidak banyak user yang mengulasnya tapi jangan salah anda mungkin akan sepakat dengan saya untuk mengatakan bahwa kenji uchida adalah seorang jenius', 'a stranger of mine terdengar asing maklum film hingar-bingar promosi besar-besaran lihat situs imdb user mengulasnya salah sepakat kenji uchida jenius', 'a stranger of mine dengar asing maklum film hingar bingar promosi besar lihat situs imdb user ulas salah sepakat kenji uchida jenius'),
(59, 76, 'ini memang tipe film yang mengajak anda menanggalkan segala kewarasan anda sembari menertawakan segala kebodohan cerita dan tingkah laku karakternya dan jika anda merasa adegan harold dan kumar berganja ria dengan george w bush sudah cukup sinting maka bersiaplah karena a very harold kumar d christmas akan memberikan anda lebih banyak lagi kehebohan dan seperti yang tertera pada judulnya semua kegilaan itu terbungkus dalam balutan d yang tidak disangka mampu digarap dengan baik', 'tipe film mengajak menanggalkan kewarasan sembari menertawakan kebodohan cerita tingkah laku karakternya adegan harold kumar berganja ria george w bush sinting bersiaplah a very harold kumar d christmas kehebohan tertera judulnya kegilaan terbungkus balutan d disangka digarap', 'tipe film ajak tanggal waras sembari tertawa bodoh cerita tingkah laku karakter adegan harold kumar ganja ria george w bush sinting siap a very harold kumar d christmas heboh tera judul gila bungkus balut d sangka garap'),
(60, 77, 'ya niat adalah kunci mengapa afflicted berhasil menjadi tontonan mocku horor yang asyik dengan hanya bekal dua kamera budget mini dan kreativitas tingkat tinggi yang mencakup sinematografi cantik dan pergerakan kamera gila-gilaan apa yang terjadi di sepanjang menit durasinya seperti campuran keseruan dalam chronicle dan ketegangan ala an american werewolf in london', 'ya niat kunci afflicted berhasil tontonan mocku horor asyik bekal kamera budget mini kreativitas tingkat mencakup sinematografi cantik pergerakan kamera gila-gilaan menit durasinya campuran keseruan chronicle ketegangan ala an american werewolf in london', 'ya niat kunci afflicted hasil tonton mocku horor asyik bekal kamera budget mini kreativitas tingkat cakup sinematografi cantik gera kamera gila menit durasi campur seru chronicle tegang ala an american werewolf in london'),
(61, 78, 'memang ending film ini mudah ditebak bahkan jauh sebelum film ini berakhir namun bagaimana proses menuju akhir itu yang menjadi bagian terpenting dan aftershock bisa terbilang sukses menggambarkan perjalanan tersebut dengan cukup baik', 'ending film mudah ditebak film proses terpenting aftershock terbilang sukses menggambarkan perjalanan', 'ending film mudah tebak film proses penting aftershock bilang sukses gambar jalan'),
(62, 79, 'harus diakui plot yang dihadirkan masih terasa kurang dalam dan terkesan terburu-buru dalam penyajiannya sepertinya amenbar terlalu memfokuskan kisahnya kepada konflik-konflik agama saja tanpa terlalu banyak menggali kisah hypatia untung saja kelemahan-kelemahan tersebut masih bisa ditutupi oleh bagaimana indahnya amenbar manyajikan setting kota alexandria dengan sinematografi yang apik dan detail-detail yang memukau dan juga tidak ketinggalan penampilan apik dari seorang rachel weisz dalam memerankan sosok hypatia', 'diakui plot dihadirkan terkesan terburu-buru penyajiannya amenbar memfokuskan kisahnya konflik-konflik agama menggali kisah hypatia untung kelemahan-kelemahan ditutupi indahnya amenbar manyajikan setting kota alexandria sinematografi apik detail-detail memukau ketinggalan penampilan apik rachel weisz memerankan sosok hypatia', 'aku plot hadir kesan buru saji amenbar fokus kisah konflik agama gali kisah hypatia untung kelemahan tutup indah amenbar manyajikan setting kota alexandria sinematografi apik detail pukau tinggal tampil apik rachel weisz peran sosok hypatia'),
(63, 80, 'ini bukan cerita tentang boneka yang menjadi manusia sosok nazomi sebenarnya tetap adalah sebuah boneka karet kosong yang hanya berisi angin namun yang menjadi menarik adalah bagaimana proses ia berinteraksi dengan lingkungannya yang tidak jarang membuat penonton tertawa dan juga sedih dengan segala tingkah lakunya bahkan adegan klimaksnya pun cukup mengejutkan air doll adalah sebuah film yang menarik dan indah tentang kesepian kehampaan dan bagaimana pentingnya kehadiran orang lain dalam kehidupan kita', 'cerita boneka manusia sosok nazomi boneka karet kosong berisi angin menarik proses berinteraksi lingkungannya jarang penonton tertawa sedih tingkah lakunya adegan klimaksnya mengejutkan air doll film menarik indah kesepian kehampaan kehadiran orang kehidupan', 'cerita boneka manusia sosok nazomi boneka karet kosong isi angin tarik proses interaksi lingkung jarang tonton tertawa sedih tingkah laku adegan klimaks kejut air doll film tarik indah sepi hampa hadir orang hidup'),
(64, 81, 'ada pesan kuat tentang seberapa besarnya daya tahan dan kesabaran manusia di tengah sebuah cobaan maha dahsyat tetapi tidak hanya karakter redford yang diuji kesabaran penontonnya pun juga karena seperti yang saya bilang barusan ini bukan film yang mudah ditonton tone kesepiannya bisa saja akan sangat menyiksa sebagian penontonnya karena di sepanjang kurang lebih menit durasinya kita hanya bisa duduk diam menjadi saksi bagaimana karakter redford tanpa dialog bertindak tanduk', 'pesan kuat besarnya daya tahan kesabaran manusia cobaan maha dahsyat karakter redford diuji kesabaran penontonnya bilang barusan film mudah ditonton tone kesepiannya menyiksa penontonnya menit durasinya duduk diam saksi karakter redford dialog bertindak tanduk', 'pesan kuat besar daya tahan sabar manusia coba maha dahsyat karakter redford uji sabar tonton bilang barusan film mudah tonton tone sepi siksa tonton menit durasi duduk diam saksi karakter redford dialog tindak tanduk'),
(65, 82, 'lihat set lihat kostum lihat tata riasnya orussell punya semua dukungan material teknis kelas oscar di sini semuanya aroma itu berhasil melebur di bawah penyutradaraan enerjik orussell lengkap dengan segala editing cepat tracking shot soundtrack retro yang asyik dan tentu saja para pemainnya', 'lihat set lihat kostum lihat tata riasnya orussell dukungan material teknis kelas oscar aroma berhasil melebur penyutradaraan enerjik orussell lengkap editing cepat tracking shot soundtrack retro asyik pemainnya', 'lihat set lihat kostum lihat tata rias orussell dukung material teknis kelas oscar aroma hasil lebur sutradara enerjik orussell lengkap editing cepat tracking shot soundtrack retro asyik main'),
(66, 83, 'eastwood begitu baik hati sampai memberikan karakter fiktif yang tidak kalah jagonya dalam menembak dari pihak lawan spesial untuk membuat pertarungan antar sniper menjadi semakin seru meskipun ujung-ujungnya terasa dipaksakan sementara pertempuran lain yang melibatkan batin dan mental serta keluarga harus diakui masih kurang dijelajahi eastwood dengan sempurna kedua bagian ini seperti dua film berbeda yang tidak mampu menyatu dengan mulus jangan salahkan bradley cooper yang sudah tampil cukup baik ketika harus membagi perannya yang kompleks itu salahkan eastwood yang tidak memaksimalkan dramanya dengan baik termasuk studi karakter kyle yang terasa sedikit jomplang di antara dua dunia berbeda', 'eastwood hati karakter fiktif kalah jagonya menembak lawan spesial pertarungan sniper seru ujung-ujungnya dipaksakan pertempuran melibatkan batin mental serta keluarga diakui dijelajahi eastwood sempurna film berbeda menyatu mulus salahkan bradley cooper tampil membagi perannya kompleks salahkan eastwood memaksimalkan dramanya studi karakter kyle jomplang dunia berbeda', 'eastwood hati karakter fiktif kalah jago tembak lawan spesial tarung sniper seru ujung paksa tempur libat batin mental serta keluarga aku jelajah eastwood sempurna film beda satu mulus salah bradley cooper tampil bagi peran kompleks salah eastwood maksimal drama studi karakter kyle jomplang dunia beda'),
(67, 84, 'ada banyak sisi personal dan kehangatan dari seorang hanake di dalamnya yang dituangkan buat istri tercintanya mungkin ini adalah karya hanake paling lembut dibandingkan yang lainnya meskipun ada sedikit kekejaman rasa takut dan kecemasan di dalamnya tetapi kita tahu bahwa semuanya sekali lagi ditujukan untuk merayakan apa yang kamu sebut dengan cinta', 'sisi personal kehangatan hanake dalamnya dituangkan istri tercintanya karya hanake lembut dibandingkan kekejaman takut kecemasan dalamnya merayakan cinta', 'sisi personal hangat hanake dalam tuang istri cinta karya hanake lembut banding kejam takut cemas dalam raya cinta'),
(68, 85, 'pendekatan intim yang dilakukan kapadia di dua pertiga filmnya menghasilkan ragam lecutan emosi buat penontonnya ada kegembiraan ketika melihat amy senang ketika melihatnya tampil membawakan lagu-lagunya kemudian ada rasa getir iba dan sedih bahkan sedikit kecewa ketika melihatnya jatuh dan tidak belajar dari kesalahannya namun tentu saja tidak ada yang mengalahkan sensasi heartbreaking luar biasa ketika kapadia menutupnya dengan momen puncak menggetarkan yang sama-sama kita ketahui akhirnya', 'pendekatan intim kapadia pertiga filmnya menghasilkan ragam lecutan emosi penontonnya kegembiraan amy senang tampil membawakan lagu-lagunya getir iba sedih kecewa jatuh belajar kesalahannya mengalahkan sensasi heartbreaking kapadia menutupnya momen puncak menggetarkan ketahui', 'dekat intim kapadia tiga film hasil ragam lecut emosi tonton gembira amy senang tampil bawa lagu getir iba sedih kecewa jatuh ajar salah kalah sensasi heartbreaking kapadia tutup momen puncak getar tahu'),
(69, 86, 'senang rasanya melihat bagaimana seorang aktor seperti ben affleck bisa berkembang sehebat ini sebagai seorang filmmaker dari thriller kecil yang mengesankan lalu lihatlah sekarang argo bisa dibilang pencapaian terbaik affleck sejauh ini sebuah thriller politik yang cerdas dan mendebarkan sebuah tontonan berkelas dari anak kemarin sore salah satu yang terbaik tahun ini', 'senang aktor ben affleck berkembang sehebat filmmaker thriller mengesankan lihatlah argo dibilang pencapaian terbaik affleck thriller politik cerdas mendebarkan tontonan berkelas anak kemarin sore salah terbaik', 'senang aktor ben affleck kembang hebat filmmaker thriller kesan lihat argo bilang capai baik affleck thriller politik cerdas debar tonton kelas anak kemarin sore salah baik'),
(70, 87, 'naskah yang berani dari ethan kruger dan suspense yang terjaga rapi menjadi kekuatan terbesar arlington road selain penampilan menawan jeff bridges dan tim robbis ini adalah suguhan thriller apik nan menantang yang akan membuatmu tetap terjaga sampai akhir bersama rentetan misterinya yang mengasyikkan sampai kemudian ia menamparmu keras dengan penutup yang luar biasa', 'naskah berani ethan kruger suspense terjaga rapi kekuatan terbesar arlington road penampilan menawan jeff bridges tim robbis suguhan thriller apik nan menantang membuatmu terjaga rentetan misterinya mengasyikkan menamparmu keras penutup', 'naskah berani ethan kruger suspense jaga rapi kuat besar arlington road tampil tawan jeff bridges tim robbis suguh thriller apik nan tantang buat jaga rentet misteri asyik tampar keras tutup'),
