(72, 89, 'dari streep sampai cumberbatch semua tampil cemerlang streep lagi-lagi tampil gemilang membawakan karakter penyakitan baik secara fisik maupun mental streep nyaris sempurna menguasai panggung dan semua momen dengan karakternya yang menyebalkan karakter yang menyerang siapa saja sebagai imbas dari rasa depresi atas penyakitnya termasuk putri-putrinya sendiri tidak heran jika nantinya ia kembali dinominasikan lagi di ajang oscar nanti sementara lawan mainnya ada julia roberts yang juga tampil bagus sebagai putri kesayangan yang berkarakter kuat', 'streep cumberbatch tampil cemerlang streep lagi-lagi tampil gemilang membawakan karakter penyakitan fisik mental streep sempurna menguasai panggung momen karakternya menyebalkan karakter menyerang imbas depresi penyakitnya putri-putrinya heran dinominasikan ajang oscar lawan mainnya julia roberts tampil bagus putri kesayangan berkarakter kuat', 'streep cumberbatch tampil cemerlang streep lagi tampil gemilang bawa karakter sakit fisik mental streep sempurna kuasa panggung momen karakter sebal karakter serang imbas depresi sakit putri heran nominasi ajang oscar lawan main julia roberts tampil bagus putri sayang karakter kuat'),
(73, 90, 'scoring musik yang dinamis dan menghanyutkan dari michael stearns yang setia mengiringi film sepanjang menit walaupun secara teknis film ini tanpa cerita melalui gambar-gambar yang ditampilkannya baraka mampu menyampaikan pesan non verbalnya secara efektif', 'scoring musik dinamis menghanyutkan michael stearns setia mengiringi film menit teknis film cerita gambar-gambar ditampilkannya baraka pesan non verbalnya efektif', 'scoring musik dinamis hanyut michael stearns setia iring film menit teknis film cerita gambar tampil baraka pesan non verbal efektif'),
(74, 91, 'baran memang tidak terlalu menampilkan banyak dialog malah karakter baran sendiri sama sekali tidak memiliki dialog dari awal hingga akhir dan hal tersebut yang membuat film ini menjadi terasa istimewa karena mampu secara langsung menyentuh emosi penontonnya hanya dengan melihat tingkah laku dan tatapan mata lateef dan baran perbedaan budaya yang menjadi tembok tidak terlihat juga mampu dieksplorasi dengan baik oleh majidi pendewasaan dan pencarian jati diri seorang lateef juga menjadi bagian paling menarik dalam film berdurasi menit ini', 'baran menampilkan dialog karakter baran memiliki dialog film istimewa langsung menyentuh emosi penontonnya tingkah laku tatapan mata lateef baran perbedaan budaya tembok dieksplorasi majidi pendewasaan pencarian jati lateef menarik film berdurasi menit', 'baran tampil dialog karakter baran milik dialog film istimewa langsung sentuh emosi tonton tingkah laku tatap mata lateef baran beda budaya tembok eksplorasi majidi dewasa cari jati lateef tarik film durasi menit'),
(75, 92, 'sebuah drama cinta berbalut elemen fantasi menyentuh yang dijamin akan meninggalkan kesan mendalam di setiap hati penontonnya apalagi be with you ternyata mampu keluar dari formula klise drama-drama tearjerker asia lainnya yang hanya menampilkan cerita dan konflik yang itu-itu saja', 'drama cinta berbalut elemen fantasi menyentuh dijamin meninggalkan kesan mendalam hati penontonnya be with you formula klise drama-drama tearjerker asia menampilkan cerita konflik itu-itu', 'drama cinta balut elemen fantasi sentuh jamin tinggal kesan dalam hati tonton be with you formula klise drama tearjerker asia tampil cerita konflik itu'),
(76, 93, 'beast of the southern wild seperti sebuah dongeng distopia modern rumit yang punya orisinalitas keceriaan semangat hidup luar biasa dan akting-akting luar biasa di balik setting dan premis pasca kiamatnya yang suram dan kotor sebuah tontonan indie arthouse yang memberikan kita sebuah sentuhan emosional dengan cara sederhana yang tidak pernah kamu bayangkan sebelumnya', 'beast of the southern wild dongeng distopia modern rumit orisinalitas keceriaan semangat hidup akting-akting setting premis pasca kiamatnya suram kotor tontonan indie arthouse sentuhan emosional sederhana bayangkan', 'beast of the southern wild dongeng distopia modern rumit orisinalitas ceria semangat hidup akting setting premis pasca kiamat suram kotor tonton indie arthouse sentuh emosional sederhana bayang'),
(77, 94, 'linklater tahu benar bagaimana memanfaatkan dua seri sebelumnya sebagai pondasi kuat dalam membentuk midnight dan perjalanan karakternya hingga berada seperti yang kita lihat sekarang tetapi linklater tentu saja tidak berdaya tanpa duo maut hawk dan delpy yang meskipun mulai menua dan gendut khususnya delpy mereka tampak tidak pernah kehilangan keintiman dan spontanitas luar biasa yang sudah mereka bentuk di nyaris dua dekade ini', 'linklater memanfaatkan seri pondasi kuat membentuk midnight perjalanan karakternya lihat linklater berdaya duo maut hawk delpy menua gendut delpy kehilangan keintiman spontanitas bentuk dekade', 'linklater manfaat seri pondasi kuat bentuk midnight jalan karakter lihat linklater daya duo maut hawk delpy tua gendut delpy hilang intim spontanitas bentuk dekade'),
(78, 95, 'meskipun kalau mau jujur sebenarnya narasinya juga tidak sampai terlalu istimewa tetapi kekuatan sebenarnya bukan berada di naskahnya namun bagaimana penampilan total dua bintang utamanya yang fantastis dan tentu saja bagaimana soderbergh menghadirkan narasinya menjadi sebuah biopik intens yang menggambarkan gejolak asmara seks dan ketenaran serta sisi hitam dibalik setiap gemerlapnya candelabra', 'jujur narasinya istimewa kekuatan naskahnya penampilan total bintang utamanya fantastis soderbergh menghadirkan narasinya biopik intens menggambarkan gejolak asmara seks ketenaran serta sisi hitam dibalik gemerlapnya candelabra', 'jujur narasi istimewa kuat naskah tampil total bintang utama fantastis soderbergh hadir narasi biopik intens gambar gejolak asmara seks tenar serta sisi hitam balik gemerlap candelabra'),
(79, 96, 'bernie mungkin tidak terlalu serius namun di balik segala komedi-komedi hitamnya yang aneh dan presentasinya yang unik ada pesan tentang sebuah dilema moral dan ambiguitas besar tentang arti sebuah kebaikan dan keadilan itu sendiri semuanya tergantung dari sisi mana kita memandangnya dan richard linklater dengan sangat lihai menghadirkan itu semua dalam kemasan yang santai menghibur dan juga berkelas ini jelas salah satu karya terbaik linklater dan salah satu film jack black yang paling bagus', 'bernie serius komedi-komedi hitamnya aneh presentasinya unik pesan dilema moral ambiguitas arti kebaikan keadilan tergantung sisi memandangnya richard linklater lihai menghadirkan kemasan santai menghibur berkelas salah karya terbaik linklater salah film jack black bagus', 'bernie serius komedi hitam aneh presentasi unik pesan dilema moral ambiguitas arti baik adil gantung sisi pandang richard linklater lihai hadir kemas santai hibur kelas salah karya baik linklater salah film jack black bagus'),
(80, 97, 'alurnya memang lambat presentasinya sederhana sunyi tanpa scoring mungkin berpotensi menjenuhkan buat sebagian penontonnya namun imbas dari kesederhanaannya bertutur menjadikan semuanya terasa natural dan sukses menghadirkan emosi tanpa harus berdramatis ria ya beyond the hills adalah sebuah drama kuat tentang cinta dan ketidak pedulian', 'alurnya lambat presentasinya sederhana sunyi scoring berpotensi menjenuhkan penontonnya imbas kesederhanaannya menjadikan natural sukses menghadirkan emosi berdramatis ria ya beyond the hills drama kuat cinta ketidak pedulian', 'alur lambat presentasi sederhana sunyi scoring potensi jenuh tonton imbas sederhana jadi natural sukses hadir emosi dramatis ria ya beyond the hills drama kuat cinta tidak peduli'),
