(88, 105, 'boogie nights bisa dibilang adalah salah satu karya terbaik paul thomas anderson dengan teknik penyajiannya yang baik dan unik anderson sukses menghadirkan kisah manusia-manusia yang tidak bahagia dan depresi di balik gemerlap dan popularitas dunia porno', 'boogie nights dibilang salah karya terbaik paul thomas anderson teknik penyajiannya unik anderson sukses menghadirkan kisah manusia-manusia bahagia depresi gemerlap popularitas dunia porno', 'boogie nights bilang salah karya baik paul thomas anderson teknik saji unik anderson sukses hadir kisah manusia bahagia depresi gemerlap popularitas dunia porno'),
(89, 106, 'linklater berhasil menghadirkan sebuah keintiman kuat yang nyata sesuatu yang tidak kamu dapati di film manapun ini seperti melihat langsung proses character building dengan melibatkan aroma kental trilogi before terutama dari feel dan pergerakan kameranya dan para pemain yang sama dari awal hingga akhir', 'linklater berhasil menghadirkan keintiman kuat nyata dapati film manapun langsung proses character building melibatkan aroma kental trilogi before feel pergerakan kameranya pemain', 'linklater hasil hadir intim kuat nyata dapat film mana langsung proses character building libat aroma kental trilogi before feel gera kamera main'),
(90, 107, 'tentu saja kunci keberhasilan breath menjadi sajian drama remaja depresif tidak hanya kepiawaian laurent mengolah naskah bersama kekuatan penyutradaraannya yang menghasilkan keintiman luar biasa dari dua karakter utamanya yang dimainkan fantastis oleh dua cast mudanya nada-nada lembut visual dari arnaud potier termasuk penggunaan teknik tracking shot bersama balutan scoring yang mampu menangkap kedekatan charlie dan sarah dengan sangat baik di paruh pertamanya dan terus secara konsisten sampai akhir', 'kunci keberhasilan breath sajian drama remaja depresif kepiawaian laurent mengolah naskah kekuatan penyutradaraannya menghasilkan keintiman karakter utamanya dimainkan fantastis cast mudanya nada-nada lembut visual arnaud potier penggunaan teknik tracking shot balutan scoring menangkap kedekatan charlie sarah paruh pertamanya konsisten', 'kunci keberhasilan breath saji drama remaja depresif piawai laurent mengolah naskah kuat sutradara hasil intim karakter utama main fantastis cast muda nada lembut visual arnaud potier guna teknik tracking shot balut scoring tangkap dekat charlie sarah paruh pertama konsisten'),
(91, 108, 'lee jeong ho seperti ingin menjadikan broken dekat dan membumi dengan keseharian penontonnya merasakan kesedihan dan kemarahan sampai ketakutan dari setiap karakternya dan harus diakui ia berhasil menuntaskan tugasnya dengan baik membentuk sebuah emosi spontan imbas dari keputusan dari tokoh-tokohnya yang bermain ciamik terutama jung jae young jeong ho membungkus setiap momen broken dengan tone kelam dan dingin yang menegaskan sebuah rasa putus asa dan amarah mendalam', 'lee jeong ho menjadikan broken membumi keseharian penontonnya merasakan kesedihan kemarahan ketakutan karakternya diakui berhasil menuntaskan tugasnya membentuk emosi spontan imbas keputusan tokoh-tokohnya bermain ciamik jung jae young jeong ho membungkus momen broken tone kelam dingin putus asa amarah mendalam', 'lee jeong ho jadi broken bumi keseharian tonton rasa sedih marah takut karakter aku hasil tuntas tugas bentuk emosi spontan imbas putus tokoh main ciamik jung jae young jeong ho bungkus momen broken tone kelam dingin putus asa amarah dalam'),
(92, 109, 'sutradara berkacamata moscot lemtosh ini selalu membuai penontonnya dengan dialog-dialog cerdas dan plot yang sederhana tapi mengena tak peduli seburuk apapun filmnya allen tetaplah allen yang jago menggulirkan kisah tentang hubungan manusia dan kerumitannya dengan gaya yang santai tapi mendalam dan caf society bukanlah pengecualian masih menggelar kisah kesukaan allen tentang cinta dan segala macam masalahnya caf society berhasil tampil cantik di mata dengan sokongan teknis yang apik latar belakang dekade dengan keglamoran hollywood berhasil disajikan tanpa cela oleh allen di layar pun begitu cerita dibawa ke big apple tata artistiknya tetap memanjakan indera penglihatan kita', 'sutradara berkacamata moscot lemtosh membuai penontonnya dialog-dialog cerdas plot sederhana mengena peduli seburuk apapun filmnya allen tetaplah allen jago menggulirkan kisah hubungan manusia kerumitannya gaya santai mendalam caf society pengecualian menggelar kisah kesukaan allen cinta caf society berhasil tampil cantik mata sokongan teknis apik latar dekade keglamoran hollywood berhasil disajikan cela allen layar cerita dibawa big apple tata artistiknya memanjakan indera penglihatan', 'sutradara kacamata moscot lemtosh buai tonton dialog cerdas plot sederhana kena peduli buruk apa film allen tetap allen jago gulir kisah hubung manusia kerumit gaya santai dalam caf society kecuali gelar kisah suka allen cinta caf society hasil tampil cantik mata sokong teknis apik latar dekade glamor hollywood hasil saji cela allen layar cerita bawa big apple tata artistik manja indera lihat'),
(93, 110, 'duo russo di luar dugaan tampil fantastis ketika harus mengemban tugas membawa captain america the winter soldier agar tampil sama besarnya dengan film marvel lain atau paling tidak lebih baik ketimbang seri pertamanya dan mereka melakukannya dengan sangat baik komposisi aksi ketegangan ledakan dan spesial efek berhasil ditampilkan berimbang dengan dramanya editing cepat dan taktis duel-duel berkoreografi jempolan dan momen-momen penuh hingar bingar semuanya tampil solid', 'duo russo dugaan tampil fantastis mengemban tugas membawa captain america the winter soldier tampil besarnya film marvel ketimbang seri pertamanya melakukannya komposisi aksi ketegangan ledakan spesial efek berhasil ditampilkan berimbang dramanya editing cepat taktis duel-duel berkoreografi jempolan momen-momen penuh hingar bingar tampil solid', 'duo russo duga tampil fantastis emban tugas bawa captain america the winter soldier tampil besar film marvel ketimbang seri pertama laku komposisi aksi tegang ledak spesial efek hasil tampil imbang drama editing cepat taktis duel koreografi jempol momen penuh hingar bingar tampil solid'),
(94, 111, 'puncaknya ada di ujung cerita ketika hanks secara emosional mengeluarkan seluruh kemampuannya untuk mewakili perasaan sang kapten selama proses penyanderaan dan dengan penampilan sebaik itu mungkin saja para juri academy akan meliriknya kali ini setidaknya peluang masuk nominasi sebagai pemeran utama terbaik terbuka lebar sementara lawan main hanks tidak kalah hebatnya dan apa yang dilakukan abdi adalah hal yang fantastis secara dengan meyakinkan ia sukses memberikan gambaran bagaimana tangguhnya para pembajak somalia dan di sisi lain ada kenaifan dan kesedihan tak terlihat dari setiap ucapan yang membuat penontonnya turut bersimpati dengan karakternya', 'puncaknya ujung cerita hanks emosional mengeluarkan kemampuannya mewakili perasaan sang kapten proses penyanderaan penampilan juri academy meliriknya kali peluang masuk nominasi pemeran utama terbaik terbuka lebar lawan main hanks kalah hebatnya abdi fantastis sukses gambaran tangguhnya pembajak somalia sisi kenaifan kesedihan ucapan penontonnya bersimpati karakternya', 'puncak ujung cerita hanks emosional luar mampu wakil asa sang kapten proses sandera tampil juri academy lirik kali peluang masuk nominasi peran utama baik buka lebar lawan main hanks kalah hebat abdi fantastis sukses gambar tangguh bajak somalia sisi naif sedih ucap tonton simpati karakter'),
(95, 112, 'sebagai sebuah drama komedi romantis coming of age the graduate jelas adalah salah satu yang terbaik bahkan hingga sekarang film ini banyak memberikan inspirasi kepada film-film romcom modern saat ini cerita tentang seorang pemuda lugu yang mencoba mencari jati diri dan cintanya ditampilkan dengan fantastis oleh seorang dustin hoffman', 'drama komedi romantis coming of age the graduate salah terbaik film inspirasi film-film romcom modern cerita pemuda lugu mencoba mencari jati cintanya ditampilkan fantastis dustin hoffman', 'drama komedi romantis coming of age the graduate salah baik film inspirasi film romcom modern cerita pemuda lugu coba cari jati cinta tampil fantastis dustin hoffman'),
(96, 113, 'cuaron melakukan pendekatan serealistis mungkin termasuk melakukan penelitian yang dalam untuk menciptakan sebuah pengalaman luar angkasa yang logis bahkan gravity banyak dipuji karena berhasil menghadirkan premis dan prinsip-prinsip fisika yang realistis termasuk semua pergerakan tanpa bobotnya yang mendominasi film untuk menghadirkan segalanya agar terlihat nyata cuarn bersama ahli visual efek tim webber membuatnya seteliti dan sedetail mungkin di studio framestore di london hasilnya bisa dilihat tanpa henti sejak adegan pembukaannya yang memesona sampai klimaksnya yang menggetarkan itu apalagi kemudian efek-efek ciamik ini dikombinasikan dengan sentuhan sinematografi brilian dengan kamera yang seperti tidak bisa berhenti bergerak dari sinematografer handal langganan cuaron dan terrence malick emmanuel lubezki scoring mendebarkan steven price sound editing jempolan dan tentu saja kepiawaian cuarn dalam mengolah setiap momennya yang semua campuran itu mampu menghasilkan efek jaw dropping yang pada akhirnya ditutup dengan ungkapan penuh ketakjuban', 'cuaron pendekatan serealistis penelitian menciptakan pengalaman angkasa logis gravity dipuji berhasil menghadirkan premis prinsip-prinsip fisika realistis pergerakan bobotnya mendominasi film menghadirkan nyata cuarn ahli visual efek tim webber membuatnya seteliti sedetail studio framestore london hasilnya henti adegan pembukaannya memesona klimaksnya menggetarkan efek-efek ciamik dikombinasikan sentuhan sinematografi brilian kamera berhenti bergerak sinematografer handal langganan cuaron terrence malick emmanuel lubezki scoring mendebarkan steven price sound editing jempolan kepiawaian cuarn mengolah momennya campuran menghasilkan efek jaw dropping ditutup ungkapan penuh ketakjuban', 'cuaron dekat realistis teliti cipta alam angkasa logis gravity puji hasil hadir premis prinsip fisika realistis gera bobot dominasi film hadir nyata cuarn ahli visual efek tim webber buat teliti detail studio framestore london hasil henti adegan buka pesona klimaks getar efek ciamik kombinasi sentuh sinematografi brilian kamera henti gerak sinematografer handal langgan cuaron terrence malick emmanuel lubezki scoring debar steven price sound editing jempol piawai cuarn mengolah momen campur hasil efek jaw dropping tutup ungkap penuh takjub'),
(97, 114, 'groundhog day adalah sebuah drama komedi dengan cerita unik dan ringan yang bisa membuat kita tertawa dan merenung saat menontonnya bukan hanya sekedar drama komedi biasa film ini juga memberikan inspirasi dan pesan moral yang cukup dalam bagi kita untuk menjadi manusia yang lebih baik', 'groundhog day drama komedi cerita unik ringan tertawa merenung menontonnya sekedar drama komedi film inspirasi pesan moral manusia', 'groundhog day drama komedi cerita unik ringan tertawa renung tonton sekedar drama komedi film inspirasi pesan moral manusia'),
(98, 115, 'di bagian aksinya guardias of the galaxy tampil memukau meskipun sebelumnya hanya pernah membuat film superhero gadungan dalam super tetapi di sini gunn sepertinya sudah fasih benar ketika ia menghadirkan setiap momennya dengan sangat berkelas dan tentu saja menghibur gunn menyuntik narasinya dengan keseimbangan sempurna humor-humor segar dari setiap karakternya musik-musik pop asyik dari kaset dan walkman jadul kesayangan peter quill yang seperti tidak pernah gagal menggelitik dan tentu saja keseruan sebuah action supehero spektakuler berbiaya mahal bersama dukungan cgi dan d yang apik dari pertarungan berskala kecil di darat dan penjara sampai pertempuran pesawat-pesawat luar angkasanya semua ditampilkan maksimal bersama sinematografi cantik ', 'aksinya guardias of the galaxy tampil memukau film superhero gadungan super gunn fasih menghadirkan momennya berkelas menghibur gunn menyuntik narasinya keseimbangan sempurna humor-humor segar karakternya musik-musik pop asyik kaset walkman jadul kesayangan peter quill gagal menggelitik keseruan action supehero spektakuler berbiaya mahal dukungan cgi d apik pertarungan berskala darat penjara pertempuran pesawat-pesawat angkasanya ditampilkan maksimal sinematografi cantik ', 'aksi guardias of the galaxy tampil pukau film superhero gadungan super gunn fasih hadir momen kelas hibur gunn suntik narasi keseimbangan sempurna humor segar karakter musik pop asyik kaset walkman jadul sayang peter quill gagal gelitik seru action supehero spektakuler biaya mahal dukung cgi d apik tarung skala darat penjara tempur pesawat angkasa tampil maksimal sinematografi cantik '),
(99, 116, 'keberhasilan guzaarish mengaduk-aduk emosi penontonnya selain karena kepiawaian bhansali meracik kisahnya dengan dukungan teknis kelas atas juga jelas tidak terlepas dari performa gemilang hrithik roshan dibutuhkan akting prima untuk dapat membawakan karakter ethan mascarenhas yang lumpuh secara meyakinkan dan roshan melakukan pekerjaannya dengan sangat baik membuat penonton bersimpati dan memaklumi keadaannya tanpa harus merasa kasihan terhadap kekurangannya kehadiran artis cantik yang juga mantan miss world aishwarya rai sebagai perawat sekaligus love interest ethan pun semakin mewarnai kisah indah ini', 'keberhasilan guzaarish mengaduk-aduk emosi penontonnya kepiawaian bhansali meracik kisahnya dukungan teknis kelas terlepas performa gemilang hrithik roshan dibutuhkan akting prima membawakan karakter ethan mascarenhas lumpuh roshan pekerjaannya penonton bersimpati memaklumi keadaannya kasihan kekurangannya kehadiran artis cantik mantan miss world aishwarya rai perawat love interest ethan mewarnai kisah indah', 'keberhasilan guzaarish aduk emosi tonton piawai bhansali racik kisah dukung teknis kelas lepas performa gemilang hrithik roshan butuh akting prima bawa karakter ethan mascarenhas lumpuh roshan kerja tonton simpati maklum ada kasihan kurang hadir artis cantik mantan miss world aishwarya rai awat love interest ethan warna kisah indah');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(100, 117, 'memasuki medan tempur gibson terlihat habis-habisan mengeksploitasi segala hal yang ia suka kombinasi dramatisasi antara kebrutalan kepahlawanan dan sisi religius mampu bersinergi dengan sempurna bersama kekuatan karakter unik seorang desmond doss kekacauan dalam adegan peperangan dihadirkan dengan sangat baik pertempuran digambarkan begitu masif dan cepat namun hebatnya kita tetap bisa mengikuti pergerakan karakter utamanya dengan baik setiap desingan peluru dan ledakan granat yang tersaji dalam balutan sinematografi ciamik simon duggan benar-benar memamerkan apa itu arti dari horor perang', 'memasuki medan tempur gibson habis-habisan mengeksploitasi suka kombinasi dramatisasi kebrutalan kepahlawanan sisi religius bersinergi sempurna kekuatan karakter unik desmond doss kekacauan adegan peperangan dihadirkan pertempuran digambarkan masif cepat hebatnya mengikuti pergerakan karakter utamanya desingan peluru ledakan granat tersaji balutan sinematografi ciamik simon duggan benar-benar memamerkan arti horor perang', 'masuk medan tempur gibson habis eksploitasi suka kombinasi dramatisasi brutal pahlawan sisi religius sinergi sempurna kuat karakter unik desmond doss kacauan adegan peperangan hadir tempur gambar masif cepat hebat ikut gera karakter utama desing peluru ledak granat saji balut sinematografi ciamik simon duggan benar pamer arti horor perang'),
(101, 118, 'hanna memang bukan suguhan biasa ini adalah kombinasi apik dari action thriller revenge movie dan coming of age yang digarap dengan kualitas penyutradaraan hebat serta dukungan teknis sinematografi jempolan dari joe wright dan tentunya sosok hanna itu sendiri yang sukses dibawakan dengan sangat apik oleh saoirse ronan', 'hanna suguhan kombinasi apik action thriller revenge movie coming of age digarap kualitas penyutradaraan hebat serta dukungan teknis sinematografi jempolan joe wright sosok hanna sukses dibawakan apik saoirse ronan', 'hanna suguh kombinasi apik action thriller revenge movie coming of age garap kualitas sutradara hebat serta dukung teknis sinematografi jempol joe wright sosok hanna sukses bawa apik saoirse ronan'),
(102, 119, 'hari untuk amanda adalah sebuah oase kesegaran di tengah panas dan gersangnya padang pasir perfilman indonesia sebuah kisah cinta sederhana namun mampu meninggalkan kesan manis dan personal bagi setiap penontonnya tidak diragukan lagi jika hari untuk amanda adalah salah satu drama romantis indonesia terbaik yang pernah dibuat oleh sineas kita', 'amanda oase kesegaran panas gersangnya padang pasir perfilman indonesia kisah cinta sederhana meninggalkan kesan manis personal penontonnya diragukan amanda salah drama romantis indonesia terbaik sineas', 'amanda oase segar panas gersang padang pasir film indonesia kisah cinta sederhana tinggal kesan manis personal tonton ragu amanda salah drama romantis indonesia baik sineas'),
(103, 120, 'the deathly hollows part sejauh ini adalah yang terbaik dari seluruh film harry potter yang ada david yates selaku sutradara sukses memanfaatkan momentum dibagi duanya kisah epik petualangan penyihir paling dicintai di dunia ini dengan menghadirkan separuh kisah seri terakhir ini dengan baik jelas sebuah bekal yang kuat bagi para penontonnya untuk menghadapi grand finale yang akan hadir tahun depan', 'the deathly hollows part terbaik film harry potter david yates sutradara sukses memanfaatkan momentum dibagi duanya kisah epik petualangan penyihir dicintai dunia menghadirkan separuh kisah seri bekal kuat penontonnya menghadapi grand finale hadir', 'the deathly hollows part baik film harry potter david yates sutradara sukses manfaat momentum bagi dua kisah epik tualang sihir cinta dunia hadir paruh kisah seri bekal kuat tonton hadap grand finale hadir'),
(104, 121, 'heartless sukses menghadirkan sebuah tema horror yang berbeda elemen-elemen misteri yang gelap tragis dan mencekam berhasil berbaur dengan baik dan berimbang dengan elemen-elemen drama psikologis keluarga romantisme yang kuat dan penuh emosi heartless sekaligus menjadi ajang comeback yang manis bagi seorang philip ridley setelah tahun hiatus dari dunia perfilman', 'heartless sukses menghadirkan tema horror berbeda elemen-elemen misteri gelap tragis mencekam berhasil berbaur berimbang elemen-elemen drama psikologis keluarga romantisme kuat penuh emosi heartless ajang comeback manis philip ridley hiatus dunia perfilman', 'heartless sukses hadir tema horror beda elemen misteri gelap tragis cekam hasil baur imbang elemen drama psikologis keluarga romantisme kuat penuh emosi heartless ajang comeback manis philip ridley hiatus dunia film'),
(105, 122, 'bagi pecinta heist movie heat jelas adalah salah satu yang terbaik dan juga sebuah film yang wajib dan patut ditonton selain karena kehadiran al pacino dan robert de niro yang bermain gemilang kisahnya yang menarik dan adegan aksinya yang seru dan gila dijamin akan membuat penontonnya betah untuk berlama-lama duduk di depan televisi mereka', 'pecinta heist movie heat salah terbaik film wajib patut ditonton kehadiran al pacino robert de niro bermain gemilang kisahnya menarik adegan aksinya seru gila dijamin penontonnya betah berlama-lama duduk televisi', 'cinta heist movie heat salah baik film wajib patut tonton hadir al pacino robert de niro main gemilang kisah tarik adegan aksi seru gila jamin tonton betah lama duduk televisi'),
(106, 123, 'dimulai dengan sedikit canggung namun perlahan namun pasti hello goodbye mampu tampil lepas dengan segala pendekatan yang masuk akal presentasi yang cantik membuat segala hal tentang premisnya yang stereotip dan dialog-dialognya yang tidak pernah terlalu kuat itu mendadak bukan lagi menjadi masalah besar ya saya suka hello goodbye mengingatkan saya pada before sunrisesunset atau lost in translation yang berkesan itu ini sebuah romansa manis yang tidak pernah berlebihan dalam menyampaikan pesan cinta dan pencarian jati diri', 'canggung perlahan hello goodbye tampil lepas pendekatan masuk akal presentasi cantik premisnya stereotip dialog-dialognya kuat mendadak ya suka hello goodbye before sunrisesunset lost in translation berkesan romansa manis pesan cinta pencarian jati', 'canggung perlahan hello goodbye tampil lepas dekat masuk akal presentasi cantik premis stereotip dialog kuat dadak ya suka hello goodbye before sunrisesunset lost in translation kesan romansa manis pesan cinta cari jati'),
(107, 124, 'henrys crime kamu bisa menyebutnya sebagai sebuah drama komedi romantis yang santai tidak hanya bagaimana ia bergerak pelan sepanjang menit namun juga bagaimana setiap konfliknya tentang pencarian jati diri dibuat begitu sederhana namun tetap tidak menghilangkan usur hiburannya yang enjoyable terlebih trio musketeer kita keanu reeves vera farmiga dan james caan begitu solid dalam menghadirkan interaksi antara karakternya', 'henrys crime menyebutnya drama komedi romantis santai bergerak pelan menit konfliknya pencarian jati sederhana menghilangkan usur hiburannya enjoyable trio musketeer keanu reeves vera farmiga james caan solid menghadirkan interaksi karakternya', 'henrys crime sebut drama komedi romantis santai gerak pelan menit konflik cari jati sederhana hilang usur hibur enjoyable trio musketeer anu reeves vera farmiga james caan solid hadir interaksi karakter'),
(108, 125, 'her menjadi sebuah pengalaman berbeda menonton sebuah romansa dengan sentuhan fiksi ilmiah sebuah film yang membawa sebuah romcom ke level berbeda romcom yang bisa membuatmu jatuh cinta pada pandangan pertama berlebihan ah tidak juga tunggu sampai kamu merasakan sendiri bagaimana her akan langsung membiusmu sejak menit pertama sejak karakter theodore membacakan surat cintanya yang manis ketika jonze membungkus semuanya dengan lagi-lagi kualitas sinematografi dreamy los angeles masa depan dari hoyte van hoytema dan iringan scoring-scoring keren arcade fire di mana membuat tampilan her layaknya seperti video klip cantik romantis berwarna lembut dengan durasi menit', 'her pengalaman berbeda menonton romansa sentuhan fiksi ilmiah film membawa romcom level berbeda romcom membuatmu jatuh cinta pandangan ah tunggu merasakan her langsung membiusmu menit karakter theodore membacakan surat cintanya manis jonze membungkus lagi-lagi kualitas sinematografi dreamy los angeles hoyte van hoytema iringan scoring-scoring keren arcade fire tampilan her layaknya video klip cantik romantis berwarna lembut durasi menit', 'her alam beda tonton romansa sentuh fiksi ilmiah film bawa romcom level beda romcom buat jatuh cinta pandang ah tunggu rasa her langsung bius menit karakter theodore baca surat cinta manis jonze bungkus lagi kualitas sinematografi dreamy los angeles hoyte van hoytema iring scoring keren arcade fire tampil her layak video klip cantik romantis warna lembut durasi menit'),
(109, 126, 'sementara tensinya juga berhasil terjaga dengan baik duffer tidak pernah berlama-lama dengan melodramanya ketika tempo mulai mengendur ada ketegangan dari kehilangan stok makanan kebakaran sampai teror dari atas yang seperti mulai mencium jejak keberadaan keluarga ray lalu dalam misi mengisi informasi yang hilang beberapa rentetan flash back memberi sedikit banyak jawaban dari masa lalu tetapi lagi-lagi duffer masih berhasil menjaga misterinya dengan baik setidaknya sampai klimaks datang menjemput dengan twist menghentak yang langsung mengubah wajah hidden selamanya', 'tensinya berhasil terjaga duffer berlama-lama melodramanya tempo mengendur ketegangan kehilangan stok makanan kebakaran teror mencium jejak keberadaan keluarga ray misi mengisi informasi hilang rentetan flash back lagi-lagi duffer berhasil menjaga misterinya klimaks menjemput twist menghentak langsung mengubah wajah hidden', 'tensi hasil jaga duffer lama melodrama tempo kendur tegang hilang stok makan bakar teror cium jejak keberadaan keluarga ray misi isi informasi hilang rentet flash back lagi duffer hasil jaga misteri klimaks jemput twist menghentak langsung ubah wajah hidden'),
(110, 127, 'tetapi sekali lagi bagian terbaiknya bukan hanya pada misterinya namun juga pada ikatan dari dua tokoh utamanya yang dimainkan oleh dua bintang muda dari dua serial televisi populer harry treadaway penny dreadful dan rose ygritte leslie game of thrones baik sebelum atau setelah konflik terjadi ada sebuah pesan tentang cinta sejati yang coba turut diangkut janik di samping segala teror mencekamnya yang datang dari luar kabin', 'terbaiknya misterinya ikatan tokoh utamanya dimainkan bintang muda serial televisi populer harry treadaway penny dreadful rose ygritte leslie game of thrones konflik pesan cinta sejati coba diangkut janik samping teror mencekamnya kabin', 'baik misteri ikat tokoh utama main bintang muda serial televisi populer harry treadaway penny dreadful rose ygritte leslie game of thrones konflik pesan cinta sejati coba angkut janik samping teror cekam kabin'),
(111, 128, 'selain trio jason bateman charlie day dan jason sudeikis yang sukses membawakan peran mereka sebagai para pekerja yang tidak dihargai oleh atasannya para evil boss tampaknya juga tidak mau ketinggalan untuk bersenang-senang melengkapi salah satu ensemble cast terbaik yang pernah ada dalam sebuah komedi ada kevin spacey yang tampil paling hebat dan paling menyebalkan di sini mengisi sebagai si psikopat dave harken atau collin ferrell yang penampilannya mengingatkan saya pada cameo tom cruise di tropic thunder lengkap dengan perut buncitnya dan rambutnya yang licin serta jeniffer aniston yang secara mengejutkan mampu tampil apik membawakan karakter dokter gigi cabul dan last but not least jamie foxx yang memerankan konsultan pembunuhan bernama motherfucker jones ya nama yang unik seunik kisah di balik pemilihan namanya', 'trio jason bateman charlie day jason sudeikis sukses membawakan peran pekerja dihargai atasannya evil boss ketinggalan bersenang-senang melengkapi salah ensemble cast terbaik komedi kevin spacey tampil hebat menyebalkan mengisi si psikopat dave harken collin ferrell penampilannya cameo tom cruise tropic thunder lengkap perut buncitnya rambutnya licin serta jeniffer aniston mengejutkan tampil apik membawakan karakter dokter gigi cabul last but not least jamie foxx memerankan konsultan pembunuhan bernama motherfucker jones ya nama unik seunik kisah pemilihan namanya', 'trio jason bateman charlie day jason sudeikis sukses bawa peran kerja harga atas evil boss tinggal senang lengkap salah ensemble cast baik komedi kevin spacey tampil hebat sebal isi si psikopat dave harken collin ferrell tampil cameo tom cruise tropic thunder lengkap perut buncit rambut licin serta jeniffer aniston kejut tampil apik bawa karakter dokter gigi cabul last but not least jamie foxx peran konsultan bunuh nama motherfucker jones ya nama unik unik kisah pilih nama'),
(112, 129, 'sebagai sutradara yang masih bau kencur macam gerard johnstone housebound adalah sajian sempurna sebuah horor mikro budget yang percaya diri dengan segala keunikannya diisi oleh banyak kombinasi dan jebakan-jebakan penuh kejutan menyenangkan yang akan mengundang rasa penasaran rasa takut sekaligus tawa lepas johnstone mencoba menciptakan sesuatu yang berbeda pada karakter utamanya menjauhkan dari unsur-unsur stereotip seperti kebanyakan horor lainnya kylie yang dimainkan asyik oleh morgana oreilly adalah karakter anti heroine yang kuat cuek pemarah kurang ajar dan untuk ukuran tokoh utama perempuan dalam film horor kylie termasuk pemberani', 'sutradara bau kencur gerard johnstone housebound sajian sempurna horor mikro budget percaya keunikannya diisi kombinasi jebakan-jebakan penuh kejutan menyenangkan mengundang penasaran takut tawa lepas johnstone mencoba menciptakan berbeda karakter utamanya menjauhkan unsur-unsur stereotip kebanyakan horor kylie dimainkan asyik morgana oreilly karakter anti heroine kuat cuek pemarah ajar ukuran tokoh utama perempuan film horor kylie pemberani', 'sutradara bau kencur gerard johnstone housebound saji sempurna horor mikro budget percaya uni isi kombinasi jebakan penuh kejut senang undang penasaran takut tawa lepas johnstone coba cipta beda karakter utama jauh unsur stereotip banyak horor kylie main asyik morgana oreilly karakter anti heroine kuat cuek marah ajar ukur tokoh utama perempuan film horor kylie berani'),
(113, 130, 'berbekal cerita yang kuat yang diadaptasi bebas dari bukunya yang berjudul sama buah karya cressida cowell duet sutradara sekaligus penulis chris sanders dan dean deblois yang sebelumnya pernah sukses menghasilkan cerita animasi disney lilo stitch berhasil menghadirkan sebuah kisah from zero to hero persahabatan kesetiaan kepercayaan dan semangat juang pantang menyerah yang dibungkus dengan karakter-karakter dan animasi yang menarik penuh warna dan sangat detail sanders dan deblois berhasil dengan konsisten menjaga irama film ini sampai akhir tanpa terlalu terburu-buru cerita mengalir dengan lembut dengan konflik-konflik yang tergali dengan baik ', 'berbekal cerita kuat diadaptasi bebas bukunya berjudul buah karya cressida cowell duet sutradara penulis chris sanders dean deblois sukses menghasilkan cerita animasi disney lilo stitch berhasil menghadirkan kisah from zero to hero persahabatan kesetiaan kepercayaan semangat juang pantang menyerah dibungkus karakter-karakter animasi menarik penuh warna detail sanders deblois berhasil konsisten menjaga irama film terburu-buru cerita mengalir lembut konflik-konflik tergali ', 'bekal cerita kuat adaptasi bebas buku judul buah karya cressida cowell duet sutradara tulis chris sanders dean deblois sukses hasil cerita animasi disney lilo stitch hasil hadir kisah from zero to hero sahabat setia percaya semangat juang pantang serah bungkus karakter animasi tarik penuh warna detail sanders deblois hasil konsisten jaga irama film buru cerita alir lembut konflik gali '),
(114, 131, 'hugo adalah debut scorsese dalam dunia d dan untuk seorang sutradara veteran yang baru pertama kali menangani teknologi ini scorsese sudah mampu menghadirkannya dengan sangat baik gambar-gambarnya terlihat luar biasa dan hebatnya tidak terkesan terlalu berlebihan karena semuanya mampu menyatu dengan bagaimana sutradara berambut putih ini menanganinya termasuk pergerakan kamera yang dinamis dan juga dukungan efek cgi yang menjadikan dunia hugo begitu mempesona sama mempesonanya ketika ia menampilkan bagaimana melies dalam wujud ben kingsley yang luar biasa itu dan sang istri jeanne helen mccrory membuat film-filmnya dengan penuh semangat dan keceriaan sebelum akhirnya mereka dilupakan', 'hugo debut scorsese dunia d sutradara veteran kali menangani teknologi scorsese menghadirkannya gambar-gambarnya hebatnya terkesan menyatu sutradara berambut putih menanganinya pergerakan kamera dinamis dukungan efek cgi menjadikan dunia hugo mempesona mempesonanya menampilkan melies wujud ben kingsley sang istri jeanne helen mccrory film-filmnya penuh semangat keceriaan dilupakan', 'hugo debut scorsese dunia d sutradara veteran kali tangan teknologi scorsese hadir gambar hebat kesan satu sutradara rambut putih tangan gera kamera dinamis dukung efek cgi jadi dunia hugo mempesona mempesonanya tampil melies wujud ben kingsley sang istri jeanne helen mccrory film penuh semangat ceria lupa'),
(115, 132, 'kekuatan utama i give it year jelas ada pada komedinya didominasi oleh dialog-dialog yang porsi kelucuannya sama besar dengan kekotorannya terutama yang keluar dari mulut minnie driver yang tampil sebagai pencuri perhatian terbesar dari momen pernikahan threesome permainan tebak kata sampai adegan frame foto elektronik semuanya berhasil menghadirkan kelucuan yang memalukan i give it a year jelas bukan role model yang pantas buat romcom impian banyak yang memandangnya sinis karena dianggap vulgar dan pro perceraian alih-alih percaya dengan keajaiban cinta pandangan pertama tetapi di balik segala kekacauan gila-gilaan yang menyenangkan itu ada sisi manis dan romantisme yang tetap dipertahankan mazer untuk menekankan bahwa ini masih berada di ranah film-film cinta ada sebuah realita pahit yang biasanya berusaha dijauhi oleh koleganya ketika film ini berakhir dengan ceria ', 'kekuatan utama i give it year komedinya didominasi dialog-dialog porsi kelucuannya kekotorannya mulut minnie driver tampil pencuri perhatian terbesar momen pernikahan threesome permainan tebak adegan frame foto elektronik berhasil menghadirkan kelucuan memalukan i give it a year role model romcom impian memandangnya sinis dianggap vulgar pro perceraian alih-alih percaya keajaiban cinta pandangan kekacauan gila-gilaan menyenangkan sisi manis romantisme dipertahankan mazer menekankan ranah film-film cinta realita pahit berusaha dijauhi koleganya film ceria ', 'kuat utama i give it year komedi dominasi dialog porsi lucu kotor mulut minnie driver tampil curi perhati besar momen nikah threesome main tebak adegan frame foto elektronik hasil hadir lucu malu i give it a year role model romcom impi pandang sinis anggap vulgar pro cerai alih percaya ajaib cinta pandang kacauan gila senang sisi manis romantisme tahan mazer tekan ranah film cinta realita pahit usaha jauh kolega film ceria '),
(116, 133, 'i love you phillip morris mungkin adalah salah satu film dengan tema homoseksual yang sangat enjoyable dan menghibur untuk ditonton jika kebanyakan film-film yang mengangkat tema tabu seperti ini tampil begitu serius dengan konflik-konflik yang cukup berat namun tidak bagi film besutan duet sutradara glenn ficarra dan john requa ini ya i love you phillip morris berhasil menggabungkan kisah nyata dari seorang penipu ulung bernama steven russell dengan unsur-unsur tipu-menipu ala catch me if you can romantisme cinta sejenis ala brokeback mountain dan gaya lelucon komikal ala jim carrey dengan manis yang membuat film bertema sensitif ini menjadi sebuah sajian yang unik dan sangat menghibur terlebih lagi banyak sekali adegan-adegan mengejutkan menipu sekaligus kocak yang membuat tawa penontonnya lepas di saat menyaksikan film berdurasi menit ini', 'i love you phillip morris salah film tema homoseksual enjoyable menghibur ditonton kebanyakan film-film mengangkat tema tabu tampil serius konflik-konflik berat film besutan duet sutradara glenn ficarra john requa ya i love you phillip morris berhasil menggabungkan kisah nyata penipu ulung bernama steven russell unsur-unsur tipu-menipu ala catch me if you can romantisme cinta sejenis ala brokeback mountain gaya lelucon komikal ala jim carrey manis film bertema sensitif sajian unik menghibur adegan-adegan mengejutkan menipu kocak tawa penontonnya lepas menyaksikan film berdurasi menit', 'i love you phillip morris salah film tema homoseksual enjoyable hibur tonton banyak film angkat tema tabu tampil serius konflik berat film besut duet sutradara glenn ficarra john requa ya i love you phillip morris hasil gabung kisah nyata tipu ulung nama steven russell unsur tipu ala catch me if you can romantisme cinta jenis ala brokeback mountain gaya lelucon komikal ala jim carrey manis film tema sensitif saji unik hibur adegan kejut tipu kocak tawa tonton lepas saksi film durasi menit'),
(117, 134, 'jika belum pernah bersentuhan dengan komiknya ichi the killer sepintas mungkin terlihat seperti film gangster kebanyakan namun bagaimana miike menghadirkannya yang membuat segalanya menjadi berbeda tidak hanya disuguhkan dengan parade adegan-adegan disturbing seperti yang sudah saya singgung diatas namun juga mengajak penontonnya dalam sebuah studi karakter dari tokoh-tokohnya yang unik lengkap dengan segala konflik maupun gangguan kejiwaannya masing-masing plus sedikit bumbu black komedi dan iring-iringan soundtrack japanese avant garde dari grup musik legendaris jepang boredoms menjadikan ichi the killer sebuah pesta darah yang lengkap dan meriah', 'bersentuhan komiknya ichi the killer sepintas film gangster kebanyakan miike menghadirkannya berbeda disuguhkan parade adegan-adegan disturbing singgung diatas mengajak penontonnya studi karakter tokoh-tokohnya unik lengkap konflik gangguan kejiwaannya plus bumbu black komedi iring-iringan soundtrack japanese avant garde grup musik legendaris jepang boredoms menjadikan ichi the killer pesta darah lengkap meriah', 'sentuh komik ichi the killer pintas film gangster banyak miike hadir beda suguh parade adegan disturbing singgung atas ajak tonton studi karakter tokoh unik lengkap konflik ganggu jiwa plus bumbu black komedi iring soundtrack japanese avant garde grup musik legendaris jepang boredoms jadi ichi the killer pesta darah lengkap riah'),
(118, 135, 'selain kisahnya yang unik seperti kebanyakan drama-drama korea selatan lainnya penontonnya akan banyak disuguhkan adegan-adegan manis dengan visual yang indah il mare dengan latar belakang pantai sunyi nan indah berhasil ditangkap dengan sangat baik menimbulkan kesan romantis sekaligus misterius secara bersamaan kehadiran jun ji hyun dan lee jung jae sebagai pasangan beda waktu juga terbilang cukup baik walaupun tidak istimewa setidaknya mereka sudah pas membawakan karakter masing-masing dengan segala konflik internalnya', 'kisahnya unik kebanyakan drama-drama korea selatan penontonnya disuguhkan adegan-adegan manis visual indah il mare latar pantai sunyi nan indah berhasil ditangkap menimbulkan kesan romantis misterius bersamaan kehadiran jun ji hyun lee jung jae pasangan beda terbilang istimewa pas membawakan karakter konflik internalnya', 'kisah unik banyak drama korea selatan tonton suguh adegan manis visual indah il mare latar pantai sunyi nan indah hasil tangkap timbul kesan romantis misterius sama hadir jun ji hyun lee jung jae pasang beda bilang istimewa pas bawa karakter konflik internal'),
(119, 136, 'dengan dukungan para pemainnya yang bermain gemilang terutama pada kedua aktris ciliknya sarah dan emma bolger yang di dunia nyata memang adalah kakak adik tampil sangat luar biasa sehingga menjadikan film ini menjadi jauh lebih menarik termasuk juga akting dari djimon hounsou aktor asal perancis berkulit hitam ini ternyata juga bisa tampil meyakinkan sebagai seorang pria yang penuh dengan kasih sayang dibalik wajahnya yang sangar sebuah drama keluarga yang indah dan penuh makna yang akan menyentuh emosi setiap penontonnya dengan kisahnya yang luar biasa', 'dukungan pemainnya bermain gemilang aktris ciliknya sarah emma bolger dunia nyata kakak adik tampil menjadikan film menarik akting djimon hounsou aktor perancis berkulit hitam tampil pria penuh kasih sayang dibalik wajahnya sangar drama keluarga indah penuh makna menyentuh emosi penontonnya kisahnya', 'dukung main main gemilang aktris cilik sarah emma bolger dunia nyata kakak adik tampil jadi film tarik akting djimon hounsou aktor perancis kulit hitam tampil pria penuh kasih sayang balik wajah sangar drama keluarga indah penuh makna sentuh emosi tonton kisah'),
(120, 137, 'tidak diragukan lagi jika inception adalah salah satu yang terbaik dari seorang christopher nolan walaupun secara kualitas masih sedikit berada di bawah memento maupun the dark night namun apa yang disajikan oleh nolan di sini lebih dari cukup untuk sekali lagi mengukuhkannya sebagai salah satu sutradara terbaik yang dimiliki oleh hollywood dan juga membuat inception menjadi salah satu film terbaik tahun ini', 'diragukan inception salah terbaik christopher nolan kualitas memento the dark night disajikan nolan mengukuhkannya salah sutradara terbaik dimiliki hollywood inception salah film terbaik', 'ragu inception salah baik christopher nol kualitas memento the dark night saji nol kukuh salah sutradara baik milik hollywood inception salah film baik'),
(121, 138, 'incendies adalah sebuah drama kuat yang tersaji luar biasa selama jam lebih tidak peduli seberapa lambat ia berjalan karena hampir di setiap menitnya film yang banyak memperoleh penghargaan internasional ini mampu berbicara banyak dan juga memberikan efek kejut kepada penontonnya ini adalah sebuah kisah hebat depresi dan tragis yang dikemas apik kisah pilu bagaimana seorang ibu berusaha menyatukan kembali keluarganya meskipun harus dengan cara yang menyakitkan', 'incendies drama kuat tersaji jam peduli lambat berjalan menitnya film memperoleh penghargaan internasional berbicara efek kejut penontonnya kisah hebat depresi tragis dikemas apik kisah pilu berusaha menyatukan keluarganya menyakitkan', 'incendies drama kuat saji jam peduli lambat jalan menit film oleh harga internasional bicara efek kejut tonton kisah hebat depresi tragis kemas apik kisah pilu usaha satu keluarga sakit'),
(122, 139, 'tidak mudah memang membuat sebuah film dengan tema sejarah di mana sejarah tersebut sudah dimodifikasi ulang sedemikian rupa sehingga menghasilkan sebuah tontonan yang berbeda dan untuk dapat membuatnya sebagai sebuah tontonan berkualitas tentu saja dibutuhkan keberanian tersendiri dan juga sedikit kegilaan untuk menulis ulang sejarah sesuai dengan yang diinginkan dan kemampuan itulah yang dimiliki oleh seorang tarantino yang ternyata berhasil menghadirkan sebuah fantasi perang yang sangat luar biasa menghibur penuh kejutan dan menegangkan hingga akhir namun film ini juga bisa luar biasa membosankan bagi penonton yang tidak terbiasa dengan dialog-dialog panjang dan alur lambat yang hampir menghiasi film yang berdurasi menit ini', 'mudah film tema sejarah sejarah dimodifikasi ulang rupa menghasilkan tontonan berbeda membuatnya tontonan berkualitas dibutuhkan keberanian tersendiri kegilaan menulis ulang sejarah sesuai kemampuan dimiliki tarantino berhasil menghadirkan fantasi perang menghibur penuh kejutan menegangkan film membosankan penonton terbiasa dialog-dialog alur lambat menghiasi film berdurasi menit', 'mudah film tema sejarah sejarah modifikasi ulang rupa hasil tonton beda buat tonton kualitas butuh berani sendiri gila tulis ulang sejarah sesuai mampu milik tarantino hasil hadir fantasi perang hibur penuh kejut tegang film bosan tonton biasa dialog alur lambat hias film durasi menit'),
(123, 140, 'inside bisa dibilang adalah salah satu horror slasher terbaik yang pernah dibuat perancis dengan premisnya yang simpel dan latar minimalis rangkaian adegan-adegan menegangkan plus bumbu blood and gore yang sangat kental film ini akan memberikan efek maksimum kepada penontonnya', 'inside dibilang salah horror slasher terbaik perancis premisnya simpel latar minimalis rangkaian adegan-adegan menegangkan plus bumbu blood and gore kental film efek maksimum penontonnya', 'inside bilang salah horror slasher baik perancis premis simpel latar minimalis rangkai adegan tegang plus bumbu blood and gore kental film efek maksimum tonton'),
(124, 141, 'lebih dalam inside out punya pesan solid tentang proses perjalanan dari seorang anak menuju kedewasaan yang mungkin hanya dimengerti oleh penonton dengan rentang usia yang lebih besar lengkap dengan segala adegan-adegannya yang mampu menyentil emosi setiap kegalauan yang hadir setiap rasa amarah dan kelabilan memang merupakan bagian tak terpisahkan dari sebuah proses namun menjadi istimewa ketika docter dan del carmen mampu membungkusnya dalam petualangan khas pixar yang bisa dinikmati oleh siapa saja dan itu yang paling penting', 'inside out pesan solid proses perjalanan anak kedewasaan dimengerti penonton rentang usia lengkap adegan-adegannya menyentil emosi kegalauan hadir amarah kelabilan terpisahkan proses istimewa docter del carmen membungkusnya petualangan khas pixar dinikmati', 'inside out pesan solid proses jalan anak dewasa dimengerti tonton rentang usia lengkap adegan sentil emosi galau hadir amarah labil pisah proses istimewa docter del carmen bungkus tualang khas pixar nikmat'),
(125, 142, 'terlalu banyak kejutan di sini yang membuat plotnya seperti berbelok tajam setiap kali sebuah surprise baru menabraknya seperti sejak valentine beralih profesi menjadi stuntman dadakan yang sukses di hollywood setelah melompat dari lantai lalu kedatangan julie yang mengubah aroma kental big daddy menjadi kramer vs kramer dan ketika kamu seperti sudah mulai terbiasa ditampar bolak balik oleh twistnya yang penuh emosi dan tawa sekali lagi sebuah kejutan paling besar datang tepat sebelum credit akhir sebuah kejutan yang dipastikan akan membuatmu menyesal sudah meremehkannya sejak awal', 'kejutan plotnya berbelok tajam kali surprise menabraknya valentine beralih profesi stuntman dadakan sukses hollywood melompat lantai kedatangan julie mengubah aroma kental big daddy kramer vs kramer terbiasa ditampar bolak twistnya penuh emosi tawa kejutan credit kejutan membuatmu menyesal meremehkannya', 'kejut plot belok tajam kali surprise tabrak valentine alih profesi stuntman dada sukses hollywood lompat lantai datang julie ubah aroma kental big daddy kramer vs kramer biasa tampar bolak twistnya penuh emosi tawa kejut credit kejut buat sesal remeh'),
(126, 143, 'sebagai sebuah film yang banyak menyajikan pengalaman luar angkasa nolan membuatnya dengan spektakuler dibungkus dengan visual menakjubkan dari dapur spesial efek double negative bersama dukungan kamera imax yang dikendalikan sinematografer kawakan hoyte van hoytema setiap momen yang melibatkan petualangan di angkasa luar itu penuh kejutan tak terduga begitu menegangkan begitu misterius sekaligus begitu memesona dan emosional terutama ketika cooper dan amelia bersenggolan dengan fenomena spacetime continuum dan usaha mereka bertahan hidup demi kemanusiaan cinta dan keluarga dan saya masih belum menyebut pengaruh besar scoring dahsyat garapan sang maestro hans zimmer yang tidak pernah gagal memompa setiap emosi penontonnya klimaksnya seperti banyak terinspirasi dari rangkaian momen absurd nan indah opus fiksi ilmiah legendaris stanley kubrick a space odyssey twist di ujungnya tidak hanya begitu mengejutkan namun juga terasa begitu sentimentil ketika nolan membawa narasinya menjadi sebuah puzzle utuh yang menggetarkan', 'film menyajikan pengalaman angkasa nolan membuatnya spektakuler dibungkus visual menakjubkan dapur spesial efek double negative dukungan kamera imax dikendalikan sinematografer kawakan hoyte van hoytema momen melibatkan petualangan angkasa penuh kejutan terduga menegangkan misterius memesona emosional cooper amelia bersenggolan fenomena spacetime continuum usaha bertahan hidup kemanusiaan cinta keluarga menyebut pengaruh scoring dahsyat garapan sang maestro hans zimmer gagal memompa emosi penontonnya klimaksnya terinspirasi rangkaian momen absurd nan indah opus fiksi ilmiah legendaris stanley kubrick a space odyssey twist ujungnya mengejutkan sentimentil nolan membawa narasinya puzzle utuh menggetarkan', 'film saji alam angkasa nol buat spektakuler bungkus visual takjub dapur spesial efek double negative dukung kamera imax kendali sinematografer kawak hoyte van hoytema momen libat tualang angkasa penuh kejut duga tegang misterius pesona emosional cooper amelia senggol fenomena spacetime continuum usaha tahan hidup manusia cinta keluarga sebut pengaruh scoring dahsyat garap sang maestro hans zimmer gagal pompa emosi tonton klimaks inspirasi rangkai momen absurd nan indah opus fiksi ilmiah legendaris stanley kubrick a space odyssey twist ujung kejut sentimentil nol bawa narasi puzzle utuh getar'),
(127, 144, 'invictus merupakan contoh film yang sangat baik dalam membawa tema olahraga untuk alat mempersatukan bangsa clint eastwood orang tua yang masih dengan tekunnya masih bisa menyutradarai film- film drama bermutu beralur pelan lagi-lagi clint sukses membawakan kisah nyata ini ke layar lebar ketika adegan pertandingan terakhir yang bersejarah antara afrika selatan dan selandia baru dengan suasana tahun dibuat sedetail mungkin oleh clint begitu banyak momen indah yang jangan sampai dilewatkan', 'invictus contoh film membawa tema olahraga alat mempersatukan bangsa clint eastwood orang tua tekunnya menyutradarai film- film drama bermutu beralur pelan lagi-lagi clint sukses membawakan kisah nyata layar lebar adegan pertandingan bersejarah afrika selatan selandia suasana sedetail clint momen indah dilewatkan', 'invictus contoh film bawa tema olahraga alat satu bangsa clint eastwood orang tua tekun sutradara film  film drama mutu alur pelan lagi clint sukses bawa kisah nyata layar lebar adegan tanding sejarah afrika selatan selandia suasana detail clint momen indah lewat'),
(128, 145, 'sebuah film perang tentu tidak lengkap jika tidak menghadirkan adegan-adegan baku hantam baik jarak jauh maupun dekat dan untuk bagian satu ini saya harus mengacungkan jempol buat english yang sudah membuat pertarungan jaman medieval ini dengan sangat baik terlebih untuk film dengan biaya produksi yang minim brutal dan realistis mungkin adalah dua kata yang tepat untuk menggambarkan bagaimana english menghadirkan adegan peperangan di sini ', 'film perang lengkap menghadirkan adegan-adegan baku hantam jarak mengacungkan jempol english pertarungan jaman medieval film biaya produksi minim brutal realistis menggambarkan english menghadirkan adegan peperangan ', 'film perang lengkap hadir adegan baku hantam jarak acung jempol english tarung jaman medieval film biaya produksi minim brutal realistis gambar english hadir adegan peperangan '),
(129, 146, 'elemen supernaturalnya bekerja dengan sangat efektif mampu mengusik imajinasimu hanya dengan melihat koridor atau pintu ruangan terbuka semua kengerian ini banyak dibantu dengan kekuatan teknis dan kerja kamera yang brilian menangkap setiap ketakutan setiap rasa tidak nyaman dan ancaman yang bisa datang kapan saja tanpa peringatan', 'elemen supernaturalnya efektif mengusik imajinasimu koridor pintu ruangan terbuka kengerian dibantu kekuatan teknis kerja kamera brilian menangkap ketakutan nyaman ancaman peringatan', 'elemen supernatural efektif usik imajinasi koridor pintu ruang buka ngeri bantu kuat teknis kerja kamera brilian tangkap takut nyaman ancam ingat'),
(130, 147, 'jackass dengan mudah menjadi sebuah suguhan komedi yang dicintai sekaligus dibenci sama besarnya kecuali penggunaan kamera yang jauh lebih canggih efek slow motion dan d yang dahsyat jackass d sesungguhnya tidak menawarkan sesuatu yang baru tetap setia mengusung konsep pranks stunts usangnya namun hebatnya hingga seri ketiga ini suguhan usang tersebut masih terbukti efektif memberikan efek kejutan dan hiburan luar biasa bagi saya ya jujur saja saya menikmati setiap menit penuh kegilaan dan kegembiraan menyimpang bersama kru jackass', 'jackass mudah suguhan komedi dicintai dibenci besarnya kecuali penggunaan kamera canggih efek slow motion d dahsyat jackass d sesungguhnya menawarkan setia mengusung konsep pranks stunts usangnya hebatnya seri ketiga suguhan usang terbukti efektif efek kejutan hiburan ya jujur menikmati menit penuh kegilaan kegembiraan menyimpang kru jackass', 'jackass mudah suguh komedi cinta benci besar kecuali guna kamera canggih efek slow motion d dahsyat jackass d sungguh tawar setia usung konsep pranks stunts usang hebat seri tiga suguh usang bukti efektif efek kejut hibur ya jujur nikmat menit penuh gila gembira simpang kru jackass'),
(131, 148, 'narasinya memang tidak mampu berinovasi besar dan terasa seperti mengulang dari pakem seri pendahulunya namun fokus utamanya adalah bagaimana meleburkan kisahnya bersama momen aksinya yang harus diakui masih terasa luar biasa mendebarkan ketika berada di tangan greengrass trademark greengrass dengan segala editing cepat dan penggunaan shaky cam kembali mendominasi setiap pergerakan bourne ketika beradu pintar dengan para agen cia setiap adegan kejar-kejaran digarap dengan sangat baik setiap adu fisik dan senjata menghadirkan lecutan adrenalin tingkat tinggi bersama dentuman scoring familiar dari john powell dan david buckley', 'narasinya berinovasi mengulang pakem seri pendahulunya fokus utamanya meleburkan kisahnya momen aksinya diakui mendebarkan tangan greengrass trademark greengrass editing cepat penggunaan shaky cam mendominasi pergerakan bourne beradu pintar agen cia adegan kejar-kejaran digarap adu fisik senjata menghadirkan lecutan adrenalin tingkat dentuman scoring familiar john powell david buckley', 'narasi inovasi ulang pakem seri dahulu fokus utama lebur kisah momen aksi aku debar tangan greengrass trademark greengrass editing cepat guna shaky cam dominasi gera bourne adu pintar agen cia adegan kejar garap adu fisik senjata hadir lecut adrenalin tingkat dentum scoring familiar john powell david buckley'),
(132, 149, 'kekuatannya ada pada character driven dan kekuatan akting para pemainnya ketimbang plot adaptasi dari novel lama milik larry brown harus diakui juga secara teknis gordon green bersama sinematografer langganannya tim orr juga sudah bekerja dengan baik membungkus joe dengan visual depressing atmosferis yang juga cantik dan mellow serta menambahkan sedikit humor pada dialog-dialognya dan juga sedikit kebrutalan guna mencegah menjadikannya terlalu sentimental', 'kekuatannya character driven kekuatan akting pemainnya ketimbang plot adaptasi novel milik larry brown diakui teknis gordon green sinematografer langganannya tim orr membungkus joe visual depressing atmosferis cantik mellow serta humor dialog-dialognya kebrutalan mencegah menjadikannya sentimental', 'kuat character driven kuat akting main ketimbang plot adaptasi novel milik larry brown aku teknis gordon green sinematografer langgan tim orr bungkus joe visual depressing atmosferis cantik mellow serta humor dialog brutal cegah jadi sentimental'),
(133, 150, 'david leitch dan chad stahelski adalah dua orang yang paling bertanggung jawab mengapa john wick bisa bergerak begitu leluasa begitu asyik dan begitu stylish dalam menerjemahkan narasi usang yang sudah dimodifikasi sana-sini oleh derek kolstad dan saya masih belum mengatakan ia juga begitu keras dan kotor memiliki tingkat kebrutalan dan koreografi aksi paling keren tahun ini yang mungkin hanya bisa dikalahkan oleh sekuel the raid berandal', 'david leitch chad stahelski orang bertanggung john wick bergerak leluasa asyik stylish menerjemahkan narasi usang dimodifikasi sana-sini derek kolstad keras kotor memiliki tingkat kebrutalan koreografi aksi keren dikalahkan sekuel the raid berandal', 'david leitch chad stahelski orang tanggung john wick gerak leluasa asyik stylish terjemah narasi usang modifikasi sana sini derek kolstad keras kotor milik tingkat brutal koreografi aksi keren kalah sekuel the raid berandal'),
(134, 151, 'joint security area bisa dibilang adalah salah satu thriller terbaik korea selatan yang juga menjadi pintu gerbang bagi karir park chan wook yang seperti kita ketahui kemudian berhasil menghadirkan banyak karya-karya besar salah satunya adalah trilogi vengeance yang fenomenal itu', 'joint security area dibilang salah thriller terbaik korea selatan pintu gerbang karir park chan wook ketahui berhasil menghadirkan karya-karya salah satunya trilogi vengeance fenomenal', 'joint security area bilang salah thriller baik korea selatan pintu gerbang karir park chan wook tahu hasil hadir karya salah satu trilogi vengeance fenomenal'),
(135, 152, 'julie julia tampil cukup solid baik dari cerita maupun akting para aktrisnya sehingga film yang mengangkat tema tentang kuliner ini mampu menjadi hiburan tersendiri buat para penontonnya baik buat penggemar masak memasak atau tidak film ini akan membuat kita lapar dan secara tidak sadar meneteskan air liur kita', 'julie julia tampil solid cerita akting aktrisnya film mengangkat tema kuliner hiburan tersendiri penontonnya penggemar masak memasak film lapar sadar meneteskan air liur', 'julie julia tampil solid cerita akting aktris film angkat tema kuliner hibur sendiri tonton gemar masak masak film lapar sadar tetes air liur'),
(136, 153, 'never say never jelas menghibur dan emosional tidak hanya buat para fans semata namun juga buat saya golongan penonton yang kurang mengenal siapa itu sosok justin bieber untuk ikut berdendang bersama menikmati kemegahan dan histeria suasana konser my world tour yang spektakuler itu dan di sisi lain chu juga tidak ketinggalan untuk mengajak penontonnya untuk mengenal lebih dekat sosok pribadi sang mega bintang yang sudah berhasil menyihir dunia ini', 'never say never menghibur emosional fans golongan penonton mengenal sosok justin bieber berdendang menikmati kemegahan histeria suasana konser my world tour spektakuler sisi chu ketinggalan mengajak penontonnya mengenal sosok pribadi sang mega bintang berhasil menyihir dunia', 'never say never hibur emosional fans golong tonton nal sosok justin bieber dendang nikmat megah histeria suasana konser my world tour spektakuler sisi chu tinggal ajak tonton nal sosok pribadi sang mega bintang hasil sihir dunia'),
(137, 154, 'kurosawa benar-benar tahu cara mengambil momen dan adegan di setiap scene pemandangan-pemandangan yang menarik tone warna yang cemerlang apalagi ini merupakan film kurosawa berwarna pertama yang saya tonton adegan alam mimpi shingen palsu benar-benar memukau tidak ada visual efek dan sebagainya yang ada hanyalah permainan warna dan pengambilan gambar yang epik ', 'kurosawa benar-benar mengambil momen adegan scene pemandangan-pemandangan menarik tone warna cemerlang film kurosawa berwarna tonton adegan alam mimpi shingen palsu benar-benar memukau visual efek permainan warna pengambilan gambar epik ', 'kurosawa benar ambil momen adegan scene pemandangan tarik tone warna cemerlang film kurosawa warna tonton adegan alam mimpi shingen palsu benar pukau visual efek main warna ambil gambar epik '),
(138, 155, 'naskahnya memang menarik dan nyaris rapi dengan segala detailnya tapi harus diakui ia masih memiliki beberapa plot hole yang terasa sedikit mengganggu keasyikannya untung saja kahaani punya cast yang bagus untuk menambal kekurangannya itu termasuk bagaimana kemudian ghosh berhasil menutup kisahnya dengan twist ending cerdas ending yang sangat berkaitan dengan pemilihan karakter wanitanya yang tidak biasa itu ', 'naskahnya menarik rapi detailnya diakui memiliki plot hole mengganggu keasyikannya untung kahaani cast bagus menambal kekurangannya ghosh berhasil menutup kisahnya twist ending cerdas ending berkaitan pemilihan karakter wanitanya ', 'naskah tarik rapi detail aku milik plot hole ganggu asyik untung kahaani cast bagus tambal kurang ghosh hasil tutup kisah twist ending cerdas ending kait pilih karakter wanita '),
(139, 156, 'tidak mudah membuat sebuah komedi romantis yang masih terlihat menyegarkan di balik formula komersialnya selain karena kepiawaian ody harahap mempresentasikan racikan komedi dan romansanya dengan takaran pas kapan kawin juga banyak sekali terbantu oleh kinerja para pemainnya yang solid malah bisa dibilang kapan kawin bisa begitu memikat berkat digerakkan oleh jagoan-jagoan hebatnya baik yang berada di posisi karakter utama maupun pendukung seperti adi kurdi dan ivanka suwandi sebagai orangtua dinda yang kolot sekaligus kocak luar biasa', 'mudah komedi romantis menyegarkan formula komersialnya kepiawaian ody harahap mempresentasikan racikan komedi romansanya takaran pas kawin terbantu kinerja pemainnya solid dibilang kawin memikat berkat digerakkan jagoan-jagoan hebatnya posisi karakter utama pendukung adi kurdi ivanka suwandi orangtua dinda kolot kocak', 'mudah komedi romantis segar formula komersial piawai ody harahap mempresentasikan racik komedi romansa takar pas kawin bantu kinerja main solid bilang kawin mikat berkat gerak jagoan hebat posisi karakter utama dukung adi kurdi ivanka suwandi orangtua dinda kolot kocak'),
(140, 157, 'layaknya keberanian yang ditampilkan oleh karakter kick-ass matthew vaughn pun dengan berani menyajikan sebuah suguhan berbeda dalam genre superhero sebuah usaha yang ternyata tidak sia-sia dan berbuah manis karena kick-ass benar-benar sukses tampil menghibur dengan segala keunikan dan kesegarannya', 'layaknya keberanian ditampilkan karakter kick-ass matthew vaughn berani menyajikan suguhan berbeda genre superhero usaha sia-sia berbuah manis kick-ass benar-benar sukses tampil menghibur keunikan kesegarannya', 'layak berani tampil karakter kick ass matthew vaughn berani saji suguh beda genre superhero usaha sia buah manis kick ass benar sukses tampil hibur uni segar'),
(141, 158, 'seperti kebanyakan animasi buatan miyazaki lainnya kikis delivery service juga tidak lepas dari balutan animasi cantik penuh warna-warni dengan detail yang luar biasa apalagi mengingat ini adalah animasi d buatan di mana teknologi animasi belum secanggih sekarang namun studio ghibli bersama miyazaki sudah mampu membuat animasi klasik modern dengan kualitas tinggi kikis delivery service memang bukanlah animasi terbaik dari miyazaki dan studio ghibli namun tetap saja animasi satu ini mampu memberikan sebuah tontonan menghibur dan penuh dengan segala kebaikan yang menginspirasi serta dapat dinikmati oleh semua kalangan', 'kebanyakan animasi buatan miyazaki kikis delivery service lepas balutan animasi cantik penuh warna-warni detail animasi d buatan teknologi animasi secanggih studio ghibli miyazaki animasi klasik modern kualitas kikis delivery service animasi terbaik miyazaki studio ghibli animasi tontonan menghibur penuh kebaikan menginspirasi serta dinikmati kalangan', 'banyak animasi buat miyazaki kikis delivery service lepas balut animasi cantik penuh warna-warni detail animasi d buat teknologi animasi canggih studio ghibli miyazaki animasi klasik modern kualitas kikis delivery service animasi baik miyazaki studio ghibli animasi tonton hibur penuh baik inspirasi serta nikmat kalang'),
(142, 159, 'untuk ukuran sebuah thriller indie kidnapped sama sekali tidak buruk miguel ngel vivas sudah melakukan pekerjaannya dengan hebat untuk meramu kembali formula usang dalam kemasan yang berkelas rumit sekaligus menyegarkan memberikan penontonnya sebuah sensasi teror dan ketakutan yang berbeda dari kebanyakan film bertema sama', 'ukuran thriller indie kidnapped buruk miguel ngel vivas pekerjaannya hebat meramu formula usang kemasan berkelas rumit menyegarkan penontonnya sensasi teror ketakutan berbeda kebanyakan film bertema', 'ukur thriller indie kidnapped buruk miguel ngel vivas kerja hebat meramu formula usang kemas kelas rumit segar tonton sensasi teror takut beda banyak film tema'),
(143, 160, 'secara teknis killer toon sudah tampil meyakinkan sebagai sebuah horor sementara narasinya sendiri tidak sekuat penampilannya memang harus diakui ia punya kekuatan besar di temanya kandungan misterinya pun sukses mengusik rasa penasaran', 'teknis killer toon tampil horor narasinya sekuat penampilannya diakui kekuatan temanya kandungan misterinya sukses mengusik penasaran', 'teknis killer toon tampil horor narasi kuat tampil aku kuat tema kandung misteri sukses usik penasaran'),
(144, 161, 'sebuah cerita cinta tentang keajaiban ruang dan waktu pun dimulai ada rasa harap-harap cemas tentang apa yang terjadi selanjutnya yang kemudian ditutup dengan klimaks sentimentil dan ending kuat yang mengingatkan saya pada sensasi yang ada pada centimeters per second sensasi yang dijamin akan membuatmu menjadi baper maksimal', 'cerita cinta keajaiban ruang harap-harap cemas ditutup klimaks sentimentil ending kuat sensasi centimeters second sensasi dijamin membuatmu baper maksimal', 'cerita cinta ajaib ruang harap cemas tutup klimaks sentimentil ending kuat sensasi centimeters second sensasi jamin buat baper maksimal');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(145, 162, 'kingsman menjadi spesial tidak hanya karena ia menginjeksi tema aksi spionase yang notabene salah satu sub genre populer namun yang penting adalah bagaimana vaughn memperlakukannya layaknya anak kandungnya sendiri ya kingsman punya semua ciri khas vaughn dari kekerasan tingkat tinggi yang melibatkan banyak darah dan kepala pecah sampai koreografi aksi memukau dengan segala efek slow motion cantik dan scoring asyik yang tepat sasaran terutama pada klimaks spektakulernya plus selipan komedi yang renyah', 'kingsman spesial menginjeksi tema aksi spionase notabene salah sub genre populer vaughn memperlakukannya layaknya anak kandungnya ya kingsman ciri khas vaughn kekerasan tingkat melibatkan darah kepala pecah koreografi aksi memukau efek slow motion cantik scoring asyik sasaran klimaks spektakulernya plus selipan komedi renyah', 'kingsman spesial injeksi tema aksi spionase notabene salah sub genre populer vaughn laku layak anak kandung ya kingsman ciri khas vaughn kerasan tingkat libat darah kepala pecah koreografi aksi pukau efek slow motion cantik scoring asyik sasar klimaks spektakuler plus selip komedi renyah'),
(146, 163, 'duo ronning-sanberg tahu benar bagaimana menghasilkan gambar-gambar cantik bersama pergerakan kamera yang dinamis ya mungkin spesial efeknya tidak secanggih life of pi tetapi ada kesan natural yang terasa jauh lebih kental dan meyakinkan lihat bagaimana para tim spesiel efeknya mampu membuat cgi hiu senyata itu', 'duo ronning-sanberg menghasilkan gambar-gambar cantik pergerakan kamera dinamis ya spesial efeknya secanggih life of pi kesan natural kental lihat tim spesiel efeknya cgi hiu senyata', 'duo ronning sanberg hasil gambar cantik gera kamera dinamis ya spesial efek canggih life of pi kesan natural kental lihat tim spesiel efek cgi hiu nyata'),
(147, 164, 'kristy punya kekuatan terbesar dari bagaimana blackburn membentuk dengan kuat set piece horornya menjadikan setiap momen slasher mampu lepas keluar dan menghunjam dengan sangat efektif menggedor jantung penontonnya menghadirkan sebuah pesona kuat tidak hanya melalui momen ketegangan akibat melihat karakternya dikejar-kejar para pemburu misterius sembari bermain petak umpet dan adu cerdas namun juga bagaimana suasana suram mencekam yang hadir secara konsisten sejak konflik dimulai', 'kristy kekuatan terbesar blackburn membentuk kuat set piece horornya menjadikan momen slasher lepas menghunjam efektif menggedor jantung penontonnya menghadirkan pesona kuat momen ketegangan akibat karakternya dikejar-kejar pemburu misterius sembari bermain petak umpet adu cerdas suasana suram mencekam hadir konsisten konflik', 'kristy kuat besar blackburn bentuk kuat set piece horor jadi momen slasher lepas hunjam efektif gedor jantung tonton hadir pesona kuat momen tegang akibat karakter kejar buru misterius sembari main petak umpet adu cerdas suasana suram cekam hadir konsisten konflik'),
