(159, 176, 'limitless mungkin bukan yang terbaik di genrenya seorang neil burger sepertinya juga butuh asupan nzt- untuk menjadikan filmnya ini jauh lebih sempurna tapi dengan premis menarik dan ditunjang dengan naskahnya yang cukup cerdas plus permainan apik dari seorang bradley cooper tentu tidak sulit bagi limetless untuk menjadi sebuah sajian crime thriller unik dan menghibur yang saya percaya dapat langsung disukai penontonnya', 'limitless terbaik genrenya neil burger butuh asupan nzt- menjadikan filmnya sempurna premis menarik ditunjang naskahnya cerdas plus permainan apik bradley cooper sulit limetless sajian crime thriller unik menghibur percaya langsung disukai penontonnya', 'limitless baik genre neil burger butuh asupan nzt  jadi film sempurna premis tarik tunjang naskah cerdas plus main apik bradley cooper sulit limetless saji crime thriller unik hibur percaya langsung suka tonton'),
