(171, 188, 'inilah kiamat ala lars von trier sebuah studi karakter kompleks yang dibawakan dengan hebat oleh kristen dunst dan pelajaran tentang keikhlasan menjelang kematian melalui metafora sebuah planet fiksi bernama melancholia ya von trier bermain sedikit lembut dan lebih sopan di sini tanpa kehilangan sentuhannya bercerita dengan gambar-gambar puitis tentang kehancuran yang digarap mengesankan', 'kiamat ala lars von trier studi karakter kompleks dibawakan hebat kristen dunst pelajaran keikhlasan menjelang kematian metafora planet fiksi bernama melancholia ya von trier bermain lembut sopan kehilangan sentuhannya bercerita gambar-gambar puitis kehancuran digarap mengesankan', 'kiamat ala lars von trier studi karakter kompleks bawa hebat kristen dunst pelajaran ikhlas jelang mati metafora planet fiksi nama melancholia ya von trier main lembut sopan hilang sentuh cerita gambar puitis hancur garap kesan'),
(172, 189, 'cerita berjalan mundur begitu unik sangat jarang ada film seperti ini ini yang saya suka dari memento karena butuh berpikir butuh konsentrasi tinggi buat menontonnya mungkin beberapa orang berpikir adegan bolak balik membuat plot film ini sangat tidak biasa namun sebenarnya adalah plotnya sederhana untuk itu bagi yang belum menonton scene demi scene harus anda cermati karena ending film ada di awal film dan fakta mengejutkan akan terselip di akhir film menjadikan film ini film murah namun berbobot salut buat nolan brothers yang berhasil meraih penghargaan di mana-mana', 'cerita berjalan mundur unik jarang film suka memento butuh berpikir butuh konsentrasi menontonnya orang berpikir adegan bolak plot film plotnya sederhana menonton scene scene cermati ending film film fakta mengejutkan terselip film menjadikan film film murah berbobot salut nolan brothers berhasil meraih penghargaan mana-mana', 'cerita jalan mundur unik jarang film suka memento butuh pikir butuh konsentrasi tonton orang pikir adegan bolak plot film plot sederhana tonton scene scene cermat ending film film fakta kejut selip film jadi film film murah bobot salut nol brothers hasil raih harga mana'),
