(182, 199, 'sudah lama tidak melihat film tentang baseball yang bagus dan moneyball menjawab kekosongan itu dengan menghadirkan sebuah biopik hebat dengan perpaduan naskah adaptasi cerdas dari kisah nyata penuh inspirasi tentang manusia-manusia yang ingin keluar dari pakem konvensional dan mengubah cara pandang terhadap baseball itu sendiri dengan cara-cara mereka yang tidak biasa', 'film baseball bagus moneyball kekosongan menghadirkan biopik hebat perpaduan naskah adaptasi cerdas kisah nyata penuh inspirasi manusia-manusia pakem konvensional mengubah pandang baseball cara-cara', 'film baseball bagus moneyball kosong hadir biopik hebat padu naskah adaptasi cerdas kisah nyata penuh inspirasi manusia pakem konvensional ubah pandang baseball cara'),
(183, 200, 'wow mungkin itulah ekspresi saya setelah menonton film ini sebuah ekspresi yang mungkin hanya terjadi jika melihat atau mengalami sesuatu yang memesona atau sesuatu yang di luar dugaan kita yup ekspresi itulah yang dirasakan saya setelah menonton moon sebuah thriller fiksi ilmiah yang disutradarai oleh duncan jones ini tampil di atas ekspektasi berbeda dengan kebanyakan film fiksi ilmiah lainnya moon tidak bergantung pada kehadiran alien misterius pesawat-pesawat luar angkasa yang dilengkapi dengan senjata canggih atau pertempuran-pertempuran kolosal namun moon menawarkan sesuatu yang lebih mendasar yang merupakan inti dari semua film yaitu ceritanya yang kuat', 'wow ekspresi menonton film ekspresi mengalami memesona dugaan yup ekspresi dirasakan menonton moon thriller fiksi ilmiah disutradarai duncan jones tampil ekspektasi berbeda kebanyakan film fiksi ilmiah moon bergantung kehadiran alien misterius pesawat-pesawat angkasa dilengkapi senjata canggih pertempuran-pertempuran kolosal moon menawarkan mendasar inti film ceritanya kuat', 'wow ekspresi tonton film ekspresi alami pesona duga yup ekspresi rasa tonton moon thriller fiksi ilmiah sutradara duncan jones tampil ekspektasi beda banyak film fiksi ilmiah moon gantung hadir alien misterius pesawat angkasa lengkap senjata canggih pertempuran kolosal moon tawar dasar inti film cerita kuat'),
(184, 201, 'jadi ingin mencari tontonan drama komedi ringan namun tetap memiliki cerita berbobot dan masih menghibur morning glory bisa jadi pilihan tepat untuk mengisi waktu santai anda tidak hanya mampu memberikan sajian yang enjoyable di sisi lain morning glory juga memberikan anda sedikit pengetahuan tentang bagaimana suka duka di balik layar sebuah acara televisi', 'mencari tontonan drama komedi ringan memiliki cerita berbobot menghibur morning glory pilihan mengisi santai sajian enjoyable sisi morning glory pengetahuan suka duka layar acara televisi', 'cari tonton drama komedi ringan milik cerita bobot hibur morning glory pilih isi santai saji enjoyable sisi morning glory tahu suka duka layar acara televisi'),
(185, 202, 'mother and child mungkin bukanlah sebuah drama yang dengan mudah dinikmati begitu saja oleh semua orang namun jelas juga bukan sebuah drama rumit yang sulit untuk dicerna yang dibutuhkan hanya kesabaran dan bagaimana kemampuan kita untuk dapat merasakan kisah yang disajikan dan kedalaman setiap karakter-karakternya dan niscaya seperti saya anda akan dapat juga merasakan bagaimana hebatnya film ini memengaruhi emosi para penontonnya dengan cara yang cerdas', 'mother and child drama mudah dinikmati orang drama rumit sulit dicerna dibutuhkan kesabaran kemampuan merasakan kisah disajikan kedalaman karakter-karakternya niscaya merasakan hebatnya film memengaruhi emosi penontonnya cerdas', 'mother and child drama mudah nikmat orang drama rumit sulit cerna butuh sabar mampu rasa kisah saji dalam karakter niscaya rasa hebat film pengaruh emosi tonton cerdas'),
(186, 203, 'mothers day bisa jadi salah satu contoh langka di mana versi daur ulang bisa tampil lebih bagus dari versi orisinalnya tidak hanya sukses membuat penontonnya menahan napas dengan momen-momen penuh darah kesadisan dan ketegangan semata namun di sisi lain bousman juga memberikan perhatian lebih dalam usahanya menghidupkan karakter-karakternya plus dalam mengkonversi naskah ceritanya', 'mothers day salah contoh langka versi daur ulang tampil bagus versi orisinalnya sukses penontonnya menahan napas momen-momen penuh darah kesadisan ketegangan sisi bousman perhatian usahanya menghidupkan karakter-karakternya plus mengkonversi naskah ceritanya', 'mothers day salah contoh langka versi daur ulang tampil bagus versi orisinal sukses tonton tahan napas momen penuh darah sadis tegang sisi bousman perhati usaha hidup karakter plus konversi naskah cerita'),
(187, 204, 'ya mud memesona tidak hanya narasi sederhana dan elemen menarik coming of age dari sudut pandang remaja tahun namun secara visual ia juga memikat dengan gambar-gambar cantiknya di bawah arahan sinematografer langganan nichols adam stone dan juga akting menawan dari matthew mcconaughey dan aktor kecilnya', 'ya mud memesona narasi sederhana elemen menarik coming of age sudut pandang remaja visual memikat gambar-gambar cantiknya arahan sinematografer langganan nichols adam stone akting menawan matthew mcconaughey aktor kecilnya', 'ya mud pesona narasi sederhana elemen tarik coming of age sudut pandang remaja visual mikat gambar cantik arah sinematografer langgan nichols adam stone akting tawan matthew mcconaughey aktor kecil'),
(188, 205, 'mulholland drive sendiri digadang-gadang sebagai salah satu film terbaik dari seorang david lynch karena bukan hanya memiliki plot dengan tingkat kerumitan luar biasa membingungkan dan didukung dengan teknis sinematik tingkat tinggi namun juga memaksa penontonnya untuk memasang mata dan telinga baik-baik bahkan dari awal film karena banyak sekali potongan-potongan petunjuk simbolik yang sudah disebar sutradara amerika berusia tahun ini dalam setiap adegan-adegannya untuk ukuran sebuah film indie mulholland drive mampu memberikan impact luar biasa kepada para penontonnya', 'mulholland drive digadang-gadang salah film terbaik david lynch memiliki plot tingkat kerumitan membingungkan didukung teknis sinematik tingkat memaksa penontonnya memasang mata telinga baik-baik film potongan-potongan petunjuk simbolik disebar sutradara amerika berusia adegan-adegannya ukuran film indie mulholland drive impact penontonnya', 'mulholland drive gadang salah film baik david lynch milik plot tingkat kerumit bingung dukung teknis sinematik tingkat paksa tonton pasang mata telinga baik film potongan tunjuk simbolik sebar sutradara amerika usia adegan ukur film indie mulholland drive impact tonton'),
(189, 206, 'meski secara keseluruhan jalinan kisahnya mudah ditebak namun tetap saja film berdurasi menit ini tetap menarik untuk dinikmati hingga akhir karena selain mencoba mengangkat tema yang sedikit berbeda pengembangan karakternya juga menjadi perhatian lain yang membuat film ini menjadi lebih hidup helene de fougerolles sudah melakukan tugasnya dengan baik menjadi karakter sonia seorang petugas medis yang harus terjebak dalam situasi dilematis menariknya lagi karakter sonia mampu berkembang dinamis sepanjang film chemistry yang dibangun dengan kekasihnya marco mampu membuat film yang seharusnya keras dan sadis ini menjadi sedikit lebih lembut dan melankolis', 'jalinan kisahnya mudah ditebak film berdurasi menit menarik dinikmati mencoba mengangkat tema berbeda pengembangan karakternya perhatian film hidup helene de fougerolles tugasnya karakter sonia petugas medis terjebak situasi dilematis menariknya karakter sonia berkembang dinamis film chemistry dibangun kekasihnya marco film keras sadis lembut melankolis', 'jalin kisah mudah tebak film durasi menit tarik nikmat coba angkat tema beda kembang karakter perhati film hidup helene de fougerolles tugas karakter sonia tugas medis jebak situasi dilematis tarik karakter sonia kembang dinamis film chemistry bangun kasih marco film keras sadis lembut melankolis'),
(190, 207, 'racikan pas antara romansa puppy love yang manis persahabatan dan pendewasaan berpadu padan dengan komedi ringan dan penyajian yang renyah menjadi alasan-alasan kenapa my girl susah untuk tidak disukai oleh penontonnya bukan hanya buat audiens cilik namun para penonton dewasa pun akan merasakan efek nostalgia personal terutama jika memiliki pengalaman yang sama dan saya belum menyebut bagaimana performa para pemain ciliknya yang tampil sama asyiknya dengan presentasinya', 'racikan pas romansa puppy love manis persahabatan pendewasaan berpadu padan komedi ringan penyajian renyah alasan-alasan my girl susah disukai penontonnya audiens cilik penonton dewasa merasakan efek nostalgia personal memiliki pengalaman menyebut performa pemain ciliknya tampil asyiknya presentasinya', 'racik pas romansa puppy love manis sahabat dewasa padu padan komedi ringan saji renyah alasan my girl susah suka tonton audiens cilik tonton dewasa rasa efek nostalgia personal milik alam sebut performa main cilik tampil asyik presentasi'),
(191, 208, 'tentu saja sesuai judulnya karakter ibu yang dibawakan dengan luar biasa oleh artis senior kim hae sook begitu mendominasi di sepanjang film nyaris tanpa cela bahkan ia sanggup menenggelamkan karakter lain termasuk karakter ji suk sendiri yang seharusnya bisa berdiri sama tinggi', 'sesuai judulnya karakter dibawakan artis senior kim hae sook mendominasi film cela sanggup menenggelamkan karakter karakter ji suk berdiri', 'sesuai judul karakter bawa artis senior kim hae sook dominasi film cela sanggup tenggelam karakter karakter ji suk diri'),
