(194, 211, 'melalui never let me go baik mark romanek maupun alex garland bisa dibilang sukses menyampaikan pesan-pesan yang hendak disampaikan oleh ishiguro dalam novelnya pesan tentang cinta kematian kepasrahan dan bagaimana manusia menghargai hidup yang sudah tuhan karuniakan kepada mereka tersaji dalam balutan drama romantis indah nan suram ini', 'never let me go mark romanek alex garland dibilang sukses pesan-pesan ishiguro novelnya pesan cinta kematian kepasrahan manusia menghargai hidup tuhan karuniakan tersaji balutan drama romantis indah nan suram', 'never let me go mark romanek alex garland bilang sukses pesan ishiguro novel pesan cinta mati pasrah manusia harga hidup tuhan karunia saji balut drama romantis indah nan suram'),
(195, 212, 'satu lagi aspek menarik di nightcrawler selain naskahnya yang pintar pesan sosialnya yang menusuk dan teknisnya yang apik adalah bagaimana gilroy sukses memaksimalkan pesona gylenhaal yang bermain gemilang dan total bahkan ia sampai harus menggerus berat badannya sebanyak kilogram menjadikan lou bloom sebagai tokoh anti hero baru tanpa cerita latar belakang ia adalah sosok gila dan lihai memanipulasi', 'aspek menarik nightcrawler naskahnya pintar pesan sosialnya menusuk teknisnya apik gilroy sukses memaksimalkan pesona gylenhaal bermain gemilang total menggerus berat badannya kilogram menjadikan lou bloom tokoh anti hero cerita latar sosok gila lihai memanipulasi', 'aspek tarik nightcrawler naskah pintar pesan sosial tusuk teknis apik gilroy sukses maksimal pesona gylenhaal main gemilang total gerus berat badan kilogram jadi lou bloom tokoh anti hero cerita latar sosok gila lihai manipulasi'),
(196, 213, 'selain karena sentuhan dingin koreeda yang mampu membuat film ini menjadi lebih hidup penampilan para aktor dan aktris ciliknya pun tak kalah hebatnya membangun emosi dan jiwa film ini khususnya penampilan hebat yuya yagira yang berperan sebagai akira hampir seluruh adegan dipastikan melibatkan aktor muda yang berhasil mendapatkan penghargaan sebagai aktor terbaik dan juga termuda sepanjang sejarah dalam ajang festival film cannes hirokazu koreeda sukses menghadirkan sebuah heartbreaking drama dalam nobody knows', 'sentuhan dingin koreeda film hidup penampilan aktor aktris ciliknya kalah hebatnya membangun emosi jiwa film penampilan hebat yuya yagira berperan akira adegan melibatkan aktor muda berhasil penghargaan aktor terbaik termuda sejarah ajang festival film cannes hirokazu koreeda sukses menghadirkan heartbreaking drama nobody knows', 'sentuh dingin koreeda film hidup tampil aktor aktris cilik kalah hebat bangun emosi jiwa film tampil hebat yuya yagira peran akira adegan libat aktor muda hasil harga aktor baik muda sejarah ajang festival film cannes hirokazu koreeda sukses hadir heartbreaking drama nobody knows'),
(197, 214, 'membuat sebuah sajian dengan latar sesempit seperti di dalam pesawat memang menjadi tantangan tersendiri beruntung non stop punya collet serra yang piawai mengolah jalan ceritanya menggerakkan kameranya dengan dinamis untuk menciptakan adegan demi adegan yang jauh dari monoton meskipun parade aksinya baru datang menjelang akhir', 'sajian latar sesempit pesawat tantangan tersendiri beruntung non stop collet serra piawai mengolah jalan ceritanya menggerakkan kameranya dinamis menciptakan adegan adegan monoton parade aksinya menjelang', 'saji latar sempit pesawat tantang sendiri untung non stop collet serra piawai mengolah jalan cerita gerak kamera dinamis cipta adegan adegan monoton parade aksi jelang'),
(198, 215, 'sebuah kisah sederhana tentang perjuangan seorang guru muda yang berusaha sekuat tenaga untuk mencari muridnya ini ternyata mampu disampaikan dengan sangat menarik oleh yimou terlebih lagi ia mengemasnya dengan pendekatan bergaya neorealist seperti yang sering digunakan sutradara iran abbas kiarostami sehingga apa yang tersaji dalam film pemenang penghargaan golden lion pada venice film festival tampak begitu natural dan apa adanya', 'kisah sederhana perjuangan guru muda berusaha sekuat tenaga mencari muridnya menarik yimou mengemasnya pendekatan bergaya neorealist sutradara iran abbas kiarostami tersaji film pemenang penghargaan golden lion venice film festival natural', 'kisah sederhana juang guru muda usaha kuat tenaga cari murid tarik yimou mas dekat gaya neorealist sutradara iran abbas kiarostami saji film menang harga golden lion venice film festival natural'),
(199, 216, 'now you see me memang keren dan sanggup membuatmu duduk betah selama menit melahap setiap kejutan di dalamnya tetapi selalu ada sisi lain dalam sebuah cerita narasinya yang dipenuhi jebakan dan pengalih perhatian mungkin terlihat cerdas di kulit luarnya namun di saat bersamaan jika menilik lebih dalam ia terkesan terlalu sempurna dan kurang manusiawi apalagi jika kamu mau membandingkannya dengan the prestige milik nolan yang mampu digarap dengan solid', 'now you see me keren sanggup membuatmu duduk betah menit melahap kejutan dalamnya sisi cerita narasinya dipenuhi jebakan pengalih perhatian cerdas kulit luarnya bersamaan menilik terkesan sempurna manusiawi membandingkannya the prestige milik nolan digarap solid', 'now you see me keren sanggup buat duduk betah menit lahap kejut dalam sisi cerita narasi penuh jebak alih perhati cerdas kulit luar sama tilik kesan sempurna manusiawi banding the prestige milik nol garap solid'),
(200, 217, 'mungkin bukan fiksi ilmiah paling orisinal yang pernah kamu tonton dengan segala pinjaman ide sana-sini tetapi meskipun basi premis tentang kehancuran bumi dan invasi alien plus pesona tom cruise yang masih bertaji itu sudah lebih dari cukup untuk menjadi sebuah kombinasi yang susah untuk ditolak terlebih sutradaranya joseph kosinski tahu benar bagaimana menghadirkannya dengan balutan teknis yang baik', 'fiksi ilmiah orisinal tonton pinjaman ide sana-sini basi premis kehancuran bumi invasi alien plus pesona tom cruise bertaji kombinasi susah ditolak sutradaranya joseph kosinski menghadirkannya balutan teknis', 'fiksi ilmiah orisinal tonton pinjam ide sana sini basi premis hancur bumi invasi alien plus pesona tom cruise taji kombinasi susah tolak sutradara joseph kosinski hadir balut teknis');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(201, 218, 'narasi ode to my father menjadi personal dan emosional khususnya buat para penonton tua korea bukan hanya karena ia banyak menghadirkan petuah-petuah lawas tentang bagaimana pentingnya sosok ayah dalam keluarga namun dalam perjalanannya yang disajikan secara kronologis yoon je kyoon juga mencoba mengeksploitasi sebuah momen reuni super emosional yang susah untuk dihindari di ujung ceritanya', 'narasi ode to my father personal emosional penonton tua korea menghadirkan petuah-petuah lawas sosok ayah keluarga perjalanannya disajikan kronologis yoon je kyoon mencoba mengeksploitasi momen reuni super emosional susah dihindari ujung ceritanya', 'narasi ode to my father personal emosional tonton tua korea hadir petuah lawas sosok ayah keluarga jalan saji kronologis yoon je kyoon coba eksploitasi momen reuni super emosional susah hindar ujung cerita'),
(202, 219, 'park chan wook sukses menjadikan oldboy sebagai salah satu film balas dendam terbaik sepanjang masa dan oldboy mempunyai shocking ending yang tidak bisa kita lupakan terlalu sakit untuk diingat terlalu gila untuk dibayangkan memuakkan penontonnya buat saya film ini begitu powerful mengaduk-aduk emosi kita ke level ekstrem', 'park chan wook sukses menjadikan oldboy salah film balas dendam terbaik oldboy shocking ending lupakan sakit gila dibayangkan memuakkan penontonnya film powerful mengaduk-aduk emosi level ekstrem', 'park chan wook sukses jadi oldboy salah film balas dendam baik oldboy shocking ending lupa sakit gila bayang muak tonton film powerful aduk emosi level ekstrem'),
(203, 220, 'dengan biaya dan waktu produksi terbatas namun dikerjakan dengan sepenuh hati once dibawah komando john carney mampu tampil memesona dan emosional sebagai sebuah drama romantis dengan kekuatannya yang terletak pada pemilihan musik yang bagus cerita yang sederhana dan chemistry kuat glen hansard dan marketa irglova sungguh pengalaman menonton sebuah romansa yang menyegarkan dengan segala lagu-lagunya yang keren karakter yang kuat dan ending yang bagus', 'biaya produksi terbatas sepenuh hati once dibawah komando john carney tampil memesona emosional drama romantis kekuatannya terletak pemilihan musik bagus cerita sederhana chemistry kuat glen hansard marketa irglova sungguh pengalaman menonton romansa menyegarkan lagu-lagunya keren karakter kuat ending bagus', 'biaya produksi batas sepenuh hati once bawah komando john carney tampil pesona emosional drama romantis kuat letak pilih musik bagus cerita sederhana chemistry kuat glen hansard marketa irglova sungguh alam tonton romansa segar lagu keren karakter kuat ending bagus'),
(204, 221, 'zootopia punya semua elemen untuk membuatnya menjadi paket animasi keluarga ala walt disney animation studios yang menghibur dari kualitas animasi penuh warna dan detail cerita from hero to zero ringan penuh inspirasi sampai ratusan karakter hewan yang unyu bin imut macam si kelinci judy hopps yang disuarakan sempurna oleh aktris ginnifer goodwin sampai mr big si tikus antartika bos tundratown', 'zootopia elemen membuatnya paket animasi keluarga ala walt disney animation studios menghibur kualitas animasi penuh warna detail cerita from hero to zero ringan penuh inspirasi ratusan karakter hewan unyu bin imut si kelinci judy hopps disuarakan sempurna aktris ginnifer goodwin mr big si tikus antartika bos tundratown', 'zootopia elemen buat paket animasi keluarga ala walt disney animation studios hibur kualitas animasi penuh warna detail cerita from hero to zero ringan penuh inspirasi ratus karakter hewan unyu bin imut si kelinci judy hopps suara sempurna aktris ginnifer goodwin mr big si tikus antartika bos tundratown'),
(205, 222, 'untuk ukuran sebuah thriller misteri kriminal berkualitas david fincher bersama zodiac miliknya sudah memiliki segalanya naskah yang kuat dan cerdas suguhan teknis yang mumpuni dan dukungan akting prima dari para pemainnya menjadikan zodiac salah satu yang terbaik di genrenya tidak peduli minus momen-momen aksi atau pun panjangnya durasi karena saya sangat menikmati setiap menitnya', 'ukuran thriller misteri kriminal berkualitas david fincher zodiac miliknya memiliki naskah kuat cerdas suguhan teknis mumpuni dukungan akting prima pemainnya menjadikan zodiac salah terbaik genrenya peduli minus momen-momen aksi panjangnya durasi menikmati menitnya', 'ukur thriller misteri kriminal kualitas david fincher zodiac milik milik naskah kuat cerdas suguh teknis mumpuni dukung akting prima main jadi zodiac salah baik genre peduli minus momen aksi panjang durasi nikmat menit'),
(206, 223, 'zero dark thirty seperti versi layar lebar dari serial homeland dengan kualitas naskah dan teknis penyajian yang jauh lebih solid menantang dan realistis bahkan ia juga punya claire danes sendiri dalam sosok jessica chastain yang tampil fantastis', 'zero dark thirty versi layar lebar serial homeland kualitas naskah teknis penyajian solid menantang realistis claire danes sosok jessica chastain tampil fantastis', 'zero dark thirty versi layar lebar serial homeland kualitas naskah teknis saji solid tantang realistis claire danes sosok jessica chastain tampil fantastis'),
(207, 224, 'jarang-jarang bisa melihat thriller buatan lokal dengan kualitas sebaik ini baik naskah maupun teknis penggarapannya apalagi mengingat keduanya tidak perlu terlalu banyak menyuguhkan adegan berdarah apalagi penampakan para dedemit untuk dapat membuat anda duduk terpaku selama menit', 'jarang-jarang thriller buatan lokal kualitas naskah teknis penggarapannya menyuguhkan adegan berdarah penampakan dedemit duduk terpaku menit', 'jarang thriller buat lokal kualitas naskah teknis garap suguh adegan darah tampak dedemit duduk terpa menit'),
(208, 225, 'seperti kebanyakan film jason reitman yang banyak dihiasi dengan karakter-karakter kompleks young adult juga punya semua hal itu sebagai sebuah anti romcom dengan segala candaan gelap ala diablo cody yang tidak hanya sukses meninggalkan tawa namun juga kegetiran menusuk buat penontonnya yang diwakili melalui karakter mavis gary yang sukses dimainkan dengan sangat apik oleh charlize theron', 'kebanyakan film jason reitman dihiasi karakter-karakter kompleks young adult anti romcom candaan gelap ala diablo cody sukses meninggalkan tawa kegetiran menusuk penontonnya diwakili karakter mavis gary sukses dimainkan apik charlize theron', 'banyak film jason reitman hias karakter kompleks young adult anti romcom canda gelap ala diablo cody sukses tinggal tawa getir tusuk tonton wakil karakter mavis gary sukses main apik charlize theron'),
(209, 226, 'yasmine adalah pencapaian luar biasa kombinasi apik antara cerita keluarga sederhana yang berisi persahabatan relasi ayah anak pencarian jati diri olah raga rivalitas dan sedikit romansa serta komedi ringan bersama dukungan akting kuat dari pendatang baru liyana yus yang energik dan lovable di visualnya ada gambar-gambar cantik nan hangat dari bumi brunei yang ditangkap kamera james teh termasuk adegan pertarungan seru', 'yasmine pencapaian kombinasi apik cerita keluarga sederhana berisi persahabatan relasi ayah anak pencarian jati olah raga rivalitas romansa serta komedi ringan dukungan akting kuat pendatang liyana yus energik lovable visualnya gambar-gambar cantik nan hangat bumi brunei ditangkap kamera james teh adegan pertarungan seru', 'yasmine capai kombinasi apik cerita keluarga sederhana isi sahabat relasi ayah anak cari jati olah raga rivalitas romansa serta komedi ringan dukung akting kuat datang liyana yus energik lovable visual gambar cantik nan hangat bumi brunei tangkap kamera james teh adegan tarung seru'),
(210, 227, 'ini adalah sebuah sebuah reboot hebat sebuah prekuel luar biasa sebuah suguhan summer movie first class dengan segala kemeriahan spesial efeknya komposisi cast apik dan yang paling penting x-men first class sudah siap memulai saga x-men yang baru', 'reboot hebat prekuel suguhan summer movie first class kemeriahan spesial efeknya komposisi cast apik x-men first class saga x-men', 'reboot hebat prekuel suguh summer movie first class kemeriahan spesial efek komposisi cast apik x men first class saga x men'),
(211, 228, 'bagian terbaik dari film yang meraih penghargaan film terbaik di ajang oscar korea blue dragon film awards ke selain premisnya yang provokatif tentu saja adalah penampilan dari para pemainnya ada aktor veteran sol kyung gu yang kembali bermain apik sebagai ayah so won', 'terbaik film meraih penghargaan film terbaik ajang oscar korea blue dragon film awards premisnya provokatif penampilan pemainnya aktor veteran sol kyung gu bermain apik ayah so won', 'baik film raih harga film baik ajang oscar korea blue dragon film awards premis provokatif tampil main aktor veteran sol kyung gu main apik ayah so won'),
(212, 229, 'kepiawaian damian szifron meramu narasinya dengan cerdas dan efektif memberi efek emosional tersendiri meskipun memiliki asas dan benang merah yang sama namun setiap segmen mampu berdiri sendiri dengan ciri khas masing-masing dengan kekuatan dan pesona masing-masing', 'kepiawaian damian szifron meramu narasinya cerdas efektif efek emosional tersendiri memiliki asas benang merah segmen berdiri ciri khas kekuatan pesona', 'piawai dami szifron meramu narasi cerdas efektif efek emosional sendiri milik asas benang merah segmen diri ciri khas kuat pesona'),
(213, 230, 'whiplash itu rumit energik dan meledak-ledak dalam prosesnya namun tidak sampai menjadi terlalu liar ketika damien chazelle memfokuskan musikalitasnya pada jazz yang penuh sinergi kendali dan perhitungan ya pada akhirnya whiplash menjadi tontonan sederhana namun padat berisi ketika narasi simpelnya berhasil dikembangkan chazelle sampai ke titik didih tertinggi yang mampu menyerang sisi psikologismu', 'whiplash rumit energik meledak-ledak prosesnya liar damien chazelle memfokuskan musikalitasnya jazz penuh sinergi kendali perhitungan ya whiplash tontonan sederhana padat berisi narasi simpelnya berhasil dikembangkan chazelle titik didih tertinggi menyerang sisi psikologismu', 'whiplash rumit energik ledak proses liar damien chazelle fokus musikalitas jazz penuh sinergi kendali hitung ya whiplash tonton sederhana padat isi narasi simpel hasil kembang chazelle titik didih tinggi serang sisi psikologis'),
(214, 231, 'drew barrymore bisa bernapas lega karena debutnya sebagai seorang sutradara ternyata bisa dibilang cukup berhasil setidaknya ia sukses menyampaikan pesan pada filmnya secara efektif dengan menghadirkan sebuah cerita ringan dengan balutan komedi yang segar dan juga pesan-pesan moral yang disampaikan dengan baik', 'drew barrymore bernapas lega debutnya sutradara dibilang berhasil sukses pesan filmnya efektif menghadirkan cerita ringan balutan komedi segar pesan-pesan moral', 'drew barrymore napas lega debut sutradara bilang hasil sukses pesan film efektif hadir cerita ringan balut komedi segar pesan moral'),
(215, 232, 'meski kental dengan nuansa suram dan mencekam di beberapa adegannya susah untuk memberi label horor kepada when marnie was there ya ada nuansa kelam duka dan kesepian dalam balutan surreal terpancar dari setiap pertemuan anna dan marnie namun juga ada kelembutan di balik tragedi dan konfliknya yang berujung pada sebuah ending pahit manis menggetarkan', 'kental nuansa suram mencekam adegannya susah label horor when marnie was there ya nuansa kelam duka kesepian balutan surreal terpancar pertemuan anna marnie kelembutan tragedi konfliknya berujung ending pahit manis menggetarkan', 'kental nuansa suram cekam adegan susah label horor when marnie was there ya nuansa kelam duka sepi balut surreal pancar temu anna marnie lembut tragedi konflik ujung ending pahit manis getar'),
(216, 233, 'semua berhasil dirangkum dengan keriangan ala komedi hitam selandia baru yang kocak dengan sedikit bumbu gore berdarah-darah yang seperti ingin menegaskan bahwa ini masih berada di jalur horor meski diselimuti elemen komedi yang lebih tebal', 'berhasil dirangkum keriangan ala komedi hitam selandia kocak bumbu gore berdarah-darah jalur horor diselimuti elemen komedi tebal', 'hasil rangkum riang ala komedi hitam selandia kocak bumbu gore darah jalur horor selimut elemen komedi tebal'),
(217, 234, 'wer tetap adalah tontonan horor yang seru dan mendebarkan di separuh durasinya bell menginjeksinya dengan aksi cepat dan brutal melibatkan pembantaian besar-besaran yang menghancurkan sekelompok anggota swat bersama dukungan spesial efek garapan robert hall dari almost human yang meyakinkan', 'wer tontonan horor seru mendebarkan separuh durasinya bell menginjeksinya aksi cepat brutal melibatkan pembantaian besar-besaran menghancurkan sekelompok anggota swat dukungan spesial efek garapan robert hall almost human', 'wer tonton horor seru debar paruh durasi bell injeksi aksi cepat brutal libat bantai besar hancur kelompok anggota swat dukung spesial efek garap robert hall almost human'),
(218, 235, 'warrior dengan segala pertarungannya yang keras brutal dan kejam sekejam tatapan tom hardy di sini ia tetap adalah sebuah drama olahraga keluarga yang lembut dan emosional gavin oconnor bisa dibilang sudah berhasil mengerjakan pekerjaannya dengan sangat baik salah satu yang terbaik tahun ini', 'warrior pertarungannya keras brutal kejam sekejam tatapan tom hardy drama olahraga keluarga lembut emosional gavin oconnor dibilang berhasil pekerjaannya salah terbaik', 'warrior tarung keras brutal kejam kejam tatap tom hardy drama olahraga keluarga lembut emosional gavin oconnor bilang hasil kerja salah baik'),
(219, 236, 'ini adalah tontonan yang menyegarkan sekaligus menyenangkan saya menikmati menit pengalaman menonton kisah zombie mungkin sedikit terasa dipaksakan di beberapa bagian namun secara keseluruhan jonathan levine sudah melakukan tugasnya dengan baik dalam rangka menghadirkan sebuah versi lain dari romansa populer romeo juliet dalam latar paska kiamat', 'tontonan menyegarkan menyenangkan menikmati menit pengalaman menonton kisah zombie dipaksakan jonathan levine tugasnya rangka menghadirkan versi romansa populer romeo juliet latar paska kiamat', 'tonton segar senang nikmat menit alam tonton kisah zombie paksa jonathan levine tugas rangka hadir versi romansa populer romeo juliet latar paska kiamat'),
(220, 237, 'sebuah foto memiliki sejuta makna melalui war photographer christian frei sukses menghadirkan sebuah pengalaman luar biasa menonton dokumenter sebuah dokumenter kuat di mana segala permasalahan tentang kemanusiaan perang sosial dan politik mampu terlihat berbeda melalui mata seorang fotografer hebat bernama james nachtwey', 'foto memiliki sejuta makna war photographer christian frei sukses menghadirkan pengalaman menonton dokumenter dokumenter kuat permasalahan kemanusiaan perang sosial politik berbeda mata fotografer hebat bernama james nachtwey', 'foto milik juta makna war photographer christian frei sukses hadir alam tonton dokumenter dokumenter kuat masalah manusia perang sosial politik beda mata fotografer hebat nama james nachtwey'),
(221, 238, 'wadjda itu bagus dan membuatnya menjadi tontonan yang tidak mengada-ada tetapi seperti yang terjadi pada dirinya jika tuhan mengizinkan selalu ada sedikit harapan akan sebuah kehidupan yang lebih baik di sana', 'wadjda bagus membuatnya tontonan mengada-ada tuhan mengizinkan harapan kehidupan', 'wadjda bagus buat tonton ada tuhan izin harap hidup'),
(222, 239, 'fletcher menyajikannya dengan gaya komikal modern dengan sedikit sentuhan surreal membagi-bagi satu jam setengah durasinya dalam chapter pendek yang terus berlanjut dengan banyak kejutan-kejutan kecil di satu sisi ini adalah sajian komedi hitam brutal yang menjadikan setiap momen pembunuhan brutalnya dengan cara yang santai di satu sisi ini juga sebuah coming of age menarik ', 'fletcher menyajikannya gaya komikal modern sentuhan surreal membagi-bagi jam durasinya chapter pendek berlanjut kejutan-kejutan sisi sajian komedi hitam brutal menjadikan momen pembunuhan brutalnya santai sisi coming of age menarik ', 'fletcher saji gaya komikal modern sentuh surreal bagi jam durasi chapter pendek lanjut kejutan sisi saji komedi hitam brutal jadi momen bunuh brutal santai sisi coming of age tarik '),
(223, 240, 'secara keseluruhan hampir di semua segi vertigo tampil sangat solid hitchcock tidak hanya mampu membuat sebuah kisah misteri yang mengusik rasa penasaran namun juga dengan pintar menempatkan penontonnya berada dalam posisi sama tidak tahunya dengan karakter scottie hingga nanti di pertengahan film hitchcock memberikan sebuah jawaban mengejutkan yang akan menampar telak penontonnya naskah hebat tampaknya masih belum cukup jika tidak didukung dengan teknis penggarapan yang hebat pula', 'segi vertigo tampil solid hitchcock kisah misteri mengusik penasaran pintar menempatkan penontonnya posisi tahunya karakter scottie pertengahan film hitchcock mengejutkan menampar telak penontonnya naskah hebat didukung teknis penggarapan hebat', 'segi vertigo tampil solid hitchcock kisah misteri usik penasaran pintar tempat tonton posisi tahu karakter scottie tengah film hitchcock kejut tampar telak tonton naskah hebat dukung teknis garap hebat'),
(224, 241, 'sebagai sebuah film efek dahsyat memanjakan mata mungkin tidak sebanyak trilogi the matrix namun tetap saja kemunculan adegan-adegan aksi pemacu adrenalin tersebut muncul di saat yang tepat dan tidak terlalu berlebihan sehingga membuat segalanya menjadi terasa pas dan akhir kisah perjuangan kebebasan ini berhasil ditutup oleh sebuah adegan dahsyat yang menyisakan pesan moral bagi penontonnya', 'film efek dahsyat memanjakan mata trilogi the matrix kemunculan adegan-adegan aksi pemacu adrenalin muncul pas kisah perjuangan kebebasan berhasil ditutup adegan dahsyat menyisakan pesan moral penontonnya', 'film efek dahsyat manja mata trilogi the matrix muncul adegan aksi pacu adrenalin muncul pas kisah juang bebas hasil tutup adegan dahsyat sisa pesan moral tonton'),
(225, 242, 'dua film dua ide besar yang terbungkus dalam semangat fiksi ilmiah yang kental tidak pernah mudah menghadirkan konsep-konsep brilian seperti yang sudah dilakukan shane carruth upstream color adalah contoh sebuah fiksi ilmiah kecil yang mampu berbicara besar sebesar tema tentang kehidupan cinta dan takdir yang ditawarkan plus mengundang perdebatan asyik setelah menontonnya semuanya ini sukses dihadirkan dalam semangat indie ala carruth yang memesona subtle dan juga emosional', 'film ide terbungkus semangat fiksi ilmiah kental mudah menghadirkan konsep-konsep brilian shane carruth upstream color contoh fiksi ilmiah berbicara tema kehidupan cinta takdir ditawarkan plus mengundang perdebatan asyik menontonnya sukses dihadirkan semangat indie ala carruth memesona subtle emosional', 'film ide bungkus semangat fiksi ilmiah kental mudah hadir konsep brilian shane carruth upstream color contoh fiksi ilmiah bicara tema hidup cinta takdir tawar plus undang debat asyik tonton sukses hadir semangat indie ala carruth pesona subtle emosional'),
(226, 243, 'unstoppable adalah tontonan hiburan yang pas bagi anda para adrenalin junkie yang mendambakan ketegangan tanpa henti ala tony scott siapa lagi yang peduli soal cerita di saat momen-momen breathtaking super cepat tersebut tanpa sadar telah merasuki dan membuat napas anda tertahan cukup lama', 'unstoppable tontonan hiburan pas adrenalin junkie mendambakan ketegangan henti ala tony scott peduli cerita momen-momen breathtaking super cepat sadar merasuki napas tertahan', 'unstoppable tonton hibur pas adrenalin junkie damba tegang henti ala tony scott peduli cerita momen breathtaking super cepat sadar rasuk napas tahan'),
