(228, 245, 'united menjadi personal buat para penggemarnya seperti yang sudah saya tulis di atas karena ia mampu menginspirasi serta mengajak penontonnya untuk melihat bagaimana salah satu tim sepak bola paling hebat di jagat raya ini bangkit dari keterpurukan menjadi seperti yang kita lihat saat ini', 'united personal penggemarnya tulis menginspirasi serta mengajak penontonnya salah tim sepak bola hebat jagat raya bangkit keterpurukan lihat', 'united personal gemar tulis inspirasi serta ajak tonton salah tim sepak bola hebat jagat raya bangkit keterpurukan lihat'),
(229, 246, 'penampakan dan kejutan datang tak terduga dalam presisi yang tepat tanpa harus diekspos secara berlebihan kadar seramnya juga dibangun oleh atmosfer tak nyaman yang dibarengi dengan kemampuan pemainnya yang memesona hasilnya under the shadow menakutkan dengan caranya sendiri yang terbilang efektif dan pintar', 'penampakan kejutan terduga presisi diekspos kadar seramnya dibangun atmosfer nyaman dibarengi kemampuan pemainnya memesona hasilnya under the shadow menakutkan terbilang efektif pintar', 'tampak kejut duga presisi ekspos kadar seram bangun atmosfer nyaman bareng mampu main pesona hasil under the shadow takut bilang efektif pintar'),
(230, 247, 'studi karakter menjadi kunci utama bagaimana tyrannosaur mampu tampil menggigit peter mullan seperti biasa aktor veteran ini memang piawai membawakan karakter pria keras bermasalah karakter joseph itu menarik dan kompleks bak bensin oktan tinggi yang mudah terbakar ketika ada sedikit percikan api saja yang menyentuhnya', 'studi karakter kunci utama tyrannosaur tampil menggigit peter mullan aktor veteran piawai membawakan karakter pria keras bermasalah karakter joseph menarik kompleks bak bensin oktan mudah terbakar percikan api menyentuhnya', 'studi karakter kunci utama tyrannosaur tampil gigit peter mullan aktor veteran piawai bawak karakter pria keras masa karakter joseph tarik kompleks bak bensin oktan mudah bakar percik api sentuh'),
(231, 248, 'jika premis tentang pilihan moral saja belum cukup maka dardenne membuatnya menjadi lebih pelik lagi ketika penontonnya juga dihadapkan pada tokoh sarah yang dimainkan cemerlang oleh cotillard tidak peduli seberapa seringnya sarah mengatakan ia dapat mengerti setiap penolakan toh kita langsung dapat melihat raut kekecewaan dari wajah meyakinkan cotillard yang setia ditangkap melalui pergerakan kamera genggam sederhana bersama take-take panjang khas dardenne ', 'premis pilihan moral dardenne membuatnya pelik penontonnya dihadapkan tokoh sarah dimainkan cemerlang cotillard peduli sarah mengerti penolakan langsung raut kekecewaan wajah cotillard setia ditangkap pergerakan kamera genggam sederhana take-take khas dardenne ', 'premis pilih moral dardenne buat pelik tonton hadap tokoh sarah main cemerlang cotillard peduli sarah erti tolak langsung raut kecewa wajah cotillard setia tangkap gerak kamera genggam sederhana take khas dardenne '),
(232, 249, 'tucker dale vs evil menjadi salah satu film langka nan unik yang berhasil membuat saya terpingkal-pingkal melihat bagaimana kelucuan demi kelucuan kejutan demi kejutan mampu berjalan beriringan sempurna dengan elemen slasher adalah sebuah daya tarik terbesar dari film milik eli crai jarang-jarang ada horor komedi yang mampu tampil sesolid ini apalagi mengingat film ini digarap dengan biaya murah dan sangat sederhana', 'tucker dale vs evil salah film langka nan unik berhasil terpingkal-pingkal kelucuan kelucuan kejutan kejutan berjalan beriringan sempurna elemen slasher daya tarik terbesar film milik eli crai jarang-jarang horor komedi tampil sesolid film digarap biaya murah sederhana', 'tucker dale vs evil salah film langka nan unik hasil pingkal lucu lucu kejut kejut jalan iring sempurna elemen slasher daya tarik besar film milik eli crai jarang horor komedi tampil solid film garap biaya murah sederhana'),
(233, 250, 'triangle bisa dibilang adalah salah satu british horror film terbaik yang pernah dibuat oleh negara ratu elizabeth itu film garapan christopher smith menawarkan sebuah pengalaman berbeda dari kebanyakan film sejenis dengan konsep cerita orisinal yang menggabungkan elemen thriller dan horror supernatural dengan balutan plot twist super rumit yang memaksa penontonnya untuk berkonsentrasi dan berpikir ekstra keras untuk dapat merangkai puzzle misteri yang ingin disampaikan film ini', 'triangle dibilang salah british horror film terbaik negara ratu elizabeth film garapan christopher smith menawarkan pengalaman berbeda kebanyakan film sejenis konsep cerita orisinal menggabungkan elemen thriller horror supernatural balutan plot twist super rumit memaksa penontonnya berkonsentrasi berpikir ekstra keras merangkai puzzle misteri film', 'triangle bilang salah british horror film baik negara ratu elizabeth film garap christopher smith tawar alam beda banyak film jenis konsep cerita orisinal gabung elemen thriller horror supernatural balut plot twist super rumit paksa tonton konsentrasi pikir ekstra keras rangkai puzzle misteri film'),
(234, 251, 'setelah menit pembukaan yang sama memesonanya dengan penampilan james mcavoy trance terjerumus menjadi thriller rumit dan dalam ketiga karakter utamanya punya porsi yang seimbang meskipun pada akhirnya dawson yang menjadi jantung bagi narasinya yang kompleks tetapi yang terpenting dari semua kesenangan itu adalah boyle tidak pernah kehilangan pesonanya dalam membungkus narasinya bersama ciri khasnya yang energik dan berkilau plus hantaman musik keren', 'menit pembukaan memesonanya penampilan james mcavoy trance terjerumus thriller rumit ketiga karakter utamanya porsi seimbang dawson jantung narasinya kompleks terpenting kesenangan boyle kehilangan pesonanya membungkus narasinya ciri khasnya energik berkilau plus hantaman musik keren', 'menit buka pesona tampil james mcavoy trance jerumus thriller rumit tiga karakter utama porsi imbang dawson jantung narasi kompleks penting senang boyle hilang pesona bungkus narasi ciri khas energik kilau plus hantam musik keren'),
(235, 252, 'mungkin ini adalah biopik terbaik yang pernah dibuat oleh perfilman indonesia sebuah kisah sejarah tentang kepahlawanan penuh inspirasi dari seorang cut nyak dien dalam usahanya merebut setiap jengkal tanah rencong dari cengkeraman penjajah yang diisi dengan semangat patriotisme tinggi dan digarap dengan sangat serius bersama balutan teknis penyutradaraan luar biasa eros djarot plus dukungan para pemainnya yang hampir semuanya tampil solid khususnya untuk penampilan cemerlang seorang christine hakim', 'biopik terbaik perfilman indonesia kisah sejarah kepahlawanan penuh inspirasi cut nyak dien usahanya merebut jengkal tanah rencong cengkeraman penjajah diisi semangat patriotisme digarap serius balutan teknis penyutradaraan eros djarot plus dukungan pemainnya tampil solid penampilan cemerlang christine hakim', 'biopik baik film indonesia kisah sejarah pahlawan penuh inspirasi cut nyak dien usaha rebut jengkal tanah rencong cengkeram jajah isi semangat patriotisme garap serius balut teknis sutradara eros djarot plus dukung main tampil solid tampil cemerlang christine hakim'),
(236, 253, 'humor-humornya mungkin tidak sampai terlalu lucu tetapi bagaimana rogen dan goldberg menyajikannya dengan santai tanpa terlihat terlalu memaksakan diri itu yang membuat this is the end menjadi tontonan menyenangkan dan saya masih belum menyebut klimaksnya yang melibatkan iblis raksasa pertobatan surga dan everybody backstreets back ya this is the end mungkin menyajikan klimaks paling edan dari film-film komedi yang saya tonton beberapa tahun ini', 'humor-humornya lucu rogen goldberg menyajikannya santai memaksakan this is the end tontonan menyenangkan menyebut klimaksnya melibatkan iblis raksasa pertobatan surga everybody backstreets back ya this is the end menyajikan klimaks edan film-film komedi tonton', 'humor lucu rogen goldberg saji santai paksa this is the end tonton senang sebut klimaks libat iblis raksasa tobat surga everybody backstreets back ya this is the end saji klimaks edan film komedi tonton'),
(237, 254, 'dari segi teknis harus diakui na hong jin sudah belajar banyak bagaimana harusnya mengeksekusi rangkaian adegan aksinya dengan baik dan bagian itulah yang kemudian menjadikan the yellow sea terasa istimewa apalagi pada akhirnya na hong jin menutup rangkaian kisahnya ini dengan sebuah ending yang sempurna', 'segi teknis diakui na hong jin belajar mengeksekusi rangkaian adegan aksinya menjadikan the yellow sea istimewa na hong jin menutup rangkaian kisahnya ending sempurna', 'segi teknis aku na hong jin ajar eksekusi rangkai adegan aksi jadi the yellow sea istimewa na hong jin tutup rangkai kisah ending sempurna'),
