(240, 257, 'out of furnace berani mengambil resiko tak populer sebuah jalan lain yang lebih berliku lebih lama dan lebih terasa arthouse guna mencapai tujuannya dengan potensi besar menjadi sajian membosankan jika kamu tidak terlalu peduli dengan karakter-karakternya atau teknisnya yang ciamik', 'out of furnace berani mengambil resiko populer jalan berliku arthouse mencapai tujuannya potensi sajian membosankan peduli karakter-karakternya teknisnya ciamik', 'out of furnace berani ambil resiko populer jalan berliku arthouse capai tuju potensi saji bosan peduli karakter teknis ciamik'),
(241, 258, 'rasanya seperti menjadi anak kecil lagi ketika menonton film ini apalagi kalau bukan karena adegan-adegan yang membuat saya tepuk tangan di depan tv ketika masih seorang bocah divisualisasikan dengan begitu realistis dan sangat masterful oleh seorang guillermo del toro', 'anak menonton film adegan-adegan tepuk tangan tv bocah divisualisasikan realistis masterful guillermo del toro', 'anak tonton film adegan tepuk tangan tv bocah visualisasi realistis masterful guillermo del toro'),
