(244, 261, 'paranormal activity sudah menyajikan semuanya segala ketakutan kengerian dan keseraman sebuah horor rumah angker dengan style mockumentary yang realistis di sepanjang kurang lebih jam setengah melalui rekaman-rekaman amatiran yang dibuat micah dan pasangannya katie dari setiap ruang di rumah mereka yang nyaman tidak perlu terlalu berlebihan karena peli tampaknya tahu benar bahwa sesuatu yang tidak terlihat itu akan lebih menakutkan dan lebih efektif mempermainkan imajinasi liar penontonnya', 'paranormal activity menyajikan ketakutan kengerian keseraman horor rumah angker style mockumentary realistis jam rekaman-rekaman amatiran micah pasangannya katie ruang rumah nyaman peli menakutkan efektif mempermainkan imajinasi liar penontonnya', 'paranormal activity saji takut ngeri seram horor rumah angker style mockumentary realistis jam rekaman amatir micah pasang katie ruang rumah nyaman pel takut efektif main imajinasi liar tonton'),
(245, 262, 'tidak dapat dimungkiri kolaborasi komedi british amrik dari ketiganya yang cenderung banyak diisi candaan hinaan fiksi ilmiah dan bromance ditambah dengan dukungan naskah menyenangkan dan teknik penyutradaraan energik dari greg mottola sudah menahbiskan paul sebagai salah satu komedi terbaik tahun ini', 'dimungkiri kolaborasi komedi british amrik ketiganya cenderung diisi candaan hinaan fiksi ilmiah bromance ditambah dukungan naskah menyenangkan teknik penyutradaraan energik greg mottola menahbiskan paul salah komedi terbaik', 'mungkir kolaborasi komedi british amrik tiga cenderung isi canda hina fiksi ilmiah bromance tambah dukung naskah senang teknik sutradara energik greg mottola tahbis paul salah komedi baik'),
(246, 263, 'affandi abdul rachman bisa dibilang sukses meramu sebuah sajian horor menantang dan menegangkan yang tidak melulu terjebak dalam pengeksploitasian penampakan-penampakan makhluk halus semata untuk membangun atmosfer kengeriannya namun bagaimana sisi psikologis karakter-karakternya serta dukungan set yang meyakinkan yang bisa dibilang menjadi senjata utama film ini meneror rasa takut penontonnya sepanjang menit', 'affandi abdul rachman dibilang sukses meramu sajian horor menantang menegangkan melulu terjebak pengeksploitasian penampakan-penampakan makhluk halus membangun atmosfer kengeriannya sisi psikologis karakter-karakternya serta dukungan set dibilang senjata utama film meneror takut penontonnya menit', 'affandi abdul rachman bilang sukses meramu saji horor tantang tegang melulu jebak eksploitasi penampakan makhluk halus bangun atmosfer ngeri sisi psikologis karakter serta dukung set bilang senjata utama film teror takut tonton menit'),
(247, 264, 'cinta dan kiamat kombinasi tidak biasa itu rupanya mampu menghadirkan tontonan fiksi ilmiah romance yang menarik perfect sense bekerja dengan baik di sisi apokaliptik mampu membuat penontonnya turut membayangkan kengerian jika suatu saat sampai benar-benar terjadi di dunia nyata', 'cinta kiamat kombinasi menghadirkan tontonan fiksi ilmiah romance menarik perfect sense sisi apokaliptik penontonnya membayangkan kengerian benar-benar dunia nyata', 'cinta kiamat kombinasi hadir tonton fiksi ilmiah romance tarik perfect sense sisi apokaliptik tonton bayang ngeri benar dunia nyata'),
(248, 265, 'philomena adalah sebuah drama padat menggugah tentang pencarian tidak hanya sekedar menjual narasi pencarian orang hilang dengan segala twist demi twist namun juga sebuah sub teks tentang pencarian jati diri dari dari dua karakter utamanya dua manusia berbeda yang dalam perjalanannya saling menguatkan satu sama lain', 'philomena drama padat menggugah pencarian sekedar menjual narasi pencarian orang hilang twist twist sub teks pencarian jati karakter utamanya manusia berbeda perjalanannya menguatkan', 'philomena drama padat gugah cari sekedar jual narasi cari orang hilang twist twist sub teks cari jati karakter utama manusia beda jalan kuat'),
(249, 266, 'pk adalah komedi satir sosial terbaik yang dimiliki bollywood pk adalah jenis film yang masih menyuapimu secara penuh dengan dialog-dialog pintar dan adegan konyol yang mengocok perut kamu tidak hanya itu kekuatan film ini ada di tangan karakter utama aamir khan yang kembali menunjukkan performanya dengan baik mungkin kali ini adalah performa terbaik yang pernah ia tunjukkan tidak seemosional idiots di beberapa adegan film ini terasa berlebihan dan masih dibumbui dengan musik dan tarian yang asyik nan mengulur waktu', 'pk komedi satir sosial terbaik dimiliki bollywood pk jenis film menyuapimu penuh dialog-dialog pintar adegan konyol mengocok perut kekuatan film tangan karakter utama aamir khan performanya kali performa terbaik tunjukkan seemosional idiots adegan film dibumbui musik tarian asyik nan mengulur', 'pk komedi satir sosial baik milik bollywood pk jenis film suap penuh dialog pintar adegan konyol kocok perut kuat film tangan karakter utama aamir khan performa kali performa baik tunjuk emosional idiots adegan film bumbu musik tari asyik nan ulur'),
(250, 267, 'naskah yang luar biasa ini memang pantas diganjar penghargaan cannes lee chang dong kembali sukses membuktikan bahwa dia adalah seorang pencerita yang luar biasa sebuah narasi yang digarap dengan natural indah dan penuh momen-momen membius didalamnya plus kombinasi karakter kuat dan tema sederhana dan juga getir membuat poetry hadir sebagai salah satu film terbaik tahun ini', 'naskah diganjar penghargaan cannes lee chang sukses membuktikan pencerita narasi digarap natural indah penuh momen-momen membius didalamnya plus kombinasi karakter kuat tema sederhana getir poetry hadir salah film terbaik', 'naskah ganjar harga cannes lee chang sukses bukti cerita narasi garap natural indah penuh momen bius dalam plus kombinasi karakter kuat tema sederhana getir poetry hadir salah film baik'),
(251, 268, 'walaupun unsur fantasi dan magic mungkin tidak banyak ditampilkan di sini namun rupanya hal itu tidak mengurangi pesona film ini kejeniusan miyazaki masih mampu menyihir kita dengan kekuatan ceritanya yang memadukan unsur-unsur heroisme politik petualangan serta romantisme dengan animasinya yang sangat detail dan penuh warna', 'unsur fantasi magic ditampilkan mengurangi pesona film kejeniusan miyazaki menyihir kekuatan ceritanya memadukan unsur-unsur heroisme politik petualangan serta romantisme animasinya detail penuh warna', 'unsur fantasi magic tampil kurang pesona film jenius miyazaki sihir kuat cerita madu unsur heroisme politik tualang serta romantisme animasi detail penuh warna'),
(252, 269, 'ini adalah sebuah studi karakter menarik nan kompleks yang berhasil disajikan villeneuve melalui karakter sang ayah sementara karakter detektif loki oleh gyllenhaal dengan reputasinya yang berhasil memecahkan semua kasus yang ditanganinya mendapat beban hebat ketika kasus penculikan ini seperti sulit menemui titik terang kedua karakter ini dibawakan dengan fantastis baik jackman dan gyllenhaal jackman memberikan lagi salah satu performa terbaiknya setelah les misarables emosinya ketika melihat foto-foto pakaian putrinya itu adalah momen terbaiknya', 'studi karakter menarik nan kompleks berhasil disajikan villeneuve karakter sang ayah karakter detektif loki gyllenhaal reputasinya berhasil memecahkan ditanganinya beban hebat penculikan sulit menemui titik terang karakter dibawakan fantastis jackman gyllenhaal jackman salah performa terbaiknya les misarables emosinya foto-foto pakaian putrinya momen terbaiknya', 'studi karakter tarik nan kompleks hasil saji villeneuve karakter sang ayah karakter detektif loki gyllenhaal reputasi hasil pecah tangan beban hebat culi sulit temu titik terang karakter bawa fantastis jackman gyllenhaal jackman salah performa baik les misarables emosi foto pakai putri momen baik'),
(253, 270, 'plotnya memang generik namun semua kesenangan time travel dengan balutan adrenalin muda plus penggunaan spesial efek tak berlebihan berhasil dituangkan dengan baik oleh israelite kita bisa melihat bagaimana suasana cair bersama kekuatan chemistry yang berhasil dibangun dengan serius tapi santai sejak awal film project almanac tidak pernah menjadikan dirinya sebuah film yang rumit sebaliknya israelite memberinya sedikit elemen persahabatan dan percintaan yang mampu bersanding manis dengan plot utamanya', 'plotnya generik kesenangan time travel balutan adrenalin muda plus penggunaan spesial efek berhasil dituangkan israelite suasana cair kekuatan chemistry berhasil dibangun serius santai film project almanac menjadikan film rumit israelite memberinya elemen persahabatan percintaan bersanding manis plot utamanya', 'plot generik senang time travel balut adrenalin muda plus guna spesial efek hasil tuang israelite suasana cair kuat chemistry hasil bangun serius santai film project almanac jadi film rumit israelite beri elemen sahabat cinta sanding manis plot utama'),
(254, 271, 'rabbit hole adalah sebuah contoh metafora sempurna tentang kepedihan tentang bagaimana memaafkan masa lalu tentang bagaimana mencoba membangun kembali puing-puing kehidupan yang berserakan dengan cinta sebagai perekatnya ya semua momen-momen tersebut sukses dirangkai dengan sangat baik dan indah oleh mitchell dan semuanya menjadi semakin terasa lebih perfect dengan kehadiran para aktor dan aktrisnya yang bermain luar biasa ya sambutlah rabbit hole salah satu drama terbaik tahun lalu', 'rabbit hole contoh metafora sempurna kepedihan memaafkan mencoba membangun puing-puing kehidupan berserakan cinta perekatnya ya momen-momen sukses dirangkai indah mitchell perfect kehadiran aktor aktrisnya bermain ya sambutlah rabbit hole salah drama terbaik', 'rabbit hole contoh metafora sempurna pedih maaf coba bangun puing hidup sera cinta rekat ya momen sukses rangkai indah mitchell perfect hadir aktor aktris main ya sambut rabbit hole salah drama baik'),
(255, 272, 'thailand rupanya tidak hanya jago menakut-nakuti penontonnya dengan sajian horor mereka yang berkualitas namun juga berhasil memukau dengan aksi-aksi bela diri luar biasa dalam film-film laga mereka seperti ong bak dan chocolate jadi bagi para fans martial arts film raging phoenix layak untuk dijadikan pilihan', 'thailand jago menakut-nakuti penontonnya sajian horor berkualitas berhasil memukau aksi-aksi bela film-film laga ong bak chocolate fans martial arts film raging phoenix layak dijadikan pilihan', 'thailand jago takut nakuti tonton saji horor kualitas hasil pukau aksi bela film laga ong bak chocolate fans martial arts film raging phoenix layak jadi pilih'),
(256, 273, 'digarap dengan teknik yang nyaris sempurna baik dari teknik visual sinematografinya yang indah sekaligus suram dan pengembangan karakternya yang luar biasa membuat kita terbius menyaksikan adegan demi adegan yang ditampilkan hingga nantinya mencapai klimaksnya yang tragis', 'digarap teknik sempurna teknik visual sinematografinya indah suram pengembangan karakternya terbius menyaksikan adegan adegan ditampilkan mencapai klimaksnya tragis', 'garap teknik sempurna teknik visual sinematografi indah suram kembang karakter bius saksi adegan adegan tampil capai klimaks tragis'),
(257, 274, 'di bawah arahan gore verbinski rango rupanya sudah melakukan semua yang dapat dilakukan oleh sebuah animasi berkualitas ia jelas menghibur cerdas dalam bertutur dan berkelakar dengan cara yang tidak biasa tanpa melupakan kandungan moralnya setiap momen petualangan disajikan dengan apik dan seru', 'arahan gore verbinski rango animasi berkualitas menghibur cerdas berkelakar melupakan kandungan moralnya momen petualangan disajikan apik seru', 'arah gore verbinski rango animasi kualitas hibur cerdas kelakar lupa kandung moral momen tualang saji apik seru'),
(258, 275, 'kudos pantas diberikan kepada para pemainnya yang bermain apik serta dapat memanaskan suasana sekaligus juga membuktikan jangan meremehkan para orang tua apalagi jika mereka tergabung dalam red karena meskipun wajah mereka sudah penuh dengan keriput rambut sudah mulai botak atau memutih namun bukan berarti mereka tidak berbahaya', 'kudos pemainnya bermain apik serta memanaskan suasana membuktikan meremehkan orang tua tergabung red wajah penuh keriput rambut botak memutih berbahaya', 'kudos main main apik serta panas suasana bukti remeh orang tua gabung red wajah penuh keriput rambut botak mutih bahaya'),
(259, 276, 'saya menikmati setiap menit rigor mortis ya ini masih menjadi sajian horor menyenangkan masih menawarkan sebuah nostalgia dari genre yang sudah lama terlelap masih ada aroma eerie yang terpancar dari setiap sudut dan ruangan bangunan apartemen kumuh nan gelap yang menjadi latarnya', 'menikmati menit rigor mortis ya sajian horor menyenangkan menawarkan nostalgia genre terlelap aroma eerie terpancar sudut ruangan bangunan apartemen kumuh nan gelap latarnya', 'nikmat menit rigor mortis ya saji horor senang tawar nostalgia genre lelap aroma eerie pancar sudut ruang bangun apartemen kumuh nan gelap latar'),
(260, 277, 'rise of the planet of the apes kembali meneruskan tradisi hebat sebuah reboot di awal tahun siapa yang pernah menyangka bahwa ia mampu menjadi sebuah tontonan fiksi ilmiah seluar biasa ini penyutradaraan apik tanpa pernah menjadi terlalu berlebihan dan terlalu bertele-tele naskah yang solid dan tepat sasaran serta performa hebat dari andy serkis dalam balutan simpanse cgi juga tanpa melupakan elemen-elemen pendahulunya', 'rise of the planet of the apes meneruskan tradisi hebat reboot menyangka tontonan fiksi ilmiah seluar penyutradaraan apik bertele-tele naskah solid sasaran serta performa hebat andy serkis balutan simpanse cgi melupakan elemen-elemen pendahulunya', 'rise of the planet of the apes terus tradisi hebat reboot sangka tonton fiksi ilmiah seluar sutradara apik tele naskah solid sasar serta performa hebat andy serkis balut simpanse cgi lupa elemen dahulu'),
(261, 278, 'ini tidak hanya menjadi sebuah film tentang relasi antara manusia dan teknologi bernama robot robot frank jauh lebih dalam dan lebih manusiawi dari itu ketika ia mampu menghadirkan sebuah buddy movie unik dengan chemistry kuat tanpa harus menjadi terlalu melodramatis dan konyol ya mungkin naskahnya tidak terlampau solid mungkin juga terlalu berfokus pada diri frank namun tetap saja kehadiran sosok robotnya menjadi bagian tidak terpisahkan dari perjalanan hangat seorang manusia di usia tuanya yang sendiri dan kesepian plus sebuah twist manis di penghujung ceritanya menjadikan segalanya begitu manis sekaligus menyentuh', 'film relasi manusia teknologi bernama robot robot frank manusiawi menghadirkan buddy movie unik chemistry kuat melodramatis konyol ya naskahnya terlampau solid berfokus frank kehadiran sosok robotnya terpisahkan perjalanan hangat manusia usia tuanya kesepian plus twist manis penghujung ceritanya menjadikan manis menyentuh', 'film relasi manusia teknologi nama robot robot frank manusiawi hadir buddy movie unik chemistry kuat melodramatis konyol ya naskah lampau solid fokus frank hadir sosok robot pisah jalan hangat manusia usia tua sepi plus twist manis hujung cerita jadi manis sentuh'),
(262, 279, 'hepburn tampil begitu cantik dan memesona di semua scene sukses membius saya atau mungkin juga para juri-juri oscar pada saat itu dengan aura magisnya sebagai putri bangsawan yang anggun dan penuh keceriaan sampai-sampai piala emas untuk aktris terbaik pun jatuh ke tangannyayup roman holiday adalah salah satu contoh bagaimana romcom yang bagus itu dibuat', 'hepburn tampil cantik memesona scene sukses membius juri-juri oscar aura magisnya putri bangsawan anggun penuh keceriaan piala emas aktris terbaik jatuh tangannyayup roman holiday salah contoh romcom bagus', 'hepburn tampil cantik pesona scene sukses bius juri oscar aura magis putri bangsawan anggun penuh ceria piala emas aktris baik jatuh tangannyayup roman holiday salah contoh romcom bagus'),
(263, 280, 'sutradara lenny abrahamson bisa dibilang cukup piawai mengolah panggung rapatnya dengan maksimal menghadirkan sebuah kelembutan dan kepolosan dari balik temanya yang keras nan suram naskahnya pun terasa begitu kuat karena emma donoghue sang empunya novel dilibatkan langsung dalam penulisannya selain dukungan narasi yang solid abrahamson banyak dibantu dengan penampilan gemilang brie larson dan jacob tremblay yang harus diakui menjadi alasan kenapa room bisa bekerja dengan sempurna', 'sutradara lenny abrahamson dibilang piawai mengolah panggung rapatnya maksimal menghadirkan kelembutan kepolosan temanya keras nan suram naskahnya kuat emma donoghue sang empunya novel dilibatkan langsung penulisannya dukungan narasi solid abrahamson dibantu penampilan gemilang brie larson jacob tremblay diakui alasan room sempurna', 'sutradara lenny abrahamson bilang piawai mengolah panggung rapat maksimal hadir lembut polos tema keras nan suram naskah kuat emma donoghue sang empunya novel libat langsung tulis dukung narasi solid abrahamson bantu tampil gemilang brie larson jacob tremblay aku alas room sempurna');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(264, 281, 'rurouni kenshin sebuah adaptasi yang setia yang dibuat dengan dedikasi dan semangat besar untuk menyenangkan hati para fans manga dan anime sedikit lemah di naskah dan tipisnya pendalaman beberapa karakter utamanya namun sisanya berhasil ditutupi dengan production value yang mengesankan baik visual sinematografi setting scoring dan koreografi dan terutama pada sektor casting yang meyakinkan', 'rurouni kenshin adaptasi setia dedikasi semangat menyenangkan hati fans manga anime lemah naskah tipisnya pendalaman karakter utamanya sisanya berhasil ditutupi production value mengesankan visual sinematografi setting scoring koreografi sektor casting', 'rurouni kenshin adaptasi setia dedikasi semangat senang hati fans manga anime lemah naskah tipis dalam karakter utama sisa hasil tutup production value kesan visual sinematografi setting scoring koreografi sektor casting'),
(265, 282, 'rush punya presentasi yang sama baiknya dengan naskahnya howard jelas tahu benar bagaimana mendramatisasi sebuah biopik kelas satu bersama dukungan teknis artistik fantastisnya setiap balapan tidak hanya terasa nyata ketika howard dengan cerdas menggabungkan segala footage-footage asli dan desain produksi dan kostum era namun ia juga terlihat cantik dan keren dengan segala efek slow motion dan guyuran hujan yang ditempatkan pada saat yang tepat tanpa harus terkesan berlebihan bersama dukungan sinematografi ciamik dari veteran anthony dod mantle yang berpadu padan dengan scoring epik nan heroik sang master hanz zimmer yang sukses menciptakan aroma magis dunia balap penuh emosi dan adrenalin yang tidak ada duanya', 'rush presentasi baiknya naskahnya howard mendramatisasi biopik kelas dukungan teknis artistik fantastisnya balapan nyata howard cerdas menggabungkan footage-footage asli desain produksi kostum era cantik keren efek slow motion guyuran hujan ditempatkan terkesan dukungan sinematografi ciamik veteran anthony dod mantle berpadu padan scoring epik nan heroik sang master hanz zimmer sukses menciptakan aroma magis dunia balap penuh emosi adrenalin duanya', 'rush presentasi baik naskah howard dramatisasi biopik kelas dukung teknis artistik fantastis balap nyata howard cerdas gabung footage asli desain produksi kostum era cantik keren efek slow motion guyur hujan tempat kesan dukung sinematografi ciamik veteran anthony dod mantle padu padan scoring epik nan heroik sang master hanz zimmer sukses cipta aroma magis dunia balap penuh emosi adrenalin dua'),
(266, 283, 'yap seperti yang saya katakan di atas tadi safe haven itu benar-benar romansa tipikal nicholas sparks yang cheesy dan mellow lengkap dengan visual indah dan scoring lembut semuanya sudah pernah kita lihat sebelumnya jadi tidak ada yang benar-benar baru di sini kecuali wajah cantik penyanyi country dan jebolan dancing with the stars julianne hough yang dipasangkan dengan josh duhamel plus sedikit elemen crime thriller bersama chemistry yang cukup bagus', 'yap safe haven benar-benar romansa tipikal nicholas sparks cheesy mellow lengkap visual indah scoring lembut lihat benar-benar kecuali wajah cantik penyanyi country jebolan dancing with the stars julianne hough dipasangkan josh duhamel plus elemen crime thriller chemistry bagus', 'yap safe haven benar romansa tipikal nicholas sparks cheesy mellow lengkap visual indah scoring lembut lihat benar kecuali wajah cantik penyanyi country jebol dancing with the stars julianne hough pasang josh duhamel plus elemen crime thriller chemistry bagus'),
(267, 284, 'sang penari itu adalah film indonesia yang sangat indonesia sudah lama rasanya tidak ada film dengan berlatar sejarah dan budaya yang digarap sebaik dan seserius ini sang penari jelas punya segalanya untuk menjadikan dirinya sebagai film terbaik yang dimiliki indonesia tahun ini atau tidak berlebihan jika saya menyebutnya sebagai salah satu yang terbaik sepanjang masa', 'sang penari film indonesia indonesia film berlatar sejarah budaya digarap seserius sang penari menjadikan film terbaik dimiliki indonesia menyebutnya salah terbaik', 'sang tari film indonesia indonesia film latar sejarah budaya garap serius sang tari jadi film baik milik indonesia sebut salah baik'),
(268, 285, 'momen bertahan hidupnya mungkin tidak sampai terlalu dalam tetapi kombinasi persahabatan dan survival itu adalah sesuatu yang unik dan berhasil melebur dengan cukup baik bersama narasi kuat garapan kyle kille elemen psikologis kekuatan akting terbaik dari duhamel dan chemistry solid bersama fogler', 'momen bertahan hidupnya kombinasi persahabatan survival unik berhasil melebur narasi kuat garapan kyle kille elemen psikologis kekuatan akting terbaik duhamel chemistry solid fogler', 'momen tahan hidup kombinasi sahabat survival unik hasil lebur narasi kuat garap kyle kille elemen psikologis kuat akting baik duhamel chemistry solid fogler'),
(269, 286, 'tetap saja bagi saya secretariat mampu memberikan sebuah hiburan menyenangkan sebuah feel good dan heartwarming drama yang layak untuk disaksikan bersama keluarga tercinta', 'secretariat hiburan menyenangkan feel good heartwarming drama layak disaksikan keluarga tercinta', 'secretariat hibur senang feel good heartwarming drama layak saksi keluarga cinta'),
(270, 287, 'saya menyukai bagaimana sutradara asal inggris keturunan india ini merangkum semua kekagumannya kepada sosok senna bagaimana ia dan rekan penulis naskahnya manish pandey mampu membuat sebuah dokumenter tampil layaknya sebuah drama biopik olahraga dengan segala unsur dramatis dan momen-momen emosionalnya', 'menyukai sutradara inggris keturunan india merangkum kekagumannya sosok senna rekan penulis naskahnya manish pandey dokumenter tampil layaknya drama biopik olahraga unsur dramatis momen-momen emosionalnya', 'suka sutradara inggris turun india rangkum kagum sosok senna rekan tulis naskah manish pandey dokumenter tampil layak drama biopik olahraga unsur dramatis momen emosional'),
(271, 288, 'senyap bukan dokumenter biasa ia adalah puisi dan teror yang menusuk hati kita sebagai penonton sebuah pengingat dan usaha keras bahwa kita harus berhenti mengakui kehidupan yang telah dihancurkan dan memaksa diri untuk mendengarkan kesenyapan yang menyusulnya adi yang selayaknya sebagai tukang kacamata keliling ini membantu kita melihat lebih jelas dalam kesenyapan membantu mengobati sebuah miopia masal yang sedang kita alami di sekeliling kita sedangkan joshua adalah perangkai dan penulis surat kesenyapan ini kedua orang ini sudah membuat senyap sebagai film dokumenter paling powerful tahun ini', 'senyap dokumenter puisi teror menusuk hati penonton pengingat usaha keras berhenti mengakui kehidupan dihancurkan memaksa mendengarkan kesenyapan menyusulnya adi selayaknya tukang kacamata keliling membantu kesenyapan membantu mengobati miopia masal alami sekeliling joshua perangkai penulis surat kesenyapan orang senyap film dokumenter powerful', 'senyap dokumenter puisi teror tusuk hati tonton ingat usaha keras henti aku hidup hancur paksa dengar senyap susul adi layak tukang kacamata keliling bantu senyap bantu obat miopia masal alami keliling joshua angka tulis surat senyap orang senyap film dokumenter powerful'),
(272, 289, 'seperti film mcdonanght sebelumnya seven psycopaths itu tetap santai dibalik temanya yang serius begitu menyenangkan untuk diikuti karena efek sentuhan komedi gelap kejutan-kejutan luar biasa dialog-dialog pintar penuh sindiran sana-sini yang kocak dan disesaki oleh karakter-karakter sinting bermulut kotor namun sekali lagi bintangnya tetap naskah brilian garapan mcdonanght yang tersusun rapi lapis demi lapis', 'film mcdonanght seven psycopaths santai dibalik temanya serius menyenangkan diikuti efek sentuhan komedi gelap kejutan-kejutan dialog-dialog pintar penuh sindiran sana-sini kocak disesaki karakter-karakter sinting bermulut kotor bintangnya naskah brilian garapan mcdonanght tersusun rapi lapis lapis', 'film mcdonanght seven psycopaths santai balik tema serius senang ikut efek sentuh komedi gelap kejutan dialog pintar penuh sindir sana sini kocak sesak karakter sinting mulut kotor bintang naskah brilian garap mcdonanght susun rapi lapis lapis'),
(273, 290, 'semua kisah di atas itu berhasil dipresentasikan dengan baik oleh ritchie aksi- aksi utama yang berlatar di dermaga dan jembatan london juga digarap dengan spesial efek yang pas dan tidak terlalu berlebihan kemampuan holmes dalam menganalisis sesuatu juga sangat menarik untuk dilihat', 'kisah berhasil dipresentasikan ritchie aksi- aksi utama berlatar dermaga jembatan london digarap spesial efek pas kemampuan holmes menganalisis menarik', 'kisah hasil presentasi ritchie aksi  aksi utama latar dermaga jembatan london garap spesial efek pas mampu holmes analisis tarik'),
(274, 291, 'dan pada akhirnya ketika theme song heaven yang dikumandangkan oleh suara merdu ayumi hamasaki menutup kisah aksi romansa ini ada sebuah perasaan yang tertinggal dari shinobi heart under blade bukan karena jualan adegan pertarungan aksi yang memang keren namun sebuah rasa kehilangan yang sukses ditularkan oboro yang cantik nan malang sebuah kisah cinta tak sampai yang harus diakui sudah meninggalkan kesan cukup dalam di benak saya', 'theme song heaven dikumandangkan suara merdu ayumi hamasaki menutup kisah aksi romansa perasaan tertinggal shinobi heart under blade jualan adegan pertarungan aksi keren kehilangan sukses ditularkan oboro cantik nan malang kisah cinta diakui meninggalkan kesan benak', 'theme song heaven kumandang suara merdu ayum hamasaki tutup kisah aksi romansa asa tinggal shinobi heart under blade jual adegan tarung aksi keren hilang sukses tular oboro cantik nan malang kisah cinta aku tinggal kesan benak'),
(275, 292, 'dari luar shirome memang menawarkan premis menarik menggabungkan sensasi kengerian sebuah urban legend kuno dan reality show modern yang diperankan oleh bintang pop sesungguhnya apalagi mengetahui fakta bahwa koji shiraishi sama sekali tidak pernah memberitahu keenam gadis itu jika ia sedang membuat sebuah film horor meninggalkan mereka dalam ketidak tahuan dan dikelilingi aktor-aktor serta spesial efek yang kemudian sukses menipu mereka hasilnya apa yang akan anda lihat di sepanjang film ini murni reaksi terkejut dan ketakutan sesungguhnya dari para abg ini', 'shirome menawarkan premis menarik menggabungkan sensasi kengerian urban legend kuno reality show modern diperankan bintang pop sesungguhnya fakta koji shiraishi memberitahu keenam gadis film horor meninggalkan ketidak tahuan dikelilingi aktor-aktor serta spesial efek sukses menipu hasilnya lihat film murni reaksi terkejut ketakutan sesungguhnya abg', 'shirome tawar premis tarik gabung sensasi ngeri urban legend kuno reality show modern peran bintang pop sungguh fakta koji shiraishi memberitahu enam gadis film horor tinggal tidak tahu keliling aktor serta spesial efek sukses tipu hasil lihat film murni reaksi kejut takut sungguh abg'),
(276, 293, 'saya suka bagaimana cretton memperlakukan karakternya semua terlihat natural kita bisa merasakan emosinya merasakan bagaimana kepedihan mereka terutama dari diri marcus dan grace yang dimainkan fantastis rasakan atmosfernya nikmati dialog-dialog cerdasnya yang mengalir begitu bebas bersama balutan gambar-gambar cantik dan dukungan alunan musik latar dan soundtrack yang sama bagusnya', 'suka cretton memperlakukan karakternya natural merasakan emosinya merasakan kepedihan marcus grace dimainkan fantastis rasakan atmosfernya nikmati dialog-dialog cerdasnya mengalir bebas balutan gambar-gambar cantik dukungan alunan musik latar soundtrack bagusnya', 'suka cretton laku karakter natural rasa emosi rasa pedih marcus grace main fantastis rasa atmosfer nikmat dialog cerdas alir bebas balut gambar cantik dukung alun musik latar soundtrack bagus'),
(277, 294, 'memang shutter island bukanlah karya terbaik dari seorang martin scorsese namun setidaknya melalui film ini scorsese sukses menghadirkan sebuah thriller psikologis mencekam dengan kualitas di atas rata-rata apalagi ditunjang dengan segi teknis yang sangat baik dan penampilan apik dari aktor-aktor besar yang bermain di dalamnya', 'shutter island karya terbaik martin scorsese film scorsese sukses menghadirkan thriller psikologis mencekam kualitas rata-rata ditunjang segi teknis penampilan apik aktor-aktor bermain dalamnya', 'shutter island karya baik martin scorsese film scorsese sukses hadir thriller psikologis cekam kualitas rata tunjang segi teknis tampil apik aktor main dalam'),
(278, 295, 'jajaran casting bisa jadi salah satu andalan sicario ada nama emily blunt didapuk menjadi karakter sentral dan harus diakui aktris inggris ini kembali bermain baik menjalankan perannya bukan karena hanya ia adalah satu-satunya perempuan di film yang didominasi oleh testosteron yang tangguh di luar dalam sesuatu yang jarang kamu dapati di film sejenis namun juga kompleksitas psikologis dan konsekuensi moral yang kemudian harus dihadapinya', 'jajaran casting salah andalan sicario nama emily blunt didapuk karakter sentral diakui aktris inggris bermain menjalankan perannya satu-satunya perempuan film didominasi testosteron tangguh jarang dapati film sejenis kompleksitas psikologis konsekuensi moral dihadapinya', 'jajar casting salah andal sicario nama emily blunt didapuk karakter sentral aku aktris inggris main jalan peran satu perempuan film dominasi testosteron tangguh jarang dapat film jenis kompleksitas psikologis konsekuensi moral hadap'),
(279, 296, 'silver linings playbook sebuah romcom adaptasi pahit manis yang punya banyak kekuatan besar di dalamnya naskah dan penyutradaraan solid dari david o russell bagaimana piawainya menggabungkan semua tema kegilaan studi karakter romansa dan komedinya menjadi sebuah sinergi kuat yang akan menjebakmu dalam kurang lebih dua jam durasinya bersama penampilan para pemainnya yang ciamik', 'silver linings playbook romcom adaptasi pahit manis kekuatan dalamnya naskah penyutradaraan solid david o russell piawainya menggabungkan tema kegilaan studi karakter romansa komedinya sinergi kuat menjebakmu jam durasinya penampilan pemainnya ciamik', 'silver linings playbook romcom adaptasi pahit manis kuat dalam naskah sutradara solid david o russell piawai gabung tema gila studi karakter romansa komedi sinergi kuat jebak jam durasi tampil main ciamik'),
(280, 297, 'saya suka bagaimana stone tahu benar mengeksplorasi sisi personal nan kompleks edward yang didukung pula oleh performa solid dari joseph gordon levitt kita tahu kapasitas levitt bagaimana akhir-akhir ini ia pintar memilih peran untuk menguji sampai di mana batas kemampuannya bagaimana ia bertransformasi dari karakter fun ke karakter lebih serius dan harus diakui levitt memang memesona di setiap filmnya terakhir ia juga bermain sangat bagus sebagai philippe petit dalam the walk sementara di snowden levitt lagi-lagi tampil meyakinkan', 'suka stone mengeksplorasi sisi personal nan kompleks edward didukung performa solid joseph gordon levitt kapasitas levitt akhir-akhir pintar memilih peran menguji batas kemampuannya bertransformasi karakter fun karakter serius diakui levitt memesona filmnya bermain bagus philippe petit the walk snowden levitt lagi-lagi tampil', 'suka stone eksplorasi sisi personal nan kompleks edward dukung performa solid joseph gordon levitt kapasitas levitt akhir pintar pilih peran uji batas mampu transformasi karakter fun karakter serius aku levitt pesona film main bagus philippe petit the walk snowden levitt lagi tampil'),
(281, 298, 'tampil solid di narasi dan aktingnya sokola rimba juga mendapatkan perlakuan istimewa di teknisnya sinematografi ciamik dari gunnar nimpuno sukses besar mengeksploitasi eksotisnya taman nasional bukit dua belas dengan segala keindahan flora dan sedikit faunanya memberikan kita sebuah pengalaman menonton berbeda yang mungkin belum pernah kita lihat sebelumnya', 'tampil solid narasi aktingnya sokola rimba perlakuan istimewa teknisnya sinematografi ciamik gunnar nimpuno sukses mengeksploitasi eksotisnya taman nasional bukit belas keindahan flora faunanya pengalaman menonton berbeda lihat', 'tampil solid narasi akting sokola rimba laku istimewa teknis sinematografi ciamik gunnar nimpuno sukses eksploitasi eksotis taman nasional bukit belas indah flora fauna alam tonton beda lihat'),
(282, 299, 'nemes memang tidak terlalu mengeksploitasi kekejamannya dengan menghadirkan gambar-gambar tentang pembantaian itu secara gamblang namun caranya mengambil perspektif berbeda menjadi sesuatu yang istimewa', 'nemes mengeksploitasi kekejamannya menghadirkan gambar-gambar pembantaian gamblang mengambil perspektif berbeda istimewa', 'nemes eksploitasi kejam hadir gambar bantai gamblang ambil perspektif beda istimewa'),
(283, 300, 'ini adalah salah satu yang terbaik dari seorang tomas alfredson sebuah thriller cerdas penuh konflik menarik dan parade akting memukau dari barisan aktor-aktor papan atasnya', 'salah terbaik tomas alfredson thriller cerdas penuh konflik menarik parade akting memukau barisan aktor-aktor papan atasnya', 'salah baik tomas alfredson thriller cerdas penuh konflik tarik parade akting pukau baris aktor papan atas'),
(284, 301, 'menonton seluruh film ini terasa seperti sedang bermimpi adegan demi adegan tak terduga mengalir dan begitu pas banyak pesan tersembunyi dan karakter-karakter aneh yang tidak akan pernah kalian jumpai miyazaki menempatkan semacam emosi berbelit-belit di setiap konflik yang ada di filmnya membuat film ini lebih sekedar tontonan keluarga saya yakin kalau setelah menonton film ini kalian tidak akan melupakan film ini selama beberapa bulan karena kesan yang didapat begitu melekat di kepala', 'menonton film bermimpi adegan adegan terduga mengalir pas pesan tersembunyi karakter-karakter aneh jumpai miyazaki menempatkan emosi berbelit-belit konflik filmnya film sekedar tontonan keluarga menonton film melupakan film kesan melekat kepala', 'tonton film mimpi adegan adegan duga alir pas pesan sembunyi karakter aneh jumpa miyazaki tempat emosi belit konflik film film sekedar tonton keluarga tonton film lupa film kesan lekat kepala'),
(285, 302, 'mungkin banyak orang yang tidak menyangka termasuk saya bahwa sebuah film horror kecil seperti splinter ini di luar dugaan mampu memberikan sebuah sajian horor dengan kualitas besar ya film garapan sutradara sekaligus penulis naskah toby wilkins ini mampu menjadi salah satu dari sedikit horror berbiaya rendah yang sukses mendobrak anggapan bahwa horor murah itu identik dengan horor kelas b yang hanya mengumbar cerita murahan', 'orang menyangka film horror splinter dugaan sajian horor kualitas ya film garapan sutradara penulis naskah toby wilkins salah horror berbiaya rendah sukses mendobrak anggapan horor murah identik horor kelas b mengumbar cerita murahan', 'orang sangka film horror splinter duga saji horor kualitas ya film garap sutradara tulis naskah toby wilkins salah horror biaya rendah sukses dobrak anggap horor murah identik horor kelas b umbar cerita murah'),
(286, 303, 'ada keseimbangan luar biasa berhasil dibuat mccarthy di sini ketika menerjemahkan naskah adaptasinya kamu bisa merasakan keasyikan dari sebuah thriller investigasi dengan tensi yang terjaga rapi di saat tim melakukan penyelidikan sebagai jurnalis setiap pemainnya bermain begitu cemerlang membawakan peran mereka masing-masing sesuai kapasitasnya tanpa terlihat harus terlalu berlebihan sementara elemen dramanya juga bekerja sama bagusnya saya suka bagaimana mccarthy mengakhiri semuanya dengan cara yang begitu elegan dan berkesan ya itu adalah ending yang bagus dari sebuah film yang sama bagusnya', 'keseimbangan berhasil mccarthy menerjemahkan naskah adaptasinya merasakan keasyikan thriller investigasi tensi terjaga rapi tim penyelidikan jurnalis pemainnya bermain cemerlang membawakan peran sesuai kapasitasnya elemen dramanya bagusnya suka mccarthy elegan berkesan ya ending bagus film bagusnya', 'keseimbangan hasil mccarthy terjemah naskah adaptasi rasa asyik thriller investigasi tensi jaga rapi tim selidik jurnalis main main cemerlang bawa peran sesuai kapasitas elemen drama bagus suka mccarthy elegan kesan ya ending bagus film bagus'),
(287, 304, 'ada james franco yang tampil fantastis sebagai gangster rasta bisa jadi ini peran terbaik franco setelah hours yang menyakitkan itu penampilannya sebagai alien mungkin terlihat seperi badut di awal-awal kemunculannya dengan segala logat anehnya namun pertemuannya dengan para babes kuliahan itu merubah karakternya menjadi lebih manusiawi di penghujung film yang nantinya ditutup dengan lights milik ellie goulding yang energik', 'james franco tampil fantastis gangster rasta peran terbaik franco hours menyakitkan penampilannya alien seperi badut awal-awal kemunculannya logat anehnya pertemuannya babes kuliahan merubah karakternya manusiawi penghujung film ditutup lights milik ellie goulding energik', 'james franco tampil fantastis gangster rasta peran baik franco hours sakit tampil alien peri badut awal muncul logat aneh temu babes kuliah rubah karakter manusiawi hujung film tutup lights milik ellie goulding energik'),
(288, 305, 'plotnya mungkin familiar bahkan kita mungkin tahu bagaimana ia berakhir tetapi theodore melfi punya kekuatan dari dukungan casting bagus yang mampu membuat segalanya menjadi berbeda bill murray menjalankan peran yang biasanya dimainkan fantastis oleh jack nicholson dengan sama baiknya sementara lawan mainnya si kecil jaeden lieberher juga tidak kalah bersinarnya di balik wajah imut lieberher memberi kekuatan seimbang buat murray dengan segala kepolosan kecerdasan dan mulut yang tidak kalah tajamnya', 'plotnya familiar theodore melfi kekuatan dukungan casting bagus berbeda bill murray menjalankan peran dimainkan fantastis jack nicholson baiknya lawan mainnya si jaeden lieberher kalah bersinarnya wajah imut lieberher kekuatan seimbang murray kepolosan kecerdasan mulut kalah tajamnya', 'plot familiar theodore melfi kuat dukung casting bagus beda bill murray jalan peran main fantastis jack nicholson baik lawan main si jaeden lieberher kalah sinar wajah imut lieberher kuat imbang murray polos cerdas mulut kalah tajam'),
(289, 306, 'jj abrams sukses menghadirkan star trek versinya dengan kombinasi cerita yang kuat dan adegan-adegan aksi seru yang seimbang apalagi ditunjang dengan dukungan efek cgi yang mumpuni menjadikan dunia star trek yang luar biasa dapat digambarkan dengan sangat baik dan mendetail di sini ', 'jj abrams sukses menghadirkan star trek versinya kombinasi cerita kuat adegan-adegan aksi seru seimbang ditunjang dukungan efek cgi mumpuni menjadikan dunia star trek digambarkan mendetail ', 'jj abrams sukses hadir star trek versi kombinasi cerita kuat adegan aksi seru imbang tunjang dukung efek cgi mumpuni jadi dunia star trek gambar detail '),
(290, 307, 'pondasi yang kuat sudah dibangun oleh jj abrams di dua seri pertamanya secara tidak langsung sudah membuat versi modern star trek ini bisa menjadi begitu kuat terutama dari eksplorasi karakter-karakter utama dan chemistry di antara mereka star trek adalah permulaan baru yang luar biasa sementara star trek into darkness yang rilis tahun kemudian pun tidak kalah hebatnya termasuk menampilkan kembali salah satu villain paling powerful', 'pondasi kuat dibangun jj abrams seri pertamanya langsung versi modern star trek kuat eksplorasi karakter-karakter utama chemistry star trek permulaan star trek into darkness rilis kalah hebatnya menampilkan salah villain powerful', 'pondasi kuat bangun jj abrams seri pertama langsung versi modern star trek kuat eksplorasi karakter utama chemistry star trek mula star trek into darkness rilis kalah hebat tampil salah villain powerful'),
(291, 308, 'saya suka perpaduan kekontrasannya antara tua dan muda antara modern dan kuno keglamoran dan kesederhanaan yang dileburkan dengan sangat manis oleh sebuah perjalanan mencari jati diri dalam penceritaan baker dan chris bergoch yang tidak pernah mengendur narasinya memang terkesan sederhana namun di balik itu ada sebuah kekompleksan tersendiri yang coba perlahan dijabarkan baker melalui dua karakter utamanya', 'suka perpaduan kekontrasannya tua muda modern kuno keglamoran kesederhanaan dileburkan manis perjalanan mencari jati penceritaan baker chris bergoch mengendur narasinya terkesan sederhana kekompleksan tersendiri coba perlahan dijabarkan baker karakter utamanya', 'suka padu kontras tua muda modern kuno glamor sederhana lebur manis jalan cari jati cerita baker chris bergoch kendur narasi kesan sederhana kompleks sendiri coba perlahan jabar baker karakter utama'),
(292, 309, 'steve jobs memang tidak menawarkan sebuah plot konvensional yang mungkin akan membuat sebagian penontonnya tak nyaman tetapi setiap momen penting dalam hidup jobs berhasil dibentuk dalam sebuah narasi padat dalam bungkusan rangkaian dialog-dialog luar biasa yang mungkin hanya bisa dibuat oleh kepiawaian seorang aaron sorkin setiap momen begitu efektif membius penontonnya', 'steve jobs menawarkan plot konvensional penontonnya nyaman momen hidup jobs berhasil dibentuk narasi padat bungkusan rangkaian dialog-dialog kepiawaian aaron sorkin momen efektif membius penontonnya', 'steve jobs tawar plot konvensional tonton nyaman momen hidup jobs hasil bentuk narasi padat bungkus rangkai dialog piawai aaron sorkin momen efektif bius tonton'),
(293, 310, 'dengan memberikan pondasi kuat pada karakter alice plotnya menjadi lebih menarik dalam perjalanannya memasuki konflik nanti kita melihat alice sebagai sosok perempuan yang nyaris sempurna ia punya segalanya sampai kemudian ia terancam kehilangan segalanya ada sebuah proses yang berhasil dirangkum glatzer dan westmoreland dengan menggunakan pendekatan intim depresif dan heartbreaking tanpa harus terkesan berusaha keras memanipulasi penontonnya dengan tetek bengek momen melodrama sentimentil', 'pondasi kuat karakter alice plotnya menarik perjalanannya memasuki konflik alice sosok perempuan sempurna terancam kehilangan proses berhasil dirangkum glatzer westmoreland pendekatan intim depresif heartbreaking terkesan berusaha keras memanipulasi penontonnya tetek bengek momen melodrama sentimentil', 'pondasi kuat karakter alice plot tarik jalan masuk konflik alice sosok perempuan sempurna ancam hilang proses hasil rangkum glatzer westmoreland dekat intim depresif heartbreaking kesan usaha keras manipulasi tonton tetek bengek momen melodrama sentimentil'),
(294, 311, 'sama seperti pendahulunya straw dogs buatan rod lurie ini bukan thriller yang terlampau istimewa ia masih menawarkan cerita yang sama karakter sama dan pesan yang sama tapi kemudian menjadi menarik karena ia disajikan dalam kemasan modern yang lebih menyegarkan lebih mengasyikkan lebih brutal dan tentu saja lebih seksi ketimbang apa yang sudah dibuat versi aslinya dekade lalu', 'pendahulunya straw dogs buatan rod lurie thriller terlampau istimewa menawarkan cerita karakter pesan menarik disajikan kemasan modern menyegarkan mengasyikkan brutal seksi ketimbang versi aslinya dekade', 'dahulu straw dogs buat rod lurie thriller lampau istimewa tawar cerita karakter pesan tarik saji kemas modern segar asyik brutal seksi ketimbang versi asli dekade'),
(295, 312, 'suicide club bisa dibilang adalah suguhan j-horror unik aneh dan juga absurd namun d isisi lain juga sebagai sebuah studi moral tentang gejolak sosial yang berkembang di masyarakat yang disajikan sion sono melalui rangkaian simbolisme dan metafora mengerikan di dalamnya', 'suicide club dibilang suguhan j-horror unik aneh absurd d isisi studi moral gejolak sosial berkembang masyarakat disajikan sion sono rangkaian simbolisme metafora mengerikan dalamnya', 'suicide club bilang suguh j horror unik aneh absurd d isis studi moral gejolak sosial kembang masyarakat saji sion sono rangkai simbolisme metafora erik dalam'),
(296, 313, 'hangat manis kocak dan menyentuh tidak ada drama korea selatan tentang persahabatan yang digarap sebaik ini sebelumnya ini adalah jenis film yang mampu memberikan efek langsung kepada penontonnya membuat anda memikirkan hei bagaimana ya kabar teman-teman smu dan smp sunny akan membuat anda mengingat kembali masa-masa luar biasa itu', 'hangat manis kocak menyentuh drama korea selatan persahabatan digarap jenis film efek langsung penontonnya memikirkan hei ya kabar teman-teman smu smp sunny masa-masa', 'hangat manis kocak sentuh drama korea selatan sahabat garap jenis film efek langsung tonton pikir hei ya kabar teman smu smp sunny masa'),
(297, 314, 'super sukses menempatkan dirinya sebagai sebuah drama superhero yang menarik menghibur dan juga bisa dibilang gila perpaduan nyeleneh antara kick-ass dan defendor sebuah black comedy dewasa depresif dan brutal yang kemudian membungkus dirinya dengan sebuah satir sosial tentang kisah kepahlawanan dan pencarian jati diri seorang anak manusia dalam mencari tujuan hidupnya di beberapa poin super bahkan terlihat lebih baik dari kick-ass', 'super sukses menempatkan drama superhero menarik menghibur dibilang gila perpaduan nyeleneh kick-ass defendor black comedy dewasa depresif brutal membungkus satir sosial kisah kepahlawanan pencarian jati anak manusia mencari tujuan hidupnya poin super kick-ass', 'super sukses tempat drama superhero tarik hibur bilang gila padu nyeleneh kick ass defendor black comedy dewasa depresif brutal bungkus satir sosial kisah pahlawan cari jati anak manusia cari tuju hidup poin super kick ass'),
(298, 315, 'hal positif lainnya dari swiss army man adalah kepiawaian scheinert dan kwan mengarahkan ke mana filmnya akan dibawa menjadikannya sulit ditebak hingga ditutup dengan konklusi yang cukup menarik dan tak disangka-sangka swiss army man berhasil membawa sajian yang orisinal dan berbeda dengan suasana yang menyenangkan', 'positif swiss army man kepiawaian scheinert kwan mengarahkan filmnya dibawa menjadikannya sulit ditebak ditutup konklusi menarik disangka-sangka swiss army man berhasil membawa sajian orisinal berbeda suasana menyenangkan', 'positif swiss army man piawai scheinert kwan arah film bawa jadi sulit tebak tutup konklusi tarik sangka swiss army man hasil bawa saji orisinal beda suasana senang'),
(299, 316, 'ada nilai-nilai dan pesan besar di baliknya setiap rendang batokok dan gulai kepala ikan pesan-pesan tentang keragaman sosial-budaya spirit gotong royong yang mulai memudar tentang menyatukan perbedaan dalam semangat bhinneka tunggal ika tentang bagaimana untuk tidak pernah menyerah dalam menjalani hidup sesusah apapun itu dan tentang kesempatan kedua untuk memulai segala sesuatu kembali tanpa prasangka seperti arti dari judulnya yang manis', 'nilai-nilai pesan baliknya rendang batokok gulai kepala ikan pesan-pesan keragaman sosial-budaya spirit gotong royong memudar menyatukan perbedaan semangat bhinneka tunggal ika menyerah menjalani hidup sesusah apapun kesempatan prasangka arti judulnya manis', 'nilai pesan balik rendang batokok gulai kepala ikan pesan ragam sosial budaya spirit gotong royong pudar satu beda semangat bhinneka tunggal ika serah jalan hidup susah apa sempat prasangka arti judul manis'),
(300, 317, 'naskah olahan reema kagti yang juga bertindak sebagai sutradara bersama bantuan rekannya zoya akhtar tersaji rapi membuatmu mau tidak mau tejebak dalam pusaran teka-teki yang juga akan mengajakmu untuk bermain menjadi seorang detektif bersama aamir khan dengan kumis aneh dan muka jutek guna menerka-nerka apa yang sebenarnya terjadi di sana', 'naskah olahan reema kagti bertindak sutradara bantuan rekannya zoya akhtar tersaji rapi membuatmu tejebak pusaran teka-teki mengajakmu bermain detektif aamir khan kumis aneh muka jutek menerka-nerka', 'naskah olah reema kagti tindak sutradara bantu rekan zoya akhtar saji rapi buat tejebak pusar teka teki ajak main detektif aamir khan kumis aneh muka jutek terka nerka'),
(301, 318, 'di atas itu semua hanung sebagai sutradara berhasil menjadi dirigen yang baik yang menyatukan kekuatan pendukung filmnya menjadi sebuah sajian yang lengkap dihadirkan dalam rangkaian cerita yang mengena plus berbalut tatanan teknis yang mumpuni seperti sinematografi ciamik dari yadi sugandi yang berhasil menangkap gambar-gambar cantik perkampungan pasar baru', 'hanung sutradara berhasil dirigen menyatukan kekuatan pendukung filmnya sajian lengkap dihadirkan rangkaian cerita mengena plus berbalut tatanan teknis mumpuni sinematografi ciamik yadi sugandi berhasil menangkap gambar-gambar cantik perkampungan pasar', 'hanung sutradara hasil dirigen satu kuat dukung film saji lengkap hadir rangkai cerita kena plus balut tatanan teknis mumpuni sinematografi ciamik yad sugandi hasil tangkap gambar cantik kampung pasar'),
(302, 319, 'kisah putri dengan rambut sepanjang kaki ini mampu dikemas dengan sangat baik bersahabat dan menghibur plus balutan animasi dengan kualitas jempolan menjadikan rapunzel cukup pantas untuk disejajarkan dengan animasi klasik terbaik disney lainnya', 'kisah putri rambut kaki dikemas bersahabat menghibur plus balutan animasi kualitas jempolan menjadikan rapunzel disejajarkan animasi klasik terbaik disney', 'kisah putri rambut kaki kemas sahabat hibur plus balut animasi kualitas jempol jadi rapunzel sejajar animasi klasik baik disney'),
(303, 320, 'taxi driver jelas adalah salah satu karya terbaik dari martin scorsese dengan cerita yang kuat dan dengan dukungan aktor sekaliber robert de niro membuat film ini mampu memberikan sebuah gambaran yang cukup realistis tentang kehidupan masyarakat amerika khususnya masyarakat kota new york pada era lengkap dengan segala konflik sosial yang terjadi pada masyarakatnya', 'taxi driver salah karya terbaik martin scorsese cerita kuat dukungan aktor sekaliber robert de niro film gambaran realistis kehidupan masyarakat amerika masyarakat kota new york era lengkap konflik sosial masyarakatnya', 'taxi driver salah karya baik martin scorsese cerita kuat dukung aktor kaliber robert de niro film gambar realistis hidup masyarakat amerika masyarakat kota new york era lengkap konflik sosial masyarakat'),
(304, 321, 'sang terminator uzur dibalut dengan kulit sintetis yang menyelubungi tulang-belulang bajanya kulit bukan hanya sekedar kulit mirip manusia namun juga mampu menua dan mengeriput layaknya sebuah kulit alami belum lagi taylor memberi sentuhan humanis buat karakternya elemen ini yang kemudian mampu membuat terminator versi genisys menjadi jauh lebih manusiawi ketimbang seri-seri sebelumnya lengkap dengan joke-joke one liner khas arnie', 'sang terminator uzur dibalut kulit sintetis menyelubungi tulang-belulang bajanya kulit sekedar kulit manusia menua mengeriput layaknya kulit alami taylor sentuhan humanis karakternya elemen terminator versi genisys manusiawi ketimbang seri-seri lengkap joke-joke one liner khas arnie', 'sang terminator uzur balut kulit sintetis selubung tulang belulang baja kulit sekedar kulit manusia tua keriput layak kulit alami taylor sentuh humanis karakter elemen terminator versi genisys manusiawi ketimbang seri lengkap joke one liner khas arnie'),
(305, 322, 'ini adalah biopik yang indah setidaknya secara fisik yang terlihat kasat mata itulah faktanya dari menit-menit awal ia dibuka testament of youth menampilkan lanskap-lanskap cantik memancarkan sebuah aroma tenang namun sendu yang diperkuat dengan scoring garapan komposer jerman-inggris max richter yang lembut meskipun di bagian pembuka ada wajah sedih dari karakter utama kita sebelum filmnya melompat beberapa tahun ke belakang', 'biopik indah fisik kasat mata faktanya menit-menit dibuka testament of youth menampilkan lanskap-lanskap cantik memancarkan aroma tenang sendu diperkuat scoring garapan komposer jerman-inggris max richter lembut pembuka wajah sedih karakter utama filmnya melompat', 'biopik indah fisik kasat mata fakta menit buka testament of youth tampil lanskap cantik pancar aroma tenang sendu kuat scoring garap komposer jerman inggris max richter lembut buka wajah sedih karakter utama film lompat'),
(306, 323, 'that evening sun adalah sebuah drama dengan semangat indie yang kental ceritanya yang simpel tidak membuat film satu ini kehilangan pesan-pesan kuatnya pesan tentang bagaimana manusia mempertahankan kenangan masa lalu yang menurutnya sangat berharga pesan tentang pelajaran hidup bahkan untuk orang lanjut usia sekalipun semuanya disajikan dengan kesederhanaan dan dukungan akting realistis dari para pemainnya', 'that evening sun drama semangat indie kental ceritanya simpel film kehilangan pesan-pesan kuatnya pesan manusia mempertahankan kenangan menurutnya berharga pesan pelajaran hidup orang usia disajikan kesederhanaan dukungan akting realistis pemainnya', 'that evening sun drama semangat indie kental cerita simpel film hilang pesan kuat pesan manusia tahan kenang turut harga pesan pelajaran hidup orang usia saji sederhana dukung akting realistis main'),
(307, 324, 'tidak banyak film-film produksi philipina yang saya tonton namun beruntung saya selalu sukses mendapatkan film-film bagus ketika mencoba menontonnya misalnya seperti komedi romantis indie milik sutradara pemula antoinette jadaone yang direkomendasikan oleh teman dan suhu saya dari movievora that thing called tadhana bisa dibilang adalah kejutan yang benar-benar menyenangkan', 'film-film produksi philipina tonton beruntung sukses film-film bagus mencoba menontonnya komedi romantis indie milik sutradara pemula antoinette jadaone direkomendasikan teman suhu movievora that thing called tadhana dibilang kejutan benar-benar menyenangkan', 'film produksi philipina tonton untung sukses film bagus coba tonton komedi romantis indie milik sutradara mula antoinette jadaone rekomendasi teman suhu movievora that thing called tadhana bilang kejut benar senang'),
(308, 325, 'oconnor mampu memaksimalkan karisma ben affleck yang tampil oke di sepanjang film sebagai sosok tangguh unik dan penuh kejutan tidak banyak adegan aksi yang dihadirkan namun ketika ada itu bisa sangat berkesan lihat saja bagaimana koreografi aksinya dibuat dengan sangat baik baik baku hantam jarak dekat atau menggunakan senjata begitu efektif begitu mematikan tanpa harus terlihat berlebihan yah sedikit banyak mengingatkan saya pada john wick yang keren itu', 'oconnor memaksimalkan karisma ben affleck tampil oke film sosok tangguh unik penuh kejutan adegan aksi dihadirkan berkesan lihat koreografi aksinya baku hantam jarak senjata efektif mematikan yah john wick keren', 'oconnor maksimal karisma ben affleck tampil oke film sosok tangguh unik penuh kejut adegan aksi hadir kesan lihat koreografi aksi baku hantam jarak senjata efektif mati yah john wick keren'),
(309, 326, 'apa yang disajikan joshua oppenheimer secara berani provokatif jujur dan blakblakan ini seperti menjadi sebuah kenyataan pahit yang pada akhirnya harus kita terima suka atau tidak', 'disajikan joshua oppenheimer berani provokatif jujur blakblakan kenyataan pahit terima suka', 'saji joshua oppenheimer berani provokatif jujur blakblakan nyata pahit terima suka'),
(310, 327, 'cepat seru dan sangat menyenangkan sebuah tontonan yang tidak hanya ditujukan buat para veteran tintin tapi untuk siapa saja yang menyukai film petualangan yang menghibur yap itulah yang saya rasakan dalam debut animasi perdana seorang steven spielberg spielberg tidak hanya sukses membuat tintin merasakan kembali kejayaannya seperti yang pernah dialaminya beberapa dekade lalu tapi bersama peter jackson ia juga sudah membuat sosok reporter yang haus petualangan dan misteri ini dan dunia di dalamnya menjadi terlihat jauh lebih bagus dan tentunya lebih hidup dari komiknya dalam balutan animasi yang luar biasa', 'cepat seru menyenangkan tontonan veteran tintin menyukai film petualangan menghibur yap rasakan debut animasi perdana steven spielberg spielberg sukses tintin merasakan kejayaannya dialaminya dekade peter jackson sosok reporter haus petualangan misteri dunia dalamnya bagus hidup komiknya balutan animasi', 'cepat seru senang tonton veteran tintin suka film tualang hibur yap rasa debut animasi perdana steven spielberg spielberg sukses tintin rasa jaya alami dekade peter jackson sosok reporter haus tualang misteri dunia dalam bagus hidup komik balut animasi'),
(311, 328, 'disajikan dengan pace yang terjaga baik membuat menit terasa terbang begitu cepat teknis visual dihadirkan dengan lembut oleh david lanzenberg memancarkan aroma misterius sekaligus romantis tetapi kekuatan terbesar the age of adaline tidak hanya pada konsep fiksi ilmiahi fantasinya tetapi juga pada diri blake lively yang tampil fantastis menggerakkan narasinya tidak hanya pesona fisik dan kecantikannya namun bagaimana ia mengisi jiwa adaline dengan sempurna lengkap dengan kekuatan dan kerapuhannya', 'disajikan pace terjaga menit terbang cepat teknis visual dihadirkan lembut david lanzenberg memancarkan aroma misterius romantis kekuatan terbesar the age of adaline konsep fiksi ilmiahi fantasinya blake lively tampil fantastis menggerakkan narasinya pesona fisik kecantikannya mengisi jiwa adaline sempurna lengkap kekuatan kerapuhannya', 'saji pace jaga menit terbang cepat teknis visual hadir lembut david lanzenberg pancar aroma misterius romantis kuat besar the age of adaline konsep fiksi ilmiah fantasi blake lively tampil fantastis gerak narasi pesona fisik cantik isi jiwa adaline sempurna lengkap kuat rapuh'),
(312, 329, 'jajaran pemainnya tampil solid bahkan penampilan apik dari jean dujardin dan berenice bejo yang mungkin membuat anda percaya bahwa mereka adalah aktor dan aktris yang terlahir tahun lalu khususnya dujardin yang sukses menghadirkan pesona kuat sebagai george valentin tidak heran jika kemudian ia banyak memperoleh penghargaan bergengsi di berbagai ajang penghargaan film internasional dariadegan pembuka yang hebat momen mimpi george yang mengejutkan sampai puncaknya sebuah suguhan kolaborasi tap dance cantik dan dialog bersuara pertama siapa yang kemudian menyangka bahwa the artist dalam perjalanannya mampu menyeruak sebagai salah satu kandidat film terbaik tahun ini ', 'jajaran pemainnya tampil solid penampilan apik jean dujardin berenice bejo percaya aktor aktris terlahir dujardin sukses menghadirkan pesona kuat george valentin heran memperoleh penghargaan bergengsi ajang penghargaan film internasional dariadegan pembuka hebat momen mimpi george mengejutkan puncaknya suguhan kolaborasi tap dance cantik dialog bersuara menyangka the artist perjalanannya menyeruak salah kandidat film terbaik ', 'jajar main tampil solid tampil apik jean dujardin berenice bejo percaya aktor aktris lahir dujardin sukses hadir pesona kuat george valentin heran oleh harga gengsi ajang harga film internasional dariadegan buka hebat momen mimpi george kejut puncak suguh kolaborasi tap dance cantik dialog suara sangka the artist jalan seruak salah kandidat film baik '),
(313, 330, 'melihat pekerjaan bagus yang sudah dibuat steven silver di sini dalam menghadirkan sebuah biopik semi dokumenter kisah nyata dari orang foto jurnalis paling berani di dunia ini saya yakin bahwa novel the bang-bang club pasti adalah sebuah bacaan yang bagus sebagus filmnya yang mampu menginspirasi dan menggugah sisi emosional saya di saat bersamaan', 'pekerjaan bagus steven silver menghadirkan biopik semi dokumenter kisah nyata orang foto jurnalis berani dunia novel the bang-bang club bacaan bagus sebagus filmnya menginspirasi menggugah sisi emosional bersamaan', 'kerja bagus steven silver hadir biopik semi dokumenter kisah nyata orang foto jurnalis berani dunia novel the bang club baca bagus bagus film inspirasi gugah sisi emosional sama'),
(314, 331, 'beruntung kisah percintaan dewasa di era kini digarap lebih baik adalah pesona james marsden ia menggantikan posisi almarhum paul walker yang terlihat tua dan bijak serta kelembutan michelle monaghan berhasil menciptakan chemistry kuat', 'beruntung kisah percintaan dewasa era digarap pesona james marsden menggantikan posisi almarhum paul walker tua bijak serta kelembutan michelle monaghan berhasil menciptakan chemistry kuat', 'untung kisah cinta dewasa era garap pesona james marsden ganti posisi almarhum paul walker tua bijak serta lembut michelle monaghan hasil cipta chemistry kuat'),
(315, 332, 'dengan jajaran pemain sementereng ini susah untuk tidak terpikat dengan the big short terlepas tidak atau tahunya kamu tentang apa yang ditawarkan isinya buat saya ini adalah sebuah pengalaman menonton sembari belajar yang mungkin paling menyenangkan yang bisa didapat dari sebuah film dan sekali lagi saya katakan adam mckay adalah dosen ekonomi terbaik yang pernah saya jumpai', 'jajaran pemain sementereng susah terpikat the big short terlepas tahunya ditawarkan isinya pengalaman menonton sembari belajar menyenangkan film adam mckay dosen ekonomi terbaik jumpai', 'jajar main mentereng susah pikat the big short lepas tahu tawar isi alam tonton sembari ajar senang film adam mckay dosen ekonomi baik jumpa'),
(316, 333, 'bagaimanapun the blind side tetap adalah sebuah drama ringan menghibur dan yang terpenting mampu memberikan inspirasi kepada penontonnya apalagi bila mengingat film ini diadaptasi dari kisah nyata tidak perlu harus mengerti american football untuk menyaksikannya cukup duduk santai dan nikmati saja segala nilai kebaikan-kebaikan yang diberikan film ini', 'the blind side drama ringan menghibur terpenting inspirasi penontonnya film diadaptasi kisah nyata mengerti american football menyaksikannya duduk santai nikmati nilai kebaikan-kebaikan film', 'the blind side drama ringan hibur penting inspirasi tonton film adaptasi kisah nyata erti american football saksi duduk santai nikmat nilai kebaikan film'),
(317, 334, 'the book thief punya casting bagus yang setiap karakternya penuh dengan kehangatan dan harapan di balik latar perang dan musim salju yang dingin geoffrey rush membawa kembali pesona kebapakannya pasca the kings speech menjadi pria paruh dengan hati yang besar dan permainan akordion yang mendamaikan emily watson tampil prima sebagai rosa ibu angkat galak namun penyayang lengkap dengan aksen jerman yang sempurna', 'the book thief casting bagus karakternya penuh kehangatan harapan latar perang musim salju dingin geoffrey rush membawa pesona kebapakannya pasca the kings speech pria paruh hati permainan akordion mendamaikan emily watson tampil prima rosa angkat galak penyayang lengkap aksen jerman sempurna', 'the book thief casting bagus karakter penuh hangat harap latar perang musim salju dingin geoffrey rush bawa pesona bapa pasca the kings speech pria paruh hati main akordion damai emily watson tampil prima rosa angkat galak sayang lengkap aksen jerman sempurna'),
(318, 335, 'jelas bukan yang terbaik namun juga bukan yang terburuk the borrower arriety kembali hadir menambah daftar panjang tradisi animasi-animasi hebat jebolan studio ghibli yang legendaris itu apalagi meskipun kali ini mereka tidak memasang duo jagoannya untuk duduk di bangku sutradara namun kehadiran hiromasa yonebayashi sebagai sutradara termuda yang pernah dimiliki ghibli rupanya mampu mengusung semangat yang sama dengan para seniornya itu dalam menghadirkan animasi tradisional berkualitas', 'terbaik terburuk the borrower arriety hadir menambah daftar tradisi animasi-animasi hebat jebolan studio ghibli legendaris kali memasang duo jagoannya duduk bangku sutradara kehadiran hiromasa yonebayashi sutradara termuda dimiliki ghibli mengusung semangat seniornya menghadirkan animasi tradisional berkualitas', 'baik buruk the borrower arriety hadir tambah daftar tradisi animasi hebat jebol studio ghibli legendaris kali pasang duo jago duduk bangku sutradara hadir hiromasa yonebayashi sutradara muda milik ghibli usung semangat senior hadir animasi tradisional kualitas'),
(319, 336, 'klasik mungkin kata yang tepat untuk menggambarkan the changeling sebagai suguhan horor rumah hantu mungkin tidak ada yang baru di sini jika anda menontonnya sekarang tapi tetap saja saya harus angkat jempol buat peter medak yang menggarapnya dengan penyajian teknis yang rapi serta tidak pernah kehilangan sentuhan angkernya membuat the changeling menjadi salah satu horor jadul yang masih tetap segar ditonton sampai saat ini', 'klasik menggambarkan the changeling suguhan horor rumah hantu menontonnya angkat jempol peter medak menggarapnya penyajian teknis rapi serta kehilangan sentuhan angkernya the changeling salah horor jadul segar ditonton', 'klasik gambar the changeling suguh horor rumah hantu tonton angkat jempol peter medak garap saji teknis rapi serta hilang sentuh angker the changeling salah horor jadul segar tonton'),
(320, 337, 'faktanya the conjuring memang sajian yang menakutkan dan james wan sukses mendramatisasi kisah nyatanya menjadi sajian horor supernatural seru dan cerdas yang nantinya bakal dikenang cukup lama', 'faktanya the conjuring sajian menakutkan james wan sukses mendramatisasi kisah sajian horor supernatural seru cerdas dikenang', 'fakta the conjuring saji takut james wan sukses dramatisasi kisah saji horor supernatural seru cerdas kenang'),
(321, 338, 'the cove adalah salah satu dari sedikit film dokumenter yang disajikan secara luar biasa tidak hanya mendidik namun juga akan menghibur karena berani menyajikan sebuah tontonan penuh ketegangan yang ditampilkan secara nyata dan yang terpenting adalah dapat menginspirasi penontonnya', 'the cove salah film dokumenter disajikan mendidik menghibur berani menyajikan tontonan penuh ketegangan ditampilkan nyata terpenting menginspirasi penontonnya', 'the cove salah film dokumenter saji didik hibur berani saji tonton penuh tegang tampil nyata penting inspirasi tonton');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(322, 339, 'the crow bisa dibilang adalah salah satu film adaptasi komik terbaik yang pernah dibuat film dengan cerita cinta yang tragis dan gelap ini sukses melambungkan nama seorang brandon lee sebagai ikon gothic terkenal di jamannya walaupun nasib baik rupanya tidak berpihak kepadanya', 'the crow dibilang salah film adaptasi komik terbaik film cerita cinta tragis gelap sukses melambungkan nama brandon lee ikon gothic terkenal jamannya nasib berpihak', 'the crow bilang salah film adaptasi komik baik film cerita cinta tragis gelap sukses lambung nama brandon lee ikon gothic kenal jaman nasib pihak'),
(323, 340, 'provokatif inspiratif dan depresif the crucible termasuk cukup baik menghadirkan segala horor tentang kekerasan seksual pada anak bawah umur dengan gamblang naskah adaptasinya mungkin tidak sempurna dan terlalu dramatis tapi bagaimanapun ini adalah tonton drama yang membuat hati nurani terkoyak terlebih para pemain ciliknya juga mampu tampil begitu meyakinkan membawakan peran mereka', 'provokatif inspiratif depresif the crucible menghadirkan horor kekerasan seksual anak umur gamblang naskah adaptasinya sempurna dramatis tonton drama hati nurani terkoyak pemain ciliknya tampil membawakan peran', 'provokatif inspiratif depresif the crucible hadir horor kerasan seksual anak umur gamblang naskah adaptasi sempurna dramatis tonton drama hati nurani koyak main cilik tampil bawa peran'),
(324, 341, 'sutradara tahun ini menaikkan tensi plot dengan megah menggeber banyak klimaks kecil yang pada akhirnya meledakkannya dengan berbagai twist sejak pertengahan film dimulai dengan adegan pembuka menarik di mana secara bersamaan nolan juga memperkenalkan sosok joker dengan rencana perampokan bank jeniusnya pencidukan karakter antagonis pesta pra kampanye harvey dent yang disambangi joker hingga kejar-kejaran tegangan tinggi antara mobil boks dan truk pun dibesut dengan sangat baik oleh nolan', 'sutradara menaikkan tensi plot megah menggeber klimaks meledakkannya twist pertengahan film adegan pembuka menarik bersamaan nolan memperkenalkan sosok joker rencana perampokan bank jeniusnya pencidukan karakter antagonis pesta pra kampanye harvey dent disambangi joker kejar-kejaran tegangan mobil boks truk dibesut nolan', 'sutradara naik tensi plot megah geber klimaks ledak twist tengah film adegan buka tarik sama nol kenal sosok joker rencana ampo bank jenius ciduk karakter antagonis pesta pra kampanye harvey dent sambang joker kejar tegang mobil boks truk besut nol'),
(325, 342, 'di sepanjang film kita tidak hanya merasakan sebuah suspense tingkat tinggi ala crime thriller yang meskipun hanyaada di ruang lingkup sederhana namun berhasil memberikan getaran-getaran besar nan efektif memancing rasa penasaran kita sementara di sisi lain drama kemanusiaannya juga tampil sama memesonanya', 'film merasakan suspense tingkat ala crime thriller hanyaada ruang lingkup sederhana berhasil getaran-getaran nan efektif memancing penasaran sisi drama kemanusiaannya tampil memesonanya', 'film rasa suspense tingkat ala crime thriller hanyaada ruang lingkup sederhana hasil getaran nan efektif pancing penasaran sisi drama manusia tampil pesona'),
(326, 343, 'tidak ada rasa bosan seperti yang sering kamu dapati di film-film mocku horor lainnya karena donohue membangun plotnya dengan cerdas dari awal memberi terlebih dahulu penontonnya sesuatu yang intim dan menarik terutama ketika melihat bagaimana ia memaksimalkan akting melanie papalia sebagai liz', 'bosan dapati film-film mocku horor donohue membangun plotnya cerdas penontonnya intim menarik memaksimalkan akting melanie papalia liz', 'bosan dapat film mocku horor donohue bangun plot cerdas tonton intim tarik maksimal akting melanie papalia liz'),
(327, 344, 'pintar begitulah saya menggambarkan the disappearance of alice creed sebuah crime thriller debut blakeson ini ternyata benar-benar mampu menyajikan sebuah suguhan kisah kriminal cerdas penuh ketegangan nyaris tanpa henti sepanjang menit', 'pintar menggambarkan the disappearance of alice creed crime thriller debut blakeson benar-benar menyajikan suguhan kisah kriminal cerdas penuh ketegangan henti menit', 'pintar gambar the disappearance of alice creed crime thriller debut blakeson benar saji suguh kisah kriminal cerdas penuh tegang henti menit'),
(328, 345, 'tidak terlalu banyak romcom komedi remaja era milenium yang mampu meninggalkan kesan mendalam yang setelah beberapa lama filmnya dirilis masih mampu kamu ingat jika kemudian ada orang yang menanyakan hei apa sih romcom remaja yang bagus jawabannya mungkin tidak jauh-jauh dari mean girls dari mark water dengan dukungan ensemble cast perempuan yang luar biasa atau mungkin juga pesona luar biasa emma stone yang mempu membuat easy a susah untuk dilupakan dan saya senang bisa menemukan dan memasukkan the duff ke dalam salah satu romcom remaja terbaik yang pernah dibuat di era twitter saat ini', 'romcom komedi remaja era milenium meninggalkan kesan mendalam filmnya dirilis orang hei sih romcom remaja bagus jawabannya jauh-jauh mean girls mark water dukungan ensemble cast perempuan pesona emma stone mempu easy a susah dilupakan senang menemukan memasukkan the duff salah romcom remaja terbaik era twitter', 'romcom komedi remaja era milenium tinggal kesan dalam film rilis orang hei sih romcom remaja bagus jawab jauh mean girls mark water dukung ensemble cast perempuan pesona emma stone mempu easy a susah lupa senang temu masuk the duff salah romcom remaja baik era twitter'),
