(357, 374, 'tidak hanya tangguh membuat para cast mudanya tampil brilian vogt-roberts juga lihai membungkus kisah pendewasaan indie ini dengan teknis yang penuh dengan kepercayaan diri tinggi terlebih untuk sutradara first timer sepertinya ada banyak gambar-gambar apik menyegarkan yang menguasai menit durasinya', 'tangguh cast mudanya tampil brilian vogt-roberts lihai membungkus kisah pendewasaan indie teknis penuh kepercayaan sutradara first timer gambar-gambar apik menyegarkan menguasai menit durasinya', 'tangguh cast muda tampil brilian vogt roberts lihai bungkus kisah dewasa indie teknis penuh percaya sutradara first timer gambar apik segar kuasa menit durasi'),
(358, 375, 'dibuka dengan meyakinkan berkembang dengan dinamis dan diakhiri dengan sangat emosional itulah the kings speech sebuah historical drama luar biasa yang diisi oleh orang-orang luar biasa sebuah film inspirasional dari seorang pemimpin hebat dalam usaha mencari kepercayaan dirinya', 'dibuka berkembang dinamis emosional the kings speech historical drama diisi orang-orang film inspirasional pemimpin hebat usaha mencari kepercayaan', 'buka kembang dinamis emosional the kings speech historical drama isi orang film inspirasional pimpin hebat usaha cari percaya'),
(359, 376, 'dukungan naskah yang kuat presentasi yang bagus akting prima dari para pemainnya serta ending yang mengejutkan sudah lebih dari cukup bagi saya untuk dapat menyukai film ini', 'dukungan naskah kuat presentasi bagus akting prima pemainnya serta ending mengejutkan menyukai film', 'dukung naskah kuat presentasi bagus akting prima main serta ending kejut suka film'),
(360, 377, 'mark osborne mempresentasikan the little prince versinya dengan cukup baik mungkin tidak sampai kelewat istimewa mengingat kualitas animasi khususnya pada bagian cerita di dunia nyatanya terasa sedikit kurang menarik meski sebenarnya buat penonton yang lebih dewasa hal itu mungkin tidak terlalu menjadi masalah karena bisa ditutupi dengan kekuatan tema dan penceritaannya yang bagus', 'mark osborne mempresentasikan the little prince versinya kelewat istimewa kualitas animasi cerita dunia menarik penonton dewasa ditutupi kekuatan tema penceritaannya bagus', 'mark osborne mempresentasikan the little prince versi lewat istimewa kualitas animasi cerita dunia tarik tonton dewasa tutup kuat tema cerita bagus'),
(361, 378, 'ada elemen komedi hitam bekerja di dalamnya membuat kita tersenyum getir ketika melihat lanthimos sebuah satir tentang tragedi komitmen dari sebuah cinta yang tersembunyi dalam keabsurdan premis fiksi ilmiahnya ada situasi kompleks di bawah permukaannya', 'elemen komedi hitam dalamnya tersenyum getir lanthimos satir tragedi komitmen cinta tersembunyi keabsurdan premis fiksi ilmiahnya situasi kompleks permukaannya', 'elemen komedi hitam dalam senyum getir lanthimos satir tragedi komitmen cinta sembunyi absurd premis fiksi ilmiah situasi kompleks muka'),
(362, 379, 'begitu sederhana namun begitu membekas the lunchbox diisi oleh dua karakter utamanya yang kuat', 'sederhana membekas the lunchbox diisi karakter utamanya kuat', 'sederhana bekas the lunchbox isi karakter utama kuat'),
(363, 380, 'saya selalu percaya kekuatan utama sebuah film itu berada di pundak narasinya dan the man from earth membuktikan itu dengan sumber daya terbatas ia mampu memberikan sebuah suguhan drama fiksi ilmiah yang berbeda menghipnotis dan membuatmu tercengang sebuah premis konyol yang mampu dieksekusi dengan sangat baik dengan balutan dialog-dialog cerdas', 'percaya kekuatan utama film pundak narasinya the man from earth membuktikan sumber daya terbatas suguhan drama fiksi ilmiah berbeda menghipnotis membuatmu tercengang premis konyol dieksekusi balutan dialog-dialog cerdas', 'percaya kuat utama film pundak narasi the man from earth bukti sumber daya batas suguh drama fiksi ilmiah beda hipnotis buat cengang premis konyol eksekusi balut dialog cerdas'),
(364, 381, 'dengan durasi sepanjang ini butuh sesuatu untuk membuat penontonnya betah berlama-lama di bangkunya dan scott tahu benar bagaimana menjaga pace the martian dengan baik hampir tidak ada momen membosankan di dalamnya setiap adegan diisi dengan efektif dan jauh dari kesan lambat belum lagi ditambah elemen humor yang memberi variasi santai di tone seriusnya', 'durasi butuh penontonnya betah berlama-lama bangkunya scott menjaga pace the martian momen membosankan dalamnya adegan diisi efektif kesan lambat ditambah elemen humor variasi santai tone seriusnya', 'durasi butuh tonton betah lama bangku scott jaga pace the martian momen bosan dalam adegan isi efektif kesan lambat tambah elemen humor variasi santai tone serius'),
(365, 382, 'kombinasi west-statham rupanya sanggup membuat the mechanic tampil lebih baik yang dari saya perkirakan sebelumnya tidak istimewa memang namun setidaknya tidak sampai terjebak dalam sajian action murahan kelas dua the mechanic bisa dibilang cukup berkelas saya sendiri sangat menikmati bagaimana west mengemas tiap menitnya dalam dalam balutan visual menarik tempo cepat dan jauh dari bertele-tele', 'kombinasi west-statham sanggup the mechanic tampil perkirakan istimewa terjebak sajian action murahan kelas the mechanic dibilang berkelas menikmati west mengemas menitnya balutan visual menarik tempo cepat bertele-tele', 'kombinasi west statham sanggup the mechanic tampil kira istimewa jebak saji action murah kelas the mechanic bilang kelas nikmat west mas menit balut visual tarik tempo cepat tele'),
(366, 383, 'salah satu yang terbaik di genrenya setelah a dirty carnival butuh waktu tahun untuk mendapatkan sebuah film gangster ala negeri ginseng memuaskan yang tidak hanya menjual kekerasan dan segala tetek bengek dunia gelap mafia namun juga sebuah plot cerdas yang kuat dan menegangkan tentang sisi mana yang kamu pilih dengan bumbu aksi berdarah-darah di sepanjang dua jam lebih plus dukungan para pemainnya yang bermain solid', 'salah terbaik genrenya a dirty carnival butuh film gangster ala negeri ginseng memuaskan menjual kekerasan tetek bengek dunia gelap mafia plot cerdas kuat menegangkan sisi pilih bumbu aksi berdarah-darah jam plus dukungan pemainnya bermain solid', 'salah baik genre a dirty carnival butuh film gangster ala negeri ginseng muas jual kerasan tetek bengek dunia gelap mafia plot cerdas kuat tegang sisi pilih bumbu aksi darah jam plus dukung main main solid'),
(367, 384, 'dibungkus dengan semangat kesederhanaan seperti film-film farhadi lainnya yang juga mencerminkan sebuah realisme kental nyaris tanpa manipulasi scoring dan dramatisasi berlebihan dalam perjalanannya kita akan banyak mendapati kejutan hebat yang sedikit demi sedikit membentuk wajah utuh the past', 'dibungkus semangat kesederhanaan film-film farhadi mencerminkan realisme kental manipulasi scoring dramatisasi perjalanannya mendapati kejutan hebat membentuk wajah utuh the past', 'bungkus semangat sederhana film farhadi cermin realisme kental manipulasi scoring dramatisasi jalan dapat kejut hebat bentuk wajah utuh the past'),
(368, 385, 'gareth evans jelas sudah mengerjakan pekerjaannya dengan sangat baik termasuk bagaimana ia memaksimalkan kemampuan dua pemainnya ya the raid mungkin sudah menjadi film aksi indonesia terbaik yang pernah ada bahkan dunia pun mengakuinya', 'gareth evans pekerjaannya memaksimalkan kemampuan pemainnya ya the raid film aksi indonesia terbaik dunia mengakuinya', 'gareth evans kerja maksimal mampu main ya the raid film aksi indonesia baik dunia aku'),
(369, 386, 'the reef bisa jadi salah satu thriller tentang serangan hiu terbaik yang pernah dibuat setelah jaws sedikit membosankan di awal andrew traucki kemudian seakan-akan tidak mau membuang waktunya lagi dengan langsung memacu tensinya memberikan penontonnya momen-momen penuh kengerian dan ketegangan yang efektif merangsang rasa takut kita tanpa harus terlihat berlebihan', 'the reef salah thriller serangan hiu terbaik jaws membosankan andrew traucki seakan-akan membuang langsung memacu tensinya penontonnya momen-momen penuh kengerian ketegangan efektif merangsang takut', 'the reef salah thriller serang hiu baik jaws bosan andrew traucki akan buang langsung pacu tensi tonton momen penuh ngeri tegang efektif rangsang takut'),
(370, 387, 'hempasan debu dan gersangnya iran ditampilkan dengan sempurna hampir tidak ada musik yang saya dengar muncul di film ini dan juga banyaknya aktor dan aktris yang ada di film ini inilah yang membuat film ini begitu dalam saya sama sekali tidak melihat sang aktor berakting di sini yang ada hanyalah benar-benar seorang amiro apalagi film ini mempunyai ending dramatis yang bikin perasaan campur aduk sekaligus indah', 'hempasan debu gersangnya iran ditampilkan sempurna musik dengar muncul film banyaknya aktor aktris film film sang aktor berakting benar-benar amiro film ending dramatis bikin perasaan campur aduk indah', 'hempas debu gersang iran tampil sempurna musik dengar muncul film banyak aktor aktris film film sang aktor akting benar amiro film ending dramatis bikin asa campur aduk indah'),
(371, 388, 'the sea of trees seakan membawa kita pada kisah haru biru perjuangan keduanya untuk tetap bertahan hidup dengan kondisi hutan yang terlihat berbahaya di malam hari karena banyaknya jurang terjal yang tersembunyi dari pandangan hingga hujan yang menerpa tak dinyana makin ke ujung alur cerita malah dibawa ke arah drama melankolis dengan penutup manis yang tidak disangka-sangka', 'the sea of trees seakan membawa kisah haru biru perjuangan bertahan hidup kondisi hutan berbahaya malam banyaknya jurang terjal tersembunyi pandangan hujan menerpa dinyana ujung alur cerita dibawa arah drama melankolis penutup manis disangka-sangka', 'the sea of trees akan bawa kisah haru biru juang tahan hidup kondisi hutan bahaya malam banyak jurang terjal sembunyi pandang hujan terpa nyana ujung alur cerita bawa arah drama melankolis tutup manis sangka'),
(372, 389, 'kemampuan collet-serra menghadirkan set piece dengan segala teknis yang luar biasa lihat saja pengambilan gambarnya dan sound editing yang keren termasuk juga penggunaan cgi yang tepat guna ini kemudian menjadikan the shallows menjadi lebih istimewa tentu saja juga tidak lepas dari akting solo hebat blake lively yang sukses berpadu padan sempurna menghasilkan tensi ketegangan baik di atas maupun di dalam air yang luar biasa tinggi dan yang pasti juga sangat efektif mengguncang adrenalin penontonnya', 'kemampuan collet-serra menghadirkan set piece teknis lihat pengambilan gambarnya sound editing keren penggunaan cgi menjadikan the shallows istimewa lepas akting solo hebat blake lively sukses berpadu padan sempurna menghasilkan tensi ketegangan air efektif mengguncang adrenalin penontonnya', 'mampu collet serra hadir set piece teknis lihat ambil gambar sound editing keren guna cgi jadi the shallows istimewa lepas akting solo hebat blake lively sukses padu padan sempurna hasil tensi tegang air efektif guncang adrenalin tonton'),
(373, 390, 'tidak heran jika banyak penonton yang memasukkan the shining dalam list film horror klasik favorit mereka karena horror psikologis kolaborasi kubrick-king ini memang yang terbaik di genrenya bahkan sampai sekarang the shining adalah salah satu obat manjur yang dapat membuat penontonnya bermimpi buruk setelah menontonnya', 'heran penonton memasukkan the shining list film horror klasik favorit horror psikologis kolaborasi kubrick-king terbaik genrenya the shining salah obat manjur penontonnya bermimpi buruk menontonnya', 'heran tonton masuk the shining list film horror klasik favorit horror psikologis kolaborasi kubrick king baik genre the shining salah obat manjur tonton mimpi buruk tonton'),
(374, 391, 'meskipun tidak menawarkan nada gelap seperti confessions atau kebanyakan thriller-thriller tentang kasus pembunuhan lain the snow white murder case masih bisa tetap tampil solid dengan pesonanya uniknya sendiri dukungan naskah gubahannya yang berakar plot misteri pembunuhan digarap sangat rapi kreatif berbaur sempurna dengan penyutradaraan lambat namun memikat ala nakamura yang tidak pernah lupa membawa ciri khasnya', 'menawarkan nada gelap confessions kebanyakan thriller-thriller pembunuhan the snow white murder case tampil solid pesonanya uniknya dukungan naskah gubahannya berakar plot misteri pembunuhan digarap rapi kreatif berbaur sempurna penyutradaraan lambat memikat ala nakamura lupa membawa ciri khasnya', 'tawar nada gelap confessions banyak thriller bunuh the snow white murder case tampil solid pesona unik dukung naskah gubah akar plot misteri bunuh garap rapi kreatif baur sempurna sutradara lambat mikat ala nakamura lupa bawa ciri khas'),
(375, 392, 'cerita berjalan dengan rapi tanpa ada paksaan dengan tempo yang pas namun tidak membosankan fincher bukan hanya menyajikan cerita tapi juga mengajak kita untuk berpikir dan menganalisis apa dan mengapa kepada setiap karakter yang muncul di film ini selain itu film ini juga dipenuhi dialog slapstick tajam dan cerdas', 'cerita berjalan rapi paksaan tempo pas membosankan fincher menyajikan cerita mengajak berpikir menganalisis karakter muncul film film dipenuhi dialog slapstick tajam cerdas', 'cerita jalan rapi paksa tempo pas bosan fincher saji cerita ajak pikir analisis karakter muncul film film penuh dialog slapstick tajam cerdas'),
(376, 393, 'kunci keberhasilan the spectacular now adalah bagaimana ponsoldt tidak membuatnya menjadi sebuah teen drama yang lebay sebaliknya secara natural menjadikan semuanya membumi termasuk setiap konfliknya the spectacular now itu seperti karakter aimee polos tanpa makeup namun tetap cantik dilihat di sepanjang film termasuk adegan seksnya yang lugu sutter keely yang dimainkan cemerlang oleh jebolan rabbit hole miles teller adalah pusat segalanya', 'kunci keberhasilan the spectacular now ponsoldt membuatnya teen drama lebay natural menjadikan membumi konfliknya the spectacular now karakter aimee polos makeup cantik film adegan seksnya lugu sutter keely dimainkan cemerlang jebolan rabbit hole miles teller pusat', 'kunci keberhasilan the spectacular now ponsoldt buat teen drama lebay natural jadi bumi konflik the spectacular now karakter aimee polos makeup cantik film adegan seks lugu sutter keely main cemerlang jebol rabbit hole miles teller pusat'),
(377, 394, 'ada sebuah keseimbangan yang berhasil dihadirkan sophon sakdapisit di sini penceritaannya yang sederhana coba ditampilkan dengan cara tidak biasa ketika plotnya melompat-lompat dari masa lalu ke masa sekarang lalu kembali lagi ke masa lalu yang berpotensi membingungkan sementara kualitas horornya juga masih mampu dijaga dengan baik', 'keseimbangan berhasil dihadirkan sophon sakdapisit penceritaannya sederhana coba ditampilkan plotnya melompat-lompat berpotensi membingungkan kualitas horornya dijaga', 'keseimbangan hasil hadir sophon sakdapisit cerita sederhana coba tampil plot lompat potensi bingung kualitas horor jaga'),
(378, 395, 'thriller berbau aksi terorisme mungkin bukan barang baru untuk dipamerkan tetapi dengan melakukan pendekatan berbeda siapa sangka kombinasi usang itu bisa menjadi sangat menggigit coba lihat apa yang dilakukan kim byung woo ketika ia berhasil memanfaatkan minimnya lokasi untuk menghasilkan teror maksimal', 'thriller berbau aksi terorisme barang dipamerkan pendekatan berbeda sangka kombinasi usang menggigit coba lihat kim byung woo berhasil memanfaatkan minimnya lokasi menghasilkan teror maksimal', 'thriller bau aksi terorisme barang pamer dekat beda sangka kombinasi usang gigit coba lihat kim byung woo hasil manfaat minim lokasi hasil teror maksimal'),
(379, 396, 'the theory of everything itu punya tampilan secantik judulnya visual gloomy dari sinematografer veteran benot delhomme berbalut scoring magical dari nada-nada elegan dan melankolis garapan komposer islandia johann johannsson menghasilkan kombinasi momen-momen sentimentil romantis yang mendukung penceritaan james marsh di paruh pertamanya yang diisi banyak cinta', 'the theory of everything tampilan secantik judulnya visual gloomy sinematografer veteran benot delhomme berbalut scoring magical nada-nada elegan melankolis garapan komposer islandia johann johannsson menghasilkan kombinasi momen-momen sentimentil romantis mendukung penceritaan james marsh paruh pertamanya diisi cinta', 'the theory of everything tampil cantik judul visual gloomy sinematografer veteran benot delhomme balut scoring magical nada elegan melankolis garap komposer islandia johann johannsson hasil kombinasi momen sentimentil romantis dukung cerita james marsh paruh pertama isi cinta'),
(380, 397, 'affleck memang terbukti sukses menyutradarai film berdurasi jam lebih ini dengan sangat baik namun tidak sebagai aktor karena ada jeremy renner disini yang berhasil menjadi scene stealer sebagai seorang badass yang mampu menyuguhkan akting kuat di sepanjang film', 'affleck terbukti sukses menyutradarai film berdurasi jam aktor jeremy renner berhasil scene stealer badass menyuguhkan akting kuat film', 'affleck bukti sukses sutradara film durasi jam aktor jeremy renner hasil scene stealer badass suguh akting kuat film'),
(381, 398, 'tidak terlalu berlebihan jika saya kemudian menyebut the tree of life adalah mahakarya agung sebuah puisi bergerak perjalanan spiritual dari seorang pujangga hebat bernama terrence malick yang dibalut dengan teknis sinematik nyaris sempurna', 'menyebut the tree of life mahakarya agung puisi bergerak perjalanan spiritual pujangga hebat bernama terrence malick dibalut teknis sinematik sempurna', 'sebut the tree of life mahakarya agung puisi gerak jalan spiritual pujangga hebat nama terrence malick balut teknis sinematik sempurna'),
(382, 399, 'karya andre ovredal satu ini layak diberi acungan dua jempol bukan hanya karena sukses menghadirkan premis yang orisinal dan menyegarkan namun juga bagaimana ovredal mengemasnya dengan apik serealistis mungkin dan sangat menghibur', 'karya andre ovredal layak acungan jempol sukses menghadirkan premis orisinal menyegarkan ovredal mengemasnya apik serealistis menghibur', 'karya andre ovredal layak acung jempol sukses hadir premis orisinal segar ovredal mas apik realistis hibur'),
(383, 400, 'saya harus mengakui bagaimana usaha keras para sineas dan para pemainnya dalam menyajikan the tunnel ini serealistis mungkin ya mereka sudah melakukannya dengan cukup baik termasuk menyelipkan beberapa sesi wawancara dari para pelakunya yang terlibat langsung guna memperkuat kesan real film berdurasi menit ini', 'mengakui usaha keras sineas pemainnya menyajikan the tunnel serealistis ya melakukannya menyelipkan sesi wawancara pelakunya terlibat langsung memperkuat kesan real film berdurasi menit', 'aku usaha keras sineas main saji the tunnel realistis ya laku selip sesi wawancara laku libat langsung kuat kesan real film durasi menit'),
(384, 401, 'dengan menampilkan sajian multi genre the voices jelas adalah film yang penuh resiko buat sutradara manapun tidak mudah menggabungkan hal-hal serius dalam sebuah thriller psikologis seperti masalah kejiwaan dan pembunuhan dengan elemen-elemen romansa komedi dan melodrama itu seperti perpaduan busana yang tak cocok namun tetap menggoda', 'menampilkan sajian multi genre the voices film penuh resiko sutradara manapun mudah menggabungkan hal-hal serius thriller psikologis kejiwaan pembunuhan elemen-elemen romansa komedi melodrama perpaduan busana cocok menggoda', 'tampil saji multi genre the voices film penuh resiko sutradara mana mudah gabung hal serius thriller psikologis jiwa bunuh elemen romansa komedi melodrama padu busana cocok goda'),
(385, 402, 'ada perekrutan anggota perencanaan matang dan tentu saja eksekusi yang semuanya berhasil disajikan dengan cara yang menarik dan menghibur tetapi momen puncak the walk ada pada menit menjelang akhir momen ketika petit berada di atas kawat baja berada di puncak dunia katanya ya itu adalah momen luar biasa mungkin salah satu yang terbaik tahun ini', 'perekrutan anggota perencanaan matang eksekusi berhasil disajikan menarik menghibur momen puncak the walk menit menjelang momen petit kawat baja puncak dunia ya momen salah terbaik', 'rekrut anggota rencana matang eksekusi hasil saji tarik hibur momen puncak the walk menit jelang momen petit kawat baja puncak dunia ya momen salah baik'),
(386, 403, 'selain visual vegetasi cantik ia juga dihiasi oleh banyak metafora dan momen emosional depresif yang terjadi dalam suasana intens dan kelam performa solo gedeck yang solid menguasai keseluruhan panggung juga menjadi alasan kenapa the wall bisa tampil memesona melihat karakternya tumbuh beradaptasi berinteraksi dengan hewan peliharaannya yang berakting sama bagusnya itu adalah pengalaman paling mengesankan menonton the wall selain menikmati indahnya visual puitis yang disuguhkan', 'visual vegetasi cantik dihiasi metafora momen emosional depresif suasana intens kelam performa solo gedeck solid menguasai panggung alasan the wall tampil memesona karakternya tumbuh beradaptasi berinteraksi hewan peliharaannya berakting bagusnya pengalaman mengesankan menonton the wall menikmati indahnya visual puitis disuguhkan', 'visual vegetasi cantik hias metafora momen emosional depresif suasana intens kelam performa solo gedeck solid kuasa panggung alas the wall tampil pesona karakter tumbuh adaptasi interaksi hewan pelihara akting bagus alam kesan tonton the wall nikmat indah visual puitis suguh'),
(387, 404, 'tidak ada momen yang terlewat frontal sebaliknya ribeiro dengan lembut memperlakukan narasi dan karakternya selembut dan sehangat orangtua leonardo memperlakukan putra semata wayangnya itu', 'momen terlewat frontal ribeiro lembut memperlakukan narasi karakternya selembut sehangat orangtua leonardo memperlakukan putra wayangnya', 'momen lewat frontal ribeiro lembut laku narasi karakter lembut hangat orangtua leonardo laku putra wayang'),
(388, 405, 'kekuatan the witch adalah bagaimana eggers mampu membangun dunianya dengan sangat-sangat kuat sejak menit-menit pertama ia bergulir pemilihan palet warna kelabu mendominasi visualnya dikombinasikan dengan scoring garapan mark korven yang menyayat menghasilkan aroma suram pekat', 'kekuatan the witch eggers membangun dunianya sangat-sangat kuat menit-menit bergulir pemilihan palet warna kelabu mendominasi visualnya dikombinasikan scoring garapan mark korven menyayat menghasilkan aroma suram pekat', 'kuat the witch eggers bangun dunia sangat kuat menit gulir pilih palet warna kelabu dominasi visual kombinasi scoring garap mark korven sayat hasil aroma suram pekat'),
(389, 406, 'the wolf of wall street menunjukkan kehandalan scorsese dalam mengeksekusi sebuah premis sederhana dengan teknis sinematis tingkat tinggi yang eksplosif dan over dramatis ya itu sudah jelas dan bersama naskah gubahan terence winter broadwalk empire scorsese tahu benar bagaimana menghadirkan sebuah biopik bagus namun secara bersamaan ia juga sukses mengeksploitasi sub teks tentang hedonisme total', 'the wolf of wall street kehandalan scorsese mengeksekusi premis sederhana teknis sinematis tingkat eksplosif over dramatis ya naskah gubahan terence winter broadwalk empire scorsese menghadirkan biopik bagus bersamaan sukses mengeksploitasi sub teks hedonisme total', 'the wolf of wall street kehandalan scorsese eksekusi premis sederhana teknis sinematis tingkat eksplosif over dramatis ya naskah gubah terence winter broadwalk empire scorsese hadir biopik bagus sama sukses eksploitasi sub teks hedonisme total');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(390, 407, 'sebagai bagian penutup dari sebuah trilogi the worlds end jelas diharapkan menjadi sebuah closure hebat untuk dua film sebelumnya dan ia memang berhasil menjadi sebuah akhir yang bagus meskipun kualitasnya sedikit masih berada di bawah shaun of the dead yang punya tema serupa', 'penutup trilogi the worlds end diharapkan closure hebat film berhasil bagus kualitasnya shaun of the dead tema', 'tutup trilogi the worlds end harap closure hebat film hasil bagus kualitas shaun of the dead tema'),
(391, 408, 'saya tidak bisa memaafkan apa yang terjadi di menit akhir ya itu seperti sebuah lawakan besar dan konyol sekonyol ketika masih menggunakan karakter banci untuk mengeksploitasi beberapa momen komedinya', 'memaafkan menit ya lawakan konyol sekonyol karakter banci mengeksploitasi momen komedinya', 'maaf menit ya lawa konyol konyol karakter banci eksploitasi momen komedi'),
(392, 409, 'apa yang tersaji di sini menjadi membosankan tidak hanya di plot yang minim kejutan namun juga kadar komedi yang bisa dibilang tidak segila dan sesegar seri pertamanya', 'tersaji membosankan plot minim kejutan kadar komedi dibilang segila sesegar seri pertamanya', 'saji bosan plot minim kejut kadar komedi bilang gila segar seri pertama'),
(393, 410, 'sayang jika kamu mengharapkan itu maka bersiaplah akan kecewa ya memang ada proses bagaimana salah satu pemimpin persia paling disegani itu terlahir kembali dari api dendam tetapi ya hanya sebatas perkenalan basa-basi biasa tanpa kedalaman dan porsinya sama seperti yang terjadi di film pendahulunya', 'sayang mengharapkan bersiaplah kecewa ya proses salah pemimpin persia disegani terlahir api dendam ya sebatas perkenalan basa-basi kedalaman porsinya film pendahulunya', 'sayang harap siap kecewa ya proses salah pimpin sia segani lahir api dendam ya batas kenal basa-basi dalam porsi film dahulu'),
(394, 411, 'saya juga merasa ketegangan dan kesan claustrophobic kurang terjaga setelah menonton kedua kalinya beberapa adegan juga terasa agak terlalu panjang dan beberapa lainnya terlalu repetitif', 'ketegangan kesan claustrophobic terjaga menonton kalinya adegan repetitif', 'tegang kesan claustrophobic jaga tonton kali adegan repetitif'),
(395, 412, 'ini benar-benar terlihat medioker tampak jelas seperti hasil pekerjaan seorang sutradara first timer yang hanya mencoba bermain aman dengan dukungan naskah yang sama lemahnya termasuk plotnya yang berjalan terseok-seok dan melelahkan apalagi ketika mereka mencoba memasukkan elemen romansa di dalamnya yang lagi-lagi tidak berhasil meninggalkan kesan', 'benar-benar medioker hasil pekerjaan sutradara first timer mencoba bermain aman dukungan naskah lemahnya plotnya berjalan terseok-seok melelahkan mencoba memasukkan elemen romansa dalamnya lagi-lagi berhasil meninggalkan kesan', 'benar medioker hasil kerja sutradara first timer coba main aman dukung naskah lemah plot jalan seok lelah coba masuk elemen romansa dalam lagi hasil tinggal kesan'),
(396, 413, 'a good day to die hard tampak benar-benar seperti sekuel sejati die hard tetapi kamu hanya menemukan bagian terbaiknya muncul dan menghilang terlalu cepat digantikan dengan aksi-aksi membosankan dan naskah yang menggelikan', 'a good day to die hard benar-benar sekuel sejati die hard menemukan terbaiknya muncul menghilang cepat digantikan aksi-aksi membosankan naskah menggelikan', 'a good day to die hard benar sekuel sejati die hard temu baik muncul hilang cepat ganti aksi bosan naskah geli'),
(397, 414, 'julian gilbey memutuskan untuk membanting kemudi ceritanya dengan memasukkan dua penculik sebagai lawan mereka meninggalkan lanskap pegunungan dan suasana pendakian dan mengubahnya menjadi sebuah slasher medioker yang mudah diprediksi ke mana arahnya lengkap dengan segala permainan kucing-tikusnya', 'julian gilbey memutuskan membanting kemudi ceritanya memasukkan penculik lawan meninggalkan lanskap pegunungan suasana pendakian mengubahnya slasher medioker mudah diprediksi arahnya lengkap permainan kucing-tikusnya', 'juli gilbey putus banting kemudi cerita masuk culik lawan tinggal lanskap gunung suasana daki ubah slasher medioker mudah prediksi arah lengkap main kucing tikus'),
(398, 415, 'plot klise dan membosankan untuk ukuran film horor terlebih bagi anda yang sudah menyaksikan versi aslinya minimnya jam terbang sutradara samuel bayer yang biasanya hanya menggarap video klip musik ini dan yang paling parah adalah hilangnya sosok englund semakin menambah dosa platinum dunes semoga saja suatu saat michael bay bertobat untuk tidak lagi menghancurkan horror-horror klasik', 'plot klise membosankan ukuran film horor menyaksikan versi aslinya minimnya jam terbang sutradara samuel bayer menggarap video klip musik parah hilangnya sosok englund menambah dosa platinum dunes semoga michael bay bertobat menghancurkan horror-horror klasik', 'plot klise bosan ukur film horor saksi versi asli minim jam terbang sutradara samuel bayer garap video klip musik parah hilang sosok englund tambah dosa platinum dunes moga michael bay tobat hancur horror klasik'),
(399, 416, 'bukan tanpa kekurangan adore dihiasi banyak dialog-dialog cheesy beberapa momen emosinalnya terasa terlalu diberat-beratkan dan ketika ia seharusnya bisa berhenti disatu titik fontaine malah memilih untuk melanjutkan lagi lebih lama untuk memperpanjang dan memperjelas sesuatu yang sebenarnya tidak terlalu perlu', 'kekurangan adore dihiasi dialog-dialog cheesy momen emosinalnya diberat-beratkan berhenti disatu titik fontaine memilih melanjutkan memperpanjang memperjelas', 'kurang adore hias dialog cheesy momen emosinalnya berat henti satu titik fontaine pilih lanjut panjang jelas'),
(400, 417, 'semuanya terasa percuma ketika shyamalan tampak tidak terlalu percaya diri untuk membawanya ke mana yang terjadi kemudian after earth malah terjebak antara drama tanpa emosi dan fiksi ilmiah yang kurang garam', 'shyamalan percaya membawanya after earth terjebak drama emosi fiksi ilmiah garam', 'shyamalan percaya bawa after earth jebak drama emosi fiksi ilmiah garam'),
(401, 418, 'overall premis yang sangat menarik namun sayang tidak dibarengi dengan kekonsistenan cerita sehingga membuat after life harus menderita di paruh akhir cerita menjadi kendur dan kurang greget', 'overall premis menarik sayang dibarengi kekonsistenan cerita after life menderita paruh cerita kendur greget', 'overall premis tarik sayang bareng konsisten cerita after life derita paruh cerita kendur greget'),
(402, 419, 'sulit memang untuk dibuat tak kecewa dengan hasil akhir allied apalagi melihat lemahnya naskah hingga plotnya yang kadang-kadang terasa begitu artifisial', 'sulit kecewa hasil allied lemahnya naskah plotnya kadang-kadang artifisial', 'sulit kecewa hasil allied lemah naskah plot kadang artifisial'),
(403, 420, 'harus diakui secara teknis altitude tampil mengecewakan tidak jauh berbeda dari yang ditampilkan kebanyakan film-film kelas dua lainnya lemah hampir di semua bagiannya', 'diakui teknis altitude tampil mengecewakan berbeda ditampilkan kebanyakan film-film kelas lemah bagiannya', 'aku teknis altitude tampil kecewa beda tampil banyak film kelas lemah bagi'),
(404, 421, 'and soon the darkness malah terjebak dalam sebuah thriller kosong tanpa jiwa bisa dibilang seperti menyaksikan sebuah sajian thriller kelas b murahan lengkap dengan karakter-karakter bodoh plot dangkal dan akting yang buruk', 'and soon the darkness terjebak thriller kosong jiwa dibilang menyaksikan sajian thriller kelas b murahan lengkap karakter-karakter bodoh plot dangkal akting buruk', 'and soon the darkness jebak thriller kosong jiwa bilang saksi saji thriller kelas b murah lengkap karakter bodoh plot dangkal akting buruk'),
(405, 422, 'dosa besar annabelle sebenarnya ada pada kualitas naskah garapan gary dauberman yang ngaco oh ya saya belum menyebut bagaimana akhirnya percayalah ending annabelle adalah salah satu ending paling konyol dalam sejarah perhororan dunia', 'dosa annabelle kualitas naskah garapan gary dauberman ngaco oh ya menyebut percayalah ending annabelle salah ending konyol sejarah perhororan dunia', 'dosa annabelle kualitas naskah garap gary dauberman ngaco oh ya sebut percaya ending annabelle salah ending konyol sejarah horor dunia'),
(406, 423, 'seperti kebanyakan thriller medioker lainnya atm punya cerita yang kelewat corny serta tidak luput dari rentetan kebodohan demi kebodohan termasuk tipikal karakter pembunuh tanpa motif yang sok misterius dengan jaket tebal ala pembunuh dalam slasher urban legend', 'kebanyakan thriller medioker atm cerita kelewat corny serta luput rentetan kebodohan kebodohan tipikal karakter pembunuh motif sok misterius jaket tebal ala pembunuh slasher urban legend', 'banyak thriller medioker atm cerita lewat corny serta luput rentet bodoh bodoh tipikal karakter bunuh motif sok misterius jaket tebal ala bunuh slasher urban legend'),
(407, 424, 'tidak semua terlihat keren beberapa terkesan bodoh dan memaksa namun overall buat adegan aksinya attack on titan tidak mengecewakan tetapi sayang di luar itu drama antar manusianya terkesan memble tidak ada pengembangan karakter tidak ada konflik berarti di antara mereka dan kemudian memaksakan elemen cinta segitiga yang tanggung malah membuatnya semakin kacau dan membosankan', 'keren terkesan bodoh memaksa overall adegan aksinya attack on titan mengecewakan sayang drama manusianya terkesan memble pengembangan karakter konflik memaksakan elemen cinta segitiga tanggung membuatnya kacau membosankan', 'keren kesan bodoh paksa overall adegan aksi attack on titan kecewa sayang drama manusia kesan memble pengembangan karakter konflik paksa elemen cinta segitiga tanggung buat kacau bosan'),
(408, 425, 'sungguh saya tidak pernah bisa mengetahui apa yang ingin disajikan di sini selain sebuah premis menarik dengan cerita kosong super dangkal rentetan pertunjukan kebodohan demi kebodohan dan wajah menyebalkan diaz yang mendominasi di sepanjang menit', 'sungguh disajikan premis menarik cerita kosong super dangkal rentetan pertunjukan kebodohan kebodohan wajah menyebalkan diaz mendominasi menit', 'sungguh saji premis tarik cerita kosong super dangkal rentet tunjuk bodoh bodoh wajah sebal diaz dominasi menit'),
(409, 426, 'tidak ada yang salah memang mendaur ulang premis basi tetapi ini seperti membuang percuma potensinya belum lagi saya menyebut beberapa plot hole mencolok yang cukup mengganggu', 'salah mendaur ulang premis basi membuang potensinya menyebut plot hole mencolok mengganggu', 'salah daur ulang premis basi buang potensi sebut plot hole colok ganggu'),
(410, 427, 'sepertinya ody terkesan terlalu serakah tidak masalah jika kemudian hasilnya bisa bagus nah ini malah sebaliknya lambat berantakan terlalu gelap sok misterius dengan plot hole sebesar gajah di dalamnya', 'ody terkesan serakah hasilnya bagus lambat berantakan gelap sok misterius plot hole gajah dalamnya', 'ody kesan serakah hasil bagus lambat beranta gelap sok misterius plot hole gajah dalam'),
(411, 428, 'sayang apa yang terjadi kemudian rupanya juga tidak berakhir sesuai ekspektasi kebanyakan orang karena faktanya battle los angeles juga bukanlah sebuah film yang kelewat istimewa tidak sedikit penonton dan kritikus-kritikus dunia yang terhormat mencapnya sebagai sebuah film buruk', 'sayang sesuai ekspektasi kebanyakan orang faktanya battle los angeles film kelewat istimewa penonton kritikus-kritikus dunia terhormat mencapnya film buruk', 'sayang sesuai ekspektasi banyak orang fakta battle los angeles film lewat istimewa tonton kritikus dunia hormat cap film buruk'),
(412, 429, 'berg bisa jadi telah berhasil melakukan apa yang bisa dicapai bay termasuk untuk bagian yang terburuknya macam kualitas naskah yang menyedihkan rentetan plot hole karakter-karakternya yang dangkal rangkaian momen super berisik yang sayangnya membosankan', 'berg berhasil dicapai bay terburuknya kualitas naskah menyedihkan rentetan plot hole karakter-karakternya dangkal rangkaian momen super berisik sayangnya membosankan', 'berg hasil capai bay buruk kualitas naskah sedih rentet plot hole karakter dangkal rangkai momen super berisik sayang bosan'),
(413, 430, 'karakter georges duroy semestinya punya kedalaman dan kompleks tapi yang ada pattinson malah menjadikannya seperti gigolo bodoh murahan di sepanjang film salahkan juga naskah yang ditulis rachel bennette seperti yang sudah saya bilang bel ami punya potensi yang kemudian dirusak dengan kualitas cerita dan dialog-dialog dangkalnya yang membosankan', 'karakter georges duroy semestinya kedalaman kompleks pattinson menjadikannya gigolo bodoh murahan film salahkan naskah ditulis rachel bennette bilang bel ami potensi dirusak kualitas cerita dialog-dialog dangkalnya membosankan', 'karakter georges duroy mesti dalam kompleks pattinson jadi gigolo bodoh murah film salah naskah tulis rachel bennette bilang bel ami potensi rusak kualitas cerita dialog dangkal bosan'),
(414, 431, 'meski priesnanda dwisatria selaku penulis naskah berupaya untuk memodifikasi sana-sini lembaran novel agnes agar tidak sampai berakhir menjadi melodrama yang terlalu dangkal namun memang susah untuk bisa mengangkatnya lebih tinggi lagi', 'priesnanda dwisatria penulis naskah berupaya memodifikasi sana-sini lembaran novel agnes melodrama dangkal susah mengangkatnya', 'priesnanda dwisatria tulis naskah upaya modifikasi sana sini lembar novel agnes melodrama dangkal susah angkat'),
(415, 432, 'mengecewakan tentu saja big eyes terasa mengecewakan untuk film kelas burton apalagi burton sebenarnya punya modal cerita bagus ketika menyorot komentar sosial tentang posisi perempuan di dekade masalahnya big eyes seperti nyaris tidak punya keistimewaan lain', 'mengecewakan big eyes mengecewakan film kelas burton burton modal cerita bagus menyorot komentar sosial posisi perempuan dekade big eyes keistimewaan', 'kecewa big eyes kecewa film kelas burton burton modal cerita bagus sorot komentar sosial posisi perempuan dekade big eyes istimewa'),
(416, 433, 'alwyn yang tergolong hijau di hollywood seakan kewalahan dan terlihat amatir saat harus beradu akting dengan nama-nama yang lebih berpengalaman adegan-adegan spiritual yang menyertakan diesel juga sekan mentah dan tak relevan dengan plot utamanya begitu pula saat plot dialihkan pada acara pertandingan football imitasi semuanya terlihat tidak penting membosankan dan dituturkan dengan bertele-tele', 'alwyn tergolong hijau hollywood seakan kewalahan amatir beradu akting nama-nama berpengalaman adegan-adegan spiritual menyertakan diesel sekan mentah relevan plot utamanya plot dialihkan acara pertandingan football imitasi membosankan bertele-tele', 'alwyn golong hijau hollywood akan kewalahan amatir adu akting nama berpengalaman adegan spiritual serta diesel sekan mentah relevan plot utama plot alih acara tanding football imitasi bosan tele'),
(417, 434, 'tidak hanya gagal di naskah blackhat malah bisa dibilang nyaris kacau di semua elemennya belum lagi saya menyebut pengembangan karakternya yang nyaris nol memang mann masih menampilkan semua ciri khasnya seperti pengunaan beberapa sudut kamera dinamis yang ditambah dengan editing cepat tetapi semuanya terlihat sudah mulai usang dan tidak bertenaga bahkan di beberapa adegan aksinya terkesan seperti merupakan versi medioker dari apa yang pernah dilakukannya di film-filmnya sebelumnya ', 'gagal naskah blackhat dibilang kacau elemennya menyebut pengembangan karakternya nol mann menampilkan ciri khasnya pengunaan sudut kamera dinamis ditambah editing cepat usang bertenaga adegan aksinya terkesan versi medioker dilakukannya film-filmnya ', 'gagal naskah blackhat bilang kacau elemen sebut kembang karakter nol mann tampil ciri khas pengunaan sudut kamera dinamis tambah editing cepat usang tenaga adegan aksi kesan versi medioker laku film '),
(418, 435, 'banyak olok-olokan slapstik yang sebenarnya tidak terlalu lucu pesan-pesan kacau dan maksa tentang bagaimana menjadi orangtua dengan terlebih dahulu mengejek kelakuan anak-anak mereka romansa yang tidak terlalu terasa romantisnya untuk ukuran romcom sebelum menutupnya dengan momen-momen cheesy dengan ending klise ', 'olok-olokan slapstik lucu pesan-pesan kacau maksa orangtua mengejek kelakuan anak-anak romansa romantisnya ukuran romcom menutupnya momen-momen cheesy ending klise ', 'olok slapstik lucu pesan kacau maksa orangtua ejek laku anak romansa romantis ukur romcom tutup momen cheesy ending klise '),
(419, 436, 'kondisi psikologis soo-ah yang merasa bersalah atas kecelakaan yang membuat adiknya terbunuh tidak memberikan pengaruh terlalu besar terhadap jalan ceritanya yang ada malah membuatnya terlihat sedikit cengeng terlebih untuk ukuran sebuah crime thriller belum lagi diperparah paruh keduanya yang mengalami penurunan kualitas dari satu jam pertama yang cerdas berubah menjadi sebuah thriller slasher corny yang tertebak tanpa sebuah penyelesaian yang bagus membuat blind menjadi kurang greget di satu jam terakhirnya', 'kondisi psikologis soo-ah bersalah kecelakaan adiknya terbunuh pengaruh jalan ceritanya membuatnya cengeng ukuran crime thriller diperparah paruh mengalami penurunan kualitas jam cerdas berubah thriller slasher corny tertebak penyelesaian bagus blind greget jam terakhirnya', 'kondisi psikologis soo ah bersalah celaka adik bunuh pengaruh jalan cerita buat cengeng ukur crime thriller parah paruh alami turun kualitas jam cerdas ubah thriller slasher corny tebak selesai bagus blind greget jam akhir'),
(420, 437, 'cerita yang disajikan masih terkesan dangkal dan predictable khususnya pada bagian ending don cheadle juga sebenarnya juga bermain cukup baik sayang cerita miliknya terbilang biasa-biasa saja terlalu banyak percakapan yang bertele-tele yang mungkin saja membuat penontonnya bosan richard gere dan kisahnya mungkin yang bisa dibilang paling buruk', 'cerita disajikan terkesan dangkal predictable ending don cheadle bermain sayang cerita miliknya terbilang biasa-biasa percakapan bertele-tele penontonnya bosan richard gere kisahnya dibilang buruk', 'cerita saji kesan dangkal predictable ending don cheadle main sayang cerita milik bilang biasa cakap tele tonton bosan richard gere kisah bilang buruk'),
(421, 438, 'bullet to the head adalah bagaimana untuk kesekian kalinya sly berada di film yang salah kharisma besarnya jelas membantunya untuk menjadi daya tarik terbesar buat penontonnya untuk berbondong-bondong melihat sang rambo kembali lagi terbang solo di layar lebar tetapi tanpa bantuan teman-temannya stallone terlihat begitu kepayahan dengan naskah yang lemah dan alur yang membosankan', 'bullet to the head kesekian kalinya sly film salah kharisma besarnya membantunya daya tarik terbesar penontonnya berbondong-bondong sang rambo terbang solo layar lebar bantuan teman-temannya stallone kepayahan naskah lemah alur membosankan', 'bullet to the head sekian kali sly film salah kharisma besar bantu daya tarik besar tonton bondong sang rambo terbang solo layar lebar bantu teman stallone payah naskah lemah alur bosan'),
(422, 439, 'sayang memang ketidak becusan brooks menjaga konsistensi yang sudah dibangun harus dirusak dengan banyaknya momen-momen tidak masuk akal yang terlalu dipaksakan andai saja burning bright dipegang oleh sutradara lain yang lebih kompeten tentu saja hasilnya bisa jauh lebih baik dari sekarang tidak hanya menjadi sebuah thriller yang hanya meninggalkan premis menariknya semata', 'sayang ketidak becusan brooks menjaga konsistensi dibangun dirusak banyaknya momen-momen masuk akal dipaksakan andai burning bright dipegang sutradara kompeten hasilnya thriller meninggalkan premis menariknya', 'sayang tidak becus brooks jaga konsistensi bangun rusak banyak momen masuk akal paksa andai burning bright pegang sutradara kompeten hasil thriller tinggal premis tarik'),
(423, 440, 'yang cukup mengganggu adalah bagaimana ketidak konsistenan yang dilakukan sattler di akhir-akhir film itu seperti sebuah blunder yang bisa saja merusak apa yang sudah dibuatnya dengan baik sejak awal ya sayang memang sattler harus sedikit mencederai debutnya dengan bermain curang untuk menguatkan pesan tetang kemanusiaannya meskipun sebenarnya juga tidak sampai benar-benar menghancurkannya', 'mengganggu ketidak konsistenan sattler akhir-akhir film blunder merusak ya sayang sattler mencederai debutnya bermain curang menguatkan pesan tetang kemanusiaannya benar-benar menghancurkannya', 'ganggu tidak konsisten sattler akhir film blunder rusak ya sayang sattler cedera debut main curang kuat pesan tetang manusia benar hancur'),
(424, 441, 'entah kenapa engler dan etter pada kenyataannya tidak mampu menjaga ritme ceritanya dengan baik membuat penontonnya terjebak dalam kebosanan dengan alurnya yang bertele-tele dan terkesan dipanjang-panjangkan serta membuang percuma sisi teknis yang sudah dikemas dengan sangat baik pada akhirnya cargo menjadi tidak lebih dari sebuah thriller medioker yang dengan mudah dilupakan oleh penontonnya', 'engler etter kenyataannya menjaga ritme ceritanya penontonnya terjebak kebosanan alurnya bertele-tele terkesan dipanjang-panjangkan serta membuang sisi teknis dikemas cargo thriller medioker mudah dilupakan penontonnya', 'engler etter nyata jaga ritme cerita tonton jebak bosan alur tele kesan panjang serta buang sisi teknis kemas cargo thriller medioker mudah lupa tonton'),
(425, 442, 'kali ini para penggemar animasi pixar harus menyaksikan pertama kalinya film pixar mendapat tomat busuk pertama di website rottentomatoes wow bayangkan orang dewasa penggemar pixar berbondong bondong ke bioskop tanpa membawa anaknya berharap cerita menyentuh dan penuh adegan emosional namun ternyata film ini memang diperuntukkan untuk anak-anak benar-benar di luar dugaan tapi inilah yang terjadi', 'kali penggemar animasi pixar menyaksikan kalinya film pixar tomat busuk website rottentomatoes wow bayangkan orang dewasa penggemar pixar berbondong bondong bioskop membawa anaknya berharap cerita menyentuh penuh adegan emosional film diperuntukkan anak-anak benar-benar dugaan', 'kali gemar animasi pixar saksi kali film pixar tomat busuk website rottentomatoes wow bayang orang dewasa gemar pixar bondong bondong bioskop bawa anak harap cerita sentuh penuh adegan emosional film untuk anak benar duga'),
(426, 443, 'chappie memang punya konsep usang yang telah dimodifikasi sana-sini namun masalah terbesar chappie bukan karena premis familiernya yang sudah bolak-balik di pakai atau template blomkamp yang itu-itu saja namun ada pada kualitas naskahnya itu sendiri yang ditulis blomkamp bersama terri tatchell memanjangkan narasinya dari sebuah film pendek menjadi feature film itu jelas penuh resiko salah salah akan merusak dan sayangnya ini yang terjadi pada chappie entah mungkin karena saya yang terlalu sok kritis tetapi melihat bagaimana narasi olahan blomkamp buaf film panjang tetra vaal itu terkesan sangat compang-camping dan kacau ', 'chappie konsep usang dimodifikasi sana-sini terbesar chappie premis familiernya bolak-balik pakai template blomkamp itu-itu kualitas naskahnya ditulis blomkamp terri tatchell memanjangkan narasinya film pendek feature film penuh resiko salah salah merusak sayangnya chappie sok kritis narasi olahan blomkamp buaf film tetra vaal terkesan compang-camping kacau ', 'chappie konsep usang modifikasi sana sini besar chappie premis familier bolak-balik pakai template blomkamp itu kualitas naskah tulis blomkamp terri tatchell panjang narasi film pendek feature film penuh resiko salah salah rusak sayang chappie sok kritis narasi olah blomkamp buaf film tetra vaal kesan compang-camping kacau '),
