(430, 447, 'untuk sebuah film yang mengandung kata wild di dalamnya wild card tidak sampai seliar itu malah bisa dibilang ia adalah salah satu film aksi statham yang jinak dengan sekuens action yang meskipun cukup badass tetapi bisa dihitung jari sebelah tangan dan untuk film yang mengandung kata card di dalamnya wild card gagal menyajikan dunia judi yang mendalam', 'film mengandung wild dalamnya wild card seliar dibilang salah film aksi statham jinak sekuens action badass dihitung jari sebelah tangan film mengandung card dalamnya wild card gagal menyajikan dunia judi mendalam', 'film kandung wild dalam wild card liar bilang salah film aksi statham jinak sekuens action badass hitung jari sebelah tangan film kandung card dalam wild card gagal saji dunia judi dalam'),
