(452, 469, 'pada akhirnya the woman in black tidak lebih dari sekedar horor rumah hantu konvensional yang tugas utamanya hanya satu menakut-nakuti penontonnya sesering dengan trik-trik oldschool yang mungkin sudah sering kita lihat di puluhan film sejenis macam benda-benda bergerak sendiri kelebatan bayangan penampakan hantu wanita padahal jika mau watkins dan goldman bisa saja memberi ruang lebih banyak untuk perkembangan karakter radcliffe', 'the woman in black sekedar horor rumah hantu konvensional tugas utamanya menakut-nakuti penontonnya sesering trik-trik oldschool lihat puluhan film sejenis benda-benda bergerak kelebatan bayangan penampakan hantu wanita watkins goldman ruang perkembangan karakter radcliffe', 'the woman in black sekedar horor rumah hantu konvensional tugas utama takut nakuti tonton sering trik oldschool lihat puluh film jenis benda gerak kelebat bayang tampak hantu wanita watkins goldman ruang kembang karakter radcliffe'),
