(454, 471, 'pada akhirnya the whistleblower hanya menjadi sebuah thriller politik medioker yang akan dengan mudah terlupakan dikarenakan kondracki gagal untuk memanfaatkan sebaik mungkin modal besar kisah nyata yang diberikan kepadanya menjadikan film yang seharusnya bisa menarik ini menjadi sedatar permukaan meja makan', 'the whistleblower thriller politik medioker mudah terlupakan kondracki gagal memanfaatkan modal kisah nyata menjadikan film menarik sedatar permukaan meja makan', 'the whistleblower thriller politik medioker mudah lupa kondracki gagal manfaat modal kisah nyata jadi film tarik datar muka meja makan'),
