(456, 473, 'yah lupakan saja memang soal bagaimana kisahnya bisa digarap selemah ini song moo lee tampaknya terlalu rakus menghidangkan terlalu banyak menu konflik tanpa mampu menghabiskan semuanya dengan bersih di samping itu juga terlalu banyak karakter yang berpotensi untuk dikembangkan lebih jauh yang pada akhirnya malah terbuang percuma begitu saja tidak lebih menjadi karakter penghibur mengisi kisah percintaan yang dan lynne yang membosankan apalagi kisah roman picisan tersebut nyaris mendominasi keseluruhan film berdurasi menit ini', 'yah lupakan kisahnya digarap selemah song moo lee rakus menghidangkan menu konflik menghabiskan bersih samping karakter berpotensi dikembangkan terbuang karakter penghibur mengisi kisah percintaan lynne membosankan kisah roman picisan mendominasi film berdurasi menit', 'yah lupa kisah garap lemah song moo lee rakus hidang menu konflik habis bersih samping karakter potensi kembang buang karakter hibur isi kisah cinta lynne bosan kisah roman picis dominasi film durasi menit'),
