(458, 475, 'ya sebenarnya masih ada momen-momen creepy di dalamnya tetapi jumlahnya tak banyak bahkan levelnya bisa dibilang hanya sekedar untuk menakut-nakuti anak ingusan misterinya tidak diperlakukan dengan baik tidak ada permulaan yang jelas tiba-tiba saja booom semua terjadi memang ada sedikit penjelasan yang menyangkut latar belakang tokoh angela yang kemudian dihubungkan dengan tema bilbical tetapi tetap saja prosesnya tidak jelas', 'ya momen-momen creepy dalamnya levelnya dibilang sekedar menakut-nakuti anak ingusan misterinya diperlakukan permulaan booom penjelasan latar tokoh angela dihubungkan tema bilbical prosesnya', 'ya momen creepy dalam level bilang sekedar takut nakuti anak ingus misteri laku mula booom jelas latar tokoh angela hubung tema bilbical proses'),
(459, 476, 'eclipse adalah seri twilight yang paling membosankan bahkan dari new moon yang dianggap paling buruk sekalipun memang harus diakui selama kurang lebih dua jam penonton akan disuguhi dialog-dialog monoton dan tidak berbobot yang keluar di antara karakter utamanya entah apa memang seperti itu juga dialog-dialog yang terdapat dalam novelnya', 'eclipse seri twilight membosankan new moon dianggap buruk diakui jam penonton disuguhi dialog-dialog monoton berbobot karakter utamanya dialog-dialog novelnya', 'eclipse seri twilight bosan new moon anggap buruk aku jam tonton suguh dialog monoton bobot karakter utama dialog novel'),
(460, 477, 'the tower tampaknya memang didesain sedemikian rupa dengan tujuan murni untuk hiburan jadi kamu hanya melihat bagaimana para manusianya berusaha bertahan hidup di kurang lebih dua jam durasinya sementara dukungan efek mahal dengan segala tetek bengek ketegangan dan aksi-aksi penyelamatan heroik yang mungkin terasa berlebihan kemudian memegang kendali sepenuhnya dan tentu saja tidak lupa bumbu melodrama khas korea kemudian diselipkan di dalamnya untuk memberikan sebuah luapan emosi di tengah kerusakan besar sayang hal itu tidak terlalu bekerja dengan baik', 'the tower didesain rupa tujuan murni hiburan manusianya berusaha bertahan hidup jam durasinya dukungan efek mahal tetek bengek ketegangan aksi-aksi penyelamatan heroik memegang kendali sepenuhnya lupa bumbu melodrama khas korea diselipkan dalamnya luapan emosi kerusakan sayang', 'the tower desain rupa tuju murni hibur manusia usaha tahan hidup jam durasi dukung efek mahal tetek bengek tegang aksi selamat heroik pegang kendali sepenuh lupa bumbu melodrama khas korea selip dalam luap emosi rusak sayang'),
(461, 478, 'naskah buruk performa mengecewakan dari kedua pemainnya membuat the tourist seakan-akan menjadi sebuah action-thriller yang serba tanggung jika ada satu-satunya yang bisa dinikmati di sepanjang kurang lebih satu jam setengah ini mungkin adalah pemandangan venesia sisanya yah seperti yang sudah saya katakan tanggung', 'naskah buruk performa mengecewakan pemainnya the tourist seakan-akan action-thriller serba tanggung satu-satunya dinikmati jam pemandangan venesia sisanya yah tanggung', 'naskah buruk performa kecewa main the tourist akan action thriller serba tanggung satu nikmat jam pandang venesia sisa yah tanggung'),
(462, 479, 'banyak shaky cam ala paul greengrass dengan editing cepat dam scoring mendebarkan yang sayangnya terasa lebih berantakan dan memusingkan the suspect terlihat terlalu dangkal terlalu lama dan bertele-tele sepanjang menit dan berakhir sedikit cengeng di balik segala konspirasi politik kemachoan dan konflik balas dendamnya', 'shaky cam ala paul greengrass editing cepat dam scoring mendebarkan sayangnya berantakan memusingkan the suspect dangkal bertele-tele menit cengeng konspirasi politik kemachoan konflik balas dendamnya', 'shaky cam ala paul greengrass editing cepat dam scoring debar sayang berantak pusing the suspect dangkal tele menit cengeng konspirasi politik kemachoan konflik balas dendam'),
(463, 480, 'jujur saja pendekatan yang dilakukan film ini secara tidak langsung merusak film ini secara keseluruhan karena siapa sebenarnya sosok david harris sudah diperlihatkan dengan gamblang dari menit-menit awal sehingga kesan misteriusnya sudah berkurang selanjutnya bisa dibilang cerita film yang didistribusikan oleh screen gems ini sangat klise dan mudah sekali ditebak bahkan untuk bagian akhirnya sekalipun', 'jujur pendekatan film langsung merusak film sosok david harris gamblang menit-menit kesan misteriusnya berkurang dibilang cerita film didistribusikan screen gems klise mudah ditebak', 'jujur dekat film langsung rusak film sosok david harris gamblang menit kesan misterius kurang bilang cerita film distribusi screen gems klise mudah tebak'),
(464, 481, 'sayang lagi-lagi seperti sudah menjadi penyakit film-film popcorn kebanyakan the sorcerers apprentice pun tidak lepas dari kelemahan mendasar ya plot yang terlalu sederhana dan klise layaknya dongeng-dongeng klasik tiga babak buatan disney yang dapat kita tebak bagaimana cerita tersebut berakhir tanpa harus repot-repot berpikir keras ya the sorcerers apprentice tidak ada plot njelimet dan berlapis-lapis yang memusingkan di sini', 'sayang lagi-lagi penyakit film-film popcorn kebanyakan the sorcerers apprentice lepas kelemahan mendasar ya plot sederhana klise layaknya dongeng-dongeng klasik babak buatan disney tebak cerita repot-repot berpikir keras ya the sorcerers apprentice plot njelimet berlapis-lapis memusingkan', 'sayang lagi sakit film popcorn banyak the sorcerers apprentice lepas lemah dasar ya plot sederhana klise layak dongeng klasik babak buat disney tebak cerita repot pikir keras ya the sorcerers apprentice plot njelimet lapis pusing'),
(465, 482, 'pendek kata the saint versi noyce ini terasa hanya menumpang ketenaran serial televisinya saja tanpa adanya kedalaman cerita bahkan untuk ukuran film aksi spionase film ini juga tidak menawarkan adegan aksi yang wah semuanya serba standar dan lurus-lurus saja kalau tidak mau dibilang buruk belum lagi aksi jual tampang val kilmer yang cukup mengganggu sepanjang menit', 'pendek the saint versi noyce menumpang ketenaran serial televisinya kedalaman cerita ukuran film aksi spionase film menawarkan adegan aksi serba standar lurus-lurus dibilang buruk aksi jual tampang val kilmer mengganggu menit', 'pendek the saint versi noyce tumpang tenar serial televisi dalam cerita ukur film aksi spionase film tawar adegan aksi serba standar lurus bilang buruk aksi jual tampang val kilmer ganggu menit'),
(466, 483, 'the rite mungkin tidak lebih dari horror bertema exorcism biasa menghibur namun tidak istimewa bahkan cenderung membosankan buat anda yang kurang menggemari horror beralur lambat kecuali anda adalah fans berat dan sudah rindu dengan penampilan dingin dari seorang sir anthony hopkins', 'the rite horror bertema exorcism menghibur istimewa cenderung membosankan menggemari horror beralur lambat kecuali fans berat rindu penampilan dingin sir anthony hopkins', 'the rite horror tema exorcism hibur istimewa cenderung bosan gemar horror alur lambat kecuali fans berat rindu tampil dingin sir anthony hopkins');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(467, 484, 'mencari sesuatu yang menarik di the resident mungkin anda hanya menemukan nama hillary swank di dalamnya karena jika nama besar itu dicabut maka sisanya hanya sebuah thriller medioker klise dari seorang sutradara video klip yang sudah bersusah payah agar debut film panjangnya ini dapat laku di pasaran', 'mencari menarik the resident menemukan nama hillary swank dalamnya nama dicabut sisanya thriller medioker klise sutradara video klip bersusah payah debut film panjangnya laku pasaran', 'cari tarik the resident temu nama hillary swank dalam nama cabut sisa thriller medioker klise sutradara video klip susah payah debut film panjang laku pasar'),
(468, 485, 'pouge kembali ke pakem lama yang melibatkan sedikit sentuhan modern dari elemen mockumentary tetapi sayang semua kesenangan-kesenangan itu tidak dibarengi dengan kehadiran aura mencekam semuanya tampak datar tidak menakutkan dan bisa dibilang membosankan', 'pouge pakem melibatkan sentuhan modern elemen mockumentary sayang kesenangan-kesenangan dibarengi kehadiran aura mencekam datar menakutkan dibilang membosankan', 'pouge pakem libat sentuh modern elemen mockumentary sayang kesenangan bareng hadir aura cekam datar takut bilang bosan'),
(469, 486, 'apa yang terjadi setelah menit anarchy kembali mengulangi kesalahan yang sama yang pernah dibuat pendahulunya membuang percuma tema besarnya dan segala elemen pendukung yang seharusnya membuat sekuelnya ini menjadi lebih baik sayang apa yang terjadi di lapangan tidak lebih dari sebuah thriller aksi survival kosong kelas dua yang dihiasi dengan kebisingan tanpa arti dan pertempuran murahan dengan kadar gore yang disunat', 'menit anarchy mengulangi kesalahan pendahulunya membuang tema besarnya elemen pendukung sekuelnya sayang lapangan thriller aksi survival kosong kelas dihiasi kebisingan arti pertempuran murahan kadar gore disunat', 'menit anarchy ulang salah dahulu buang tema besar elemen dukung sekuelnya sayang lapang thriller aksi survival kosong kelas hias bising arti tempur murah kadar gore sunat'),
(470, 487, 'sebuah konsep gila yang punya potensi menjadi besar dan dalam sayangnya pada akhirnya demonaco entah terlalu malas atau tidak tahu bagaimana mengembangkannya the purge kemudian hanya menjadi sajian home invasion thriller yang sering kamu lihat dengan segala aspek bertahan hidupnya yang juga familiar', 'konsep gila potensi sayangnya demonaco malas mengembangkannya the purge sajian home invasion thriller lihat aspek bertahan hidupnya familiar', 'konsep gila potensi sayang demonaco malas kembang the purge saji home invasion thriller lihat aspek tahan hidup familiar'),
(471, 488, 'ceritanya yang juga tidak lagi terlalu orisinal ini bergerak begitu lambat dan sedikit membosankan dengan rentetan misteri-misteri yang tidak mampu disembunyikan dengan aman sungguh teka-teki yang disajikan oleh the perfect house gagal mempermainkan saya tentu saja imbas dari kekurangan-kekurangan di atas membuat ending the perfect house yang seharusnya bisa mengejutkan menjadi cacat dan terasa hambar anggap saja seperti menonton thriller untuk pemula', 'ceritanya orisinal bergerak lambat membosankan rentetan misteri-misteri disembunyikan aman sungguh teka-teki disajikan the perfect house gagal mempermainkan imbas kekurangan-kekurangan ending the perfect house mengejutkan cacat hambar anggap menonton thriller pemula', 'cerita orisinal gerak lambat bosan rentet misteri sembunyi aman sungguh teka teki saji the perfect house gagal main imbas kekurangan ending the perfect house kejut cacat hambar anggap tonton thriller mula'),
(472, 489, 'seperti kebanyakan romcom lainnya ia akan memulainya dengan sesuatu yang cukup menyegarkan sampai kemudian berakhir cheesy termasuk penyutradaraan cassavetes junior yang juga tidak istimewa terutama ketika ia terlalu memaksakan memasukkan beberapa gambar-gambar melankolis yang terasa tidak cocok', 'kebanyakan romcom memulainya menyegarkan cheesy penyutradaraan cassavetes junior istimewa memaksakan memasukkan gambar-gambar melankolis cocok', 'banyak romcom mulai segar cheesy sutradara cassavetes junior istimewa paksa masuk gambar melankolis cocok'),
(473, 490, 'endingnya buruk terlalu cepat absurd dan tidak memberikan banyak jawaban dari pertanyaan-pertanyaan yang ada seperti siapa sebenarnya wanita misterius itu apa hubungan adegan bunuh diri di awal film dengan buku itu sendiri dan beberapa lubang lain di ceritanya banyak kritikus yang menganggap the ninth gate sebagai salah satu kesalahan besar polanski', 'endingnya buruk cepat absurd pertanyaan-pertanyaan wanita misterius hubungan adegan bunuh film buku lubang ceritanya kritikus menganggap the ninth gate salah kesalahan polanski', 'endingnya buruk cepat absurd pertanyaan wanita misterius hubung adegan bunuh film buku lubang cerita kritikus anggap the ninth gate salah salah polanski'),
(474, 491, 'seperti ingin menyertai kegagalan film ini nama kevin costner yang didapuk sebagai nilai jual juga kembali gagal menampilkan peran terbaiknya overall premis usang ditambah dengan eksekusinya yang payah dan ditutup dengan ending buruk jelas membuat the new daughter bukanlah sajian horror yang dapat diharapkan dapat memuaskan para penggemarnya', 'menyertai kegagalan film nama kevin costner didapuk nilai jual gagal menampilkan peran terbaiknya overall premis usang ditambah eksekusinya payah ditutup ending buruk the new daughter sajian horror diharapkan memuaskan penggemarnya', 'serta gagal film nama kevin costner didapuk nilai jual gagal tampil peran baik overall premis usang tambah eksekusi payah tutup ending buruk the new daughter saji horror harap muas gemar'),
(475, 492, 'nama richard gare jelas di dapuk untuk menjadi daya pikat the mothman prophecies namun apa daya aktor yang memiliki cir khas berambut putih ini gagal memainkan perannya pada akhirnya the mothman prophecies menjadi sebuah thriller misteri yang garing', 'nama richard gare dapuk daya pikat the mothman prophecies daya aktor memiliki cir khas berambut putih gagal memainkan perannya the mothman prophecies thriller misteri garing', 'nama richard gare dapuk daya pikat the mothman prophecies daya aktor milik cir khas rambut putih gagal main peran the mothman prophecies thriller misteri garing'),
(476, 493, 'sementara unsur romansanya dibentuk secara paksa dan kasar transisi untuk membangun rasa cinta terasa terlalu cepat hanya melalui acara makan ayam panggang dan bersenang-senang beberapa jam di taman bermain dan terakhir soal cgi kualitas cgi the mermaid itu buruk sangat buruk bahkan untuk sekedar dibandingkan dengan shaolin soccer atau kung fu hustle sekalipun', 'unsur romansanya dibentuk paksa kasar transisi membangun cinta cepat acara makan ayam panggang bersenang-senang jam taman bermain cgi kualitas cgi the mermaid buruk buruk sekedar dibandingkan shaolin soccer kung fu hustle', 'unsur romansa bentuk paksa kasar transisi bangun cinta cepat acara makan ayam panggang senang jam taman main cgi kualitas cgi the mermaid buruk buruk sekedar banding shaolin soccer kung fu hustle'),
(477, 494, 'naskah besutan james bukan hanya terlalu klise dengan segala cerita tentang bagaimana robot yang ingin menjadi manusia namun juga ia tidak pernah benar-benar kuat membentuk segala urusan moral termasuk sentuhan dramanya yang juga gagal menciptakan emosi yang semestinya', 'naskah besutan james klise cerita robot manusia benar-benar kuat membentuk urusan moral sentuhan dramanya gagal menciptakan emosi semestinya', 'naskah besut james klise cerita robot manusia benar kuat bentuk urus moral sentuh drama gagal cipta emosi mesti'),
(478, 495, 'faktor minus terbesar adalah ketika the love of siam bergerak terlalu bertele-tele dan terasa lama sesuatu yang tidak baik untuk sebuah drama yang berdurasi dua jam setengah benar-benar perjuangan yang melelahkan ketika menontonnya sakveerakul sepertinya kebingungan untuk bagaimana mengembangkan kisahnya lebih lanjut dan apa yang terjadi kemudian ia malah menambahkan sub plot lain yang parahnya terlalu opera sabun alias terlalu sinetron dan tidak penting', 'faktor minus terbesar the love of siam bergerak bertele-tele drama berdurasi jam benar-benar perjuangan melelahkan menontonnya sakveerakul kebingungan mengembangkan kisahnya sub plot parahnya opera sabun alias sinetron', 'faktor minus besar the love of siam gerak tele drama durasi jam benar juang lelah tonton sakveerakul bingung kembang kisah sub plot parah opera sabun alias sinetron'),
(479, 496, 'santai sajalah menikmati the losers tidak perlu pusing dengan plotnya yang simpel dan klise toh filmnya sendiri memang diperuntukkan sebagai hiburan semata', 'santai menikmati the losers pusing plotnya simpel klise filmnya diperuntukkan hiburan', 'santai nikmat the losers pusing plot simpel klise film untuk hibur'),
(480, 497, 'yang salah bisa jadi adalah naskah yang ditulis ken daurio dan cinco paul bukan masalah bagaimana mereka sudah memodifikasinya sana-sini membuat karakter the lorax yang semestinya menjadi tokoh sentral mendapat porsi lebih sedikit ketimbang tokoh ted tapi yang menjadi persoalan adalah plotnya yang terlalu lurus khususnya untuk penonton dewasa efeknya bisa membosankan terlebih ketika homor-humor di paruh pertamanya sudah tidak lagi terlalu lucu ketika menginjak pertengahan film hingga kemudian ia berakhir klise', 'salah naskah ditulis ken daurio cinco paul memodifikasinya sana-sini karakter the lorax semestinya tokoh sentral porsi ketimbang tokoh ted plotnya lurus penonton dewasa efeknya membosankan homor-humor paruh pertamanya lucu menginjak pertengahan film klise', 'salah naskah tulis ken daurio cinco paul modifikasi sana sini karakter the lorax mesti tokoh sentral porsi ketimbang tokoh ted plot lurus tonton dewasa efek bosan homor humor paruh pertama lucu injak tengah film klise'),
(481, 498, 'robbie dan karakter-karakter lain seperti terbuang percuma oleh peran mereka karena naskah yang tidak pernah mampu membuat mereka berkembang dari sekedar karakter hore-hore semata', 'robbie karakter-karakter terbuang peran naskah berkembang sekedar karakter hore-hore', 'robbie karakter buang peran naskah kembang sekedar karakter hore'),
(482, 499, 'masalahnya sedikit momen seram tidak mampu menutupi kekacauan yang akan hadir selanjutnya seiring dengan semakin jauhnya durasinya berjalan the lazarus effect menjadi melempem ia seperti sedang kebingungan untuk memilih satu tema utama sialnya itu tidak terjadi dan berbicara soal bagian akhirnya percayalah apa yang terjadi di ujungnya itu tidak lebih dari sebuah kekonyolan luar biasa seakan-akan melengkapi setiap bencana yang terjadi', 'momen seram menutupi kekacauan hadir seiring jauhnya durasinya berjalan the lazarus effect melempem kebingungan memilih tema utama sialnya berbicara percayalah ujungnya kekonyolan seakan-akan melengkapi bencana', 'momen seram tutup kacauan hadir iring jauh durasi jalan the lazarus effect melempem bingung pilih tema utama sial bicara percaya ujung konyol akan lengkap bencana'),
(483, 500, 'tidak ada kedalaman tidak ada pengembangan ceria berarti termasuk karakter-karakternya yang terasa teralu datar dan tidak tergali dengan baik meski sebenarnya ada sedikit potensi yang sebenarnya bisa dikembangkan dalam karakter klauder dengan sejumput masa lalunya yang suram toh pada akhirnya film-film jenis ini kembali terjebak dalam pakem lama yang lebih menonjolkan otot dalam aksi pertarungan dan visual dalam cgi mahal seharga juta dollar', 'kedalaman pengembangan ceria karakter-karakternya teralu datar tergali potensi dikembangkan karakter klauder sejumput lalunya suram film-film jenis terjebak pakem menonjolkan otot aksi pertarungan visual cgi mahal seharga juta dollar', 'dalam kembang ceria karakter alu datar gali potensi kembang karakter klauder jumput lalu suram film jenis jebak pakem tonjol otot aksi tarung visual cgi mahal harga juta dollar'),
(484, 501, 'setelah dear john yang tampil kurang greget dan banyak mendapatkan respon negatif dari para kritikus kali ini the last song pun nasibnya tidak jauh berbeda dari pendahulunya itu malah bisa dibilang film ini adalah film adaptasi novel nicholas spark terburuk yang pernah dibuat plot tidak menarik datar dan membosankan konfilk-konflik yang kurang digali serta tempo yang terlalu cepat menjadi penyebab kegagalan the last song so jika anda bukan salah satu penggemar berat miley cyrus lebih baik hindari saja film membosankan satu ini ya the last song benar-benar tampil sangat mengecewakan hampir di semua bagian salah satu yang terburuk di tahun ini', 'dear john tampil greget respon negatif kritikus kali the last song nasibnya berbeda pendahulunya dibilang film film adaptasi novel nicholas spark terburuk plot menarik datar membosankan konfilk-konflik digali serta tempo cepat penyebab kegagalan the last song so salah penggemar berat miley cyrus hindari film membosankan ya the last song benar-benar tampil mengecewakan salah terburuk', 'dear john tampil greget respon negatif kritikus kali the last song nasib beda dahulu bilang film film adaptasi novel nicholas spark buruk plot tarik datar bosan konfilk konflik gali serta tempo cepat sebab gagal the last song so salah gemar berat miley cyrus hindar film bosan ya the last song benar tampil kecewa salah buruk'),
(485, 502, 'presentasinya buruk alurnya kelewat lambat di awal-awal dan beberapa repetisi terasa hambar ketimbang menakutkan ini lebih pantas kamu masukan dalam format yang lebih kecil macam ftv atau home video ketimbang film layar lebar', 'presentasinya buruk alurnya kelewat lambat awal-awal repetisi hambar ketimbang menakutkan masukan format ftv home video ketimbang film layar lebar', 'presentasi buruk alur lewat lambat awal repetisi hambar ketimbang takut masuk format ftv home video ketimbang film layar lebar'),
(486, 503, 'ya untuk ukuran sebuah horor the intruders jelas gagal melaksanakan tugasnya dengan baik selain naskahnya yang lemah penyutradaraan fresnadillo juga tidak maksimal dengan segala pace lambatnya yang terkesan terseok-seok repetitif dan membosankan termasuk yang paling parah adalah gagal menghadirkan aura menakutkan untuk memberikan teror kepada penontonnya', 'ya ukuran horor the intruders gagal melaksanakan tugasnya naskahnya lemah penyutradaraan fresnadillo maksimal pace lambatnya terkesan terseok-seok repetitif membosankan parah gagal menghadirkan aura menakutkan teror penontonnya', 'ya ukur horor the intruders gagal laksana tugas naskah lemah sutradara fresnadillo maksimal pace lambat kesan seok repetitif bosan parah gagal hadir aura takut teror penontonnya'),
(487, 504, 'ironisnya dengan rentetan misteri semenarik itu nakata bisa dibilang gagal membangun tensi suspense alias ketegangannya belum lagi saya menyebut beberapa plot hole yang mengganggu meskipun banyak dihiasi dengan kematian mengerikan tapi incite mill tidak pernah mencapai titik didih semestinya untuk sebuah thriller psikologis bahkan bumbu krisis kepercayaan dan survival juga terasa sedikit hambar', 'ironisnya rentetan misteri semenarik nakata dibilang gagal membangun tensi suspense alias ketegangannya menyebut plot hole mengganggu dihiasi kematian mengerikan incite mill mencapai titik didih semestinya thriller psikologis bumbu krisis kepercayaan survival hambar', 'ironis rentet misteri semenarik nakata bilang gagal bangun tensi suspense alias ketegangannya sebut plot hole ganggu hias mati erik incite mill capai titik didih semestinya thriller psikologis bumbu krisis percaya survival hambar'),
(488, 505, 'kombinasi konsep dongeng modifikasi tanggung petualangan yang tidak terlalu greget romansa gombal dan penyutradaraan lembek dari seorang debutan macam cedric nicolas-troyan memang menjadi luka-luka besar buat the huntsman winters war', 'kombinasi konsep dongeng modifikasi tanggung petualangan greget romansa gombal penyutradaraan lembek debutan cedric nicolas-troyan luka-luka the huntsman winters war', 'kombinasi konsep dongeng modifikasi tanggung tualang greget romansa gombal sutradara lembek debut cedric nicolas troyan luka the huntsman winters war'),
(489, 506, 'lemah di plot dan didukung dengan penyajiannya yang serba tanggung dan sangat predictable membuat the human centipede sudah kalah di bagian yang bisa dibilang cukup vital ini dan hal itu masih diperparah dengan minimnya adegan gore dan disturbing yang ternyata juga tidak ditampilkan secara eksplisit', 'lemah plot didukung penyajiannya serba tanggung predictable the human centipede kalah dibilang vital diperparah minimnya adegan gore disturbing ditampilkan eksplisit', 'lemah plot dukung penyajiannya serba tanggung predictable the human centipede kalah bilang vital parah minim adegan gore disturbing tampil eksplisit'),
(490, 507, 'ini bisa dibilang adalah seri terburuk paling mengecewakan tidak hanya punya kualitas narasi palik jelek namun six memindahkan jalurnya dari hororthriller ke ranah dark comedy yang sedikit banyak sudah menghilangkan kesan seriusnya hasilnya final sequence seperti parade sirkus bodoh yang dipimpin oleh cast dan plot yang sama bodohnya sementara laurence r harvey pun tidak kalah buruknya melihat six sudah membuat penampilannya begitu berbeda dengan karakternya di full sequence jelas mengecewakan', 'dibilang seri terburuk mengecewakan kualitas narasi palik jelek six memindahkan jalurnya hororthriller ranah dark comedy menghilangkan kesan seriusnya hasilnya final sequence parade sirkus bodoh dipimpin cast plot bodohnya laurence r harvey kalah buruknya six penampilannya berbeda karakternya full sequence mengecewakan', 'bilang seri buruk kecewa kualitas narasi palik jelek six pindah jalur hororthriller ranah dark comedy hilang kesan serius hasil final sequence parade sirkus bodoh pimpin cast plot bodoh laurence r harvey kalah buruk six penampilannya beda karakter full sequence kecewa'),
(491, 508, 'apa yang dilakukan martin lomax di sini terangkai dalam gambar-gambar yang cukup frontal dan tidak bermoral nyaris tanpa sensor membuat penonton yang lemah hati bisa jadi akan dibuat sakit jantung dan mual', 'martin lomax terangkai gambar-gambar frontal bermoral sensor penonton lemah hati sakit jantung mual', 'martin lomax angka gambar frontal moral sensor tonton lemah hati sakit jantung mual'),
(492, 509, 'tetapi di balik segala sumber dayanya yang mewah dan pesan kepahlawanan yang luar biasa itu tidak sulit untuk mengatakan bahwa the himalayas adalah sebuah drama cengeng yang konyol kenapa konyol pikir saja secara logika sehat misi membawa pulang jenazah dari puncak everest yang mematikan bisa dibilang adalah sebuah tindakan bunuh diri yang bodoh dan tidak masuk akal coba saja kamu tanyakan kepada pendaki profesional paling hebat sekalipun saya berani bertaruh ia tidak akan berpikir dua kali untuk menolaknya', 'sumber dayanya mewah pesan kepahlawanan sulit the himalayas drama cengeng konyol konyol pikir logika sehat misi membawa pulang jenazah puncak everest mematikan dibilang tindakan bunuh bodoh masuk akal coba pendaki profesional hebat berani bertaruh berpikir kali menolaknya', 'sumber daya mewah pesan pahlawan sulit the himalayas drama cengeng konyol konyol pikir logika sehat misi bawa pulang jenazah puncak everest mati bilang tindak bunuh bodoh masuk akal coba pendak profesional hebat berani taruh pikir kali tolak'),
(493, 510, 'mungkin the hangover  lalu sudah membuat batasan begitu tinggi bagi phillips yang membuatnya kesulitan untuk melanjutkannya ke sekuel-sekuel selanjutnya yang terjadi dengan kepercayaan yang begitu tinggi pada akhirnya adalah bencana di seri keduanya dan the hangover part iii yang dipaksakan untuk dilanjutkan sebagai penutup juga bukan sekuel yang bagus namun setidaknya ini masih lebih baik ketimbang part deux yang malas itu', 'the hangover  batasan phillips membuatnya kesulitan melanjutkannya sekuel-sekuel kepercayaan bencana seri the hangover part iii dipaksakan dilanjutkan penutup sekuel bagus ketimbang part deux malas', 'the hangover  batas phillips buat sulit lanjut sekuel-sekuel percaya bencana seri the hangover part iii paksa lanjut penutup sekuel bagus timbang part deux malas'),
(494, 511, 'eli roth memang belum pernah membuat horor-horor yang luar biasa bagus dalam hal bercerita dalam kasus the green inferno roth memulainya dengan banyak basa-basi tak perlu yang terlalu lama dipenuhi narasi dan karakterisasi cheesy tetapi jika kamu hanya ingin sekedar mencari hiburan sederhana dalam bentuk blood and gore dengan sedikit bumbu humor gelap yang efektif maka kamu sudah berada di tangan orang yang tepat ', 'eli roth horor-horor bagus bercerita the green inferno roth memulainya basa-basi dipenuhi narasi karakterisasi cheesy sekedar mencari hiburan sederhana bentuk blood and gore bumbu humor gelap efektif tangan orang ', 'eli roth horor-horor bagus cerita the green inferno roth mulai basa-basi penuh narasi karakterisasi cheesy sekedar cari hibur sederhana bentuk blood and gore bumbu humor gelap efektif tang orang '),
(495, 512, 'ya the giver jelas punya modal kuat dari novelnya tetapi michael mitnick dan robert b weide rupanya memilih untuk bermain aman dengan banyak memangkas segalanya menyederhanakan narasi kompleksnya membuang bagian-bagian penting untuk dijadikan tontonan yang benar-benar terasa seperti sebuah sajian young adult klise nan cheesy ala hollywood ketimbang fiksi ilmiah pintar yang dipenuhi dengan kedalaman metafora filosofi dan sindiran sosial ya sayang memang setelah seperempat durasi awal yang cukup menyakinkan lengkap dengan sebuah proses perubahan warna ala pleasentville the giver jatuh menjadi tontonan sci-fi remaja tumpul yang terlalu panjang dan membosankan oleh beberapa momen tak perlu yang seperti diulang-ulang lalu ada banyak casting bagus yang terasa mubazir karena minimnya porsi yang diberikan', 'ya the giver modal kuat novelnya michael mitnick robert b weide memilih bermain aman memangkas menyederhanakan narasi kompleksnya membuang bagian-bagian dijadikan tontonan benar-benar sajian young adult klise nan cheesy ala hollywood ketimbang fiksi ilmiah pintar dipenuhi kedalaman metafora filosofi sindiran sosial ya sayang seperempat durasi menyakinkan lengkap proses perubahan warna ala pleasentville the giver jatuh tontonan sci-fi remaja tumpul membosankan momen diulang-ulang casting bagus mubazir minimnya porsi', 'ya the giver modal kuat novel michael mitnick robert b weide memilih main aman mangkas sederhana narasi kompleks buang bagian-bagian jadi tonton benar-benar saji young adult klise nan cheesy ala hollywood timbang fiksi ilmiah pintar penuh dalam metafora filosofi sindir sosial ya sayang seperempat durasi menyakinkan lengkap proses ubah warna ala pleasentville the giver jatuh tonton sci-fi remaja tumpul bosan momen diulang-ulang casting bagus mubazir minim porsi'),
(496, 513, 'implentasi psikologis bisa dibilang gagal total dalam memberikan sebuah pengalaman horor yang kompleks hasilnya terlebih dengan ending yang terlalu mudah diprediksi the forest tidak lebih dari sebuah horor medioker yang berlindung di balik premis kisah nyatanya yang harus diakui jauh lebih mampu membuatmu bergidik', 'implentasi psikologis dibilang gagal total pengalaman horor kompleks hasilnya ending mudah diprediksi the forest horor medioker berlindung premis kisah diakui membuatmu bergidik', 'implentasi psikologis bilang gagal total alam horor kompleks hasil ending mudah prediksi the forest horor medioker lindung premis kisah aku buat gidik'),
(497, 514, 'the flowers of war jelas bukan pencapaian terbaik seorang zhang yimou narasinya tidak sekuat temanya tidak ada emosi yang dalam kecuali anda adalah penonton oversensitif hanya ada gambar-gambar bagus dan adengan perang hebat di  menit pertamanya dan christian bale dengan akting pas-pasan jauh jika dibandingkan karya-karya hebat yimaou yang lain macam raise the red lantern hero atau to live yang luar biasa itu mengecewakan memang untuk ukuran yimaou tapi setidaknya saya masih bisa menikmatinya hingga akhir', 'the flowers of war pencapaian terbaik zhang yimou narasinya sekuat temanya emosi kecuali penonton oversensitif gambar-gambar bagus adengan perang hebat  menit pertamanya christian bale akting pas-pasan dibandingkan karya-karya hebat yimaou raise the red lantern hero to live mengecewakan ukuran yimaou menikmatinya', 'the flowers of war capai baik zhang yimou narasi kuat tema emosi kecuali penonton oversensitif gambar-gambar bagus adengan perang hebat  menit pertama christian bale akting pas-pasan banding karya-karya hebat yimaou raise the red lantern hero to live kecewa ukur yimaou nikmat'),
(498, 515, 'berbeda dengan dua seri sebelumnya seri ketiganya ini mungkin akan sedikit mengecewakan karena beberapa hal pertama ia kembali mengulang formula plot yang sama semuanya persis seperti yang sudah pernah kamu lihat dimulai dengan opening heboh misi yang gagal dan ditutup dengan pembalasan yang setimpal lengkap dengan guyonan-guyonan one liner-nya kedua ia kembali menjadi terlalu serius dan lembek padahal seri ke-dua nya sempat berhasil tampil lepas menghamburkan komedi dan aksinya dengan porsi sama asiknya menjadi tontonan aksi yang super gila-gilaan ketiga dengan memilih untuk menurunkan ratingnya menjadi pg- segala kekerasannya disunat habis-habisan tidak ada lagi darah bermuncratan kepala pecah dan anggota tubuh yang terlepas ya ini seperti the expendebles versi disney', 'berbeda seri seri ketiganya mengecewakan mengulang formula plot persis lihat opening heboh misi gagal ditutup pembalasan setimpal lengkap guyonan-guyonan one liner-nya serius lembek seri ke-dua nya berhasil tampil lepas menghamburkan komedi aksinya porsi asiknya tontonan aksi super gila-gilaan ketiga memilih menurunkan ratingnya pg- kekerasannya disunat habis-habisan darah bermuncratan kepala pecah anggota tubuh terlepas ya the expendebles versi disney', 'beda seri seri tiga kecewa ulang formula plot persis lihat opening heboh misi gagal tutup balas timpal lengkap guyonan-guyonan one liner-nya serius lembek seri ke-dua nya hasil tampil lepas hambur komedi aksi porsi asiknya tonton aksi super gila-gilaan tiga memilih turun ratingnya pg- kerasan sunat habis-habisan darah muncrat kepala pecah anggota tubuh lepas ya the expendebles versi disney'),
(499, 516, 'untuk sebuah film yang berlebel romansa  the disappearance of eleanor rigby terasa begitu dingin di balik segala kehangatan sinematografinya tidak hanya kontennya namun bagaimana beson mempersentasikan narasinya juga begitu depresif plotnya seperti berjalan terseok-seok terasa begitu lama dan menjemukan terlebih beson memilih untuk membiarkan kedukaanya bertahan begitu panjang dan terkesan repetitif tanpa memberi solusi bagaimana karakter di dalamnya berusaha menyembuhkan diri mereka', 'film berlebel romansa  the disappearance of eleanor rigby dingin kehangatan sinematografinya kontennya beson mempersentasikan narasinya depresif plotnya berjalan terseok-seok menjemukan beson memilih membiarkan kedukaanya bertahan terkesan repetitif solusi karakter dalamnya berusaha menyembuhkan', 'film berlebel romansa  the disappearance of eleanor rigby dingin hangat sinematografi konten beson mempersentasikan narasi depresif plot jalan terseok-seok jemu beson memilih biar kedukaanya tahan kesan repetitif solusi karakter dalam usaha sembuh'),
(500, 517, 'para cast dimana semuanya perempuan juga tampil tidak mengecewakan mereka tidak hanya bermodalkan tampang cantik yang bisanya cuma teriak saja karakter mereka juga berkembang seiring berjalannya film sayang dibeberapa adegan banyak hal yang sepertinya dipaksakan dan sedikit tidak masuk akal para  mahluk  juga digambarkan terlalu sederhana kurang cukup menakutkan namun setidaknya kekurangan tersebut ditutup dengan ending yang menurut saya cukup keren walau sepertinya agak sedikit memaksa', 'cast dimana perempuan tampil mengecewakan bermodalkan tampang cantik bisanya teriak karakter berkembang seiring berjalannya film sayang dibeberapa adegan dipaksakan masuk akal  mahluk  digambarkan sederhana menakutkan kekurangan ditutup ending keren memaksa', 'cast mana perempuan tampil kecewa modal tampang cantik bisa teriak karakter kembang iring jalan film sayang beberapa adegan paksa masuk akal  mahluk  gambar sederhana takut kurang tutup ending keren memaksa'),
(501, 518, 'yang terjadi di the collection adalah ia nampak terlalu berupaya seperti saw namun gagal ia kemudian juga menjadi terlalu action membuang banyak ketegangan dan keintiman personalnya termasuk terlalu berfokus pada jebakan-jebakan dan gore-nya ketimbang unsur survivor yang dihadirkan karakternya dan itu bisa menjadi sangat menghibur namun jelas ia juga sudah kehilangan banyak elemen horornya yang membuat tensinya jauh menurun ketimbang pendahulunya', 'the collection nampak berupaya saw gagal action membuang ketegangan keintiman personalnya berfokus jebakan-jebakan gore-nya ketimbang unsur survivor dihadirkan karakternya menghibur kehilangan elemen horornya tensinya menurun ketimbang pendahulunya', 'the collection nampak upaya saw gagal action buang tegang intim personal fokus jebakan gore nya ketimbang unsur survivor hadir karakter hibur hilang elemen horor tensi turun ketimbang dahulu'),
(502, 519, 'trailernya menarik seperti menjanjikan tontonan spy thriller konspirasi tingkat tinggi yang seru ala trilogi bourne tapi fakta di lapangan berkata lain the cold light of day tidak lebih seperti sebuah b movie dengan bintang kelas satu dari seorang sutradara medioker mabrouk el mechri yang sebelumnya juga pernah membuat jcvd semi-biografi aktor laga lawas jean-claude van damme ya ini seperti parodi buruk dari bourne melihat si bakal manusia baja henry cavill berlari ke sana kemari di lorong-lorong kota madrid dan di kejar-kejar oleh pihak-pihak yang ingin membunhnya seharusnya bisa menjadi sajian pemacu adrenalin yang mendebarkan sayang el mechri tidak lihai menghadirkannya setiap momennya terasa sangat lembek dan datar tidak peduli seberapa keras scoring lucas vidal memacunya tidak peduli ada dua gaek bruce wills dan sigourney weaver di sini rangkaian plot hole dan naskahnya yang buruk juga menjadi salah satu faktor yang menghancurkannya', 'trailernya menarik menjanjikan tontonan spy thriller konspirasi tingkat seru ala trilogi bourne fakta lapangan the cold light of day b movie bintang kelas sutradara medioker mabrouk el mechri jcvd semi-biografi aktor laga lawas jean-claude van damme ya parodi buruk bourne si manusia baja henry cavill berlari kemari lorong-lorong kota madrid kejar-kejar pihak-pihak membunhnya sajian pemacu adrenalin mendebarkan sayang el mechri lihai menghadirkannya momennya lembek datar peduli keras scoring lucas vidal memacunya peduli gaek bruce wills sigourney weaver rangkaian plot hole naskahnya buruk salah faktor menghancurkannya', 'trailer tarik janji tonton spy thriller konspirasi tingkat seru ala trilogi bourne fakta lapang the cold light of day b movie bintang kelas sutradara medioker mabrouk el mechri jcvd semi-biografi aktor laga lawas jean-claude v damme ya parodi buruk bourne si manusia baja henry cavill lari kemari lorong-lorong kota madrid kejar-kejar pihak-pihak membunhnya saji pemacu adrenalin debar sayang el mechri lihai hadir momen lembek datar peduli keras scoring lucas vidal memacunya peduli gaek bruce wills sigourney weaver rangkai plot hole naskah buruk salah faktor hancur'),
(503, 520, 'semuanya berjalan lancar sampai kemudian klimaksnya menjadi terlalu familiar dan dipaksakan tanpa perlu menjadi jenius kita sudah tahu apa yang akan terjadi dan seberapa kerasnya usaha anderson untuk membuat endingnya terlihat berbeda toh itu tidak terlalu berhasil but still the call adalah tontonan crime thriller menyenangkan tidak terlalu berat namun juga tidak sampai menjadi terlalu bodoh helle berry bermain kuat sebagai operator  sementara breslin juga tidak buruk', 'berjalan lancar klimaksnya familiar dipaksakan jenius kerasnya usaha anderson endingnya berbeda berhasil but still the call tontonan crime thriller menyenangkan berat bodoh helle berry bermain kuat operator  breslin buruk', 'jalan lancar klimaks familiar paksa jenius keras usaha anderson endingnya beda hasil but still the call tonton crime thriller senang berat bodoh helle berry main kuat operator  breslin buruk'),
(504, 521, 'yang menjadi masalah adalah narasinya yang tidak terlalu kuat itu terlalu banyak bergantung dengan kisah-kisah di luar gedung putih mungkin saja cerita aslinya terlalu membosankan dan tidak menarik sampai-sampai lee daniels bersama strong harus banyak melakukan permak sana sini dengan mengandalkan banyak sisipan sejarah yang dipaksa ', 'narasinya kuat bergantung kisah-kisah gedung putih cerita aslinya membosankan menarik lee daniels strong permak mengandalkan sisipan sejarah dipaksa ', 'narasi kuat gantung kisah gedung putih cerita asli bosan tarik lee daniels strong permak andal sisip sejarah paksa '),
(505, 522, 'dalam perjalanannya misteri yang tampak menjanjikan di awal film berangsur-angsur menguap dan kehilangan daya cengkeramannya jangan salah dari segi akting lauren cohan sendiri tampil baik sama ketika natalie dormer menjadi bintang di the forest namun sayang bell membuat karakternya menjadi terlihat bodoh dengan pemilihan dialog dan pengambilan keputusan yang konyol sementara pencarian petunjuk dan penemuan fakta-fakta dari masa lalu seperti menjadi terbuang percuma ketika twist yang dihadirkan bell malah berakhir antiklimaks', 'perjalanannya misteri menjanjikan film berangsur-angsur menguap kehilangan daya cengkeramannya salah segi akting lauren cohan tampil natalie dormer bintang the forest sayang bell karakternya bodoh pemilihan dialog pengambilan keputusan konyol pencarian petunjuk penemuan fakta-fakta terbuang twist dihadirkan bell antiklimaks', 'jalan misteri janji film berangsur-angsur uap hilang daya cengkeram salah segi akting lauren cohan tampil natalie dormer bintang the forest sayang bell karakternya bodoh pemilihan dialog ambil putus konyol cari tunjuk penemuan fakta-fakta buang twist hadir bell antiklimaks'),
(506, 523, 'menderita cukup hebat pada pembukannya dengan segala konflik motivasi dan sub plot yang cukup membuat penontonnya bertanya-tanya the berlin file mulai sedikit membaik ketika seung-wa kemudian mengurangi segala kerumitannya di pertengahan film menjadikannya jauh lebih sederhana bersama melodrama dan suspense khas korea selatan yang dibungkus dengan adegan-adegan aksi cepat dan berkelas mungkin susah untuk menyebutnya sebagai bourne-nya korea selatan tetapi setidaknya seung-wa sudah mencoba menghadirkan sesuatu yang berbeda meskipun yah tidak sesuai ekspektasi', 'menderita hebat pembukannya konflik motivasi sub plot penontonnya the berlin file membaik seung-wa mengurangi kerumitannya pertengahan film menjadikannya sederhana melodrama suspense khas korea selatan dibungkus adegan-adegan aksi cepat berkelas susah menyebutnya bourne-nya korea selatan seung-wa mencoba menghadirkan berbeda yah sesuai ekspektasi', 'derita hebat bukan konflik motivasi sub plot penontonnya the berlin file baik seung-wa urang kerumit tengah film jadi sederhana melodrama suspense khas korea selatan bungkus adegan-adegan aksi cepat las susah sebut bourne-nya korea selatan seung-wa coba hadir beda yah suai ekspektasi'),
(507, 524, 'seperti yang sudah dijelaskan sedikit diatas film ini memang hanya sebatas menjual premis dan dua nama besar pemainnya saja terlihat dari bagaimana ketidakmampuan ravich memperpanjang premis tersebut menjadi sebuah plot yang solid dan menarik alih-alih tampil kuat the astronauts wife malah tampil dengan segala kedangkalan cerita dan lubang-lubang besar disepanjang  menit yang membuat misteri-misteri yang dihadirkan menjadi terasa hambar belum lagi ending yang buruk dan klise semakin membuat film ini terasa seperti thriller murahan yang hanya mengumbar banyak adegan tidak perlu yang semata-mata hanya agar membuat film ini terlihat sebagai sebuah film thriller', 'diatas film sebatas menjual premis nama pemainnya ketidakmampuan ravich memperpanjang premis plot solid menarik alih-alih tampil kuat the astronauts wife tampil kedangkalan cerita lubang-lubang disepanjang  menit misteri-misteri dihadirkan hambar ending buruk klise film thriller murahan mengumbar adegan film film thriller', 'atas film batas jual premis nama main ketidakmampuan ravich panjang premis plot solid tarik alih-alih tampil kuat the astronauts wife tampil dangkal cerita lubang-lubang disepanjang  menit misteri-misteri hadir hambar ending buruk klise film thriller murah umbar adegan film film thriller'),
(508, 525, 'the accused punya modal yang bagus untuk menjadikan dirinya sebuah drama pengadilan yang solid apalagi ia punya jodie foster yang tampil baik sayang kenyataannya tidak penyutradaraan dan naskah yang terlalu datar dan klise membuatnya tidak mampu meninggalkan kesan satu-satunya yang mungkin akan anda ingat adalah adegan mengerikan yang terjadi di atas mesin pinball itu', 'the accused modal bagus menjadikan drama pengadilan solid jodie foster tampil sayang kenyataannya penyutradaraan naskah datar klise membuatnya meninggalkan kesan satu-satunya adegan mengerikan mesin pinball', 'the accused modal bagus jadi drama adil solid jodie foster tampil sayang nyata sutradara naskah datar klise buat tinggal kesan satu-satunya adegan erik mesin pinball'),
(509, 526, 'tetapi kegembiraan itu tidak berlangsung lama dengan cepat setelah paruh pertama berakhir the th wave memasuki bagian paling buruknya tercebur dalam kubangan drama remaja dengan segala romantika picisan yang kelewat familiar tidak hanya terasa generik namun sangat payah bagaimana cassie sampai jatuh hati dengan evan walker alex roe penyelamat hidupnya yang misterius juga tidak pernah melewati sebuah proses yang wajar terjadi begitu cepat hanya dengan sedikit obrolan dengan mudah benci berubah menjadi cinta segampang membalikan telapak tangan', 'kegembiraan cepat paruh the th wave memasuki buruknya tercebur kubangan drama remaja romantika picisan kelewat familiar generik payah cassie jatuh hati evan walker alex roe penyelamat hidupnya misterius melewati proses wajar cepat obrolan mudah benci berubah cinta segampang membalikan telapak tangan', 'gembira cepat paruh the th wave masuk buruk cebur kubang drama remaja romantika picis lewat familiar generik payah cassie jatuh hati evan walker alex roe selamat hidup misterius lewat proses wajar cepat obrol mudah benci ubah cinta gampang balik telapak tang'),
(510, 527, 'seperti dua sisi koin begitu banyak twist bisa jadi menyenangkan namun di sisi lain juga bisa menjadi bumerang ketika ternyata focus menjadi teralalu asik memusatkan segalanya pada elemen kejutannya terlalu banyak tipu sana tipu sini sehingga penontonnya mungkin tidak tahu lagi bagaimana harus mempercayai jalan ceritanya yang bisa dipastikan selalu ada rekayasa baru selalu ada desain bohong lagi yang ironisnya terasa repetitif dan menjadi mudah tertebak langkah demi langkahnya ujung-ujungnya focus menjadi tidak sefokus judulnya tidak mengerti tujuannya tidak mengerti apa yang sebenarnya ingin dicapai karena terlalu sibuk mempertontonkan trik-triknya muktakhirnya dari awal sampai akhir sementara kadar romansa dan komedinya sendiri tidak pernah benar-benar disentuh dengan baik meskipun harus diakui pesona besar smith dan robbie masih mampu memberikan penampilan dan chemistry mereka dengan cukup intim', 'sisi koin twist menyenangkan sisi bumerang focus teralalu asik memusatkan elemen kejutannya tipu tipu penontonnya mempercayai jalan ceritanya rekayasa desain bohong ironisnya repetitif mudah tertebak langkah langkahnya ujung-ujungnya focus sefokus judulnya mengerti tujuannya mengerti dicapai sibuk mempertontonkan trik-triknya muktakhirnya kadar romansa komedinya benar-benar disentuh diakui pesona smith robbie penampilan chemistry intim', 'sisi koin twist senang sisi bumerang focus teralalu asik memusatkan elemen kejut tipu tipu penontonnya percaya jalan cerita rekayasa desain bohong ironis repetitif mudah tebak langkah langkah ujung-ujungnya focus fokus judul erti tuju erti capai sibuk tonton trik-triknya muktakhirnya kadar romansa komedi benar-benar sentuh aku pesona smith robbie penampilan chemistry intim'),
(511, 528, 'mungkin teknis mokumentarinya kacau dan naskahnya juga sama berantakannya dengan presentasi ala dokumenternya yang terlalu memusingkan tetapi pada dasarnya frankensteins army memang dimaksudkan sebagai tontonan yang ringan ia tidak pernah terlalu serius namun masih sanggup memberikanmu sebuah keasikan horor found footage indie orisnil dengan sekarung potongan tubuh galonan darah segar dan sajian utamanya monster-monster keren mematikan', 'teknis mokumentarinya kacau naskahnya berantakannya presentasi ala dokumenternya memusingkan dasarnya frankensteins army tontonan ringan serius sanggup memberikanmu keasikan horor found footage indie orisnil sekarung potongan tubuh galonan darah segar sajian utamanya monster-monster keren mematikan', 'teknis mokumentarinya kacau naskah berantak presentasi ala dokumenter memusingkan dasar frankensteins army tonton ringan serius sanggup berik asi horor found footage indie orisnil karung potong tubuh galon darah segar saji utama monster-monster keren mati'),
(512, 529, 'ini bukan salah satu yang terbaik dari soerang luc besson skrip lemah penuh lubang sana-sini subplot romansanya yang konyol karakterisasi yang seharusnya bisa berkembang peran-peran yang mubazir dan penyutradaraan yang payah dari megaton membuat colombiana babak belur bak sajian action kelas dua ', 'salah terbaik soerang luc besson skrip lemah penuh lubang sana-sini subplot romansanya konyol karakterisasi berkembang peran-peran mubazir penyutradaraan payah megaton colombiana babak belur bak sajian action kelas ', 'salah baik soerang luc besson skrip lemah penuh lubang sana sini subplot romansa konyol karakterisasi kembang peran mubazir sutradara payah megaton colombiana babak belur bak saji action kelas '),
(513, 530, 'cerita standar kengerian yang minim darah dan kesadisan yang kelewat sedikit dan karakter yang tidak dipoles dengan baik serta penyajian ala kadarnya crush tampak seperti sinetron thriller yang tumpul dan membosankan usaha untuk membuatnya menjadi berbeda dengan memunculkan twist di klimaksnya juga gagal ya ini seperti tontonan thriller buat anak-anak bahkan posternya saja sudah membocorkan semuanya', 'cerita standar kengerian minim darah kesadisan kelewat karakter dipoles serta penyajian ala kadarnya crush sinetron thriller tumpul membosankan usaha membuatnya berbeda memunculkan twist klimaksnya gagal ya tontonan thriller anak-anak posternya membocorkan', 'cerita standar ngeri minim darah sadis lewat karakter poles serta saji ala kadar crush sinetron thriller tumpul bosan usaha buat beda muncul twist klimaks gagal ya tonton thriller anak-anak poster bocor'),
(514, 531, 'mungkin tidak terlalu kuat di sektor naskahnya tetapi pengaruh eropa yang tenang plus sedikit suspense dan drama yang dibawa oplev untuk membungkus setiap momennya membuat dead man down mampu tampil menghanyutkan yang sayangnya harus dirusak oleh ending yang terlalu hollywood ya klimaks di penghujungnya menjadikan dead man down seperti dua film yang berbeda begitu tenang dan terlihat solid di hampir keseluruhan tetapi penutupnya seperti membuang segala hal-hal yang bagus itu ke tempat sampah dan menghancurkan dirinya sendiri', 'kuat sektor naskahnya pengaruh eropa tenang plus suspense drama dibawa oplev membungkus momennya dead man down tampil menghanyutkan sayangnya dirusak ending hollywood ya klimaks penghujungnya menjadikan dead man down film berbeda tenang solid penutupnya membuang hal-hal bagus sampah menghancurkan', 'kuat sektor naskah pengaruh eropa tenang plus suspense drama bawa oplev bungkus momen dead man down tampil hanyut sayang rusak ending hollywood ya klimaks hujung jadi dead man down film beda tenang solid tutup buang hal bagus sampah hancur'),
(515, 532, 'death tube sepertinya hanya meninggalkan konsep yang ambius tanpa dibarengi eksekusi yang mumpuni menjadikannya sebuah horror-thriller yang membosankan tanpa tahu mau dibawa kemana tujuan akhir film ini padahal kalau mau jujur ia memiliki potensi untuk dapat berkembang lebih jauh', 'death tube meninggalkan konsep ambius dibarengi eksekusi mumpuni menjadikannya horror-thriller membosankan dibawa kemana tujuan film jujur memiliki potensi berkembang', 'death tube tinggal konsep ambius bareng eksekusi mumpuni jadi horror thriller bosan bawa mana tuju film jujur milik potensi kembang'),
(516, 533, 'apa yang dilakukan derrickson adalah sebuah antiklimaks terlepas dari sekuens exorcism medebarkan di ujungnya ia seperti memilih bermain aman dan terkesan malas memberi sentuhan akhir berupa penjelasan setimpal yang semestinya bisa membuat deliver us from evil tidak berakhir menjadi horor medioker yang begitu saja berlalu tanpa kesan apa-apa', 'derrickson antiklimaks terlepas sekuens exorcism medebarkan ujungnya memilih bermain aman terkesan malas sentuhan penjelasan setimpal semestinya deliver us from evil horor medioker kesan apa-apa', 'derrickson antiklimaks lepas sekuens exorcism medebarkan ujung pilih main aman kesan malas sentuh jelas timpal mesti deliver us from evil horor medioker kesan apa'),
(517, 534, 'kombinasi realisme found footage setting yang meyakinkan dan kandungan misterinya yang berujung narasi kompleks dan twist membuat devils pass milik harlin sebenarnya tidak terlalu buruk andai saja ia tahu bagaimana menghindari beberapa kesalahan macam yang paling fatal ketidak konsistenan pengunaan kameranya yang terkadang terasa janggal untuk ukuran film dengan tampilan dokumenter belum lagi penyakit lama dari horor jenis ini yang seperti terlalu memaksakan kameranya untuk harus terus merekam segalanya apapun yang terjadi seakan-akan membuat keselamatan kamera lebih penting dari nyawa mereka sendiri terasa aneh dan mengganggu memang', 'kombinasi realisme found footage setting kandungan misterinya berujung narasi kompleks twist devils pass milik harlin buruk andai menghindari kesalahan fatal ketidak konsistenan pengunaan kameranya terkadang janggal ukuran film tampilan dokumenter penyakit horor jenis memaksakan kameranya merekam apapun seakan-akan keselamatan kamera nyawa aneh mengganggu', 'kombinasi realisme found footage setting kandung misteri ujung narasi kompleks twist devils pass milik harlin buruk andai hindar salah fatal tidak konsisten pengunaan kamera terkadang janggal ukur film tampil dokumenter sakit horor jenis paksa kamera rekam apa akan selamat kamera nyawa aneh ganggu'),
(518, 535, 'ini mungkin yang terburuk dari sheridan tapi hasilnya bisa jadi akan berbeda andai saja pihak morgan creek tidak pernah turut campur tangan dalam urusan naskahnya ya konon terjadi perselisihan antara sheridan dan morgan creek selaku studio produksi yang berujung dengan tidak pernah digunakannya naskah sheridan yang dirasa tidak komersil itu ironisnya perubahan yang dilakukan sepihak tersebut ternyata juga tidak membuahkan hasil berarti selain filmnya sendiri banyak dicerca di sana sini termasuk oleh sheridan craig dan weisz sendiri yang sampai-sampai tidak mau mempromosikannya hasilnya box-ofiice nya pun anjlok menjadikannya salah satu horor-thriller paling mengecewakan tahun ini', 'terburuk sheridan hasilnya berbeda andai morgan creek campur tangan urusan naskahnya ya konon perselisihan sheridan morgan creek studio produksi berujung digunakannya naskah sheridan dirasa komersil ironisnya perubahan membuahkan hasil filmnya dicerca sheridan craig weisz mempromosikannya hasilnya box-ofiice nya anjlok menjadikannya salah horor-thriller mengecewakan', 'buruk sheridan hasil beda andai morgan creek campur tangan urus naskah ya konon selisih sheridan morgan creek studio produksi ujung guna naskah sheridan rasa komersil ironis ubah buah hasil film cerca sheridan craig weisz mempromosikannya hasil box ofiice nya anjlok jadi salah horor thriller kecewa'),
(519, 536, 'drive angry sepertinya berusaha keras untuk menjadi sebuah film aksi tanpa otak gila-gilaan yang sayangnya tidak berjalan dengan baik patrick lussier seakan-akan tidak rela jika filmnya terlihat terlalu murahan namun disisi lain ia juga tidak ingin menjadikannya terlalu serius nah kegalauan inilah yang malah membuat drive angry menjadi sebuah film aksi banci yang terkesan masih malu-malu menunjukan kegilaannya', 'drive angry berusaha keras film aksi otak gila-gilaan sayangnya berjalan patrick lussier seakan-akan rela filmnya murahan disisi menjadikannya serius kegalauan drive angry film aksi banci terkesan malu-malu menunjukan kegilaannya', 'drive angry usaha keras film aksi otak gila-gilaan sayang jalan patrick lussier seakan-akan rela film murah sisi jadi serius galau drive angry film aksi banci kesan malu-malu tunjuk gila'),
(520, 537, 'kesalahan todd philips adalah improvisasinya menghancurkan segalanya kalau di perhatikan ia lupa mau di kemanakan dua aktor ini padahal chemistry dua orang yang berlawanan arah seharusnya menjadi daya tarik yang bagus di suatu adegan robert downey kembali reuni dengan jamie foxx the soloist meskipun cuma tampil sebentar di sini namun sekali lagi yang saya sayangkan kehadiran jamie fox sama sekali tak berpengaruh apa apa bagi film ini', 'kesalahan todd philips improvisasinya menghancurkan perhatikan lupa kemanakan aktor chemistry orang berlawanan arah daya tarik bagus adegan robert downey reuni jamie foxx the soloist tampil sebentar sayangkan kehadiran jamie fox berpengaruh film', 'salah todd philips improvisasi hancur perhati lupa manakan aktor chemistry orang lawan arah daya tarik bagus adegan robert downey reuni jamie foxx the soloist tampil sebentar sayang hadir jamie fox pengaruh film');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(521, 538, 'walaupun dalam segi penceritaanya masih terdapat banyak lubang di sana sini setidaknya chan punya pesan yang ingin diangkat tidak melulu menghadirkan horor yang berisi kesadisan dan kegilaan semata sentilan kecil di dalamnya tentang fenomena sosial yang sering kali terjadi dalam masyarakat cina daratan dan obsesi manusia dalam usahanya untuk mencari kecantikan abadi termasuk dengan cara yang paling menjijikan sekalipun', 'segi penceritaanya lubang chan pesan diangkat melulu menghadirkan horor berisi kesadisan kegilaan sentilan dalamnya fenomena sosial kali masyarakat cina daratan obsesi manusia usahanya mencari kecantikan abadi menjijikan', 'segi penceritaanya lubang chan pesan angkat melulu hadir horor isi sadis gila sentil dalam fenomena sosial kali masyarakat cina darat obsesi manusia usaha cari cantik abadi jijik'),
(522, 539, 'kuat di teknis tidak diikuti dengan penceritaan yang mengesankan mencoba membuat everest untuk tampil humble dan juga sebisa mungkin setia dengan sumber aslinya sedikit banyak sudah memaksa kormkur untuk mengurangi kadar dramatisasinya bukan berati naskah everest sampai menjadi buruk dan tak layak tonton kamu mungkin bisa menyebutnya sebagai sajian dokudrama yang lebih memfokuskan pada kronologis peristiwa masalahnya hal ini terkadang akan menjadi terasa lama dan membosankan setidaknya itu yang saya rasakan di paruh awal film yang terlalu banyak menghabiskan waktu untuk memperkenalkan karakter-karakter utamanya', 'kuat teknis diikuti penceritaan mengesankan mencoba everest tampil humble sebisa setia sumber aslinya memaksa kormkur mengurangi kadar dramatisasinya berati naskah everest buruk layak tonton menyebutnya sajian dokudrama memfokuskan kronologis peristiwa terkadang membosankan rasakan paruh film menghabiskan memperkenalkan karakter-karakter utamanya', 'kuat teknis ikut cerita kesan coba everest tampil humble bisa setia sumber asli memaksa kormkur urang kadar dramatisasi berat naskah everest buruk layak tonton sebut saji dokudrama fokus kronologis peristiwa kadang bosan rasa paruh film habis kenal karakter-karakter utama'),
(523, 540, 'untuk ukuran film reliji exodus tergolong terlalu bermain aman tidak ada upanya maksimal mengiring rasa emosi dan spiritual penontonnya apa yang tersaji di sepanjang dua jam setengah exodus terasa seperti film sejarah membosankan dengan sedikit adegan spektakuler yang tidak sebanding dengan kesabaran para penonton yang tersiksa menunggunya termasuk adegan penting yang berada di ujung film tidak hanya membuang banyak waktu untuk sesuatu yang kurang penting exodus bisa jadi adalah salah satu film yang memubazirkan jajaran pemainnya', 'ukuran film reliji exodus tergolong bermain aman upanya maksimal mengiring emosi spiritual penontonnya tersaji jam exodus film sejarah membosankan adegan spektakuler sebanding kesabaran penonton tersiksa menunggunya adegan ujung film membuang exodus salah film memubazirkan jajaran pemainnya', 'ukur film reliji exodus golong main aman upa maksimal iring emosi spiritual tonton saji jam exodus film sejarah bosan adegan spektakuler banding sabar tonton siksa tunggu adegan ujung film buang exodus salah film mubazir jajar main'),
(524, 541, 'memang untuk ukuran film superhero  juta dollar bukan budget yang kelewat besar tetapi jika ia mampu mengubah  juta menjadi tontonan sekelas chronicle secara logika dengan dukungan dana yang mencapai lima kali lipat trank seharusnya bisa melakukan sesuatu yang jauh lebih baik dan lebih besar tetapi seperti yang bisa kamu lihat fantastic four miliknya punya ruang lingkup yang sesempit narasinya tidak ada set besar semua pemandangan yang terlihat hanya melibatkan gudang besar dan banyak layar hijau untuk menampilkan scene planet zero yang gersang gelap dan sepi bahkan yang lebih mengecewakan dari cerita yang buruk adalah kualitas aksi yang medioker tanpa greget tensi dan emosi sungguh sangat disayangkan franchise sebesar fantastic four harus dimulai lagi dengan start yang buruk', 'ukuran film superhero  juta dollar budget kelewat mengubah  juta tontonan sekelas chronicle logika dukungan dana mencapai kali lipat trank lihat fantastic four miliknya ruang lingkup sesempit narasinya set pemandangan melibatkan gudang layar hijau menampilkan scene planet zero gersang gelap sepi mengecewakan cerita buruk kualitas aksi medioker greget tensi emosi sungguh disayangkan franchise fantastic four start buruk', 'ukur film superhero  juta dollar budget lewat ubah  juta tonton kelas chronicle logika dukung dana capai kali lipat trank lihat fantastic four milik ruang lingkup sempit narasi set pandang libat gudang layar hijau tampil scene planet zero gersang gelap sepi kecewa cerita buruk kualitas aksi medioker greget tensi emosi sungguh sayang franchise fantastic four start buruk'),
(525, 542, 'ya harus diakui beberapa momen masih berhasil menghadirkan sebuah atmosfer kelam mencekam setiap koridor gelap dari bagunan asrama masih memberikan efek tidak nyaman namun untuk ukuran j-horor fatal frame masih berada di wilayah aman buat penonton penakut tidak sampai terlalu mengerikan malah bisa dibilang ia membosankan karena alurnya bergerak terlalu pelan sementara narasinya sendiri sebenarnya tidak terlalu buruk plot fatal frame meskipun lemah namun ia masih mampu menghadirkan rasa penasaran penontonnya untuk mengetahui tentang apa yang sebenarnya terjadi termasuk dengan kejutan di akhir film', 'ya diakui momen berhasil menghadirkan atmosfer kelam mencekam koridor gelap bagunan asrama efek nyaman ukuran j-horor fatal frame wilayah aman penonton penakut mengerikan dibilang membosankan alurnya bergerak pelan narasinya buruk plot fatal frame lemah menghadirkan penasaran penontonnya kejutan film', 'ya aku momen hasil hadir atmosfer kelam cekam koridor gelap bagunan asrama efek nyaman ukur j horor fatal frame wilayah aman tonton takut erik bilang bosan alur gerak pelan narasi buruk plot fatal frame lemah hadir penasaran tonton kejut film'),
(526, 543, 'ini mungkin film gangster dengan cerita dan karakterisasi terlemah yang pernah saya tonton tetapi jika kamu adalah salah satu audiens yang tidak pernah peduli soal hal-hal penting itu maka gangster squad akan memuaskanmu dengan parade aksi seru nan brutal sedikit komedi lengkap dengan segala aroma gangster ala amerika klasik yang kuat dipresentasinya plus ensemble cast yang sudah sedikit banyak memberikan pesona terbesar untuk film yang sebenarnya tidak istimewa ini', 'film gangster cerita karakterisasi terlemah tonton salah audiens peduli hal-hal gangster squad memuaskanmu parade aksi seru nan brutal komedi lengkap aroma gangster ala amerika klasik kuat dipresentasinya plus ensemble cast pesona terbesar film istimewa', 'film gangster cerita karakterisasi lemah tonton salah audiens peduli hal-hal gangster squad muas parade aksi seru nan brutal komedi lengkap aroma gangster ala amerika klasik kuat presentasi plus ensemble cast pesona besar film istimewa'),
(527, 544, 'pertama untuk ukuran horor dengan tema klasik rumah hantu ia tidak menakutkan tidak ada sesuatu yang benar-benar sampai membuat bergidik di sini kecuali mungkin ketika melihat sosok bin bocah yatim-piatu yang diperankan dengan baik aktor cilik hyung-suk kedua yun-ho sudah kerap menipu penontonnya dengan cara yang sama sekali tidak elegan lihat saja ketika ia terlalu banyak melibatkan adegan mengerikan yang ternyata hanya jelmaan mimpi dari tokoh-tokoh didalamnya benar-benar sebuah cara yang bodoh dan ketiga yang paling fatal adalah kualitas naskahnya ceritanya begitu lemah dan dipaksakan terlalu banyak lubang-lubang besar di sana-sini yang sangat mengganggu', 'ukuran horor tema klasik rumah hantu menakutkan benar-benar bergidik kecuali sosok bin bocah yatim-piatu diperankan aktor cilik hyung-suk yun-ho kerap menipu penontonnya elegan lihat melibatkan adegan mengerikan jelmaan mimpi tokoh-tokoh didalamnya benar-benar bodoh ketiga fatal kualitas naskahnya ceritanya lemah dipaksakan lubang-lubang sana-sini mengganggu', 'ukur horor tema klasik rumah hantu takut benar gidik kecuali sosok bin bocah yatim piatu peran aktor cilik hyung suk yun ho kerap tipu tonton elegan lihat libat adegan erik jelma mimpi tokoh dalam benar bodoh tiga fatal kualitas naskah cerita lemah paksa lubang sana sini ganggu'),
(528, 545, 'masalahnya adalah motif karakter cusack tidak seidealis dan tidak sepintar yang kita kira tidak seperti karakter yang dimainkan kiefer sutherland di phone booth ketika ia mengancam colin farell yang bermulut besar mungkin dari awal kita akan mengira bahwa ia seorang fans fanantik yang kecewa dengan pertunjukan terakhir selznick tetapi pada akhirnya kita tahu bahwa tujuannya sangat sederhana dan sangat cheesy dan itu sedikit banyak sudah merusak segalanya belum lagi mengetahui bahwa sang villain ternyata terlihat bodoh dan tidak pernah konsisten dengan ancamannya lalu klimaksnya di atas panggung itu bisa dibilang konyol', 'motif karakter cusack seidealis sepintar karakter dimainkan kiefer sutherland phone booth mengancam colin farell bermulut fans fanantik kecewa pertunjukan selznick tujuannya sederhana cheesy merusak sang villain bodoh konsisten ancamannya klimaksnya panggung dibilang konyol', 'motif karakter cusack idealis pintar karakter main kiefer sutherland phone booth ancam colin farell mulut fans fanantik kecewa tunjuk selznick tuju sederhana cheesy rusak sang villain bodoh konsisten ancam klimaks panggung bilang konyol'),
(529, 546, 'sebagai sebuah sugguhan superhero green lantern sebenarnya memiliki semua potensi untuk melebihi atau setidaknya menyaingi jagoan-jagoan marvel tahun ini sayang ia tidak pernah mencapai titik puncak kepuasan menonton sebuah sajian pahlawan super karena harus menderita oleh kualitas naskah yang buruk penggarapan yang pas-pasan cgi yang terlihat cantik namun terlalu berlebihan termask juga kehadiran ryan reinolds yang overatted sepertinya untuk saat ini dc comics lebih baik memfokuskan saja kepada reboot superman atau the dark knight rises yang mudah-mudahan bisa mengambalikan kejayaan mereka lagi', 'sugguhan superhero green lantern memiliki potensi melebihi menyaingi jagoan-jagoan marvel sayang mencapai titik puncak kepuasan menonton sajian pahlawan super menderita kualitas naskah buruk penggarapan pas-pasan cgi cantik termask kehadiran ryan reinolds overatted dc comics memfokuskan reboot superman the dark knight rises mudah-mudahan mengambalikan kejayaan', 'sugguhan superhero green lantern milik potensi lebih saing jagoan-jagoan marvel sayang capai titik puncak puas tonton saji pahlawan super derita kualitas naskah buruk garap pas-pasan cgi cantik termask hadir ryan reinolds overatted dc comics fokus reboot superman the dark knight rises mudah-mudahan mengambalikan jaya'),
(530, 547, 'perang irak memang bukanlah tema yang bersahabat untuk diangkat dalam sebuah film walaupun kuat secara kualitas cerita namun jelas tidak menjamin film tersebut akan sukses di pasaran contoh paling gampang adalah the hurt locker yang di puji habis-habisan oleh para kritikus bahkan sampai mendapat oscar sebagai film terbaik namun hasil box-office nya bisa dibilang biasa saja dan sepertinya kutukan itu kembali menerpa green zone walaupun sudah memasang duet maut greengrass-damon dan didukung oleh penulis naskah brian helgeland la confidential robin hood tampaknya untuk dapat balik modal saja sudah bagus memang kalau mau jujur walaupun cerita yang diangkat cukup menarik dan penuh dengan sindiran-sindiran dan intrik-intrik politik kental namun sepertinya masih terlalu berat untuk dinikmati sebagai sebuah film hiburan', 'perang irak tema bersahabat diangkat film kuat kualitas cerita menjamin film sukses pasaran contoh gampang the hurt locker puji habis-habisan kritikus oscar film terbaik hasil box-office nya dibilang kutukan menerpa green zone memasang duet maut greengrass-damon didukung penulis naskah brian helgeland la confidential robin hood modal bagus jujur cerita diangkat menarik penuh sindiran-sindiran intrik-intrik politik kental berat dinikmati film hiburan', 'perang irak tema sahabat angkat film kuat kualitas cerita jamin film sukses pasar contoh gampang the hurt locker puji habis-habisan kritikus oscar film baik hasil box-office nya bilang kutuk terpa green zone memasang duet maut greengrass-damon dukung penulis naskah brian helgeland la confidential robin hood modal bagus jujur cerita angkat tarik penuh sindiran-sindiran intrik-intrik politik kental berat nikmat film hibur'),
(531, 548, 'overall tampaknya daripada menghadirkan daur ulang sebuah dongeng klasik ke dalam versi modern gullivers travels malah lebih condong menjadi ajang jack black mempertontonkan segala kenarsisaan dan kegilaannya ya film ini memang hanya sekedar menghibur itupun kalau anda memang fans seorang jack black yang terbiasa dengan segala guyonannya yang nyeleh jika tidak lebih baik lewatkan saja film satu ini toh anda tidak akan rugi apa-apa', 'overall menghadirkan daur ulang dongeng klasik versi modern gullivers travels condong ajang jack black mempertontonkan kenarsisaan kegilaannya ya film sekedar menghibur itupun fans jack black terbiasa guyonannya nyeleh lewatkan film rugi apa-apa', 'overall hadir daur ulang dongeng klasik versi modern gullivers travels condong ajang jack black tonton kenarsisaan gila ya film sekedar hibur itu fans jack black biasa guyon nyeleh lewat film rugi apa-apa'),
(532, 549, 'dengan durasi kejam yang hampir menyentuh tiga jam tanpa kekuatan bercerita yang benar-benar bisa mengikat itu jelas adalah sebuah sikasaan tersendiri pesona teknis luar biasa dan dukungan ensemble cast-nya yang bermain gemilang hanya memberi rasa takjub instan yang perlahan memudar digerus durasi panjang nan memelahkan tidak ada momen yang benar-benar menghentak atau sampai emosional yang merengsek rasa patriotisme penontonnya bahkan konflik demi konfliknya pun terasa lempeng dan dipanjang-panjangkan termasuk penambahan karakter fiktif macam stella yang tidak terlalu penting meskipun kenyataanya chelsea islan bermain fantastis', 'durasi kejam menyentuh jam kekuatan bercerita benar-benar mengikat sikasaan tersendiri pesona teknis dukungan ensemble cast-nya bermain gemilang takjub instan perlahan memudar digerus durasi nan memelahkan momen benar-benar menghentak emosional merengsek patriotisme penontonnya konflik konfliknya lempeng dipanjang-panjangkan penambahan karakter fiktif stella kenyataanya chelsea islan bermain fantastis', 'durasi kejam sentuh jam kuat cerita benar-benar ikat sikasaan sendiri pesona teknis dukung ensemble cast-nya main gemilang takjub instan perlahan memudar gerus durasi nan memelahkan momen benar-benar menghentak emosional merengsek patriotisme penontonnya konflik konflik lempeng dipanjang-panjangkan penambahan karakter fiktif stella kenyataanya chelsea islan main fantastis'),
(533, 550, 'belum cukup dengan plot dan akting yang buruk bak tsunami yang dahsyat film ini masih akan menerjang penontonnya dengan luapan besar kesalahan alias bloopers yang kelewatan banget terlihat bukan hanya sekali dua kali namun hampir disetiap adegan yang melibatkan bencana dipastikan diwarnai dengan adegan bodoh tidak masuk akal dan sangat teramat dipaksakan maksud hati sih ingin menghadirkan sebuah ketegangan yang mencekam namun hasilnya malah konyol overall buruk adalah kata yang pas untuk menggambarkan keseluruhan film disaster korea selatan satu ini bahkan  yang notabene sudah terbilang mengecewakan terlihat jauh lebih baik dan masuk akal jika dibandingkan dengan film satu ini benar membuang buang waktu saja', 'plot akting buruk bak tsunami dahsyat film menerjang penontonnya luapan kesalahan alias bloopers kelewatan banget kali disetiap adegan melibatkan bencana diwarnai adegan bodoh masuk akal teramat dipaksakan maksud hati sih menghadirkan ketegangan mencekam hasilnya konyol overall buruk pas menggambarkan film disaster korea selatan  notabene terbilang mengecewakan masuk akal dibandingkan film membuang buang', 'plot akting buruk bak tsunami dahsyat film terjang penontonnya luap salah alias bloopers lewat banget kali disetiap adegan libat bencana warna adegan bodoh masuk akal amat paksa maksud hati sih hadir tegang cekam hasil konyol overall buruk pas gambar film disaster korea selatan  notabene bilang kecewa masuk akal banding film buang buang'),
(534, 551, 'overall walaupun masih bisa dibilang cukup halloween ii sukses menuai keuntungan secara komersil namun secara kualitas seri keduanya ini mengalami penurunan cukup besar terutama pada bagian cerita yang tidak sebaik predesornya terlepas dari kelemahannya tersebut ucapan terima kasih tetap layak diberikan oleh rob zombie yang mampu menghadirkan sosok baru sang legenda michael mayers menjadi lebih baik dari versi orisinilnya', 'overall dibilang halloween ii sukses menuai keuntungan komersil kualitas seri mengalami penurunan cerita predesornya terlepas kelemahannya ucapan terima kasih layak rob zombie menghadirkan sosok sang legenda michael mayers versi orisinilnya', 'overall bilang halloween i sukses tuai untung komersil kualitas seri alami penurunan cerita predesornya lepas lemah ucap terima kasih layak rob zombie hadir sosok sang legenda michael mayers versi orisinilnya'),
(535, 552, 'sementara apa yang kamu dapat dalam haunt bukan hanya sekedar sajian horor rumah angker dengan pakem basi yang kembali diulang tanpa modifikasi berarti namun juga sebuah kebingungan untuk menjabarkan narasi dan misterinya hasilnya haunt tidak lebih dari horor medioker dengan beberapa kebodohan keluarga yang menempati rumahnya tahu bahwa tempat itu bekas dari kejadian-kejadian mengerikan dan mereka seperti tidak pernah terpengaruh sama sekali cerita percintaan remaja maksa yang bertele-tele dan belum lagi gangguan plot hole', 'haunt sekedar sajian horor rumah angker pakem basi diulang modifikasi kebingungan menjabarkan narasi misterinya hasilnya haunt horor medioker kebodohan keluarga menempati rumahnya bekas kejadian-kejadian mengerikan terpengaruh cerita percintaan remaja maksa bertele-tele gangguan plot hole', 'haunt sekedar saji horor rumah angker pakem basi ulang modifikasi bingung menjabarkan narasi misteri hasil haunt horor medioker bodoh keluarga tempat rumah bekas kejadian-kejadian erik pengaruh cerita cinta remaja maksa bertele-tele ganggu plot hole'),
(536, 553, 'headshot menderita banyak di berbagai sisi cerita tentu saja salah satu yang paling mencolok narasi tentang balas dendam dari penjahat insaf dan pencarian identitas mungkin bukan konsep baru di ranah ini headshot sedikit banyak mengingatkan saya pada kill bill vol  milik tarantino namun klise bukan masalah utamanya adalah tidak adanya pengembangan yang cukup untuk membuat penontonnya bisa terlibat lebih dalam dengan konflik dan karakternya yang membuat naskah headshot terasa dangkal dan compang-camping padahal jujur saja meski terasa familiar premis ini sangat mungkin diolah lebih baik lagi guna menghasilkan tonjokan lebih emosional apalagi kemudian ia membawa embel-embel romansa di dalamnya dengan melibatkan relasi antara ishmael dan ailin yang sayang lagi-lagi juga tidak pernah bisa dikemas dengan sempurna', 'headshot menderita sisi cerita salah mencolok narasi balas dendam penjahat insaf pencarian identitas konsep ranah headshot kill bill vol  milik tarantino klise utamanya pengembangan penontonnya terlibat konflik karakternya naskah headshot dangkal compang-camping jujur familiar premis diolah menghasilkan tonjokan emosional membawa embel-embel romansa dalamnya melibatkan relasi ishmael ailin sayang lagi-lagi dikemas sempurna', 'headshot derita sisi cerita salah colok narasi balas dendam jahat insaf cari identitas konsep ranah headshot kill bill vol  milik tarantino klise utama pengembangan penontonnya libat konflik karakternya naskah headshot dangkal compang-camping jujur familiar premis o hasil tonjok emosional bawa embel-embel romansa dalam libat relasi ishmael ailin sayang lagi-lagi kemas sempurna'),
(537, 554, 'sayang ketimbang memilih untuk tampil sederhana dan to the point layaknya thriller home invasion kebanyakan huh jung berusaha membuat ceritanya menjadi lebih berbelit dengan memberikan karakter utamanya bermasalah dengan ocd nah sejak itu hide and seek mulai rusak ia terjebak dalam upayanya ingin mengalihkan perhatian penontonnya ke sesuatu yang lain sialnya semuanya terlalu dipaksakan dan kebodohan fatal huh jung membocorkan identitas pelaku terlalu dini', 'sayang ketimbang memilih tampil sederhana to the point layaknya thriller home invasion kebanyakan huh jung berusaha ceritanya berbelit karakter utamanya bermasalah ocd hide and seek rusak terjebak upayanya mengalihkan perhatian penontonnya sialnya dipaksakan kebodohan fatal huh jung membocorkan identitas pelaku', 'sayang ketimbang pilih tampil sederhana to the point layak thriller home invasion banyak huh jung usaha cerita belit karakter utama masa ocd hide and seek rusak jebak upaya alih perhati tonton sial paksa bodoh fatal huh jung bocor identitas pelaku'),
(538, 555, 'mungkin yang sangat disayangkan adalah bagaimana aja menutup kisah ini alih-alih menghadirkan sebuah twist-shocking ending yang cerdas ala the sixth sense aja malah seakan-akan memaksa penontonnya tertipu dengan cara yang terbilang murahan saya sendiri tidak percaya sutradara sekelas aja bisa juga membuat ending seperti ini layaknya mencomot bagian penutup dari film lain dan menempelkannya disini apa yang tersaji di klimaks ini begitu penuh kontrdiksi dengan apa yang sudah dihadirkan sepanjang film sebuah plot hole besar yang seharusnya tidak perlu terjadi jika aja memilih untuk menyelesaikan film ini dengan cara yang lebih normal', 'disayangkan aja menutup kisah alih-alih menghadirkan twist-shocking ending cerdas ala the sixth sense aja seakan-akan memaksa penontonnya tertipu terbilang murahan percaya sutradara sekelas aja ending layaknya mencomot penutup film menempelkannya tersaji klimaks penuh kontrdiksi dihadirkan film plot hole aja memilih menyelesaikan film normal', 'sayang aja tutup kisah alih-alih hadir twist-shocking ending cerdas ala the sixth sense aja seakan-akan memaksa penontonnya tipu bilang murah percaya sutradara kelas aja ending layak comot penutup film tempel saji klimaks penuh kontrdiksi hadir film plot hole aja memilih selesai film normal'),
(539, 556, 'tetapi akan menjadi kasus berbeda jika kamu datang memosisikan dirimu sebagai penonton awam yang tidak membawa ekspektasi apa-apa ya hasilnya hitman agen  tidak terlalu buruk untuk sekelas sutradara iklan komersial basch sebenarnya cukup berhasil menghadirkan sebuah sensasi brainless action thriller yang seru dan enjoyable plot-nya mungkin sedikit berantakan lemah dan tidak konsisten beberapa elemen cerita akan terlihat tidak masuk akal dan menantang logika namun mengingat ini adalah cerita seorang agen super dari sebuah percobaan biologi rahasia yang mampu membuat jagoan kita lebih pintar lebih cepat dan lebih mematikan dari manusia normal maka hal-hal yang terasa berlebihan tersebut masih bisa dibilang cukup wajar ya ini adalah jenis film yang tidak perlu diambil pusing soal penceritaannya tentang kenapa dan mengapa yang ujung-ujungnya nanti malah membuatmu tambah pusing', 'berbeda memosisikan dirimu penonton awam membawa ekspektasi apa-apa ya hasilnya hitman agen  buruk sekelas sutradara iklan komersial basch berhasil menghadirkan sensasi brainless action thriller seru enjoyable plot-nya berantakan lemah konsisten elemen cerita masuk akal menantang logika cerita agen super percobaan biologi rahasia jagoan pintar cepat mematikan manusia normal hal-hal dibilang wajar ya jenis film diambil pusing penceritaannya ujung-ujungnya membuatmu pusing', 'beda memosisikan diri penonton awam bawa ekspektasi apa-apa ya hasil hitman agen  buruk kelas sutradara iklan komersial basch hasil hadir sensasi brainless action thriller seru enjoyable plot-nya berantak lemah konsisten elemen cerita masuk akal tantang logika cerita agen super coba biologi rahasia jago pintar cepat mati manusia normal hal-hal bilang wajar ya jenis film ambil pusing cerita ujung-ujungnya buat pusing'),
(540, 557, 'jadi kenapa dengan materi teknis semenjanjikan itu home malah tampil melempem pertama melihat deretan animasi-animasi besutan johnson tentu saja ada rasa pesimis akan keberhasilan home menjadi kartun yang bagus antz sinbad legend of the seven seas dan over the hedge jelas bukan termasuk dalam animasi panas dreamworks malah bisa dibilang secara kualitas mereka termasuk kelas medioker dibandingkan franchise besar dreamworks lain macam shrek kung-fu panda dan how to train your dragon dan apa yang terjadi di home semakin memperkuat posisi johnson sebagai sutradara animasi kelas dua-nya dreamworks johnson lagi-lagi gagal menghadirkan sesuatu yang spesial termasuk desian karakternya untuk bisa tinggal lama di ingatan penontonnya narasinya terlalu generik meskipun punya premis menarik yang meliputi petualangan intergalaksi namun materinya sendiri terasa terlalu dipanjang-panjangkan untuk ukuran film dengan durasi  menit home dengan mudah menjadi membosankan dalam perjalannya menuju akhir', 'materi teknis semenjanjikan home tampil melempem deretan animasi-animasi besutan johnson pesimis keberhasilan home kartun bagus antz sinbad legend of the seven seas over the hedge animasi panas dreamworks dibilang kualitas kelas medioker dibandingkan franchise dreamworks shrek kung-fu panda how to train your dragon home memperkuat posisi johnson sutradara animasi kelas dua-nya dreamworks johnson lagi-lagi gagal menghadirkan spesial desian karakternya tinggal ingatan penontonnya narasinya generik premis menarik meliputi petualangan intergalaksi materinya dipanjang-panjangkan ukuran film durasi  menit home mudah membosankan perjalannya', 'materi teknis semenjanjikan home tampil lempem deret animasi-animasi besut johnson pesimis hasil home kartun bagus antz sinbad legend of the seven as over the hedge animasi panas dreamworks bilang kualitas kelas medioker banding franchise dreamworks shrek kung-fu panda how to train your dragon home kuat posisi johnson sutradara animasi kelas dua-nya dreamworks johnson lagi-lagi gagal hadir spesial desian karakternya tinggal ingat penontonnya narasi generik premis tarik liput tualang intergalaksi materi dipanjang-panjangkan ukur film durasi  menit home mudah bosan jalan'),
(541, 558, 'harus diakui memang setengah jam pertama horsemen tampil sangat menjanjikan akan sebuah sajian thriller yang menarik atmosfer gelap dan mencekam serta misteri-misteri tentang peristiwa pembunuhan berantai misterius berhasil digarap dengan baik sehingga membuat penontonnya tentu berharap banyak untuk mendapatkan sebuah kejutan di satu jam kedepan namun apa yang terjadi adalah sebuah bencana cerita yang begitu menjanjikan di awal-awal film menjadi babak belur entah kenapa cerita menarik tersebut menjadi terlihat bodoh penuh dengan penjelasan yang tidak jelas dangkal dan terkesan dipaksakan belum lagi ending-nya yang sangat mengecewakan kesemuanya itu masih diperparah lagi dengan akting zhang ziyi yang luar biasa buruk alih-alih tampil mengesankan sebagai seorang wanita misterius aktris asal cina ini malah lebih terlihat seperti pelacur murahan yang sedang merayu pelanggannya dengan bahasa inggris-nya yang pas-pasan overall mencari sebuah crime-thriller yang pintar dan mencekam horseman jelas bukanlah sebuah pilihan yang bijak karena film ini dijamin akan menghabiskan percuma waktu anda dengan sajian yang jauh dari berkualitas', 'diakui jam horsemen tampil menjanjikan sajian thriller menarik atmosfer gelap mencekam serta misteri-misteri peristiwa pembunuhan berantai misterius berhasil digarap penontonnya berharap kejutan jam kedepan bencana cerita menjanjikan awal-awal film babak belur cerita menarik bodoh penuh penjelasan dangkal terkesan dipaksakan ending-nya mengecewakan kesemuanya diperparah akting zhang ziyi buruk alih-alih tampil mengesankan wanita misterius aktris cina pelacur murahan merayu pelanggannya bahasa inggris-nya pas-pasan overall mencari crime-thriller pintar mencekam horseman pilihan bijak film dijamin menghabiskan sajian berkualitas', 'aku jam horsemen tampil janji saji thriller tarik atmosfer gelap cekam serta misteri-misteri peristiwa bunuh beranta misterius hasil garap penontonnya harap kejut jam depan bencana cerita janji awal-awal film babak belur cerita tarik bodoh penuh jelas dangkal kesan paksa ending-nya kecewa semua parah akting zhang ziyi buruk alih-alih tampil kesan wanita misterius aktris cina lacur murah rayu langgan bahasa inggris-nya pas-pasan overall cari crime-thriller pintar cekam horseman pilih bijak film jamin habis saji kualitas'),
(542, 559, 'sayang selain adegan menguliti wajah otomatis tidak ada lagi hal mengerikan yang bisa ditawarkan spiegel ya menggunakan kecoa-kecoa madagaskar sebesar kepalan tangan anak kecil atau tembakan-tembakan anak panah besi untuk menyiksa korbannya jelas bukan cara yang kreatif untuk ukuran sebuah torture porn sekelas hostel parahanya lagi adegan-adegan tersebut terlihat begitu lembek begitu cupu jelas merusak apa yang sudah dibuat roth sebelumnya satu-satunya yang mungkin sukses disiksa disini mungkin hanya para penontonnya yang harus duduk menyaksikan segala jeritan-jeritan sumbang dan kebodohan demi kebodohan membuat durasi  menit terasa berjam-jam', 'sayang adegan menguliti wajah otomatis mengerikan ditawarkan spiegel ya kecoa-kecoa madagaskar kepalan tangan anak tembakan-tembakan anak panah besi menyiksa korbannya kreatif ukuran torture porn sekelas hostel parahanya adegan-adegan lembek cupu merusak roth satu-satunya sukses disiksa penontonnya duduk menyaksikan jeritan-jeritan sumbang kebodohan kebodohan durasi  menit berjam-jam', 'sayang adegan ulit wajah otomatis erik ditawarkan spiegel ya kecoa-kecoa madagaskar kepal tang anak tembakan-tembakan anak panah besi siksa korban kreatif ukur torture porn kelas hostel parahanya adegan-adegan lembek cupu rusak roth satu-satunya sukses siksa penontonnya duduk saksi jeritan-jeritan sumbang bodoh bodoh durasi  menit berjam-jam'),
(543, 560, 'ya tidak butuh lama untuk membuat penontonnya bisa membenci hates setelah opening yang menyakinkan narasi garapan david loucka dream house dan jonathan mostow surrogates ini perlahan namun pasti mulai terjun bebas ke jurang kehancuran dosis suspense-nya ompong misterinya tiga babaknya tidak pernah terasa kuat dan menggigit kamu dengan mudah melihat akhirnya jauh sebelum filmnya sendiri berakhir terutama ketika karakter ryan muncul dan membeberkan segalanya twist ending-nya sebenarnya bagus hanya saja proses menuju ke sana itu adalah sebuah kekacauan ditambah lagi selain penampilan apik j-law yang lovable karakter-karakter pendukung lainnya tidak pernah diberi porsi lebih dalam mereka tampak lebih seperti figuran tanpa arti ketimbang membantu menggerakan plotnya memang elizabeth sue mampu menjalin relasi ibu-anak dengan lawrence dengan cukup baik tetapi hanya itu saja subplot lainnya seperti diada-adakan untuk memperpanjang narasinya yang sebenarnya bisa saja diakhiri setengah jam lebih cepat', 'ya butuh penontonnya membenci hates opening menyakinkan narasi garapan david loucka dream house jonathan mostow surrogates perlahan terjun bebas jurang kehancuran dosis suspense-nya ompong misterinya babaknya kuat menggigit mudah filmnya karakter ryan muncul membeberkan twist ending-nya bagus proses kekacauan ditambah penampilan apik j-law lovable karakter-karakter pendukung porsi figuran arti ketimbang membantu menggerakan plotnya elizabeth sue menjalin relasi ibu-anak lawrence subplot diada-adakan memperpanjang narasinya jam cepat', 'ya butuh penontonnya benci hates opening menyakinkan narasi garap david loucka dream house jonathan mostow surrogates perlahan terjun bebas jurang hancur dosis suspense-nya ompong misteri babak kuat gigit mudah film karakter ryan muncul beber twist ending-nya bagus proses kacau tambah penampilan apik j-law lovable karakter-karakter dukung porsi figuran arti timbang bantu gerak plot elizabeth sue jalin relasi ibu-anak lawrence subplot diada-adakan panjang narasi jam cepat'),
(544, 561, 'tetapi jujur saja i frankenstein itu lebih kacau dari franchise underworld dan blade yang buat saya sudah termasuk medioker bahkan parade pertarungan penuh cgi mewah antara pasukan gargoyle pimpinan miranda otto dan iblis yang dikomandani oleh sang pangeran kegelapan dalam wujud bill nighy itu akan menjadi cepat usang dan membosankan', 'jujur i frankenstein kacau franchise underworld blade medioker parade pertarungan penuh cgi mewah pasukan gargoyle pimpinan miranda otto iblis dikomandani sang pangeran kegelapan wujud bill nighy cepat usang membosankan', 'jujur i frankenstein kacau franchise underworld blade medioker parade tarung penuh cgi mewah pasuk gargoyle pimpin miranda otto iblis komandan sang pangeran gelap wujud bill nighy cepat usang bosan'),
(545, 562, 'memang cerita tentang arwah cantik penasaran dalam drama bukan sekali ini saja dipakai meskipun sedikit basi tetapi segmen penuh dengan aroma sedih dan kecemasan ini ini jelas jauh lebih menarik dan emosional ketimbang harus melihat banyak flashback membosankan tetang kehidupan bahagia mia pra tragedi yang diisi banyak momen cheesy dalam iring-iringan musik cantik  nyaris tanpa konflik berarti mungkin bukan sepenuhnya salah sutradara spesialis dokumenter r j cutler yang memulai debutnya di sini atau penulis naskahnya shauna cross mungkin saja memang novel gayle forman bukan live action material yang bisa dengan mudah dibuat versi filmnya dengan segala detil yang tak mungkin terangkut dalam  durasinya ', 'cerita arwah cantik penasaran drama dipakai basi segmen penuh aroma sedih kecemasan menarik emosional ketimbang flashback membosankan tetang kehidupan bahagia mia pra tragedi diisi momen cheesy iring-iringan musik cantik  konflik sepenuhnya salah sutradara spesialis dokumenter r j cutler debutnya penulis naskahnya shauna cross novel gayle forman live action material mudah versi filmnya detil terangkut  durasinya ', 'cerita arwah cantik penasaran drama pakai basi segmen penuh aroma sedih cemas tarik emosional timbang flashback bosan tetang hidup bahagia mia pra tragedi isi momen cheesy iring-iringan musik cantik  konflik penuh salah sutradara spesialis dokumenter r j cutler debut penulis naskah shauna cross novel gayle forman live action material mudah versi film detil angkut  durasi '),
(546, 563, 'ya film fantasi yang juga menjadi pembuka dalam ajang inafff kemarin ini memang gagal menghadirkan sebuah epik mitologi sendal dan pedang yang bagus dari segi kualitas cerita terlalu banyak modifikasi ekstrem di sana sini yang membuatnya malah terlihat konyol lihat saja bagaimana singh menurunkan derajat theseus dari manusia setengah dewa menjadi tukan batu yang terlahir dari seorang ibu tanpa ayah menggambarkan para titan yang alih-alih berukuran raksasa sesuai namanya mereka malah terlihat mengelikan termasuk juga para dewa-dewanya ya menjadi berbeda itu boleh-boleh saja tetapi bukan berati harus konyol tapi di sisi lain immortals punya daya tarik tersendiri selain visualnya yang luar biasa itu tingkat kesadisan yang cukup frontal membuatnya jelas bukan tontonan anak-anak seperti clash of the titans lihat saja ketika apollo menghabisi para anak buah hyperion sebuah kombinasi tidak wajar menggabungkan segala kecantikan dan kebrutalan penuh darah dan banyak kepala hancur menjadi kesatuan yang keren ya seperti  tapi tidak banyak editing berlebihan yang dilakukan oleh sighn di sini', 'ya film fantasi pembuka ajang inafff kemarin gagal menghadirkan epik mitologi sendal pedang bagus segi kualitas cerita modifikasi ekstrem membuatnya konyol lihat singh menurunkan derajat theseus manusia dewa tukan batu terlahir ayah menggambarkan titan alih-alih berukuran raksasa sesuai namanya mengelikan dewa-dewanya ya berbeda boleh-boleh berati konyol sisi immortals daya tarik tersendiri visualnya tingkat kesadisan frontal membuatnya tontonan anak-anak clash of the titans lihat apollo menghabisi anak buah hyperion kombinasi wajar menggabungkan kecantikan kebrutalan penuh darah kepala hancur kesatuan keren ya  editing sighn', 'ya film fantasi buka ajang inafff kemarin gagal hadir epik mitologi sendal pedang bagus segi kualitas cerita modifikasi ekstrem buat konyol lihat singh turun derajat theseus manusia dewa tuk batu lahir ayah gambar titan alih-alih ukur raksasa suai nama kelik dewa-dewanya ya beda boleh-boleh berat konyol sisi immortals daya tarik sendiri visual tingkat sadis frontal buat tonton anak-anak clash of the titans lihat apollo habis anak buah hyperion kombinasi wajar gabung cantik brutal penuh darah kepala hancur satu keren ya  editing sighn'),
(547, 564, 'ya di atas kertas imperium menjanjikan sajian thriller yang menarik tetapi narasinya yang tidak kuat membuatnya hanya terasa angker pada premis tidak dengan keseluruhan plotnya memang ada beberapa adegan yang terasa mendebarkan kebanyakan melibatkan nyaris terbongkarnya penyamaran nate foster tetapi secera keseluruhan imperium bisa dibilang adalah thriller yang masih bermain di wilayah aman tanpa benar-benar punya keberanian lebih untuk menelusuri konsep kontroversialnya dengan lebih terbuka terlebih dari interaksi antar karakternya yang terasa terlalu mudah dan memaksakan diri', 'ya kertas imperium menjanjikan sajian thriller menarik narasinya kuat membuatnya angker premis plotnya adegan mendebarkan kebanyakan melibatkan terbongkarnya penyamaran nate foster secera imperium dibilang thriller bermain wilayah aman benar-benar keberanian menelusuri konsep kontroversialnya terbuka interaksi karakternya mudah memaksakan', 'ya kertas imperium janji saji thriller tarik narasi kuat buat angker premis plot adegan debar banyak libat bongkar samar nate foster secera imperium bilang thriller main wilayah aman benar-benar berani telusur konsep kontroversial buka interaksi karakternya mudah memaksakan'),
(548, 565, 'dengan durasi yang menyentuh  jam howard sebenarnya punya cukup banyak waktu untuk mengolah relasi antar karakternya potensinya besar terutama ketika kita bisa melihat konsep rivalitas dan clash antara owen chase dan george pollard jr yang sedikit banyak mengingatkan saya pada niki lauda dan james hunt di rush dari situ sebenarnya howard bisa saja memperkuat naskah garapan charles leavitt blood diamond dan segala pergolakan emosi dengan modal perseteruan dua karakternya utamanya sayang nyatanya tidak demikian howard tampak lebih sibuk memperhatikan segala urusan teknis untuk bagaimana membuat in the heart of the sea secantik dan semegah mungkin namun tanpa jiwa dan emosi', 'durasi menyentuh  jam howard mengolah relasi karakternya potensinya konsep rivalitas clash owen chase george pollard jr niki lauda james hunt rush situ howard memperkuat naskah garapan charles leavitt blood diamond pergolakan emosi modal perseteruan karakternya utamanya sayang howard sibuk memperhatikan urusan teknis in the heart of the sea secantik semegah jiwa emosi', 'durasi sentuh  jam howard o relasi karakternya potensi konsep rivalitas clash owen chase george pollard jr nik lauda james hunt rush situ howard kuat naskah garap charles leavitt blood diamond pergola emosi modal seteru karakternya utama sayang howard sibuk hati urus teknis in the heart of the a cantik megah jiwa emosi'),
(549, 566, 'sungguh premis yang menjanjikan ketika pertama kali saya mendengarkan cerita film ini apalagi mengetahui kalau andrew niccol yang menyutradarai sekaligus menulis ceritanya saya langsung girang gattaca adalah salah satu film scifi favorit saya walaupun agak underrated selain gattaca andrew niccol juga menulis the terminal the truman show dan lord of war yang juga termasuk dalam daftar film-film yang saya sukai tetapi in time sayangnya menjadi film dengan ide yang sangat menarik tetapi eksekusi yang mengecewakan', 'sungguh premis menjanjikan kali mendengarkan cerita film andrew niccol menyutradarai menulis ceritanya langsung girang gattaca salah film scifi favorit underrated gattaca andrew niccol menulis the terminal the truman show lord of war daftar film-film sukai in time sayangnya film ide menarik eksekusi mengecewakan', 'sungguh premis janji kali dengar cerita film andrew niccol sutradara tulis cerita langsung girang gattaca salah film scifi favorit underrated gattaca andrew niccol tulis the terminal the truman show lord of war daftar film-film suka in time sayang film ide tarik eksekusi kecewa'),
(550, 567, 'jadi ketimbang lebih memusatkan segalanya pada pesona chupacabra itu sendiri orr malah seperti lebih asik bermain-main dengan karakter-karakternya masalahnya seperti chupacabra setiap tokohnya juga tidak mendapatkan perlakuan yang lebih baik mereka tidak jauh dari tipikal tokoh-tokoh sterotip dalam banyak sajian horor yang lebih cenderung bodoh terutama dalam mengambil keputusan tidak jarang mereka menganggap remeh larangan yang ada ya sepertinya dalam dunia horor peraturan larangan atau himbauan itu memang paling asik untuk dilanggar selanjutnya bisa ditebak sebuah penyesalan yang datang terlambat indigenous tidak hanya diisi oleh banyak karakter bodoh namun juga presentasinya yang seperti tidak mau kalah naskahnya sudah bisa diduga dangkal padahal kalau mau sedikit lebih rajin max roberts sang penulis bisa memberi lebih banyak', 'ketimbang memusatkan pesona chupacabra orr asik bermain-main karakter-karakternya chupacabra tokohnya perlakuan tipikal tokoh-tokoh sterotip sajian horor cenderung bodoh mengambil keputusan jarang menganggap remeh larangan ya dunia horor peraturan larangan himbauan asik dilanggar ditebak penyesalan terlambat indigenous diisi karakter bodoh presentasinya kalah naskahnya diduga dangkal rajin max roberts sang penulis', 'timbang memusatkan pesona chupacabra orr asik bermain-main karakter-karakternya chupacabra tokoh laku tipikal tokoh-tokoh sterotip saji horor cenderung bodoh ambil putus jarang anggap remeh larang ya dunia horor atur larang himbauan asik langgar tebak sesal lambat indigenous isi karakter bodoh presentasi kalah naskah duga dangkal rajin max roberts sang penulis'),
(551, 568, 'menginjak paruh kedua kesan mengerikan pun perlahan mulai kedodoran sampai akhirnya menginjak klimaks yang ternyata hanya terkesan begitu saja  walaupun harus diakui ending film ini sangat mengejutkan overall entah karena sudah menonton versi alexandre aja atau kenapa saya merasa into the mirror tampil tidak maksimal premis yang sebenarnya menarik harus terbuang begitu saja dikarenakan pengolahan cerita yang lemah untung saja alexandre aja mengetahui kekurangan ini dan mampu membuat mirrors versinya menjadi jauh lebih menarik', 'menginjak paruh kesan mengerikan perlahan kedodoran menginjak klimaks terkesan  diakui ending film mengejutkan overall menonton versi alexandre aja into the mirror tampil maksimal premis menarik terbuang pengolahan cerita lemah untung alexandre aja kekurangan mirrors versinya menarik', 'injak paruh kesan erik perlahan kedodoran injak klimaks kesan  aku ending film kejut overall tonton versi alexandre aja into the mirror tampil maksimal premis tarik buang olah cerita lemah untung alexandre aja kurang mirrors versi tarik'),
(552, 569, 'dibandingkan twister into the strom memang menderita banyak di narasinya terlalu cheesy dan klise penulis naskah john swetnam memang seperti tidak terlalu ingin membuat ceritanya terlalu rumit toh ini adalah jenis film cenderung untuk dilihat ketimbang disimak jadi kamu akan menemukan pengenalan karakter yang kelewat standar dan pergerakan plot yang terlalu mudah dikenali singkatnya lupakan saja ceritanya setidaknya meskipun dangkal ia masih enak dinikmati tentu saja tidak lepas karena faktor lainnya', 'dibandingkan twister into the strom menderita narasinya cheesy klise penulis naskah john swetnam ceritanya rumit jenis film cenderung ketimbang disimak menemukan pengenalan karakter kelewat standar pergerakan plot mudah dikenali singkatnya lupakan ceritanya dangkal enak dinikmati lepas faktor', 'banding twister into the strom derita narasi cheesy klise penulis naskah john swetnam cerita rumit jenis film cenderung timbang simak temu pengenalan karakter lewat standar gerak plot mudah kenal singkat lupa cerita dangkal enak nikmat lepas faktor'),
(553, 570, 'ya jack and jill sudah menjadi pengalaman menonton komedi yang mengerikan selain harus menyaksikan karakter sandler berwujud wanita dengan wig payudara palsu lengkap dengan suara palsunya yang mengganggu dan tingkah lakunya yang super bodoh nan menjijikkan itu di selama satu jam setengah naskah yang dikeroyok sandler bersama tiga teman penulisnya juga terbilang sangat buruk sama buruknya dengan segala humor-humor serta dialog-dialog garing kurang ajar jorok dan kasar ala sandler yang kali ini sama sekali tidak berhasil membuat saya sulit untuk sekedar menyunggingkan senyum', 'ya jack and jill pengalaman menonton komedi mengerikan menyaksikan karakter sandler berwujud wanita wig payudara palsu lengkap suara palsunya mengganggu tingkah lakunya super bodoh nan menjijikkan jam naskah dikeroyok sandler teman penulisnya terbilang buruk buruknya humor-humor serta dialog-dialog garing ajar jorok kasar ala sandler kali berhasil sulit sekedar menyunggingkan senyum', 'ya jack and jill alam tonton komedi erik saksi karakter sandler wujud wanita wig payudara palsu lengkap suara palsu ganggu tingkah laku super bodoh nan jijik jam naskah keroyok sandler teman tulis bilang buruk buruk humor serta dialog garing ajar jorok kasar ala sandler kali hasil sulit sekedar sungging senyum'),
(554, 571, 'sayang mcquarrie sepertinya tidak terlalu pintar mengeksekusi naskahnya menjadi sebuah kesatuan thirller yang solid seperti yang pernah dilakukannya pada valkyrie lalu intensitas keteganganya terasa labil ketika di satu titik ia berhasil mencapai puncak adegan kejar-kejaran mobil di titik selanjutnya ia seperti terjun bebas menjadi menjemukan dan terseok-seok dengan segala dialog-dialognya yang lemah dan itu sering terjadi berulang-ulang termasuk membuang percuma performa apik para peran pembantunya macam warner herzog yang tampil dingin sebagai the zec atau robert duvall sampai kemudian ia diakhiri dengan ending antiklimaks yang masih belum menjawab sepenuhnya siapa sebenarnya sosok jack reacher itu mungkin jika sukses akan dijelaskan dalam sekuel-sekuelnya saya kira ini bisa ditutup dengan pintar  ternyata saya salah jack reacher tidak lebih dari sebuah thriller kriminal yang berusaha keras untu terlihat cerdas dan seru sama baiknya sayang itu tidak terjadi di sini hanya terlihat bagus di  menit pertama selanjutnya kita hanya melihat mcquarrie lebih mengantungkan semuanya kepada pesona bintang seorang tom cruise', 'sayang mcquarrie pintar mengeksekusi naskahnya kesatuan thirller solid dilakukannya valkyrie intensitas keteganganya labil titik berhasil mencapai puncak adegan kejar-kejaran mobil titik terjun bebas menjemukan terseok-seok dialog-dialognya lemah berulang-ulang membuang performa apik peran pembantunya warner herzog tampil dingin the zec robert duvall ending antiklimaks sepenuhnya sosok jack reacher sukses sekuel-sekuelnya ditutup pintar  salah jack reacher thriller kriminal berusaha keras untu cerdas seru baiknya sayang bagus  menit mcquarrie mengantungkan pesona bintang tom cruise', 'sayang mcquarrie pintar eksekusi naskah satu thirller solid laku valkyrie intensitas keteganganya labil titik hasil capai puncak adegan kejar-kejaran mobil titik terjun bebas jemu terseok-seok dialog-dialognya lemah berulang-ulang buang performa apik peran bantu warner herzog tampil dingin the zec robert duvall ending antiklimaks penuh sosok jack reacher sukses sekuel-sekuelnya tutup pintar  salah jack reacher thriller kriminal usaha keras untu cerdas seru baik sayang bagus  menit mcquarrie kantung pesona bintang tom cruise'),
(555, 572, 'tentu saja mengecewakan untuk ukuran sutradara sekaliber bryan singer terlebih dengan budget sebesar itu dan banyak nama-nama aktor kelas satu di dalamnya jack the giant slayer harusnya bisa lebih dari sekedar sebuah dongeng fantasi daur ulang untuk kelas film keluarga dengan cgi pas-pasan tetapi sekali lagi saya masih sanggup menikmatinya yah setidaknya saya lebih suka yang satu ini ketimbang hansel  gratel witchs hunter ', 'mengecewakan ukuran sutradara sekaliber bryan singer budget nama-nama aktor kelas dalamnya jack the giant slayer sekedar dongeng fantasi daur ulang kelas film keluarga cgi pas-pasan sanggup menikmatinya yah suka ketimbang hansel  gratel witchs hunter ', 'kecewa ukur sutradara kaliber bryan singer budget nama-nama aktor kelas dalam jack the giant slayer sekedar dongeng fantasi daur ulang kelas film keluarga cgi pas-pasan sanggup nikmat yah suka timbang hansel  gratel witchs hunter '),
(556, 573, 'eksploitasi besar-besaran kota jogjakarta plus candi borobudur dengan segala kegemerlapan acara waisak-nya mungkin hanya satu-satunya hal positif yang berhasil di garap conor sisanya java heat bak sebuah bencana berisik berbiaya besar yang gagal di semua sektornya termasuk membuang percuma premis dan sumber daya utamanya kecuali ada fans film aksi kelas b tanpa otak saya sarankan untuk menghindari java heat yang tidak ada panas-panasnya ini', 'eksploitasi besar-besaran kota jogjakarta plus candi borobudur kegemerlapan acara waisak-nya satu-satunya positif berhasil garap conor sisanya java heat bak bencana berisik berbiaya gagal sektornya membuang premis sumber daya utamanya kecuali fans film aksi kelas b otak sarankan menghindari java heat panas-panasnya', 'eksploitasi besar-besaran kota jogjakarta plus candi borobudur gemerlap acara waisak-nya satu-satunya positif hasil garap conor sisa java heat bak bencana berisik biaya gagal sektor buang premis sumber daya utama kecuali fans film aksi kelas b otak saran hindar java heat panas-panasnya');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(557, 574, 'mencampur elemen haunted house dan sihir-sihir voodoo lama dari selatan amerika jessabelle tidak pernah tampil semeyakinkan posternya sejak menit-menit awal bergulir tentu saja ada misteri yang butuh jawaban sejak kaset-kaset vhs tua itu mulai diputar oleh jessie yang malang tentu saja ada banyak pertanyaan tentang siapa itu dan mengapa ini yang sedikit banyak sudah memaksa penontonnya untuk duduk bersabar menanti akhir melewati serangkaian serangan lemah berupa jump scare murahan akting pas-pasan dari artis australia sarah snook aroma creepy yang tak pernah mencapai titik didih dan kualitas narasi lembek dan bisa dibilang jauh lebih dangkal ketimbang selokan depan rumahmu lengkap dengan banyak basa-basi tak perlu kecuali mungkin untuk memanjangkan durasinya', 'mencampur elemen haunted house sihir-sihir voodoo selatan amerika jessabelle tampil semeyakinkan posternya menit-menit bergulir misteri butuh kaset-kaset vhs tua diputar jessie malang memaksa penontonnya duduk bersabar melewati serangkaian serangan lemah jump scare murahan akting pas-pasan artis australia sarah snook aroma creepy mencapai titik didih kualitas narasi lembek dibilang dangkal ketimbang selokan rumahmu lengkap basa-basi kecuali memanjangkan durasinya', 'campur elemen haunted house sihir-sihir voodoo selatan amerika jessabelle tampil semeyakinkan poster menit-menit gulir misteri butuh kaset-kaset vhs tua putar jessie malang memaksa penontonnya duduk sabar lewat rangkai serang lemah jump scare murah akting pas-pasan artis australia sarah snook aroma creepy capai titik didih kualitas narasi lembek bilang dangkal timbang selokan rumah lengkap basa-basi kecuali memanjangkan durasi'),
(558, 575, 'seperti yang sudah saya singgung di atas tidak usah terlalu pusing memikirkan plot-nya yang memang berantakan jonah hex jelas tidak menawarkan sesuatu yang spesial pada ceritanya semuanya serba instan klise bahkan bisa dibilang jauh dibawah rata-rata film superhero yang paling standart sekalipun ', 'singgung pusing memikirkan plot-nya berantakan jonah hex menawarkan spesial ceritanya serba instan klise dibilang dibawah rata-rata film superhero standart ', 'singgung pusing pikir plot nya berantak jonah hex tawar spesial cerita serba instan klise bilang bawah rata film superhero standart '),
(559, 576, 'russell memang masih mempertahankan segala ciri khasnya dari momen-momen depresi yang dibungkus humor namun ia gagal menghadirkan sebuah proses yang masuk akal apalagi untuk ukuran drama berdasar kisah nyata transisi dari sebuah kegagalan menuju kesuksesan terasa digampangkan tanpa adanya sebuah penjelasan poof seperti sulap semua rintangan mendadak dengan cepat menghilang ketika joy menginginkannya proses transisi yang ajaib ini malah menghilangkan kesan realistisnya membuatnya menjadi semacam fantasi yang tentu saja terasa aneh', 'russell mempertahankan ciri khasnya momen-momen depresi dibungkus humor gagal menghadirkan proses masuk akal ukuran drama berdasar kisah nyata transisi kegagalan kesuksesan digampangkan penjelasan poof sulap rintangan mendadak cepat menghilang joy menginginkannya proses transisi ajaib menghilangkan kesan realistisnya membuatnya fantasi aneh', 'russell tahan ciri khas momen-momen depresi bungkus humor gagal hadir proses masuk akal ukur drama dasar kisah nyata transisi gagal sukses gampang jelas poof sulap rintang dadak cepat hilang joy ingin proses transisi ajaib hilang kesan realistis buat fantasi aneh'),
(560, 577, 'tidak butuh waktu lama buat saya untuk segera merasakan kejenuhan wachowskis mengulangi lagi dan lagi sekuen yang sama dengan setting berbeda dengan suasana yang semakin berisik hal negatif ini kemudian diperparah dengan kualitas narasi yang sama membosankannya konsep yang ditawarkan memang terlihat besar dan ambisius bahkan lana sesumbar ada elemen spritual bekerja di dalamnya masalahnya entah saya tidak peka atau memang pesannya tidak berhasil tersampaikan dengan baik alih-alih menjadi versi baru the matrix dan cloud atlas jupiter ascending dengan cepat jatuh menjadi sajian sci-fi action garing dengan naskah kelas medioker ', 'butuh merasakan kejenuhan wachowskis mengulangi sekuen setting berbeda suasana berisik negatif diperparah kualitas narasi membosankannya konsep ditawarkan ambisius lana sesumbar elemen spritual dalamnya peka pesannya berhasil alih-alih versi the matrix cloud atlas jupiter ascending cepat jatuh sajian sci-fi action garing naskah kelas medioker ', 'butuh rasa jenuh wachowskis ulang sekuen setting beda suasana berisik negatif parah kualitas narasi bosan konsep tawar ambisius lana sesumbar elemen spritual dalam peka pesan hasil alih versi the matrix cloud atlas jupiter ascending cepat jatuh saji sci fi action garing naskah kelas medioker '),
(561, 578, 'lantas apa yang kemudian ditawarkan jurassic world ia bahkan hanya ditangani oleh sutradara sekaliber colin trevorrow yang terakhir menggarap sci-fi indie safety not guaranteed ya di dalamnya kita memang akan menemukan spesies baru dino yang lebih ganas lebih kuat lebih cerdas dan memiliki lebih banyak gigi dari t-rex bernama konyol indominus rex indominus rex pula lah yang kemudian menjadi alasan kenapa naskah dangkal jurassic world masih bisa berjalan ada petualangan mendebarkan khususnya di paruh ketiga dan momen puncaknya ketika karakter-karakter utamanya berusaha bertahan hidup dari serangan indominus rex yang mengerikan tentu saja semuanya itu dibungkus bersama adegan-adegan aksi dan kejar-kejaran seru nan mendebarkan dalam balutan cgi yang keren dan visual megah khas film musim panas yang mahal plus tambahan gimmick efek d yang sayang tidak bekerja terlalu maksimal sama tidak maksimalnya dengan pengembangan karakter yang terkesan apa adanya', 'lantas ditawarkan jurassic world ditangani sutradara sekaliber colin trevorrow menggarap sci-fi indie safety not guaranteed ya dalamnya menemukan spesies dino ganas kuat cerdas memiliki gigi t-rex bernama konyol indominus rex indominus rex alasan naskah dangkal jurassic world berjalan petualangan mendebarkan paruh ketiga momen puncaknya karakter-karakter utamanya berusaha bertahan hidup serangan indominus rex mengerikan dibungkus adegan-adegan aksi kejar-kejaran seru nan mendebarkan balutan cgi keren visual megah khas film musim panas mahal plus tambahan gimmick efek d sayang maksimal maksimalnya pengembangan karakter terkesan', 'lantas ditawarkan jurassic world ditangani sutradara kaliber colin trevorrow garap sci-fi indie safety not guaranteed ya dalam temu spesies dino ganas kuat cerdas milik gigi t-rex nama konyol indominus rex indominus rex alas naskah dangkal jurassic world jalan tualang debar paruh tiga momen puncak karakter-karakter utama usaha tahan hidup serang indominus rex erik bungkus adegan-adegan aksi kejar-kejaran seru nan debar balut cgi keren visual megah khas film musim panas mahal plus tambah gimmick efek d sayang maksimal maksimal pengembangan karakter kesan'),
(562, 579, 'naskahnya lemah dan cenderung terlalu lurus tidak peduli kemudian ia diberikan penghalang berupa seorang cantik bernama kimberly rider yang muncul ditengah-tengah dua hati yang sedang saling mengobati dan memperburuk keadaan toh ia tidak pernah menjadi terlalu rumit bahkan kita bisa mencium endingnya dari kejauhan tanpa harus menjadi anjing pelacak tapi sekali lagi bukan hanya itu masalahnya ekskusi yang dilakukan iqbal rais juga semakin memperparah segalanya alurnya lambat terlalu bertele-tele tidak peduli ketika ia bersama dop-nya berhasil menangkap gambar-gambar cantik kota jogja atau bagaimana andhika triyadi mampu membungkusnya dengan soundtrack-soundtrack romantis ini sama sekali tidak bekerja dengan baik itu saya belum menyebut dua karakter utamanya yang tidak punya cukup chemistry untuk membuatmu percaya bahwa ada banyak cinta di dalamnya lalu ada sub plot bodoh tentang adik fila yang sama sekali tidak penting kecuali untuk memperpanjang durasinya', 'naskahnya lemah cenderung lurus peduli penghalang cantik bernama kimberly rider muncul ditengah-tengah hati mengobati memperburuk rumit mencium endingnya kejauhan anjing pelacak ekskusi iqbal rais memperparah alurnya lambat bertele-tele peduli dop-nya berhasil menangkap gambar-gambar cantik kota jogja andhika triyadi membungkusnya soundtrack-soundtrack romantis menyebut karakter utamanya chemistry membuatmu percaya cinta dalamnya sub plot bodoh adik fila kecuali memperpanjang durasinya', 'naskah lemah cenderung lurus peduli halang cantik nama kimberly rider muncul ditengah-tengah hati obat buruk rumit cium endingnya jauh anjing lacak ekskusi iqbal rais parah alur lambat bertele-tele peduli dop-nya hasil tangkap gambar-gambar cantik kota jogja andhika triyadi bungkus soundtrack-soundtrack romantis sebut karakter utama chemistry buat percaya cinta dalam sub plot bodoh adik fila kecuali panjang durasi'),
(563, 580, 'meskipun dimulai dengan berantakan toh saya tetap harus melanjutkan film ini hingga habis karena sudah terlanjur penasaran dengan bagaimana nasib sang anak untung saja selanjutnya ternyata not so bad beberapa adegan tersaji cukup menarik dan menegangkan dengan tempo naik turun plus beberapa momen melodrama yang seharusnya mengaharukan namun tetap saja harus diakui adegan-adegan tersebut terkesan terlalu lebay atau berlebih-lebihan dalam penggarapannya sehingga cukup menganggu kenyamanan menonton', 'berantakan melanjutkan film habis terlanjur penasaran nasib sang anak untung not so bad adegan tersaji menarik menegangkan tempo turun plus momen melodrama mengaharukan diakui adegan-adegan terkesan lebay berlebih-lebihan penggarapannya menganggu kenyamanan menonton', 'berantak lanjut film habis lanjur penasaran nasib sang anak untung not so bad adegan saji tarik tegang tempo turun plus momen melodrama mengaharukan aku adegan-adegan kesan lebay berlebih-lebihan garap menganggu nyaman tonton'),
(564, 581, 'masih beranggapan saya berlebihan ya ini adalah jenis film yang menawarkan premis yang buruk dalam artian positif kotor dan cabul dengan banyak menampilkan gambar-gambar vulgar lalu kamu akan tahu kenapa film jenis ini dibatasi dengan rating nc- di as sana yang jelas membuatnya sulit untuk mendapatkan banyak penonton tetapi ini memang bukan film yang pantas untuk ditonton oleh banyak orang', 'beranggapan ya jenis film menawarkan premis buruk artian positif kotor cabul menampilkan gambar-gambar vulgar film jenis dibatasi rating nc- as membuatnya sulit penonton film ditonton orang', 'anggap ya jenis film tawar premis buruk arti positif kotor cabul tampil gambar vulgar film jenis batas rating nc- as buat sulit tonton film tonton orang'),
(565, 582, 'ketika drama keluarga dengan segala tetek bengek melodrama dan isu-isu sosialnya bisa tersaji lebih kuat dan menarik ladda land malah harus menderita pada sisi horornya malah membuat elemen yang seharunya mendapatkan porsi paling besar ini terkesan sebagai sebuah subplot tambahan yang buruk termasuk dengan hadirnya rentetan plot hole yang tidak pernah terungkap dan juga terkesan terlalu dipaksakan hanya untuk memenuhi tujuannya untuk menakut-nakuti penontonnya dengan cara murahan tanpa memberikan asas cerita yang kuat bukan berarti saya mengatakan sukdapisit gagal total dalam menghadirkan segala momen mencekam dan atmosfer creepynya di beberapa bagian ladda land masih mampu memberikan terapi kejut yang efektif sayang klimaksnya sedikit tertebak tetapi saya menyukai bagaimana kemudian sukdapisit memilih sentuhan drama ketimbang horor untuk menutup kisahnya', 'drama keluarga tetek bengek melodrama isu-isu sosialnya tersaji kuat menarik ladda land menderita sisi horornya elemen seharunya porsi terkesan subplot tambahan buruk hadirnya rentetan plot hole terungkap terkesan dipaksakan memenuhi tujuannya menakut-nakuti penontonnya murahan asas cerita kuat sukdapisit gagal total menghadirkan momen mencekam atmosfer creepynya ladda land terapi kejut efektif sayang klimaksnya tertebak menyukai sukdapisit memilih sentuhan drama ketimbang horor menutup kisahnya', 'drama keluarga tetek bengek melodrama isu-isu sosial saji kuat tarik ladda land derita sisi horor elemen haru porsi kesan subplot tambah buruk hadir rentet plot hole ungkap kesan paksa memenuhi tuju menakut-nakuti penontonnya murah asas cerita kuat sukdapisit gagal total hadir momen cekam atmosfer creepynya ladda land terapi kejut efektif sayang klimaks tebak suka sukdapisit memilih sentuh drama timbang horor tutup kisah'),
(566, 583, 'tidak ada yang terlalu istimewa dalam letters to juliet semuanya tersaji serba standart tidak sampai terlalu mengecewakan memang namun masih jauh juga untuk dikatakan sebagai sebuah film yang bagus tipikal drama romantis hollywood yang hanya mejual keindahan kulit luar ketimbang kedalaman ceritanya', 'istimewa letters to juliet tersaji serba standart mengecewakan film bagus tipikal drama romantis hollywood mejual keindahan kulit ketimbang kedalaman ceritanya', 'istimewa letters to juliet saji serba standart kecewa film bagus tipikal drama romantis hollywood jual indah kulit timbang dalam cerita'),
(567, 584, 'tidak peduli seberapa memesonanya penampilan cantik lily collins dengan alis tebalnya itu naskah towhidi dengan cepat dan pasti membuatnya menjadi tidak lebih dari karakter perempuan bodoh yang insecure haus akan cinta yang tak kunjung datang membuatnya seperti terlihat selalu putus asa dalam mengambil setiap keputusan yang kemudian di sesalinya tetapi penampilan collins bisa dibilang terlihat jauh lebih baik ketimbang ketika narasinya memperlakukan tokoh alex yang dibawakan jebolan the hunger games sam claflin alex adalah jenis manusia yang jauh lebih menyedihkan ketimbang rosie punya banyak kesempatan untuk mengakhiri konfliknya lebih cepat namun yang terjadi adalah sebuah kebodohan demi kebodohan yang membuatnya seperti tidak pantas menjadi pria yang ditunggu selama  tahun', 'peduli memesonanya penampilan cantik lily collins alis tebalnya naskah towhidi cepat membuatnya karakter perempuan bodoh insecure haus cinta kunjung membuatnya putus asa mengambil keputusan sesalinya penampilan collins dibilang ketimbang narasinya memperlakukan tokoh alex dibawakan jebolan the hunger games sam claflin alex jenis manusia menyedihkan ketimbang rosie kesempatan konfliknya cepat kebodohan kebodohan membuatnya pria ditunggu ', 'peduli memesonanya penampilan cantik lily collins alis tebalnya naskah towhidi cepat buat karakter perempuan bodoh insecure haus cinta kunjung buat putus asa ambil putus sesal penampilan collins bilang timbang narasi laku tokoh alex bawak jebol the hunger games sam claflin alex jenis manusia sedih timbang rosie sempat konflik cepat bodoh bodoh buat pria tunggu '),
(568, 585, 'man on a ledge thriller dengan premis menarik eksekusi yang tidak terlalu buruk dan deretan bintang-bintang besar sayang ia harus dirusak dengan kualitas naskah menyedihkan yah masih untung ia tidak berakhir membosankan dan sekali lagi mungkin anda harus menutup sebelah mata untuk benar-benar bisa merasakan segala kebodohannya yang menghibur itu', 'man on a ledge thriller premis menarik eksekusi buruk deretan bintang-bintang sayang dirusak kualitas naskah menyedihkan yah untung membosankan menutup sebelah mata benar-benar merasakan kebodohannya menghibur', 'man on a ledge thriller premis tarik eksekusi buruk deret bintang-bintang sayang rusak kualitas naskah sedih yah untung bosan tutup sebelah mata benar-benar rasa bodoh hibur'),
(569, 586, 'di luar dari kepiawaian clarke yang membawakan peran gadis kikuk manisnya me before you juga untungnya didukung chemistry yang lumayan sepadan dari duet clarke dan claflin keduanya cukup mampu menjaga laju filmnya yang beralur lemah dan kelewat enteng sebagai sajian komedi romantis me before you sudah memenuhi semua kriteria film mainstream sejenis dari dua pemeran utama yang berwajah sedap dipandang tempat-tempat berpanorama elok di mata hingga lantunan lagu-lagu yang sedap didengar kurangnya ada di naskah tulisan moyes sendiri yang berasa kelewat manis dan ringan bak gula kapas arumanis sebegitu manisnya hingga terkadang membuat enek isu sensitif euthanasia yang bisa digali dengan mendalam juga dijadikan sekedar tempelan belaka di penghujung plotnya di tangan sineas inggris thea sharrock me before you juga terkesan main aman tak berani bermain-main keluar dari zona aman stereotype komedi romantis kontemporer yang belakangan ini mulai terasa menjemukan', 'kepiawaian clarke membawakan peran gadis kikuk manisnya me before you untungnya didukung chemistry lumayan sepadan duet clarke claflin menjaga laju filmnya beralur lemah kelewat enteng sajian komedi romantis me before you memenuhi kriteria film mainstream sejenis pemeran utama berwajah sedap dipandang tempat-tempat berpanorama elok mata lantunan lagu-lagu sedap didengar kurangnya naskah tulisan moyes berasa kelewat manis ringan bak gula kapas arumanis manisnya terkadang enek isu sensitif euthanasia digali mendalam dijadikan sekedar tempelan belaka penghujung plotnya tangan sineas inggris thea sharrock me before you terkesan main aman berani bermain-main zona aman stereotype komedi romantis kontemporer menjemukan', 'piawai clarke bawak peran gadis kikuk manis me before you untung dukung chemistry lumayan padan duet clarke claflin jaga laju film alur lemah lewat enteng saji komedi romantis me before you memenuhi kriteria film mainstream jenis pemeran utama wajah sedap pandang tempat-tempat panorama elok mata lantun lagu-lagu sedap dengar kurang naskah tulis moyes asa lewat manis ringan bak gula kapas arumanis manis kadang enek isu sensitif euthanasia gali dalam jadi sekedar tempel belaka hujung plot tang sineas inggris thea sharrock me before you kesan main aman berani bermain-main zona aman stereotype komedi romantis kontemporer jemu'),
(570, 587, 'coffin seperti sudah kehabisan amunisi untuk menghadirkan lelucon baru buat para minion hasilnya kelucuan yang dihadirkan minions perlahan namun pasti menjadi garing dan annoying setiap lelucon kemudian hanya sebatas menghasilkan sedikit senyum ketimbang tawa lepas', 'coffin kehabisan amunisi menghadirkan lelucon minion hasilnya kelucuan dihadirkan minions perlahan garing annoying lelucon sebatas menghasilkan senyum ketimbang tawa lepas', 'coffin habis amunisi hadir lelucon minion hasil lucu hadir minions perlahan garing annoying lelucon batas hasil senyum ketimbang tawa lepas'),
(571, 588, 'narasinya menjebak anda untuk ikut tersesat seperti halnya laura yang terombang ambing didalamnya dimulai sejak peristiwa di klub malam itu selanjutnya akan banyak kejutan tidak terduga yang membuat anda tetap terjaga menantikan apa yang kira-kira akan terjadi kemudian pada laura yang berada di tempat dan waktu yang salah sayang naranjo menghadirkan film yang mewakili meksiko dalam ajang oscar  ini sedikit bertele-tele dan terkesan repetitif pesannya sendiri juga tidak pernah mencapai sasaran kecuali satu hal meksiko itu memang keras bung tidak ada karakter yang benar-benar baik di sini bahkan polisi sampai jenderal sekalipun semuanya korup tapi selain itu kita benar-benar dibuat bingung apa yang sebenarnya ingin disampaikan naranjo tidak ada klimaks bahkan terdapat beberapa bagian yang nampak konyol dan tidak masuk akal ', 'narasinya menjebak tersesat halnya laura terombang ambing didalamnya peristiwa klub malam kejutan terduga terjaga menantikan laura salah sayang naranjo menghadirkan film mewakili meksiko ajang oscar  bertele-tele terkesan repetitif pesannya mencapai sasaran kecuali meksiko keras karakter benar-benar polisi jenderal korup benar-benar bingung naranjo klimaks nampak konyol masuk akal ', 'narasi jebak sesat hal laura terombang ambing dalam peristiwa klub malam kejut duga jaga nanti laura salah sayang naranjo hadir film wakil meksiko ajang oscar  bertele-tele kesan repetitif pesan capai sasar kecuali meksiko keras karakter benar-benar polisi jenderal korup benar-benar bingung naranjo klimaks nampak konyol masuk akal '),
(572, 589, 'memang di menit-menit awal money monster terasa menjanjikan ketika foster memilih untuk tidak menjadikannya the big short versi  yang cerewet berbicara soal uang dan ekonomi dan langsung tancap gas ke konflik utamanya lalu presentasi thriller ruang sempitnya juga tidak buruk perpindahan antara adegan di panggung dan di ruang kontrol digarap dengan baik di bagian ini foster cukup pintar memberikan momen intensnya meski buat saya efek tegangnya dengan cepat berlalu bersama penampilan tokoh-tokohnya yang kurang bersimpati serta transisi antara komedi dan dramanya yang kacau kecuali mungkin julia roberts yang bermain cukup oke sebagai director money monster meski ia selalu berada di belakang layar bagian terburuk money monster ada pada third act-nya itu bukan sebuah puncak yang bagus terkesan memaksakan diri dengan segala konklusi yang datang secara kebetulan dan bersamaan tetapi sekali lagi ini bukan tontonan yang buruk setidaknya saya menikmati apa yang ditawarkan foster di sini terlepas dari segala kekurangannya', 'menit-menit money monster menjanjikan foster memilih menjadikannya the big short versi  cerewet berbicara uang ekonomi langsung tancap gas konflik utamanya presentasi thriller ruang sempitnya buruk perpindahan adegan panggung ruang kontrol digarap foster pintar momen intensnya efek tegangnya cepat penampilan tokoh-tokohnya bersimpati serta transisi komedi dramanya kacau kecuali julia roberts bermain oke director money monster layar terburuk money monster third act-nya puncak bagus terkesan memaksakan konklusi bersamaan tontonan buruk menikmati ditawarkan foster terlepas kekurangannya', 'menit-menit money monster janji foster memilih jadi the big short versi  cerewet bicara uang ekonomi langsung tancap gas konflik utama presentasi thriller ruang sempit buruk pindah adegan panggung ruang kontrol garap foster pintar momen intens efek tegang cepat penampilan tokoh-tokohnya simpati serta transisi komedi drama kacau kecuali julia roberts main oke director money monster layar buruk money monster third act-nya puncak bagus kesan memaksakan konklusi sama tonton buruk nikmat ditawarkan foster lepas kurang'),
(573, 590, 'beberapa kekurangan lain seperti dialog yang tidak berkembang disaat memasuki pertengahan film dan lemahnya chemistry yang terjalin antara scoot mcnairy dan whitney able menjadi catatan tersendiri disini cukup mengejutkan memang mengingat keduanya sebenarnya juga adalah pasangan di dunia nyata namun kenyataannya mereka tidak mampu menghasilkan pendekatan satu sama lain dengan meyakinkan', 'kekurangan dialog berkembang disaat memasuki pertengahan film lemahnya chemistry terjalin scoot mcnairy whitney able catatan tersendiri mengejutkan pasangan dunia nyata kenyataannya menghasilkan pendekatan', 'kurang dialog kembang saat masuk tengah film lemah chemistry jalin scoot mcnairy whitney able catat sendiri kejut pasang dunia nyata nyata hasil dekat'),
(574, 591, 'jelas ini adalah film besar lihat konsepnya lihat budgetnya lihat distribusi masalnya lihat bagaimana para tim spesial efeknya berhasil melakukan pekerjaan rumah mereka dengan menciptakan gorilla cgi menggemaskan yang nyaris sempurna sebagai daya pikat terbesarnya lalu memberikannya baseball sebagai pertunjukan utama tetapi yang terjadi pada narasinya bisa dikatakan berbanding terbalik dengan segala teknis canggihnya entah terlalu sibuk memfokuskan semuanya untuk menciptakan sosok gorilla sebagus mungkin mereka bahkan membuat setiap helai bulu ling ling yang berjumlah  juta kim yong-hwa melupakan bahwa mr go juga memerlukan kualitas cerita yang bagus atau setidaknya tidak sampai sedangkal dan semudah ini', 'film lihat konsepnya lihat budgetnya lihat distribusi masalnya lihat tim spesial efeknya berhasil pekerjaan rumah menciptakan gorilla cgi menggemaskan sempurna daya pikat terbesarnya memberikannya baseball pertunjukan utama narasinya berbanding terbalik teknis canggihnya sibuk memfokuskan menciptakan sosok gorilla sebagus helai bulu ling ling  juta kim yong-hwa melupakan mr go kualitas cerita bagus sedangkal semudah', 'film lihat konsep lihat budgetnya lihat distribusi masalnya lihat tim spesial efek hasil kerja rumah cipta gorilla cgi gemas sempurna daya pikat besar berik baseball tunjuk utama narasi banding balik teknis canggih sibuk fokus cipta sosok gorilla bagus helai bulu ling ling  juta kim yong-hwa lupa mr go kualitas cerita bagus dangkal mudah'),
(575, 592, 'jujur saja mudah kok untuk menebak siapa yang menjadi pilihan lintang toh ini bukan film christopher nolan yang njelimet atau terrence malick yang absurd petunjuk-petunjuknya sudah tersebar jelas di sepanjang film dengan karakter lintang yang cenderung serius dan sedikit manja kandidat calon suami langsung mengerucut ke dua orang belum lagi twist menjelang akhir film semakin memperjelas siapa yang akhirnya bersanding di pelaminan bersamanya mungkin saya tidak terlalu memusingkan pertanyaan siapa itu mudah namun dengan potensi premis yang sebenarnya menjanjikan akan sebuah proses pengenalan karakter yang dalam ternyata disia-siakan oleh endri pelita memang ada pengenalan satu per satu karakternya namun itu masih dirasa terlalu minim dan hanya menyentuh permukaannya saja', 'jujur mudah menebak pilihan lintang film christopher nolan njelimet terrence malick absurd petunjuk-petunjuknya tersebar film karakter lintang cenderung serius manja kandidat calon suami langsung mengerucut orang twist menjelang film memperjelas bersanding pelaminan bersamanya memusingkan mudah potensi premis menjanjikan proses pengenalan karakter disia-siakan endri pelita pengenalan karakternya dirasa minim menyentuh permukaannya', 'jujur mudah tebak pilih lintang film christopher nol njelimet terrence malick absurd petunjuk-petunjuknya sebar film karakter lintang cenderung serius manja kandidat calon suami langsung kerucut orang twist jelang film jelas sanding lamin sama memusingkan mudah potensi premis janji proses pengenalan karakter disia-siakan endri pelita pengenalan karakternya rasa minim sentuh muka'),
(576, 593, 'hampir sepanjang  jam setengah tidak ada sesuatu yang istimewa yang ditawarkan disini semuanya terkesan plain membosankan belum lagi akting-akting bodoh yang ditampilkan para pemainnya membuat saya berharap film ini untuk secepat mungkin berakhir dan berharap secepat mungkin menyaksikan ending-nya yang mungkin saja akan membuat saya terbangun namun apa yang ditunggu ternyata jauh diluar dugaan jujur saja saya terkejut namun bukan dalam arti yang postif saya terkejut karena seumur hidup belum pernah saya menonton sebuah thriller dengan ending sebodoh ini bahkan hanya dengan membaca judulnya saja kita akan tahu bagaimana akhir film kelas b satu ini', ' jam istimewa ditawarkan terkesan plain membosankan akting-akting bodoh ditampilkan pemainnya berharap film secepat berharap secepat menyaksikan ending-nya terbangun ditunggu diluar dugaan jujur terkejut arti postif terkejut seumur hidup menonton thriller ending sebodoh membaca judulnya film kelas b', ' jam istimewa tawar kesan plain bosan akting bodoh tampil main harap film cepat harap cepat saksi ending nya bangun tunggu luar duga jujur kejut arti postif kejut umur hidup tonton thriller ending bodoh baca judul film kelas b'),
(577, 594, 'sementara kemunculan tokoh hammond yang dimainkan pierce brosnan alih-alih menjadi daya tarik malah melemahkan tidak ada kejelasan karakter hammond siapa ia dan apa tugasnya hammond muncul seenaknya dengan kharisma khas brosnan selalu di saat dan momen yang terlalu pas membuat no escape kehilangan elemen realistisnya karakter hammond sama tidak jelas dengan latar belakang narasi utamanya yang sama sekali tidak pernah membahas mengapa dan kenapa situasi politik bisa memanas yang kita tahu para pemberontak tidak terima karena amerika menguasai sumber air dan mendirikan perusahaan di sana masalahnya apakah itu bisa menjadi motif kuat untuk memicu sebuah aksi pemberontakan meski set waktunya berlangsung cepat terhitung hanya satu malam tetapi melihat bagaimana pemerintah yang nyaris tidak bereaksi dan hanya muncul di awal konflik itu jelas menjadi sebuah plot hole yang mengganggu', 'kemunculan tokoh hammond dimainkan pierce brosnan alih-alih daya tarik melemahkan kejelasan karakter hammond tugasnya hammond muncul kharisma khas brosnan momen pas no escape kehilangan elemen realistisnya karakter hammond latar narasi utamanya membahas situasi politik memanas pemberontak terima amerika menguasai sumber air mendirikan perusahaan motif kuat memicu aksi pemberontakan set cepat terhitung malam pemerintah bereaksi muncul konflik plot hole mengganggu', 'muncul tokoh hammond main pierce brosnan alih-alih daya tarik lemah jelas karakter hammond tugas hammond muncul kharisma khas brosnan momen pas no escape hilang elemen realistis karakter hammond latar narasi utama bahas situasi politik memanas berontak terima amerika kuasa sumber air diri usaha motif kuat memicu aksi berontak set cepat hitung malam pemerintah reaksi muncul konflik plot hole ganggu'),
(578, 595, 'masalah utama nurse d bukan pada lemahnya naskah yang memang sangat-sangat cheesy atau efek d yang norak soal itu sudah sangat bisa dimaklumi tetapi bagaimana ketidak konsistenan penyutradaraan aarniokoski di awal-awal ia seperti ingin membungkus nurse dengan kemasan grindhouse seksi dan erotis bersama segala unsur gotik yang penyajiannya seakan-akan sengaja dibentuk dalam kemasan hororthriller murahan namun dalam perjalanannya semua itu menguap dan ironisnya menjadikan nurse benar-benar terasa murahan', 'utama nurse d lemahnya naskah sangat-sangat cheesy efek d norak dimaklumi ketidak konsistenan penyutradaraan aarniokoski awal-awal membungkus nurse kemasan grindhouse seksi erotis unsur gotik penyajiannya seakan-akan sengaja dibentuk kemasan hororthriller murahan perjalanannya menguap ironisnya menjadikan nurse benar-benar murahan', 'utama nurse d lemah naskah sangat cheesy efek d norak maklum tidak konsisten sutradara aarniokoski awal bungkus nurse kemas grindhouse seksi erotis unsur gotik saji akan sengaja bentuk kemas hororthriller murah jalan uap ironis jadi nurse benar murah'),
(579, 596, 'ada hal-hal yang tidak konsisten dan dipaksakan dalam perjalannya menuju akhir yang membuat plotnya berlubang di beberapa bagian belum lagi karakter-karakter baru yang seperti selalu muncul silih berganti seperti ingin membuat penontonnya bingung untuk menebak siapa pelakunya tanpa adanya latar belakang yang jelas entah karena sommers tidak lihai mengubah narasi novelnya ke naskah film tanpa dukungan koontz fyi sommers menulis sendiri naskahnya setelah membaca novelnya karena tidak mendapatkan hak cipta dari dean koontz sebelum akhirnya diberikan pada juni  lalu  atau sederhana memang novelnya sendiri yang tidak kuat saya tidak terlalu percaya yang ini menjadikan odd thomas kedodoran di setengah jam terakhir plus twist ending yang memaksa', 'hal-hal konsisten dipaksakan perjalannya plotnya berlubang karakter-karakter muncul silih berganti penontonnya bingung menebak pelakunya latar sommers lihai mengubah narasi novelnya naskah film dukungan koontz fyi sommers menulis naskahnya membaca novelnya hak cipta dean koontz juni   sederhana novelnya kuat percaya menjadikan odd thomas kedodoran jam plus twist ending memaksa', 'hal-hal konsisten paksa jalan plot lubang karakter-karakter muncul silih ganti penontonnya bingung tebak laku latar sommers lihai ubah narasi novel naskah film dukung koontz fyi sommers tulis naskah baca novel hak cipta de koontz juni   sederhana novel kuat percaya jadi odd thomas dodor jam plus twist ending memaksa'),
(580, 597, 'tempo yang dibangun sudah pas tidak terlalu lambat dan tidak kelewat cepat namun entah kenapa masih terkesan dangkal dan kurang menyentuh mitos tentang celtic creature yang menjadi tema utama sepertinya hanya dijadikan pajangan disepanjang film pertanyaan tentang siapa sebenarnya ondine memang terjawab di akhir film namun sekali lagi tidak membuat film ini menjadi istimewa karenanya', 'tempo dibangun pas lambat kelewat cepat terkesan dangkal menyentuh mitos celtic creature tema utama dijadikan pajangan disepanjang film ondine terjawab film film istimewa', 'tempo bangun pas lambat lewat cepat kesan dangkal sentuh mitos celtic creature tema utama jadi pajang disepanjang film ondine jawab film film istimewa'),
(581, 598, 'bukan pilihan romcom yang tepat untuk menghabiskan malam valentine bersama pasanganmu terlalu medioker dan mudah dilupakan tanpa sebuah romantisme dan chemistry yang kuat untung saja masih ada italia dan wajah cantik tomei yang setidaknya mampu membuat saya atau mungkin penonton pria lainnya mampu bertahan menyaksikan only you sampai akhir', 'pilihan romcom menghabiskan malam valentine pasanganmu medioker mudah dilupakan romantisme chemistry kuat untung italia wajah cantik tomei penonton pria bertahan menyaksikan only you', 'pilih romcom habis malam valentine pasang medioker mudah lupa romantisme chemistry kuat untung italia wajah cantik tomei penonton pria tahan saksi only you'),
(582, 599, 'pasca opening-nya tensinya langsung melorot drastis meskipun tidak sampai mengerucutkan niatmu untuk melihat akhirnya lpez-gallego jelas harus banyak berterima kasih kepada sharlto copley yang menjadi alasan besar kenapa open grave masih layak ditonton selain misterinya dan tentu saja ending yang kamu tunggu-tunggu sebenarnya tidak perlu menunggu sampai habis untuk mencerna semuanya toh lpez-gallego terlalu baik untuk memberikan banyak petunjuk dan flashback tentang apa yang sebenarnya terjadi dan ketika akhir itu datang hasilnya tidak terlalu mengejutkan lagi sebuah akhir yang ternyata sangat familiar hanya saja seperti nasib para karakternya kita seperti dibuat tidak tahu apa-apa dari awal', 'pasca opening-nya tensinya langsung melorot drastis mengerucutkan niatmu lpez-gallego berterima kasih sharlto copley alasan open grave layak ditonton misterinya ending tunggu-tunggu menunggu habis mencerna lpez-gallego petunjuk flashback hasilnya mengejutkan familiar nasib karakternya apa-apa', 'pasca opening-nya tensi langsung lorot drastis kerucut niat lpez-gallego terima kasih sharlto copley alas open grave layak tonton misteri ending tunggu-tunggu tunggu habis cerna lpez-gallego tunjuk flashback hasil kejut familiar nasib karakternya apa-apa'),
(583, 600, 'jujur meskipun mengakui sebagai fans beratnya saya tidak pernah berharap banyak pada instalemen terbaru pa ini apalagi mengingat ini sebuah spin-off dan benar saja the marked ones mengecewakan termasuk buat penonton yang memuja franchise ini macam saya tidak ada hal baru di sini seperti berjalan di tempat yang sama semuanya sudah pernah kamu lihat parahnya the marked ones tersaji dengan kualitas keangkeran yang menurun jauh  bahkan dari seri ke-empatnya sekalipun yang digadang-gadang sebagai seri terburuk', 'jujur mengakui fans beratnya berharap instalemen terbaru pa spin-off the marked ones mengecewakan penonton memuja franchise berjalan lihat parahnya the marked ones tersaji kualitas keangkeran menurun  seri ke-empatnya digadang-gadang seri terburuk', 'jujur aku fans berat harap instalemen baru pa spin-off the marked ones kecewa penonton memuja franchise jalan lihat parah the marked ones saji kualitas angker turun  seri ke-empatnya digadang-gadang seri buruk'),
(584, 601, 'passion jelas kurang unsur erotisnya ia terasa lebih berat ke arah misteri dan crime yang sempit termasuk mengeksploitasi pesona mcadams dan repace namun sayang karakter-karakter mereka seperti kurang punya motivasi dan datar passion terasa kecil belum lagi saya menyebut banyak kejutan-kejutan murahan macam sekuen mimpi yang berulang-ulang dan twist yang bisa dikatakan sedikit bodoh ', 'passion unsur erotisnya berat arah misteri crime sempit mengeksploitasi pesona mcadams repace sayang karakter-karakter motivasi datar passion menyebut kejutan-kejutan murahan sekuen mimpi berulang-ulang twist bodoh ', 'passion unsur erotis berat arah misteri crime sempit eksploitasi pesona mcadams repace sayang karakter motivasi datar passion sebut kejutan murah sekuen mimpi ulang twist bodoh '),
(585, 602, 'jujur saya menikmati setiap lagu-lagu modifikasi tidak pernah menyangka bahwa the sign legendarisnyaace of base bisa dimodif seperti itu yang dihadirkan di sini mereka sungguh terdengar keren dan itu jelas adalah bagian terbaiknya tetapi tetap saja sebagai sebuah film utuh ia tidak boleh hanya bergantung pada satu elemen saja sementara elemen lainnya tidak bekerja maksimal maka inilah pitch perfect sebuah drama komedi kompetisi dengan cerita tipis yang punya humor-humor garing romansa dangkal dan banyak karakter-karakter bodoh tetapi jika kamu mencari tontonan seringan kapas dan sedangkal selokan depan rumah dengan kualitas musikalitas yang bagus silahkan', 'jujur menikmati lagu-lagu modifikasi menyangka the sign legendarisnyaace of base dimodif dihadirkan sungguh terdengar keren terbaiknya film utuh bergantung elemen elemen maksimal pitch perfect drama komedi kompetisi cerita tipis humor-humor garing romansa dangkal karakter-karakter bodoh mencari tontonan seringan kapas sedangkal selokan rumah kualitas musikalitas bagus silahkan', 'jujur nikmat lagu-lagu modifikasi sangka the sign legendarisnyaace of base dimodif hadir sungguh dengar keren baik film utuh gantung elemen elemen maksimal pitch perfect drama komedi kompetisi cerita tipis humor-humor garing romansa dangkal karakter-karakter bodoh cari tonton sering kapas dangkal selokan rumah kualitas musikalitas bagus silah'),
(586, 603, 'tidak ada spirit dan antusiasme besar dari para bellas seperti yang pernah dihadirkan di seri pertamanya semua terkesan canggung termasuk beberapa guyonan garing yang masih mengandalkan rabel wilson dan beberapa anggota bellas macam lilly onakurama pendatang baru si anak hispanik flo dengan segala keanehan komedinya', 'spirit antusiasme bellas dihadirkan seri pertamanya terkesan canggung guyonan garing mengandalkan rabel wilson anggota bellas lilly onakurama pendatang si anak hispanik flo keanehan komedinya', 'spirit antusiasme bellas hadir seri pertama kesan canggung guyon garing andal rabel wilson anggota bellas lilly onakurama datang si anak hispanik flo aneh komedi'),
(587, 604, 'harus diakui narasinya setipis kertas dan pengembangan karakternya nyaris nol termasuk di dalamnya romansa antara sam brenner dan lieutenant colonel violet van patten yang dimainkan michelle monaghan tetapi ini bukan jenis film yang mesti kamu anggap terlalu serius dari segi penceritaan apalagi karakter', 'diakui narasinya setipis kertas pengembangan karakternya nol dalamnya romansa sam brenner lieutenant colonel violet van patten dimainkan michelle monaghan jenis film mesti anggap serius segi penceritaan karakter', 'aku narasi tipis kertas kembang karakter nol dalam romansa sam brenner lieutenant colonel violet van patten main michelle monaghan jenis film mesti anggap serius segi cerita karakter'),
(588, 605, 'ah sayang sekali scott steward tampaknya terlalu percaya dengan diri membuang sebagaian besar elemen-elemen penting dalam komiknya meninggalkan priest telanjang dengan segala kekurangan-kekurangannya baik dalam naskah maupun bagaimana menghadirkan momen-momen aksinya yang seharusnya bisa menjadi bagian paling menghibur disini yah untuk menghibur anda priest setidaknya sedikit lebih baik dari legion', 'ah sayang scott steward percaya membuang sebagaian elemen-elemen komiknya meninggalkan priest telanjang kekurangan-kekurangannya naskah menghadirkan momen-momen aksinya menghibur yah menghibur priest legion', 'ah sayang scott steward percaya buang bagai elemen-elemen komik tinggal priest telanjang kekurangan-kekurangannya naskah hadir momen-momen aksi hibur yah hibur priest legion'),
(589, 606, 'jujur saja untuk sebuah film yang diadaptasi dari novel secara keseluruhan terlepas dari twistnya cerita primal fear memiliki lubang yang cukup banyak walaupun itu terbatas hanya pada subplotnya saja namun cukup menganggu banyak hal yang ditinggalkan mengambang tanpa penjelasan begitu saja seakan akan subplot tersebut hanya digunakan untuk memperpanjang durasi film tanpa berpengaruh besar pada cerita utamanya', 'jujur film diadaptasi novel terlepas twistnya cerita primal fear memiliki lubang terbatas subplotnya menganggu ditinggalkan mengambang penjelasan seakan subplot memperpanjang durasi film berpengaruh cerita utamanya', 'jujur film adaptasi novel lepas twistnya cerita primal fear milik lubang batas subplotnya menganggu tinggal ambang jelas akan subplot panjang durasi film pengaruh cerita utama'),
(590, 607, 'dengan premis yang menantang dan teknis sinematik serumit dan semengagumkan itu itu pvc- seharusnya bisa tampil perkasa sayang pada akhirnya thriller satu ini tidak pernah berhasil membuat kita benar-benar merasakan sebuah sensai ketegangan yang seharusnya di sepanjang kurang lebih satu jam setengah durasinya ya jujur saja saya memang kagum dengan bagaimana stathoulopoulos mempresentasikannya tapi disaat bersamaan ia juga berhasil membuat saya cukup frustasi disaat menontonnya', 'premis menantang teknis sinematik serumit semengagumkan pvc- tampil perkasa sayang thriller berhasil benar-benar merasakan sensai ketegangan jam durasinya ya jujur kagum stathoulopoulos mempresentasikannya disaat bersamaan berhasil frustasi disaat menontonnya', 'premis tantang teknis sinematik rumit semengagumkan pvc- tampil perkasa sayang thriller hasil benar-benar rasa sensai tegang jam durasi ya jujur kagum stathoulopoulos presentasi saat sama hasil frustasi saat tonton'),
(591, 608, 'lalu datanglah bencana itu dipertengahan naskahnya menjadi amburadul entah apa yang terjadi ketika robert schwentke mencoba mencampurkan alam baka dan dunia manusia menjadi satu ya manusia dapat melihat apa yang dilakukan ripd meskipun senjata mereka terlihat seperti pisang dan yang lebih para dari cgi setengah matang untuk ukuran film berbiaya ratusan juta dan momen aksi yang mudah terlupakan adalah plot hole besar', 'datanglah bencana dipertengahan naskahnya amburadul robert schwentke mencoba mencampurkan alam baka dunia manusia ya manusia ripd senjata pisang cgi matang ukuran film berbiaya ratusan juta momen aksi mudah terlupakan plot hole', 'datang bencana tengah naskah amburadul robert schwentke coba campur alam baka dunia manusia ya manusia ripd senjata pisang cgi matang ukur film biaya ratus juta momen aksi mudah lupa plot hole'),
(592, 609, 'jujur saja horor satu ini termasuk salah satu mockumentary yang buruk pawan kripalani sebagai sutradara telah gagal mengeksekusi setiap momen didalamnya niatnya sih boleh saja besar ingin menampilkan ragini mms layaknya sebuah crossover antara paranormal activity dan the blair witch project dengan berusaha menampilkan tampilan indoor maupun outdoor se creepy mungkin sayang usahanya tidak berhasil semua yang disajikan disini terkesan terburu-buru asal-asalan dan terlihat murahan penempatan kamera-kamera cctv kelewat banyak dan tidak logis malah menambah kesan tidak realistis penampakan mahkluk halusnya beserta segala gangguan-gangguannya terlalu diobral habis-habisan sejak keduanya menginjak rumah itu sedari pertama kali parahnya lagi kripalani juga nyaris tidak mampu menghadirkan sesuatu yang menakutkan disini kecuali setting rumah itu sendiri', 'jujur horor salah mockumentary buruk pawan kripalani sutradara gagal mengeksekusi momen didalamnya niatnya sih menampilkan ragini mms layaknya crossover paranormal activity the blair witch project berusaha menampilkan tampilan indoor outdoor creepy sayang usahanya berhasil disajikan terkesan terburu-buru asal-asalan murahan penempatan kamera-kamera cctv kelewat logis menambah kesan realistis penampakan mahkluk halusnya beserta gangguan-gangguannya diobral habis-habisan menginjak rumah sedari kali parahnya kripalani menghadirkan menakutkan kecuali setting rumah', 'jujur horor salah mockumentary buruk pawan kripalani sutradara gagal eksekusi momen dalam niat sih tampil ragini mms layak crossover paranormal activity the blair witch project usaha tampil tampil indoor outdoor creepy sayang usaha hasil saji kesan buru asal murah tempat kamera cctv lewat logis tambah kesan realistis tampak mahkluk halus serta ganggu obral habis injak rumah dari kali parah kripalani hadir takut kecuali setting rumah'),
(593, 610, 'overall rec mungkin adalah salah satu dari sekian banyak sequel mengecewakan yang juga seharusnya tidak perlu dibuat karena film pertamanya sebenarnya sudah berhasil ditutup dengan sangat baik namun apa daya lagi-lagi faktor komersial untuk mengeruk untung lebih banyak dengan tidak diimbangi dengan kualitas yang memadai menjadi noda besar pada film ini mudah-mudahan saja nanti seri ke- nya bisa tampil lebih baik dari seri keduanya ini', 'overall rec salah sekian sequel mengecewakan film pertamanya berhasil ditutup daya lagi-lagi faktor komersial mengeruk untung diimbangi kualitas memadai noda film mudah-mudahan seri ke- nya tampil seri', 'overall rec salah kian sequel kecewa film pertama hasil tutup daya lagi-lagi faktor komersial keruk untung imbang kualitas memadai noda film mudah-mudahan seri ke- nya tampil seri'),
(594, 611, 'bagaimana dengan ceritanya seperti yang sudah dijelaskan sedikit diatas tema cerita seperti ini sudah sering diangkat dalam sebuah film oleh sineas-sineas dunia sehingga tidak ada sesuatu yang bisa diandalkan dalam ceritanya kalau tidak mau dibilang membosankan dan tidak fokus terhadap masalah yang ingin disampaikan mungkin satu-satunya yang menyelamatkan film ini sehingga masih layak ditonton hingga akhir adalah endingnya yang cukup powerfull ya akhir yang luar biasa untuk ukuran film yang tergolong biasa-biasa ini benar-benar membuat penontonnya bak tersengat listrik dan membangunkan mereka dari kebosanan yang melanda hampir kurang lebih  jam overall untuk sebuah film yang tidak isitmewa yang hanya mengandalkan seorang robert pattinson semata sebagai nilai jual terbesar remember me tampil terlalu lama dan membosankan tampaknya r-pratz masih harus giat belajar akting lebih banyak lagi jika tidak mau dibilang sebagai aktor yang hanya mengandalkan tampang semata', 'ceritanya diatas tema cerita diangkat film sineas-sineas dunia diandalkan ceritanya dibilang membosankan fokus satu-satunya menyelamatkan film layak ditonton endingnya powerfull ya ukuran film tergolong biasa-biasa benar-benar penontonnya bak tersengat listrik membangunkan kebosanan melanda  jam overall film isitmewa mengandalkan robert pattinson nilai jual terbesar remember me tampil membosankan r-pratz giat belajar akting dibilang aktor mengandalkan tampang', 'cerita atas tema cerita angkat film sineas-sineas dunia andal cerita bilang bosan fokus satu-satunya selamat film layak tonton endingnya powerfull ya ukur film golong biasa-biasa benar-benar penontonnya bak sengat listrik bangun bosan landa  jam overall film isitmewa andal robert pattinson nilai jual besar remember me tampil bosan r-pratz giat belajar akting bilang aktor andal tampang'),
(595, 612, 'jadi dengan menurunkan ekpektasi saya serendah-rendahnya saya membaranikan diri untuk duduk dan menonton kisah terbaru petualangan alice di negeri para zombie ini seperti yang sudah bisa ditebak memang tidak ada hal yang baru yang ditawarkan anderson dalam resident evil afterlife terutama dari segi cerita yang seakan-akan mengulang kembali formula yang sama dengan seri-seri sebelumnya yah seperti yang sudah saya bilang tadi saya sama sekali tidak terkejut dan sangat memaklumi kekonsistenan anderson dalam menggarap ceritan dan dialog-dialog yang sangat dangkal dan klise ini bahkan judul resident evil sendiri sepertinya sama sekali tidak mewakili kisah di versi game-nya jadi kita langsung saja membahas senjata utama film yang membuat film ini terasa istimewa yaitu pengunaan d fusion camera system', 'menurunkan ekpektasi serendah-rendahnya membaranikan duduk menonton kisah terbaru petualangan alice negeri zombie ditebak ditawarkan anderson resident evil afterlife segi cerita seakan-akan mengulang formula seri-seri yah bilang terkejut memaklumi kekonsistenan anderson menggarap ceritan dialog-dialog dangkal klise judul resident evil mewakili kisah versi game-nya langsung membahas senjata utama film film istimewa pengunaan d fusion camera system', 'turun ekpektasi serendah-rendahnya membaranikan duduk tonton kisah baru tualang alice neger zombie tebak ditawarkan anderson resident evil afterlife segi cerita seakan-akan ulang formula seri-seri yah bilang kejut maklum konsisten anderson garap ceritan dialog-dialog dangkal klise judul resident evil wakil kisah versi game-nya langsung bahas senjata utama film film istimewa pengunaan d fusion camera system');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(596, 613, 'ya retreat membosankan dan terlalu lama bergerak naskahnya tidak sekuat idenya eksekusinya lemah hingga ia tidak pernah mampu mencapai potensi ketegangan yang semestinya bisa jauh lebih baik walaupun harus diakui juga tibbets sempat membuat saya mengalami keraguan sejenak tentang kebenaran kabar kiamat yang dihebuskan oleh karakter jack disini dan senang mengetahui endingnya mampu mengobati kekecewaan saya dengan sedikit twist yang cerdas tidak ada yang menonjol dari ketiga karakter utamanya cillian murphy nyaris bermain tanpa emosi dan pemilihan jamie bell adalah sebuah kesalahan bukan karena aktingnya buruk tapi ia terlalu lugu untuk kemudian didapuk sebagai tokoh antagonis disini', 'ya retreat membosankan bergerak naskahnya sekuat idenya eksekusinya lemah mencapai potensi ketegangan semestinya diakui tibbets mengalami keraguan kebenaran kabar kiamat dihebuskan karakter jack senang endingnya mengobati kekecewaan twist cerdas menonjol ketiga karakter utamanya cillian murphy bermain emosi pemilihan jamie bell kesalahan aktingnya buruk lugu didapuk tokoh antagonis', 'ya retreat bosan gerak naskah kuat ide eksekusi lemah capai potensi tegang mesti aku tibbets alami ragu benar kabar kiamat dihebuskan karakter jack senang endingnya obat kecewa twist cerdas tonjol tiga karakter utama cillian murphy main emosi pemilihan jamie bell salah aktingnya buruk lugu didapuk tokoh antagonis'),
(597, 614, 'kualitas narasinya mungkin bukan yang terbaik namun sudah cukup untuk menegaskan kembali franchise ini masih punya daya tarik dan ia tidak sebodoh seri keduanya riddick juga banyak dihiasi dengan dialog-dialog canggung tetapi kamu pastinya tidak menonton riddick untuk mencari dialog pintar bukan terlalu banyak karakter tanpa ada waktu memberikan mereka kedalaman tidak seperti pitch black yang membaginya sama rata di sini hanya riddick yang berkuasa penuh', 'kualitas narasinya terbaik franchise daya tarik sebodoh seri riddick dihiasi dialog-dialog canggung pastinya menonton riddick mencari dialog pintar karakter kedalaman pitch black membaginya riddick berkuasa penuh', 'kualitas narasi baik franchise daya tarik bodoh seri riddick hias dialog canggung pasti tonton riddick cari dialog pintar karakter dalam pitch black bagi riddick kuasa penuh'),
(598, 615, 'ya memang sabotage sendiri memang masih tidak jauh-jauh dari otot senjata berat dialog humor one liner dan sedikit aksi tetapi ayer ingin menjual misteri dan sisi psikologis karakternya ketimbang parade aksi hasilnya sabotage dengan kandungan misteri gelap dan kadar violence cukup vulgar terlihat seperti sebuah horor slasher beralut kemachoan yang sayang tidak mampu berjalan beriringan dengan sempurna', 'ya sabotage jauh-jauh otot senjata berat dialog humor one liner aksi ayer menjual misteri sisi psikologis karakternya ketimbang parade aksi hasilnya sabotage kandungan misteri gelap kadar violence vulgar horor slasher beralut kemachoan sayang berjalan beriringan sempurna', 'ya sabotage jauh otot senjata berat dialog humor one liner aksi ayer jual misteri sisi psikologis karakter ketimbang parade aksi hasil sabotage kandung misteri gelap kadar violence vulgar horor slasher beralut kemachoan sayang jalan iring sempurna'),
(599, 616, 'tidak usahlah membahas plotnya yang tipis dan serba memaksakan diri kita tahu benar dari awal bahwa sadako vs kayako memang akan berakhir menggelikan ketimbang mengerikan bersama humor-humor yang datang dari celetukan-celetukan bodoh karakternya serta momen-momen kematian yang terkesan berlebihan alias over the top', 'usahlah membahas plotnya tipis serba memaksakan sadako vs kayako menggelikan ketimbang mengerikan humor-humor celetukan-celetukan bodoh karakternya serta momen-momen kematian terkesan alias over the top', 'usah bahas plot tipis serba paksa sadako vs kayako geli ketimbang erik humor celetukan bodoh karakter serta momen mati kesan alias over the top'),
(600, 617, 'polisi korup uang kotor gengster baku hantam peluru di mana mana dan kejar-kejaran dengan kualitas cerita apa adanya safe seperti kebanyakan film statham lainnya yang memang didesain cepat untuk sekedar menjadi suguhan murni hiburan buat penontonnya sayang tidak bekerja terlalu baik bahkan untuk sekedar menikmati porsi aksi tanpa otaknya yang tak pernah bisa mencapai kadar maksimumnya', 'polisi korup uang kotor gengster baku hantam peluru kejar-kejaran kualitas cerita safe kebanyakan film statham didesain cepat sekedar suguhan murni hiburan penontonnya sayang sekedar menikmati porsi aksi otaknya mencapai kadar maksimumnya', 'polisi korup uang kotor gengster baku hantam peluru kejar kualitas cerita safe banyak film statham desain cepat sekedar suguh murni hibur tonton sayang sekedar nikmat porsi aksi otak capai kadar maksimum'),
(603, 620, 'jika kamu menyukai baraka dapat saya pastikan kamu akan menyukai samsara baik baraka ataupun samsara keduanya merupakan sebuah masterpiece yang jangan sampai di lewatkan sebuah paket pengalaman sinematik yang tak bisa kamu saksikan satu kali saja akhir kata samsara adalah salah satu film dengan visual yang memukau dalam sejarah perfilman dunia', 'menyukai baraka pastikan menyukai samsara baraka samsara masterpiece lewatkan paket pengalaman sinematik saksikan kali samsara salah film visual memukau sejarah perfilman dunia', 'suka baraka pasti suka samsara baraka samsara masterpiece lewat paket alam sinematik saksi kali samsara salah film visual pukau sejarah film dunia'),
(604, 621, 'season of the witch sesungguhnya tidak lebih dari sebuah kisah fantasi medioker yang lemah nyaris di semua sisinya sebuah film akan dengan mudah dilupakan penontonnya sama persis seperti apa yang pernah dilakukan cena terhadap kate beckinsale pada whiteout lalu meskipun kali ini tidaklah sampai seburuk itu', 'season of the witch sesungguhnya kisah fantasi medioker lemah sisinya film mudah dilupakan penontonnya persis cena kate beckinsale whiteout kali seburuk', 'season of the witch sungguh kisah fantasi medioker lemah sisi film mudah lupa tonton persis cena kate beckinsale whiteout kali buruk'),
(605, 622, 'sekuel yang buruk dari seri terbaik jika kamu bukan fans berat video game-nya mungkin akan sulit menikmati apa yang akan tersaji di menit durasinya yang diisi oleh naskah yang compang camping horor yang lembek d yang tidak bekerja dan karakter yang lemah kabar baiknya open ending-nya membuka kemungkinan sekuel lagi di masa depan', 'sekuel buruk seri terbaik fans berat video game-nya sulit menikmati tersaji menit durasinya diisi naskah compang camping horor lembek d karakter lemah kabar baiknya open ending-nya membuka sekuel', 'sekuel buruk seri baik fans berat video game nya sulit nikmat saji menit durasi isi naskah compang camping horor lembek d karakter lemah kabar baik open ending nya buka sekuel'),
(607, 624, 'mocku horor yang terlalu ambisius eksekusi buruk membosankan akting murahan sama sekali tidak mencerminkan judulnya bahkan negara-negara tetangganya saja mampu memberikan tontonan yang lebih baik ketimbang ini lihat haunted changi singapura atau keramat dari negara kita yah sisi positifnya setidaknya nayato dan terekam miliknya akan mendapat saingan tangguh kali ini', 'mocku horor ambisius eksekusi buruk membosankan akting murahan mencerminkan judulnya negara-negara tetangganya tontonan ketimbang lihat haunted changi singapura keramat negara yah sisi positifnya nayato terekam miliknya saingan tangguh kali', 'mocku horor ambisius eksekusi buruk bosan akting murah cermin judul negara tetangga tonton ketimbang lihat haunted changi singapura keramat negara yah sisi positif nayato rekam milik saing tangguh kali'),
(608, 625, 'ini bukan sekedar kisah hidup menarik tentang seorang pawang boneka bernama kevin clash dan bagaimana ia menjadi elmo yang fenomenal itu tapi being elmo a puppeteers journey juga sebuah sajian dokumentar inspiratif manis yang tersaji dengan sederhana namun mampu menyentuh hati para penontonnya', 'sekedar kisah hidup menarik pawang boneka bernama kevin clash elmo fenomenal being elmo a puppeteers journey sajian dokumentar inspiratif manis tersaji sederhana menyentuh hati penontonnya', 'sekedar kisah hidup tarik pawang boneka nama kevin clash elmo fenomenal being elmo a puppeteers journey saji dokumentar inspiratif manis saji sederhana sentuh hati tonton'),
(609, 626, 'story percintaan yang bermasalah masih diperparah dengan penampilan ario bayu yang mengecewakan fisik dan parasnya mungkin menunjang tetapi pemeran satrio dalam catatan harian si boy itu gagal menghadirkan kharisma besar seorang pemimpin bangsa yang disegani hingga sekarang kecuali pada bagian rayu-merayunya ario bayu tidak pernah berhasil mengundang rasa simpati dalam setiap momennya', 'story percintaan bermasalah diperparah penampilan ario bayu mengecewakan fisik parasnya menunjang pemeran satrio catatan harian si boy gagal menghadirkan kharisma pemimpin bangsa disegani kecuali rayu-merayunya ario bayu berhasil mengundang simpati momennya', 'story cinta masa parah tampil ario bayu kecewa fisik paras tunjang peran satrio catat hari si boy gagal hadir kharisma pimpin bangsa segani kecuali rayu ario bayu hasil undang simpati momen'),
(610, 627, 'harapan akan suguhan bond pemungkas era craig yang berkesan sepertinya gagal dihadirkan mendes kali ini ya ekspektasi akan narasi yang lebih dalam dari para pendahulunya ternyata tidak terbukti meski sebenarnya potensi menjadi besar ada di dalamnya coba cek trailer yang menampilkan suasana suram yang seakan-akan menitik beratkan pada pribadi dan masa lalu bond serta rahasia besar yang akan terkuak nanti tetapi dalam perjalanannya tidak demikian setelah - menit penontonnya perlahan akan menyadari bahwa naskah keroyokan garapan john logan neal purvis robert wade dan jez butterworth ini menjadi terlalu dangkal jauh dari yang diharapkan', 'harapan suguhan bond pemungkas era craig berkesan gagal dihadirkan mendes kali ya ekspektasi narasi pendahulunya terbukti potensi dalamnya coba cek trailer menampilkan suasana suram seakan-akan menitik beratkan pribadi bond serta rahasia terkuak perjalanannya - menit penontonnya perlahan menyadari naskah keroyokan garapan john logan neal purvis robert wade jez butterworth dangkal diharapkan', 'harap suguh bond pungkas era craig kesan gagal hadir mendes kali ya ekspektasi narasi dahulu bukti potensi dalam coba cek trailer tampil suasana suram akan titik berat pribadi bond serta rahasia kuak jalan - menit tonton perlahan sadar naskah keroyok garap john log neal purvis robert wade jez butterworth dangkal harap'),
(611, 628, 'pertunjukan utamanya memang misteri dan twistnya tetapi bukan berarti tidak ada karakter menarik di dalamnya setiap tokohnya punya motif terselubung setiap karakternya punya masa lalu yang ingin dihilangkan sayang belen rueda tidak maksimal karena tuntutan perannya yang harus membuatnya terkesan misterius namun perseteruan jose coronado dan hugo silva di sepanjang film itu bisa menjadi highlight tersendiri terutama bagaimana satu dengan yang lainnya berusaha adu pintar dengan motif berbeda', 'pertunjukan utamanya misteri twistnya karakter menarik dalamnya tokohnya motif terselubung karakternya dihilangkan sayang belen rueda maksimal tuntutan perannya membuatnya terkesan misterius perseteruan jose coronado hugo silva film highlight tersendiri berusaha adu pintar motif berbeda', 'tunjuk utama misteri twistnya karakter tarik dalam tokoh motif selubung karakter hilang sayang belen rueda maksimal tuntut peran buat kesan misterius seteru jose coronado hugo silva film highlight sendiri usaha adu pintar motif beda'),
(612, 629, 'sebenarnya tidak ada yang salah dengan perubahan plot-nya yang menghilangkan unsur sesualitasnya sama sekali pada akhirnya bahkan kalau mau jujur jlo pun bermain tidak buruk jauh lebih baik dari penampilan cast lain tetapi apa yang dilakukan cohen ini adalah kesalahan fatal ketika ia seperti terlalu cepat merubah narasi the boy next door dari thriller erotis menjadi sekedar thriller medioker semata tanpa proses yang kuat', 'salah perubahan plot-nya menghilangkan unsur sesualitasnya jujur jlo bermain buruk penampilan cast cohen kesalahan fatal cepat merubah narasi the boy next door thriller erotis sekedar thriller medioker proses kuat', 'salah ubah plot nya hilang unsur sesualitasnya jujur jlo main buruk tampil cast cohen salah fatal cepat rubah narasi the boy next door thriller erotis sekedar thriller medioker proses kuat'),
(613, 630, 'sesuai judulnya the cat akan dipenuhi dengan banyak kucing bertampang lucu nan menggemaskan namun mereka juga terlihat mengerikan disaat bersamaan ada hantu juga disini yang semakin memeriahkan horor seung-wook ini tapi naas selain premisnya yang menarik misteri yang membuat penasaran atau akting hebat dari para kucing ya serius mereka tampil lebih baik dari para pemain manusia tidak ada lagi yang bisa ditawarkan salah satu entri inafff ini dengan segera ia akan mudah dilupakan begitu anda selesai menontonnya', 'sesuai judulnya the cat dipenuhi kucing bertampang lucu nan menggemaskan mengerikan disaat bersamaan hantu memeriahkan horor seung-wook naas premisnya menarik misteri penasaran akting hebat kucing ya serius tampil pemain manusia ditawarkan salah entri inafff mudah dilupakan selesai menontonnya', 'sesuai judul the cat penuh kucing tampang lucu nan gemas erik saat sama hantu memeriahkan horor seung wook naas premis tarik misteri penasaran akting hebat kucing ya serius tampil main manusia tawar salah entri inafff mudah lupa selesai tonton'),
(614, 631, 'konsepnya bagus memadukan horor supranatural time travel dan slasher walau tidak lagi baru tapi yang terpenting the caller sudah bekerja baik memberikan tontonan yang memikat efektif dalam menghadirkan teror dan kengerian layakya horor sejati ya masih ada kekurangan-kekurangan didalamnya tidak menjadi masalah besar jika anda tidak terlalu serius memikirkannya siapa juga sih yang bisa membuat film sempurna apalagi untuk sebuah horor', 'konsepnya bagus memadukan horor supranatural time travel slasher terpenting the caller tontonan memikat efektif menghadirkan teror kengerian layakya horor sejati ya kekurangan-kekurangan didalamnya serius memikirkannya sih film sempurna horor', 'konsep bagus madu horor supranatural time travel slasher penting the caller tonton mikat efektif hadir teror ngeri layakya horor sejati ya kekurangan dalam serius pikir sih film sempurna horor'),
(616, 633, 'overall the chronicles of narnia the voyage of the dawn treader mungkin terlihat jauh lebih sederhana ketimbang dua predesesornya namun tidak membuat epik petualangan fantasi satu ini kehilangan pesonanya sebagai sebuah sajian ringan dan menghibur yang dapat dengan mudah disantap oleh seluruh anggota keluarga sayangnya kita harus berpisah dengan lucy dan edmund disini karakter-karakter manusia terakhir yang menjadi benang merah di dua instalemen sebelumnya namun setidaknya suka tidak suka kita sudah diperkenalkan oleh seorang pahlawan baru penerus kisah narnia dalam diri eustace', 'overall the chronicles of narnia the voyage of the dawn treader sederhana ketimbang predesesornya epik petualangan fantasi kehilangan pesonanya sajian ringan menghibur mudah disantap anggota keluarga sayangnya berpisah lucy edmund karakter-karakter manusia benang merah instalemen suka suka diperkenalkan pahlawan penerus kisah narnia eustace', 'overall the chronicles of narnia the voyage of the dawn treader sederhana ketimbang predesesornya epik tualang fantasi hilang pesona saji ringan hibur mudah santap anggota keluarga sayang pisah lucy edmund karakter manusia benang merah instalemen suka suka kenal pahlawan terus kisah narnia eustace'),
(617, 634, 'sekali lagi tim burton membuktikan kapasitasnya sebagai penghasil film berkualitas walaupun hanya menjadi produser namun jelas sekali sentuhannya cukup dominan disini membuat  menjadi salah satu animasi terbaik dan beda pada tahun  lalu', 'tim burton membuktikan kapasitasnya penghasil film berkualitas produser sentuhannya dominan  salah animasi terbaik beda ', 'tim burton bukti kapasitas hasil film kualitas produser sentuh dominan  salah animasi baik beda '),
(618, 635, 'layaknya kebanyakan film drama jepang kisah  promises to my dog juga mengalir pelan dan lembut dipenuhi dengan visual dan sinematografi indah dan lantunan musik-musik klasik penggugah emosi dukungan akting dari pemain-pemainnya seperti artis cantik rena tanaka sebagai sang majikan juga membuat film satu ini berjalan dengan manis hingga akhir', 'layaknya kebanyakan film drama jepang kisah  promises to my dog mengalir pelan lembut dipenuhi visual sinematografi indah lantunan musik-musik klasik penggugah emosi dukungan akting pemain-pemainnya artis cantik rena tanaka sang majikan film berjalan manis', 'layak banyak film drama jepang kisah  promises to my dog alir pelan lembut penuh visual sinematografi indah lantun musik klasik gugah emosi dukung akting main artis cantik rena tanaka sang majikan film jalan manis'),
(619, 636, 'pada akhirnya  stories of me and my wife tidak terlalu berbeda jauh dengan kebanyakan melodrama tearjerker lainnya ia mampu bergerak indah lembut dengan segala kisah cintanya mengharu biru melukiskan perjuangan seorang suami untuk membahagiakan istri tercintanya yang sekarat dengan caranya sendiri yang tidak biasa walaupun berujung klise dan jika ada satu-satunya yang kemudian menjadi garis pembeda dengan kebanyakan film bertema sama lainnya adalah bagaimana dasar kisah nyata menarik dan sangat romantis serta bagaimana unsur fiksi ilmiah yang berperan besar didalamnya', ' stories of me and my wife berbeda kebanyakan melodrama tearjerker bergerak indah lembut kisah cintanya mengharu biru melukiskan perjuangan suami membahagiakan istri tercintanya sekarat berujung klise satu-satunya garis pembeda kebanyakan film bertema dasar kisah nyata menarik romantis serta unsur fiksi ilmiah berperan didalamnya', ' stories of me and my wife beda banyak melodrama tearjerker gerak indah lembut kisah cinta haru biru lukis juang suami bahagia istri cinta sekarat ujung klise satu garis beda banyak film tema dasar kisah nyata tarik romantis serta unsur fiksi ilmiah peran dalam'),
(620, 637, 'menarik tentu memilih cabang olahraga tak terkenal untuk dijadikan bahan jualannya bahkan seingat saya hollywood pun tidak punya persediaan sport movie macam ini jadi sekali lagi ini menarik secara konsep ia memang tidak jauh-jauh dari drama-drama olahraga kebanyakan mengusung cerita perjuangan untuk menjadi yang terbaik namun kombinasi kisah nyata dan casting bagus bisa membuat  srikandi menjadi istimewa', 'menarik memilih cabang olahraga terkenal dijadikan bahan jualannya hollywood persediaan sport movie menarik konsep jauh-jauh drama-drama olahraga kebanyakan mengusung cerita perjuangan terbaik kombinasi kisah nyata casting bagus  srikandi istimewa', 'tarik pilih cabang olahraga kenal jadi bahan jual hollywood sedia sport movie tarik konsep jauh drama olahraga banyak usung cerita juang baik kombinasi kisah nyata casting bagus  srikandi istimewa'),
(621, 638, 'naskah juara dari will reiser dan joseph gordon-levitt adalah sang bintang di sini yang mampu melebur sempurna dalam penyutradaraan apik dari jonathan levine membuat  tidak hanya sukses membuat anda tertawa ringan dengan joke-joke gelap-segarnya namun juga mampu menyentil hati anda ketika melihat bagaimana suka duka pengidap kanker dalam bertahan hidup yang tersaji dengan sangat baik di sepanjang  menit durasinya ya ini adalah film yang bagus', 'naskah juara will reiser joseph gordon-levitt sang bintang melebur sempurna penyutradaraan apik jonathan levine  sukses tertawa ringan joke-joke gelap-segarnya menyentil hati suka duka pengidap kanker bertahan hidup tersaji  menit durasinya ya film bagus', 'naskah juara will reiser joseph gordon levitt sang bintang lebur sempurna sutradara apik jonathan levine  sukses tertawa ringan joke gelap segar sentil hati suka duka idap kanker tahan hidup saji  menit durasi ya film bagus'),
(622, 639, 'tidak banyak dialog terucap di sepanjang  jam  menit durasinya amipour memilih kesunyian untuk menegaskan tema horornya dan memperbanyak permainan bahasa tubuh dan mimik untuk berbicara menunjukkan emosi dan cinta terselubung dalam interaksi antar karakternya sementara di balik setiap momennya tidak ketinggalan amipour menyelipkan soundtrack-soundtrack pop-rock alternatif pilihan yang sukses menghasilkan sebuah kesan tersendiri buat jati dirinya yang unik', 'dialog terucap  jam  menit durasinya amipour memilih kesunyian tema horornya memperbanyak permainan bahasa tubuh mimik berbicara emosi cinta terselubung interaksi karakternya momennya ketinggalan amipour menyelipkan soundtrack-soundtrack pop-rock alternatif pilihan sukses menghasilkan kesan tersendiri jati unik', 'dialog ucap  jam  menit durasi amipour pilih sunyi tema horor banyak main bahasa tubuh mimik bicara emosi cinta selubung interaksi karakter momen tinggal amipour selip soundtrack pop rock alternatif pilih sukses hasil kesan sendiri jati unik'),
(623, 640, 'alurnya sendiri bergerak cepat dan mulus dalam tone gembira seiring berjalannya waktu kita tahu bahwa ini tidak hanya melulu bercerita soal cinta sejati dari kekasih impianmu ada hubungan ayah-anak dan adik-kakak yang berusaha disandingkan curtis bersama elemen cinta dan time travel dengan cakupan hidup karakternya yang disajikan secara periodik dalam balutan gambar-gambar cantik dan pilihan soundtrack asyik hasilnya bisa dibilang cukup menyentuh terutama pada bagian ayah-anaknya yang kalau mau jujur adalah romance utama film ini', 'alurnya bergerak cepat mulus tone gembira seiring berjalannya melulu bercerita cinta sejati kekasih impianmu hubungan ayah-anak adik-kakak berusaha disandingkan curtis elemen cinta time travel cakupan hidup karakternya disajikan periodik balutan gambar-gambar cantik pilihan soundtrack asyik hasilnya dibilang menyentuh ayah-anaknya jujur romance utama film', 'alur gerak cepat mulus tone gembira iring jalan melulu cerita cinta sejati kasih impi hubung ayah anak adik kakak usaha sanding curtis elemen cinta time travel cakup hidup karakter saji periodik balut gambar cantik pilih soundtrack asyik hasil bilang sentuh ayah anak jujur romance utama film'),
(624, 641, 'overall mencari sebuah film dengan kisah cinta yang tidak biasa baik dalam cerita maupun penyajiannya amores perros mungkin pilihan yang tepat sebuah karya terbaik dari seorang alejandro gonzalez inarritu yang wajib ditonton', 'overall mencari film kisah cinta cerita penyajiannya amores perros pilihan karya terbaik alejandro gonzalez inarritu wajib ditonton', 'overall cari film kisah cinta cerita saji amores perros pilih karya baik alejandro gonzalez inarritu wajib tonton'),
(625, 642, 'big hero  punya daya magis pada kesederhanaan plotnya dan besarnya hati yang ditawarkan seperti kebanyakan film-film disney dengan segala kekuatan moralnya dan layaknya film superhero tentu saja ceritanya tidak jauh-jauh dari pertempuran antara kebaikan melawan kejahatan yang kemudian dipoles lagi dengan sentuhan hangat cerita persahabatan dan relasi adik-kakak coming of age dan penciptaan sebuah origin', 'big hero  daya magis kesederhanaan plotnya besarnya hati ditawarkan kebanyakan film-film disney kekuatan moralnya layaknya film superhero ceritanya jauh-jauh pertempuran kebaikan melawan kejahatan dipoles sentuhan hangat cerita persahabatan relasi adik-kakak coming of age penciptaan origin', 'big hero  daya magis sederhana plot besar hati tawar banyak film disney kuat moral layak film superhero cerita jauh tempur baik lawan jahat poles sentuh hangat cerita sahabat relasi adik kakak coming of age cipta origin'),
