(628, 645, 'wow saya tidak pernah menyangka sebelumnya bahwa dead end ternyata mampu menjadi sebuah suguhan horror-misteri yang sangat menarik dan mencekam premisnya sendiri sebenarnya sederhana hanya bercerita tentang sekelompok keluarga yang tersesat namun hebatnya duet sutradara jean-baptiste andrea dan fabrice canepa ini mampu memberikan sebuah pengalaman misteri yang membuat penontonnya bertanya tanya apa yang sebenarnya terjadi di jalan yang sepi itu', 'wow menyangka dead end suguhan horror-misteri menarik mencekam premisnya sederhana bercerita sekelompok keluarga tersesat hebatnya duet sutradara jean-baptiste andrea fabrice canepa pengalaman misteri penontonnya jalan sepi', 'wow sangka dead end suguh horror misteri tarik cekam premis sederhana cerita kelompok keluarga sesat hebat duet sutradara jean baptiste andrea fabrice canepa alam misteri tonton jalan sepi'),
