(630, 647, 'film ini mungkin saja mengubah penontonnya jadi vegetarian tapi itulah inti dari film ini untuk menimbulkan reaksi penontonnya dan itupun efektif ditambah narasi yang dibawakan sangat bagus oleh joaquin phoenix saya salut sama dokumenter ini', 'film mengubah penontonnya vegetarian inti film menimbulkan reaksi penontonnya itupun efektif ditambah narasi dibawakan bagus joaquin phoenix salut dokumenter', 'film ubah tonton vegetarian inti film timbul reaksi tonton itu efektif tambah narasi bawak bagus joaquin phoenix salut dokumenter'),
(631, 648, 'evil dead  jelas adalah sebuah sekuel solid yang setidaknya mampu menyamai pesona seri pertamanya memang ia terlalu banyak bercanda tapi raimi tetap setia menghadirkan kengerian klasik ala horor-horor jadul dengan segala elemen-elemen teknis pendukungnya termasuk melebarkan lagi lebih jauh ceritanya memaksimalkan akting kuat bruce campbell yang mengasyikkan dan juga menggelikan ya ini memang sebuah sekuel dari horor sejati', 'evil dead  sekuel solid menyamai pesona seri pertamanya bercanda raimi setia menghadirkan kengerian klasik ala horor-horor jadul elemen-elemen teknis pendukungnya melebarkan ceritanya memaksimalkan akting kuat bruce campbell mengasyikkan menggelikan ya sekuel horor sejati', 'evil dead  sekuel solid sama pesona seri pertama canda raimi setia hadir ngeri klasik ala horor jadul elemen teknis dukung lebar cerita maksimal akting kuat bruce campbell asyik geli ya sekuel horor sejati'),
(632, 649, 'mcavoy adalah jagoan kita sosok anti-hero brengsek mudah dibenci dengan segala tindakan amoralnya namun narasi braid bersama kombinasi performa apik mcavoy juga sanggup menghadirkan simpati yang sama besarnya kita tahu kapasitas mcavoy pria skotlandia ini sudah mencoba semuanya dari faun superhero komik pemimpin mutant populer sampai polisi korup di sini mcavoy tidak hanya memesona ia adalah alasan mengapa filth bisa tampil sekotor ini', 'mcavoy jagoan sosok anti-hero brengsek mudah dibenci tindakan amoralnya narasi braid kombinasi performa apik mcavoy sanggup menghadirkan simpati besarnya kapasitas mcavoy pria skotlandia mencoba faun superhero komik pemimpin mutant populer polisi korup mcavoy memesona alasan filth tampil sekotor', 'mcavoy jago sosok anti hero brengsek mudah benci tindak amoral narasi braid kombinasi performa apik mcavoy sanggup hadir simpati besar kapasitas mcavoy pria skotlandia coba faun superhero komik pimpin mutant populer polisi korup mcavoy pesona alas filth tampil kotor'),
(633, 650, 'selain masih menghadirkan kematian-kematian yang kreatif canggih dan menghibur termasuk bagaimana efek d yang mampu digarap dengan sangat baik instalemen kelima dari saga mencurangi kematian ini rupanya juga menyimpan kejutan yang tak disangka-sangka di penghujung ceritanya', 'menghadirkan kematian-kematian kreatif canggih menghibur efek d digarap instalemen saga mencurangi kematian menyimpan kejutan disangka-sangka penghujung ceritanya', 'hadir kematian kreatif canggih hibur efek d garap instalemen saga curang mati simpan kejut sangka hujung cerita'),
