(635, 652, 'setiap adegan yang melibatkan fury dan nazi hadir dalam sebuah ketegangan luar biasa dan juga brutal tanpa ampun spesial efeknya meyakinkan sound editing fantastis suara yang dihasilkan dari setiap peluru yang terhambur bak perang laser yang intens dengan dan dentuman meriam sherman itu terasa begitu spektakuler', 'adegan melibatkan fury nazi hadir ketegangan brutal ampun spesial efeknya sound editing fantastis suara dihasilkan peluru terhambur bak perang laser intens dentuman meriam sherman spektakuler', 'adegan libat fury nazi hadir tegang brutal ampun spesial efek sound editing fantastis suara hasil peluru hambur bak perang laser intens dentum meriam sherman spektakuler'),
(636, 653, 'habibie  ainun adalah sebuah biopik yang bagus jarang ada film-film lokal berkualitas yang menghadirkan sosok besar yang dikenal masyarakat luar kita jelajahi melalui sisi lainnya dalam hal ini sisi romantisme yang kental dan itu bekerja dengan sangat baik termasuk akting yang luar biasa dan juga teknis yang mendukung', 'habibie  ainun biopik bagus jarang film-film lokal berkualitas menghadirkan sosok dikenal masyarakat jelajahi sisi sisi romantisme kental akting teknis mendukung', 'habibie  ainun biopik bagus jarang film lokal kualitas hadir sosok kenal masyarakat jelajah sisi sisi romantisme kental akting teknis dukung'),
