(638, 655, 'satu hal yang saya suka dari hanung di sini adalah ia tidak pernah menjadi tuhan untuk memaksakan akan adanya sebuah konklusi ajaib tidak ada dramatisasi berlebihan yang sampai harus menggoyang kepercayaan karakternya akan sesuatu paham yang dipegangnya teguh sebaliknya hanung membiarkan semuanya mengalir apa adanya dengan sebuah akhir yang bisa menyenangkan semua pihak sesuatu yang jarang dilakukan hanung ketika membuat film-film dakwah seperti ini', 'suka hanung tuhan memaksakan konklusi ajaib dramatisasi menggoyang kepercayaan karakternya paham dipegangnya teguh hanung membiarkan mengalir menyenangkan jarang hanung film-film dakwah', 'suka hanung tuhan paksa konklusi ajaib dramatisasi goyang percaya karakter paham pegang teguh hanung biar alir senang jarang hanung film dakwah'),
(639, 656, 'butuh waktu untuk bisa benar-benar menikmati kumiko the treasure hunter sebagai sebuah drama slow burn zellner tidak pernah terlalu terburu-buru menggerajkan plot-nya sebaliknya ia mencoba memperkenalkan siapa kumiko kepada penontonnya membiarkan audiens merasakan setiap tingkah laku dan kenyentrikannya yang terbungkus dalam visual cantik namun dingin dan nuansa depresi kental yang mungkin akan menyesakkan', 'butuh benar-benar menikmati kumiko the treasure hunter drama slow burn zellner terburu-buru menggerajkan plot-nya mencoba memperkenalkan kumiko penontonnya membiarkan audiens merasakan tingkah laku kenyentrikannya terbungkus visual cantik dingin nuansa depresi kental menyesakkan', 'butuh benar nikmat kumiko the treasure hunter drama slow burn zellner buru menggerajkan plot nya coba kenal kumiko tonton biar audiens rasa tingkah laku nyentrik bungkus visual cantik dingin nuansa depresi kental sesak'),
(640, 657, 'diblasi sukses menghadirkan sebuah pengalaman berbeda menonton horor rumah hantu secara keseluruhan last shift punya kadar kengerian dan ketegangan yang digarap dengan sangat baik aroma sesak bercampur misteri pekat kemudian menyelimuti  menit durasinya bersama pergerakan kamera yang pintar dan scoring eerie yang menyayat', 'diblasi sukses menghadirkan pengalaman berbeda menonton horor rumah hantu last shift kadar kengerian ketegangan digarap aroma sesak bercampur misteri pekat menyelimuti  menit durasinya pergerakan kamera pintar scoring eerie menyayat', 'diblasi sukses hadir alam beda tonton horor rumah hantu last shift kadar ngeri tegang garap aroma sesak campur misteri pekat selimut  menit durasi gerak kamera pintar scoring eerie sayat'),
(641, 658, 'sandberg dengan sangat-sangat lihai membangun tensinya menjaganya dengan baik antara drama ibu-anak dan fenomena supranatural hingga akhir bersama banyak jump-scare tak terduga yang akan membuatmu gelisah hingga menjerit keras dengan sangat efektif', 'sandberg sangat-sangat lihai membangun tensinya menjaganya drama ibu-anak fenomena supranatural jump-scare terduga membuatmu gelisah menjerit keras efektif', 'sandberg sangat lihai bangun tensi jaga drama ibu anak fenomena supranatural jump scare duga buat gelisah jerit keras efektif'),
(642, 659, 'semua cast utamanya kembali pada posisinya masing-masing termasuk morgan freeman dan angela bassett yang selalu pantas memerankan karakter staf pemerintahan dengan pakaian rapi dan yang paling tentu saja penampilan gerard butler yang semakin sangar sebagai mike banning', 'cast utamanya posisinya morgan freeman angela bassett memerankan karakter staf pemerintahan pakaian rapi penampilan gerard butler sangar mike banning', 'cast utama posisi morgan freeman angela bassett peran karakter staf perintah pakai rapi tampil gerard butler sangar mike banning'),
(643, 660, 'ya inilah salah satu fim paling menghibur dan paling kreatif di  robert rodriguez tahu benar bagaimana menghadirkan sebuah paket brainless action movie dengan gaya b movie yang kental machete jelas bukan film untuk semua orang tapi jelas it works for me', 'ya salah fim menghibur kreatif  robert rodriguez menghadirkan paket brainless action movie gaya b movie kental machete film orang it works for me', 'ya salah fim hibur kreatif  robert rodriguez hadir paket brainless action movie gaya b movie kental machete film orang it works for me'),
(644, 661, 'bong joon ho benar-benar menyajikan plot dan koflik-konfliknya dengan sangat cerdas dan enjoyable serta tensi ketegangan mampu dijaga dengan baik belum lagi hadirnya twist-twist yang dijamin akan banyak mengejutkan kita dari awal hingga akhir satu elemen lagi yang membuat film berdurasi  menit ini menjadi berbeda adalah masuknya unsur-unsur komedi jadi selain mencekam film ini juga akan membuat kita tersenyum bahkan tertawa melihat tingkah laku yang dibuat para karakternya khususnya karakter detektif park doo man', 'bong joon ho benar-benar menyajikan plot koflik-konfliknya cerdas enjoyable serta tensi ketegangan dijaga hadirnya twist-twist dijamin mengejutkan elemen film berdurasi  menit berbeda masuknya unsur-unsur komedi mencekam film tersenyum tertawa tingkah laku karakternya karakter detektif park doo man', 'bong joon ho benar saji plot koflik konflik cerdas enjoyable serta tensi tegang jaga hadir twist jamin kejut elemen film durasi  menit beda masuk unsur komedi cekam film senyum tertawa tingkah laku karakter karakter detektif park doo man'),
(645, 662, 'yang membuat film ini mendapat nilai tinggi bukan karena cerita dan plotnya tapi karena visi yang di sampaikan firtz lang kepada penonton disebut-sebut sebagai salah satu film yang sangat berpengaruh yang menginspirasi sebagian besar film-film fiksi ilmiah seperti coruscant di star wars blade runner dark city dan the fifth element visual effect yang disajikan firtz lang begitu brutal walau  tahun lebih sudah umur film ini masih tetap terlihat inovatif dan memukau', 'film nilai cerita plotnya visi firtz lang penonton disebut-sebut salah film berpengaruh menginspirasi film-film fiksi ilmiah coruscant star wars blade runner dark city the fifth element visual effect disajikan firtz lang brutal  umur film inovatif memukau', 'film nilai cerita plot visi firtz lang tonton sebut salah film pengaruh inspirasi film fiksi ilmiah coruscant star wars blade runner dark city the fifth element visual effect saji firtz lang brutal  umur film inovatif pukau'),
(646, 663, 'dari semua karya woody allen yang sudah saya tonton bisa jadi midnight in paris adalah film allen yang paling ringan dan juga yang paling memesona lihat saja dialog-dialog cerdasnya yang dibungkus dengan banyak percakapan santai itu atau ia dengan suksesnya mengeksploitasi setiap sudut kota paris yang berkilauan itu dengan sangat baik menghadirkan aura romansa fantasi dan nostalgia yang menghipnotis melalui lensa darius khondji dan johanne debas dengan pendekatan yang hebat itu allen sudah seperti seorang tour guide yang seakan-akan sudah mengajak kita berkeliling paris', 'karya woody allen tonton midnight in paris film allen ringan memesona lihat dialog-dialog cerdasnya dibungkus percakapan santai suksesnya mengeksploitasi sudut kota paris berkilauan menghadirkan aura romansa fantasi nostalgia menghipnotis lensa darius khondji johanne debas pendekatan hebat allen tour guide seakan-akan mengajak berkeliling paris', 'karya woody allen tonton midnight in paris film allen ringan pesona lihat dialog cerdas bungkus cakap santai sukses eksploitasi sudut kota paris kilau hadir aura romansa fantasi nostalgia hipnotis lensa darius khondji johanne debas dekat hebat allen tour guide akan ajak keliling paris'),
(647, 664, 'bagi saya inilah film mission impossible seharusnya tidak seperti film-film sebelumnya yang hanya menitik beratkan ego seorang ethan hunt sebuah perfect popcorn movie akhir tahun yang tidak hanya mengandalkan one man show dari seorang aktor tom cruise tapi sebuah kerja team yang solid baik dari para pemainnya dan kru yang terlibat ya tidak bisa dimungkiri kalau saya bilang dalam kategori film aksi terbaik tahun ini ghost protocol berada di puncaknya', 'film mission impossible film-film menitik beratkan ego ethan hunt perfect popcorn movie mengandalkan one man show aktor tom cruise kerja team solid pemainnya kru terlibat ya dimungkiri bilang kategori film aksi terbaik ghost protocol puncaknya', 'film mission impossible film titik berat ego ethan hunt perfect popcorn movie andal one man show aktor tom cruise kerja team solid main kru libat ya mungkir bilang kategori film aksi baik ghost protocol puncak'),
(648, 665, 'seperti judulnya moana mendominasi narasinya bersama desain karakter princess baru disney yang loveable lengkap dengan karakteristiknya yang penuh semangat tangguh ceria sekaligus berani disuarakan sempurna oleh pendatang baru auli cravalho yang juga turut bernyanyi sementara daya tarik di jajaran cast utamanya ada pada suara maui yang disuarakan dwayne johnson', 'judulnya moana mendominasi narasinya desain karakter princess disney loveable lengkap karakteristiknya penuh semangat tangguh ceria berani disuarakan sempurna pendatang auli cravalho bernyanyi daya tarik jajaran cast utamanya suara maui disuarakan dwayne johnson', 'judul moana dominasi narasi desain karakter princess disney loveable lengkap karakteristik penuh semangat tangguh ceria berani suara sempurna datang auli cravalho nyanyi daya tarik jajar cast utama suara mau suara dwayne johnson'),
(649, 666, 'mu bisa menjadi tontonan yang cukup menghibur sekaligus ajang bernostalgia dengan wazowski dan sulley yang lucu sekaligus menjadi saksi bagaimana keduanya bertemu untuk pertama kali plus jangan lewatkan film pendek blue umbrela cameo-cameo menarik dari monster-monster di film pertamanya dan tentu saja pencarian mobil pizza planet yang legendaris itu', 'mu tontonan menghibur ajang bernostalgia wazowski sulley lucu saksi bertemu kali plus lewatkan film pendek blue umbrela cameo-cameo menarik monster-monster film pertamanya pencarian mobil pizza planet legendaris', 'mu tonton hibur ajang nostalgia wazowski sulley lucu saksi bertemu kali plus lewat film pendek blue umbrela cameo tarik monster film pertama cari mobil pizza planet legendaris'),
(650, 667, 'gambar-gambar yang cantik dari perkampungan yang seharusnya nampak kumuh pun membuat cerita lebih menyenangkan untuk diikuti tentunya dengan pay-off yang luar biasa satu-satunya yang saya sesali dari menonton film ini adalah mengapa saya harus menunggu begitu lama', 'gambar-gambar cantik perkampungan nampak kumuh cerita menyenangkan diikuti pay-off satu-satunya sesali menonton film menunggu', 'gambar cantik kampung nampak kumuh cerita senang ikut pay off satu sesal tonton film tunggu'),
(651, 668, 'overall debut penyutradaran hebat dari jim sheridan dan dukungan akting gemilang dari daniel day-lewis menjadi kombinasi hebat yang membuat my left foot the story of christy brown menjadi sebuah biopik manis kuat dan inspiratif sebuah kisah hebat yang jelas akan tinggal dan membekas cukup lama di benak setiap penontonnya', 'overall debut penyutradaran hebat jim sheridan dukungan akting gemilang daniel day-lewis kombinasi hebat my left foot the story of christy brown biopik manis kuat inspiratif kisah hebat tinggal membekas benak penontonnya', 'overall debut penyutradaran hebat jim sheridan dukung akting gemilang daniel day lewis kombinasi hebat my left foot the story of christy brown biopik manis kuat inspiratif kisah hebat tinggal bekas benak tonton'),
(652, 669, 'overall mysterious skin adalah sebuah drama luar biasa yang mampu menyampaikan pesannya dengan kuat walaupun tema yang diangkat terbilang kontroversial namun pada kenyataanya film ini mampu membuka mata para penontonnya tentang kenyataan yang memang sering terjadi disekeliling kita sebuah kenyataan yang suka atau tidak suka harus kita hadapi dengan besar hati', 'overall mysterious skin drama pesannya kuat tema diangkat terbilang kontroversial kenyataanya film membuka mata penontonnya kenyataan disekeliling kenyataan suka suka hadapi hati', 'overall mysterious skin drama pesan kuat tema angkat bilang kontroversial kenyataanya film buka mata tonton nyata disekeliling nyata suka suka hadap hati'),
(653, 670, 'pelan namun pasti payne bersama nebraska membuatmu terasa akrab dengan ceritanya yang sendu kamu akan memahami narasinya seperti tokoh david yang sedikit demi sedikit memahami ayahnya ada rasa haru dan iba melihat woody dan bagaimana david berusaha menjadi anak baik buat ayahnya emosinya memuncak pada adegan david bertanya tentang apa yang akan dilakukan woody dengan uang satu juta itu sampai kemudian salah satu ending paling hangat tahun lalu menutup kisahnya sementara kadar dramanya digarap bagus payne tentu saja tidak melupakan komedinya seperti biasa ada guyonan komedi hitam bersemayam di dalamnya', 'pelan payne nebraska membuatmu akrab ceritanya sendu memahami narasinya tokoh david memahami ayahnya haru iba woody david berusaha anak ayahnya emosinya memuncak adegan david woody uang juta salah ending hangat menutup kisahnya kadar dramanya digarap bagus payne melupakan komedinya guyonan komedi hitam bersemayam dalamnya', 'pelan payne nebraska buat akrab cerita sendu paham narasi tokoh david paham ayah haru iba woody david usaha anak ayah emosi puncak adegan david woody uang juta salah ending hangat tutup kisah kadar drama garap bagus payne lupa komedi guyon komedi hitam semayam dalam'),
(654, 671, 'bisa dibilang untuk tahun ini no mercy yang notabene kurang terdengar gaungnya ini adalah salah satu thriller terbaik korea selatan dengan balutan plot cerdas menggabungkan elemen-elemen investigasi ala penyelidik forensik seperti pada serial televisi amerika serikat csi atau bones pada menit-menit awalnya kemudian langsung berbelok tajam di saat memasuki konflik utamanya rangkaian adegan-adegan berpacu dengan waktu yang dikombinasikan dengan kemampuan villain utama mengendalikan permainan menjadikan film ini terasa semakin menarik saja dan itu masih ditambah lagi dengan kehadiran twist demi twist berlapis yang mengejutkan di pertengahan hingga klimaks', 'dibilang no mercy notabene terdengar gaungnya salah thriller terbaik korea selatan balutan plot cerdas menggabungkan elemen-elemen investigasi ala penyelidik forensik serial televisi amerika serikat csi bones menit-menit langsung berbelok tajam memasuki konflik utamanya rangkaian adegan-adegan berpacu dikombinasikan kemampuan villain utama mengendalikan permainan menjadikan film menarik ditambah kehadiran twist twist berlapis mengejutkan pertengahan klimaks', 'bilang no mercy notabene dengar gaung salah thriller baik korea selatan balut plot cerdas gabung elemen investigasi ala selidik forensik serial televisi amerika serikat csi bones menit langsung belok tajam masuk konflik utama rangkai adegan pacu kombinasi mampu villain utama kendali main jadi film tarik tambah hadir twist twist lapis kejut tengah klimaks'),
(655, 672, 'tidak peduli seberapa jauh anda dapat mencerna film ini tidak peduli bagaimana anda akan menilai film absurd satu ini norikos dinner table jelas berpotensi besar menjadikan anda seperti orang bodoh namun bagi saya pribadi norikos dinner table sudah sukses menorehkan bekas cukup dalam pikiran saya semuanya tidak lepas dari tangan dingin sono berhasil menggodok premisnya dengan sangat baik memberikan sebuah pesan masalah sosial yang berlaku di masyarakat dengan cara yang sama sekali tidak biasa', 'peduli mencerna film peduli menilai film absurd norikos dinner table berpotensi menjadikan orang bodoh pribadi norikos dinner table sukses menorehkan bekas pikiran lepas tangan dingin sono berhasil menggodok premisnya pesan sosial berlaku masyarakat', 'peduli cerna film peduli nilai film absurd norikos dinner table potensi jadi orang bodoh pribadi norikos dinner table sukses toreh bekas pikir lepas tangan dingin sono hasil godok premis pesan sosial berlaku masyarakat'),
(656, 673, 'overall nuovo cinema paradiso jelas adalah salah satu film terbaik italia atau mungkin salah satu film terbaik di dunia sebuah film yang mampu membuat penontonya terbius dengan kisahnya yang luar biasa definitely a masterpiece', 'overall nuovo cinema paradiso salah film terbaik italia salah film terbaik dunia film penontonya terbius kisahnya definitely a masterpiece', 'overall nuovo cinema paradiso salah film baik italia salah film baik dunia film penontonya bius kisah definitely a masterpiece');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(657, 674, 'only god forgives adalah sebuah karya yang mistis dan divisif winding refn seakan hanya mengeksplor gaya aestetik filmmaking-nya tanpa memperhatikan aspek-aspek lain yang membuat sebuah film menjadi karya yang memuaskan saya tetap akan merekomendasikan only god forgives sebagai sebuah pelajaran unik dalam auteur filmmaking tetapi terlepas dari gaya yang ditonjolkan olehnya only god forgives juga masih menyisakan banyak hal yang dapat dianalisa dan didiskusikan', 'only god forgives karya mistis divisif winding refn seakan mengeksplor gaya aestetik filmmaking-nya memperhatikan aspek-aspek film karya memuaskan merekomendasikan only god forgives pelajaran unik auteur filmmaking terlepas gaya ditonjolkan only god forgives menyisakan dianalisa didiskusikan', 'only god forgives karya mistis divisif winding refn akan mengeksplor gaya aestetik filmmaking nya hati aspek film karya muas rekomendasi only god forgives pelajaran unik auteur filmmaking lepas gaya tonjol only god forgives sisa dianalisa diskusi'),
(658, 675, 'overall percy jackson  the olympians the lightning thief memang tidak akan sefenomenal harry potter series namun setidaknya columbus sekali lagi berhasil menghadirkan adaptasi novel laris dengan lumayan baik sehingga mampu menjadikan film ini menjadi sebuah film keluarga yang ringan dan menghibur setidaknya bagi anak-anak dan para remaja', 'overall percy jackson  the olympians the lightning thief sefenomenal harry potter series columbus berhasil menghadirkan adaptasi novel laris lumayan menjadikan film film keluarga ringan menghibur anak-anak remaja', 'overall percy jackson  the olympians the lightning thief fenomenal harry potter series columbus hasil hadir adaptasi novel laris lumayan jadi film film keluarga ringan hibur anak remaja'),
(659, 676, 'kita tahu riwayat padilha dengan senjata dan tembakan di filmnya dan robocop miliknya mendapatkan porsi aksi yang pantas mungkin tidak sampai terlalu spektakuler untuk ukuran film berbiaya  juta dollar tetapi apa yang tersaji sudah lebih dari cukup untuk memamerkan kekuatan robocop yang baru pertarungannya dengan versi anyar ed- cukup mengesankan dan menghasilkan aroma nostalgia', 'riwayat padilha senjata tembakan filmnya robocop miliknya porsi aksi spektakuler ukuran film berbiaya  juta dollar tersaji memamerkan kekuatan robocop pertarungannya versi anyar ed- mengesankan menghasilkan aroma nostalgia', 'riwayat padilha senjata tembak film robocop milik porsi aksi spektakuler ukur film biaya  juta dollar saji pamer kuat robocop tarung versi anyar ed- kesan hasil aroma nostalgia'),
(660, 677, 'sesuai judulnya sad movie memang adalah sebuah film yang menjual melodrama romantis tingkat tinggi layaknya film-film drama romantis korea selatan sejenis dengan akhir yang sudah bisa ditebak seperti apa namun setidaknya film ini berani tampil beda dengan menyajikan sebuah drama multiplot yang digarap dengan presentasi dan elemen teknis cukup baik khususnya visualnya yang indah dan memanjakan mata penontonnya', 'sesuai judulnya sad movie film menjual melodrama romantis tingkat layaknya film-film drama romantis korea selatan sejenis ditebak film berani tampil beda menyajikan drama multiplot digarap presentasi elemen teknis visualnya indah memanjakan mata penontonnya', 'sesuai judul sad movie film jual melodrama romantis tingkat layak film drama romantis korea selatan jenis tebak film berani tampil beda saji drama multiplot garap presentasi elemen teknis visual indah manja mata tonton'),
(661, 678, 'sebuah film bertemakan aksi laga klasik shaolin di bawah asuhan benny chan ini sudah sukses menghadirkan sebuah paket hiburan lengkap dengan tidak lupa menyelipkan petuah-petuah dan ajaran-ajaran moral didalamnya', 'film bertemakan aksi laga klasik shaolin asuhan benny chan sukses menghadirkan paket hiburan lengkap lupa menyelipkan petuah-petuah ajaran-ajaran moral didalamnya', 'film temak aksi laga klasik shaolin asuh benny chan sukses hadir paket hibur lengkap lupa selip petuah ajaran moral dalam'),
(662, 679, 'dengan berbekal kisah nyata yang luar biasa mengispirasi tampaknya sutradara sean mcnamara tidak mengalami kesulitan berarti untuk menghadirkan soul surfer sebagai sebuah drama keluarga menarik dengan kandungan pesan moral yang cukup tinggi', 'berbekal kisah nyata mengispirasi sutradara sean mcnamara mengalami kesulitan menghadirkan soul surfer drama keluarga menarik kandungan pesan moral', 'bekal kisah nyata mengispirasi sutradara sean mcnamara alami sulit hadir soul surfer drama keluarga tarik kandung pesan moral'),
(663, 680, 'selain faktor hanks yang tampil meyakinkan untungnya di menit-menit emosional sully cukup berhasil menggugah perasaan penontonnya aksi gagah berani sang kapten juga bisa ditampilkan dengan baik dan sanggup memberi ketegangan tersendiri di detik-detik pendaratan yang menjadi aksi yang dikenang dunia hingga kini intinya walaupun tidak sampai pada taraf mengesankan layaknya united  dari paul greengrass atau serumit flight dari robert zemeckis sully yang terasa terlalu singkat dan tidak padat ini masih memberikan pesan heroik-humanis terutama pada adegan klimaks yang cukup menguras emosi tersebut', 'faktor hanks tampil untungnya menit-menit emosional sully berhasil menggugah perasaan penontonnya aksi gagah berani sang kapten ditampilkan sanggup ketegangan tersendiri detik-detik pendaratan aksi dikenang dunia intinya taraf mengesankan layaknya united  paul greengrass serumit flight robert zemeckis sully singkat padat pesan heroik-humanis adegan klimaks menguras emosi', 'faktor hanks tampil untung menit emosional sully hasil gugah asa tonton aksi gagah berani sang kapten tampil sanggup tegang sendiri detik darat aksi kenang dunia inti taraf kesan layak united  paul greengrass rumit flight robert zemeckis sully singkat padat pesan heroik humanis adegan klimaks uras emosi'),
(664, 681, 'gibeney punya cara untuk tetap memberikan penghormatan buat atlet favoritnya dengan cara yang elegan memberikan penontonnya sisi lain big tex yang posfitif bagaimana kecintaannya pada olahraga sepeda yang begitu besar bagaimana perjuangannya menghadapi kanker ganas mampu memberi kekuatan buat banyak orang putus asa bersama yayasan kanker livestrong yang didirikannya', 'gibeney penghormatan atlet favoritnya elegan penontonnya sisi big tex posfitif kecintaannya olahraga sepeda perjuangannya menghadapi kanker ganas kekuatan orang putus asa yayasan kanker livestrong didirikannya', 'gibeney hormat atlet favorit elegan tonton sisi big tex posfitif cinta olahraga sepeda juang hadap kanker ganas kuat orang putus asa yayasan kanker livestrong diri'),
(665, 682, 'salah satu elemen terbaik dari trilogi the hobbit ia punya dukungan ensemble cast yang solid martin freeman masih konsisten membawakan karakter bilbo baggins sebagai daya tarik utama narasinya sejak seri pertama digulirkan tidak ada konflik personal sebesar dua seri pertamanya tetapi bilbo seperti hobbit-hobbit dalam franchise middle-earth selalu memegang kunci utama untuk menggerakkan plotnya meskipun kalau mau jujur sebenarnya adalah richard armitage yang benar-benar tampil bersinar sampai seri pemungkasnya ini', 'salah elemen terbaik trilogi the hobbit dukungan ensemble cast solid martin freeman konsisten membawakan karakter bilbo baggins daya tarik utama narasinya seri digulirkan konflik personal seri pertamanya bilbo hobbit-hobbit franchise middle-earth memegang kunci utama menggerakkan plotnya jujur richard armitage benar-benar tampil bersinar seri pemungkasnya', 'salah elemen baik trilogi the hobbit dukung ensemble cast solid martin freeman konsisten bawak karakter bilbo baggins daya tarik utama narasi seri gulir konflik personal seri pertama bilbo hobbit franchise middle earth pegang kunci utama gerak plot jujur richard armitage benar tampil sinar seri pungkas'),
(666, 683, 'the ides of march bisa jadi karya terbaik george clooney di belakang kamera sekaligus pemain setelah good night and good luck yang luar biasa itu duetnya dengan gosling seakan-akan menunjukkan kepada penontonnya bagaimana cara kerja politisi-politisi berjas mahal dan bermulut manis itu sampai mereka bisa terpilih nantinya dalam balutan thriller politik paling cerdas berliku dan kompleks tahun ini', 'the ides of march karya terbaik george clooney kamera pemain good night and good luck duetnya gosling seakan-akan penontonnya kerja politisi-politisi berjas mahal bermulut manis terpilih balutan thriller politik cerdas berliku kompleks', 'the ides of march karya baik george clooney kamera main good night and good luck duet gosling akan tonton kerja politisi jas mahal mulut manis pilih balut thriller politik cerdas berliku kompleks'),
(667, 684, 'ya luar biasa memang karya dardenne satu ini di balik kesederhanaan premisnya mereka mampu menghadirkan sebuah narasi coming of age bocah  tahun yang hebat dengan teknis penyutradaraan gemilang dan performa hebat dari aktor ciliknya sebuah dongeng realistis dengan hati yang besar', 'ya karya dardenne kesederhanaan premisnya menghadirkan narasi coming of age bocah  hebat teknis penyutradaraan gemilang performa hebat aktor ciliknya dongeng realistis hati', 'ya karya dardenne sederhana premis hadir narasi coming of age bocah  hebat teknis sutradara gemilang performa hebat aktor cilik dongeng realistis hati'),
(668, 685, 'sepertinya tidak terlalu mengejutkan ketika florian henckel von donnersmarck dengan the lives of others miliknya ini berhasil membawa pulang penghargaan prestisius sebagai film berbahasa asing terbaik pada ajang oscar  lalu ya selain menawarkan sebuah drama thriller berbasis sosial politik historis yang menarik florian henckel juga mengajak penontonnya untuk menyaksikan sebuah kisah kuat dan menyentuh', 'mengejutkan florian henckel von donnersmarck the lives of others miliknya berhasil membawa pulang penghargaan prestisius film berbahasa asing terbaik ajang oscar  ya menawarkan drama thriller berbasis sosial politik historis menarik florian henckel mengajak penontonnya menyaksikan kisah kuat menyentuh', 'kejut florian henckel von donnersmarck the lives of others milik hasil bawa pulang harga prestisius film bahasa asing baik ajang oscar  ya tawar drama thriller basis sosial politik historis tarik florian henckel ajak tonton saksi kisah kuat sentuh'),
(669, 686, 'overall perfilman australia membuktikan bahwa mereka juga mampu menghadirkan sebuah torture porn yang tidak kalah mengerikannya dengan yang dibuat hollywood tidak hanya kejam dan penuh darah the loved ones juga sukses menghadirkan ikon psikopat baru dalam sosok cantik bernama lola stone', 'overall perfilman australia membuktikan menghadirkan torture porn kalah mengerikannya hollywood kejam penuh darah the loved ones sukses menghadirkan ikon psikopat sosok cantik bernama lola stone', 'overall film australia bukti hadir torture porn kalah erik hollywood kejam penuh darah the loved ones sukses hadir ikon psikopat sosok cantik nama lola stone'),
(670, 687, 'setidaknya saya harus angkat jempol atas keberaniannya menampilkan sesuatu yang berbeda dengan caranya sendiri mungkin sedikit terlalu ambisius dan berlebihan namun setidaknya the man with the iron fists masih cukup menyenangkan untuk ditonton terlebih jika kamu juga adalah fans karya-karya jadul shaw brothers atau kungfu klasik wu-tang', 'angkat jempol keberaniannya menampilkan berbeda ambisius the man with the iron fists menyenangkan ditonton fans karya-karya jadul shaw brothers kungfu klasik wu-tang', 'angkat jempol berani tampil beda ambisius the man with the iron fists senang tonton fans karya jadul shaw brothers kungfu klasik wu tang'),
