(701, 718, 'hansel and gretel witch hunters hanya ingin menjual banyak adegan aksi tanpa otaknya bersama balutan blood and gore yang tidak terlalu nendang plus dua bintang utamanya yang tampil tanpa greget juga tanpa kedalaman cerita yang sebenanya punya potensi untuk dijadikan franchise baru jika digarap lebih serius hansel and gretel witch hunters adalah film yang dengan mudah akan kamu lupakan begitu end credit bergulir', 'hansel and gretel witch hunters menjual adegan aksi otaknya balutan blood and gore nendang plus bintang utamanya tampil greget kedalaman cerita sebenanya potensi dijadikan franchise digarap serius hansel and gretel witch hunters film mudah lupakan end credit bergulir', 'hansel and gretel witch hunters jual adegan aksi otak balut blood and gore nendang plus bintang utama tampil greget dalam cerita bena potensi jadi franchise garap serius hansel and gretel witch hunters film mudah lupa end credit gulir'),
(702, 719, 'ia punya dwyne johnson sebagai ikon film-film seru macam ini namun sayang sekali lagi momen action juga sama mediokernya ya ada banyak adegan pertempuran masif tetapi semuanya digarap setengah-setengah tanpa dukungan spesial efek dan cgi yang mumpuni memang tidak sampai terasa murahan namun apa yang tersaji masih terasa kecil dari harapan', 'dwyne johnson ikon film-film seru sayang momen action mediokernya ya adegan pertempuran masif digarap setengah-setengah dukungan spesial efek cgi mumpuni murahan tersaji harapan', 'dwyne johnson ikon film seru sayang momen action mediokernya ya adegan tempur masif garap setengah dukung spesial efek cgi mumpuni murah saji harap'),
(703, 720, 'singkat kata meskipun dari luar hereafter terlihat begitu percaya diri menjunjung tema after life namun sayang pada kenyataannya naskah yang ditulis oleh peter morgan ini tampak kurang berdiri kuat datar dan sedikit kedodoran pada eksekusinya', 'singkat hereafter percaya menjunjung tema after life sayang kenyataannya naskah ditulis peter morgan berdiri kuat datar kedodoran eksekusinya', 'singkat hereafter percaya junjung tema after life sayang nyata naskah tulis peter morgan diri kuat datar kedodoran eksekusi'),
(704, 721, 'i am number four memulai franchise dengan kurang meyakinkan ia tampak seperti sebuah serial televisi dengan durasi panjang ketimbang sebuah film kali ini harus diakui caruso gagal mengolah adegan per adegannya dengan maksimal masih terlalu banyak momen datar repetitif membosankan dan cheesy di  durasinya', 'i am number four franchise serial televisi durasi ketimbang film kali diakui caruso gagal mengolah adegan adegannya maksimal momen datar repetitif membosankan cheesy  durasinya', 'i am number four franchise serial televisi durasi ketimbang film kali aku caruso gagal mengolah adegan adegan maksimal momen datar repetitif bosan cheesy  durasi'),
(705, 722, 'beberapa momennya terasa terlalu berlebihan saya masih belum menyebut plot hole dan ketidak konsistenan yang bertaburan di sana sini tetapi saya percaya penontonnya terlalu sibuk memofuskan semuanya pada lee yong gu dan ye sung sampai lupa untuk memikirkan bagaimana sebuah penjara dapat semudah itu dibuat keluar masuk', 'momennya menyebut plot hole ketidak konsistenan bertaburan percaya penontonnya sibuk memofuskan lee yong gu ye sung lupa memikirkan penjara semudah masuk', 'momen sebut plot hole tidak konsisten tabur percaya tonton sibuk memofuskan lee yong gu ye sung lupa pikir penjara mudah masuk'),
(706, 723, 'mr poppers penguins seperti bukunya ia memang ditujukan buat ranah penonton anak-anak atau setidaknya ditonton bersama anak-anak adik atau keponakan anda tidak ada yang istimewa di sini ceritanya yang ringan terlalu mudah ditebak guyonannya datar termasuk dengan ada atau tidak adanya nama besar jim carrey sekalipun', 'mr poppers penguins bukunya ranah penonton anak-anak ditonton anak-anak adik keponakan istimewa ceritanya ringan mudah ditebak guyonannya datar nama jim carrey', 'mr poppers penguins buku ranah tonton anak tonton anak adik keponakan istimewa cerita ringan mudah tebak guyon datar nama jim carrey'),
(707, 724, 'ya sebagai sebuah sekuel now you see me  memang boleh lebih besar dan lebih meriah tetapi apalah arti itu semua jika kamu terus menguap di satu jam pertamanya dengan segala pengulangan plot yang harus diakui kualitasnya jauh lebih buruk dari seri pertamanya entah apa yang ingin ditonjolkan di sini', 'ya sekuel now you see me  meriah apalah arti menguap jam pertamanya pengulangan plot diakui kualitasnya buruk seri pertamanya ditonjolkan', 'ya sekuel now you see me  riah apa arti uap jam pertama ulang plot aku kualitas buruk seri pertama tonjol'),
(708, 725, ' ya kamu bisa saja memotong elemen horornya dan ia tetap akan bisa berjalan normal layaknya puluhan adaptasi pride and prejudice lainnya tetapi itu bukan pujian apalagi ternyata dominasi jane austen juga tidak bekerja dengan baik hasilnya hambar dan membosankan', ' ya memotong elemen horornya berjalan normal layaknya puluhan adaptasi pride and prejudice pujian dominasi jane austen hasilnya hambar membosankan', ' ya potong elemen horor jalan normal layak puluh adaptasi pride and prejudice puji dominasi jane austen hasil hambar bosan'),
(709, 726, 'memang masih ada momen intens di dalamnya yang melibatkan serangan mayat hidup yang agresif yang melibatkan darah dan gore tetapi tidak ada yang benar-benar meninggalkan kesan berarti belum lagi saya menyebutkan hampir semua karakternya sangat bodoh disaat mereka mengambil keputusan yang seharusnya bisa dengan sangat mudah dilakukan terutama menjelang akhir yang kacau dan menggelikan serta kemunculan twist yang serba memaksa', 'momen intens dalamnya melibatkan serangan mayat hidup agresif melibatkan darah gore benar-benar meninggalkan kesan karakternya bodoh disaat mengambil keputusan mudah menjelang kacau menggelikan serta kemunculan twist serba memaksa', 'momen intens dalam libat serang mayat hidup agresif libat darah gore benar tinggal kesan karakter bodoh saat ambil putus mudah jelang kacau geli serta muncul twist serba paksa'),
(710, 727, 'sangat disayangkan dupieux tidak mampu menjaga ritme film ini dengan baik segera setelah  menit yang sangat menghibur itu berlalu rubber seakan-akan kehilangan arah menjadi sebuah film tanpa tujuan dengan cerita yang tidak jelas dan hanya berputar-putar di tempat adegan yang terkesan diulang-ulang bahkan seburuk-buruknya horror kelas b saja masih bisa tampil lebih baik dalam bercerita ketimbang horror produksi perancis satu ini semua itu masih diperparah lagi dengan rangkaian plot hole yang bertebaran di sepanjang film apalagi di saat bersamaan dupieux memaksakan dunia nyata dan fantasi bercampur menjadi satu menghasilkan sebuah kisah yang terkesan amburadul dengan guyonan black comedy yang super datar membosankan dan diakhiri dengan ending yang sangat buruk ', 'disayangkan dupieux menjaga ritme film  menit menghibur rubber seakan-akan kehilangan arah film tujuan cerita berputar-putar adegan terkesan diulang-ulang seburuk-buruknya horror kelas b tampil bercerita ketimbang horror produksi perancis diperparah rangkaian plot hole bertebaran film bersamaan dupieux memaksakan dunia nyata fantasi bercampur menghasilkan kisah terkesan amburadul guyonan black comedy super datar membosankan ending buruk ', 'sayang dupieux jaga ritme film  menit hibur rubber akan hilang arah film tuju cerita putar adegan kesan ulang buruk horror kelas b tampil cerita ketimbang horror produksi perancis parah rangkai plot hole tebar film sama dupieux paksa dunia nyata fantasi campur hasil kisah kesan amburadul guyon black comedy super datar bosan ending buruk '),
(711, 728, 'tidak peduli seberapa usangnya formula yang diusung seberapa cheesy dan klise adegan-adegan yang disajikan atau dangkalnya naskah plus semakin banyaknya komedi yang disuguhkan harus diakui scream  tetap memberikan sebuah tontonan slasher menghibur sekaligus mengobati rasa kangen sebagian penontonnya', 'peduli usangnya formula diusung cheesy klise adegan-adegan disajikan dangkalnya naskah plus banyaknya komedi disuguhkan diakui scream  tontonan slasher menghibur mengobati kangen penontonnya', 'peduli usang formula usung cheesy klise adegan saji dangkal naskah plus banyak komedi suguh aku scream  tonton slasher hibur obat kangen tonton'),
(712, 729, 'tanpa embel-embel kisah nyata seharusnya naskah garapan kreator serial televisi sons of anarchy kurt sutter ini bisa menghadirkan sesuatu yang setidaknya bisa sedikit keluar dari zona nyaman sekali lagi itu bukan masalah besar menggunakan formula tradisional yang sama yang sudah bolak-balik dipakai memang imbasnya membuat southpaw menjadi begitu klise ', 'embel-embel kisah nyata naskah garapan kreator serial televisi sons of anarchy kurt sutter menghadirkan zona nyaman formula tradisional bolak-balik dipakai imbasnya southpaw klise ', 'embel kisah nyata naskah garap kreator serial televisi sons of anarchy kurt sutter hadir zona nyaman formula tradisional bolak-balik pakai imbas southpaw klise '),
(713, 730, 'film ini memang hanya sekedar hiburan murni yang hanya sekali lagi hanya menjual tarian-tarian semata jadi tidak usah protes jika kualitas akting dan ceritanya terbilang sangat standar jika tidak mau dikatakan buruk', 'film sekedar hiburan murni menjual tarian-tarian protes kualitas akting ceritanya terbilang standar buruk', 'film sekedar hibur murni jual tarian protes kualitas akting cerita bilang standar buruk'),
(714, 731, 'ketimbang memperhatikan plot yang semestinya bisa memberi kekuatan dan hati tersendiri dengan segala usaha ted membuktikan kemanusiaannya dan persamaan hak macfarlane malah terlalu sibuk menyajikan canda gurau dan kekonyolan toilet yang sayang seperti saya bilang di atas basi garing dan tidak sampai seofensif dulu', 'ketimbang memperhatikan plot semestinya kekuatan hati tersendiri usaha ted membuktikan kemanusiaannya persamaan hak macfarlane sibuk menyajikan canda gurau kekonyolan toilet sayang bilang basi garing seofensif', 'ketimbang hati plot mesti kuat hati sendiri usaha ted bukti manusia sama hak macfarlane sibuk saji canda gurau konyol toilet sayang bilang basi garing ofensif'),
(715, 732, 'kalau mau jujur horor produksi bbc films ini sebenarnya tidak terlalu menakutkan setidaknya buat saya ia tampak terlalu familiar kejutan-kejutannya tampak terlalu teratur termasuk twist endingnya sendiri seperti modifkasi dari yang pernah ada bahkan kita sudah bisa melihat bagaimana ia akan berakhir dari kejauhan', 'jujur horor produksi bbc films menakutkan familiar kejutan-kejutannya teratur twist endingnya modifkasi kejauhan', 'jujur horor produksi bbc films takut familiar kejut atur twist endingnya modifkasi jauh'),
(716, 733, 'kehilangan ritmenya di paruh keduanya karakter-karakter yang tidak menarik dan rentetan plot hole menganga menjadikannya bulan-bulanan cacian dan hinaan dari kebanyakan penontonnya untung saja saya tidak sekejam mereka saya masih dapat menikmatinya dengan baik menutup sebelah mata saya terhadap segala kekurangannya kecuali penampakan aliennya yang buruk itu', 'kehilangan ritmenya paruh karakter-karakter menarik rentetan plot hole menganga menjadikannya bulan-bulanan cacian hinaan kebanyakan penontonnya untung sekejam menikmatinya menutup sebelah mata kekurangannya kecuali penampakan aliennya buruk', 'hilang ritme paruh karakter tarik rentet plot hole menganga jadi bulan caci hina banyak tonton untung kejam nikmat tutup sebelah mata kurang kecuali tampak aliennya buruk'),
(717, 734, 'jika anda salah satu penonton yang protes mengenai lemahnya kualitas cerita the green hornet jangan melulu menyalahkan gondry salahkan saja seth rogen dan evan goldberg orang paling bertanggung jawab dibalik penulisan naskah film ini goldberg yang sebelumnya sudah bolak balik bekerja sama dengan rogen yang juga mengambil alih peran utama sebagai karakter britt reid disini sepertinya berupaya keras mencoba menghadirkan kisah superhero yang berbeda dan lebih manusiawi dibanding versi radio maupun serial televisinya dengan tidak lupa banyak memasukan unsur-unsur komedi khas rogen yang mungkin akan terasa garing bagi sebagian penontonnya', 'salah penonton protes lemahnya kualitas cerita the green hornet melulu menyalahkan gondry salahkan seth rogen evan goldberg orang bertanggung dibalik penulisan naskah film goldberg bolak rogen mengambil alih peran utama karakter britt reid berupaya keras mencoba menghadirkan kisah superhero berbeda manusiawi dibanding versi radio serial televisinya lupa memasukan unsur-unsur komedi khas rogen garing penontonnya', 'salah tonton protes lemah kualitas cerita the green hornet melulu salah gondry salah seth rogen evan goldberg orang tanggung balik tulis naskah film goldberg bolak rogen ambil alih peran utama karakter britt reid upaya keras coba hadir kisah superhero beda manusiawi banding versi radio serial televisi lupa masuk unsur komedi khas rogen garing tonton'),
(718, 735, 'ia juga dapat membuat beberapa penontonnya merasa tidak nyaman terutama ketika champan terlalu berlebihan mengekspos semangat anti agama di dalamnya melalui rangkaian dialog-dialognya yang tajam', 'penontonnya nyaman champan mengekspos semangat anti agama dalamnya rangkaian dialog-dialognya tajam', 'tonton nyaman champan ekspos semangat anti agama dalam rangkai dialog tajam'),
(719, 736, 'untuk ukuran sebuah crime drama pines terasa terlalu panjang meskipun tidak sampai bertele-tele namun pesonanya mulai luntur setelah cianfrance dengan berani menghilangkan gosling terlalu cepat tepat di saat karakter yang dimainkannya itu tengah mencapai puncaknya', 'ukuran crime drama pines bertele-tele pesonanya luntur cianfrance berani menghilangkan gosling cepat karakter dimainkannya mencapai puncaknya', 'ukur crime drama pines tele pesona luntur cianfrance berani hilang gosling cepat karakter main capai puncak'),
(720, 737, 'takahashi sepertinya tidak ingin memberikannya begitu saja karena apa yang terjadi di paruh kedua adalah rentetan ketidakjelasan demi ketidakjelasan alih-alih semakin menarik the sylvian experiments malah berpotensi menjadi tontonan yang aneh membingungkan dan membosankan', 'takahashi memberikannya paruh rentetan ketidakjelasan ketidakjelasan alih-alih menarik the sylvian experiments berpotensi tontonan aneh membingungkan membosankan', 'takahashi berik paruh rentet ketidakjelasan ketidakjelasan alih tarik the sylvian experiments potensi tonton aneh bingung bosan'),
(721, 738, 'sebenarnya kalau mau jujur the dark world mungkin sedikit berada di bawah ekpektasi saya dan ini juga mungkin dirasakan oleh penonton yang lain terlebih sebelumnya sudah menonton trailernya terlebih dahulu', 'jujur the dark world ekpektasi dirasakan penonton menonton trailernya', 'jujur the dark world ekpektasi rasa tonton tonton trailer'),
(722, 739, 'jujur saja susah buat saya bisa untuk menikmatinya untuk kualitas cerita yang digarap anggy berserta andi awwe wijaya bene dion rajagukguk terasa terlalu absurd dan tanpa arah yang jelas bahkan film-film warkop terdahulu saja tidak sampai seaneh seliar dan senorak ini dengan segala macam kehebohan yang tak wajar dan lebih parah', 'jujur susah menikmatinya kualitas cerita digarap anggy berserta andi awwe wijaya bene dion rajagukguk absurd arah film-film warkop seaneh seliar senorak kehebohan wajar parah', 'jujur susah nikmat kualitas cerita garap anggy serta andi awwe wijaya bene dion rajagukguk absurd arah film warkop aneh liar norak heboh wajar parah'),
(723, 740, 'berjalan dalam tempo lambat dengan aura depressing yang kental serta pengunaan teknik long take dan kamera statis yang banyak mendominasi setiap adegannya we are what we are jelas menjadi tidak mudah dikonsumsi oleh semua penontonnya terutama bagi mereka yang terlalu berharap banyak akan suguhan kekerasan berlebih atau sebuah torture porn dan gore fest konvensional', 'berjalan tempo lambat aura depressing kental serta pengunaan teknik long take kamera statis mendominasi adegannya we are what we are mudah dikonsumsi penontonnya berharap suguhan kekerasan berlebih torture porn gore fest konvensional', 'jalan tempo lambat aura depressing kental serta pengunaan teknik long take kamera statis dominasi adegan we are what we are mudah konsumsi tonton harap suguh kerasan lebih torture porn gore fest konvensional'),
(724, 741, 'sayang lagi-lagi sayang sebagai fokus cerita sosok apocalypse sendiri terbilang mengecewakan mengingat kebesaran namanya sebagai mutan pertama dan terkuat tidak ada motif yang jelas selain kehancuran total tidak ada kekejaman luar biasa', 'sayang lagi-lagi sayang fokus cerita sosok apocalypse terbilang mengecewakan kebesaran namanya mutan terkuat motif kehancuran total kekejaman', 'sayang lagi sayang fokus cerita sosok apocalypse bilang kecewa besar nama mutan kuat motif hancur total kejam'),
(725, 742, 'shimizu mulai unjuk gigi ia membawa teror horor ala asia khususnya j-horror ke dalam kabin pesawat komersial amerika yang sempit mempermainkan rasa penasaran penontonnya untuk mengulik misteri tentang apa yang sebenarnya terjadi bersama rentetan teror yang dibangun merayap', 'shimizu unjuk gigi membawa teror horor ala asia j-horror kabin pesawat komersial amerika sempit mempermainkan penasaran penontonnya mengulik misteri rentetan teror dibangun merayap', 'shimizu unjuk gigi bawa teror horor ala asia j horror kabin pesawat komersial amerika sempit main penasaran tonton ulik misteri rentet teror bangun rayap');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(726, 743, 'setiap ketenangan tanpa dialog menciptakan rasa tak nyaman dan gelisah setiap emosi dihadirkan haigh begitu nyata tanpa manipulasi terbentuk dari setiap gestur tubuh dan tatapan mata yang berhasil dibawakan dengan sangat luar biasa oleh charlotte rampling dan tom courtenay sebagai pasangan lansia', 'ketenangan dialog menciptakan nyaman gelisah emosi dihadirkan haigh nyata manipulasi terbentuk gestur tubuh tatapan mata berhasil dibawakan charlotte rampling tom courtenay pasangan lansia', 'tenang dialog cipta nyaman gelisah emosi hadir haigh nyata manipulasi bentuk gestur tubuh tatap mata hasil bawak charlotte rampling tom courtenay pasang lansia'),
(727, 744, 'persahabatan cinta dan perjalanan hebat ya  cm punya semua hal-hal bagus untuk menjadikannya sebuah drama adaptasi yang keren bahkan teknisnya pun juga fantastis yang paling terlihat adalan bagaimana rizal bersama dop yudi datau dan penata artistik vida sylvia tahu benar bagaimana mengeksploitasi gambar-gambar cantik nan puitis', 'persahabatan cinta perjalanan hebat ya  cm hal-hal bagus menjadikannya drama adaptasi keren teknisnya fantastis adalan rizal dop yudi datau penata artistik vida sylvia mengeksploitasi gambar-gambar cantik nan puitis', 'sahabat cinta jalan hebat ya  cm hal bagus jadi drama adaptasi keren teknis fantastis adalan rizal dop yudi datau tata artistik vida sylvia eksploitasi gambar cantik nan puitis'),
(728, 745, 'michael fassbender pun memerankan jung dengan sangat mengesankan timing dalam melontarkan dialog dalam debat dan diskusinya dengan emma jungsarah gadon juga freud dan spielrein sangat relatable dan juga membuat hati saya berbunga-bunga saya rasa jika anda familiar dengan teori-teori jung akan merasakan hal yang sama', 'michael fassbender memerankan jung mengesankan timing melontarkan dialog debat diskusinya emma jungsarah gadon freud spielrein relatable hati berbunga-bunga familiar teori-teori jung merasakan', 'michael fassbender peran jung kesan timing lontar dialog debat diskusi emma jungsarah gadon freud spielrein relatable hati bunga familiar teori jung rasa'),
(729, 746, 'maka inilah a simple life sebuah drama sederhana berhati besar yang begitu banyak menawarkan kehangatan kasih sayang dan cinta dari sosok yang begitu dekat dengan kita dan bagaimana kita membalas dengan sepantasnya ya saya suka bagaimana ia akan menguras sisi emosionalmu tanpa harus menjadi kelewat sentimentil', 'a simple life drama sederhana berhati menawarkan kehangatan kasih sayang cinta sosok membalas ya suka menguras sisi emosionalmu kelewat sentimentil', 'a simple life drama sederhana hati tawar hangat kasih sayang cinta sosok balas ya suka uras sisi emosional lewat sentimentil'),
(730, 747, 'adakah sesuatu yang membedakan all the boys love mandy lane dengan film-film setipe ada dan itu ada dalam karakter mandy lane yang diperankan dengan sangat baik oleh si cantik amber hard ya sutradara jonathan levine sukses memaksimalkan keunggulan fisik dan akting artis  tahun ini dalam membawakan karakter mandy lane dengan pengambilan sudut-sudut kamera cantik yang sepertinya memang sengaja ditempatkan untuk lebih menyorot sosok mandy lane yang jelita', 'adakah membedakan all the boys love mandy lane film-film setipe karakter mandy lane diperankan si cantik amber hard ya sutradara jonathan levine sukses memaksimalkan keunggulan fisik akting artis  membawakan karakter mandy lane pengambilan sudut-sudut kamera cantik sengaja ditempatkan menyorot sosok mandy lane jelita', 'ada bedak all the boys love mandy lane film tipe karakter mandy lane peran si cantik amber hard ya sutradara jonathan levine sukses maksimal unggul fisik akting artis  bawak karakter mandy lane ambil sudut kamera cantik sengaja tempat sorot sosok mandy lane jelita'),
(731, 748, 'cameron bisa dengan bebas untuk mengekspresikan kreasinya dan imajinasinya dalam teknologi komputer yang super canggih dan juga super mahal ini avatar jelas adalah sebuah film yang layak dimasukan dalam daftar film terbaik  anda atau mungkin salah satu film terbaik sepanjang masa dengan segala kelebihannya yang luar biasa', 'cameron bebas mengekspresikan kreasinya imajinasinya teknologi komputer super canggih super mahal avatar film layak dimasukan daftar film terbaik  salah film terbaik kelebihannya', 'cameron bebas ekspresi kreasi imajinasi teknologi komputer super canggih super mahal avatar film layak masuk daftar film baik  salah film baik lebih'),
(732, 749, 'tidak terlalu frontal memang dalam usahanya menyampaikan pesan-pesan tentang isu sensitifnya bahkan harus diakui ia masih terlihat malu-malu tapi bagaimanapun itu ia sudah berhasil membuat saya menyukai film ini bukan karena saya ingin terlihat sebagai seorang penonton sok cerdas yang bisa menginterpretasi dengan mudah setiap momen absurd di dalamnya bukan bahkan saya masih harus melihat referensi dari para reviewer lain untuk itu', 'frontal usahanya pesan-pesan isu sensitifnya diakui malu-malu berhasil menyukai film penonton sok cerdas menginterpretasi mudah momen absurd dalamnya referensi reviewer', 'frontal usaha pesan isu sensitif aku malu hasil suka film tonton sok cerdas interpretasi mudah momen absurd dalam referensi reviewer'),
(733, 750, 'kudos jelas pantas disematkan kepada kedua pemain utamanya khususnya bagi yeong hie seo yang bermain luar biasa di sini perannya sebagai wanita yang tertindas sukses dibawakannya dengan apik sampai-sampai membuat pesona dan kecantikan ji sung won seakan-akan tenggelam dibawah bayang-bayangnya tidak salah berkat akting fenomenalnya di sini yeong hie seo kemudian banyak mendapatkan penghargaan sebagai artis terbaik di ajang-ajang festival film bergengsi', 'kudos disematkan pemain utamanya yeong hie seo bermain perannya wanita tertindas sukses dibawakannya apik pesona kecantikan ji sung won seakan-akan tenggelam dibawah bayang-bayangnya salah berkat akting fenomenalnya yeong hie seo penghargaan artis terbaik ajang-ajang festival film bergengsi', 'kudos semat main utama yeong hie seo main peran wanita tindas sukses bawak apik pesona cantik ji sung won akan tenggelam bawah bayang salah berkat akting fenomenal yeong hie seo harga artis baik ajang festival film gengsi'),
(734, 751, 'pada akhirnya semua keberanian tabu itu berhasil diselaraskan dengan penampilan apik nan emosional dari kedua pemainnya khususnya buat exarchopoulos yang tampil luar biasa mengesankan menggerakkan narasi sederhana kechiche bersama setiap kerapuhan kegelisahan dan energi yang dibawa karakternya dari ia remaja sampai menuju kedewasaan dalam sebuah proses transformasi yang meyakinkan', 'keberanian tabu berhasil diselaraskan penampilan apik nan emosional pemainnya exarchopoulos tampil mengesankan menggerakkan narasi sederhana kechiche kerapuhan kegelisahan energi dibawa karakternya remaja kedewasaan proses transformasi', 'berani tabu hasil selaras tampil apik nan emosional main exarchopoulos tampil kesan gerak narasi sederhana kechiche rapuh gelisah energi bawa karakter remaja dewasa proses transformasi'),
