(736, 753, 'dari awal film disuguhkan visualisasi robot-robot yang sangat realistis membuat saya mengkhayal mengenai universe di mana semua hal itu benar ada film ini tidak secara literal mereferensi  laws of robotic dari isaac asimov tetapi jika ditilik secara keseluruhan masih ada secara implisit mengacu ke sana', 'film disuguhkan visualisasi robot-robot realistis mengkhayal universe film literal mereferensi  laws of robotic isaac asimov ditilik implisit mengacu', 'film suguh visualisasi robot realistis mengkhayal universe film literal referensi  laws of robotic isaac asimov tilik implisit acu'),
