(739, 756, 'drama milik stephen daldry punya segalanya untuk menjadikan dirinya pantas bersaing dengan kandidat film-film terbaik lainnya di ajang paling bergengsi untuk dunia perfilman itu kombinasi dari kejadian nyata dan drama emosional nan menyentuh plus presentasi apik serta akting kuat dari aktor ciliknya menjadikan extremely loud  incredibly close salah satu drama terbaik tahun lalu', 'drama milik stephen daldry menjadikan bersaing kandidat film-film terbaik ajang bergengsi dunia perfilman kombinasi kejadian nyata drama emosional nan menyentuh plus presentasi apik serta akting kuat aktor ciliknya menjadikan extremely loud  incredibly close salah drama terbaik', 'drama milik stephen daldry jadi saing kandidat film baik ajang gengsi dunia film kombinasi jadi nyata drama emosional nan sentuh plus presentasi apik serta akting kuat aktor cilik jadi extremely loud  incredibly close salah drama baik'),
(740, 757, 'johannes roberts sang sutradara juga terbilang cukup lihai membangun atmosfer eerie yang menakutkan ketimbang menegangkan sepanjang film penonton akan merasakan bagaimana pergerakan kamera dan iringan scoring mengerikan menjadi kombinasi maut yang meneror indra penglihatan dan pendengaran kita ya inilah bagian terbaik dari film produksi inggris ini', 'johannes roberts sang sutradara terbilang lihai membangun atmosfer eerie menakutkan ketimbang menegangkan film penonton merasakan pergerakan kamera iringan scoring mengerikan kombinasi maut meneror indra penglihatan pendengaran ya terbaik film produksi inggris', 'johannes roberts sang sutradara bilang lihai bangun atmosfer eerie takut ketimbang tegang film tonton rasa gerak kamera iring scoring erik kombinasi maut teror indra lihat dengar ya baik film produksi inggris'),
(741, 758, 'duet sutradara conrad vernon dan greg tiernan tahu benar bagaimana mengimplementasikan kegilaan naskah yang ditulis rogen dan golberg yang turut dibantu kyle hunter dan ariel shaffir menjadi sebuah gelaran animasi dalam balutan elemen petualangan dan romantika yang menyenangkan sekaligus disturbing', 'duet sutradara conrad vernon greg tiernan mengimplementasikan kegilaan naskah ditulis rogen golberg dibantu kyle hunter ariel shaffir gelaran animasi balutan elemen petualangan romantika menyenangkan disturbing', 'duet sutradara conrad vernon greg tiernan implementasi gila naskah tulis rogen golberg bantu kyle hunter ariel shaffir gelar animasi balut elemen tualang romantika senang disturbing'),
(742, 759, 'proses menarik dihadirkan dengan mulus penuh kehangatan oleh hancock bersama segala set los angeles dekade  yang menyakinkan dan  tentu saja kebesaran pesona thompson sendiri termasuk juga pengaruh besar dari karakter-karakter lain', 'proses menarik dihadirkan mulus penuh kehangatan hancock set los angeles dekade  menyakinkan  kebesaran pesona thompson pengaruh karakter-karakter', 'proses tarik hadir mulus penuh hangat hancock set los angeles dekade  menyakinkan  besar pesona thompson pengaruh karakter'),
