(746, 763, 'jadi secara keseluruhan tampan tailor sudah memberikan sebuah drama inspiratif emosional yang menarik dengan segala profesi tukang jahit hubungan ayah-anak dan perjuangan dalam menjalani kehidupan dengan semangat pantang menyerah', 'tampan tailor drama inspiratif emosional menarik profesi tukang jahit hubungan ayah-anak perjuangan menjalani kehidupan semangat pantang menyerah', 'tampan tailor drama inspiratif emosional tarik profesi tukang jahit hubung ayah anak juang jalan hidup semangat pantang serah'),
