(750, 767, 'chemistry lepas gardner dan cronheim memberi banyak keceriaan untuk sub genre horor yang seharusnya kelam ini perbincangan santai mereka akan hobi makanan sampai wanita memberi sentuhan manusiawi pada narasinya lengkap dengan iring-iringan playlist musik country dari pemutar musik milik mickey', 'chemistry lepas gardner cronheim keceriaan sub genre horor kelam perbincangan santai hobi makanan wanita sentuhan manusiawi narasinya lengkap iring-iringan playlist musik country pemutar musik milik mickey', 'chemistry lepas gardner cronheim ceria sub genre horor kelam bincang santai hobi makan wanita sentuh manusiawi narasi lengkap iring playlist musik country putar musik milik mickey'),
(751, 768, 'breck eisner sukses menghadirkan sebuah horror penuh ketegangan dan mengasyikkan tanpa terlalu banyak basa-basi dan tensi yang terjaga dengan baik dari awal hingga akhir dengan ceritanya yang sederhana dan ringan kita benar-benar diajak kedalam dunia the crazies yang sunyi dan gelap', 'breck eisner sukses menghadirkan horror penuh ketegangan mengasyikkan basa-basi tensi terjaga ceritanya sederhana ringan benar-benar diajak kedalam dunia the crazies sunyi gelap', 'breck eisner sukses hadir horror penuh tegang asyik basa-basi tensi jaga cerita sederhana ringan benar ajak dalam dunia the crazies sunyi gelap'),
(752, 769, 'kualitas animasi yang bagus komedi yang sukses menghadirkan gelak tawa d menawan lanskap karakter unik serta segudang pesan moral dan ini bukan disney dengan pixar nya ya sekali lagi dreamworks animation membuktikan bawha mereka juga sanggup menghadirkan sebuah kualitas animasi jempolan yang dapat dinikmati semua umur seperti rival abadinya itu', 'kualitas animasi bagus komedi sukses menghadirkan gelak tawa d menawan lanskap karakter unik serta segudang pesan moral disney pixar nya ya dreamworks animation membuktikan bawha sanggup menghadirkan kualitas animasi jempolan dinikmati umur rival abadinya', 'kualitas animasi bagus komedi sukses hadir gelak tawa d tawan lanskap karakter unik serta gudang pesan moral disney pixar nya ya dreamworks animation bukti bawha sanggup hadir kualitas animasi jempol nikmat umur rival abadi'),
(753, 770, 'saya senang bagaimana karakter sarah moss milik marling berkembang dari a-z di sepanjang filmnya bagaimana secara perlahan namun pasti terjadi pergelutan antara kepentingan yang saling tarik menarik dan benturan moral krisis identitas serta elemen romance yang sedikit banyak sudah mengubah dirinya dan kamu tahu lagi-lagi marling membawakan setiap detik karakternya bersama akting memesona', 'senang karakter sarah moss milik marling berkembang a-z filmnya perlahan pergelutan kepentingan tarik menarik benturan moral krisis identitas serta elemen romance mengubah lagi-lagi marling membawakan detik karakternya akting memesona', 'senang karakter sarah moss milik marling kembang a-z film perlahan gelut penting tarik tarik bentur moral krisis identitas serta elemen romance ubah lagi marling bawak detik karakter akting pesona'),
(754, 771, ' di balik segala konsep homage brilian yang digabungkan dengan elemen fantasi kreatif tersembunyi drama relasi ibu-anak drama tentang duka dan tentang kehilangan orang tercinta serta bagaimana melanjutkan hidup yang secara mengejutkan mampu menghadirkan emosi tersendiri kudos buat penampilan apik taissa farmiga dan malin akerman yang memberikan hati dan emosi buat the final girls dengan chemistry anak-ibu yang kuat', ' konsep homage brilian digabungkan elemen fantasi kreatif tersembunyi drama relasi ibu-anak drama duka kehilangan orang tercinta serta melanjutkan hidup mengejutkan menghadirkan emosi tersendiri kudos penampilan apik taissa farmiga malin akerman hati emosi the final girls chemistry anak-ibu kuat', ' konsep homage brilian gabung elemen fantasi kreatif sembunyi drama relasi ibu anak drama duka hilang orang cinta serta lanjut hidup kejut hadir emosi sendiri kudos tampil apik taissa farmiga malin akerman hati emosi the final girls chemistry anak ibu kuat'),
(755, 772, 'ya kita tahu pixar adalah jagonya membuat animasi menakjubkan dan the good dinosaurs adalah salah satu mahakarya terbaik mereka ketika berbicara soal bagaimana visualnya dihadirkan lanskap-lanskap amerika utara pra sejarah dengan sedikit sentuhan western tergambar tidak hanya begitu detil namun juga begitu cantik dan nyaris terlihat nyata lihat saja rendering photo-realistic air dan vegetasinya yang sempurna', 'ya pixar jagonya animasi menakjubkan the good dinosaurs salah mahakarya terbaik berbicara visualnya dihadirkan lanskap-lanskap amerika utara pra sejarah sentuhan western tergambar detil cantik nyata lihat rendering photo-realistic air vegetasinya sempurna', 'ya pixar jago animasi takjub the good dinosaurs salah mahakarya baik bicara visual hadir lanskap amerika utara pra sejarah sentuh western gambar detil cantik nyata lihat rendering photo realistic air vegetasi sempurna'),
(756, 773, 'the hidden fortress merupakan salah satu film hitam putih yang nyaman dan enak untuk di tonton oleh semua kalangan bukan hanya ceritanya yang mudah diikuti tapi juga mempunyai banyak pesan moral setting film yang di gunakan juga sangat luar biasa', 'the hidden fortress salah film hitam putih nyaman enak tonton kalangan ceritanya mudah diikuti pesan moral setting film', 'the hidden fortress salah film hitam putih nyaman enak tonton kalang cerita mudah ikut pesan moral setting film'),
(757, 774, 'secara keseluruhan ini adalah adaptasi yang baik bahkan lebih baik dengan keempat seri twilight sekalipun jika digabungkan pesonanya ada pada sosok alien berjiwa murni yang dibawakan ronan dengan solid lalu ditambah naskah berisi dan penyutradaraan niccol yang pas plus sinematografi cantik menjadikan the host salah satu drama fiksi ilmiah yang bagus di genrenya', 'adaptasi keempat seri twilight digabungkan pesonanya sosok alien berjiwa murni dibawakan ronan solid ditambah naskah berisi penyutradaraan niccol pas plus sinematografi cantik menjadikan the host salah drama fiksi ilmiah bagus genrenya', 'adaptasi empat seri twilight gabung pesona sosok alien jiwa murni bawak ronan solid tambah naskah isi sutradara niccol pas plus sinematografi cantik jadi the host salah drama fiksi ilmiah bagus genre'),
(758, 775, 'layaknya sebuah sekuel catching fire tampil lebih meriah tidak hanya karena budget yang dinaikkan sampai dua kali lipat arena yang lebih mematikan atau parade kostum-kostumnya yang lebih keren namun juga karena diisi dengan para cast jempolan', 'layaknya sekuel catching fire tampil meriah budget dinaikkan kali lipat arena mematikan parade kostum-kostumnya keren diisi cast jempolan', 'layak sekuel catching fire tampil riah budget naik kali lipat arena mati parade kostum keren isi cast jempol'),
(759, 776, 'berbekal sisi rumit karakternya dan bagaimana turing menjalin hubungan dengan teman-temannya macam rekan wanitanya joan clarke keira knightley yang menjadi sahabat dalam suka dan dukanya plot the imitation game menjadi lebih menarik karena elemen-elemen pribadi dan psikologisnya ini mampu bersatu kuat dengan premis utamanya yang kemudian pada akhirnya menjadi bagian tak terpisahkan dalam pergerakan alurnya menginjak akhir film yang emosional itu', 'berbekal sisi rumit karakternya turing menjalin hubungan teman-temannya rekan wanitanya joan clarke keira knightley sahabat suka dukanya plot the imitation game menarik elemen-elemen pribadi psikologisnya bersatu kuat premis utamanya terpisahkan pergerakan alurnya menginjak film emosional', 'bekal sisi rumit karakter turing jalin hubung teman rekan wanita joan clarke ira knightley sahabat suka duka plot the imitation game tarik elemen pribadi psikologis satu kuat premis utama pisah gerak alur injak film emosional'),
(760, 777, 'the impossible tidak hanya bagaimana seorang ja bayona dengan meyakinkan menggambarkan sebuah tragedi terbesar yang pernah terjadi dalam sejarah manusia itu pernah terjadi dengan segala elemen-elemen dramatisasi tingkat tingginya namun ada sesuatu yang lebih dalam dari itu ketika sebuah semangat juang kekuatan dan harapan luar biasa yang tidak pernah padam dalam diri manusia-manusianya', 'the impossible ja bayona menggambarkan tragedi terbesar sejarah manusia elemen-elemen dramatisasi tingkat tingginya semangat juang kekuatan harapan padam manusia-manusianya', 'the impossible ja bayona gambar tragedi besar sejarah manusia elemen dramatisasi tingkat tinggi semangat juang kuat harap padam manusia'),
(761, 778, 'sebuah sajian intens mengasyikkan dengan kejutan-kejutan yang menghentak ya the imposter mungkin saja membuatmu lupa bahwa ini bahwa ini bukan sebuah thriller fiksi ini adalah sebuah dokumenter berterima kasihlah kepada layton yang mampu membuat kisah kuatnya menjadi lebih kuat dengan penyajian yang juga sama kuatnya dengan dasar cerita nyatanya itu sendiri', 'sajian intens mengasyikkan kejutan-kejutan menghentak ya the imposter membuatmu lupa thriller fiksi dokumenter berterima kasihlah layton kisah kuatnya kuat penyajian kuatnya dasar cerita', 'saji intens asyik kejutan menghentak ya the imposter buat lupa thriller fiksi dokumenter terima kasih layton kisah kuat kuat saji kuat dasar cerita'),
(762, 779, 'the man from nowhere harus diakui berhasil menyajikan sebuah sajian action thriller yang menarik dan seru hingga akhir apalagi ditunjang dengan penampilan seorang won bin yang sukses menampilkankehebatannya di sini dengan balutan aksi baku hantam dan tembak menembak tingkat tinggi yang jelas sangat menghibur', 'the man from nowhere diakui berhasil menyajikan sajian action thriller menarik seru ditunjang penampilan won bin sukses menampilkankehebatannya balutan aksi baku hantam tembak menembak tingkat menghibur', 'the man from nowhere aku hasil saji saji action thriller tarik seru tunjang tampil won bin sukses menampilkankehebatannya balut aksi baku hantam tembak tembak tingkat hibur'),
