(792, 809, 'ada rasa canggung dan tidak lepas terlihat di layar ada batasan tak terlihat yang seperti membuat mereka tidak maksimal menjadi pasangan suami istri yang sudah menikah lima tahun entah salah skenario atau fajar nugros yang tak maksimal memanfaatkan talenta mereka yang pasti saya tidak merasakan keintiman pasutri yang seharusnya', 'canggung lepas layar batasan maksimal pasangan suami istri menikah salah skenario fajar nugros maksimal memanfaatkan talenta merasakan keintiman pasutri', 'canggung lepas layar batas maksimal pasang suami istri meni salah skenario fajar nugros maksimal manfaat talenta rasa intim pasutri'),
(793, 810, 'overall a barefoot dream tidak lebih hanya sebuah film olahraga biasa ya memang diangkat dari kisah nyata tapi semua itu sudah bukan barang baru lagi alias basi', 'overall a barefoot dream film olahraga ya diangkat kisah nyata barang alias basi', 'overall a barefoot dream film olahraga ya angkat kisah nyata barang alias basi');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(794, 811, 'tidak ada dasar cerita yang kuat untuk menjelaskan kenapa hubungan rangga dan cinta kandas di tengah jalan meski pada akhirnya dijelaskan di sini tetapi saya tidak menemukan itu adalah alasan kuat yang cukup masuk di logika aadc  harus diakui memulainya dengan sedikit canggung dan lambat', 'dasar cerita kuat hubungan rangga cinta kandas jalan menemukan alasan kuat masuk logika aadc  diakui memulainya canggung lambat', 'dasar cerita kuat hubung rangga cinta kandas jalan temu alas kuat masuk logika aadc  aku mulai canggung lambat'),
(795, 812, 'namun sayang alice in wonderland versi burton ini rupanya tidak bisa dibilang karya terbaik sutradara yang sering tampil dalam rambut berantakan ini khususnya pada bagian storyline yang lemah dan terkesan datar-datar saja burton gagal membuat kisah petualangan kedua alice dalam negeri ajaib ini menjadi sebuah kisah yang dapat dinikmati semua kalangan konflik-konflik yang disajikan terbilang terlalu biasa kurang nendang dan kelewat bersahabat', 'sayang alice in wonderland versi burton dibilang karya terbaik sutradara tampil rambut berantakan storyline lemah terkesan datar-datar burton gagal kisah petualangan alice negeri ajaib kisah dinikmati kalangan konflik-konflik disajikan terbilang nendang kelewat bersahabat', 'sayang alice in wonderland versi burton bilang karya baik sutradara tampil rambut berantak storyline lemah kesan datar burton gagal kisah tualang alice negeri ajaib kisah nikmat kalang konflik saji bilang nendang lewat sahabat'),
(796, 813, 'menderita banyak di karakterisasi naskah yang lemah dan dialog-dialog yang ngalor-ngidul membosankan beruntung evans punya dop john guleserian yang mampu menjalankan tugasnya sementara beberapa kali terdengar soundtrack rock indie membantu menciptakan emosi yang gagal dihadirkan oleh narasi dan karakternya', 'menderita karakterisasi naskah lemah dialog-dialog ngalor-ngidul membosankan beruntung evans dop john guleserian menjalankan tugasnya kali terdengar soundtrack rock indie membantu menciptakan emosi gagal dihadirkan narasi karakternya', 'derita karakterisasi naskah lemah dialog ngalor-ngidul bosan untung evans dop john guleserian jalan tugas kali dengar soundtrack rock indie bantu cipta emosi gagal hadir narasi karakter'),
(797, 814, 'horor-thriller arthouse dengan aroma horor italia yang berjalan menjadi semakin rumit dibutuhkan perjuangan ekstra untuk melewati tidak hanya teror fisiknya yang berupa atmosfer creepy yang dipenuhi dengan ketakutan mental dan teror klaustrofobik namun juga bungkusan narasi dan presentasi ambigu', 'horor-thriller arthouse aroma horor italia berjalan rumit dibutuhkan perjuangan ekstra melewati teror fisiknya atmosfer creepy dipenuhi ketakutan mental teror klaustrofobik bungkusan narasi presentasi ambigu', 'horor thriller arthouse aroma horor italia jalan rumit butuh juang ekstra lewat teror fisik atmosfer creepy penuh takut mental teror klaustrofobik bungkus narasi presentasi ambigu'),
(798, 815, 'big game harus diakui memang menarik meskipun terasa konyol dalam praktiknya banyak terinspirasi dari action dekade  sampai  rangkaian aksinya dengan mudah dikunyah dan ditelan penontonnya begitu saja tetapi beberapa bagian semestinya bisa mendapatkan polesan lagi misalnya helender bisa memasukkan lebih banyak unsur survival daripada sekedar aksi cepat yang dangkal', 'big game diakui menarik konyol praktiknya terinspirasi action dekade   rangkaian aksinya mudah dikunyah ditelan penontonnya semestinya polesan helender memasukkan unsur survival sekedar aksi cepat dangkal', 'big game aku tarik konyol praktik inspirasi action dekade   rangkai aksi mudah kunyah telan tonton mesti poles helender masuk unsur survival sekedar aksi cepat dangkal'),
(799, 816, 'sulneir kemudian melanjutkan plotnya menjadi semakin kelam ke belakang merubah semuanya menjadi lebih buruk lagi ketika semakin banyak kekacauan tak terkendali yang seperti tak berujung', 'sulneir melanjutkan plotnya kelam merubah buruk kekacauan terkendali berujung', 'sulneir lanjut plot kelam rubah buruk kacauan kendali ujung'),
(800, 817, 'ini jelas mengecewakan meski faktanya wells masih memberikan penontonnya banyak penampakan-penampakan hidangan lezat hampir di sepanjang durasinya kita hanya menyaksikan adam yang terjatuh dan terjatuh lagi karena ego dan temperamental kemudian berusaha bangkit dan bangkit lagi ini seperti drama pencarian jati diri seorang laki-laki labil yang gagal move on dari masa lalu dengan kedok kuliner yang terkadang terlalu pretensius dan klise', 'mengecewakan faktanya wells penontonnya penampakan-penampakan hidangan lezat durasinya menyaksikan adam terjatuh terjatuh ego temperamental berusaha bangkit bangkit drama pencarian jati laki-laki labil gagal move on kedok kuliner terkadang pretensius klise', 'kecewa fakta wells tonton penampakan hidang lezat durasi saksi adam jatuh jatuh ego temperamental usaha bangkit bangkit drama cari jati laki labil gagal move on kedok kuliner terkadang pretensius klise'),
(801, 818, 'presentasinya terasa monoton momen ruang sempitnya menjadi senjata makan tua nketika narasinya harus memenjarakan mobilitas para karakternya adegan demi adegannya terasa repetitif temanya bergeser tidak konsisten dari misteri survival menjadi debat kusir tentang moral dan yang lebih mengecewakan lagi adalah akhir yang antiklimaks ya setelah mimpi buruk yang dilalui para tokohnya hann dan miscione memilih untuk menutupnya dengan cara yang bisa dibilang terlalu menggampangkan mereka seperti terlalu malas untuk memberi penjelasan panjang lebar alih-alih keduanya malah memilih ending macam itu untuk menutup misterinya dengan cara murahan', 'presentasinya monoton momen ruang sempitnya senjata makan tua nketika narasinya memenjarakan mobilitas karakternya adegan adegannya repetitif temanya bergeser konsisten misteri survival debat kusir moral mengecewakan antiklimaks ya mimpi buruk tokohnya hann miscione memilih menutupnya dibilang menggampangkan malas penjelasan lebar alih-alih memilih ending menutup misterinya murahan', 'presentasi monoton momen ruang sempit senjata makan tua nketika narasi penjara mobilitas karakter adegan adegan repetitif tema geser konsisten misteri survival debat kusir moral kecewa antiklimaks ya mimpi buruk tokoh hann miscione pilih tutup bilang gampang malas jelas lebar alih pilih ending tutup misteri murah'),
(802, 819, 'despicable me  sesungguhnya masih sama saja payahnya dalam hal bercerita tidak peduli ketika duet penulis naskah cinco paul dan ken daurio memberikan lebih banyak cinta di dalamnya atau kehadiran nama-nama baru macam kristen wigg atau benjamin bratt yang menggantikan al pacino yang mundur karena perbedaan pandangan', 'despicable me  sesungguhnya payahnya bercerita peduli duet penulis naskah cinco paul ken daurio cinta dalamnya kehadiran nama-nama kristen wigg benjamin bratt menggantikan al pacino mundur perbedaan pandangan', 'despicable me  sungguh payah cerita peduli duet tulis naskah cinco paul ken daurio cinta dalam hadir nama kristen wigg benjamin bratt ganti al pacino mundur beda pandang'),
(803, 820, 'sayangnya dolphin tale digarap terlalu biasa dengan penyajian ala film televisi anak-anak disney yang banyak menjual banyak keajaiban instan kebetulan-kebetulan bodoh ala sinetron dengan konflik-konflik yang terlalu dilebih-lebihkan ketimbang sebuah film layar lebar yang sudah menghabiskan biaya  juta dollar', 'sayangnya dolphin tale digarap penyajian ala film televisi anak-anak disney menjual keajaiban instan kebetulan-kebetulan bodoh ala sinetron konflik-konflik dilebih-lebihkan ketimbang film layar lebar menghabiskan biaya  juta dollar', 'sayang dolphin tale garap saji ala film televisi anak disney jual ajaib instan kebetulan bodoh ala sinetron konflik lebih ketimbang film layar lebar habis biaya  juta dollar'),
(804, 821, 'kalau mau jujur si echo jarang digunakan green dalam penceritaannya sebaliknya ia lebih memfokuskan segalanya kepada kuartet anak-anak clark country yang jujur saja buat saya terbilang gagal menghadirkan chemistry dan minimnya jalinan emosional antar karakter manusia dan alien membuat echo to earth terkesan datar-datar saja dari awal hingga akhir dalam balutan narasi garapan henry gayden yang menggampangkan segalanya', 'jujur si echo jarang green penceritaannya memfokuskan kuartet anak-anak clark country jujur terbilang gagal menghadirkan chemistry minimnya jalinan emosional karakter manusia alien echo to earth terkesan datar-datar balutan narasi garapan henry gayden menggampangkan', 'jujur si echo jarang green cerita fokus kuartet anak clark country jujur bilang gagal hadir chemistry minim jalin emosional karakter manusia alien echo to earth kesan datar balut narasi garap henry gayden gampang'),
(805, 822, 'sayang karakter-karakter yang disuarakan mereka sama sekali tidak mampu meninggalkan kesan dikarenakan wedge tampak lebih sibuk mengurus bagaimana epic bisa tampil mulus ketimbang memikirkan kedalaman karakternya yang ironisnya juga dipresentasikan biasa saja kalau tidak mau disebut kaku', 'sayang karakter-karakter disuarakan meninggalkan kesan wedge sibuk mengurus epic tampil mulus ketimbang memikirkan kedalaman karakternya ironisnya dipresentasikan kaku', 'sayang karakter suara tinggal kesan wedge sibuk urus epic tampil mulus ketimbang pikir dalam karakter ironis presentasi kaku'),
(806, 823, 'penonton seperti hanya diajak menyaksikan segala penyimpangan seksnya yang terkesan seperti bahan jualan murahan tanpa adanya kesan ia seperti tempelan kosong tanpa jiwa tanpa kemampuan untuk merangsang imajinasi liar penontonnya dari dalam hanya sebatas godaan visual yang bekerja tidak maksimal belum saya menyebut romansa klise dengan segala bumbu tarik ulurnya yang tidak jelas juntrungnya ', 'penonton diajak menyaksikan penyimpangan seksnya terkesan bahan jualan murahan kesan tempelan kosong jiwa kemampuan merangsang imajinasi liar penontonnya sebatas godaan visual maksimal menyebut romansa klise bumbu tarik ulurnya juntrungnya ', 'tonton ajak saksi simpang seks kesan bahan jual murah kesan tempel kosong jiwa mampu rangsang imajinasi liar tonton batas goda visual maksimal sebut romansa klise bumbu tarik ulur juntrung '),
(807, 824, 'saya bukan salah satu penggemar mainan ini jadi imbasnya saya cukup menikmati setiap menit yang dihadirkan chu ya retaliation memang tidak jauh berbeda dengan pendahulunya sama-sama menyajikan sebuah pop corn movie tanpa otak berisik yang di saat bersamaan akan memanjakan matamu chu juga tampaknya tidak pernah mencoba untuk mengendurkan tensinya termasuk menyuguhkan scene pertarungan antara snake eyes dan rival abadinya storm shadow berlanjut pada baku hantam di himalaya hingga akhirnya sebuah klimaks klise bersama bruce willis kemudian menutup aksi heroik nan klise', 'salah penggemar mainan imbasnya menikmati menit dihadirkan chu ya retaliation berbeda pendahulunya menyajikan pop corn movie otak berisik bersamaan memanjakan matamu chu mencoba mengendurkan tensinya menyuguhkan scene pertarungan snake eyes rival abadinya storm shadow berlanjut baku hantam himalaya klimaks klise bruce willis menutup aksi heroik nan klise', 'salah gemar main imbas nikmat menit hadir chu ya retaliation beda dahulu saji pop corn movie otak berisik sama manja mata chu coba kendur tensi suguh scene tarung snake eyes rival abadi storm shadow lanjut baku hantam himalaya klimaks klise bruce willis tutup aksi heroik nan klise'),
(808, 825, 'rudi soedjarwo tampak lebih banyak menyorot karakternya terlalu dekat ketimbang permainan sepak bola itu sendiri adegannya terlalu cepat untuk dapat dinikmati dengan baik dan endingnya ya mengapa harus dengan tendangan salto bukankah itu terlihat murahan seperti melihat iklan televisi', 'rudi soedjarwo menyorot karakternya ketimbang permainan sepak bola adegannya cepat dinikmati endingnya ya tendangan salto murahan iklan televisi', 'rudi soedjarwo sorot karakter ketimbang main sepak bola adegan cepat nikmat endingnya ya tendang salto murah iklan televisi'),
(809, 826, 'sayang meskipun cukup lucu dan didukung kualitas animasi yang jauh dari kata memalukan harus diakui semua itu hanya berada dalam batasan hiburan ringan belaka di mana begitu selesai menontonnya dijamin dengan mudah anda melupakan animasi berdurasi  menit ini sesegera mungkin', 'sayang lucu didukung kualitas animasi memalukan diakui batasan hiburan ringan belaka selesai menontonnya dijamin mudah melupakan animasi berdurasi  menit', 'sayang lucu dukung kualitas animasi malu aku batas hibur ringan belaka selesai tonton jamin mudah lupa animasi durasi  menit'),
(810, 827, 'di satu sisi melihat segala kehebohan dan kekacauan yang dihasilkan bisa menjadi sebuah tontonan berskala besar namun di sisi lain ia tidak jarang terlihat murahan dan konyol tak jarang kita menertawakan segala kebodohan narasi dan karakternya belum lagi beberapa visual efeknya yang kasar seperti proses transformasi yang buruk dan pertarungan yang jauh dari kata mulus', 'sisi kehebohan kekacauan dihasilkan tontonan berskala sisi jarang murahan konyol jarang menertawakan kebodohan narasi karakternya visual efeknya kasar proses transformasi buruk pertarungan mulus', 'sisi heboh kacauan hasil tonton skala sisi jarang murah konyol jarang tertawa bodoh narasi karakter visual efek kasar proses transformasi buruk tarung mulus'),
(811, 828, 'tidak ada konflik berarti kecuali mungkin kedatangan vlad si vampir tua di penghujung film yang sedikit mengacaukan suasana secara keseluruhan hotel transylvania  bermain kelewat aman dengan potensi premis yang sebenarnya bisa dikembangkan lagi', 'konflik kecuali kedatangan vlad si vampir tua penghujung film mengacaukan suasana hotel transylvania  bermain kelewat aman potensi premis dikembangkan', 'konflik kecuali datang vlad si vampir tua hujung film acau suasana hotel transylvania  main lewat aman potensi premis kembang'),
(812, 829, 'paruh pertama ip man  adalah kekacauan luar biasa narasinya buruk dan tidak konsisten yang kemudian diperparah dengan banyak adegan pertarungan keroyokan yang tidak berkesan dan membosankan mike tyson mengecewakan sesuai perkiraan tyson nyaris tidak bisa berakting dialog-dialognya konyol gerak-geriknya canggung sekaku kayu jati tua ini diperburuk dengan naskah yang tidak memberinya latar belakang cukup motif rakusnya begitu klise', 'paruh ip man  kekacauan narasinya buruk konsisten diperparah adegan pertarungan keroyokan berkesan membosankan mike tyson mengecewakan sesuai perkiraan tyson berakting dialog-dialognya konyol gerak-geriknya canggung sekaku kayu jati tua diperburuk naskah memberinya latar motif rakusnya klise', 'paruh ip man  kacauan narasi buruk konsisten parah adegan tarung keroyok kesan bosan mike tyson kecewa sesuai kira tyson akting dialog konyol gerak gerik canggung seka kayu jati tua buruk naskah beri latar motif rakus klise'),
(813, 830, 'entah apa yang dipikirkan black dan pearce ketika menghadirkan sebuah twist yang menjungkir balikkan ekspektasi banyak orang baik fan boys atau tidak ya itu adalah kejutan yang sangat konyol jika tidak mau disebut dengan kebodohan luar biasa membuang percuma salah satu talenta yang sebenarnya sangat berpotensi', 'dipikirkan black pearce menghadirkan twist menjungkir balikkan ekspektasi orang fan boys ya kejutan konyol kebodohan membuang salah talenta berpotensi', 'pikir black pearce hadir twist jungkir balik ekspektasi orang fan boys ya kejut konyol bodoh buang salah talenta potensi'),
(814, 831, 'besarnya tema tentang google membuat premis utama dan komedinya menjadi sedikit tenggelam dominasi google yang sangat ditonjolkan menjadikan the internship terlihat seperti video iklan panjang dari perusahaan internet raksasa tersebut dengan bintang vince vaughn dan owen wilson', 'besarnya tema google premis utama komedinya tenggelam dominasi google ditonjolkan menjadikan the internship video iklan perusahaan internet raksasa bintang vince vaughn owen wilson', 'besar tema google premis utama komedi tenggelam dominasi google tonjol jadi the internship video iklan usaha internet raksasa bintang vince vaughn owen wilson'),
(815, 832, 'muatan yang dibawa the interview jelas terlalu vulgar mengolok-olok negara sensitif korea utara dengan paradigma komunisnya yang tebal termasuk upaya membunuh pemimpin tertingginya yang punya gaya rambut ajaib dalam sebuah acara talk show murahan jelas sony sudah melakukan sebuah kebodohan besar ketika mereka nekat tetap meneruskan proyek provokatif ini', 'muatan dibawa the interview vulgar mengolok-olok negara sensitif korea utara paradigma komunisnya tebal upaya membunuh pemimpin tertingginya gaya rambut ajaib acara talk show murahan sony kebodohan nekat meneruskan proyek provokatif', 'muat bawa the interview vulgar olok negara sensitif korea utara paradigma komunis tebal upaya bunuh pimpin tinggi gaya rambut ajaib acara talk show murah sony bodoh nekat terus proyek provokatif'),
(816, 833, 'namun sayang film berbiaya  juta dollar ini hasilnya ternyata jauh di bawah ekspektasi atau bisa dibilang cukup mengecewakan apalagi untuk film garapan seorang peter jackson', 'sayang film berbiaya  juta dollar hasilnya ekspektasi dibilang mengecewakan film garapan peter jackson', 'sayang film biaya  juta dollar hasil ekspektasi bilang kecewa film garap peter jackson'),
(817, 834, 'yang menjadi pertanyaan apakah film ini menakutkan jika kamu bukan veteran horor atau mungkin hanya berhati lemah ya the other side of the door mampu memberimu sedikit ancaman yang cukup sekedar menggedor jantungmu jika mungkin akhirnya ia menjadi horor yang lembek pun setidaknya melihat kembali penampilan sarah wayne callies setelah serial prison break dan the walking dead sedikit banyak memberikan pengalaman tersendiri', 'film menakutkan veteran horor berhati lemah ya the other side of the door memberimu ancaman sekedar menggedor jantungmu horor lembek penampilan sarah wayne callies serial prison break the walking dead pengalaman tersendiri', 'film takut veteran horor hati lemah ya the other side of the door beri ancam sekedar gedor jantung horor lembek tampil sarah wayne callies serial prison break the walking dead alam sendiri'),
(818, 835, 'ironis melihat bagaimana spesial efek yang begitu diagung-agungkan ching sebelumnya ternyata terlihat begitu berlebihan begitu kasar begitu murahan dan begitu mendominasi nyaris seluruh durasi the sorcerer and the white snake akibatnya fatal karena ceritanya sendiri harus rela dikebiri sana-sini untuk memberikan banyak spot lebih pada segala tetek bengek cgi yang memalukan itu', 'ironis spesial efek diagung-agungkan ching kasar murahan mendominasi durasi the sorcerer and the white snake akibatnya fatal ceritanya rela dikebiri sana-sini spot tetek bengek cgi memalukan', 'ironis spesial efek agung ching kasar murah dominasi durasi the sorcerer and the white snake akibat fatal cerita rela kebiri sana sini spot tetek bengek cgi malu'),
(819, 836, 'sementara sekuens aksinya juga tidak terlalu buruk sayang tidak semua momen pertarungannya mampu meninggalkan kesan seperti halnya pertarungan di atas kereta api yang melaju kencang itu termasuk adegan puncaknya yang mempertemukan logan dengan salah satu musuh besarnya silver samurai berakhir terlalu cepat', 'sekuens aksinya buruk sayang momen pertarungannya meninggalkan kesan halnya pertarungan kereta api melaju kencang adegan puncaknya mempertemukan logan salah musuh besarnya silver samurai cepat', 'sekuens aksi buruk sayang momen tarung tinggal kesan hal tarung kereta api laju kencang adegan puncak temu log salah musuh besar silver samurai cepat'),
(820, 837, 'ini mungkin akan lebih terasa ke sebuah drama psikologis yang sedikit lemah ketimbang road trip survival yang seharusnya bisa lebih dramatis lagi', 'drama psikologis lemah ketimbang road trip survival dramatis', 'drama psikologis lemah ketimbang road trip survival dramatis'),
(821, 838, 'masih ada banyak pertanyaan-pertanyaan misalnya siapa sebenarnya karakter johansson siapa pengendara motor misterius yang bolak-balik membersihkan pekerjaanya apa tujuan mereka dengan pria-pria glasgow itu namun jika kamu menunggu jawaban pasti di akhir nanti bersiaplah kecewa berat karena glazer tidak memberikanmu apa-apa kecuali sebuah ending mengerikan dan lebih banyak lagi pertanyaan mengganggu', 'pertanyaan-pertanyaan karakter johansson pengendara motor misterius bolak-balik membersihkan pekerjaanya tujuan pria-pria glasgow menunggu bersiaplah kecewa berat glazer memberikanmu apa-apa kecuali ending mengerikan mengganggu', 'pertanyaan karakter johansson kendara motor misterius bolak-balik bersih pekerjaanya tuju pria glasgow tunggu siap kecewa berat glazer berik apa kecuali ending erik ganggu'),
(822, 839, 'were the millers tergolong biasa saja predictable cheesy dan bahkan bisa dikatakan nanggung dalam artian ia takut untuk berani bermain kotor namun di saat bersamaan ia juga tidak mau bermain terlalu aman', 'were the millers tergolong predictable cheesy nanggung artian takut berani bermain kotor bersamaan bermain aman', 'were the millers golong predictable cheesy nanggung arti takut berani main kotor sama main aman'),
(823, 840, 'ketimbang film pertamanya mclean terlihat sedikit mengurangi kadar creepy toh wajar saja karena kini penontonnya sudah tahu misterinya tahu apa yang dihadapi para turis asing itu memang bukan alien atau hantu penunggu kawah wolf creek melainkan psikopat edan', 'ketimbang film pertamanya mclean mengurangi kadar creepy wajar penontonnya misterinya dihadapi turis asing alien hantu penunggu kawah wolf creek psikopat edan', 'ketimbang film pertama mclean kurang kadar creepy wajar tonton misteri hadap turis asing alien hantu tunggu kawah wolf creek psikopat edan'),
(824, 841, 'untuk versi jepangnya kisah hachi digambarkan lebih tragis dan depressing minimnya adegan melodrama mengurangi kemampuan film ini untuk menguras habis emosi penontonnya', 'versi jepangnya kisah hachi digambarkan tragis depressing minimnya adegan melodrama mengurangi kemampuan film menguras habis emosi penontonnya', 'versi jepangnya kisah hachi gambar tragis depressing minim adegan melodrama kurang mampu film uras habis emosi tonton'),
