(855, 872, 'overall cyrus adalah sebuah kisah cinta unik dan menarik terlebih lagi dua bersaudara duplass sukses menyelipkan unsur-unsur komedi satirnya dengan takaran yang pas dan tidak terlalu berlebihan tanpa harus kehilangan pesan-pesan yang ingin disampaikan plus dukungan akting apik dari para pemainnya membuat cyrus tampil cukup memuaskan', 'overall cyrus kisah cinta unik menarik bersaudara duplass sukses menyelipkan unsur-unsur komedi satirnya takaran pas kehilangan pesan-pesan plus dukungan akting apik pemainnya cyrus tampil memuaskan', 'overall cyrus kisah cinta unik tarik saudara duplass sukses selip unsur komedi satir takar pas hilang pesan plus dukung akting apik main cyrus tampil muas'),
(856, 873, 'satu lagi film fiksi ilmiah dengan cerita yang sangat orisinil unik dan luar biasa keren sang sutradara alex proyas dengan jenius memadukan unsur-unsur film noir gelap thriller dan fiksi ilmiah yang jarang ditemukan di film-film lain kita dibuat penasaran sepanjang film dengan siapa sebenarnya karakter john di mana nantinya kita menemukan sebuah penjelasan yang mencengangkan', 'film fiksi ilmiah cerita orisinil unik keren sang sutradara alex proyas jenius memadukan unsur-unsur film noir gelap thriller fiksi ilmiah jarang ditemukan film-film penasaran film karakter john menemukan penjelasan mencengangkan', 'film fiksi ilmiah cerita orisinil unik keren sang sutradara alex proyas jenius madu unsur film noir gelap thriller fiksi ilmiah jarang temu film penasaran film karakter john temu jelas cengang'),
(857, 874, 'senang rasanya menemukan ada satu lagi horor korea selatan yang mampu berbicara sebaik a tale of two sisters jung bersaudara sudah berhasil menghadirkan sebuah thriller psikologis dengan balutan puisi kematiannya yang indah dan mengerikan hasilnya ia tidak hanya mampu bermain-main dengan rasa takut kita melalui momen-momen horor atmosferik dan eerie di dalamnya namun disaat bersamaan ia juga menyentuh pikiran hati dan perut penontonnya sekaligus', 'senang menemukan horor korea selatan berbicara a tale of two sisters jung bersaudara berhasil menghadirkan thriller psikologis balutan puisi kematiannya indah mengerikan hasilnya bermain-main takut momen-momen horor atmosferik eerie dalamnya disaat bersamaan menyentuh pikiran hati perut penontonnya', 'senang temu horor korea selatan bicara a tale of two sisters jung saudara hasil hadir thriller psikologis balut puisi mati indah erik hasil main takut momen horor atmosferik eerie dalam saat sama sentuh pikir hati perut tonton'),
(858, 875, 'sebagai pencerita yang ulung ia tahu bagaimana harus menggulirkan narasinya dengan baik walaupun sebagai awal dari bakal waralaba besar ke depannya rowling menuturkannya dengan begitu sederhana dan terkendala durasi film yang relatif pendek untuk banyak detil yang terabaikan tapi fantastic beasts and where to find them sudah meletakkan fondasinya dengan lumayan baik dan berhasil menghibur serta mengobati kerinduan kita akan dunia sihir ala rowling yang masyhur itu', 'pencerita ulung menggulirkan narasinya waralaba depannya rowling menuturkannya sederhana terkendala durasi film relatif pendek detil terabaikan fantastic beasts and where to find them meletakkan fondasinya lumayan berhasil menghibur serta mengobati kerinduan dunia sihir ala rowling masyhur', 'cerita ulung gulir narasi waralaba depan rowling tutur sederhana kendala durasi film relatif pendek detil abai fantastic beasts and where to find them letak fondasi lumayan hasil hibur serta obat rindu dunia sihir ala rowling masyhur'),
(859, 876, 'tone yang ditawarkan frances ha sebenarnya tidaklah jauh berbeda dengan the squid and the whale masih dipenuhi dengan semangat indie kental dan soundtrack-soundtrack bagus hanya saja untuk yang terbaru ini mungkin terasa lebih girly dan monokrom ya keunikan frances ha yang paling mencolok tentu saja adalah  menit durasinya dikuasai oleh presentasi hitam putih yang terinspirasi dari drama-drama perancis new wave', 'tone ditawarkan frances ha berbeda the squid and the whale dipenuhi semangat indie kental soundtrack-soundtrack bagus terbaru girly monokrom ya keunikan frances ha mencolok  menit durasinya dikuasai presentasi hitam putih terinspirasi drama-drama perancis new wave', 'tone tawar frances ha beda the squid and the whale penuh semangat indie kental soundtrack bagus baru girly monokrom ya unik frances ha colok  menit durasi kuasa presentasi hitam putih inspirasi drama perancis new wave'),
(860, 877, 'plotnya mampu berjalan dari sesuatu yang simpel menjadi rumit dan menghentak di klimaksnya dengan akselerasi tensi yang terjaga dengan sangat baik akting si kembar yang dingin plus beberapa momen body horor dan penampakan-penampakan yang cukup menghentak itu kemudian menjadikan goodbye mother tampil solid dalam usahanya menjadi gelaran horor psikologis yang menawan', 'plotnya berjalan simpel rumit menghentak klimaksnya akselerasi tensi terjaga akting si kembar dingin plus momen body horor penampakan-penampakan menghentak menjadikan goodbye mother tampil solid usahanya gelaran horor psikologis menawan', 'plot jalan simpel rumit menghentak klimaks akselerasi tensi jaga akting si kembar dingin plus momen body horor penampakan menghentak jadi goodbye mother tampil solid usaha gelar horor psikologis tawan'),
(861, 878, 'naishuller menggandengnya dengan dukungan cast yang bagus dari sharlto copley sebagai jimmy yang sukses menghadirkan sisi komedi tersendiri di setiap kehadirannya sementara tidak banyak yang bisa digali dari karakter lain haley bennett tetap cantik dan seksi sejak saya pertama kali melihatnya dalam horor the hole  silam lalu ada tim roth yang tampil sebentar sebagai ayah henry sisanya danila kozlovsky tampil cukup oke sebagai villain utama', 'naishuller menggandengnya dukungan cast bagus sharlto copley jimmy sukses menghadirkan sisi komedi tersendiri kehadirannya digali karakter haley bennett cantik seksi kali horor the hole  silam tim roth tampil sebentar ayah henry sisanya danila kozlovsky tampil oke villain utama', 'naishuller gandeng dukung cast bagus sharlto copley jimmy sukses hadir sisi komedi sendiri hadir gali karakter haley bennett cantik seksi kali horor the hole  silam tim roth tampil sebentar ayah henry sisa danila kozlovsky tampil oke villain utama');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(862, 879, 'premisnya sendiri sebenarnya sudah cukup kuat untuk menjadikan helpless sebagai thriller misteri noir modern yang menarik termasuk ketika mampu membuat penontonnya terus terjaga menebak dan menunggu apa yang sebenarnya terjadi bersama rentetan twist demi twist', 'premisnya kuat menjadikan helpless thriller misteri noir modern menarik penontonnya terjaga menebak menunggu rentetan twist twist', 'premis kuat jadi helpless thriller misteri noir modern tarik tonton jaga tebak tunggu rentet twist twist'),
(863, 880, 'steve pink sang sutradara yang juga pernah menghasilkan komedi berjudul accepted bisa dibilang berhasil menciptakan sebuah sajian komedi yang unik ringan dan sederhana namun cukup efektif untuk mengocok perut penontonnya terutama bagi mereka penggemar komedi-komedi dewasa yang pernah juga merasakan kejayaan era dekade ', 'steve pink sang sutradara menghasilkan komedi berjudul accepted dibilang berhasil menciptakan sajian komedi unik ringan sederhana efektif mengocok perut penontonnya penggemar komedi-komedi dewasa merasakan kejayaan era dekade ', 'steve pink sang sutradara hasil komedi judul accepted bilang hasil cipta saji komedi unik ringan sederhana efektif kocok perut tonton gemar komedi dewasa rasa jaya era dekade '),
(864, 881, 'ya apa yang tersaji di sepanjang kurang lebih satu jam setengah durasinya sungguh menyenangkan ada komedi ringan drama feel good sampai heartbreaking yang melebur dalam kesatuan penyutradaraan dan akting natural dari chen serta jajaran pemain yang bermain gemilang', 'ya tersaji jam durasinya sungguh menyenangkan komedi ringan drama feel good heartbreaking melebur kesatuan penyutradaraan akting natural chen serta jajaran pemain bermain gemilang', 'ya saji jam durasi sungguh senang komedi ringan drama feel good heartbreaking lebur satu sutradara akting natural chen serta jajar main main gemilang'),
(865, 882, 'sebuah bittersweet love story  menit dari spike jones yang banyak mengajarkan penontonnya tentang makna sebuah cinta sejati dan bagaimana mempertahankan keutuhannya meskipun itu harus dengan melakukan pengorbanan luar biasa ya mungkin terlihat aneh namun bagaimana jonze membuatnya menjadi senormal mungkin dengan balutan kisah manis nan menyentuh itulah yang menjadikannya sangat berkesan', 'bittersweet love story  menit spike jones mengajarkan penontonnya makna cinta sejati mempertahankan keutuhannya pengorbanan ya aneh jonze membuatnya senormal balutan kisah manis nan menyentuh menjadikannya berkesan', 'bittersweet love story  menit spike jones ajar tonton makna cinta sejati tahan utuh korban ya aneh jonze buat normal balut kisah manis nan sentuh jadi kesan'),
(866, 883, 'masa lalu sangat berperan penting pada chapter  ini untuk mengungkap beberapa fakta ada juga elemen time travel yang dimasukkan wan dan harus diakui bagaimana dengan cerdas wan memanfaatkan perjalanan waktunya untuk menempel dengan sekuen-sekuen seri pertamanya menjadikan kedua seri ini seperti satu paket horor yang tidak terlepaskan satu sama lain', 'berperan chapter  mengungkap fakta elemen time travel dimasukkan wan diakui cerdas wan memanfaatkan perjalanan menempel sekuen-sekuen seri pertamanya menjadikan seri paket horor terlepaskan', 'peran chapter  ungkap fakta elemen time travel masuk wan aku cerdas wan manfaat jalan tempel sekuen seri pertama jadi seri paket horor lepas'),
(867, 884, 'walaupun tidak sehebat pedahulunya tetap saja kehadiran old lady in white ini masih terbilang efektif sebagai alat senam jantung anda walaupun patut disayangkan ketidak hadiran si cantik kayako cukup berdampak besar pada film ini', 'sehebat pedahulunya kehadiran old lady in white terbilang efektif alat senam jantung patut disayangkan ketidak hadiran si cantik kayako berdampak film', 'hebat dahulu hadir old lady in white bilang efektif alat senam jantung patut sayang tidak hadir si cantik kayako dampak film'),
(868, 885, 'seperti yang saya katakan di atas kekuatan utama dari kung fu panda sejak kemunculan perdananya  silam adalah perpaduan olahan humor kocak dari dialog sampai fisik aksi martial arts spektakuler dan pemilihan karakter yang kuat dan kombinasi itu yang lagi-lagi kita dapatkan di seri ketiganya ini', 'kekuatan utama kung fu panda kemunculan perdananya  silam perpaduan olahan humor kocak dialog fisik aksi martial arts spektakuler pemilihan karakter kuat kombinasi lagi-lagi dapatkan seri ketiganya', 'kuat utama kung fu panda muncul perdana  silam padu olah humor kocak dialog fisik aksi martial arts spektakuler pilih karakter kuat kombinasi lagi dapat seri tiga'),
(869, 886, 'tanpa ada sepatah kata pun diucapkan oleh para pemain ending di film ini benar benar mindblowing dan ditutup dengan adegan manis overall film ini sudah mengangkat film bertemakan vampire ke level brilian bahkan dibuat versi remake oleh hollywood yang berjudul sama dengan novel aslinya let me in', 'sepatah pemain ending film mindblowing ditutup adegan manis overall film mengangkat film bertemakan vampire level brilian versi remake hollywood berjudul novel aslinya let me in', 'patah main ending film mindblowing tutup adegan manis overall film angkat film temak vampire level brilian versi remake hollywood judul novel asli let me in'),
(870, 887, 'zack snyder dengan dukungan nama-nama besar di balik kesuksesan reboot batman membawa kembali kisah si manusia baja kembali ke awal memodifikasinya dengan sentuhan modern dan mencoba menyeimbangkan drama tentang pencarian jati diri yang manusiawi dan parade action dahsyat meskipun kombinasinya terasa bekerja di satu sisi saja namun ini adalah awal yang bagus dari franchise sebesar superman', 'zack snyder dukungan nama-nama kesuksesan reboot batman membawa kisah si manusia baja memodifikasinya sentuhan modern mencoba menyeimbangkan drama pencarian jati manusiawi parade action dahsyat kombinasinya sisi bagus franchise superman', 'zack snyder dukung nama sukses reboot batman bawa kisah si manusia baja modifikasi sentuh modern coba menyeimbangkan drama cari jati manusiawi parade action dahsyat kombinasi sisi bagus franchise superman'),
(871, 888, 'sean durkin dengan gemilang telah menghadirkan potret depresi dan kesedihan luar biasa seorang anak manusia yang tenggelam dalam jurang kehancuran melalui akting kelas atas seorang pendatang baru bernama elizabeth olsen', 'sean durkin gemilang menghadirkan potret depresi kesedihan anak manusia tenggelam jurang kehancuran akting kelas pendatang bernama elizabeth olsen', 'sean durkin gemilang hadir potret depresi sedih anak manusia tenggelam jurang hancur akting kelas datang nama elizabeth olsen'),
(872, 889, 'harus diakui narasi time travel tetap menyenangkan untuk diikuti dukungan pengisi suaranya juga sedikit banyak membantu ada ty burell aktor jebolan sitkom televisi modern family mengisi jiwa mr peabody yang canggih sedikit sombong namun penuh kasih sayang dan perhatian sementara sherman dikuasai oleh keceriaan max charles', 'diakui narasi time travel menyenangkan diikuti dukungan pengisi suaranya membantu ty burell aktor jebolan sitkom televisi modern family mengisi jiwa mr peabody canggih sombong penuh kasih sayang perhatian sherman dikuasai keceriaan max charles', 'aku narasi time travel senang ikut dukung isi suara bantu ty burell aktor jebol sitkom televisi modern family isi jiwa mr peabody canggih sombong penuh kasih sayang perhati sherman kuasa ceria max charles'),
(873, 890, 'setiap momen yang disajikan ergven melalui pendekatan natural membuat kita mudah untuk dekat dengan karakter-karakternya dan bersimpati kepada mereka plotnya bergerak perlahan namun pasti dari keceriaan penuh tawa menjadi lebih gelap seperti sebuah dongeng hitam yang terus menggerogoti emosi di mana putri-putri cantik di dalamnya terus bermimpi mencari sebuah akhir yang bahagia', 'momen disajikan ergven pendekatan natural mudah karakter-karakternya bersimpati plotnya bergerak perlahan keceriaan penuh tawa gelap dongeng hitam menggerogoti emosi putri-putri cantik dalamnya bermimpi mencari bahagia', 'momen saji ergven dekat natural mudah karakter simpati plot gerak perlahan ceria penuh tawa gelap dongeng hitam gerogot emosi putri cantik dalam mimpi cari bahagia'),
(874, 891, 'ya kamu jelas tidak bisa menyangkal bahwa my stupid boss digerakkan oleh kemampuan akting fantastis reza rahardian yang entah bagaimana selalu berhasil menembus batasan bossman adalah karakter yang spesial dan hanya aktor spesial macam reza yang mampu menghadirkan sisi paling unik sama hebatnya dengan sisi baiknya lengkap dengan segala improvisasinya yang luar biasa', 'ya menyangkal my stupid boss digerakkan kemampuan akting fantastis reza rahardian berhasil menembus batasan bossman karakter spesial aktor spesial reza menghadirkan sisi unik hebatnya sisi baiknya lengkap improvisasinya', 'ya sangkal my stupid boss gerak mampu akting fantastis reza rahardian hasil tembus batas bossman karakter spesial aktor spesial reza hadir sisi unik hebat sisi baik lengkap improvisasi'),
(875, 892, ' ya saya mungkin bukan fans berat marilyn tapi melihat bagaimana ia dalam wujud michelle williams tampil begitu memesona sulit rasanya tidak cemburu ketika ia mengucapkan i love you pada colin dan kemudian menciumnya tidak peduli apakah ia benar-benar tulus melakukannya atau tidak', ' ya fans berat marilyn wujud michelle williams tampil memesona sulit cemburu i love you colin menciumnya peduli benar-benar tulus melakukannya', ' ya fans berat marilyn wujud michelle williams tampil pesona sulit cemburu i love you colin cium peduli benar tulus laku'),
(876, 893, 'setiap pemainnya mampu tampil solid membawakan karakternya dengan sangat baik misalnya seperti apa yang sudah dilakukan marsha timothy ya aktris cantik yang juga istri dari aktor vino g bastian ini tampil dalam performa terbaiknya begitu sangat menjiwai peran nada', 'pemainnya tampil solid membawakan karakternya marsha timothy ya aktris cantik istri aktor vino g bastian tampil performa terbaiknya menjiwai peran nada', 'main tampil solid bawak karakter marsha timothy ya aktris cantik istri aktor vino g bastian tampil performa baik jiwa peran nada'),
(877, 894, 'nokas bisa jadi adalah salah satu contoh film bertema perampokan paling realistis yang pernah ada semua digambarkan erik skjoldbjrg seotentik mungkin dengan kejadian aslinya plus dukungan teknik kamera tingkat tinggi yang sanggup memberikan saya sebuah kepuasan tersendiri dalam menikmati setiap menitnya yang mengesankan', 'nokas salah contoh film bertema perampokan realistis digambarkan erik skjoldbjrg seotentik kejadian aslinya plus dukungan teknik kamera tingkat sanggup kepuasan tersendiri menikmati menitnya mengesankan', 'nokas salah contoh film tema ampo realistis gambar erik skjoldbjrg otentik jadi asli plus dukung teknik kamera tingkat sanggup puas sendiri nikmat menit kesan'),
(878, 895, 'overall jika menyukai film horror terutama horror asia yang sedikit berbeda noroi mungkin bisa memberikan sebuah pengalaman tersendiri walaupun konsep yang diangkat bukanlah sebuah konsep baru namun jalinan cerita dan atmosfer yang ditampilkan di sini cukup membuat penggemar horror sejati tersenyum bahagia bukan karena film ini lucu namun karena film ini mampu memberikan gambaran bagaimana sebuah film horror yang baik dan berkualitas itu dibuat', 'overall menyukai film horror horror asia berbeda noroi pengalaman tersendiri konsep diangkat konsep jalinan cerita atmosfer ditampilkan penggemar horror sejati tersenyum bahagia film lucu film gambaran film horror berkualitas', 'overall suka film horror horror asia beda noroi alam sendiri konsep angkat konsep jalin cerita atmosfer tampil gemar horror sejati senyum bahagia film lucu film gambar film horror kualitas'),
(879, 896, 'bagian terbaiknya adalah ketika flanagan tahu benar memperlakukan sang cermin tidak hanya sebagai objek namun ia adalah bintang utama oculus yang mengikat segalanya ada aktris cantik karen gillan yang berkolaborasi dengan aktor muda brenton thwaites', 'terbaiknya flanagan memperlakukan sang cermin objek bintang utama oculus mengikat aktris cantik karen gillan berkolaborasi aktor muda brenton thwaites', 'baik flanagan laku sang cermin objek bintang utama oculus ikat aktris cantik karen gillan kolaborasi aktor muda brenton thwaites'),
(880, 897, 'set kostum dan make up semua terasa sempurna untuk mewakili sub urban los angeles di dekade  termasuk pemilihan soundtrack jadul yang semakin menambah kesan vintage kudos buat penampilan kuat pemainnya', 'set kostum make up sempurna mewakili sub urban los angeles dekade  pemilihan soundtrack jadul menambah kesan vintage kudos penampilan kuat pemainnya', 'set kostum make up sempurna wakil sub urban los angeles dekade  pilih soundtrack jadul tambah kesan vintage kudos tampil kuat main'),
(881, 898, 'selain banyak meminjam pernak pernik klasik oz raimi juga membuat dunianya sendiri yang luar biasa dengan segala macam tumpahan warna-warni dan tentu saja bagian terbaiknya ketika ia mampu memaksimalkan bagian gelapnya dengan sentuhan klasik ini seperti memasuki wahana oz yang baru dengan lebih banyak warna cgi dan d yang tidak terlalu sempurna', 'meminjam pernak pernik klasik oz raimi dunianya tumpahan warna-warni terbaiknya memaksimalkan gelapnya sentuhan klasik memasuki wahana oz warna cgi d sempurna', 'pinjam pernak pernik klasik oz raimi dunia tumpah warna-warni baik maksimal gelap sentuh klasik masuk wahana oz warna cgi d sempurna'),
(882, 899, 'ya saya suka parental guidance ia lucu dan hangat bisa ditebak hampir semua tawa berasal dari satu sumber utama bernama billy crystal bersama dialog-dialog dan guyonan-guyonan improvisasinya yang kocak bersama bette midler yang juga tak kalah kocaknya kombinasi keduanya dengan premis sederhana menjadi sebuah persembahan film keluarga menyenangkan', 'ya suka parental guidance lucu hangat ditebak tawa berasal sumber utama bernama billy crystal dialog-dialog guyonan-guyonan improvisasinya kocak bette midler kalah kocaknya kombinasi premis sederhana persembahan film keluarga menyenangkan', 'ya suka parental guidance lucu hangat tebak tawa asal sumber utama nama billy crystal dialog guyonan improvisasi kocak bette midler kalah kocak kombinasi premis sederhana sembah film keluarga senang'),
(883, 900, 'mcdonald diam-diam sudah mengikatmu erat dengan narasi dan karakter-karakternya yang kuat bersama ruang lingkup stasiun radio plus segala hal yang berhubungan dengan proses penyiaran yang menempel erat pada premisnya dan tidak pernah melepaskanmu sedikit pun', 'mcdonald diam-diam mengikatmu erat narasi karakter-karakternya kuat ruang lingkup stasiun radio plus berhubungan proses penyiaran menempel erat premisnya melepaskanmu', 'mcdonald diam ikat erat narasi karakter kuat ruang lingkup stasiun radio plus hubung proses siar tempel erat premis lepas'),
(884, 901, 'ya tidak bisa dipungkiri pyscho jelas adalah salah satu karya terbaik yang pernah dibuat oleh alfred hitchcock sebuah psychological thriller hebat yang tidak hanya menawarkan ketegangan dan kengerian semata namun juga cerita yang menarik dan pintar serta penuh kejutan di dalamnya inilah mahakarya dari sutradara legendaris alfred hitchcock', 'ya dipungkiri pyscho salah karya terbaik alfred hitchcock psychological thriller hebat menawarkan ketegangan kengerian cerita menarik pintar serta penuh kejutan dalamnya mahakarya sutradara legendaris alfred hitchcock', 'ya dipungkiri pyscho salah karya baik alfred hitchcock psychological thriller hebat tawar tegang ngeri cerita tarik pintar serta penuh kejut dalam mahakarya sutradara legendaris alfred hitchcock'),
(885, 902, 'harus saya akui helander sudah memberikan sesuatu yang besar pada film kecilnya ini sebuah christmas tale yang tidak ada duanya unik gelap dan juga menghibur yang jelas sulit kita dapatkan dalam film-film buatan hollywood sekalipun', 'akui helander film kecilnya christmas tale duanya unik gelap menghibur sulit dapatkan film-film buatan hollywood', 'aku helander film kecil christmas tale dua unik gelap hibur sulit dapat film buat hollywood'),
