(941, 958, 'relasi cinta segitiganya juga tetap sama flat dengan pendahulunya tidak ada dilema yang bisa dirasakan dari dua pilhan bahkan saga twilight saja masih lebih baik soal ini sementara di tempat lain juga terlalu banyak cast terbuang karena olahan naskah yang kerdil', 'relasi cinta segitiganya flat pendahulunya dilema dirasakan pilhan saga twilight cast terbuang olahan naskah kerdil', 'relasi cinta segitiga flat dahulu dilema rasa pilhan saga twilight cast buang olah naskah kerdil'),
