(944, 961, 'tidak hanya itu selain kisahnya yang datar dan kurang greget dan minim konflik penonton juga disuguhkan dengan buruknya kualitas dialog-dialog yang terlewat sederhana baca bodoh dari para karakter-karakternya yang juga tampil tidak kalah mengecewakannya', 'kisahnya datar greget minim konflik penonton disuguhkan buruknya kualitas dialog-dialog terlewat sederhana baca bodoh karakter-karakternya tampil kalah mengecewakannya', 'kisah datar greget minim konflik tonton suguh buruk kualitas dialog lewat sederhana baca bodoh karakter tampil kalah kecewa'),
