(949, 966, 'saya suka bagaimana mcdonald menghadirkan tensi ketegangan yang mampu terjaga dengan baik di sepanjang  menit durasinya tidak banyak basa-basi mcdonald langsung menyajikan permasalahan dari awal dengan cepat', 'suka mcdonald menghadirkan tensi ketegangan terjaga  menit durasinya basa-basi mcdonald langsung menyajikan permasalahan cepat', 'suka mcdonald hadir tensi tegang jaga  menit durasi basa-basi mcdonald langsung saji masalah cepat'),
