(959, 976, 'banyak halyang terkesan dangkal dan dipaksakan di sepanjang film berdurasi  menit ini beberapa adegan pertarungan memang terlihat menarik namun semua itu seakan akan tidak mampu menutupi kelemahan-kelemahan dalam ceritanya yang cukup mengganggu', 'halyang terkesan dangkal dipaksakan film berdurasi  menit adegan pertarungan menarik seakan menutupi kelemahan-kelemahan ceritanya mengganggu', 'halyang kesan dangkal paksa film durasi  menit adegan tarung tarik akan tutup kelemahan cerita ganggu'),
