(963, 980, 'plotnya yang beputar-putar jelas akan membingungkan adegan demi adegan yang berulang memudarkan antara realita dan kenyataan dan komedinya sama anehnya dengan presentasinya', 'plotnya beputar-putar membingungkan adegan adegan berulang memudarkan realita kenyataan komedinya anehnya presentasinya', 'plot beputar putar bingung adegan adegan ulang pudar realita nyata komedi aneh presentasi'),
(964, 981, 'yang terjadi dengan kepercayaan yang begitu tinggi pada akhirnya adalah bencana di seri keduanya dan the hangover part iii yang dipaksakan untuk dilanjutkan sebagai penutup juga bukan sekuel yang bagus namun setidaknya ini masih lebih baik ketimbang part deux yang malas itu', 'kepercayaan bencana seri the hangover part iii dipaksakan dilanjutkan penutup sekuel bagus ketimbang part deux malas', 'percaya bencana seri the hangover part iii paksa lanjut tutup sekuel bagus ketimbang part deux malas'),
