(996, 1013, 'ive loved you so long adalah contoh sebuah drama kuat dan menyentuh yang berisi kompilasi tema tentang hubungan kakak-adik tentang pencarian jati diri tentang perjuangan untuk bisa diterima kembali bagaimana berdamai dengan masa lalu agar dapat terus maju semua itu juga berhasil tidak lepas dari dukungan naskah dan eksekusi yang baik dari philippe claudel plus akting luar biasa dari para pemainnya', 'ive loved you so long contoh drama kuat menyentuh berisi kompilasi tema hubungan kakak-adik pencarian jati perjuangan diterima berdamai maju berhasil lepas dukungan naskah eksekusi philippe claudel plus akting pemainnya', 'ive loved you so long contoh drama kuat sentuh isi kompilasi tema hubung kakak adik cari jati juang terima damai maju hasil lepas dukung naskah eksekusi philippe claudel plus akting main'),
(997, 1014, 'oliver parker bisa dibilang berhasil menghadirkan sajian komedi pelepas penat efektif sama atau mungkin tampil sedikit lebih baik dari pendahulunya tentu saja faktor x bernama rowan atkinson masih mendominasi dan menjadi nilai jual terbesar dari komedi parodi satu ini', 'oliver parker dibilang berhasil menghadirkan sajian komedi pelepas penat efektif tampil pendahulunya faktor x bernama rowan atkinson mendominasi nilai jual terbesar komedi parodi', 'oliver parker bilang hasil hadir saji komedi lepas penat efektif tampil dahulu faktor x nama rowan atkinson dominasi nilai jual besar komedi parodi'),
(998, 1015, 'ya kill list memang brutal dan gelap ada sisi psikologis dari karakter utamanya yang dimainkan dengan sangat baik oleh neil maskell berperan besar disini menghadirkan sebuah kengerian tidak terlihat yang juga terpancar dari scoring menyayatnya yang membuat adegan tenang terasa menakutkan hingga kemudian mencapai puncaknya pada adegan kejar-kejaran dalam terowongan gelap', 'ya kill list brutal gelap sisi psikologis karakter utamanya dimainkan neil maskell berperan menghadirkan kengerian terpancar scoring menyayatnya adegan tenang menakutkan mencapai puncaknya adegan kejar-kejaran terowongan gelap', 'ya kill list brutal gelap sisi psikologis karakter utama main neil maskell peran hadir ngeri pancar scoring sayat adegan tenang takut capai puncak adegan kejar terowongan gelap'),
(999, 1016, 'di sini mereka berhasil membuat semua penonton termasuk penonton dewasa bisa begitu menikmati setiap menitnya ada humor yang cukup untuk membuatmu tertawa atau paling tidak tersenyum ada kehangatan dari cerita cinta keluarga dan tradisi desain karakter yang loveable ada petualangan seru dengan monster dan beberapa kejutan cerita yang menyenangkan', 'berhasil penonton penonton dewasa menikmati menitnya humor membuatmu tertawa tersenyum kehangatan cerita cinta keluarga tradisi desain karakter loveable petualangan seru monster kejutan cerita menyenangkan', 'hasil tonton tonton dewasa nikmat menit humor buat tertawa senyum hangat cerita cinta keluarga tradisi desain karakter loveable tualang seru monster kejut cerita senang'),
(1000, 1017, 'menarik memang melihat adu pintar antara kedua karakter utamanya dan juga menanti apa kejutan-kejutan yang akan dilakukan karakter clyde selanjutnya ia mampu menghibur karena disajikan dengan cukup bervariasi', 'menarik adu pintar karakter utamanya kejutan-kejutan karakter clyde menghibur disajikan bervariasi', 'tarik adu pintar karakter utama kejutan karakter clyde hibur saji variasi'),
(1001, 1018, 'jadi apa yang dilakukan hooper di sini seperti memindahkan versi panggung broadway- ke medium film dengan segala aransemen ulang musik dan lagu-lagunya yang luar biasa serta teknis penyajian yang jempolan lihat setting lihat sinematografinya bersama kekuatan akting para pemainnya dan musikalitas tingkat tingginya semua sukses melebur menjadi sebuah kesatuan harmoni yang cantik nan emosional', 'hooper memindahkan versi panggung broadway- medium film aransemen ulang musik lagu-lagunya serta teknis penyajian jempolan lihat setting lihat sinematografinya kekuatan akting pemainnya musikalitas tingkat tingginya sukses melebur kesatuan harmoni cantik nan emosional', 'hooper pindah versi panggung broadway  medium film aransemen ulang musik lagu serta teknis saji jempol lihat setting lihat sinematografi kuat akting main musikalitas tingkat tinggi sukses lebur satu harmoni cantik nan emosional'),
(1002, 1019, 'tidak heran jika faktanya loft mampu menjadi film yang paling sukses di belgia sana lihat saja bertaburnya bintang-bintang hebat belgia yang tampil apik atau kualitas naskah dan penyutradaraan solid dari erik van looy sudah memanjakan para penggemar kisah-kisah crime thriller berkualitas', 'heran faktanya loft film sukses belgia lihat bertaburnya bintang-bintang hebat belgia tampil apik kualitas naskah penyutradaraan solid erik van looy memanjakan penggemar kisah-kisah crime thriller berkualitas', 'heran fakta loft film sukses belgia lihat tabur bintang hebat belgia tampil apik kualitas naskah sutradara solid erik van looy manja gemar kisah crime thriller kualitas'),
(1003, 1020, 'tema superhero memang selalu menarik untuk ditonton apalagi film animasi ini cocok di tonton oleh tua dan muda megamind murni sebagai animasi penutup tahun  yang sangat menghibur ya meskipun belum mampu menandingi kedahsyatan how to train your dragon dan toy story  namun film ini cukup saja dengan kata menghibur', 'tema superhero menarik ditonton film animasi cocok tonton tua muda megamind murni animasi penutup  menghibur ya menandingi kedahsyatan how to train your dragon toy story  film menghibur', 'tema superhero tarik tonton film animasi cocok tonton tua muda megamind murni animasi tutup  hibur ya tanding dahsyat how to train your dragon toy story  film hibur'),
(1004, 1021, 'gillespie tahu benar bagaimana dengan sabar menyajikannya dalam balutan kehangatan sebuah drama keluarga bersama bumbu komedi segar yang tak henti-hentinya menghadirkan senyum', 'gillespie sabar menyajikannya balutan kehangatan drama keluarga bumbu komedi segar henti-hentinya menghadirkan senyum', 'gillespie sabar saji balut hangat drama keluarga bumbu komedi segar henti hadir senyum'),
(1005, 1022, 'dan apa yang saya suka dari versi live action garapan scott waugh adalah ia tahu bagaimana memindahkan setiap elemen terbaik dari gamea ke versi live actiondengan editing cepat scoring enerjik stunt-stunt berbahaya minim cgi yang semuanya dibalut dalam penggunaan sudut-sudut kamera dinamis yang menghasilkan rentetan sekuen spektakuler', 'suka versi live action garapan scott waugh memindahkan elemen terbaik gamea versi live actiondengan editing cepat scoring enerjik stunt-stunt berbahaya minim cgi dibalut penggunaan sudut-sudut kamera dinamis menghasilkan rentetan sekuen spektakuler', 'suka versi live action garap scott waugh pindah elemen baik gamea versi live actiondengan editing cepat scoring enerjik stunt bahaya minim cgi balut guna sudut kamera dinamis hasil rentet sekuen spektakuler'),
(1006, 1023, 'overall untuk sebuah film bergenre action thriller nikita memang tidak banyak mengobral adegan-adegan aksi menegangkan pemacu adrenalin layaknya film besson kebanyakan namun menjadi istimewa ketika sutradara asal perancis satu ini mampu membawa kisah seorang pembunuh ini ke area yg lebih personal', 'overall film bergenre action thriller nikita mengobral adegan-adegan aksi menegangkan pemacu adrenalin layaknya film besson kebanyakan istimewa sutradara perancis membawa kisah pembunuh area yg personal', 'overall film genre action thriller nikita obral adegan aksi tegang pacu adrenalin layak film besson banyak istimewa sutradara perancis bawa kisah bunuh area yg personal'),
(1007, 1024, 'sebuah teknis ala sineas-sineas timur tengah yang dipenuhi dengan kesederhanaan dan realisme yang kuat yang terpancar dari pergerakan kamera momen dramatis yang melibatkan kejar-kejaran ala bourne melewati setiap gang sempit dan tentu saja akting kuat aktor-aktor non-profesionalnya', 'teknis ala sineas-sineas timur dipenuhi kesederhanaan realisme kuat terpancar pergerakan kamera momen dramatis melibatkan kejar-kejaran ala bourne melewati gang sempit akting kuat aktor-aktor non-profesionalnya', 'teknis ala sineas timur penuh sederhana realisme kuat pancar gerak kamera momen dramatis libat kejar ala bourne lewat gang sempit akting kuat aktor non profesional'),
(1008, 1025, 'dukungan naskah yang ditulis oleh michael r perry christopher landon tom pabst dan oren peli sendiri sedikit banyak membuat paranormal activity  ini mengalami banyak kemajuan berarti dalam ceritanya menariknya kisah yang disajikan ini lebih ke sebuah prekuel ketimbang sekuel', 'dukungan naskah ditulis michael r perry christopher landon tom pabst oren peli paranormal activity  mengalami kemajuan ceritanya menariknya kisah disajikan prekuel ketimbang sekuel', 'dukung naskah tulis michael r perry christopher landon tom pabst oren pel paranormal activity  alami maju cerita tarik kisah saji prekuel ketimbang sekuel'),
(1009, 1026, 'ia punya plot yang cerdas karakterisasi yang kuat dan susah untuk tidak menyukai kandungannya yang berisi banyak hal tentang bagaimana proses penebusan dosa yang ekstrem tentang kasih sayang yang menyembuhkan dan juga menghancurkan tentang kelembutan di balik kebrutalan tentang kebencian yang berujung balas dendam', 'plot cerdas karakterisasi kuat susah menyukai kandungannya berisi proses penebusan dosa ekstrem kasih sayang menyembuhkan menghancurkan kelembutan kebrutalan kebencian berujung balas dendam', 'plot cerdas karakterisasi kuat susah suka kandung isi proses tebus dosa ekstrem kasih sayang sembuh hancur lembut brutal benci ujung balas dendam'),
(1010, 1027, 'sebagai sebuah sajian fiksi ilmiah dengan balutan thriller dan action di dalamnya predators mungkin masih tidak sebaik pendahulunya namun tetap saja ini adalah sebuah sekuel yang baik setidaknya bagi saya fans berat film pertamanya yang cukup terhibur melihat pertarungan para manusia dengan para predator kali ini', 'sajian fiksi ilmiah balutan thriller action dalamnya predators pendahulunya sekuel fans berat film pertamanya terhibur pertarungan manusia predator kali', 'saji fiksi ilmiah balut thriller action dalam predators dahulu sekuel fans berat film pertama hibur tarung manusia predator kali'),
(1011, 1028, 'hampir kurang lebih  menit sub-plot emosional dari unmarried mother yang dimainkan gemilang oleh bintang jessabelle sarah snook yang nyaris tidak dikenali di awal film kemudian menjadi bagian tidak terpisahkan dari keseluruhan cerita', ' menit sub-plot emosional unmarried mother dimainkan gemilang bintang jessabelle sarah snook dikenali film terpisahkan cerita', ' menit sub plot emosional unmarried mother main gemilang bintang jessabelle sarah snook kenal film pisah cerita'),
(1012, 1029, 'resep action comedy yang sama dengan koki berbeda dan porsi kelucuan dan ledakan yang ditambah dan hasilnya masih sama lezatnya dengan pendahulunya terlebih kali ini ada lebih banyak personel dengan nama besar dan hasilnya red  adalah film yang menyenangkan ditonton', 'resep action comedy koki berbeda porsi kelucuan ledakan ditambah hasilnya lezatnya pendahulunya kali personel nama hasilnya red  film menyenangkan ditonton', 'resep action comedy koki beda porsi lucu ledak tambah hasil lezat dahulu kali personel nama hasil red  film senang tonton'),
(1013, 1030, 'penggunaan teknik montages mendominasi hampir keseluruhan film sepanjang  menit ini membuat film ini terasa unik dan berbeda dari film-film sejenis seperti masih belum cukup menghadirkan kegilaan lewat visual-visualnya lantunan irama lux aeterna yang legendaris dan menyayat hati garapan clint mansell pun membuat kisah tragis ini semakin menjadi-jadi', 'penggunaan teknik montages mendominasi film  menit film unik berbeda film-film sejenis menghadirkan kegilaan visual-visualnya lantunan irama lux aeterna legendaris menyayat hati garapan clint mansell kisah tragis menjadi-jadi', 'guna teknik montages dominasi film  menit film unik beda film jenis hadir gila visual lantun irama lux aeterna legendaris sayat hati garap clint mansell kisah tragis jadi'),
(1014, 1031, 'kenshin vs soujiro dipenuhi dengan kecepatan dan kelincahan sebuah adu pedang cantik sebuah rematch yang fantastis sementara foursome battle antara kenshin and the gank melawan shisio itu sulit untuk dilukiskan dengan kata-kata', 'kenshin vs soujiro dipenuhi kecepatan kelincahan adu pedang cantik rematch fantastis foursome battle kenshin and the gank melawan shisio sulit dilukiskan kata-kata', 'kenshin vs soujiro penuh cepat lincah adu pedang cantik rematch fantastis foursome battle kenshin and the gank lawan shisio sulit lukis kata'),
(1015, 1032, 'overall scott pilgrim vs the world menjadi penyegar di akhir-akhir summer movies  dan tak lupa musik-musik yang hadir di film ini asyik sekali patut dikoleksi', 'overall scott pilgrim vs the world penyegar akhir-akhir summer movies  lupa musik-musik hadir film asyik patut dikoleksi', 'overall scott pilgrim vs the world segar akhir summer movies  lupa musik hadir film asyik patut koleksi'),
(1016, 1033, 'nikmati saja kisahnya yang sederhana niscaya anda akan terhibur seperti saya sambil sekalian berharap sekuelnya nanti akan lebih baik dari yang ditampilkan sekarang', 'nikmati kisahnya sederhana niscaya terhibur berharap sekuelnya ditampilkan', 'nikmat kisah sederhana niscaya hibur harap sekuelnya tampil'),
(1017, 1034, 'stand by me punya kedalaman efek poping dan motion yang mumpuni dalam menghadirkan pengalaman sinematik modern yang menghibur sementara menginjak paruh kedua dominasi cahaya matahari sore memberi kesan sentimentil guna mendukung narasi perpisahan dengan lantuan lembut himawari no yakusoku yang memberi efek melodrama luar biasa', 'stand by me kedalaman efek poping motion mumpuni menghadirkan pengalaman sinematik modern menghibur menginjak paruh dominasi cahaya matahari sore kesan sentimentil mendukung narasi perpisahan lantuan lembut himawari no yakusoku efek melodrama', 'stand by me dalam efek poping motion mumpuni hadir alam sinematik modern hibur injak paruh dominasi cahaya matahari sore kesan sentimentil dukung narasi pisah lantuan lembut himawari no yakusoku efek melodrama'),
(1018, 1035, 'the force awakens tampil juga tampil perkasa di sini bahkan bisa dibilang ia sedikit berada di bawah empire strike back yang punya kekuatan dan twist yang hampir sama gilanya setiap kejutan berakhir dengan letupan emosi terutama buat para penonton veterannya setiap sesuatu yang familiar memunculkan sebuah nostalgia dan romantisme yang begitu kuat', 'the force awakens tampil tampil perkasa dibilang empire strike back kekuatan twist gilanya kejutan letupan emosi penonton veterannya familiar memunculkan nostalgia romantisme kuat', 'the force awakens tampil tampil perkasa bilang empire strike back kuat twist gila kejut letup emosi tonton veteran familiar muncul nostalgia romantisme kuat'),
(1019, 1036, 'tentu saja pertempuran dahsyatnya melibatkan banyak kerusakan yang mendebarkan tetapi bagian terbaiknya tidak hanya sampai di sana kim han min menyelipkan banyak kejutan dari strategi cerdas yang melibatkan kekuatan alam dan juga sebuah drama heroisme dan patriotisme penuh keberanian yang menginspirasi dari seorang pemimpin besar', 'pertempuran dahsyatnya melibatkan kerusakan mendebarkan terbaiknya kim han min menyelipkan kejutan strategi cerdas melibatkan kekuatan alam drama heroisme patriotisme penuh keberanian menginspirasi pemimpin', 'tempur dahsyat libat rusak debar baik kim han min selip kejut strategi cerdas libat kuat alam drama heroisme patriotisme penuh berani inspirasi pimpin'),
(1020, 1037, 'jarang ada drama dengan elemen musik yang tidak hanya digarap bagus namun di sisi lain sekaligus berfungsi sebagai penguat narasinya dari awal saja ketika lagu yang dibawakan dengan apik oleh johan heldenberg itu seperti sebuah pertanyaan pembuka merdu apakah lingkaran itu bisa tidak tersambung kembali apakah ada kehidupan setelah kematian lalu masih ada banyak lagi tembang-tembang country bluegrass bertema pahit-manis didendangkan bersama duet johan heldenbergh dan veerle baetens dengan kekuatan chemistry yang sama solidnya ketika keduanya menghadirkan romansa kesenangan dan segala luka kehidupannya', 'jarang drama elemen musik digarap bagus sisi berfungsi penguat narasinya lagu dibawakan apik johan heldenberg pembuka merdu lingkaran tersambung kehidupan kematian tembang-tembang country bluegrass bertema pahit-manis didendangkan duet johan heldenbergh veerle baetens kekuatan chemistry solidnya menghadirkan romansa kesenangan luka kehidupannya', 'jarang drama elemen musik garap bagus sisi fungsi kuat narasi lagu bawak apik johan heldenberg buka merdu lingkar sambung hidup mati tembang country bluegrass tema pahit manis dendang duet johan heldenbergh veerle baetens kuat chemistry solid hadir romansa senang luka hidup'),
(1021, 1038, 'the debt mungkin bukan thriller spionase yang sempurna tapi bagaimanpaun film yang didistribusikan oleh focus features dan miramax films ini adalah remake yang bagus apalagi ketika madden mampu mengemasnya dengan baik setiap momen-momen penuh kejutan dan ketegangan di dalamnya termasuk dukungan akting hebat dalam diri helen mirren dan jessica chastain', 'the debt thriller spionase sempurna bagaimanpaun film didistribusikan focus features miramax films remake bagus madden mengemasnya momen-momen penuh kejutan ketegangan dalamnya dukungan akting hebat helen mirren jessica chastain', 'the debt thriller spionase sempurna bagaimanpaun film distribusi focus features miramax films remake bagus madden emas momen penuh kejut tegang dalam dukung akting hebat helen mirren jessica chastain');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(1022, 1039, 'josh boone sudah melakukan pekerjaan bagus ketika bersama penulis naskah scott neustadter dan michael h weber tahu benar bagaimana mengangkut bagian-bagian terbaik dari novelnya meskipun tentu saja tidak semuanya yang ada di versi live action akan selengkap novelnya', 'josh boone pekerjaan bagus penulis naskah scott neustadter michael h weber mengangkut bagian-bagian terbaik novelnya versi live action selengkap novelnya', 'josh boone kerja bagus tulis naskah scott neustadter michael h weber angkut bagian baik novel versi live action lengkap novel'),
(1023, 1040, 'satu hal yang harus diperhatikan dalam membuat sebuah horor mockumentary adalah tingkat kerealistisannya memang sekarang gimmick-gimmick kisah nyata rekaman nyata dan pelaku nyata sudah tidak lagi mempan buat penonton yang sudah tahu jika ini adalah pertunjukan horor tetapi kesan nyata itu tetap harus ada di sub genre ini karena di sanalah kekuatannya', 'diperhatikan horor mockumentary tingkat kerealistisannya gimmick-gimmick kisah nyata rekaman nyata pelaku nyata mempan penonton pertunjukan horor kesan nyata sub genre sanalah kekuatannya', 'perhati horor mockumentary tingkat realistis gimmick kisah nyata rekam nyata pelaku nyata mempan tonton tunjuk horor kesan nyata sub genre sana kuat'),
(1024, 1041, 'overall the greatest memang bukanlah drama istimewa terutama kisahnya yang memang biasa-biasa saja dan sudah sering diangkat di film-film lain namun setidaknya film satu ini dapat mewakili sebuah kesedihan dan kedukaan mendalam sebuah keluarga lewat akting kuat dari para pemainnya sehingga mungkin tanpa sadar momen-momen menyentuh di dalamnya akan menggugah emosi penontonnya', 'overall the greatest drama istimewa kisahnya biasa-biasa diangkat film-film film mewakili kesedihan kedukaan mendalam keluarga akting kuat pemainnya sadar momen-momen menyentuh dalamnya menggugah emosi penontonnya', 'overall the greatest drama istimewa kisah biasa angkat film film wakil sedih duka dalam keluarga akting kuat main sadar momen sentuh dalam gugah emosi tonton'),
(1025, 1042, 'kombinasi duet maut yang bak bumi-langit dengan kandungan esterogen tingkat tinggi ini menjadi daya pikat terbesar the heat paul feig memberi banyak waktu untuk mccarthy dan bullock membangun chemistry kuat mereka mengenali satu sama lain mengisi setiap kekurangan dengan kelebihan mereka', 'kombinasi duet maut bak bumi-langit kandungan esterogen tingkat daya pikat terbesar the heat paul feig mccarthy bullock membangun chemistry kuat mengenali mengisi kekurangan kelebihan', 'kombinasi duet maut bak bumi langit kandung esterogen tingkat daya pikat besar the heat paul feig mccarthy bullock bangun chemistry kuat kenal isi kurang lebih'),
(1026, 1043, 'tidak diragukan bahwa streep yang membawa film ini dari stempel ordinary ke extraordinary patut diakui juga akting pemain pendukung olivia colman sebagai putrinya carol saya tidak heran jika meryl streep memenangkan oscar lagi di film ini walaupun saya juga menjagokan viola davis', 'diragukan streep membawa film stempel ordinary extraordinary patut diakui akting pemain pendukung olivia colman putrinya carol heran meryl streep memenangkan oscar film menjagokan viola davis', 'raguk streep bawa film stempel ordinary extraordinary patut aku akting main dukung olivia colman putri carol heran meryl streep menang oscar film jago viola davis'),
(1027, 1044, 'dobkin jelas beruntung punya dua pemain hebat macam downey jr dan duvall yang mampu menggerakkan ceritanya hubungan yang terjalin menghadirkan aroma dingin yang perlahan meleleh ketika kedua manusia ia mulai belajar berdamai dengan satu sama lain dan dengan masa lalu mereka yang sempat memisahkan', 'dobkin beruntung pemain hebat downey jr duvall menggerakkan ceritanya hubungan terjalin menghadirkan aroma dingin perlahan meleleh manusia belajar berdamai memisahkan', 'dobkin untung main hebat downey jr duvall gerak cerita hubung jalin hadir aroma dingin perlahan leleh manusia ajar damai pisah'),
(1028, 1045, 'film ini cocok di tonton semua kalangan meskipun film ini jauh dari sempurna ada beberapa adegan yang menyentuh saya salut buat jackie chan yang bisa membimbing jaden smith menjadi seorang aktor yang tidak hanya bisa berakting namun bisa juga beraksi di depan kamera meskipun ia baru belajar dan jika anda menyukai film pendahulunya anda pasti suka dengan yang ini', 'film cocok tonton kalangan film sempurna adegan menyentuh salut jackie chan membimbing jaden smith aktor berakting beraksi kamera belajar menyukai film pendahulunya suka', 'film cocok tonton kalang film sempurna adegan sentuh salut jackie chan bimbing jaden smith aktor akting aksi kamera ajar suka film dahulu suka'),
(1029, 1046, 'sebuah film laga hollywood bernuansa western-modern yang disajikan dengan presentasi penuh gaya dan kebrutalan tingkat tinggi dari seorang sutradara beken korea selatan yang baru saja memulai debut film berbahasa inggrisnya plus daya pikat utamanya arnold schwarzenegger ya the last stand menawarkan keasyikan sebuah action movie dengan kombinasi timur dan barat yang apik semua elemen aksi humor dan naskahnya yang ringan sukses melebur menjadi satu kesatuan yang menyenangkan', 'film laga hollywood bernuansa western-modern disajikan presentasi penuh gaya kebrutalan tingkat sutradara beken korea selatan debut film berbahasa inggrisnya plus daya pikat utamanya arnold schwarzenegger ya the last stand menawarkan keasyikan action movie kombinasi timur barat apik elemen aksi humor naskahnya ringan sukses melebur kesatuan menyenangkan', 'film laga hollywood nuansa western modern saji presentasi penuh gaya brutal tingkat sutradara beken korea selatan debut film bahasa inggris plus daya pikat utama arnold schwarzenegger ya the last stand tawar asyik action movie kombinasi timur barat apik elemen aksi humor naskah ringan sukses lebur satu senang'),
