(1102, 1119, 'untuk menambah kadar kelamnya byrkit menyuntiknya dengan atmosfer creepy bersama scoring minimalis yang menakutkan sementara elemen fiksi ilmiah misterinya berhasil bekerja maksimal memaksa pikiran kita bekerja keras menyusun gambar utuh dari petunjuk yang ada sampai nanti ditutup oleh ending yang mengejutkan', 'menambah kadar kelamnya byrkit menyuntiknya atmosfer creepy scoring minimalis menakutkan elemen fiksi ilmiah misterinya berhasil maksimal memaksa pikiran keras menyusun gambar utuh petunjuk ditutup ending mengejutkan', 'tambah kadar kelam byrkit suntik atmosfer creepy scoring minimalis takut elemen fiksi ilmiah misteri hasil maksimal paksa pikir keras susun gambar utuh tunjuk tutup ending kejut');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(1103, 1120, 'karakterisasi memegang peranan penting dalam berkembangnya cerita dan untuk bagian satu ini saya harus angkat dua jempol pada penampilan para pemainnya khususnya buat aktor yang juga komedian senior jepang dendem yang sudah membawakan karakter murata dengan sangat apik ya murata jelas menjadi daya tarik hebat sejak kemunculannya pertama kali dengan segala kehangatan kebaikan dan semangatnya', 'karakterisasi memegang peranan berkembangnya cerita angkat jempol penampilan pemainnya aktor komedian senior jepang dendem membawakan karakter murata apik ya murata daya tarik hebat kemunculannya kali kehangatan kebaikan semangatnya', 'karakterisasi pegang peran kembang cerita angkat jempol tampil main aktor komedian senior jepang dendem bawak karakter murata apik ya murata daya tarik hebat muncul kali hangat baik semangat'),
(1104, 1121, 'robert zemeckis sudah mengerjakan tugasnya dengan baik dalam menerjemahkan kembali lembar demi lembar naskah kuat dan cerdas beserta visual-visual hebat di dalamnya apa yang kemudian menjadikan contact sebuah sajian fiksi ilmiah yang istimewa adalah ketika ia kemudian menjejalkan beberapa tema menarik menjadi satu kesatuan kokoh dalam rangkaian drama penuh kejutan-kejutan manis sepanjang hampir  jam', 'robert zemeckis tugasnya menerjemahkan lembar lembar naskah kuat cerdas beserta visual-visual hebat dalamnya menjadikan contact sajian fiksi ilmiah istimewa menjejalkan tema menarik kesatuan kokoh rangkaian drama penuh kejutan-kejutan manis  jam', 'robert zemeckis tugas terjemah lembar lembar naskah kuat cerdas serta visual hebat dalam jadi contact saji fiksi ilmiah istimewa jejal tema tarik satu kokoh rangkai drama penuh kejutan manis  jam'),
(1105, 1122, 'soderbergh sudah melakukan pekerjaannya dengan bagus rapi dan sangat meyakinkan dalam mensimulasikan kiamat versinya itu dengan dukungan bintang-bintang kelas  nya yang bermain bagus', 'soderbergh pekerjaannya bagus rapi mensimulasikan kiamat versinya dukungan bintang-bintang kelas  nya bermain bagus', 'soderbergh kerja bagus rapi simulasi kiamat versi dukung bintang kelas  nya main bagus'),
(1106, 1123, 'overall conviction adalah sebuah film inspirasional yang menyentuh dan emosional goldwyn sukses meramu premis sederhana ini menjadi sebuah tontonan menarik apalagi didukung dengan performa apik para pemainnya', 'overall conviction film inspirasional menyentuh emosional goldwyn sukses meramu premis sederhana tontonan menarik didukung performa apik pemainnya', 'overall conviction film inspirasional sentuh emosional goldwyn sukses meramu premis sederhana tonton tarik dukung performa apik main'),
(1107, 1124, 'senang rasanya menemukan satu lagi komedi bagus tahun ini crazy stupid love telah memenuhi semua kriteria sebuah sajian komedi romantis yang menarik tidak hanya lucu manis dan menyimpan kejutan-kejutan tak terduga tapi ia juga punya hati dan menawarkan banyak cinta di dalamnya untuk diperjuangkan bersama jajaran pemainnya yang luar biasa', 'senang menemukan komedi bagus crazy stupid love memenuhi kriteria sajian komedi romantis menarik lucu manis menyimpan kejutan-kejutan terduga hati menawarkan cinta dalamnya diperjuangkan jajaran pemainnya', 'senang temu komedi bagus crazy stupid love penuh kriteria saji komedi romantis tarik lucu manis simpan kejutan duga hati tawar cinta dalam juang jajar main'),
(1108, 1125, 'tentu saja sebuah biopik bagus harus punya jagoan hebat di dalamnya sebagai sentral berceritanya dalam kasus ini ada mcconaughey yang sudah melakukan sesuatu yang besar bahkan mungkin yang paling besar melebihi apa yang pernah kamu lihat di sepanjang kariernya', 'biopik bagus jagoan hebat dalamnya sentral berceritanya mcconaughey melebihi lihat kariernya', 'biopik bagus jago hebat dalam sentral cerita mcconaughey lebih lihat karier'),
(1109, 1126, 'setiap emosi yang terpancar dari wajah caesar itu nyata milik serkis sampai-sampai membuat reeves memuji serkins setinggi langit dan menganggap performanya itu layak diganjar oscar', 'emosi terpancar wajah caesar nyata milik serkis reeves memuji serkins langit menganggap performanya layak diganjar oscar', 'emosi pancar wajah caesar nyata milik serkis reeves puji serkins langit anggap performa layak ganjar oscar'),
(1110, 1127, 'overall kehadiran daybreakers bisa dibilang menjadi obat bagi mereka yang selama ini merindukan genre vampire yang berbalut adegan-adegan action menarik apalagi film yang didistribusikan lionsgate ini juga memiliki konsep yang terbilang orisinil dari kebanyakan film bertema sama lainnya', 'overall kehadiran daybreakers dibilang obat merindukan genre vampire berbalut adegan-adegan action menarik film didistribusikan lionsgate memiliki konsep terbilang orisinil kebanyakan film bertema', 'overall hadir daybreakers bilang obat rindu genre vampire balut adegan action tarik film distribusi lionsgate milik konsep bilang orisinil banyak film tema'),
(1111, 1128, 'dead snow menjadi kejutan menyenangkan tersendiri buat para fans horor horor komedi produksi norwegia itu memberikan sensasi menonton genre zombie yang menyegarkan', 'dead snow kejutan menyenangkan tersendiri fans horor horor komedi produksi norwegia sensasi menonton genre zombie menyegarkan', 'dead snow kejut senang sendiri fans horor horor komedi produksi norwegia sensasi tonton genre zombie segar'),
(1112, 1129, 'disokong wahlberg dan nama-nama lain deepwater horizon bisa jadi film berondong jagung yang efektif menghibur dan diimbuhi sedikit pesan humanis yang berhasil menutup filmnya dengan cukup mengaduk-aduk nurani', 'disokong wahlberg nama-nama deepwater horizon film berondong jagung efektif menghibur diimbuhi pesan humanis berhasil menutup filmnya mengaduk-aduk nurani', 'sokong wahlberg nama deepwater horizon film berondong jagung efektif hibur imbuh pesan humanis hasil tutup film aduk nurani'),
(1113, 1130, 'departures menurut saya adalah film jepang terbaik di tahun  memang tak salah film ini menang oscar untuk film berbahasa asing terbaik kematian di sini digambarkan dengan indah penuh kelembutan dan penuh dengan emosi diiringi dengan music score yang sangat menyentuh khas film drama jepang yang mampu menambah makna film ini', 'departures film jepang terbaik  salah film menang oscar film berbahasa asing terbaik kematian digambarkan indah penuh kelembutan penuh emosi diiringi music score menyentuh khas film drama jepang menambah makna film', 'departures film jepang baik  salah film menang oscar film bahasa asing baik mati gambar indah penuh lembut penuh emosi iring music score sentuh khas film drama jepang tambah makna film'),
(1114, 1131, 'sampai tulisan ini dibuat despicable me sudah meraup  juta dollar di tangga box office serta banyak mendapatkan sambutan positif dari moviegoers dunia jelas sebuah pencapaian fantastis untuk ukuran animasi yang hanya memiliki budget  juta dollar ini', 'tulisan despicable me meraup  juta dollar tangga box office serta sambutan positif moviegoers dunia pencapaian fantastis ukuran animasi memiliki budget  juta dollar', 'tulis despicable me raup  juta dollar tangga box office serta sambut positif moviegoers dunia capai fantastis ukur animasi milik budget  juta dollar'),
(1115, 1132, 'ya guillermo del toro memang sutradara spesial melalui film yang juga diproduserinya bersama pedro almodovar ini ia sukses menghadirkan sebuah kisah hantu berkualitas disajikan dengan pendekatan yang meyakinkan realisitis indah namun juga tragis secara bersamaan', 'ya guillermo del toro sutradara spesial film diproduserinya pedro almodovar sukses menghadirkan kisah hantu berkualitas disajikan pendekatan realisitis indah tragis bersamaan', 'ya guillermo del toro sutradara spesial film produser pedro almodovar sukses hadir kisah hantu kualitas saji dekat realisitis indah tragis sama'),
(1116, 1133, 'saya menikmati setiap menitnya menyaksikan bagaimana interaksi para karakternya dibangun dengan cukup baik bagaimana bettinelli-olpin dan gillett menjaga misteri dan atmosfernya secara konsisten dari start hingga finish beberapa spesial efeknya digarap bagus untuk ukuran horor dan tentu saja klimaksnya menjadi bagian terbaik yang patut kamu tunggu', 'menikmati menitnya menyaksikan interaksi karakternya dibangun bettinelli-olpin gillett menjaga misteri atmosfernya konsisten start finish spesial efeknya digarap bagus ukuran horor klimaksnya terbaik patut tunggu', 'nikmat menit saksi interaksi karakter bangun bettinelli olpin gillett jaga misteri atmosfer konsisten start finish spesial efek garap bagus ukur horor klimaks baik patut tunggu'),
(1117, 1134, 'ya ini adalah sesuatu yang jarang kamu dapatkan dalam sebuah film yang disesaki dengan banyak karakter penting di mana setiap karakter berakting baik dan yang paling utama adalah mereka mendapatkan kesempatan untuk mengembangkan karakternya', 'ya jarang dapatkan film disesaki karakter karakter berakting utama kesempatan mengembangkan karakternya', 'ya jarang dapat film sesak karakter karakter akting utama sempat kembang karakter'),
(1118, 1135, 'sulit untuk tidak jatuh cinta dengan django unchained apalagi untuk ukuran sebuah western movie yang biasa dijadikan tontonan nomor dua tarantino sudah melakukan sebuah usaha fantastis untuk menaikkan pamor genre klasik ini dengan caranya sendiri tanpa harus menghilangkan semangat baratnya terlebih kamu akan kembali bertemu dengan seorang christoph waltz yang lagi-lagi tampil bagus', 'sulit jatuh cinta django unchained ukuran western movie dijadikan tontonan nomor tarantino usaha fantastis menaikkan pamor genre klasik menghilangkan semangat baratnya bertemu christoph waltz lagi-lagi tampil bagus', 'sulit jatuh cinta django unchained ukur western movie jadi tonton nomor tarantino usaha fantastis naik pamor genre klasik hilang semangat barat bertemu christoph waltz lagi tampil bagus'),
(1119, 1136, 'jajaran pemainnya yang berkaliber oscar hingga tampilan mads mikkelsen sebagai antagonis serta cumberbatch yang mumpuni sebagai strange menjadi poin lebih yang memikat di layar', 'jajaran pemainnya berkaliber oscar tampilan mads mikkelsen antagonis serta cumberbatch mumpuni strange poin memikat layar', 'jajar main kaliber oscar tampil mads mikkelsen antagonis serta cumberbatch mumpuni strange poin mikat layar'),
(1120, 1137, 'neil marshall bisa dikatakan telah berhasil memodifikasi sub genre horor werewolf dengan sangat baik dan efektif baik dari naskah maupun sisi teknisnya dengan sentuhan klasik-modern dan sedikit humor gelap untuk menjadikannya sebagai salah satu cult horor yang patut ditonton bagi setiap penggemar genre ini', 'neil marshall berhasil memodifikasi sub genre horor werewolf efektif naskah sisi teknisnya sentuhan klasik-modern humor gelap menjadikannya salah cult horor patut ditonton penggemar genre', 'neil marshall hasil modifikasi sub genre horor werewolf efektif naskah sisi teknis sentuh klasik modern humor gelap jadi salah cult horor patut tonton gemar genre'),
(1121, 1138, 'gordon-levitt mencoba membuat filmnya seatraktif mungkin dengan melibatkan banyak narasi editing cepat nan enerjik dan tentu saja komedi-komedi seks yang melibatkan dialog-dialog kocak ya itu berhasil memang secara teknis penyutradaraan gordon-levitt sudah melakukan pekerjaan bagus untuk seorang debutan', 'gordon-levitt mencoba filmnya seatraktif melibatkan narasi editing cepat nan enerjik komedi-komedi seks melibatkan dialog-dialog kocak ya berhasil teknis penyutradaraan gordon-levitt pekerjaan bagus debutan', 'gordon levitt coba film atraktif libat narasi editing cepat nan enerjik komedi seks libat dialog kocak ya hasil teknis sutradara gordon levitt kerja bagus debut'),
(1122, 1139, 'dream home ternyata mampu menyajikannya segala kesadisan dan tumpahan darah tersebut dengan dosis tinggi sehingga hasilnya adalah rangkaian adegan pembunuhan yang berhasil disajikan dengan kreatif dan rapi bahkan terlihat sangat realistis berkat dukungan spesial efek dan make up yang luar biasa', 'dream home menyajikannya kesadisan tumpahan darah dosis hasilnya rangkaian adegan pembunuhan berhasil disajikan kreatif rapi realistis berkat dukungan spesial efek make up', 'dream home saji sadis tumpah darah dosis hasil rangkai adegan bunuh hasil saji kreatif rapi realistis berkat dukung spesial efek make up'),
(1123, 1140, 'usaha yang dilakukan karl urban dalam menjadikan dirinya sebagai judge dredd yang baru jelas patut mendapatkan acungan jempol tidak seperti stallone urban sudah mengembalikan sosok sang hakim ke jalan yang benar ', 'usaha karl urban menjadikan judge dredd patut acungan jempol stallone urban mengembalikan sosok sang hakim jalan ', 'usaha karl urban jadi judge dredd patut acung jempol stallone urban kembali sosok sang hakim jalan '),
(1124, 1141, 'farrely membiarkan carrey dan daniels menguasai panggung dengan segala sisa-sisa energi mereka membiarkan para penonton veterannya merasakan sensasi yang pernah mereka rasakan dua dekade lalu ketika melihat duet maut ini berhasil mengocok perutmu sampai sakit lengkap dengan segala cameo menghibur termasuk cameo dari van anjing legendaris mereka', 'farrely membiarkan carrey daniels menguasai panggung sisa-sisa energi membiarkan penonton veterannya merasakan sensasi rasakan dekade duet maut berhasil mengocok perutmu sakit lengkap cameo menghibur cameo van anjing legendaris', 'farrely biar carrey daniels kuasa panggung sisa energi biar tonton veteran rasa sensasi rasa dekade duet maut hasil kocok perut sakit lengkap cameo hibur cameo van anjing legendaris'),
(1125, 1142, 'ah intinya elle adalah sebuah pengalaman menonton yang tak biasa disajikan dengan berkelas dan menampilkan salah satu performa terbaik tahun ini melalui akting prima huppert dan verhoeven di usianya yang tak lagi muda sukses bereksplorasi dengan tema yang dahulu membesarkan namanya namun disajikannya tanpa dibuat-buat dan berkesan karena kesederhanaannya yang kuat', 'ah intinya elle pengalaman menonton disajikan berkelas menampilkan salah performa terbaik akting prima huppert verhoeven usianya muda sukses bereksplorasi tema membesarkan namanya disajikannya dibuat-buat berkesan kesederhanaannya kuat', 'ah inti elle alam tonton saji kelas tampil salah performa baik akting prima huppert verhoeven usia muda sukses eksplorasi tema besar nama saji buat kesan sederhana kuat'),
(1126, 1143, 'gandolfini bermain bagus sebagai duda dengan selera humor dan kehangatan yang menyenangkan bisa dibilang ini adalah pertunjukan perpisahan manis dan berkesan dari seorang gandolfini  sementara bintang serial televisi julia louis-dreyfus punya chemistry dengan gandolfini terutama di saat melibatkan guyonan-guyonan cerdas', 'gandolfini bermain bagus duda selera humor kehangatan menyenangkan dibilang pertunjukan perpisahan manis berkesan gandolfini  bintang serial televisi julia louis-dreyfus chemistry gandolfini melibatkan guyonan-guyonan cerdas', 'gandolfini main bagus duda selera humor hangat senang bilang tunjuk pisah manis kesan gandolfini  bintang serial televisi julia louis dreyfus chemistry gandolfini libat guyonan cerdas'),
(1127, 1144, 'overall event horizon bisa dibilang sukses mengkombinasikan dengan baik elemen-elemen fiksi ilmiah dan horror dengan sangat baik kengerian visual maupun psikologis benar-benar dieksploitasi habis-habisan oleh paul anderson hasilnya adalah sebuah horror luar angkasa yang siap memberikan teror mental bagi para penontonnya', 'overall event horizon dibilang sukses mengkombinasikan elemen-elemen fiksi ilmiah horror kengerian visual psikologis benar-benar dieksploitasi habis-habisan paul anderson hasilnya horror angkasa teror mental penontonnya', 'overall event horizon bilang sukses mengkombinasikan elemen fiksi ilmiah horror ngeri visual psikologis benar eksploitasi habis paul anderson hasil horror angkasa teror mental tonton'),
(1128, 1145, 'untuk ukuran sebuah film televisi frequently asked questions about time travel ternyata dapat melebihi dari yang saya kira sebelumnya jarang-jarang ada fiksi ilmiah komedi sekocak dak sekomplit ini yang tidak hanya menampilkan humor semata namun secara bersamaan diikuti dengan dukungan kisah yang seru dan menarik pemilihan dialog yang cerdas dan kekuatan chemistry ketiga tokoh utamanya yang bermain solid', 'ukuran film televisi frequently asked questions about time travel melebihi jarang-jarang fiksi ilmiah komedi sekocak dak sekomplit menampilkan humor bersamaan diikuti dukungan kisah seru menarik pemilihan dialog cerdas kekuatan chemistry ketiga tokoh utamanya bermain solid', 'ukur film televisi frequently asked questions about time travel lebih jarang fiksi ilmiah komedi kocak dak sekomplit tampil humor sama ikut dukung kisah seru tarik pilih dialog cerdas kuat chemistry tiga tokoh utama main solid'),
(1129, 1146, 'overall from dusk till dawn mungkin bukan karya terbaik dari seorang robert rodriguez namun seperti ciri khas film-film lain miliknya from dusk till dawn juga tidak ketinggalan menghibur penontonnya dengan ciri khasnya sendiri sebuah suguhan b movie yang menyenangkan untuk ditonton tentunya dengan pikiran terbuka', 'overall from dusk till dawn karya terbaik robert rodriguez ciri khas film-film miliknya from dusk till dawn ketinggalan menghibur penontonnya ciri khasnya suguhan b movie menyenangkan ditonton pikiran terbuka', 'overall from dusk till dawn karya baik robert rodriguez ciri khas film milik from dusk till dawn tinggal hibur tonton ciri khas suguh b movie senang tonton pikir buka'),
(1130, 1147, 'tidak hanya para demit yang tampil lebih oke presentasi feig dalam hal action juga tidak kalah hebatnya menghasilkan tontonan berburu hantu yang sangat fun di sepanjang  menit durasinya', 'demit tampil oke presentasi feig action kalah hebatnya menghasilkan tontonan berburu hantu fun  menit durasinya', 'demit tampil oke presentasi feig action kalah hebat hasil tonton buru hantu fun  menit durasi'),
(1131, 1148, 'menyenangkan melihat bagaimana duo mo naik kelas jika rumah dara seperti sarana mereka untuk bersenang-senang sekaligus membuktikan kecintaan mereka pada blood and gore maka killers adalah bagaimana keduanya melangkah lebih jauh ke dalam sebuah sajian thriller yang lebih kompleks namun tetap begitu menyenangkan untuk ditonton bersama balutan sekuen-sekuen mendebarkan', 'menyenangkan duo mo kelas rumah dara sarana bersenang-senang membuktikan kecintaan blood and gore killers melangkah sajian thriller kompleks menyenangkan ditonton balutan sekuen-sekuen mendebarkan', 'senang duo mo kelas rumah dara sarana senang bukti cinta blood and gore killers lang saji thriller kompleks senang tonton balut sekuen debar'),
(1132, 1149, 'kesan pertama ketika menancapkan pandangan kepada kingsglaive adalah ini animasi yang luar biasa indah secara teknis apa yang dilakukan oleh suradara takeshi nozue dan para animator square enix dalam menghadirkan dunia final fantasy xv sulit untuk dilukiskan dengan kata-kata bahkan buat saya pribadi yang sudah sering melihat kualitas cgi yang dibuat mereka di karya-karya sebelumnya', 'kesan menancapkan pandangan kingsglaive animasi indah teknis suradara takeshi nozue animator square enix menghadirkan dunia final fantasy xv sulit dilukiskan kata-kata pribadi kualitas cgi karya-karya', 'kesan tancap pandang kingsglaive animasi indah teknis suradara takeshi nozue animator square enix hadir dunia final fantasy xv sulit lukis kata pribadi kualitas cgi karya'),
(1133, 1150, 'tidak pernah mudah membuat sebuah drama olahraga yang bagus secara teknis dan bersamaan juga terasa informatif real dan sentimentil semua itu bisa terjadi karena delon tio yang juga bagian dari komunitas indorunners dengan cerdik memanfaatkan dua even lari di dunia nyata untuk disatukan dengan filmnya', 'mudah drama olahraga bagus teknis bersamaan informatif real sentimentil delon tio komunitas indorunners cerdik memanfaatkan even lari dunia nyata disatukan filmnya', 'mudah drama olahraga bagus teknis sama informatif real sentimentil delon tio komunitas indorunners cerdik manfaat even lari dunia nyata satu film'),
