(1175, 1192, 'zampaglione merusak semuanya dengan twist endingnya yang maksa itu ya harus diakui penyelesaiannya memang cukup membuat saya terkejut tapi menipu penontonnya mentah-mentah dengan cara seperti itu jelas buruk', 'zampaglione merusak twist endingnya maksa ya diakui penyelesaiannya terkejut menipu penontonnya mentah-mentah buruk', 'zampaglione rusak twist endingnya maksa ya aku selesai kejut tipu tonton mentah buruk'),
(1176, 1193, 'banyak menderita di naskahnya yang terlalu generik meskipun kemudian kualitas penyajian yang dihadirkan park chan wook mampu sedikit menyelamatkan stoker dari sebuah kehancuran total', 'menderita naskahnya generik kualitas penyajian dihadirkan park chan wook menyelamatkan stoker kehancuran total', 'derita naskah generik kualitas saji hadir park chan wook selamat stoker hancur total'),
(1177, 1194, 'jujur saja itu sama menyebalkannya dengan karakter aggi yang di sepanjang film seperti minta ditampar tidak peduli jika kamu memasang lagu raisa yang paling ngetop sekalipun tetapi jika penggunaannya sampai menabrak adegan dan dialog-dialognya itu terlihat seperti pekerjaan amatiran', 'jujur menyebalkannya karakter aggi film ditampar peduli memasang lagu raisa ngetop penggunaannya menabrak adegan dialog-dialognya pekerjaan amatiran', 'jujur sebal karakter aggi film tampar peduli pasang lagu raisa ngetop guna tabrak adegan dialog kerja amatir'),
(1178, 1195, 'kamu akan menyaksikan rentetan momen aksi murahan tanpa didukung set-piece yang baik humor-humor one-liner yang terasa terlalu memaksakan diri untuk terlihat lucu', 'menyaksikan rentetan momen aksi murahan didukung set-piece humor-humor one-liner memaksakan lucu', 'saksi rentet momen aksi murah dukung set piece humor one liner paksa lucu'),
(1179, 1196, 'sayangnya saya merasa super  bergerak terlalu lama dan sedikit bertele-tele pada satu jam pertama tidak ada emosi di sini semuanya dihadirkan dalam takaran yang serba berkecukupan bahkan elemen misterinya juga harus berakhir antiklimaks begitu saja tanpa mampu meninggalkan kesan berarti', 'sayangnya super  bergerak bertele-tele jam emosi dihadirkan takaran serba berkecukupan elemen misterinya antiklimaks meninggalkan kesan', 'sayang super  gerak tele jam emosi hadir takar serba berkecukupan elemen misteri antiklimaks tinggal kesan'),
(1180, 1197, 'alih-alih menjadi sajian thriller survivor malah terjerembab dalam kubangan action kelas dua dengan kualitas narasi yang menyedihkan plus ketidak konsistenan plot yang sangat mengganggu', 'alih-alih sajian thriller survivor terjerembab kubangan action kelas kualitas narasi menyedihkan plus ketidak konsistenan plot mengganggu', 'alih saji thriller survivor terjerembab kubang action kelas kualitas narasi sedih plus tidak konsisten plot ganggu'),
(1181, 1198, 'tidak hanya menderita di naskah dan alurnya yang semakin terseok-seok membosankan porsi action mengalami downgrade termasuk pace yang menjadi semakin lambat selambat karakter bryan mills yang tampak mulai kelelahan', 'menderita naskah alurnya terseok-seok membosankan porsi action mengalami downgrade pace lambat selambat karakter bryan mills kelelahan', 'derita naskah alur seok bosan porsi action alami downgrade pace lambat lambat karakter bryan mills lelah'),
(1182, 1199, 'munculnya beberapa lubang cerita yang cukup mengganggu konflik-konflik yang muncul terkesan terlalu digampangakn dalam penyelesaiannya karakter-karakter yang kurang bisa dimanfaatkan menjadi dosa-dosa terbesar di film ini', 'munculnya lubang cerita mengganggu konflik-konflik muncul terkesan digampangakn penyelesaiannya karakter-karakter dimanfaatkan dosa-dosa terbesar film', 'muncul lubang cerita ganggu konflik muncul kesan digampangakn selesai karakter manfaat dosa besar film'),
(1183, 1200, 'tidak peduli seberapa kerasnya usaha yang dilakukan ketiga pemainnya tetap saja mereka gagal termasuk dengan menghadirkan wawancara terpisah pada awal dan akhir film bukan hanya karena kualitas akting yang sangat buruk namun kehadiran mereka yang notabene adalah publik figurlah yang menjadikan nuansa real film ini langsung lenyap begitu saja', 'peduli kerasnya usaha ketiga pemainnya gagal menghadirkan wawancara terpisah film kualitas akting buruk kehadiran notabene publik figurlah menjadikan nuansa real film langsung lenyap', 'peduli keras usaha tiga main gagal hadir wawancara pisah film kualitas akting buruk hadir notabene publik figur jadi nuansa real film langsung lenyap'),
(1184, 1201, 'gatsby terasa terlalu lama dan seperti berputar-putar untuk mencapai titik yang ingin dituju namun masalah terbesarnya bukan pada durasi yang panjang plot dragging atau dialog-dialog membosankannya tetapi ketika luhrmaan gagal menghadirkan sisi emosional yang seharusnya bisa tergali lebih dalam lagi', 'gatsby berputar-putar mencapai titik dituju terbesarnya durasi plot dragging dialog-dialog membosankannya luhrmaan gagal menghadirkan sisi emosional tergali', 'gatsby putar capai titik tuju besar durasi plot dragging dialog bosan luhrmaan gagal hadir sisi emosional gali'),
(1185, 1202, 'seperti kita ketahui film pertamanya punya premis kuat dan beda untuk ukuran sebuah animasi yang sanggup menjadi daya tarik utama namun tidak adanya lagi badai makanan-makanan yang lezat rupanya tidak membuat cloudy with a chance of meatballs  kehilangan pesonanya di bawah komando baru duo sutradara barunya hujan bakso dan kuliner lain diganti menjadi pulau makanan dengan segala macam food animals yang digarap dengan sangat kreatif dan juga lucu oleh tangan-tangan handal animator sony pictures animation', 'ketahui film pertamanya premis kuat beda ukuran animasi sanggup daya tarik utama badai makanan-makanan lezat cloudy with a chance of meatballs  kehilangan pesonanya komando duo sutradara barunya hujan bakso kuliner diganti pulau makanan food animals digarap kreatif lucu tangan-tangan handal animator sony pictures animation', 'tahu film pertama premis kuat beda ukur animasi sanggup daya tarik utama badai makanan lezat cloudy with a chance of meatballs  hilang pesona komando duo sutradara baru hujan bakso kuliner ganti pulau makan food animals garap kreatif lucu tangan handal animator sony pictures animation');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(1186, 1203, 'overall grave of the fireflies berhasil menampilkan sebuah kisah sederhana realistis dan menyentuh yang mampu memberikan efek besar bagi para penontonnya tidak terlalu berlebihan rasanya jika roger ebert menganggap animasi satu ini adalah salah satu the most powerful anti-war movies ever made bahkan mereka pun berani menyandingkannya dengan karya hebat steven spielberg', 'overall grave of the fireflies berhasil menampilkan kisah sederhana realistis menyentuh efek penontonnya roger ebert menganggap animasi salah the most powerful anti-war movies ever made berani menyandingkannya karya hebat steven spielberg', 'overall grave of the fireflies hasil tampil kisah sederhana realistis sentuh efek tonton roger ebert anggap animasi salah the most powerful anti war movies ever made berani sanding karya hebat steven spielberg'),
(1187, 1204, 'ya perpaduan urban legend yang dipadu padankan dengan style mockumentary masih terbukti efektif untuk memberikan penontonnya sebuah sensasi menonton horror penuh kengerian', 'ya perpaduan urban legend dipadu padankan style mockumentary terbukti efektif penontonnya sensasi menonton horror penuh kengerian', 'ya padu urban legend padu padan style mockumentary bukti efektif tonton sensasi tonton horror penuh ngeri'),
(1188, 1205, 'plotnya sendiri berkembang dinamis masih berisi elemen coming of age buddy movie dan kesetiaan serta kali ini ada tambahan sebuah reuni keluarga yang manis tetapi yang istimewa dari naskah how to train your dragon  adalah bagaimana dean deblois menghadirkan kadar emosinya ', 'plotnya berkembang dinamis berisi elemen coming of age buddy movie kesetiaan serta kali tambahan reuni keluarga manis istimewa naskah how to train your dragon  dean deblois menghadirkan kadar emosinya ', 'plot kembang dinamis isi elemen coming of age buddy movie setia serta kali tambah reuni keluarga manis istimewa naskah how to train your dragon  dean deblois hadir kadar emosi '),
(1189, 1206, 'seorang biarawati polandia lembut dan baik hati yang dimainkan dengan sangat baik oleh agata buzek kombinasi karakter yang bak bumi dan langit ini kemudian saling mengisi satu sama lain yang meskipun tidak sepenuhnya berjalan terlalu mulus namun sudah lebih dari cukup untuk memberikan sebuah hubungan unik yang menarik', 'biarawati polandia lembut hati dimainkan agata buzek kombinasi karakter bak bumi langit mengisi sepenuhnya berjalan mulus hubungan unik menarik', 'biarawati polandia lembut hati main agata buzek kombinasi karakter bak bumi langit isi sepenuh jalan mulus hubung unik tarik'),
(1190, 1207, 'layaknya sebuah zombie survival ada begitu banyak momen mendebarkan di sini yang didominasi dengan serbuan masif para pelahap otak itu dan bagaimana sato mampu mengemasnya dengan sangat baik menyeimbangkan antara horor komedi dan drama menariknya para zombie digambarkan tidak hanya terlihat mengerikan namun juga unik dengan karakteristik berbeda-beda', 'layaknya zombie survival momen mendebarkan didominasi serbuan masif pelahap otak sato mengemasnya menyeimbangkan horor komedi drama menariknya zombie digambarkan mengerikan unik karakteristik berbeda-beda', 'layak zombie survival momen debar dominasi serbu masif lahap otak sato emas menyeimbangkan horor komedi drama tarik zombie gambar erik unik karakteristik beda'),
(1191, 1208, 'acharia bisa dibilang adalah kekuatan utama i am yours ia sukses menggerakkan naskah kompleks haq mengisi perannya dengan sisi perpaduan sensualitas yang sama kuatnya dengan kerapuhannya sebagai manusia yang terbuang dari lingkungannya', 'acharia dibilang kekuatan utama i am yours sukses menggerakkan naskah kompleks haq mengisi perannya sisi perpaduan sensualitas kuatnya kerapuhannya manusia terbuang lingkungannya', 'acharia bilang kuat utama i am yours sukses gerak naskah kompleks haq isi peran sisi padu sensualitas kuat rapuh manusia buang lingkung'),
(1192, 1209, 'meskipun tidak sampai serealistis dan sekontroversial versi aslinya setidaknya sebagai sutradara monroe sudah memberikan sebuah suguhan thriller balas dendam yang lumayan menghibur dan cukup ejoyable untuk ditonton', 'serealistis sekontroversial versi aslinya sutradara monroe suguhan thriller balas dendam lumayan menghibur ejoyable ditonton', 'realistis kontroversial versi asli sutradara monroe suguh thriller balas dendam lumayan hibur ejoyable tonton'),
(1193, 1210, 'sussanne bier sudah melakukan pekerjaannya dengan sangat baik dengan menghadirkan sebuah melodrama emosional sederhana dengan balutan naskah kuat yang juga didukung teknik penyutradaraan prima dan akting apik dari setiap pemainnya', 'sussanne bier pekerjaannya menghadirkan melodrama emosional sederhana balutan naskah kuat didukung teknik penyutradaraan prima akting apik pemainnya', 'sussanne bier kerja hadir melodrama emosional sederhana balut naskah kuat dukung teknik sutradara prima akting apik main'),
(1194, 1211, 'kombinasi nama besar whedon premis cinta yang unik dan kehadiran kembali si manis zoe kazan memang membuat in your eyes punya kekuatannya sendiri', 'kombinasi nama whedon premis cinta unik kehadiran si manis zoe kazan in your eyes kekuatannya', 'kombinasi nama whedon premis cinta unik hadir si manis zoe kazan in your eyes kuat'),
(1195, 1212, 'duo emmerich-develin telah sukses melakukan pekerjaannya dalam upaya mereka menghadirkan sebuah sajian sci-fi paling menghibur yang tidak akan pernah jemu saya tonton berulang kali', 'duo emmerich-develin sukses pekerjaannya upaya menghadirkan sajian sci-fi menghibur jemu tonton berulang kali', 'duo emmerich develin sukses kerja upaya hadir saji sci fi hibur jemu tonton ulang kali'),
(1196, 1213, 'overall innocent voices adalah salah satu anti war movie terbaik yang pernah dibuat sebuah film yang perlu disaksikan semua orang di seluruh dunia agar mereka dapat memberikan kesempatan bagi anak-anak untuk menjalani hidupnya sebagaimana layaknya anak kecil yaitu penuh canda dan tawa', 'overall innocent voices salah anti war movie terbaik film disaksikan orang dunia kesempatan anak-anak menjalani hidupnya layaknya anak penuh canda tawa', 'overall innocent voices salah anti war movie baik film saksi orang dunia sempat anak jalan hidup layak anak penuh canda tawa'),
(1197, 1214, 'setiap cerita punya daya tarik masing-masing meskipun tidak semuanya tersaji kuat namun bagaimana kemudian mereka saling bersinggungan satu sama lain itu menjadi daya tarik tersendiri departemen akting tampil bagus khususnya ririn ekawati yang bermain total', 'cerita daya tarik tersaji kuat bersinggungan daya tarik tersendiri departemen akting tampil bagus ririn ekawati bermain total', 'cerita daya tarik saji kuat singgung daya tarik sendiri departemen akting tampil bagus ririn ekawati main total'),
(1198, 1215, 'lebanon bisa dibilang adalah sebuah film anti perang yang unik jika dibandingkan dengan kebanyakan sejenisnya salah satu faktor utama yang membuat film ini berbeda adalah setting yang sangat terbatas', 'lebanon dibilang film anti perang unik dibandingkan kebanyakan sejenisnya salah faktor utama film berbeda setting terbatas', 'lebanon bilang film anti perang unik banding banyak jenis salah faktor utama film beda setting batas'),
(1199, 1216, 'sutradara dan penulis naskah lukas moodysson sukses menghasilkan sebuah drama kemanusiaan realistis dengan dukungan akting natural dari semua pemainnya dukungan soundtrack yang powerful juga menjadi daya tarik tersendiri bagi lilya  ever', 'sutradara penulis naskah lukas moodysson sukses menghasilkan drama kemanusiaan realistis dukungan akting natural pemainnya dukungan soundtrack powerful daya tarik tersendiri lilya  ever', 'sutradara tulis naskah lukas moodysson sukses hasil drama manusia realistis dukung akting natural main dukung soundtrack powerful daya tarik sendiri lilya  ever'),
(1200, 1217, 'elemen komedi repetitif kembali mengeksploitasi habis-habisan sosok po dengan segala tingkah laku kecerobohannya serta dominasi suara jack black dan gary oldman sepanjang  menit yang pada akhirnya membuat personil furious five lain kecuali tigress terlantar', 'elemen komedi repetitif mengeksploitasi habis-habisan sosok po tingkah laku kecerobohannya serta dominasi suara jack black gary oldman  menit personil furious five kecuali tigress terlantar', 'elemen komedi repetitif eksploitasi habis sosok po tingkah laku ceroboh serta dominasi suara jack black gary oldman  menit personil furious five kecuali tigress lantar'),
(1201, 1218, 'idenya sudah dipakai berulang kali sungguh benar-benar tidak ada sesuatu yang baru ditawarkan last summer dan yang lebih parah dari premis basi tentang arwah marah yang balas dendam adalah presentasi dan narasi buruk', 'idenya dipakai berulang kali sungguh benar-benar ditawarkan last summer parah premis basi arwah marah balas dendam presentasi narasi buruk', 'ide pakai ulang kali sungguh benar tawar last summer parah premis basi arwah marah balas dendam presentasi narasi buruk'),
(1202, 1219, 'terlalu lama berputar-putar membosankan repetitif dengan karakter-karakternya yang menggelikan machine gun preacher jelas bukan biopik yang bagus', 'berputar-putar membosankan repetitif karakter-karakternya menggelikan machine gun preacher biopik bagus', 'putar bosan repetitif karakter geli machine gun preacher biopik bagus'),
(1203, 1220, 'ya pastinya akan sulit menghadirkan porsi cerita lebih banyak buat sang antagonis yang di sumber aslinya juga sebenarnya tidak banyak muncul tetapi memolesnya dengan cara kurang ajar seperti ini bisa dibilang adalah sebuah penghinaan sebuah lelucon konyol', 'ya pastinya sulit menghadirkan porsi cerita sang antagonis sumber aslinya muncul memolesnya ajar dibilang penghinaan lelucon konyol', 'ya pasti sulit hadir porsi cerita sang antagonis sumber asli muncul moles ajar bilang hina lelucon konyol'),
(1204, 1221, 'horror yang tidak menakutkan romansa nanggung akting datar dialog cheesy termasuk di dalamnya beberapa momen konyol dan plot hole sepertinya dengan segala borok tersebut red riding hood mudah untuk kemudian menjadi sasaran empuk caci para penontonnya', 'horror menakutkan romansa nanggung akting datar dialog cheesy dalamnya momen konyol plot hole borok red riding hood mudah sasaran empuk caci penontonnya', 'horror takut romansa nanggung akting datar dialog cheesy dalam momen konyol plot hole borok red riding hood mudah sasar empuk caci tonton'),
(1205, 1222, 'tidak ada yang salah dengan segala dramatisasi dalam sebuah film tetapi memberondongnya dengan berlebihan dan serba memaksakan diri itu juga bukan sesuatu yang baik yang ada malah perasaan ilfil karena terasa terlalu lebay', 'salah dramatisasi film memberondongnya serba memaksakan perasaan ilfil lebay', 'salah dramatisasi film berondong serba paksa asa ilfil lebay');
