(18, 'Carol', 'POSITIF', 'DATA LATIH', 'Di permukaannya, naskah Carol garapan Phyllis Nagy mungkin tidak sampai serumit romansa provokatif sejenis. Tidak ada momen emosional, tidak ada pertentangan besar dari lingkungan. Ruang lingkupnya dipersempit pada tokoh Carol dan konflik internalnya, namun bagaimana cara Haynes memperlakukan kesederhanaan narasinya menjadi sajian yang intim dan personal. Nada-nada depresi dan dingin menghiasi 118 menit durasinya. Ada begitu banyak cinta, nafsu sekaligus rasa putus asa di udara yang dibungkus oleh visual cantik dan detail  desain produksi yang sempurna serta iringan scoring lembut Carter Burwell yang sanggup menghasilkan sisi sentimentil tersendiri, namun yang terpenting adalah bagaimana Haynes berhasil memaksimalkan daya pikat dua cast utamanya yang bermain gemilang guna memperkuat narasinya.'),
(19, 'Circles', 'POSITIF', 'DATA LATIH', 'Meski terdiri dari banyak cerita dan karakter, namun semuanya mendapatkan perlakuan dan jatah seimbang. Setiap tokohnya berjuang menyembuhkan luka dalam diri mereka dengan sebuah keberanian menghadapi ketakutan. setiap konflik berhasil menyedot perhatian sama besarnya. Dan bagaimana akhirnya seperti kembali lagi ke awal itu adalah menjadi bagian paling berkesan. Semuanya berhasil dibungkus Golubovic bersama dukungan sinematografi cantik, silent moment penuh renungan, kekuatan akting fantastis dan kandungan tema filosofis yang tergambar dalam kepedihan puitis dalam 112 menit durasinya.'),
(20, 'Chronicle', 'POSITIF', 'DATA LATIH', 'Ada banyak ledakan besar, mobil-mobil terbalik, dilema moral dan pertarungan hebat di klimaksnya yang kemudian berakhir dengan suara penuh kekaguman dari penonton dan tentu saja pertanyaan menarik seperti Bagaimana mereka melakukannya? Ya, biayanya hanya 15 juta Dollar tapi Chronicle punya cita rasa, spesial efek dan magis seperti film-film blockbuster mahal yang dananya puluhan kali lipat, sekali lagi semua itu berkat ide brilian dan kemampuan luar biasa dua sineas mudanya yang mampu membuat manusia bisa terbang dengan serealistis itu. '),
(21, 'Compliance', 'POSITIF', 'DATA LATIH', 'Compliance sekali lagi membuktikan bahwa thriller kecil pun dapat memberikan sebuah efek teror yang besar dengan efektif. Saya sarankan untuk tidak mencari info terlalu banyak soal film ini karena ini adalah jenis thriller yang semakin sedikit kamu tahu tentangnya semakin bagus.'),
(22, 'Creed', 'POSITIF', 'DATA LATIH', 'Meski tampil dengan raut muka menyebalkan di sepanjang film, Michael B. Jordan sukses menjadi hero baru, berdampingan dengan mentornya Rocky tua yang ternyata mampu dimainkan dengan sangat baik oleh Stallone penuh kerut wajah tanpa harus melibatkan otot dan tinju.'),
(23, 'Dog Day Afternoon', 'POSITIF', 'DATA LATIH', 'Dog Day Afternoon sukses menyuguhkan dirinya sebagai salah satu crime thriller paling hebat sepanjang masa. Bukan hanya karena terinspirasi dari kisah nyata saja, namun juga bagaimana seorang Sidney Lumet menyajikannya dengan sangat luar biasa dengan adegan demi adegan di dalamnya, dan semuanya menjadi terasa semakin lengkap dengan dukungan akting kuat dari seorang Al Pacino.'),
(24, 'District 9', 'POSITIF', 'DATA LATIH', 'Sepertinya sudah cukup lama sebuah tidak ada sebuah fiksi ilmiah yang mampu tampil beda dan luar biasa, dan sepertinya District 9 mampu mengobati kerinduan para penontonnya akan hal tersebut, dengan keorisinalan cerita maupun penggarapannya membuat District 9 menjadi salah satu yang terbaik di genrenya, dan tidak usah heran jika di masa yang akan datang bakal ada film-film fiksi ilmiah lain yang meniru gaya yang ditampilkan oleh District 9.'),
(25, 'Don''t Breathe', 'POSITIF', 'DATA LATIH', 'Kudos buat Stephen Lang yang bermain sebagai the Blind Man dengan sangat fantastis, karakter si buta dengan segala ancamannya adalah pusat gravitasi buat Dont Breathe, ia adalah mimpi buruk buat para maling dan penyusup yang nekat.'),
(26, 'Drag Me to Hell', 'POSITIF', 'DATA LATIH', 'Film ini secara di luar dugaan mampu menghibur saya lebih dari yang saya perkirakan sebelumnya. Sebuah horror modern dengan sentuhan klasik dari Sam Raimi yang berhasil membuat sebuah film horror yang berkelas. Dari opening scene saja saya sudah bakalan menduga kalau film ini bakalan memberikan suasana yang berbeda dari film-film horor kebanyakan. '),
(27, 'Drinking Buddies', 'POSITIF', 'DATA LATIH', 'Berbicara soal pemainnya, tidak seperti mumblecore pada umumnya, Swanberg melakukan seperti yang dilakukan koleganya, Duplass bersaudara; Mengisinya dengan nama-nama besar macam Oliva Wilde dan Anna Kendrick, tetapi bukan berarti kehadiran mereka hanya sekedar bahan jualan semata. Wilde yang mendominasi bersama Johnson yang karismatik tampil energik dan percaya diri sebagai Kate. Sementara Kendrick tampil kalem seperti biasa, memberikan sedikit kerapuhan akan komitmen kepada karakternya.\r\nDrinking Buddies punya kualitas bagus untuk ukuran drama mikro budget. Teknik penyutradaraan minimalis  Swanberg  mampu menangkap momen-momen manis di dalam maupun di luar plot yang lalu dipoles dengan visual intim dari sinematografer Beasts of the Southern Wild, Ben Richardson dan scoring pop indie lembut Kris Swanson.'),
(28, 'Drive', 'POSITIF', 'DATA LATIH', 'Sepertinya saya tidak terlalu berlebihan menobatkan Drive sebagai salah satu yang terbaik tahun ini. Nicolas Winding Refn sudah membuat film aksi cerdas, artistik, brutal dan juga begitu emosional dengan gayanya sendiri yang tidak biasa dan menyegarkan di tengah hamparan mainstream Hollywood yang selama ini menawarkan sesuatu yang itu-itu saja, dan bukan hanya itu, Refn juga telah melahirkan sosok anti hero baru dalam diri Ryan Gosling, sebagai seorang supir jagoan yang tidak hanya keren, tapi juga tidak pernah tanggung-tanggung dalam menjalankan aksinya.'),
(29, 'Easy A', 'POSITIF', 'DATA LATIH', 'Easy A jelas dengan mudah menjadikan dirinya sebagai salah satu teen flick terbaik tahun ini. Kisahnya yang sederhana namun berhasil dikemas menarik dengan dialog-dialog cerdas dan humor-humor menggelitik, belum lagi didukung dengan penampilan fantastis dari Emma Stone menjadikan film ini sebagai sebuah film wajib ditonton bagi siapa saja yang mencari drama komedi remaja berkualitas'),
(30, 'Elephant', 'POSITIF', 'DATA LATIH', 'Elephant bukan hanya sekedar crime drama biasa, berkat sentuhan dingin seorang Gus Van Sant, film produksi HBO ini berhasil menyajikan sebuah pengalaman menonton drama yang berbeda dan unik, sebuah drama yang mampu meninggalkan kesan bagi setiap penontonnya, khususnya bagi pecinta drama dengan alur yang lambat.'),
(31, 'Elysium', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah aksi fiksi ilmiah kamu masih akan mendapatkan semua keasyikan ala Blomkamp yang pernah kamu dapatkan dalam District 9 dalam bungkusan visual dan efek canggih garapan Industrial Light and Magic yang masih terasa manusiawi sama ketika Weta menggarap District 9 dulu, termasuk senjata-senjata keren nan dashyat serta gear canggih yang dipakai karakter Damon dan Copley. '),
(32, 'Enemy', 'POSITIF', 'DATA LATIH', 'Meskipun terkesan rumit dan penuh simbolisme macam karya-karya David Lynch, sebenarnya Enemy tidak sampai seabsurd itu. Ya, memang mungkin kamu akan dipaksa untuk menontonnya lebih dari satu kali dalam usaha menemukan maksud dari semua momen surealisnya, tetapi kamu akan menyadari bahwa Villeneuve dan penulis naskah Javier Gullon sebenarnya sudah sangat berbaik hati untuk memberikan jawaban dari pertanyaan-pertanyaan yang mengganggumu. Ini seperti sebuah jigsaw puzzle kuning besar berdurasi satu jam setengah di mana setiap kepingannya menunggu untuk ditemukan guna membentuk wajahnya secara keseluruhan. Dan keping-keping itu sebenarnya sudah terhampar di setiap adegan, di setiap dialog yang semuanya secara cerdas berhasil diolah Villeneuve menjadi sebuah sajian thriller kompleks sekaligus cerdas.'),
(33, 'Enter the Void', 'POSITIF', 'DATA LATIH', 'Melalui Enter the Void, Gaspar Noe kembali sukses menyajikan sebuah pengalaman sinematik yang luar biasa, tidak hanya indah namun juga bisa dibilang gila, menghipnotis bahkan memabukkan dalam arti sebenarnya, terutama bagi para penonton yang gampang mual. Pendek kata, Enter the Void adalah sebuah masterpiece yang tidak mudah dilupakan dari seorang Gaspar Noe.'),
(34, 'Escape Plan', 'POSITIF', 'DATA LATIH', 'Daya tarik dari film ini adalah bagaimana mencari celah untuk kabur, permainan adu pintar dan kucing-kucingan dengan para penjaga dan sipir penjara dan itu semua disajikan dengan editing menghibur nan cepat sejak menit pertama ketika penontonnya diperlihatkan bagaimana karakter Breslin melakukan pertunjukan sulapnya.'),
(35, 'Europa Report', 'POSITIF', 'DATA LATIH', 'Polesan plot familiar yang mengerikan dan mendebarkan, visual cantik dan teknis realistis serta akting kuat para pemainnya adalah elemen-elemen yang kamu temukan dalam 90 menit Europa Report, dan hebatnya ini bukan space thriller besar macam franchise Alien namun kadar aroma eerie dan teror luar angkasa yang kamu dapatkan nyaris sama.'),
(36, 'Evil Dead', 'POSITIF', 'DATA LATIH', 'Alvarez membuang banyak porsi komedi hitamnya yang menjadi salah satu tanda pengenal versi klasiknya, menggantikannya dengan tone yang jauh lebih gelap, suram dan serius, menambah lebih banyak kesadisan frontal nan brutal dan hujan darah yang memerahkan segalanya dalam bungkusan scoring Roque Banos yang menyayat, dan kamu tahu, kelancangan yang dilakukan Alvarez rupanya berbuah manis, menjadikan setiap momen gore yang konon digarap dengan sedikit CGI itu sukses menyiksa habis-habisan penontonnya yang berjiwa lemah.'),
(37, 'Ex Machina', 'POSITIF', 'DATA LATIH', 'Tidak ada yang terlalu abstrak di sini, tidak ada lapisan cerita rumit, semua motif dan pesannya sudah terpampang jelas di depan hidungmu. Namun meski kurang kuat di narasinya saya menyukai bagaimana Garland mempresentasikan idenya itu. Dihadirkan dalam visual sederhana namun terasa intim layaknya drama-drama indie yang indah. Setiap percakapan segi tiga antara Gleeson dan Issac mengundang rasa ketertarikan tersendiri ketika keduanya terlibat dalam bahasan moral, etika serta keputusan yang diambil. Sementara interaksi Gleeson dan Vikander seharusnya bisa jauh lebih baik lagi, mengingat keduanya punya peranan penting untuk membawa konfliknya, terlebih melihat Vikander bermain dengan sangat baik sebagai Ava yang.. Oh ya, jangan lupakan juga penampilan Sonoya Mizuno yang meskipun nyaris tak berbicara, namun kehadirannya mampu mencuri perhatian sebagai asisten pribadi Nathan yang misterius. Bagian terbaik Ex Machina tentu saja adalah klimaksnya, meski sudah bisa diprediksi ke mana ia akan berakhir, namun horor di ujungnya sedikit banyak berhasil meninggalkan sedikit kesan haunting di benak penontonnya.'),
(38, 'Exam', 'POSITIF', 'DATA LATIH', 'Seperti film-film indie kebanyakan, Exam juga tidak menampilkan bintang-bintang top, namun bukan berarti para pemainnya tidak bermain baik, justru dengan nama-nama yang kurang terkenal ini suasana tegang berhasil dihasilkan dengan baik, apalagi mengetahui bahwa mereka semua bermain sama baiknya dengan porsi yang cukup berimbang.\r\nSo, mencari sebuah thriller cerdas dengan konsep orisinal dan penuh dengan kejadian-kejadian tidak terduga didalamnya? Ya, Exam jelas adalah pilihan yang paling tepat untuk anda para maniak thriller berkualitas.'),
(39, 'Eye In the Sky', 'POSITIF', 'DATA LATIH', 'Jujur, saya belum pernah melihat adegan  sederhana seperti momen ketika menunggu seorang bocah perempuan Nairobi  berjualan roti bisa disajikan dengan begitu mendebarkan sekaligus emosional atau bagaimana ketika para petinggi-petinggi saling adu argumen tentang prosedur pelaksanaan operasi yang tak jarang membuat kita tertawa getir. Sementara jajaran cast-nya juga bermain  gemilang dalam menggerakkan naskah dan penyutradaraannya. Kita tahu kualitas aktris senior macam Helen Mirren yang sekali lagi tampil mengesankan membawakan peran Kolonel Katherine Powell yang tegas, penuh wibawa namun di saat bersamaan juga sama tidak berdayanya ketika dihadapkan pada sebuah situasi yang sulit. Sementara mendiang aktor Alan Rickman juga tampil sama hebatnya sebagai petinggi militer Inggris Frank Benson di salah satu film terakhirnya. '),
(40, 'Fair Game', 'POSITIF', 'DATA LATIH', 'Ini ketiga kalinya Watts dan Penn berkolaborasi setelah sebelumnya, 21 Grams dan The Assassination of Richard Nixon. Seperti biasa keduanya mampu membawakan perannya dengan baik, meskipun bukan penampilan terbaik mereka, namun sudah lebih dari cukup untuk membuat film berdurasi 108 menit ini menjadi lebih hidup dan menarik.'),
(41, 'Fast & Furious 5', 'POSITIF', 'DATA LATIH', 'Fast & Furious 5 semakin mengukuhkan bahwa franchise satu ini memang masih bertaji dan tidak bisa diremehkan sebagai sebuah sajian aksi hebat nan menghibur, bahkan saya berani mengatakan ia menjadi semakin baik di setiap episodenya. Dan untuk sejauh ini instalemen kelimanya ini sudah menjadi yang terbaik termasuk dalam segi naskah yang semakin dewasa, ensemble cast hebat hingga rentetan aksi dahsyatnya yang sulit untuk dilupakan, benar-benar sebuah paket hiburan lengkap. Dan melihat apa yang terjadi setelah end credit, saya berharap Lin bisa kembali mengejutkan saya kembali di sekuel selanjutnya.'),
(42, 'Feast', 'POSITIF', 'DATA LATIH', 'Feast diawali dengan pembukaan yang menarik, ketika Gulager memperkenalkan setiap karakternya dengan gaya komikal, lengkap dengan tulisan-tulisan nama, pekerjaan dan ekspektasi hidup mereka yang tentu saja diisi dengan konyol. Dan yang menjadi bagian paling menarik di sini adalah kejutan. Ya, Feast bukan tipikal film yang taat pada pakem slasher kasual di mana biasanya yang paling cantik, sok pintar atau paling bodoh mati terlabih dahulu, tidak disini, Gulanger akan memberikan banyak kejutan, anda akan dibuat tidak mudah untuk menebak siapa-siapa yang akan santapan para monster berikutnya.'),
(43, 'Field of Dreams', 'POSITIF', 'DATA LATIH', 'Ya, pada akhirnya kesentimentalan Field of Dreams akan menyentuh anda, tidak hanya faktor kehadiran lapangan baseball  itu dengan segala keajaiban di dalamnya, penampilan Kevin Costner yang sederhana dan membumi atau selipan road trip menarik tentang pencarian manusia-manusia yang mencintai baseball namun juga bagaimana usaha untuk memenuhi segala impian masa kecilmu yang mungkin belum kesampaian. Field of Dream seperti ingin memberitahu kepada kita bahwa keajaiban itu ada.'),
(44, 'Finding Vivian Maier', 'POSITIF', 'DATA LATIH', 'Tentu saja saya tidak akan membocorkan hasil temuannya di sini, biar kamu menonton dan mengetahui siapa itu Vivian Maier, namun satu hal yang pasti ini adalah salah satu dokumenter paling kuat tahun lalu, dokumenter yang tidak hanya didedikasikan kepada sosok VIvian Maier yang penuh talenta dan kejutan, namun juga sebuah studi karakter menarik dan kompleks dari manusia hebat yang nyaris dilupakan dunia.'),
(45, 'Fists of Legend', 'POSITIF', 'DATA LATIH', 'Bagian terbaiknya mungkin ada di pertarungan tangan kosongnya dan penampilan apik Hwang Jung-min yang baru-baru ini juga tampil bagus di thriller gangster, New World. Meskipun tidak memiliki banyak variasi tetapi setiap duelnya digarap dengan editing dan visual yang baik dan terasa realistis ketika ada campur tangan koreografer Jung Doo-hong yang tahun ini juga menggarap aksi di The Berlin File. Klimaksnya mungkin tidak yang seperti kita harapkan tetapi bisa jadi itu adalah penutup yang pantas untuk menebalkan semua tema-temanya. Sementara di tempat lain, karakter-karakter utamanya dibuat cukup menarik.'),
(46, 'Footloose', 'POSITIF', 'DATA LATIH', 'Sama seperti pendahulunya, Footloose versi Craig Brewer ini masih tetap menjadi sebuah guilty pleasure yang menyenangkan dengan segala melodrama yang corny, termasuk tarian-tarian klasiknya yang abadi itu. Yang menarik adalah bagaimana Brewer berusaha tetap setia menghadirkan pernak pernik di dalamnya sebagai sebuah penghormatan besar untuk versi orisinalnya. Ya, Footloose mungkin akan disukai oleh penonton-penonton remajanya.'),
(47, 'Foxcatcher', 'POSITIF', 'DATA LATIH', 'Seperti judulnya yang secara harfiah berarti perangkap rubah, Miller sudah menyiapkan jebakan untuk membuat penontonnya yang tidak siap terperosok ke dalam sebuah lubang berisi proses dari sebuah kisah nyata kelam yang berjalan lambat serta ditempeli oleh studi karakter yang kompleks. Dengan memposisikan kita seperti karakter lugu Mark Schultz yang tidak tahu apa-apa, tentu saja dengan asumsi kamu juga tidak pernah tahu kisah aslinya sebelumnya, Foxcatcher akan memberi kejutan-kejutan dalam perjalanannya, terutama ketika ia menutup kisahnya dengan sebuah momen shocking yang menghentak.'),
(48, 'Frank', 'POSITIF', 'DATA LATIH', 'Tanpa bisa memamerkan wajahnya di nyaris 90% durasinya, dedikasi Michael Fassbender dalam memerankan Frank yang punya pesona unik sekaligus rapuh patut diacungi jempol. Tentu saja kita tidak pernah bisa melihat ekspresi wajahnya yang keras, kebanyakan emosinya diungkapkan secara verbal yang terkadang sering mengganggu karakter lainnya, tetapi gestur tubuh Fassbender sudah berbicara banyak, sangat banyak malah dalam usahanya menciptakan karakter salah satu karakter paling ikonis dalam perjalanan kariernya.'),
(49, 'Frankenweenie', 'POSITIF', 'DATA LATIH', 'Frankenweenie mungkin saja membuat mereka bermimpi buruk meskipun masih ada sisi menyentuh tentang persahabatan seorang anak dengan anjingnya di dalamnya. Tetapi jika kamu adalah penonton dewasa yang pernah merasakan kejayaan horor-horor jadul, atau setidaknya sedikit mengenalnya, maka kamu akan terpuaskan dengan apa yang sudah dilakukan Tim Burton kali ini. Ya, ini bukan sekedar parodi dari kisah klasik Frankenstein yang legendaris itu saja, ini seperti sebuah persembahan untuk semua horor-horor klasik.'),
(50, 'Friends With Benefits', 'POSITIF', 'DATA LATIH', 'Friends With Benefits, mungkin tidak sekuat dan secerdas Easy A sebagai sebuah komedi seks dewasa, tapi untuk ukuran romcom ringan, ia jelas lucu, enjoyable,  menghibur dan sekaligus satir disaat bersamaan dengan segala dukungan hebat dari chemistry yang dibangun Timberlake-Kunis plus kehadiran karakter-karakter pendukungnya yang menarik. Sepertinya seorang Will Gluck patut bernafas lega karena ia kembali berhasil menorehkan pekerjaan bagus di film ketiganya kali ini.'),
(51, 'Fright Night', 'POSITIF', 'DATA LATIH', 'Fright Night mungkin tidak sedalam Let The Right One In tapi saya percaya ia tidak akan dihina habis-habisan seperti saga Twilight oleh para vampir mania. Ya, untuk ukuran remake, Gillespie bisa dibilang sukses membawa horor klasik milik Holland itu ke ranah modern tanpa harus menghilangkan segala aspek-aspek vampir tradisionalnya, termasuk juga humor-humor gelapnya yang mampu berpadu padan dengan baik dengan horor mencekamnya dan ceritanya yang ringan.'),
(52, 'From Paris with Love', 'POSITIF', 'DATA LATIH', 'Selain adegan-adegan aksinya, From Paris with Love benar-benar tertolong dengan penampilan dynamic duo yang tampil kompak. Sepertinya semenjak True Lies yang kontroversial itu, sudah cukup lama tidak ada lagi film bertema aksi terorisme yang menyenangkan untuk ditonton, untung saja ada Luc Besson dengan From Paris with Love yang hadir memberikan sebuah sajian film aksi yang benar-benar menghibur'),
(53, 'Fruitvale Station', 'POSITIF', 'DATA LATIH', 'Penampilan cemerlang jebolan fiksi ilmiah Chronicle dan serial televisi Friday Night Lights, Michael B. Jordan turut menjadi alasan mengapa film yang diproduseri oleh Forest Whitaker ini tampil meyakinkan. Mungkin kita tidak mengenal siapa Oscar, tetapi apa yang dilakukan Jordan sedikit banyak sudah mendekatkan kita pada sosok pemuda 22 tahun itu termasuk bagaimana keseharian dan pribadinya. Tetapi tidak hanya Jordan yang bagus, ada Melonie Diaz yang memainkan kekasih Oscar, Sophina Mesa dan Octavia Spencer sebagai sang ibu yang tampil sama kuatnya, memberikan kehangatan sebuah keluarga dalam menemani hari-hari terakhir Oscar yang malang.'),
(54, 'Full Metal Jacket', 'POSITIF', 'DATA LATIH', 'Sebagai karya jenius Stanley Kubrick, Full Metal Jacket bukanlah film perang berskala besar, namun jarang ada film perang dengan kualitas seperti ini. Menurut saya dari film film perang Vietnam yang membanjiri Bioskop pada era ''70 hingga ''90 Full Metal Jacket merupakan film anti perang yang mengesankan, bahkan dengan segala kesalahannya film ini merupakan salah satu yang terbaik.'),
(55, 'Gattaca', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah film kecil untuk ukuran sebuah fiksi ilmiah, Gattaca jelas menyimpan segudang potensi luar biasa yang berhasil diterjemahkan dengan sangat baik dan cantik oleh Andrew Niccol. Tidak hanya menjadi sebuah sajian fiksi ilmiah yang sarat dengan teknologi-teknologi canggihnya namun Gattaca juga sarat dengan pesan-pesan moral serta inspirasi yang kuat tentang perjuangan seorang manusia dalam mencapai cita-citanya.'),
(56, 'Girl, Interrupted', 'POSITIF', 'DATA LATIH', 'Dengan cerita terbilang cukup berat dan dalam ini, dibutuhkan sedikit kesabaran dan pemikiran lebih untuk menontonnya, namun bukan berarti Girl, Interrupted adalah film yang membosankan, malah sebaliknya film ini mampu memberikan sebuah tontonan yang menarik dengan segala konflik-konflik didalamnya, apalagi dengan dukungan akting yang luar biasa dari para aktrisnya.'),
(57, 'Gone Girl', 'POSITIF', 'DATA LATIH', 'Gone Girl tidak hanya menyajikan sebuah thriller kriminal paling solid dan paling rapi tahun ini, tetapi yang mengejutkan adalah bagaimana ia bisa membuat si blonde cantik Rosamund Pike keluar dari zona nyamannya, bertransformasi menjadi sesuatu yang sama sekali berbeda dari peran-perannya sebelumnya. Amy adalah karakter yang kompleks, sama kompleksnya dengan kebanyakan karakter dalam film-film Fincher. Untuk sebuah film tentang istri hilang, tokoh Pike malah bisa dibilang lebih mendominasi, tidak hanya dengan aktingnya yang patut diganjar setidaknya nominasi Oscar, namun juga porsi secara keseluruhan.'),
(58, '2046', 'POSITIF', 'DATA LATIH', 'Sudah selayaknya sebuah trilogi hebat ditutup pula dengan kisah yang hebat, dan 2046 pun berhasil menjadi akhir kisah manis dari trilogi patah hati yang berjarak 15 tahun ini. Melalui 2046 ini sekali lagi Wong Kar Wai membuktikan bahwa ia adalah sutradara luar biasa yang selalu berhasil menghasilkan karya-karya seninya yang indah, unik dan sangat berkesan bagi para penggemarnya.'),
(59, '10 Cloverfield Lane', 'POSITIF', 'DATA LATIH', 'Satu hal lain yang menonjol dalam 10 Cloverfield Lane selain kualitas narasi dan penyutradaraan yang menyimpang adalah casting yang sempurna. Ia hanya punya tiga orang pemain utama, dan semua bermain fantastis. Kudos terutama patut diberikan kepada aktor senior John Goodman dalam salah satu penampilan terbaiknya. Berperan sebagai Howard sang penyelamat, Goodman bisa menghadirkan sebuah kompleksitas karakter yang menarik.'),
(60, '12 Angry Men', 'POSITIF', 'DATA LATIH', 'Dialog-dialog cerdas dan kekuatan akting prima dari para pemainnya yang memang menjadi senjata andalan film yang diadaptasi dari drama televisi tahun 1954 berjudul sama ini. Hanya dengan mendengar percakapan yang keluar dari mulut para pemainnya saja kita sudah diajak seakan-akan terlibat langsung menjadi juri ke 13 dan juga ikut membayangkan kejadian-kejadian secara kronologis yang pada filmnya sendiri tidak pernah ditampilkan. Hasilnya adalah sebuah pengalaman menonton yang menyenangkan dimana banyak kejutan demi kejutan menarik bermunculan sepanjang 96 menit film berlangsung.'),
(61, '12 Years a Slave', 'POSITIF', 'DATA LATIH', 'Tidak hanya menawarkan perjalanan seorang budak yang menjadi bagian sejarah suram dengan segala momen kebrutalannya, McQueen juga tahu bagaimana menghadirkan sisi lain yang bermain dengan rasa ironi dan situasi dilematis hebat yang menghinggapi setiap karakter, termasuk karakter majikan kulit putih di mana seperti manusia, tidak semuanya digambarkan jahat, sayang mereka terjebak dalam situasi serba salah. Bahkan yang jahat pun tidak lepas dari beban moral ketika harus menyiksa budak yang diam-diam disukainya, dan segala kegalauan hebat itu berhasil dibawakan apik oleh para pemainnya.'),
(62, '13 Assassins', 'POSITIF', 'DATA LATIH', 'Di tahun 2011 ini film 13 Assassin mempunyai adegan pertarungan paling epik yang pernah saya tonton, tensi pertarungannya benar-benar terjaga mengingatkan saya pada film jadul Samurai Seven karya master Akira Kurosawa hampir semua karakternya mempunyai chemistry yang sama, akan tetapi sayangnya skenario film ini tidak terlalu menonjol untuk ukuran film samurai, setelah selesai menonton saya sendiri merasa agak ada yang kurang di film ini. Sebagai seorang sutradara predikat Cult, Takashi Miike sudah berhasil mengembalikan jiwa film-film samurai yang telah lama hilang lewat 13 Assassins, sudah sepantasnya film ini masuk ke jajaran film samurai terbaik sepanjang masa.'),
(63, '2001: A Space Odyssey', 'POSITIF', 'DATA LATIH', '2001: A Space Odyssey adalah salah satu film terbaik yang pernah dibuat dalam sejarah manusia, sebuah film yang lebih tepat disebut maha karya seni, sebuah art cosmic dari seorang Stanley Kubrick, seorang sutradara dengan ide-ide jenius yang berhasil mengubah cara pandang kita menonton sebuah film.'),
(64, '3 Hari Untuk Selamanya', 'POSITIF', 'DATA LATIH', '3 Hari untuk Selamanya jelas merupakan salah satu film Indonesia  terbaik sepanjang masa versi saya dan melalui film  ini sekali lagi duet Mira Lesmana dan Riri Riza membuktikan bahwa mereka adalah film maker terbaik bangsa ini yang berani menghasilkan karya-karya fresh dan berkualitas tanpa harus terjebak dalam komersialisme belaka.'),
(65, '3 Nafas Likas', 'POSITIF', 'DATA LATIH', 'Di separuh awalnya, 3 Nafas Likas begitu terasa personal. Narasinya yang mengalir baik dalam balutan visual-visual cantik kamera Hani Pradigya membawa penonton ke masa kecil Likas, melihat kesederhanaan hidupnya, mengulik pribadinya yang cerdas sekaligus keras dalam halnya mencoba menembus batasan adat dan budaya patriarki Karo yang kental.'),
(66, '5 Centimeters Per Second', 'POSITIF', 'DATA LATIH', ' Dengan balutan animasi, pencahayaan super detail dan sinematografi yang super indah serta iringan musik penuh emosi dari Tenmon, kisah percintaan dua manusia yang terpisahkan oleh jarak dan waktu ini digambarkan secara realistis, tidak ada unsur-unsur fantasi ataupun petualangan-petualangan seru yang melibatkan monster-monster dan kisah-kisah kepahlawanan, semuanya digambarkan layaknya seperti kehidupan percintaan remaja Jepang dengan segala suka dukanya. '),
(67, '500 Days of Summer', 'POSITIF', 'DATA LATIH', 'Kredit plus juga pantas diberikan oleh kedua pemain utamanya. Baik Joseph Gordon Levitt maupun Zooey Deschanel tampaknya benar-benar sangat menikmati peran mereka disini sebagai pasangan TTM yang serasi. Menyenangkan memang melihat bagaimana kedua karakter ini berinteraksi satu sama lain apalagi dengan chemistry yang dibangun dengan sangat kuat. Walaupun bukan akting terbaik dari keduanya, namun tetap saja kedua aktor-aktris ini mampu memesona penontonnya. Aroma indie juga tampak pada soundrack yang keren dan emosional. Jangan terlalu percaya dengan narasi Richard McGonagle yang mengatakan bahwa 500 Days of Summer bukanlah sebuah kisah cinta, malahan bisa dibilang film ini adalah salah satu cerita cinta terbaik dan terkeren yang pernah dibuat oleh perfilman modern saat ini.'),
(68, '7 Days', 'POSITIF', 'DATA LATIH', 'Tidak ada soundtrack atau scoring sama sekali disini, sepertinya Daniel Grou sengaja membungkus penontonnya dalam kesunyian dengan tujuan agar penontonnya lebih dapat merasakan bagaimana terasa realistisnya ketegangan dan atmosfer kelam nan dingin yang dibangun sepanjang 111 menit ini. Dan semuanya terasa lengkap ketika para pemerannya bermain dengan sangat baik,'),
(69, '9 Summers 10 Autumns', 'POSITIF', 'DATA LATIH', 'Simpel namun padat berisi dengan segala filosofi hidup tanpa harus terkesan berdakwah, membumi dengan segala kesederhanaan bertutur dalam balutan teknis solid dan juga sentimentil tanpa harus jatuh menjadi tontonan cengeng nan mendayu-dayu.'),
(70, 'A Copy of My Mind', 'POSITIF', 'DATA LATIH', 'Apa yang terjadi di A Copy of My Mind adalah murni sebuah observasi langsung kepada para karakternya. Seperti tidak ada jarak yang memisahkan antara setiap tokoh dengan penontonnya. Satu hal yang menonjol adalah teknisnya. Kamera dari Ical Tanjung seperti begitu setia, tidak hanya menguntit Sara dan Alex dari belakang, namun bagaimana juga ia menangkap sisi lain kota metropolitan yang kumuh, sesak, bising dan suram dalam balutan visual yang kasar dan mentah, termasuk di dalamnya departemen penata suara yang jempolan.'),
(71, 'A Girl at My Door', 'POSITIF', 'DATA LATIH', 'Plotnya sendiri berjalan lambat seperti kebanyakan drama arthouse, namun Jung juga membuatnya begitu memesona ketika ia mampu membungkusnya dengan kelembutan sekaligus aroma depresi yang begitu kuat bersama kekuatan akting Bae Doona dan Kim Sae-ron yang memikat, mampu menggerakkan naskahnya yang berisi pesan-pesan ambigu yang bernada provokatif.'),
(72, 'A Moment to Remember', 'POSITIF', 'DATA LATIH', 'Lee tahu bagaimana membuat sebuah drama romantis indah dengan balutan visualnya yang cantik plus dukungan musik latar klasik yang mendayu-dayu, apalagi alih-alih menggunakan kematian sebagai konflik utama pengaduk-aduk emosi, A Moment to Remember lebih memilih Alzheimer yang bisa secara perlahan namun pasti menyiksa penontonnya. Hati siapa yang tidak terenyuh melihat kondisi Kim Su Jin? Ya, pelan namun pasti ia mulai melupakan orang-orang yang dicintainya, khususnya Cheol Su, suaminya. Keberhasilan A Moment to Remember menyentuh penontonnya juga tidak lepas dari kekuatan chemistry yang dihasilkan Son Ye Jin dan Jung Woo Sung dalam membawakan karakter mereka masing-masing. Keduanya benar-benar pas dipasangkan satu sama lain.'),
(73, 'A Monster Calls', 'POSITIF', 'DATA LATIH', 'Relasi tak biasa antara sosok monster dan Conor tentu menjadi pusat gravitasi buat A Monster Calls. Melihat bagaimana kombinasi penyutradaraan lembut Bayona dan Patrick Ness yang ditunjuk untuk mengurus naskahnya mampu bersinergi dengan sempurna dalam usahanya mengeksplorasi sisi terdalam sang bocah dalam menghadapi problematikanya yang diwakili melalui dongeng-dongeng depresif yang diceritakan si monster pohon. Setiap cerita divisualisasikan oleh presentasi cantik animasi stop motion dengan sentuhan gaya cat air penuh imajinasi, setiap cerita punya pesan-pesan kuat yang merepresentasikan kehidupan Conor.'),
(74, 'A Separation', 'POSITIF', 'DATA LATIH', '\r\nDibuka dan diakhiri dengan luar biasa, itulah A Separation, sebuah drama tentang perpisahan dalam sebuah keluarga menengah Iran yang juga membahas arti lain dari nilai-nilai kejujuran yang mampu berjalan berdampingan dengan manisnya elemen-elemen agama, moralitas, sosial bahkan court room drama sekalipun tanpa harus berat sebelah, tanpa terlihat overdramatis, Ya, semuanya itu disajikan dengan naskah dan penyutradaraan brilian oleh Asghar Farhadi menjadikan A Separation masterpiece dari sutradara asal Iran itu dan salah satu yang terbaik tahun ini.'),
(75, 'A Stranger of Mine', 'POSITIF', 'DATA LATIH', 'A Stranger of Mine jelas akan terdengar asing, maklum saja film kecil satu ini memang jauh dari hingar-bingar dan promosi besar-besaran, lihat saja di situs sebesar IMdB pun, tidak banyak user yang mengulasnya, tapi jangan salah, anda mungkin akan sepakat dengan saya untuk mengatakan bahwa Kenji Uchida adalah seorang jenius.'),
(76, 'A Very Harold & Kumar 3D Christmas', 'POSITIF', 'DATA LATIH', 'Ini memang tipe film yang mengajak anda menanggalkan segala kewarasan anda sembari menertawakan segala kebodohan cerita dan tingkah laku karakternya, dan jika anda merasa adegan Harold dan Kumar berganja ria dengan George W. Bush sudah cukup sinting, maka bersiaplah karena A Very Harold & Kumar 3D Christmas akan memberikan anda lebih banyak lagi kehebohan. Dan seperti yang tertera pada judulnya, semua kegilaan itu terbungkus dalam balutan 3D yang tidak disangka mampu digarap dengan baik.\r\n'),
(77, 'Afflicted', 'POSITIF', 'DATA LATIH', 'Ya, niat adalah kunci mengapa Afflicted berhasil menjadi tontonan mocku horor yang asyik. Dengan hanya bekal dua kamera, budget mini dan kreativitas tingkat tinggi yang mencakup sinematografi cantik dan pergerakan kamera gila-gilaan, apa yang terjadi di sepanjang 85 menit durasinya seperti campuran keseruan dalam Chronicle dan ketegangan ala An American Werewolf in London.'),
(78, 'Aftershock', 'POSITIF', 'DATA LATIH', 'Memang ending film ini mudah ditebak, bahkan jauh sebelum film ini berakhir, namun bagaimana proses menuju akhir itu yang menjadi bagian terpenting, dan Aftershock bisa terbilang sukses menggambarkan perjalanan tersebut dengan cukup baik.'),
(79, 'Agora', 'POSITIF', 'DATA LATIH', 'Harus diakui plot yang dihadirkan masih terasa kurang dalam dan terkesan terburu-buru dalam penyajiannya, sepertinya Amenbar terlalu memfokuskan kisahnya kepada konflik-konflik agama saja tanpa terlalu banyak menggali kisah Hypatia. Untung saja kelemahan-kelemahan tersebut masih bisa ditutupi oleh bagaimana indahnya Amenbar manyajikan setting kota Alexandria dengan sinematografi yang apik dan detail-detail yang memukau dan juga tidak ketinggalan penampilan apik dari seorang Rachel Weisz dalam memerankan sosok Hypatia.'),
(80, 'Air Doll', 'POSITIF', 'DATA LATIH', 'Ini bukan cerita tentang boneka yang menjadi manusia, sosok Nazomi sebenarnya tetap adalah sebuah boneka karet kosong yang hanya berisi angin, namun yang menjadi menarik adalah bagaimana proses ia berinteraksi dengan lingkungannya yang tidak jarang membuat penonton tertawa dan juga sedih dengan segala tingkah lakunya, bahkan adegan klimaksnya pun cukup mengejutkan. Air Doll adalah sebuah film yang menarik dan indah tentang kesepian, kehampaan, dan bagaimana pentingnya kehadiran orang lain dalam kehidupan kita.'),
(81, 'All is Lost', 'POSITIF', 'DATA LATIH', 'Ada pesan kuat tentang seberapa besarnya daya tahan dan kesabaran manusia di tengah sebuah cobaan maha dahsyat, tetapi tidak hanya karakter Redford yang diuji, kesabaran penontonnya pun juga, karena seperti yang saya bilang barusan, ini bukan film yang mudah ditonton, tone kesepiannya bisa saja akan sangat menyiksa sebagian penontonnya karena di sepanjang kurang lebih 100 menit durasinya kita hanya bisa duduk diam, menjadi saksi bagaimana karakter Redford tanpa dialog bertindak tanduk.'),
(82, 'American Hustle', 'POSITIF', 'DATA LATIH', 'Lihat set, lihat kostum, lihat tata riasnya, O.Russell punya semua dukungan material teknis kelas Oscar di sini. Semuanya aroma ''70 itu berhasil melebur di bawah penyutradaraan enerjik O.Russell lengkap dengan segala editing cepat, tracking shot, soundtrack retro yang asyik dan tentu saja para pemainnya.\r\n'),
(83, 'American Sniper', 'NEGATIF', 'DATA LATIH', 'Eastwood begitu baik hati sampai memberikan karakter fiktif yang tidak kalah jagonya dalam menembak dari pihak lawan, spesial untuk membuat pertarungan antar sniper menjadi semakin seru meskipun ujung-ujungnya terasa dipaksakan. Sementara pertempuran lain yang melibatkan batin dan mental serta keluarga harus diakui masih kurang dijelajahi Eastwood dengan sempurna. Kedua bagian ini seperti dua film berbeda yang tidak mampu menyatu dengan mulus. Jangan salahkan Bradley Cooper yang sudah tampil cukup baik ketika harus membagi perannya yang kompleks itu, salahkan Eastwood yang tidak memaksimalkan dramanya dengan baik termasuk studi karakter Kyle yang terasa sedikit jomplang di antara dua dunia berbeda.'),
(84, 'Amour', 'POSITIF', 'DATA LATIH', 'Ada banyak sisi personal dan kehangatan dari seorang Hanake di dalamnya yang dituangkan buat istri tercintanya, mungkin ini adalah karya Hanake paling lembut dibandingkan yang lainnya meskipun ada sedikit kekejaman, rasa takut dan kecemasan di dalamnya tetapi kita tahu bahwa semuanya sekali lagi ditujukan untuk merayakan apa yang kamu sebut dengan CINTA.'),
(85, 'Amy', 'POSITIF', 'DATA LATIH', 'Pendekatan intim yang dilakukan Kapadia di dua pertiga filmnya menghasilkan ragam lecutan emosi buat penontonnya. Ada kegembiraan ketika melihat Amy senang, ketika melihatnya tampil membawakan lagu-lagunya, kemudian ada rasa getir, iba dan sedih, bahkan sedikit kecewa ketika melihatnya jatuh dan tidak belajar dari kesalahannya namun tentu saja tidak ada yang mengalahkan sensasi heartbreaking luar biasa ketika Kapadia menutupnya dengan momen puncak menggetarkan yang sama-sama kita ketahui akhirnya.'),
(86, 'Argo', 'POSITIF', 'DATA LATIH', 'Senang rasanya melihat bagaimana seorang aktor seperti Ben Affleck bisa berkembang sehebat ini sebagai seorang filmmaker. Dari thriller kecil yang mengesankan lalu lihatlah sekarang, Argo  bisa dibilang pencapaian terbaik Affleck sejauh ini. Sebuah thriller politik yang cerdas dan mendebarkan, sebuah tontonan berkelas dari anak kemarin sore, salah satu yang terbaik tahun ini'),
(87, 'Arlington Road', 'POSITIF', 'DATA LATIH', 'Naskah yang berani dari Ethan Kruger dan suspense yang terjaga rapi menjadi kekuatan terbesar Arlington Road selain penampilan menawan Jeff Bridges dan Tim Robbis. Ini adalah suguhan thriller apik nan menantang yang akan membuatmu tetap terjaga sampai akhir bersama rentetan misterinya yang mengasyikkan sampai kemudian ia menamparmu keras dengan penutup yang luar biasa.'),
(88, 'Athirah', 'POSITIF', 'DATA LATIH', 'Riri memilih untuk membuang segala embel-embel sentimentil, menggantikannya dengan pertunjukan gestur  yang minim dialog dalam iring-iringan musik lembut dari Endah & Rhesa yang menjadi kekuatan buat Athirah dalam  menghadirkan letupan emosi tersendiri, apalagi didukung dengan penampilan apik para pemainnya yang tampil total terutama Cut Mini. Sementara tak kalah hebatnya adalah presentasi teknis dan penyutradaraan Riri yang meliputi pergerakan kamera, sinematografi yang menangkap lanskap-lanskap cantik di Sulawesi Selatan.'),
(89, 'August Osage County', 'POSITIF', 'DATA LATIH', 'Dari Streep sampai Cumberbatch semua tampil cemerlang. Streep lagi-lagi tampil gemilang membawakan karakter penyakitan baik secara fisik maupun mental. Streep nyaris sempurna menguasai panggung dan semua momen dengan karakternya yang menyebalkan, karakter yang menyerang siapa saja sebagai imbas dari rasa depresi atas penyakitnya, termasuk putri-putrinya sendiri, tidak heran jika nantinya ia kembali dinominasikan lagi di ajang Oscar nanti. Sementara lawan mainnya ada Julia Roberts yang juga tampil bagus sebagai putri kesayangan yang berkarakter kuat.'),
(90, 'Baraka', 'POSITIF', 'DATA LATIH', 'Scoring musik yang dinamis dan menghanyutkan dari Michael Stearns yang setia mengiringi film sepanjang 96 menit. Walaupun secara teknis film ini tanpa cerita, melalui gambar-gambar yang ditampilkannya, Baraka mampu menyampaikan pesan non verbalnya secara efektif.'),
(91, 'Baran', 'POSITIF', 'DATA LATIH', 'Baran memang tidak terlalu menampilkan banyak dialog, malah karakter Baran sendiri sama sekali tidak memiliki dialog dari awal hingga akhir, dan hal tersebut yang membuat film ini menjadi terasa istimewa karena mampu secara langsung menyentuh emosi penontonnya hanya dengan melihat tingkah laku dan tatapan mata Lateef dan Baran. Perbedaan budaya yang menjadi tembok tidak terlihat juga mampu dieksplorasi dengan baik oleh Majidi, pendewasaan dan pencarian jati diri seorang Lateef juga menjadi bagian paling menarik dalam film berdurasi 94 menit ini.'),
(92, 'Be with You', 'POSITIF', 'DATA LATIH', 'Sebuah drama cinta berbalut elemen fantasi menyentuh yang dijamin akan meninggalkan kesan mendalam di setiap hati penontonnya, apalagi Be with You ternyata mampu keluar dari formula klise drama-drama tearjerker Asia lainnya yang hanya menampilkan cerita dan konflik yang itu-itu saja.'),
(93, 'Beasts of the Southern Wild', 'POSITIF', 'DATA LATIH', 'Beast of The Southern Wild seperti sebuah dongeng distopia modern rumit yang punya orisinalitas, keceriaan, semangat hidup luar biasa dan akting-akting luar biasa di balik setting dan premis pasca kiamatnya yang suram dan kotor. Sebuah tontonan indie arthouse yang memberikan kita sebuah sentuhan emosional dengan cara sederhana yang tidak pernah kamu bayangkan sebelumnya.'),
(94, 'Before Midnight', 'POSITIF', 'DATA LATIH', 'Linklater tahu benar bagaimana memanfaatkan dua seri sebelumnya sebagai pondasi kuat dalam membentuk Midnight dan perjalanan karakternya hingga berada seperti yang kita lihat sekarang. Tetapi Linklater tentu saja tidak berdaya tanpa duo maut Hawk dan Delpy yang meskipun mulai menua dan gendut (khususnya Delpy) mereka tampak tidak pernah kehilangan keintiman dan spontanitas luar biasa yang sudah mereka bentuk di nyaris dua dekade ini.'),
(95, 'Behind the Candelabra', 'POSITIF', 'DATA LATIH', 'Meskipun kalau mau jujur sebenarnya narasinya juga tidak sampai terlalu istimewa, tetapi kekuatan sebenarnya bukan berada di naskahnya, namun bagaimana penampilan total dua bintang utamanya yang fantastis dan tentu saja bagaimana Soderbergh menghadirkan narasinya menjadi sebuah biopik intens yang menggambarkan gejolak asmara, seks dan ketenaran  serta sisi hitam dibalik setiap gemerlapnya candelabra'),
(96, 'Bernie', 'POSITIF', 'DATA LATIH', 'Bernie mungkin  tidak terlalu serius, namun di balik segala komedi-komedi hitamnya yang aneh dan presentasinya yang unik ada pesan tentang sebuah dilema moral dan ambiguitas besar tentang arti sebuah kebaikan dan keadilan itu sendiri, semuanya tergantung dari sisi mana kita memandangnya dan Richard Linklater dengan sangat lihai menghadirkan itu semua dalam kemasan yang santai, menghibur dan juga berkelas. Ini jelas salah satu karya terbaik Linklater dan salah satu film Jack Black yang paling bagus.'),
(97, 'Beyond the Hills', 'POSITIF', 'DATA LATIH', 'Alurnya memang lambat, presentasinya sederhana, sunyi tanpa scoring mungkin berpotensi menjenuhkan buat sebagian penontonnya, namun imbas dari kesederhanaannya bertutur menjadikan semuanya terasa natural dan sukses menghadirkan emosi tanpa harus berdramatis ria. Ya, Beyond the Hills adalah sebuah drama kuat tentang cinta dan ketidak pedulian.'),
(98, 'Billy Elliot', 'POSITIF', 'DATA LATIH', 'Yang menarik lagi dari film ini adalah, meskipun premisnya sederhana, tapi selama film berlangsung, semua tertata rapi di setiap adegan, dan dialog yang tidak dipaksakan, Storytelling yang baik dan mudah dimengerti. Sutradara Stephen Daldry dengan sukses menghadirkan drama yang mudah dicintai dan berkesan bagi penontonnya.'),
(99, 'Birdman', 'POSITIF', 'DATA LATIH', 'Dengan pergerakan yang luar biasa, begitu dinamis meliputi zoom in, zoom out lembut plus teknis pencahayaan puitis lembut khas Lubezki setiap momen menjadi terasa begitu bermakna, setiap momen menjadi terasa spesial, lepas, bebas dan seperti melayang tak terbatas menembus tembok-tembok keras.'),
(100, 'Biutiful', 'POSITIF', 'DATA LATIH', 'Ya, ini adalah sebuah film emosional dan menyentuh yang digarap dengan teknis sinematik yang cantik serta dukungan akting luar biasa dari aktor kaliber Oscar, Javier Bardem.'),
(101, 'Black Mass', 'POSITIF', 'DATA LATIH', 'Tentu saja sebagai sebuah film gangster, Black Mass akan dipenuhi dengan banyak unsur kekerasan frontal yang mampu semakin menebalkan kesan gelap dari kisah salah satu buronan yang paling dicari di Amerika ini. Sementara di bagian teknis, Cooper dan sinematografer  Masanobu Takayanagi juga berhasil menangkap suasana sendu dari sudut-sudut kota Boston era ''70 dan ''80 dengan detail, bagaimana selubung suram itu kemudian mampu menguatkan penceritaannya sekaligus di saat bersamaan, karakternya, termasuk scoring mencekam dari Junkie Xl yang membuat setiap gesekan yang terjadi bisa begitu terasa menegangkan.\r\n'),
(102, 'Black Swan', 'POSITIF', 'DATA LATIH', 'Black Swan bisa saya bilang adalah salah satu karya terjeniusnya, mungkin yang terbaik setelah Requiem for a Dream. Hampir semua aspek baik teknis maupun non teknis sukses digarap dengan sempurna oleh sutradara 41 tahun ini, menyajikan sebuah pengalaman dan sensasi sinematik unik yang tidak terlupakan, mengerikan dan menakutkan namun juga emosional di saat bersamaan plus akting fantastis dari Natalie Portman menjadikan segalanya terasa luar biasa.'),
(103, 'Blue Jasmine', 'POSITIF', 'DATA LATIH', 'Saya selalu menyukai bagaimana Woody Allen menghadirkan film-filmnya dengan caranya sendiri yang tidak biasa, apalagi kali ini ia mencoba bermain-main sesuatu yang baru ketika menelusuri efek besar dari sebuah kebangkrutan yang berdampak pada kondisi mental karakternya. Allen menyajikan sebuah drama depresi yang dibungkus dengan sentuhan komedi khasnya yang hadir dalam dialog-dialog cerdas termasuk bagaimana Allen seperti biasa, menghadirkan visual cantik dari kota-kota yang menjadi latarnya, dalam kasus ini ada San Fransisco dalam nuansa musik Jazz kental membuat Blue Jasmine terasa riang di balik temanya yang sebenarnya gelap itu.'),
(104, 'Blue Valentine', 'POSITIF', 'DATA LATIH', 'Derek Cianfrance sudah memberikan saya sebuah tontonan drama percintaan yang tidak hanya menjual romantisme gombal belaka, namun Derek juga ingin menunjukkan kepada penontonnya sebuah realita kehidupan yang membutuhkan lebih dari sekedar kata cinta untuk dapat mempertahankan sebuah komitmen. Indah namun juga depressing dan penuh kesedihan.'),
(105, 'Boogie Nights', 'POSITIF', 'DATA LATIH', 'Boogie Nights bisa dibilang adalah salah satu karya terbaik Paul Thomas Anderson, dengan teknik penyajiannya yang baik dan unik, Anderson sukses menghadirkan kisah manusia-manusia yang tidak bahagia dan depresi di balik gemerlap dan popularitas dunia porno.'),
(106, 'Boyhood', 'POSITIF', 'DATA LATIH', 'Linklater berhasil menghadirkan sebuah keintiman kuat yang nyata, sesuatu yang tidak kamu dapati di film manapun. Ini seperti melihat langsung proses character building dengan melibatkan aroma kental trilogi Before terutama dari feel dan pergerakan kameranya dan para pemain yang sama dari awal hingga akhir.'),
(107, 'Breath', 'POSITIF', 'DATA LATIH', 'Tentu saja kunci keberhasilan Breath menjadi sajian drama remaja depresif tidak hanya kepiawaian Laurent mengolah naskah bersama kekuatan penyutradaraannya yang menghasilkan keintiman luar biasa dari dua karakter utamanya yang dimainkan fantastis oleh dua cast mudanya. Nada-nada lembut visual dari Arnaud Potier, termasuk penggunaan teknik tracking shot bersama balutan scoring yang mampu menangkap kedekatan Charlie dan Sarah dengan sangat baik di paruh pertamanya dan terus secara konsisten sampai akhir.'),
(108, 'Broken', 'POSITIF', 'DATA LATIH', 'Lee Jeong Ho seperti ingin menjadikan Broken dekat dan membumi dengan keseharian penontonnya, merasakan kesedihan dan kemarahan sampai ketakutan dari setiap karakternya, dan harus diakui ia berhasil menuntaskan tugasnya dengan baik, membentuk sebuah emosi spontan imbas dari keputusan dari tokoh-tokohnya yang bermain ciamik (terutama Jung Jae Young). Jeong Ho membungkus setiap momen Broken dengan tone kelam dan dingin yang menegaskan sebuah rasa putus asa dan amarah mendalam.'),
(109, 'Cafe Society', 'POSITIF', 'DATA LATIH', 'Sutradara berkacamata Moscot Lemtosh ini selalu membuai penontonnya dengan dialog-dialog cerdas dan plot yang sederhana tapi mengena, tak peduli seburuk apapun filmnya, Allen tetaplah Allen yang jago menggulirkan kisah tentang hubungan manusia dan kerumitannya dengan gaya yang santai tapi mendalam. Dan Caf Society bukanlah pengecualian. Masih menggelar kisah kesukaan Allen tentang cinta dan segala macam masalahnya, Caf Society  berhasil tampil cantik di mata dengan sokongan teknis yang apik. Latar belakang dekade ''30 dengan keglamoran Hollywood berhasil disajikan tanpa cela oleh Allen di layar, pun begitu cerita dibawa ke Big Apple, tata artistiknya tetap memanjakan indera penglihatan kita.'),
(110, 'Captain America: The Winter Soldier', 'POSITIF', 'DATA LATIH', 'Duo Russo di luar dugaan tampil fantastis ketika harus mengemban tugas membawa Captain America: The Winter Soldier  agar tampil sama besarnya dengan film Marvel lain, atau paling tidak lebih baik ketimbang seri pertamanya, dan mereka melakukannya dengan sangat baik. Komposisi aksi, ketegangan, ledakan dan spesial efek berhasil ditampilkan berimbang dengan dramanya. Editing cepat dan taktis, duel-duel berkoreografi jempolan dan momen-momen penuh hingar bingar semuanya tampil solid.'),
(111, 'Captain Phillips', 'POSITIF', 'DATA LATIH', 'Puncaknya ada di ujung cerita ketika Hanks secara emosional mengeluarkan seluruh kemampuannya untuk mewakili perasaan sang Kapten selama proses penyanderaan, dan dengan penampilan sebaik itu, mungkin saja para juri Academy akan meliriknya kali ini, setidaknya peluang masuk nominasi sebagai pemeran utama terbaik terbuka lebar. Sementara lawan main Hanks tidak kalah hebatnya. Dan apa yang dilakukan Abdi adalah hal yang fantastis secara dengan meyakinkan ia sukses memberikan gambaran bagaimana tangguhnya para pembajak Somalia dan di sisi lain ada kenaifan dan kesedihan tak terlihat  dari setiap ucapan yang membuat penontonnya turut bersimpati dengan karakternya.'),
(112, 'Graduate', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah drama komedi romantis coming of age, The Graduate jelas adalah salah satu yang terbaik, bahkan hingga sekarang film ini banyak memberikan inspirasi kepada film-film romcom modern saat ini. Cerita tentang seorang pemuda lugu yang mencoba mencari jati diri dan cintanya ditampilkan dengan fantastis oleh seorang Dustin Hoffman.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(113, 'Gravity', 'POSITIF', 'DATA LATIH', 'Cuaron melakukan pendekatan serealistis mungkin termasuk melakukan penelitian yang dalam untuk menciptakan sebuah pengalaman luar angkasa yang logis, bahkan Gravity banyak dipuji karena berhasil menghadirkan premis dan prinsip-prinsip fisika yang realistis termasuk semua pergerakan tanpa bobotnya yang mendominasi 95% film. Untuk menghadirkan segalanya agar terlihat nyata, Cuarn bersama ahli visual efek, Tim Webber membuatnya seteliti dan sedetail mungkin di studio Framestore di London. Hasilnya bisa dilihat tanpa henti sejak adegan pembukaannya yang memesona sampai klimaksnya yang menggetarkan itu, apalagi kemudian efek-efek ciamik ini dikombinasikan dengan sentuhan sinematografi brilian dengan kamera yang seperti tidak bisa berhenti bergerak dari sinematografer handal langganan Cuaron dan Terrence Malick, Emmanuel Lubezki, scoring mendebarkan Steven Price, sound editing jempolan dan tentu saja, kepiawaian Cuarn dalam mengolah setiap momennya  yang semua campuran itu mampu menghasilkan efek jaw dropping yang pada akhirnya ditutup dengan ungkapan penuh ketakjuban.'),
(114, 'Groundhog Day', 'POSITIF', 'DATA LATIH', 'Groundhog Day adalah sebuah drama komedi dengan cerita unik dan ringan yang bisa membuat kita tertawa dan merenung saat menontonnya, bukan hanya sekedar drama komedi biasa, film ini juga memberikan inspirasi dan pesan moral yang cukup dalam bagi kita untuk menjadi manusia yang lebih baik.'),
(115, 'Guardians of the Galaxy', 'POSITIF', 'DATA LATIH', 'Di bagian aksinya, Guardias of The Galaxy tampil memukau. Meskipun sebelumnya hanya pernah membuat film superhero gadungan dalam Super, tetapi di sini Gunn sepertinya sudah fasih benar ketika ia menghadirkan setiap momennya dengan sangat berkelas dan tentu saja menghibur. Gunn  menyuntik narasinya dengan keseimbangan sempurna humor-humor segar dari setiap karakternya, musik-musik pop asyik dari kaset dan walkman jadul kesayangan Peter Quill yang seperti tidak pernah gagal menggelitik dan tentu saja keseruan sebuah action supehero spektakuler berbiaya mahal bersama dukungan CGI dan 3D yang apik. Dari pertarungan berskala kecil di darat dan penjara sampai pertempuran pesawat-pesawat luar angkasanya, semua ditampilkan maksimal bersama sinematografi cantik. '),
(116, 'Guzaarish', 'POSITIF', 'DATA LATIH', 'Keberhasilan Guzaarish mengaduk-aduk emosi penontonnya selain karena kepiawaian Bhansali meracik kisahnya dengan dukungan teknis kelas atas,  juga jelas tidak terlepas dari performa gemilang Hrithik Roshan. Dibutuhkan akting prima untuk dapat membawakan karakter Ethan Mascarenhas yang lumpuh secara meyakinkan, dan Roshan melakukan pekerjaannya dengan sangat baik, membuat penonton bersimpati dan memaklumi keadaannya tanpa harus merasa kasihan terhadap kekurangannya. Kehadiran artis cantik yang  juga mantan Miss World, Aishwarya Rai sebagai perawat sekaligus love interest Ethan pun semakin mewarnai kisah indah ini.\r\n'),
(117, 'Hacksaw Ridge', 'POSITIF', 'DATA LATIH', 'Memasuki medan tempur Gibson terlihat habis-habisan mengeksploitasi segala hal yang ia suka. Kombinasi dramatisasi antara kebrutalan, kepahlawanan dan sisi religius mampu bersinergi dengan sempurna bersama kekuatan karakter unik seorang Desmond Doss. Kekacauan dalam adegan peperangan dihadirkan dengan sangat baik. Pertempuran digambarkan begitu masif dan cepat namun hebatnya kita tetap bisa mengikuti pergerakan karakter utamanya dengan baik. Setiap desingan peluru dan ledakan granat yang tersaji dalam balutan sinematografi ciamik Simon Duggan benar-benar memamerkan apa itu arti dari horor perang.'),
(118, 'Hanna', 'POSITIF', 'DATA LATIH', 'Hanna memang bukan suguhan biasa. Ini adalah kombinasi apik dari action thriller, revenge movie dan coming of age yang digarap dengan kualitas penyutradaraan hebat serta dukungan  teknis sinematografi jempolan dari Joe Wright dan tentunya sosok Hanna itu sendiri yang sukses dibawakan dengan sangat apik oleh Saoirse Ronan.'),
(119, 'Hari Untuk Amanda', 'POSITIF', 'DATA LATIH', 'Hari Untuk Amanda adalah sebuah oase kesegaran di tengah panas dan gersangnya padang pasir perfilman Indonesia, sebuah kisah cinta sederhana namun mampu meninggalkan kesan manis dan personal bagi setiap penontonnya. Tidak diragukan lagi jika Hari Untuk Amanda adalah salah satu drama romantis Indonesia terbaik yang pernah dibuat oleh sineas kita.'),
(120, 'Harry Potter and the Deathly Hallows: Part 1', 'POSITIF', 'DATA LATIH', 'The Deathly Hollows: part 1 sejauh ini adalah yang terbaik dari seluruh film Harry Potter yang ada. David Yates selaku sutradara sukses memanfaatkan momentum dibagi duanya kisah epik petualangan penyihir paling dicintai di dunia ini dengan menghadirkan separuh kisah seri terakhir ini dengan baik. Jelas sebuah bekal yang kuat bagi para penontonnya untuk menghadapi grand finale yang akan hadir tahun depan.'),
(121, 'Heartless', 'POSITIF', 'DATA LATIH', 'Heartless sukses menghadirkan sebuah tema horror yang berbeda. Elemen-elemen misteri yang gelap, tragis dan mencekam berhasil berbaur dengan baik dan berimbang dengan elemen-elemen drama psikologis, keluarga, romantisme yang kuat dan penuh emosi. Heartless sekaligus menjadi ajang comeback yang manis bagi seorang Philip Ridley setelah 15 tahun hiatus dari dunia perfilman.'),
(122, 'Heat', 'POSITIF', 'DATA LATIH', 'Bagi pecinta heist movie, Heat jelas adalah salah satu yang terbaik dan juga sebuah film yang wajib dan patut ditonton. Selain karena kehadiran Al Pacino dan Robert De Niro yang bermain gemilang, kisahnya yang menarik dan adegan aksinya yang seru dan gila dijamin akan membuat penontonnya betah untuk berlama-lama duduk di depan televisi mereka.'),
(123, 'Hello Goodbye', 'POSITIF', 'DATA LATIH', 'Dimulai dengan sedikit canggung namun perlahan namun pasti Hello Goodbye mampu tampil lepas dengan segala pendekatan yang masuk akal, presentasi yang cantik, membuat segala hal tentang premisnya yang stereotip dan dialog-dialognya yang tidak pernah terlalu kuat itu mendadak bukan lagi menjadi masalah besar. Ya, saya suka Hello Goodbye, mengingatkan saya pada Before Sunrise/Sunset atau Lost in Translation yang berkesan itu. Ini sebuah romansa manis yang tidak pernah berlebihan dalam menyampaikan pesan cinta dan pencarian jati diri.'),
(124, 'Henry''s Crime', 'POSITIF', 'DATA LATIH', 'Henrys Crime, kamu bisa menyebutnya sebagai sebuah drama komedi romantis yang santai. Tidak hanya bagaimana ia bergerak pelan sepanjang 108 menit, namun juga bagaimana setiap konfliknya tentang pencarian jati diri dibuat begitu sederhana namun tetap tidak menghilangkan usur hiburannya yang enjoyable, terlebih trio Musketeer kita , Keanu Reeves, Vera Farmiga dan James Caan begitu solid dalam menghadirkan interaksi antara karakternya.'),
(125, 'Her', 'POSITIF', 'DATA LATIH', 'Her menjadi sebuah pengalaman berbeda menonton sebuah romansa dengan sentuhan fiksi ilmiah, sebuah film yang membawa sebuah romcom ke level berbeda, romcom yang bisa membuatmu jatuh cinta pada pandangan pertama, berlebihan? Ah, tidak juga, tunggu sampai kamu merasakan sendiri bagaimana Her akan langsung membiusmu sejak menit pertama, sejak karakter Theodore membacakan surat cintanya yang manis, ketika Jonze membungkus semuanya dengan (lagi-lagi) kualitas sinematografi dreamy Los Angeles masa depan dari Hoyte van Hoytema dan iringan scoring-scoring keren Arcade Fire di mana membuat tampilan Her layaknya seperti video klip cantik romantis berwarna lembut dengan durasi 125 menit.'),
(126, 'Hidden', 'POSITIF', 'DATA LATIH', 'Sementara tensinya juga berhasil terjaga dengan baik, Duffer tidak pernah berlama-lama dengan melodramanya, ketika tempo mulai mengendur ada ketegangan, dari kehilangan stok makanan, kebakaran sampai teror dari atas yang seperti mulai mencium jejak keberadaan keluarga Ray. Lalu dalam misi mengisi informasi yang hilang, beberapa rentetan flash back memberi sedikit banyak jawaban dari masa lalu tetapi lagi-lagi Duffer masih berhasil menjaga misterinya dengan baik setidaknya sampai klimaks datang menjemput dengan twist menghentak yang langsung mengubah wajah Hidden selamanya.'),
(127, 'Honeymoon', 'POSITIF', 'DATA LATIH', 'Tetapi sekali lagi bagian terbaiknya bukan hanya pada misterinya, namun juga pada ikatan dari dua tokoh utamanya yang dimainkan oleh dua bintang muda dari dua serial televisi populer, Harry Treadaway (Penny Dreadful) dan Rose Ygritte Leslie (Game of Thrones). baik sebelum atau setelah konflik terjadi. Ada sebuah pesan tentang cinta sejati yang coba turut diangkut Janik di samping segala teror mencekamnya yang datang dari luar kabin.'),
(128, 'Horrible Bosses', 'POSITIF', 'DATA LATIH', 'Selain trio Jason Bateman, Charlie Day, dan Jason Sudeikis yang sukses membawakan peran mereka sebagai para pekerja yang tidak dihargai oleh atasannya, para evil boss tampaknya juga tidak mau ketinggalan untuk bersenang-senang, melengkapi salah satu ensemble cast terbaik yang pernah ada dalam sebuah komedi. Ada Kevin Spacey yang tampil paling hebat dan paling menyebalkan di sini mengisi sebagai si  psikopat Dave Harken, atau Collin Ferrell yang penampilannya mengingatkan saya pada cameo Tom Cruise di Tropic Thunder, lengkap dengan perut buncitnya dan rambutnya yang licin, serta Jeniffer Aniston yang secara mengejutkan mampu tampil apik membawakan karakter dokter gigi cabul, dan last but not least, Jamie Foxx yang memerankan konsultan pembunuhan bernama Motherfucker Jones, ya, nama yang unik, seunik kisah di balik pemilihan namanya.'),
(129, 'Housebound', 'POSITIF', 'DATA LATIH', 'Sebagai sutradara yang masih bau kencur macam Gerard Johnstone, Housebound adalah sajian sempurna. Sebuah horor mikro budget yang percaya diri dengan segala keunikannya, diisi oleh banyak kombinasi dan jebakan-jebakan penuh kejutan menyenangkan yang akan mengundang rasa penasaran, rasa takut sekaligus tawa lepas. Johnstone mencoba menciptakan sesuatu yang berbeda pada karakter utamanya, menjauhkan dari unsur-unsur stereotip seperti kebanyakan horor lainnya. Kylie yang dimainkan asyik oleh Morgana OReilly adalah karakter anti heroine yang kuat, cuek, pemarah, kurang ajar dan untuk ukuran tokoh utama perempuan dalam film horor, Kylie termasuk pemberani.'),
(130, 'How to Train Your Dragon', 'POSITIF', 'DATA LATIH', 'Berbekal cerita yang kuat yang diadaptasi bebas dari bukunya yang berjudul sama buah karya Cressida Cowell, duet sutradara sekaligus penulis Chris Sanders dan Dean DeBlois yang sebelumnya pernah sukses menghasilkan cerita animasi Disney, Lilo & Stitch berhasil menghadirkan sebuah kisah from zero to hero, persahabatan, kesetiaan, kepercayaan dan semangat juang pantang menyerah yang dibungkus dengan karakter-karakter dan animasi yang menarik, penuh warna dan sangat detail. Sanders dan DeBlois berhasil dengan konsisten menjaga irama film ini sampai akhir. Tanpa terlalu terburu-buru cerita mengalir dengan lembut dengan konflik-konflik yang tergali dengan baik. '),
(131, 'Hugo', 'POSITIF', 'DATA LATIH', 'Hugo adalah debut Scorsese dalam dunia 3D, dan untuk seorang sutradara veteran yang baru pertama kali menangani teknologi ini Scorsese sudah mampu menghadirkannya dengan sangat baik. Gambar-gambarnya terlihat luar biasa dan hebatnya, tidak terkesan terlalu berlebihan karena semuanya mampu menyatu dengan bagaimana sutradara berambut putih ini menanganinya, termasuk pergerakan kamera yang dinamis dan juga dukungan efek CGI yang menjadikan dunia Hugo begitu mempesona, sama mempesonanya ketika ia menampilkan bagaimana Melies dalam wujud Ben Kingsley yang luar biasa itu dan sang istri, Jeanne (Helen McCrory) membuat film-filmnya dengan penuh semangat dan keceriaan sebelum akhirnya mereka dilupakan.'),
(132, 'I Give It A Year', 'POSITIF', 'DATA LATIH', 'Kekuatan utama I Give it Year jelas ada pada komedinya. Didominasi oleh dialog-dialog yang porsi kelucuannya sama besar dengan kekotorannya terutama yang keluar dari mulut Minnie Driver yang tampil sebagai pencuri perhatian terbesar. Dari momen pernikahan, threesome, permainan tebak kata, sampai adegan frame foto elektronik, semuanya berhasil menghadirkan kelucuan yang memalukan. I Give it A Year jelas bukan role model yang pantas buat romcom impian, banyak yang memandangnya sinis karena dianggap vulgar dan pro perceraian alih-alih percaya dengan keajaiban cinta pandangan pertama. Tetapi di balik segala kekacauan gila-gilaan yang menyenangkan itu ada sisi manis dan romantisme yang tetap dipertahankan Mazer untuk menekankan bahwa ini masih berada di ranah film-film cinta.  Ada sebuah realita pahit yang biasanya berusaha dijauhi oleh koleganya ketika film ini berakhir dengan ceria. '),
(133, 'I Love You Phillip Morris', 'POSITIF', 'DATA LATIH', 'I Love You Phillip Morris mungkin adalah salah satu film dengan tema homoseksual yang sangat enjoyable dan menghibur untuk ditonton. Jika kebanyakan film-film yang mengangkat tema tabu seperti ini tampil begitu serius dengan konflik-konflik yang cukup berat, namun tidak bagi film besutan duet sutradara Glenn Ficarra dan John Requa ini. Ya, I Love You Phillip Morris berhasil menggabungkan kisah nyata dari seorang penipu ulung bernama Steven Russell dengan unsur-unsur tipu-menipu ala Catch Me if You Can, romantisme cinta sejenis ala Brokeback Mountain dan gaya lelucon komikal ala Jim Carrey dengan manis yang membuat film bertema sensitif ini menjadi sebuah sajian yang unik dan sangat menghibur, terlebih lagi banyak sekali adegan-adegan mengejutkan, menipu sekaligus kocak yang membuat tawa penontonnya lepas di saat menyaksikan film berdurasi 98 menit ini.'),
(134, 'Ichi the Killer', 'POSITIF', 'DATA LATIH', 'Jika belum pernah bersentuhan dengan komiknya, Ichi The Killer sepintas mungkin terlihat seperti film gangster kebanyakan, namun bagaimana Miike menghadirkannya yang membuat segalanya menjadi berbeda. Tidak hanya disuguhkan dengan parade adegan-adegan disturbing seperti yang sudah saya singgung diatas, namun juga mengajak penontonnya dalam sebuah studi karakter dari tokoh-tokohnya yang unik, lengkap dengan segala konflik maupun gangguan kejiwaannya masing-masing plus sedikit bumbu black komedi dan iring-iringan soundtrack Japanese avant garde dari grup musik legendaris Jepang, Boredoms menjadikan Ichi the Killer sebuah pesta darah yang lengkap dan meriah.'),
(135, 'Il Mare', 'POSITIF', 'DATA LATIH', 'Selain kisahnya yang unik, seperti kebanyakan drama-drama Korea Selatan lainnya, penontonnya akan banyak disuguhkan adegan-adegan manis dengan visual yang indah. Il Mare dengan latar belakang pantai sunyi nan indah berhasil ditangkap dengan sangat baik, menimbulkan kesan romantis sekaligus misterius secara bersamaan. Kehadiran Jun Ji Hyun dan Lee Jung Jae sebagai pasangan beda waktu juga terbilang cukup baik, walaupun tidak istimewa setidaknya mereka sudah pas membawakan karakter masing-masing dengan segala konflik internalnya'),
(136, 'In America', 'POSITIF', 'DATA LATIH', 'Dengan dukungan para pemainnya yang bermain gemilang terutama pada kedua aktris ciliknya Sarah dan Emma Bolger yang di dunia nyata memang adalah kakak adik tampil sangat luar biasa sehingga menjadikan film ini menjadi jauh lebih menarik, termasuk juga akting dari Djimon Hounsou, aktor asal Perancis berkulit hitam ini ternyata juga bisa tampil meyakinkan sebagai seorang pria yang penuh dengan kasih sayang dibalik wajahnya yang sangar. Sebuah drama keluarga yang indah dan penuh makna yang akan menyentuh emosi setiap penontonnya dengan kisahnya yang luar biasa.'),
(137, 'Inception', 'POSITIF', 'DATA LATIH', 'Tidak diragukan lagi jika Inception adalah salah satu yang terbaik dari seorang Christopher Nolan, walaupun secara kualitas masih sedikit berada di bawah Memento maupun The Dark Night, namun apa yang disajikan oleh Nolan di sini lebih dari cukup untuk sekali lagi mengukuhkannya sebagai salah satu sutradara terbaik yang dimiliki oleh Hollywood dan juga membuat Inception menjadi salah satu film terbaik tahun ini.'),
(138, 'Incendies', 'POSITIF', 'DATA LATIH', 'Incendies adalah sebuah drama kuat yang tersaji luar biasa selama 2 jam lebih. Tidak peduli seberapa lambat ia berjalan karena hampir di setiap menitnya film yang banyak memperoleh penghargaan internasional ini mampu berbicara banyak dan juga memberikan efek kejut kepada penontonnya. Ini adalah sebuah kisah hebat, depresi dan tragis yang dikemas apik, kisah pilu bagaimana seorang ibu berusaha menyatukan kembali keluarganya meskipun harus dengan cara yang menyakitkan.'),
(139, 'Inglorious Basterds', 'POSITIF', 'DATA LATIH', 'Tidak mudah memang membuat sebuah film dengan tema sejarah di mana sejarah tersebut sudah dimodifikasi ulang sedemikian rupa sehingga menghasilkan sebuah tontonan yang berbeda, dan untuk dapat membuatnya sebagai sebuah tontonan berkualitas tentu saja dibutuhkan keberanian tersendiri dan juga sedikit kegilaan untuk menulis ulang sejarah sesuai dengan yang diinginkan, dan kemampuan itulah yang dimiliki oleh seorang Tarantino yang ternyata berhasil menghadirkan sebuah fantasi perang yang sangat luar biasa menghibur, penuh kejutan dan menegangkan hingga akhir, namun film ini juga bisa luar biasa membosankan bagi penonton yang tidak terbiasa dengan dialog-dialog panjang dan alur lambat yang hampir menghiasi film yang berdurasi 153 menit ini'),
(140, 'Inside', 'POSITIF', 'DATA LATIH', 'Inside bisa dibilang adalah salah satu horror slasher terbaik yang pernah dibuat Perancis. Dengan premisnya yang simpel dan latar minimalis, rangkaian adegan-adegan menegangkan plus bumbu blood and gore yang sangat kental, film ini akan memberikan efek maksimum kepada penontonnya.'),
(141, 'Inside Out', 'POSITIF', 'DATA LATIH', 'Lebih dalam, Inside Out punya pesan solid tentang proses perjalanan dari seorang anak menuju kedewasaan yang mungkin hanya dimengerti oleh penonton dengan rentang usia yang lebih besar lengkap dengan segala adegan-adegannya yang mampu menyentil emosi. Setiap kegalauan yang hadir, setiap rasa amarah dan kelabilan memang merupakan bagian tak terpisahkan dari sebuah proses, namun menjadi istimewa ketika Docter dan Del Carmen mampu membungkusnya dalam petualangan khas Pixar yang bisa dinikmati oleh siapa saja, dan itu yang paling penting.'),
(142, 'Instructions Not Included', 'POSITIF', 'DATA LATIH', 'Terlalu banyak kejutan di sini yang membuat plotnya seperti berbelok tajam setiap kali sebuah surprise baru menabraknya, seperti sejak Valentine beralih profesi menjadi stuntman dadakan yang sukses di Hollywood setelah melompat dari lantai 10 lalu kedatangan Julie yang mengubah aroma kental Big Daddy menjadi Kramer Vs. Kramer,  Dan ketika kamu seperti sudah mulai terbiasa ditampar bolak balik oleh twistnya yang penuh emosi dan tawa, sekali lagi sebuah kejutan paling besar datang tepat sebelum credit akhir, sebuah kejutan yang dipastikan akan membuatmu menyesal sudah meremehkannya sejak awal.'),
(143, 'Interstellar', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah film yang banyak menyajikan pengalaman luar angkasa, Nolan membuatnya dengan spektakuler. Dibungkus dengan visual menakjubkan dari dapur spesial efek Double Negative bersama dukungan kamera IMAX yang dikendalikan sinematografer kawakan Hoyte van Hoytema. Setiap momen yang melibatkan petualangan di angkasa luar itu penuh kejutan tak terduga, begitu menegangkan, begitu misterius sekaligus begitu memesona dan emosional terutama ketika Cooper dan Amelia bersenggolan dengan fenomena spacetime continuum dan usaha mereka bertahan hidup demi kemanusiaan, cinta dan keluarga, dan saya masih belum menyebut pengaruh besar scoring dahsyat garapan sang maestro Hans Zimmer yang tidak pernah gagal memompa setiap emosi penontonnya. Klimaksnya seperti banyak terinspirasi dari rangkaian momen absurd nan indah opus fiksi ilmiah legendaris Stanley Kubrick, 2001: A Space Odyssey. Twist di ujungnya tidak hanya begitu mengejutkan namun juga terasa begitu sentimentil ketika Nolan membawa narasinya menjadi sebuah puzzle utuh yang menggetarkan.'),
(144, 'Invictus', 'POSITIF', 'DATA LATIH', 'Invictus merupakan contoh film yang sangat baik dalam membawa tema olahraga untuk alat mempersatukan bangsa. Clint Eastwood, orang tua yang masih dengan tekunnya masih bisa menyutradarai film- film drama bermutu beralur pelan, lagi-lagi Clint sukses  membawakan kisah nyata ini ke layar lebar, ketika adegan pertandingan terakhir yang bersejarah antara Afrika Selatan dan Selandia baru dengan suasana tahun 1995 dibuat sedetail mungkin oleh Clint, begitu banyak momen indah yang jangan sampai dilewatkan.'),
(145, 'Ironclad', 'POSITIF', 'DATA LATIH', 'Sebuah film perang tentu tidak lengkap jika tidak menghadirkan adegan-adegan baku hantam baik jarak jauh maupun dekat, dan untuk bagian satu ini saya harus mengacungkan jempol buat English yang sudah membuat pertarungan jaman medieval ini dengan sangat baik, terlebih untuk film dengan biaya produksi yang minim. Brutal dan realistis mungkin adalah dua kata yang tepat untuk menggambarkan bagaimana English menghadirkan adegan peperangan di sini. '),
(146, 'It Follows', 'POSITIF', 'DATA LATIH', 'Elemen supernaturalnya bekerja dengan sangat efektif, mampu mengusik imajinasimu hanya dengan melihat koridor atau pintu ruangan terbuka. Semua kengerian ini banyak dibantu dengan kekuatan teknis dan kerja kamera yang brilian menangkap setiap ketakutan, setiap rasa tidak nyaman dan ancaman yang bisa datang kapan saja tanpa peringatan.'),
(147, 'Jackass 3D', 'POSITIF', 'DATA LATIH', 'Jackass dengan mudah menjadi sebuah suguhan komedi yang dicintai sekaligus dibenci sama besarnya. Kecuali penggunaan kamera yang jauh lebih canggih, efek slow motion dan 3D yang dahsyat, Jackass 3D sesungguhnya tidak menawarkan sesuatu yang baru, tetap setia mengusung konsep pranks & stunts usangnya, namun hebatnya hingga seri ketiga ini suguhan usang tersebut masih terbukti efektif memberikan efek kejutan dan hiburan luar biasa bagi saya. Ya, jujur saja saya menikmati setiap menit penuh kegilaan dan kegembiraan menyimpang bersama kru Jackass.'),
(148, 'Jason Bourne', 'POSITIF', 'DATA LATIH', 'Narasinya memang tidak mampu berinovasi besar dan terasa seperti mengulang dari pakem seri pendahulunya, namun fokus utamanya adalah bagaimana meleburkan kisahnya bersama momen aksinya yang harus diakui masih terasa luar biasa mendebarkan ketika berada di tangan Greengrass. Trademark Greengrass dengan segala editing cepat dan penggunaan shaky cam kembali mendominasi setiap pergerakan Bourne ketika beradu pintar dengan para agen CIA. Setiap adegan kejar-kejaran digarap dengan sangat baik, setiap adu fisik dan senjata menghadirkan lecutan adrenalin tingkat tinggi bersama dentuman scoring familiar dari John Powell dan David Buckley.'),
(149, 'Joe', 'POSITIF', 'DATA LATIH', 'Kekuatannya ada pada character driven dan kekuatan akting  para pemainnya ketimbang plot adaptasi dari novel lama milik Larry Brown. Harus diakui juga, secara teknis Gordon Green bersama sinematografer langganannya, Tim Orr juga sudah bekerja dengan baik membungkus Joe dengan visual depressing atmosferis yang juga cantik dan mellow serta menambahkan sedikit humor pada dialog-dialognya dan juga sedikit kebrutalan guna mencegah menjadikannya terlalu sentimental.'),
(150, 'John WIck', 'POSITIF', 'DATA LATIH', 'David Leitch dan Chad Stahelski adalah dua orang yang paling bertanggung jawab mengapa John Wick bisa bergerak begitu leluasa, begitu asyik dan begitu stylish dalam menerjemahkan narasi usang yang sudah dimodifikasi sana-sini oleh Derek Kolstad, dan saya masih belum mengatakan ia juga begitu keras dan kotor memiliki tingkat kebrutalan dan koreografi aksi paling keren tahun ini yang mungkin hanya bisa dikalahkan oleh sekuel The Raid, Berandal.'),
(151, 'Joint Security Area', 'POSITIF', 'DATA LATIH', 'Joint Security Area bisa dibilang adalah salah satu thriller terbaik Korea Selatan, yang juga menjadi pintu gerbang bagi karir Park Chan Wook, yang seperti kita ketahui kemudian berhasil menghadirkan banyak karya-karya besar, salah satunya adalah Trilogi Vengeance yang fenomenal itu.'),
(152, 'Julie & Julia', 'POSITIF', 'DATA LATIH', 'Julie & Julia tampil cukup solid baik dari cerita maupun akting para aktrisnya, sehingga film yang mengangkat tema tentang kuliner ini mampu menjadi hiburan tersendiri buat para penontonnya, baik buat penggemar masak memasak atau tidak film ini akan membuat kita lapar dan secara tidak sadar meneteskan air liur kita.'),
(153, 'Justin Bieber: Never Say Never', 'POSITIF', 'DATA LATIH', 'Never Say Never jelas menghibur dan emosional tidak hanya buat para fans semata, namun juga buat saya, golongan penonton yang kurang mengenal siapa itu sosok Justin Bieber untuk ikut berdendang bersama menikmati kemegahan dan histeria suasana konser My World Tour yang spektakuler itu, dan di sisi lain Chu juga tidak ketinggalan untuk mengajak penontonnya untuk mengenal lebih dekat sosok pribadi sang mega bintang yang sudah berhasil menyihir dunia ini.'),
(154, 'Kagemusha', 'POSITIF', 'DATA LATIH', 'Kurosawa benar-benar tahu cara mengambil momen dan adegan di setiap scene, pemandangan-pemandangan yang menarik, tone warna yang cemerlang, Apalagi ini merupakan film Kurosawa berwarna pertama yang saya tonton, adegan alam mimpi Shingen palsu benar-benar memukau, tidak ada visual efek dan sebagainya, yang ada hanyalah permainan warna dan pengambilan gambar yang epik. '),
(155, 'Kahaani', 'POSITIF', 'DATA LATIH', 'Naskahnya memang menarik dan nyaris rapi dengan segala detailnya, tapi harus diakui ia masih memiliki beberapa plot hole yang terasa sedikit mengganggu keasyikannya. Untung saja Kahaani punya cast yang bagus untuk menambal kekurangannya itu termasuk bagaimana kemudian Ghosh berhasil menutup kisahnya dengan twist ending cerdas, ending yang sangat berkaitan dengan pemilihan karakter wanitanya yang tidak biasa itu. '),
(156, 'Kapan Kawin', 'POSITIF', 'DATA LATIH', 'Tidak mudah membuat sebuah komedi romantis yang masih terlihat menyegarkan di balik formula komersialnya. Selain karena kepiawaian Ody Harahap mempresentasikan racikan komedi dan romansanya dengan takaran pas, Kapan Kawin? juga banyak sekali terbantu oleh kinerja para pemainnya yang solid, malah bisa dibilang Kapan Kawin? bisa begitu memikat berkat digerakkan oleh jagoan-jagoan hebatnya, baik yang berada di posisi karakter utama maupun pendukung seperti Adi Kurdi dan Ivanka Suwandi sebagai orangtua Dinda yang kolot sekaligus kocak luar biasa.'),
(157, 'Kick-Ass', 'POSITIF', 'DATA LATIH', 'Layaknya keberanian yang ditampilkan oleh karakter Kick-Ass, Matthew Vaughn pun dengan berani menyajikan sebuah suguhan berbeda dalam genre superhero. Sebuah usaha yang ternyata tidak sia-sia dan berbuah manis, karena Kick-Ass benar-benar sukses tampil menghibur dengan segala keunikan dan kesegarannya.'),
(158, 'Kiki''s Delivery Service', 'POSITIF', 'DATA LATIH', 'Seperti kebanyakan animasi buatan Miyazaki lainnya, Kikis Delivery Service juga tidak lepas dari balutan animasi cantik, penuh warna-warni dengan detail yang luar biasa, apalagi mengingat ini adalah animasi 2D buatan 1989 di mana teknologi animasi belum secanggih sekarang, namun Studio Ghibli bersama Miyazaki sudah mampu membuat animasi klasik modern dengan kualitas tinggi. Kikis Delivery Service memang bukanlah animasi terbaik dari Miyazaki dan Studio Ghibli, namun tetap saja animasi satu ini mampu memberikan sebuah tontonan menghibur dan penuh dengan segala kebaikan yang menginspirasi serta dapat dinikmati oleh semua kalangan.'),
(159, 'Kidnapped', 'POSITIF', 'DATA LATIH', 'Untuk ukuran sebuah thriller indie, Kidnapped sama sekali tidak buruk.  Miguel ngel Vivas sudah melakukan pekerjaannya dengan hebat untuk meramu kembali formula usang dalam kemasan yang berkelas, rumit sekaligus menyegarkan, memberikan penontonnya sebuah sensasi teror dan ketakutan yang berbeda dari kebanyakan film bertema sama.'),
(160, 'Killer Toon', 'POSITIF', 'DATA LATIH', 'Secara teknis Killer Toon sudah tampil meyakinkan sebagai sebuah horor. Sementara narasinya sendiri tidak sekuat penampilannya. Memang harus diakui ia punya kekuatan besar di temanya, kandungan misterinya pun sukses mengusik rasa penasaran.'),
(161, 'Kimi no Na Wa', 'POSITIF', 'DATA LATIH', 'Sebuah cerita cinta tentang keajaiban ruang dan waktu pun dimulai, ada rasa harap-harap cemas tentang apa yang terjadi selanjutnya yang kemudian ditutup dengan klimaks sentimentil dan ending kuat yang mengingatkan saya pada sensasi yang ada pada 5 Centimeters Per Second. Sensasi yang dijamin akan membuatmu menjadi baper maksimal.'),
(162, 'Kingsman: The Secret Service', 'POSITIF', 'DATA LATIH', 'Kingsman menjadi spesial tidak hanya karena ia menginjeksi tema aksi spionase yang notabene salah satu sub genre populer, namun yang penting adalah bagaimana Vaughn memperlakukannya layaknya anak kandungnya sendiri. Ya, Kingsman punya semua ciri khas Vaughn dari kekerasan tingkat tinggi yang melibatkan banyak darah dan kepala pecah sampai koreografi aksi memukau dengan segala efek slow motion cantik dan scoring asyik yang tepat sasaran, terutama pada klimaks spektakulernya, plus selipan komedi yang renyah.'),
(163, 'Kon Tiki', 'POSITIF', 'DATA LATIH', 'Duo Ronning-Sanberg tahu benar bagaimana menghasilkan gambar-gambar cantik bersama pergerakan kamera yang dinamis. Ya, mungkin spesial efeknya tidak secanggih Life of Pi, tetapi ada kesan natural yang terasa jauh lebih kental dan meyakinkan, lihat bagaimana para tim spesiel efeknya mampu membuat CGI hiu senyata itu.'),
(164, 'Kristy', 'POSITIF', 'DATA LATIH', 'Kristy punya kekuatan terbesar dari bagaimana Blackburn membentuk dengan kuat set piece horornya, menjadikan setiap momen slasher mampu lepas, keluar dan menghunjam dengan sangat efektif menggedor jantung penontonnya, menghadirkan sebuah pesona kuat tidak hanya melalui momen ketegangan akibat melihat karakternya dikejar-kejar para pemburu misterius sembari bermain petak umpet dan adu cerdas, namun juga bagaimana suasana suram mencekam yang hadir secara konsisten sejak konflik dimulai.'),
(165, 'La Horde', 'POSITIF', 'DATA LATIH', 'Melalui La Horde, duet sutradara Benjamin Rocher & Yannick Dahan sukses menghadirkan sebuah survival action zombie movie di debut penyutradaraan mereka. Dan hasilnya di luar dugaan tampil cukup baik dan menghibur. Segala ciri khas film-film zombie klasik pun tidak lupa mereka tampilkan dalam film berdurasi 96 menit ini, bertaburannya adegan-adegan gore dan blood splatter, serta kejutan-kejutan pelecut adrenalin yang sudah menanti dalam setiap kegelapan.'),
(166, 'La Strada', 'POSITIF', 'DATA LATIH', 'Film Besutan Federico Fellini yang satu ini menampilkan kisah cinta yang indah dan menghanyutkan, benar-benar menuangkan cinta di pita seluloidnya, meskipun film hitam putih ceritanya tidak hitam putih, ide yang di sampaikan cukup berkesan dan mengena, mudah diingat, menghibur, bijaksana, dan banyak hal lainnya. Film ini benar-benar mengungkapkan tentang kondisi manusia sebenarnya dalam kombinasi tak terduga dari emosi yang kadang-kadang membangkitkan.'),
(167, 'Lake Mungo', 'POSITIF', 'DATA LATIH', 'Lake Mungo bisa dibilang adalah salah satu contoh bagaimana horror mockumentary yang baik itu dibuat. Dengan sederhana namun efektif, film yang rencananya akan dibuat remake tahun 2011 nanti ini mampu memberikan sebuah pengalaman berkesan yang akan menghantui pikiran setiap penontonnya.'),
(168, 'Lars and the Real Girl', 'POSITIF', 'DATA LATIH', 'Tidak seperti latarnya yang dingin, ini adalah film yang menghangatkan dan membuat kita nyaman dengan segala kebaikan di dalamnya, sebuah heart warming drama kata orang di barat sana. Semua karakter tampak begitu menyenangkan dan begitu suportif, tidak ada karakter antagonis di sini kecuali mungkin Lars dan dirinya sendiri. Ryan Gosling sudah melakukan hal hebat untuk menghidupkan karakter Lars yang sakit sekaligus karismatik secara bersamaan, sebuah pribadi yang kompleks dengan tragedi masa lalu yang menghantuinya'),
(169, 'Laura & Marsha', 'POSITIF', 'DATA LATIH', 'Ini adalah road movie menarik dengan kandungan estrogen yang kental (disutradarai, ditulis, dimainkan dan diproduseri oleh para wanita). Semua yang kamu butuhkan dari sebuah fim perjalanan ada di Laura & Marsha; Set cantik, karakterisasi kuat dan soundtrack yang bagus, yah, meskipun masih digarap dengan terburu-buru dan terasa kikuk di beberapa bagian, ini adalah tontonan yang enjoyable tentang sebuah perjalanan penuh makna yang menguji sampai di mana kekuatan sebuah persahabatan.'),
(170, 'Lean on Me', 'POSITIF', 'DATA LATIH', 'Selain ceritanya yang ringan, film produksi tahun 1989 ini juga banyak diselingi dengan quote menarik dan humor-humor lucu sehingga tidak jarang membuat penontonnya tertawa.'),
(171, 'Lego Movie', 'POSITIF', 'DATA LATIH', 'Jika kamu bukan penggemar Lego, mungkin membutuhkan sedikit waktu untuk terbiasa melihat tampilan visualnya yang unik, seperti kombinasi animasi stop motion dengan tampilan kotak-kotak kaku ala bata-bata cerah Lego.'),
(172, 'Leon: The Professional', 'POSITIF', 'DATA LATIH', 'Tidak terlalu berlebihan rasanya jika banyak orang yang memasukkan Leon ke dalam list film terfavorit mereka, karena film produksi Perancis bukan hanya tampil menghibur semata namun juga memberikan sebuah tontonan crime drama berkelas dan penuh emosi.'),
(173, 'Let Me In', 'POSITIF', 'DATA LATIH', 'Walaupun secara keseluruhan saya tetap lebih menyukai Let the Right One In, namun harus diakui Matt Reeves telah berhasil melalukan pekerjaan rumahnya mentransfer elemen-elemen penting novel maupun film aslinya dengan sangat baik. Ya,  Let Me In ini adalah contoh sukses bagaimana harusnya sebuah film daur ulang itu dibuat. Jarang-jarang ada remake yang mampu berbicara banyak, sebanyak film aslinya'),
(174, 'Life of Pi', 'POSITIF', 'DATA LATIH', 'Secara fisik Life of Pi itu cantik, sangat cantik, bahkan sejak pertama kali dibuka ia sudah menebar pesonanya melalui gambar-gambar fauna yang terbalut dalam selimut 3D yang apik. Ya, efeknya bisa jadi salah satu yang terbaik di kelasnya tetapi kejutan masih terus berlanjut, kamu akan menemukan bahwa visualnya pun sangat indah, sinematografer Claudio Miranda sepertinya tahu benar kemauan Lee akan sebuah sajian penuh orgasme visual menggetarkan ketika ia dengan lihai menghasilkan variasi lanskap-lanskap laut fantastis yang merangsang mata dan hati kita.'),
(175, 'Like Crazy', 'POSITIF', 'DATA LATIH', 'Like Crazy, sebuah romansa pahit manis dengan rasa indie kental yang berbalut narasi sederhana tentang kekuatan cinta. Menjadi menarik dan emosional ketika Drake Doremus membungkusnya dengan segala kesederhanaan bercerita, pemilihan sudut-sudut kamera yang cantik termasuk memaksimalkan akting dua pemeran utamanya, khususnya Felicity Jones yang tampil luar biasa.'),
(176, 'Limitless', 'POSITIF', 'DATA LATIH', 'Limitless mungkin bukan yang terbaik di genrenya. Seorang Neil Burger  sepertinya juga butuh asupan NZT-48 untuk menjadikan filmnya ini jauh lebih sempurna. Tapi dengan premis menarik dan ditunjang dengan naskahnya yang cukup cerdas plus permainan apik dari seorang Bradley Cooper, tentu tidak sulit bagi Limetless untuk menjadi sebuah sajian crime thriller unik dan menghibur yang saya percaya dapat langsung disukai penontonnya.'),
(177, 'Locke', 'POSITIF', 'DATA LATIH', 'Setting, naskah dan karakternya memang terlihat begitu sederhana dan sempit, tetapi siapa sangka di bawah arahan solid Steven Knight, Locke bisa tampil memaksimalkan segala keterbatasannya. Memang dengan hanya didominasi seorang Tom Hardy di belakang kemudi BMW berkecepatan 100 km per jam dan timbunan percakapan telepon, Locke bukan thriller yang akan disukai kebanyakan penontonnya yang tidak sabar.'),
(178, 'Logorama', 'POSITIF', 'DATA LATIH', 'Menonton Logorama adalah sebuah sensasi 16 menit menyenangkan yang tak terlupakan. Konsep unik berhasil disajikan dengan balutan animasi cell shading penuh warna yang sangat enjoyable.'),
(179, 'Lone Survivor', 'POSITIF', 'DATA LATIH', 'Diisi oleh jajaran aktor besar, dari keempat karakter utamanya; Mark Walhberg, Taylor Kitsch, Ben Foster dan Emile Hirsch sampai sang komandan yang diperankan Eric Bana, semua bermain bagus dalam mengemban tugas mereka masing-masing.'),
(180, 'Lovelace', 'POSITIF', 'DATA LATIH', 'Saya menyukai bagaimana Epstein dan Friedman membungkus kisah Linda dalam balutan presentasi yang menarik. Tidak hanya menampilkan setting dekade ''70 yang akurat termasuk dandanan, busana retro kental dan behind the scene pembuatan Deep Throat bersama cameo-cameo bintang porno besar lainnya, termasuk kehadiran juragan Playboy, Hugh Hefner yang dibawakan oleh James Franco,  namun juga secara visual kita seperti menonton kembali film berusia 30 tahun dengan segala efek dan musiknya.'),
(181, 'Mad Max: Fury Road', 'POSITIF', 'DATA LATIH', 'Berbicara soal aksi, Fury Road punya semua yang kamu butuhkan di sebuah action movie kejar-kejaran. Cepat, menegangkan, seru dan indah. Ya, setiap aspek aksi di Fury Road digarap dengan teknis luar biasa. Untuk sebuah film yang berlatar padang gurun tandus, visual garapan John Seale tersaji begitu indah menangkap setiap lanskapnya,'),
(182, 'Malavita', 'POSITIF', 'DATA LATIH', 'Malavita alias The Family  adalah sajian mobster komedi yang menghibur dengan 20 menit klimaks yang menegangkan bersama jajaran cast solid, terutama Michelle Pfeiffer dan si cantik Dianna Agron.'),
(183, 'Mama', 'POSITIF', 'DATA LATIH', 'Mama menawarkan sebuah dongeng horor dengan premis dan narasi yang menarik, sukses untuk membuat kita penasaran hingga akhir. Elemen horornya bekerja dengan baik, latarnya menakutkan, auranya menyesakkan serta para cast bermain dengan..  ya, mungkin sedikit berlebihan di beberapa bagian, namun bagaimanapun Andres Muschietti bisa dikatakan sudah sukses memanjangkan film pendeknya dengan baik, efektif menunaikan tugasnya untuk memberikan penontonnya sebuah sensasi menonton horor yang menakutkan.'),
(184, 'Maniac', 'POSITIF', 'DATA LATIH', 'Tentu saja seperti kebanyakan remake, mau tidak mau, suka tidak suka kita akan membandingkannya dengan versi aslinya, dan untuk kasus Maniac, sekali lagi Aja membuktikan bahwa ia memang pantas dijuluki sang master horor remake di mana ia bersama koleganya, Khalfoun sudah membuat versi daur ulangnya ini menjadi lebih segar bersama sentuhan-sentuhan modern yang membuatnya memiliki ciri khas sendiri tanpa harus kehilangan DNA milik Bill Lustig.'),
(185, 'Marshland', 'POSITIF', 'DATA LATIH', 'Jika ada satu hal yang menonjol dari Marshland itu adalah kualitas visualnya. Ya, ia punya sinematografi jempolan di bawah arahan lex Cataln. Setiap gambar berhasil memancarkan aura tenang sekaligus haunting dan eerie di saat bersamaan. Permainan lensa jarak jauh termasuk penggunaan format bird eye view bergerak pelan, menawarkan kecantikan realisme tersendiri di balik tragedi dari kota rawa-rawa terpencil itu.'),
(186, 'Matchstick Men', 'POSITIF', 'DATA LATIH', 'Menariknya, dalam perjalanannya Matchstick Men tidak melulu bercerita soal teknik tipu menipu saja dengan segala selipan komedi satir di dalamnya, ada dua bagian lain yang kemudian sukses menyertainya. Pertama adalah karakter Roy Wellar sendiri dengan segala krisis kejiwaan yang diidapnya yang sukses dibawakan dengan sangat baik oleh Nicholas Cage. Karakternya punya porsi yang sama besarnya antara kecerdasan seorang penipu handal, kerapuhan seorang neurotik dan sosok ayah yang belajar untuk mencintai putri 14 tahun yang baru saja dikenalnya.'),
(187, 'Me and Earl and the Dying Girl', 'POSITIF', 'DATA LATIH', 'Paruh pertamanya diisi dengan tone ceria lengkap dengan segala dialog-dialog blakblakan dan humor ajaib yang seakan-akan tidak pernah memedulikan rasa sakit yang menjadi tema besarnya. Namun dalam perjalanannya ada elemen coming of age alias pendewasaan yang berperan besar di mana kemudian akan mengubah nadanya menjadi lebih serius.'),
(188, 'Melancholia', 'POSITIF', 'DATA LATIH', 'Inilah kiamat ala Lars von Trier, sebuah studi karakter kompleks yang dibawakan dengan hebat oleh Kristen Dunst dan pelajaran tentang keikhlasan menjelang kematian melalui metafora sebuah planet fiksi bernama Melancholia. Ya, von Trier bermain sedikit lembut dan lebih sopan di sini tanpa kehilangan sentuhannya bercerita dengan gambar-gambar puitis tentang kehancuran yang digarap mengesankan.'),
(189, 'Memento', 'POSITIF', 'DATA LATIH', 'Cerita berjalan mundur begitu unik, sangat jarang ada film seperti ini. Ini yang saya suka dari Memento karena butuh berpikir, butuh konsentrasi tinggi buat menontonnya, mungkin beberapa orang berpikir adegan bolak balik membuat plot film ini sangat tidak biasa namun sebenarnya adalah plotnya sederhana. Untuk itu bagi yang belum menonton scene demi scene harus anda cermati karena ending film ada di awal film dan fakta mengejutkan akan terselip di akhir film,  menjadikan film ini film murah namun berbobot. Salut buat Nolan brothers yang berhasil meraih penghargaan di mana-mana.'),
(190, 'Mencari Hilal', 'POSITIF', 'DATA LATIH', 'Tidak ada melodrama berlebih apalagi sampai menjurus  cengeng, namun momen-momen besar yang hadir mampu meletupkan emosi dengan caranya sendiri, belum lagi saya menyebut kepiawaian Satria Kurnianto dalam membalut narasinya dalam gambar-gambar yang sangat cantik sekaligus puitis yang kemudian dipasangkan serasi dengan scoring garapan Charlie Meliala hingga kemudian soundtrack milik Sabrang Noe Panuluh menutup rangkaian perjalanan besar dua anak manusia dengan sangat menyentuh.'),
(191, 'Midnight Special', 'POSITIF', 'DATA LATIH', 'Saya senang bagaimana proses menuju akhir yang paling istimewa adalah bagaimana Nichols menghormati kecerdasan penontonnya dengan memilih  melakukan pendekatan emosional ketimbang naratif yang bertele-tele dan sok pintar, termasuk bagaimana ia memanfaatkan pesona jajaran para pemainnya yang turut bermain apik untuk menggerakkan ceritanya. Mungkin pada akhirnya Midnight Special tidak menawarkan sebuah twist yang sampai terlalu menonjok tetapi tidak bisa dimungkiri itu adalah sebuah akhir yang cukup emosional.'),
(192, 'Mindscape', 'POSITIF', 'DATA LATIH', 'Sampai tiga perempat filmnya, Dorado seperti sudah mengerjakan segalanya dengan rapi. Misterinya dijaga dengan baik, bersama tone mencekam, mencoba menghapus batasan alam mimpi dan alam nyata, termasuk dukungan performa yang bagus dari Mark Strong yang tampil lebih kalem dan tentu saja penampilan meyakinkan dari Taissa Farmiga yang tidak lain dan tidak bukan adalah adik dari aktris Vera Farmiga. Taissa sukses menghadirkan aura misterius pada karakternya, membuat pikiran penontonnya terpecah.'),
(193, 'Minggu Pagi di Victoria Park', 'POSITIF', 'DATA LATIH', 'Di bawah penyutradaraan  apik Lola Amaria plus dukungan naskah kuat dari Titin Watimena, MPdVP sukses menjelma menjadi sebuah suguhan menarik dan menyegarkan. Meskipun tema yang disuguhkan mungkin terlihat berat namun berkat olahan naskah yang cerdas membuat jalinan kisah MPdVP menjadi mudah dikunyah oleh para penontonnya.'),
(194, 'Mirrors', 'POSITIF', 'DATA LATIH', 'Memang untuk ukuran film horror secara keseluruhan Mirrors jelas bukan yang terbaik, masih banyak lubang kecil di sana sini, namun setidaknya bagi saya film sudah berhasil digarap cukup baik oleh Aja, bahkan lebih baik dari versi aslinya. Aja sekali lagi membuktikan bahwa ia memang ahlinya membuat horror remake.'),
(195, 'Misery', 'POSITIF', 'DATA LATIH', 'Keberhasilan Misery sebagai sebuah thriller mencekam tentu tidak lepas dari dua orang penting yang berjasa di baliknya. Selain Stephen King sebagai yang empunya cerita, tentu acungan jempol sangat layak diberikan kepada Kathy Bates yang performanya sangat luar biasa di sini. Berperan sebagai seorang wanita psikopat, Bates benar-benar memaksimalkan kemampuan beraktingnya dengan menghadirkan kengerian dalam sosok psikopat bernama Annie Wilkes.'),
(196, 'Miss Granny', 'POSITIF', 'DATA LATIH', 'Premisnya memang menarik, tetapi segala kegilaan itu tidak akan bekerja maksimal jika tidak didukung pemain yang sama gilanya. Ada Shim Eun Kyung yang imut menjadi Oh Doo Ri. Kelucuan demi kelucuan timbul dari gap generasi, kisah cinta segi banyak yang konyol dan kehangatan sebuah keluarga serta perjalanan karakternya mencari jati diri dalam kesempatan kedua yang semuanya difokuskan ke tingkah laku komikal Eun Kyung yang sangat jago memberikan sentuhan jompo cerewet ke dalam wujud 20 tahunnya.'),
(197, 'Moebius', 'POSITIF', 'DATA LATIH', 'Apa yang selalu saya suka dari film-film Kim Ki Duk adalah bagaimana ia menetralkan kegilaannya dalam sebuah konklusi spiritual dengan pesan mendalam, untuk kasus ini ada sub teks tentang karma dan sebab akibat dari apa yang kamu hasilkan melalui setiap perbuatanmu di dunia.'),
(198, 'Mommy', 'POSITIF', 'DATA LATIH', 'Dipresentasikan dengan gaya semi realis seperti kebanyakan film-film Dolan dan visual cantik dari sinematografer langganan Dolan, Andre Turpin sukses menciptakan pemandangan outdoor indah. Sementara lantunan-lantunan musik latar dari tembang-tembang pop tenar dari White Flag milik Dido. Colorblind milik Counting Crows, Oasis dengan Wonderwall sampai ditutup oleh nada depressing dari Born to Die milik Lana Del Rey sukses memberikan suntikan energi tersendiri di setiap sekuen dramatisnya, membuatnya seperti kompilasi video klip musik panjang yang emosional.'),
(199, 'Moneyball', 'POSITIF', 'DATA LATIH', 'Sudah lama tidak melihat film tentang baseball yang bagus, dan Moneyball menjawab kekosongan itu dengan menghadirkan sebuah biopik hebat dengan perpaduan naskah adaptasi cerdas dari kisah nyata penuh inspirasi tentang manusia-manusia yang ingin keluar dari pakem konvensional dan mengubah cara pandang terhadap baseball itu sendiri dengan cara-cara mereka yang tidak biasa.'),
(200, 'Moon', 'POSITIF', 'DATA LATIH', 'Wow! Mungkin itulah ekspresi saya setelah menonton film ini, sebuah ekspresi yang mungkin hanya terjadi jika melihat atau mengalami sesuatu yang memesona atau sesuatu yang di luar dugaan kita. Yup ekspresi itulah yang dirasakan saya setelah menonton Moon, sebuah thriller fiksi ilmiah yang disutradarai oleh Duncan Jones ini tampil di atas ekspektasi. Berbeda dengan kebanyakan film fiksi ilmiah lainnya, Moon tidak bergantung pada kehadiran alien misterius, pesawat-pesawat luar angkasa yang dilengkapi dengan senjata canggih atau pertempuran-pertempuran kolosal, namun Moon menawarkan sesuatu yang lebih mendasar yang merupakan inti dari semua film yaitu ceritanya yang kuat.'),
(201, 'Morning Glory', 'POSITIF', 'DATA LATIH', 'Jadi ingin mencari tontonan drama komedi ringan namun tetap memiliki cerita berbobot dan masih menghibur? Morning Glory bisa jadi pilihan tepat untuk mengisi waktu santai anda. Tidak hanya mampu memberikan sajian yang enjoyable, di sisi lain Morning Glory juga memberikan anda sedikit pengetahuan tentang bagaimana suka duka di balik layar sebuah acara televisi.'),
(202, 'Mother and Child', 'POSITIF', 'DATA LATIH', 'Mother and Child mungkin bukanlah sebuah drama yang dengan mudah dinikmati begitu saja oleh semua orang, namun jelas juga bukan sebuah drama rumit yang sulit untuk dicerna. Yang dibutuhkan hanya kesabaran dan bagaimana kemampuan kita untuk dapat merasakan kisah yang disajikan dan kedalaman setiap karakter-karakternya, dan niscaya seperti saya, anda akan dapat juga merasakan bagaimana hebatnya film ini memengaruhi emosi para penontonnya dengan cara yang cerdas.'),
(203, 'Mother''s Day', 'POSITIF', 'DATA LATIH', 'Mothers Day bisa jadi salah satu contoh langka di mana versi daur ulang bisa tampil lebih bagus dari versi orisinalnya. Tidak hanya sukses membuat penontonnya menahan napas dengan momen-momen penuh darah, kesadisan dan ketegangan semata, namun di sisi lain Bousman juga memberikan perhatian lebih dalam usahanya menghidupkan karakter-karakternya plus dalam mengkonversi naskah ceritanya.'),
(204, 'Mud', 'POSITIF', 'DATA LATIH', 'Ya, Mud memesona, tidak hanya narasi sederhana dan elemen menarik coming of age dari sudut pandang remaja 14 tahun namun secara visual ia juga memikat dengan gambar-gambar cantiknya di bawah arahan sinematografer langganan Nichols, Adam Stone dan juga akting menawan dari Matthew McConaughey dan aktor kecilnya.'),
(205, 'Mulholland Dr.', 'POSITIF', 'DATA LATIH', 'Mulholland Drive sendiri digadang-gadang sebagai salah satu film terbaik dari seorang David Lynch karena bukan hanya memiliki plot dengan tingkat kerumitan luar biasa membingungkan dan didukung dengan teknis sinematik tingkat tinggi namun juga memaksa penontonnya untuk memasang mata dan telinga baik-baik, bahkan dari awal film karena banyak sekali potongan-potongan petunjuk simbolik yang sudah disebar sutradara Amerika berusia 66 tahun ini dalam setiap adegan-adegannya. Untuk ukuran sebuah film indie, Mulholland Drive mampu memberikan impact luar biasa kepada para penontonnya.'),
(206, 'Mutants', 'POSITIF', 'DATA LATIH', 'Meski secara keseluruhan jalinan kisahnya mudah ditebak, namun tetap saja film berdurasi 95 menit ini tetap menarik untuk dinikmati hingga akhir karena selain mencoba mengangkat tema yang sedikit berbeda, pengembangan karakternya juga menjadi perhatian lain yang membuat film ini menjadi lebih hidup. Helene de Fougerolles sudah melakukan tugasnya dengan baik menjadi karakter Sonia, seorang petugas medis yang harus terjebak dalam situasi dilematis. Menariknya lagi karakter Sonia mampu berkembang dinamis sepanjang film. Chemistry yang dibangun dengan kekasihnya Marco mampu membuat film yang seharusnya keras dan sadis ini menjadi sedikit lebih lembut dan melankolis.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(207, 'My Girl', 'POSITIF', 'DATA LATIH', 'Racikan pas antara romansa puppy love yang manis, persahabatan dan pendewasaan berpadu padan dengan komedi ringan dan penyajian yang renyah menjadi alasan-alasan kenapa My Girl susah untuk tidak disukai oleh penontonnya, bukan hanya buat audiens cilik namun para penonton dewasa pun akan merasakan efek nostalgia personal terutama jika memiliki pengalaman yang sama. Dan saya belum menyebut bagaimana performa para pemain ciliknya yang tampil sama asyiknya dengan presentasinya.'),
(208, 'My Mom', 'POSITIF', 'DATA LATIH', 'Tentu saja sesuai judulnya, karakter ibu yang dibawakan dengan luar biasa oleh artis senior Kim Hae Sook begitu mendominasi di sepanjang film, nyaris tanpa cela, bahkan ia sanggup  menenggelamkan karakter lain termasuk karakter Ji Suk sendiri yang seharusnya bisa berdiri sama tinggi.\r\n'),
(209, 'My Neighbor Totoro', 'POSITIF', 'DATA LATIH', 'Sama seperti kebanyakan karya-karya Miyazaki lainnya, Dunia Tonari no Totoro pun digarap dengan penuh warna dengan animasi indah khas Mizayaki yang lengkap dengan elemen-elemen fantasi dan magical, namun untuk Tonari no Totoro sutradara ini membuat cerita ringan dan lebih bersahabat dibanding dengan karya lainnya.'),
(210, 'Neighbors', 'POSITIF', 'DATA LATIH', 'Pastinya kita masih akan melihat guyonan-guyonan kurang ajar yang keluar dari mulut kotor penuh improvisasi Rogen tanpa henti, sementara Byrne yang manis seperti menjadi satu-satunya cast perempuan yang berarti bisa dibilang sanggup menandingi pesona kotor dari duet Rogen dan Efron yang berjibaku. Kehebohan dan kegilaan yang ditampilkan memang luar biasa, Stoller yang sudah makan asam garam di genre ini jelas tahu bagaimana menghadirkan setiap momen dengan sangat menghibur.'),
(211, 'Never Let Me Go', 'POSITIF', 'DATA LATIH', 'Melalui Never Let Me Go, baik Mark Romanek maupun Alex Garland bisa dibilang sukses menyampaikan pesan-pesan yang hendak disampaikan oleh Ishiguro dalam novelnya. Pesan tentang cinta, kematian, kepasrahan dan bagaimana manusia menghargai hidup yang sudah Tuhan karuniakan kepada mereka tersaji dalam balutan drama romantis indah nan suram ini.'),
(212, 'Nightcrawler', 'POSITIF', 'DATA LATIH', 'Satu lagi aspek menarik di Nightcrawler selain naskahnya yang pintar, pesan sosialnya yang menusuk dan teknisnya yang apik adalah bagaimana Gilroy sukses memaksimalkan pesona Gylenhaal yang bermain gemilang dan total, bahkan ia sampai harus menggerus berat badannya sebanyak 15 kilogram, menjadikan Lou Bloom sebagai tokoh anti hero baru tanpa cerita latar belakang. Ia adalah sosok  gila dan lihai memanipulasi.'),
(213, 'Nobody Knows', 'POSITIF', 'DATA LATIH', 'Selain karena sentuhan dingin Koreeda yang mampu membuat film ini menjadi lebih hidup, penampilan para aktor dan aktris ciliknya pun tak kalah hebatnya membangun emosi dan jiwa film ini, khususnya penampilan hebat Yuya Yagira yang berperan sebagai Akira. Hampir seluruh adegan dipastikan melibatkan aktor muda yang berhasil mendapatkan penghargaan sebagai aktor terbaik dan juga termuda sepanjang sejarah dalam ajang Festival Film Cannes 2004. Hirokazu Koreeda sukses menghadirkan sebuah heartbreaking drama dalam Nobody Knows.'),
(214, 'Non Stop', 'POSITIF', 'DATA LATIH', 'Membuat sebuah sajian dengan latar sesempit seperti di dalam pesawat memang menjadi tantangan tersendiri, beruntung Non Stop punya Collet Serra yang piawai mengolah jalan ceritanya, menggerakkan kameranya dengan dinamis untuk menciptakan adegan demi adegan yang jauh dari monoton meskipun parade aksinya baru datang menjelang akhir.'),
(215, 'Not One Less', 'POSITIF', 'DATA LATIH', 'Sebuah kisah sederhana tentang perjuangan seorang guru muda yang berusaha sekuat tenaga untuk mencari muridnya ini ternyata mampu disampaikan dengan sangat menarik oleh Yimou, terlebih lagi ia mengemasnya dengan pendekatan bergaya neorealist seperti yang sering digunakan sutradara Iran, Abbas Kiarostami, sehingga apa yang tersaji dalam film pemenang penghargaan Golden Lion pada Venice Film Festival 1999 tampak begitu natural dan apa adanya.'),
(216, 'Now You See Me', 'POSITIF', 'DATA LATIH', 'Now You See Me memang keren dan sanggup membuatmu duduk betah selama 115 menit melahap setiap kejutan di dalamnya, tetapi selalu ada sisi lain dalam sebuah cerita. Narasinya yang dipenuhi jebakan dan pengalih perhatian mungkin terlihat cerdas di kulit luarnya, namun di saat bersamaan jika menilik lebih dalam ia terkesan terlalu sempurna dan kurang manusiawi, apalagi jika kamu mau membandingkannya dengan The Prestige milik Nolan yang mampu digarap dengan solid.'),
(217, 'Oblivion', 'POSITIF', 'DATA LATIH', 'Mungkin bukan fiksi ilmiah paling orisinal yang pernah kamu tonton dengan segala pinjaman ide sana-sini, tetapi meskipun basi,  premis tentang kehancuran bumi dan invasi alien plus pesona Tom Cruise yang masih bertaji itu sudah lebih dari cukup untuk menjadi sebuah kombinasi yang susah untuk ditolak, terlebih sutradaranya, Joseph Kosinski tahu benar bagaimana menghadirkannya dengan balutan teknis yang baik.'),
(218, 'Ode to My Father', 'POSITIF', 'DATA LATIH', 'Narasi Ode to My Father menjadi personal dan emosional, khususnya buat para penonton tua Korea, bukan hanya karena ia banyak menghadirkan petuah-petuah lawas tentang bagaimana pentingnya sosok ayah dalam keluarga, namun dalam perjalanannya yang disajikan secara kronologis, Yoon Je Kyoon juga mencoba mengeksploitasi sebuah momen reuni super emosional yang susah untuk dihindari di ujung ceritanya'),
(219, 'Oldboy', 'POSITIF', 'DATA LATIH', 'Park Chan Wook sukses menjadikan Oldboy sebagai salah satu film balas dendam terbaik sepanjang masa, dan Oldboy mempunyai shocking ending yang tidak bisa kita lupakan, terlalu sakit untuk diingat, terlalu gila untuk dibayangkan, memuakkan penontonnya. Buat saya film ini begitu powerful, mengaduk-aduk emosi kita ke level ekstrem.'),
(220, 'Once', 'POSITIF', 'DATA LATIH', 'Dengan biaya dan waktu  produksi terbatas namun dikerjakan dengan sepenuh hati, Once dibawah komando John Carney mampu tampil memesona dan emosional sebagai sebuah drama romantis dengan kekuatannya yang terletak pada pemilihan musik yang bagus, cerita yang sederhana dan chemistry kuat Glen Hansard dan Marketa Irglova. Sungguh pengalaman menonton sebuah romansa yang menyegarkan dengan segala lagu-lagunya yang keren, karakter yang kuat dan ending yang bagus.'),
(221, 'Zootopia', 'POSITIF', 'DATA LATIH', 'Zootopia punya semua elemen untuk membuatnya menjadi paket animasi keluarga ala Walt Disney Animation Studios yang menghibur, dari kualitas animasi penuh warna dan detail, cerita from hero to zero ringan penuh inspirasi  sampai ratusan karakter hewan yang unyu bin imut macam si kelinci Judy Hopps yang disuarakan sempurna oleh aktris Ginnifer Goodwin sampai Mr. Big si tikus Antartika bos Tundratown.'),
(222, 'Zodiac', 'POSITIF', 'DATA LATIH', 'Untuk ukuran sebuah thriller misteri kriminal berkualitas, David Fincher bersama Zodiac miliknya sudah memiliki segalanya. Naskah yang kuat dan cerdas, suguhan teknis yang mumpuni dan dukungan akting prima dari para pemainnya menjadikan Zodiac salah satu yang terbaik di genrenya, tidak peduli minus momen-momen aksi atau pun panjangnya durasi karena saya sangat menikmati setiap menitnya.'),
(223, 'Zero Dark Thirty', 'POSITIF', 'DATA LATIH', 'Zero Dark Thirty seperti versi layar lebar dari serial Homeland dengan kualitas naskah dan teknis penyajian yang jauh lebih solid, menantang dan realistis, bahkan ia juga punya Claire Danes sendiri dalam sosok Jessica Chastain yang tampil fantastis.'),
(224, 'Yours Truly', 'POSITIF', 'DATA LATIH', 'Jarang-jarang bisa melihat thriller buatan lokal dengan kualitas sebaik ini, baik naskah maupun teknis penggarapannya, apalagi mengingat keduanya tidak perlu terlalu banyak menyuguhkan adegan berdarah apalagi penampakan para dedemit untuk dapat membuat anda duduk terpaku selama 16 menit.'),
(225, 'Young Adult', 'POSITIF', 'DATA LATIH', 'Seperti kebanyakan film Jason Reitman yang banyak dihiasi dengan karakter-karakter kompleks, Young Adult juga punya semua hal itu sebagai sebuah anti romcom dengan segala candaan gelap ala Diablo Cody yang tidak hanya sukses meninggalkan tawa namun juga kegetiran menusuk buat penontonnya yang diwakili melalui karakter Mavis Gary yang sukses dimainkan dengan sangat apik oleh Charlize Theron.'),
(226, 'Yasmine', 'POSITIF', 'DATA LATIH', 'Yasmine adalah pencapaian luar biasa. Kombinasi apik antara cerita keluarga sederhana yang berisi persahabatan, relasi ayah anak, pencarian jati diri, olah raga, rivalitas dan sedikit romansa serta komedi ringan bersama dukungan akting kuat dari pendatang baru Liyana Yus yang energik dan lovable. Di visualnya ada gambar-gambar cantik nan hangat dari bumi Brunei yang ditangkap kamera James Teh termasuk adegan pertarungan seru.'),
(227, 'X-Men: First Class', 'POSITIF', 'DATA LATIH', 'Ini adalah sebuah sebuah reboot hebat, sebuah prekuel luar biasa, sebuah suguhan summer movie first class dengan segala kemeriahan spesial efeknya, komposisi cast apik dan yang paling penting X-Men: First Class sudah siap memulai saga X-men yang baru.'),
(228, 'Wish. Hope', 'POSITIF', 'DATA LATIH', 'Bagian terbaik dari film yang meraih penghargaan film terbaik di ajang Oscar Korea, Blue Dragon Film Awards ke 34 selain premisnya yang provokatif tentu saja adalah penampilan dari para pemainnya. Ada aktor veteran Sol Kyung Gu yang kembali bermain apik sebagai ayah So Won.'),
(229, 'Wild Tales', 'POSITIF', 'DATA LATIH', 'Kepiawaian Damian Szifron meramu narasinya dengan cerdas dan efektif memberi efek emosional tersendiri. Meskipun memiliki asas dan benang merah yang sama, namun setiap segmen mampu berdiri sendiri dengan ciri khas masing-masing, dengan kekuatan dan pesona masing-masing.'),
(230, 'Whiplash', 'POSITIF', 'DATA LATIH', 'Whiplash itu rumit, energik dan meledak-ledak dalam prosesnya namun tidak sampai menjadi terlalu liar ketika Damien Chazelle memfokuskan musikalitasnya pada jazz yang penuh sinergi, kendali dan perhitungan. Ya, pada akhirnya Whiplash menjadi tontonan sederhana namun padat berisi ketika narasi simpelnya berhasil dikembangkan Chazelle sampai ke titik didih tertinggi yang mampu menyerang sisi psikologismu.'),
(231, 'Whip It', 'POSITIF', 'DATA LATIH', 'Drew Barrymore bisa bernapas lega karena debutnya sebagai seorang sutradara ternyata bisa dibilang cukup berhasil, setidaknya ia sukses menyampaikan pesan pada filmnya secara efektif dengan menghadirkan sebuah cerita ringan dengan balutan komedi yang segar dan juga pesan-pesan moral yang disampaikan dengan baik.'),
(232, 'When Marnie Was There', 'POSITIF', 'DATA LATIH', 'Meski kental dengan nuansa suram dan mencekam di beberapa adegannya, susah untuk memberi label horor kepada When Marnie Was There. Ya, ada nuansa kelam, duka dan kesepian dalam balutan surreal terpancar dari setiap pertemuan Anna dan Marnie, namun juga ada kelembutan di balik tragedi dan konfliknya yang berujung pada sebuah ending pahit manis menggetarkan.'),
(233, 'What We Do in the Shadows', 'POSITIF', 'DATA LATIH', 'Semua berhasil dirangkum dengan keriangan ala komedi hitam Selandia Baru yang kocak dengan sedikit bumbu gore berdarah-darah yang seperti ingin menegaskan bahwa ini masih berada di jalur horor meski diselimuti elemen komedi yang lebih tebal.'),
(234, 'Wer', 'POSITIF', 'DATA LATIH', 'Wer tetap adalah tontonan horor yang seru dan mendebarkan. Di separuh durasinya, Bell menginjeksinya dengan aksi cepat dan brutal, melibatkan pembantaian besar-besaran yang menghancurkan sekelompok anggota SWAT bersama dukungan spesial efek garapan Robert Hall dari Almost Human yang meyakinkan.'),
(235, 'Warrior', 'POSITIF', 'DATA LATIH', 'Warrior dengan segala pertarungannya yang keras, brutal dan kejam, sekejam tatapan Tom Hardy di sini ia tetap adalah sebuah drama olahraga keluarga yang lembut dan emosional. Gavin OConnor bisa dibilang sudah berhasil mengerjakan pekerjaannya dengan sangat baik. Salah satu yang terbaik tahun ini.'),
(236, 'Warm Bodies', 'POSITIF', 'DATA LATIH', 'Ini adalah tontonan yang menyegarkan sekaligus menyenangkan, saya menikmati 97 menit pengalaman menonton kisah zombie. Mungkin sedikit terasa dipaksakan di beberapa bagian, namun secara keseluruhan Jonathan Levine sudah melakukan tugasnya dengan baik dalam rangka menghadirkan sebuah versi lain dari romansa populer Romeo & Juliet dalam latar paska kiamat.'),
(237, 'War Photographer', 'POSITIF', 'DATA LATIH', 'Sebuah foto memiliki sejuta makna. Melalui War Photographer Christian Frei sukses menghadirkan sebuah pengalaman luar biasa menonton dokumenter. Sebuah dokumenter kuat di mana segala permasalahan tentang kemanusiaan, perang, sosial dan politik mampu terlihat berbeda melalui mata seorang fotografer hebat bernama James Nachtwey.'),
(238, 'Wadjda', 'POSITIF', 'DATA LATIH', 'Wadjda itu bagus dan membuatnya menjadi tontonan yang tidak mengada-ada. Tetapi seperti yang terjadi pada dirinya, jika Tuhan mengizinkan, selalu ada sedikit harapan akan sebuah kehidupan yang lebih baik di sana.'),
(239, 'Violet & Daisy', 'POSITIF', 'DATA LATIH', 'Fletcher menyajikannya dengan gaya komikal modern dengan sedikit sentuhan surreal, membagi-bagi satu jam setengah durasinya dalam 10 chapter pendek yang terus berlanjut dengan banyak kejutan-kejutan kecil. Di satu sisi, ini adalah sajian komedi hitam brutal yang menjadikan setiap momen pembunuhan brutalnya dengan cara yang santai, di satu sisi ini juga sebuah coming of age menarik .'),
(240, 'Vertigo', 'POSITIF', 'DATA LATIH', 'Secara keseluruhan hampir di semua segi Vertigo tampil sangat solid. Hitchcock tidak hanya mampu membuat sebuah kisah misteri yang mengusik rasa penasaran namun juga dengan pintar menempatkan penontonnya berada dalam posisi sama tidak tahunya dengan karakter Scottie, hingga nanti di pertengahan film Hitchcock memberikan sebuah jawaban mengejutkan yang akan menampar telak penontonnya. Naskah hebat tampaknya masih belum cukup jika tidak didukung dengan teknis penggarapan yang hebat pula.'),
(241, 'V for Vendetta', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah film, efek dahsyat memanjakan mata mungkin tidak sebanyak trilogi The Matrix, namun tetap saja kemunculan adegan-adegan aksi pemacu adrenalin tersebut muncul di saat yang tepat dan tidak terlalu berlebihan sehingga membuat segalanya menjadi terasa pas. Dan akhir kisah perjuangan kebebasan ini berhasil ditutup oleh sebuah adegan dahsyat yang menyisakan pesan moral bagi penontonnya.'),
(242, 'Upstream Color', 'POSITIF', 'DATA LATIH', 'Dua film, dua ide besar yang terbungkus dalam semangat fiksi ilmiah yang kental, tidak pernah mudah menghadirkan konsep-konsep brilian seperti yang sudah dilakukan Shane Carruth. Upstream Color adalah contoh sebuah fiksi ilmiah kecil yang mampu berbicara besar, sebesar tema tentang kehidupan, cinta dan takdir yang ditawarkan plus mengundang perdebatan asyik setelah menontonnya. Semuanya ini sukses dihadirkan dalam semangat indie ala Carruth yang memesona, subtle dan juga emosional.'),
(243, 'Unstoppable', 'POSITIF', 'DATA LATIH', 'Unstoppable adalah tontonan hiburan yang pas bagi anda para adrenalin junkie yang mendambakan ketegangan tanpa henti ala Tony Scott. Siapa lagi yang peduli soal cerita di saat momen-momen breathtaking super cepat tersebut tanpa sadar telah merasuki dan membuat napas anda tertahan cukup lama.'),
(244, 'Unknown', 'POSITIF', 'DATA LATIH', 'Porsi pas antara sisi misteri yang menarik, aksi seru nan menegangkan dan guyuran twist menarik membuat Unknown sudah lebih dari cukup untuk  menjadi sebuah suguhan thriller aksi yang layak tonton. Terlebih lagi ada sosok Liam Neeson di dalamnya yang belakangan mulai menunjukkan tajinya sebagai aktor laga baru nan menjanjikan.'),
(245, 'United', 'POSITIF', 'DATA LATIH', 'United menjadi personal buat para penggemarnya seperti yang sudah saya tulis di atas, karena ia mampu menginspirasi serta mengajak penontonnya untuk melihat bagaimana salah satu tim sepak bola paling hebat di jagat raya ini bangkit dari keterpurukan menjadi seperti yang kita lihat saat ini.'),
(246, 'Under the Shadow', 'POSITIF', 'DATA LATIH', 'Penampakan dan kejutan datang tak terduga dalam presisi yang tepat tanpa harus diekspos secara berlebihan, kadar seramnya juga dibangun oleh atmosfer tak nyaman yang dibarengi dengan kemampuan pemainnya yang memesona, hasilnya Under The Shadow menakutkan dengan caranya sendiri yang terbilang efektif dan pintar.'),
(247, 'Tyrannosaur', 'POSITIF', 'DATA LATIH', 'Studi karakter menjadi kunci utama bagaimana Tyrannosaur mampu tampil menggigit. Peter Mullan seperti biasa, aktor veteran ini memang piawai membawakan karakter pria keras bermasalah. Karakter Joseph itu menarik dan kompleks, bak bensin oktan tinggi yang mudah terbakar ketika ada sedikit percikan api saja yang menyentuhnya.'),
(248, 'Two Days, One Night', 'POSITIF', 'DATA LATIH', 'Jika premis tentang pilihan moral saja belum cukup, maka Dardenne membuatnya menjadi lebih pelik lagi ketika penontonnya juga dihadapkan pada  tokoh Sarah yang dimainkan cemerlang oleh Cotillard. Tidak peduli seberapa seringnya Sarah mengatakan ia dapat mengerti setiap penolakan, toh, kita langsung dapat melihat raut kekecewaan dari wajah meyakinkan Cotillard yang setia ditangkap melalui pergerakan kamera genggam sederhana, bersama take-take panjang khas Dardenne .'),
(249, 'Tucker & Dale vs Evil', 'POSITIF', 'DATA LATIH', 'Tucker & Dale vs Evil menjadi salah satu film langka nan unik yang berhasil membuat saya terpingkal-pingkal. Melihat bagaimana kelucuan demi kelucuan, kejutan demi kejutan mampu berjalan beriringan sempurna dengan elemen slasher adalah sebuah daya tarik terbesar dari film milik Eli Crai. Jarang-jarang ada horor komedi yang mampu tampil sesolid ini, apalagi mengingat film ini digarap dengan biaya murah dan sangat sederhana.'),
(250, 'Triangle', 'POSITIF', 'DATA LATIH', 'Triangle bisa dibilang adalah salah satu British horror film terbaik yang pernah dibuat oleh negara ratu Elizabeth itu. Film garapan Christopher Smith menawarkan sebuah pengalaman berbeda dari kebanyakan film sejenis dengan konsep cerita orisinal yang menggabungkan elemen thriller dan horror supernatural dengan balutan plot twist super rumit yang memaksa penontonnya untuk berkonsentrasi dan berpikir ekstra keras untuk dapat merangkai puzzle misteri yang ingin disampaikan film ini.'),
(251, 'Trance', 'POSITIF', 'DATA LATIH', 'Setelah 10 menit pembukaan yang sama memesonanya dengan penampilan James McAvoy, Trance terjerumus menjadi thriller rumit dan dalam. Ketiga karakter utamanya punya porsi yang seimbang, meskipun pada akhirnya Dawson yang menjadi jantung bagi narasinya yang kompleks. Tetapi yang terpenting dari semua kesenangan itu adalah Boyle tidak pernah kehilangan pesonanya dalam membungkus narasinya bersama ciri khasnya yang energik dan berkilau plus hantaman musik keren.'),
(252, 'Tjoet Nja'' Dien', 'POSITIF', 'DATA LATIH', 'Mungkin ini adalah biopik terbaik yang pernah dibuat oleh perfilman Indonesia, sebuah kisah sejarah tentang kepahlawanan penuh inspirasi dari seorang Cut Nyak Dien dalam usahanya merebut setiap jengkal tanah Rencong dari cengkeraman penjajah yang diisi dengan semangat patriotisme tinggi dan digarap dengan sangat serius bersama balutan teknis penyutradaraan luar biasa Eros Djarot plus dukungan para pemainnya yang hampir semuanya tampil solid, khususnya untuk penampilan cemerlang seorang Christine Hakim.'),
(253, 'This is the End', 'POSITIF', 'DATA LATIH', 'Humor-humornya mungkin tidak sampai terlalu lucu, tetapi bagaimana Rogen dan Goldberg menyajikannya dengan santai tanpa terlihat terlalu memaksakan diri itu yang membuat This is The End menjadi tontonan menyenangkan dan saya masih belum menyebut klimaksnya yang melibatkan iblis raksasa, pertobatan, surga dan Everybody (Backstreets Back), ya, This is the End mungkin menyajikan klimaks paling edan dari film-film komedi yang saya tonton beberapa tahun ini.'),
(254, 'The Yellow Sea', 'POSITIF', 'DATA LATIH', 'Dari segi teknis harus diakui Na Hong Jin sudah belajar banyak bagaimana harusnya mengeksekusi rangkaian adegan aksinya dengan baik, dan bagian itulah yang kemudian menjadikan The Yellow Sea terasa istimewa, apalagi pada akhirnya Na Hong Jin menutup rangkaian kisahnya ini dengan sebuah ending yang sempurna.'),
(255, 'Orphan', 'POSITIF', 'DATA LATIH', 'Yang membuat Orphan menjadi menarik adalah anak yang diadopsi bukanlah anak sembarangan, misteri tersebut ternyata mampu ditampilkan dengan baik dalam film yang diproduksi oleh Dark Castle Entertainment ini. Sepanjang kurang lebih 2 jam ini kita disuguhkan dengan suasana kelam penuh ketegangan dan rasa penasaran yang membuat para penontonnya setia menikmati adegan demi adegan yang ditampilkan.'),
(256, 'Osama', 'POSITIF', 'DATA LATIH', 'Adegan demi adegan ditampilkan secara real, tanpa adanya track musik film berbahasa Persia ini berjalan sangat alami, bahkan para pemainnya yang seluruhnya merupakan amatiran yang diambil dari jalan-jalan kota Kabul pun bermain sangat meyakinkan. Beberapa adegan simbolis juga tidak lupa disisipkan oleh Barmak sebagai bahan perenungan di akhir film nanti.'),
(257, 'Out of the Furnace', 'POSITIF', 'DATA LATIH', 'Out of Furnace berani mengambil resiko tak populer, sebuah jalan lain yang lebih berliku, lebih lama dan lebih terasa arthouse guna mencapai tujuannya dengan potensi besar menjadi sajian membosankan jika kamu tidak terlalu peduli dengan karakter-karakternya atau teknisnya yang ciamik.'),
(258, 'Pacific Rim', 'POSITIF', 'DATA LATIH', 'Rasanya seperti menjadi anak kecil lagi ketika menonton film ini, apalagi kalau bukan karena adegan-adegan yang membuat saya tepuk tangan di depan TV ketika masih seorang bocah, divisualisasikan dengan begitu realistis dan sangat masterful oleh seorang Guillermo del Toro.'),
(259, 'Pain & Gain', 'POSITIF', 'DATA LATIH', 'Para pemainnya sukses menjalankan peran mereka dengan baik, Whalberg yang  karismatik, Dwayne Johnson dengan peran yang sedikit berbeda plus Anthony Mackie yang asyik menjadi daya tarik utama  Pain & Gain, selain mungkin pesona Bay sendiri.'),
(260, 'Paper Towns', 'POSITIF', 'DATA LATIH', 'Paper Towns adalah drama remaja yang lengkap, ia punya romantika manis yang diwakili dengan perjuangan Q mencari sang pujaan hati yang hilang, sementara sisi misterinya meski tidak sampai terlalu kuat mampu bersatu dengan plot utama dan memberi warna tersendiri buat pergerakan kisahnya.'),
(261, 'Paranormal Activity', 'POSITIF', 'DATA LATIH', 'Paranormal Activity sudah menyajikan semuanya, segala ketakutan, kengerian dan keseraman sebuah horor rumah angker dengan style mockumentary yang realistis di sepanjang kurang lebih 1 jam setengah melalui rekaman-rekaman amatiran yang dibuat Micah dan pasangannya Katie dari setiap ruang di rumah mereka yang nyaman. Tidak perlu terlalu berlebihan karena Peli tampaknya tahu benar bahwa sesuatu yang tidak terlihat itu akan lebih menakutkan dan lebih efektif mempermainkan imajinasi liar penontonnya.'),
(262, 'Paul', 'POSITIF', 'DATA LATIH', 'Tidak dapat dimungkiri kolaborasi komedi British Amrik dari ketiganya yang cenderung banyak diisi candaan, hinaan, fiksi ilmiah dan bromance, ditambah dengan dukungan naskah menyenangkan dan teknik penyutradaraan energik dari Greg Mottola sudah menahbiskan Paul sebagai salah satu komedi terbaik tahun ini.'),
(263, 'Pencarian Terakhir', 'POSITIF', 'DATA LATIH', 'Affandi Abdul Rachman bisa dibilang sukses meramu sebuah sajian horor menantang dan menegangkan yang tidak melulu terjebak dalam pengeksploitasian penampakan-penampakan makhluk halus semata untuk membangun atmosfer kengeriannya, namun bagaimana sisi psikologis karakter-karakternya serta dukungan set yang meyakinkan yang bisa dibilang menjadi senjata utama film ini meneror rasa takut penontonnya sepanjang 110 menit.'),
(264, 'Perfect Sense', 'POSITIF', 'DATA LATIH', 'Cinta dan kiamat, kombinasi tidak biasa itu rupanya mampu menghadirkan tontonan fiksi ilmiah romance yang menarik. Perfect Sense bekerja dengan baik di sisi apokaliptik, mampu membuat penontonnya turut membayangkan kengerian jika suatu saat sampai benar-benar terjadi di dunia nyata.'),
(265, 'Philomena', 'POSITIF', 'DATA LATIH', 'Philomena adalah sebuah drama padat menggugah tentang pencarian, tidak hanya sekedar menjual narasi pencarian orang hilang dengan segala twist demi twist, namun juga sebuah sub teks tentang pencarian jati diri dari dari dua karakter utamanya, dua manusia berbeda yang dalam perjalanannya saling menguatkan satu sama lain.'),
(266, 'PK', 'POSITIF', 'DATA LATIH', 'PK adalah komedi satir sosial terbaik yang dimiliki Bollywood. PK adalah jenis film yang masih menyuapimu secara penuh dengan dialog-dialog pintar dan adegan konyol yang mengocok perut kamu. Tidak hanya itu, kekuatan film ini ada di tangan karakter utama, Aamir Khan yang kembali menunjukkan performanya dengan baik, mungkin kali ini adalah performa terbaik yang pernah ia tunjukkan. Tidak seemosional 3 Idiots, di beberapa adegan film ini terasa berlebihan, dan masih dibumbui dengan musik dan tarian yang asyik nan mengulur waktu.'),
(267, 'Poetry', 'POSITIF', 'DATA LATIH', 'Naskah yang luar biasa ini memang pantas diganjar penghargaan Cannes. Lee Chang Dong kembali sukses membuktikan bahwa dia adalah seorang pencerita yang luar biasa, sebuah narasi yang digarap dengan natural, indah dan penuh momen-momen membius didalamnya, plus kombinasi karakter kuat dan tema sederhana dan juga getir membuat Poetry hadir sebagai salah satu film terbaik tahun ini.'),
(268, 'Porco Rosso', 'POSITIF', 'DATA LATIH', 'Walaupun unsur fantasi dan magic mungkin tidak banyak ditampilkan di sini namun rupanya hal itu tidak mengurangi pesona film ini. Kejeniusan Miyazaki masih mampu menyihir kita dengan kekuatan ceritanya yang memadukan unsur-unsur heroisme, politik, petualangan serta romantisme dengan animasinya yang sangat detail dan penuh warna.'),
(269, 'Prisoners', 'POSITIF', 'DATA LATIH', 'Ini adalah sebuah studi karakter menarik nan kompleks yang berhasil disajikan Villeneuve melalui karakter sang ayah. Sementara karakter Detektif Loki oleh Gyllenhaal dengan reputasinya yang berhasil memecahkan semua kasus yang ditanganinya mendapat beban hebat ketika kasus penculikan ini seperti sulit menemui titik terang. Kedua karakter ini dibawakan dengan fantastis baik Jackman dan Gyllenhaal. Jackman memberikan lagi salah satu performa terbaiknya setelah Les Misarables, emosinya ketika melihat foto-foto pakaian putrinya itu adalah momen terbaiknya.'),
(270, 'Project Almanac', 'POSITIF', 'DATA LATIH', 'Plotnya memang generik, namun semua kesenangan time travel dengan balutan adrenalin muda plus penggunaan spesial efek tak berlebihan berhasil dituangkan dengan baik oleh Israelite. Kita bisa melihat bagaimana suasana cair bersama kekuatan chemistry yang berhasil dibangun dengan serius tapi santai sejak awal film. Project Almanac tidak pernah menjadikan dirinya sebuah film yang rumit, sebaliknya Israelite memberinya sedikit elemen persahabatan dan percintaan yang mampu bersanding manis dengan plot utamanya.'),
(271, 'Rabbit Hole', 'POSITIF', 'DATA LATIH', 'Rabbit Hole adalah sebuah contoh metafora sempurna tentang kepedihan, tentang bagaimana memaafkan masa lalu, tentang bagaimana mencoba membangun kembali puing-puing kehidupan yang berserakan dengan cinta sebagai perekatnya, Ya, semua momen-momen tersebut sukses dirangkai dengan sangat baik dan indah oleh Mitchell, dan semuanya menjadi semakin terasa lebih perfect dengan kehadiran para aktor dan aktrisnya yang bermain luar biasa. Ya, sambutlah Rabbit Hole, salah satu drama terbaik tahun lalu.'),
(272, 'Raging Phoenix', 'POSITIF', 'DATA LATIH', 'Thailand rupanya tidak hanya jago menakut-nakuti penontonnya dengan sajian horor mereka yang berkualitas, namun juga berhasil memukau dengan aksi-aksi bela diri luar biasa dalam film-film laga mereka, seperti Ong Bak dan Chocolate. Jadi bagi para fans martial arts film, Raging Phoenix layak untuk dijadikan pilihan.'),
(273, 'Ran', 'POSITIF', 'DATA LATIH', 'Digarap dengan teknik yang nyaris sempurna, baik dari teknik visual sinematografinya yang indah sekaligus suram dan pengembangan karakternya yang luar biasa membuat kita terbius menyaksikan adegan demi adegan yang ditampilkan hingga nantinya mencapai klimaksnya yang tragis.'),
(274, 'Rango', 'POSITIF', 'DATA LATIH', 'Di bawah arahan Gore Verbinski, Rango rupanya sudah melakukan semua yang dapat dilakukan oleh sebuah animasi berkualitas. Ia jelas menghibur, cerdas dalam bertutur dan berkelakar dengan cara yang tidak biasa tanpa melupakan kandungan moralnya. Setiap momen petualangan disajikan dengan apik dan seru.'),
(275, 'Red', 'POSITIF', 'DATA LATIH', 'Kudos pantas diberikan kepada para pemainnya yang bermain apik serta dapat memanaskan suasana, sekaligus juga membuktikan jangan meremehkan para orang tua, apalagi jika mereka tergabung dalam Red, karena meskipun wajah mereka sudah penuh dengan keriput, rambut sudah mulai botak atau memutih namun bukan berarti mereka tidak berbahaya.'),
(276, 'Rigor Mortis', 'POSITIF', 'DATA LATIH', 'Saya menikmati setiap menit Rigor Mortis. Ya, ini masih menjadi sajian horor menyenangkan, masih menawarkan sebuah nostalgia dari genre yang sudah lama terlelap, masih ada aroma eerie yang terpancar dari setiap sudut dan ruangan bangunan apartemen kumuh nan gelap yang menjadi latarnya.'),
(277, 'Rise of the Planet of the Apes', 'POSITIF', 'DATA LATIH', 'Rise of the Planet of the Apes kembali meneruskan tradisi hebat sebuah reboot. Di awal tahun siapa yang pernah menyangka bahwa ia mampu menjadi sebuah tontonan fiksi ilmiah seluar biasa ini. Penyutradaraan apik tanpa pernah menjadi terlalu berlebihan dan terlalu bertele-tele, naskah yang solid dan tepat sasaran serta performa hebat dari Andy Serkis dalam balutan Simpanse CGI juga tanpa melupakan elemen-elemen pendahulunya.'),
(278, 'Robot & Frank', 'POSITIF', 'DATA LATIH', 'Ini tidak hanya menjadi sebuah film tentang relasi antara manusia dan teknologi bernama robot, Robot & Frank jauh lebih dalam dan lebih manusiawi dari itu ketika ia mampu menghadirkan sebuah buddy movie unik dengan chemistry kuat tanpa harus menjadi terlalu melodramatis dan konyol. Ya, mungkin naskahnya tidak terlampau solid, mungkin juga terlalu berfokus pada diri Frank, namun tetap saja kehadiran sosok robotnya menjadi bagian tidak terpisahkan dari perjalanan hangat seorang manusia di usia tuanya yang sendiri dan kesepian, plus sebuah twist manis di penghujung ceritanya menjadikan segalanya begitu manis sekaligus menyentuh.'),
(279, 'Roman Holiday', 'POSITIF', 'DATA LATIH', 'Hepburn tampil begitu cantik dan memesona di semua scene, sukses membius saya atau mungkin juga para juri-juri Oscar pada saat itu dengan aura magisnya sebagai putri bangsawan yang anggun dan penuh keceriaan, sampai-sampai piala emas untuk aktris terbaik pun jatuh ke tangannya.\r\nYup, Roman Holiday adalah salah satu contoh bagaimana romcom yang bagus itu dibuat.'),
(280, 'Room', 'POSITIF', 'DATA LATIH', 'Sutradara Lenny Abrahamson bisa dibilang cukup piawai mengolah panggung rapatnya dengan maksimal, menghadirkan sebuah kelembutan dan kepolosan dari balik temanya yang keras nan suram. Naskahnya pun terasa begitu kuat karena Emma Donoghue sang empunya novel dilibatkan langsung dalam penulisannya. Selain dukungan narasi yang solid. Abrahamson banyak dibantu dengan penampilan gemilang Brie Larson dan Jacob Tremblay yang harus diakui menjadi alasan kenapa Room bisa bekerja dengan sempurna.'),
(281, 'Rurouni Kenshin', 'POSITIF', 'DATA LATIH', 'Rurouni Kenshin, sebuah adaptasi yang setia yang dibuat dengan dedikasi dan semangat besar untuk menyenangkan hati para fans manga dan anime. Sedikit lemah di naskah dan tipisnya pendalaman beberapa karakter utamanya namun sisanya berhasil ditutupi dengan production value yang mengesankan, baik visual, sinematografi, setting, scoring dan koreografi, dan terutama pada sektor casting yang meyakinkan.'),
(282, 'Rush', 'POSITIF', 'DATA LATIH', 'Rush punya presentasi yang sama baiknya dengan naskahnya. Howard jelas tahu benar bagaimana mendramatisasi sebuah biopik kelas satu bersama  dukungan teknis artistik fantastisnya. Setiap balapan tidak hanya terasa nyata ketika Howard dengan cerdas menggabungkan segala footage-footage asli dan desain produksi dan kostum era ''70, namun ia juga terlihat  cantik dan keren dengan segala efek slow motion dan guyuran hujan yang ditempatkan pada saat yang tepat tanpa harus terkesan berlebihan bersama dukungan sinematografi ciamik dari veteran Anthony Dod Mantle yang berpadu padan dengan scoring epik nan heroik sang master, Hanz Zimmer yang sukses menciptakan aroma magis dunia balap penuh emosi dan adrenalin yang tidak ada duanya.'),
(283, 'Safe Haven', 'POSITIF', 'DATA LATIH', 'Yap, seperti yang saya katakan di atas tadi, Safe Haven itu benar-benar romansa tipikal Nicholas Sparks yang cheesy dan mellow lengkap dengan visual indah dan scoring lembut. Semuanya sudah pernah kita lihat sebelumnya, jadi tidak ada yang benar-benar baru di sini kecuali wajah cantik penyanyi country dan jebolan Dancing with the Stars, Julianne Hough yang dipasangkan dengan Josh Duhamel plus sedikit elemen crime thriller bersama chemistry yang cukup bagus.'),
(284, 'Sang Penari', 'POSITIF', 'DATA LATIH', 'Sang Penari itu adalah film Indonesia yang sangat Indonesia. Sudah lama rasanya tidak ada film dengan berlatar sejarah dan budaya yang digarap sebaik dan seserius ini. Sang Penari jelas punya segalanya untuk menjadikan dirinya sebagai film terbaik yang dimiliki Indonesia tahun ini, atau tidak berlebihan jika saya menyebutnya sebagai salah satu yang terbaik sepanjang masa.'),
(285, 'Scenic Route', 'POSITIF', 'DATA LATIH', 'Momen bertahan hidupnya mungkin tidak sampai terlalu dalam, tetapi kombinasi persahabatan dan survival itu adalah sesuatu yang unik dan berhasil melebur dengan cukup baik bersama narasi kuat garapan Kyle Kille, elemen psikologis, kekuatan akting terbaik dari Duhamel dan chemistry solid bersama Fogler.'),
(286, 'Secretariat', 'POSITIF', 'DATA LATIH', 'Tetap saja bagi saya Secretariat mampu memberikan sebuah hiburan menyenangkan, sebuah feel good dan heartwarming drama yang layak untuk disaksikan bersama keluarga tercinta.'),
(287, 'Senna', 'POSITIF', 'DATA LATIH', 'Saya menyukai bagaimana sutradara asal Inggris keturunan India ini merangkum semua kekagumannya kepada sosok Senna. Bagaimana ia dan rekan penulis naskahnya, Manish Pandey mampu membuat sebuah dokumenter tampil layaknya sebuah drama biopik olahraga dengan segala unsur dramatis dan momen-momen emosionalnya.'),
(288, 'Senyap', 'POSITIF', 'DATA LATIH', 'Senyap bukan dokumenter biasa, ia adalah puisi dan teror yang menusuk hati kita sebagai penonton. Sebuah pengingat dan usaha keras bahwa kita harus berhenti, mengakui kehidupan yang telah dihancurkan, dan memaksa diri untuk mendengarkan kesenyapan yang menyusulnya. Adi yang selayaknya sebagai tukang kacamata keliling ini membantu kita melihat lebih jelas dalam kesenyapan, membantu mengobati sebuah miopia masal yang sedang kita alami di sekeliling kita, Sedangkan Joshua adalah perangkai dan penulis surat kesenyapan ini. Kedua orang ini sudah membuat Senyap sebagai film dokumenter paling powerful tahun ini.'),
(289, 'Seven Psycopaths', 'POSITIF', 'DATA LATIH', 'Seperti film McDonanght sebelumnya, Seven Psycopaths itu tetap santai dibalik temanya yang serius, begitu menyenangkan untuk diikuti karena efek sentuhan komedi gelap, kejutan-kejutan luar biasa, dialog-dialog pintar penuh sindiran sana-sini yang kocak dan disesaki oleh karakter-karakter sinting bermulut kotor, namun sekali lagi bintangnya tetap naskah brilian garapan McDonanght yang tersusun rapi lapis demi lapis.'),
(290, 'Sherlock Holmes', 'POSITIF', 'DATA LATIH', 'Semua kisah di atas itu berhasil dipresentasikan dengan baik oleh Ritchie. Aksi- aksi utama yang berlatar di dermaga dan Jembatan London juga digarap dengan spesial efek yang pas dan tidak terlalu berlebihan. Kemampuan Holmes dalam menganalisis sesuatu juga sangat menarik untuk dilihat.'),
(291, 'Shinobi: Heart Under Blade', 'POSITIF', 'DATA LATIH', 'Dan pada akhirnya ketika theme Song Heaven yang dikumandangkan oleh suara merdu Ayumi Hamasaki menutup kisah aksi romansa ini, ada sebuah perasaan yang tertinggal dari Shinobi: Heart Under Blade, bukan karena jualan adegan pertarungan aksi yang memang keren namun sebuah rasa kehilangan yang sukses ditularkan Oboro yang cantik nan malang, sebuah kisah cinta tak sampai yang harus diakui sudah meninggalkan kesan cukup dalam di benak saya.'),
(292, 'Shirome', 'POSITIF', 'DATA LATIH', 'Dari luar Shirome memang menawarkan premis menarik, menggabungkan sensasi kengerian sebuah urban legend kuno dan reality show modern yang diperankan oleh bintang pop sesungguhnya, apalagi mengetahui fakta bahwa Koji Shiraishi sama sekali tidak pernah memberitahu keenam gadis itu jika ia sedang membuat sebuah film horor, meninggalkan mereka dalam ketidak tahuan dan dikelilingi aktor-aktor serta spesial efek yang kemudian sukses menipu mereka, hasilnya apa yang akan anda lihat di sepanjang film ini murni reaksi terkejut dan ketakutan sesungguhnya dari para ABG ini.'),
(293, 'Short Term 12', 'POSITIF', 'DATA LATIH', 'Saya suka bagaimana Cretton memperlakukan karakternya, semua terlihat natural, kita bisa merasakan emosinya, merasakan bagaimana kepedihan mereka, terutama dari diri Marcus dan Grace yang dimainkan fantastis. Rasakan atmosfernya, nikmati dialog-dialog cerdasnya yang mengalir begitu bebas bersama balutan gambar-gambar cantik dan dukungan alunan musik latar dan soundtrack yang sama bagusnya.'),
(294, 'Shutter Island', 'POSITIF', 'DATA LATIH', 'Memang Shutter Island bukanlah karya terbaik dari seorang Martin Scorsese, namun setidaknya melalui film ini Scorsese sukses menghadirkan sebuah thriller psikologis mencekam dengan kualitas di atas rata-rata, apalagi ditunjang dengan segi teknis yang sangat baik dan penampilan apik dari aktor-aktor besar yang bermain di dalamnya'),
(295, 'Sicario', 'POSITIF', 'DATA LATIH', 'Jajaran casting bisa jadi salah satu andalan Sicario. Ada nama Emily Blunt didapuk menjadi karakter sentral dan harus diakui aktris Inggris ini kembali bermain baik menjalankan perannya, bukan karena hanya ia adalah satu-satunya perempuan di film yang didominasi oleh testosteron yang tangguh di luar dalam, sesuatu yang jarang kamu dapati di film sejenis, namun juga kompleksitas psikologis dan konsekuensi moral yang kemudian harus dihadapinya.'),
(296, 'Silver Linings Playbook', 'POSITIF', 'DATA LATIH', 'Silver Linings Playbook, sebuah romcom adaptasi pahit manis yang punya banyak kekuatan besar di dalamnya, naskah dan penyutradaraan solid dari David O. Russell, bagaimana piawainya menggabungkan semua tema kegilaan, studi karakter, romansa dan komedinya menjadi sebuah sinergi kuat yang akan menjebakmu dalam kurang lebih dua jam durasinya bersama penampilan para pemainnya yang ciamik.'),
(297, 'Snowden', 'POSITIF', 'DATA LATIH', 'Saya suka bagaimana Stone tahu benar mengeksplorasi sisi personal nan kompleks Edward yang didukung pula oleh performa solid dari Joseph Gordon Levitt. Kita tahu kapasitas Levitt, bagaimana akhir-akhir ini ia pintar memilih peran untuk menguji sampai di mana batas kemampuannya, bagaimana ia bertransformasi dari karakter fun ke karakter lebih serius, dan harus diakui Levitt memang memesona di setiap filmnya, terakhir ia juga bermain sangat bagus sebagai Philippe Petit dalam The Walk, sementara di Snowden, Levitt lagi-lagi tampil meyakinkan.'),
(298, 'Sokola Rimba', 'POSITIF', 'DATA LATIH', 'Tampil solid di narasi dan aktingnya, Sokola Rimba juga mendapatkan perlakuan istimewa di teknisnya.  Sinematografi ciamik dari Gunnar Nimpuno sukses besar mengeksploitasi eksotisnya Taman Nasional Bukit Dua Belas dengan segala keindahan flora dan sedikit faunanya, memberikan kita sebuah pengalaman menonton berbeda yang mungkin belum pernah kita lihat sebelumnya.'),
(299, 'Son of Saul', 'POSITIF', 'DATA LATIH', 'Nemes memang tidak terlalu mengeksploitasi kekejamannya dengan menghadirkan gambar-gambar tentang pembantaian itu secara gamblang namun caranya mengambil perspektif berbeda menjadi sesuatu yang istimewa.'),
(300, 'Tinker Tailor Soldier Spy', 'POSITIF', 'DATA LATIH', 'Ini adalah salah satu yang terbaik dari seorang Tomas Alfredson, sebuah thriller cerdas penuh konflik menarik dan parade akting memukau dari barisan aktor-aktor papan atasnya.'),
(301, 'Spirited Away', 'POSITIF', 'DATA LATIH', 'Menonton seluruh film ini terasa seperti sedang bermimpi, adegan demi adegan tak terduga mengalir dan begitu pas, banyak pesan tersembunyi dan karakter-karakter aneh yang tidak akan pernah kalian jumpai. Miyazaki menempatkan semacam emosi berbelit-belit di setiap konflik yang ada di filmnya membuat film ini lebih sekedar tontonan keluarga, saya yakin kalau setelah menonton film ini kalian tidak akan melupakan film ini selama beberapa bulan karena kesan yang didapat begitu melekat di kepala.'),
(302, 'Splinter', 'POSITIF', 'DATA LATIH', 'Mungkin banyak orang yang tidak menyangka, termasuk saya, bahwa sebuah film horror kecil seperti Splinter ini di luar dugaan mampu memberikan sebuah sajian horor dengan kualitas besar. Ya, film garapan sutradara sekaligus penulis naskah, Toby Wilkins ini mampu menjadi salah satu dari sedikit horror berbiaya rendah yang sukses mendobrak anggapan bahwa horor murah itu identik dengan horor kelas B yang hanya mengumbar cerita murahan.'),
(303, 'Spotlight', 'POSITIF', 'DATA LATIH', 'Ada keseimbangan luar biasa berhasil dibuat McCarthy di sini ketika menerjemahkan naskah adaptasinya. Kamu bisa merasakan keasyikan dari sebuah thriller investigasi dengan tensi yang terjaga rapi di saat tim melakukan penyelidikan sebagai jurnalis. Setiap pemainnya bermain begitu cemerlang membawakan peran mereka masing-masing sesuai kapasitasnya tanpa terlihat harus terlalu berlebihan. Sementara elemen dramanya juga bekerja sama bagusnya. Saya suka bagaimana McCarthy mengakhiri semuanya dengan cara yang begitu elegan dan berkesan, ya, itu adalah ending yang bagus dari sebuah film yang sama bagusnya.'),
(304, 'Spring Breakers', 'POSITIF', 'DATA LATIH', 'Ada James Franco yang tampil fantastis sebagai gangster rasta, bisa jadi ini peran terbaik Franco setelah 127 Hours yang menyakitkan itu. Penampilannya sebagai Alien mungkin terlihat seperi badut di awal-awal kemunculannya dengan segala logat anehnya, namun pertemuannya dengan para babes kuliahan itu merubah karakternya menjadi lebih manusiawi di penghujung film yang nantinya ditutup dengan Lights milik Ellie Goulding yang energik.'),
(305, 'St. Vincent', 'POSITIF', 'DATA LATIH', 'Plotnya mungkin familiar, bahkan kita mungkin tahu bagaimana ia berakhir tetapi Theodore Melfi punya kekuatan dari dukungan casting bagus yang mampu membuat segalanya menjadi berbeda. Bill Murray menjalankan peran yang biasanya dimainkan fantastis oleh Jack Nicholson dengan sama baiknya. Sementara lawan mainnya, si kecil Jaeden Lieberher juga tidak kalah bersinarnya. Di balik wajah imut, Lieberher memberi kekuatan seimbang buat Murray dengan segala kepolosan, kecerdasan dan mulut yang tidak kalah tajamnya.'),
(306, 'Star Trek', 'POSITIF', 'DATA LATIH', 'JJ Abrams sukses menghadirkan Star Trek versinya dengan kombinasi cerita yang kuat dan adegan-adegan aksi seru yang seimbang, apalagi ditunjang dengan dukungan efek CGI yang mumpuni menjadikan dunia Star Trek yang luar biasa dapat digambarkan dengan sangat baik dan mendetail di sini. '),
(307, 'Star Trek: Beyond', 'POSITIF', 'DATA LATIH', 'Pondasi yang kuat sudah dibangun oleh JJ Abrams di dua seri pertamanya secara tidak langsung sudah membuat versi modern Star Trek ini bisa menjadi begitu kuat, terutama dari eksplorasi karakter-karakter utama dan chemistry di antara mereka. Star Trek 2009 adalah permulaan baru yang luar biasa, sementara Star Trek Into Darkness yang rilis 4 tahun kemudian pun tidak kalah hebatnya, termasuk menampilkan kembali salah satu villain paling powerful.'),
(308, 'Starlet', 'POSITIF', 'DATA LATIH', 'Saya suka perpaduan kekontrasannya, antara tua dan muda, antara modern dan kuno, keglamoran dan kesederhanaan yang dileburkan dengan sangat manis oleh sebuah perjalanan mencari jati diri dalam penceritaan Baker dan Chris Bergoch yang tidak pernah mengendur. Narasinya memang terkesan sederhana, namun di balik itu ada sebuah kekompleksan tersendiri yang coba perlahan dijabarkan Baker melalui dua karakter utamanya.'),
(309, 'Steve Jobs', 'POSITIF', 'DATA LATIH', 'Steve Jobs memang tidak menawarkan sebuah plot konvensional yang mungkin akan membuat sebagian penontonnya tak nyaman, tetapi setiap momen penting dalam hidup Jobs berhasil dibentuk dalam sebuah narasi padat dalam bungkusan rangkaian dialog-dialog luar biasa yang mungkin hanya bisa dibuat oleh kepiawaian seorang Aaron Sorkin.  Setiap momen begitu efektif membius penontonnya.'),
(310, 'Still Alice', 'POSITIF', 'DATA LATIH', 'Dengan memberikan pondasi kuat pada karakter Alice, plotnya menjadi lebih menarik dalam perjalanannya memasuki konflik nanti. Kita melihat Alice sebagai sosok perempuan yang nyaris sempurna, ia punya segalanya sampai kemudian ia terancam kehilangan segalanya. Ada sebuah proses yang berhasil dirangkum Glatzer dan Westmoreland dengan menggunakan pendekatan intim, depresif dan heartbreaking tanpa harus terkesan berusaha keras memanipulasi penontonnya dengan tetek bengek momen melodrama sentimentil.'),
(311, 'Straw Dogs', 'POSITIF', 'DATA LATIH', 'Sama seperti pendahulunya Straw Dogs buatan Rod Lurie ini bukan thriller yang terlampau istimewa, ia masih menawarkan cerita yang sama, karakter sama, dan pesan yang sama, tapi kemudian menjadi menarik karena ia disajikan dalam kemasan modern yang lebih menyegarkan, lebih mengasyikkan, lebih brutal, dan tentu saja lebih seksi ketimbang apa yang sudah dibuat versi aslinya 4 dekade lalu.'),
(312, 'Suicide Club', 'POSITIF', 'DATA LATIH', 'Suicide Club bisa dibilang adalah suguhan J-horror unik, aneh dan juga absurd, namun d isisi lain juga sebagai sebuah studi moral tentang gejolak sosial yang berkembang di masyarakat yang disajikan Sion Sono melalui rangkaian simbolisme dan metafora mengerikan di dalamnya.'),
(313, 'Sunny', 'POSITIF', 'DATA LATIH', 'Hangat, manis, kocak dan menyentuh, tidak ada drama Korea Selatan tentang persahabatan yang digarap sebaik ini sebelumnya. Ini adalah jenis film yang mampu memberikan efek langsung kepada penontonnya, membuat anda memikirkan, hei, bagaimana ya kabar teman-teman SMU dan SMP? Sunny akan membuat anda mengingat kembali masa-masa luar biasa itu.'),
(314, 'Super', 'POSITIF', 'DATA LATIH', 'Super sukses menempatkan dirinya sebagai sebuah drama superhero yang menarik, menghibur dan juga bisa dibilang gila. Perpaduan nyeleneh antara Kick-Ass dan Defendor. Sebuah black comedy dewasa, depresif dan brutal yang kemudian membungkus dirinya dengan sebuah satir sosial tentang kisah kepahlawanan dan pencarian jati diri seorang anak manusia dalam mencari tujuan hidupnya. Di beberapa poin Super bahkan terlihat lebih baik dari Kick-Ass.'),
(315, 'Swiss Army Man', 'POSITIF', 'DATA LATIH', 'Hal positif lainnya dari Swiss Army Man adalah kepiawaian Scheinert dan Kwan mengarahkan ke mana filmnya akan dibawa. Menjadikannya sulit ditebak, hingga ditutup dengan konklusi yang cukup menarik dan tak disangka-sangka. Swiss Army Man berhasil membawa sajian yang orisinal dan berbeda dengan suasana yang menyenangkan.'),
(316, 'Tabula Rasa', 'POSITIF', 'DATA LATIH', 'Ada nilai-nilai dan pesan besar di baliknya setiap rendang Batokok dan gulai kepala ikan, pesan-pesan tentang keragaman sosial-budaya, spirit gotong royong yang mulai memudar, tentang menyatukan perbedaan dalam semangat Bhinneka Tunggal Ika, tentang bagaimana untuk tidak pernah menyerah dalam menjalani hidup sesusah apapun itu dan tentang kesempatan kedua untuk memulai segala sesuatu kembali tanpa prasangka, seperti arti dari judulnya yang manis.'),
(317, 'Talaash: The Answers Lies WIthin', 'POSITIF', 'DATA LATIH', 'Naskah olahan Reema Kagti yang juga bertindak sebagai sutradara bersama bantuan rekannya Zoya Akhtar tersaji rapi, membuatmu mau tidak mau tejebak dalam pusaran teka-teki yang juga akan mengajakmu untuk bermain menjadi seorang detektif bersama Aamir Khan dengan kumis aneh dan muka jutek guna menerka-nerka apa yang sebenarnya terjadi di sana.'),
(318, 'Tanda Tanya', 'POSITIF', 'DATA LATIH', 'Di atas itu semua, Hanung sebagai sutradara berhasil menjadi dirigen yang baik, yang menyatukan kekuatan pendukung filmnya menjadi sebuah sajian yang lengkap, dihadirkan dalam rangkaian cerita yang mengena plus berbalut tatanan teknis yang mumpuni seperti sinematografi ciamik dari Yadi Sugandi yang berhasil menangkap gambar-gambar cantik perkampungan Pasar Baru.'),
(319, 'Tangled', 'POSITIF', 'DATA LATIH', 'Kisah putri dengan rambut sepanjang 70 kaki ini mampu dikemas dengan sangat baik, bersahabat dan menghibur plus balutan animasi dengan kualitas jempolan menjadikan Rapunzel cukup pantas untuk disejajarkan dengan animasi klasik terbaik Disney lainnya.'),
(320, 'Taxi Driver', 'POSITIF', 'DATA LATIH', 'Taxi Driver jelas adalah salah satu karya terbaik dari Martin Scorsese, dengan cerita yang kuat dan dengan dukungan aktor sekaliber Robert De Niro membuat film ini mampu memberikan sebuah gambaran yang cukup realistis tentang kehidupan masyarakat Amerika, khususnya masyarakat kota New York pada era ''70 lengkap dengan segala konflik sosial yang terjadi pada masyarakatnya.'),
(321, 'Terminator Genisys', 'POSITIF', 'DATA LATIH', 'Sang Terminator uzur dibalut dengan kulit sintetis yang menyelubungi tulang-belulang bajanya. Kulit bukan hanya sekedar kulit mirip manusia, namun juga mampu menua dan mengeriput layaknya sebuah kulit alami belum lagi Taylor memberi sentuhan humanis buat karakternya. Elemen ini yang kemudian mampu membuat terminator versi Genisys menjadi jauh lebih manusiawi ketimbang seri-seri sebelumnya lengkap dengan joke-joke one liner khas Arnie.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(322, 'Testament of Youth', 'POSITIF', 'DATA LATIH', 'Ini adalah biopik yang indah, setidaknya secara fisik yang terlihat kasat mata itulah faktanya. Dari menit-menit awal ia dibuka, Testament of Youth menampilkan lanskap-lanskap cantik, memancarkan sebuah aroma tenang namun sendu yang diperkuat dengan scoring garapan komposer Jerman-Inggris Max Richter yang lembut, meskipun di bagian pembuka ada wajah sedih dari karakter utama kita sebelum filmnya melompat beberapa tahun ke belakang.'),
(323, 'That Evening Sun', 'POSITIF', 'DATA LATIH', 'That Evening Sun adalah sebuah drama dengan semangat indie yang kental. Ceritanya yang simpel tidak membuat film satu ini kehilangan pesan-pesan kuatnya. Pesan tentang bagaimana manusia mempertahankan kenangan masa lalu yang menurutnya sangat berharga, pesan tentang pelajaran hidup, bahkan untuk orang lanjut usia sekalipun. Semuanya disajikan dengan kesederhanaan dan dukungan akting realistis dari para pemainnya.'),
(324, 'That Thing Called Tadhana', 'POSITIF', 'DATA LATIH', 'Tidak banyak film-film produksi Philipina yang saya tonton, namun beruntung, saya selalu sukses mendapatkan film-film bagus ketika mencoba menontonnya, misalnya, seperti komedi romantis indie milik sutradara pemula Antoinette Jadaone yang direkomendasikan oleh teman dan suhu saya dari Movievora. That Thing Called Tadhana bisa dibilang adalah kejutan yang benar-benar menyenangkan.'),
(325, 'The Accountant', 'POSITIF', 'DATA LATIH', 'OConnor mampu memaksimalkan karisma Ben Affleck yang tampil oke di sepanjang film sebagai sosok tangguh, unik dan penuh kejutan. Tidak banyak adegan aksi yang dihadirkan namun ketika ada itu bisa sangat berkesan, lihat saja bagaimana koreografi aksinya dibuat dengan sangat baik, baik baku hantam jarak dekat atau menggunakan senjata begitu efektif, begitu mematikan tanpa harus terlihat berlebihan, yah, sedikit banyak mengingatkan saya pada John Wick yang keren itu.'),
(326, 'The Act of Killing', 'POSITIF', 'DATA LATIH', 'Apa yang disajikan Joshua Oppenheimer secara berani, provokatif,  jujur dan blakblakan ini seperti menjadi sebuah kenyataan pahit yang pada akhirnya harus kita terima, suka atau tidak.'),
(327, 'The Adventures of Tintin', 'POSITIF', 'DATA LATIH', 'Cepat, seru dan sangat menyenangkan. Sebuah tontonan yang tidak hanya ditujukan buat para veteran Tintin, tapi untuk siapa saja yang menyukai film petualangan yang menghibur. Yap, itulah yang saya rasakan dalam debut animasi perdana seorang Steven Spielberg. Spielberg tidak hanya sukses membuat Tintin merasakan kembali kejayaannya seperti yang pernah dialaminya beberapa dekade lalu, tapi bersama Peter Jackson ia juga sudah membuat sosok reporter yang haus petualangan dan misteri ini dan dunia di dalamnya menjadi terlihat jauh lebih bagus dan tentunya lebih hidup dari komiknya dalam balutan animasi yang luar biasa.'),
(328, 'The Age of Adaline', 'POSITIF', 'DATA LATIH', 'Disajikan dengan pace yang terjaga baik, membuat 112 menit terasa terbang begitu cepat. Teknis visual dihadirkan dengan lembut oleh David Lanzenberg, memancarkan aroma misterius sekaligus romantis. Tetapi kekuatan terbesar The Age of Adaline tidak hanya pada konsep fiksi ilmiahi fantasinya, tetapi juga pada diri Blake Lively yang tampil fantastis menggerakkan narasinya, tidak hanya pesona fisik dan kecantikannya namun bagaimana ia mengisi jiwa Adaline dengan sempurna lengkap dengan kekuatan dan kerapuhannya.'),
(329, 'The Artist', 'POSITIF', 'DATA LATIH', 'Jajaran pemainnya tampil solid, bahkan penampilan apik dari Jean Dujardin dan Berenice Bejo yang mungkin membuat anda percaya bahwa mereka adalah aktor dan aktris yang terlahir 100 tahun lalu, khususnya Dujardin yang sukses menghadirkan pesona kuat sebagai George Valentin, tidak heran jika kemudian ia banyak memperoleh penghargaan bergengsi di berbagai ajang penghargaan film Internasional. Dariadegan pembuka yang hebat, momen mimpi George yang mengejutkan sampai puncaknya, sebuah suguhan kolaborasi tap dance cantik dan dialog bersuara pertama, siapa yang kemudian menyangka bahwa The Artist dalam perjalanannya mampu menyeruak sebagai salah satu kandidat film terbaik tahun ini. '),
(330, 'The Bang-Bang Club', 'POSITIF', 'DATA LATIH', 'Melihat pekerjaan bagus yang sudah dibuat Steven Silver di sini dalam menghadirkan sebuah biopik semi dokumenter kisah nyata dari 4 orang foto jurnalis paling berani di dunia ini saya yakin bahwa novel The Bang-Bang Club pasti adalah sebuah bacaan yang bagus, sebagus filmnya yang mampu menginspirasi dan  menggugah sisi emosional saya di saat bersamaan.'),
(331, 'The Best of Me', 'POSITIF', 'DATA LATIH', 'Beruntung kisah percintaan dewasa di era kini digarap lebih baik. Adalah pesona James Marsden (ia menggantikan posisi almarhum Paul Walker) yang terlihat tua dan bijak serta kelembutan Michelle Monaghan berhasil menciptakan chemistry kuat.'),
(332, 'The Big Short', 'POSITIF', 'DATA LATIH', 'Dengan jajaran pemain sementereng ini, susah untuk tidak terpikat dengan The Big Short terlepas tidak atau tahunya kamu tentang apa yang ditawarkan isinya. Buat saya ini adalah sebuah pengalaman menonton sembari belajar yang mungkin paling menyenangkan yang bisa didapat dari sebuah film, dan sekali lagi saya katakan, Adam McKay adalah dosen ekonomi terbaik yang pernah saya jumpai.'),
(333, 'The Blind Side', 'POSITIF', 'DATA LATIH', 'Bagaimanapun The Blind Side tetap adalah sebuah drama ringan, menghibur dan yang terpenting mampu memberikan inspirasi kepada penontonnya, apalagi bila mengingat film ini diadaptasi dari kisah nyata. Tidak perlu harus mengerti American football untuk menyaksikannya, cukup duduk santai dan nikmati saja segala nilai kebaikan-kebaikan yang diberikan film ini.'),
(334, 'The Book Thief', 'POSITIF', 'DATA LATIH', 'The Book Thief punya casting bagus yang setiap karakternya penuh dengan kehangatan dan harapan di balik latar perang dan musim salju yang dingin. Geoffrey Rush membawa kembali pesona kebapakannya pasca The Kings Speech, menjadi pria paruh dengan hati yang besar dan permainan akordion yang mendamaikan. Emily Watson tampil prima sebagai Rosa, ibu angkat galak namun penyayang lengkap dengan aksen Jerman yang sempurna.'),
(335, 'The Borrower Arriety', 'POSITIF', 'DATA LATIH', 'Jelas bukan yang terbaik, namun juga bukan yang terburuk, The Borrower Arriety kembali hadir menambah daftar panjang tradisi animasi-animasi hebat jebolan Studio Ghibli yang legendaris itu, apalagi, meskipun kali ini mereka tidak memasang duo jagoannya untuk duduk di bangku sutradara, namun kehadiran Hiromasa Yonebayashi sebagai sutradara termuda yang pernah dimiliki Ghibli rupanya mampu mengusung semangat yang sama dengan para seniornya itu dalam menghadirkan animasi tradisional berkualitas.'),
(336, 'The Changeling', 'POSITIF', 'DATA LATIH', 'Klasik! Mungkin kata yang tepat untuk menggambarkan The Changeling sebagai suguhan horor rumah hantu. Mungkin tidak ada yang baru di sini jika anda menontonnya sekarang, tapi tetap saja saya harus angkat jempol buat Peter Medak yang menggarapnya dengan penyajian teknis yang rapi serta tidak pernah kehilangan sentuhan angkernya, membuat The Changeling menjadi salah satu horor jadul yang masih tetap segar ditonton sampai saat ini.'),
(337, 'The Conjuring', 'POSITIF', 'DATA LATIH', 'Faktanya The Conjuring memang sajian yang menakutkan, dan James Wan sukses mendramatisasi kisah nyatanya menjadi sajian horor supernatural seru dan cerdas yang nantinya bakal dikenang cukup lama.'),
(338, 'The Cove', 'POSITIF', 'DATA LATIH', 'The Cove adalah salah satu dari sedikit film dokumenter yang disajikan secara luar biasa, tidak hanya mendidik namun juga akan menghibur karena berani menyajikan sebuah tontonan penuh ketegangan yang ditampilkan secara nyata, dan yang terpenting adalah dapat menginspirasi penontonnya.'),
(339, 'The Crow', 'POSITIF', 'DATA LATIH', 'The Crow bisa dibilang adalah salah satu film adaptasi komik terbaik yang pernah dibuat, film dengan cerita cinta yang tragis dan gelap ini sukses melambungkan nama seorang Brandon Lee sebagai ikon gothic terkenal di jamannya, walaupun nasib baik rupanya tidak berpihak kepadanya.'),
(340, 'The Crucible', 'POSITIF', 'DATA LATIH', 'Provokatif, inspiratif dan depresif, The Crucible termasuk cukup baik menghadirkan segala horor tentang kekerasan seksual pada anak bawah umur dengan gamblang. Naskah adaptasinya mungkin tidak sempurna dan terlalu dramatis, tapi bagaimanapun ini adalah tonton drama yang membuat hati nurani terkoyak, terlebih para pemain ciliknya juga mampu tampil begitu meyakinkan membawakan peran mereka.'),
(341, 'The Dark Knight', 'POSITIF', 'DATA LATIH', 'Sutradara 41 tahun ini menaikkan tensi plot dengan megah, menggeber banyak klimaks kecil yang pada akhirnya meledakkannya dengan berbagai twist sejak pertengahan film. Dimulai dengan adegan pembuka menarik di mana secara bersamaan Nolan juga memperkenalkan sosok Joker dengan rencana perampokan bank jeniusnya, pencidukan karakter antagonis, pesta pra kampanye Harvey Dent yang disambangi Joker hingga kejar-kejaran tegangan tinggi antara mobil boks dan truk pun dibesut dengan sangat baik oleh Nolan.'),
(342, 'The Deep End', 'POSITIF', 'DATA LATIH', 'Di sepanjang film kita tidak hanya merasakan sebuah suspense tingkat tinggi ala crime thriller yang meskipun hanyaada di ruang lingkup sederhana namun berhasil memberikan getaran-getaran besar nan efektif memancing rasa penasaran kita. Sementara di sisi lain drama kemanusiaannya juga tampil sama memesonanya.'),
(343, 'The Den', 'POSITIF', 'DATA LATIH', 'Tidak ada rasa bosan seperti yang sering kamu dapati di film-film mocku horor lainnya karena Donohue membangun plotnya dengan cerdas dari awal, memberi terlebih dahulu penontonnya sesuatu yang intim dan menarik terutama ketika melihat bagaimana ia memaksimalkan akting Melanie Papalia sebagai Liz.'),
(344, 'The Disappearance of Alice', 'POSITIF', 'DATA LATIH', 'Pintar, begitulah saya menggambarkan The Disappearance of Alice Creed, sebuah crime thriller debut Blakeson ini ternyata benar-benar mampu menyajikan sebuah suguhan kisah kriminal cerdas penuh ketegangan nyaris tanpa henti sepanjang 98 menit.'),
(345, 'The Duff', 'POSITIF', 'DATA LATIH', 'Tidak terlalu banyak romcom komedi remaja era milenium yang mampu meninggalkan kesan mendalam yang setelah beberapa lama filmnya dirilis. Masih mampu kamu ingat jika kemudian ada orang yang menanyakan, Hei, apa sih romcom remaja yang bagus? Jawabannya mungkin tidak jauh-jauh dari Mean Girls dari Mark Water dengan dukungan ensemble cast perempuan yang luar biasa atau mungkin juga pesona luar biasa Emma Stone yang mempu membuat Easy A susah untuk dilupakan. Dan saya senang bisa menemukan dan memasukkan The Duff ke dalam salah satu romcom remaja terbaik yang pernah dibuat di era twitter saat ini.'),
(346, 'The Edge of Tomorrow', 'POSITIF', 'DATA LATIH', 'Tom Cruise memang masih menjadi magnet terbesar buat The Edge of Tomorrow, meskipun kamu tidak tahu apa-apa soal premisnya, tetapi melihat sang action man pujaan mengenakan baju zirah canggih di posternya itu jelas akan memancing penonton awamnya, dan sekali lagi Cruise memang memberikan performa kuat buat karakternya seperti yang sering dilakukannya di film-filmnya. Lalu di sebelahnya ada Emily Blunt yang seperti saya bilang di atas tampil badass sebagai heroine tempur hebat, mencuri perhatian sejak kemunculannya yang dahsyat dan chemistry bersama Cruise.'),
(347, 'The Evil Dead', 'POSITIF', 'DATA LATIH', 'Evil Dead atau yang dikenal dengan nama lain The Book of the Dead ini memang layak menyandang predikat salah satu cult horror klasik terbaik. Hanya dengan biaya seadanya tidak membuat seorang Sam Raimi ciut untuk dapat menghadirkan sebuah tontonan sekaligus obat penghasil mimpi buruk paling manjur bagi penontonnya'),
(348, 'The Fifth Estate', 'POSITIF', 'DATA LATIH', 'Ritmenya dijaga stabil, dibangun dengan perlahan sejak awal dan kemudian terasa tensinya naik setiap kali Assange menemukan rahasia baru untuk dibagi sampai puncaknya, tentu saja Cablegate yang menggegerkan dunia itu dengan segala elemen politiknya.'),
(349, 'The Fighter', 'POSITIF', 'DATA LATIH', 'Beruntung seorang David Russel memiliki jajaran pemain-pemain hebat yang mampu menghidupkan setiap momen-momen emosional dalam The Fighter. Kombinasi kisah nyata, penyutradaraan dan akting yang luar biasa menjadikan The Fighter salah satu yang terbaik di genrenya.'),
(350, 'The Fly', 'POSITIF', 'DATA LATIH', 'Usia body horror David Cronenberg satu ini memang sudah 25 tahun, tapi pesona menakjubkan remake The Fly tidak pernah luntur oleh waktu dikarenakan elemen-elemen pendukung kuat di dalamnya. Ia simpel namun juga kompleks , Jeff Goldbum dan Geena Davids memberikan akting hebat mereka, dan tentu saja  ia sangat menghibur dan mengerikan sebagai sebuah horor fiksi ilmiah dengan segala teknik spesial efek serta tata riasnya yang mengagumkan dan  juga menjijikkan di saat bersaman. Klasik!'),
(351, 'The Fourth Kind', 'POSITIF', 'DATA LATIH', 'Sang sutradara terbilang cukup berhasil menciptakan sebuah atmosfer penuh kengerian dan ketegangan berbalut adegan-adegan disturbing yang mampu membuat bergidik penontonnya. Plot yang sebenarnya sederhana dibuat sedemikian rupa sehingga menimbulkan kesan rumit, sehingga tidak jarang penontonnya diajak untuk ikut berputar-putar dalam memecahkan teka-teki tentang apa yang sebenarnya terjadi.'),
(352, 'The Gift', 'POSITIF', 'DATA LATIH', 'The Gift sendiri bisa dibilang adalah langkah besar buat Edgerton, selain menjadi salah satu tokoh utamanya, ia juga menuliskan naskah serta produser, namun yang terpenting, The Gift menjadi debut pertama Edgerton sebagai sutradara, dan lagi-lagi harus diakui, ia menjalani tugasnya dengan sangat baik.'),
(353, 'The Girl who Leapt Through Time', 'POSITIF', 'DATA LATIH', 'The Girl Who Leapt Through Time milik Taniguchi mungkin tidak akan memuaskan semua pihak, terutama bagi mereka yang sudah terlanjur menyukai versi anime yang lebih dahulu populer. Banding membandingkan pun dipastikan akan terjadi setelah menonton film ini, namun sekali lagi setiap versi pasti memiliki kelebihan dan kekurangannya sendiri, namun jika anda penyuka drama romantis ketimbang fiksi ilmiah, film ini bisa sangat menyenangkan sekaligus menyedihkan.'),
(354, 'The Girl with the Dragon Tattoo', 'POSITIF', 'DATA LATIH', 'Lagi-lagi sebuah adaptasi luar biasa dari seorang David Fincher. Lebih bagus dan lebih mencekam dari versi aslinya tanpa harus banyak mengkhianati novelnya. Dan siapa yang menyangka jika Rooney Mara mampu tampil sebaik ini sebelumnya. Sebuah thriller cerdas dan berani, salah satu yang terbaik dari David Fincher.'),
(355, 'The Good, the Bad, and the Weird', 'POSITIF', 'DATA LATIH', 'Kombinasi barat dan timur dalam balutan ala film-film koboi belum pernah tercampur seasyik dan sekreatif ini. Dengan kemampuannya meracik elemen aksi, petualangan, komedi dengan gayanya yang keren, The Good, The Bad, The Weird mampu bergerak lancar tanpa harus kehilangan elemen klasik dari inspirasi western lawasnya, sebaliknya dengan sentuhan modern, Kim Jee Won berhasil menjadikan The Good, The Bad, The Weird sebagai sebuah sajian unik yang seru dan menyenangkan.'),
(356, 'The Grand Budapest Hotel', 'POSITIF', 'DATA LATIH', 'Bagian terbaik dari The Grand Budapest Hotel adalah segalanya. Ya, segalanya. Jika kamu menganggap apa yang dilakukan Anderson kemarin dalam Moonrise Kingdom sudah kamu anggap luar biasa, maka bersiaplah, karena The Grand Budapest Hotel punya kadar jauh lebih dahsyat, meskipun harus diakui masih belum mampu menyaingi  The Royal Tenenbaums. Namun satu hal bisa dipastikan The Grand Budapest Hotel itu seru.'),
(357, 'The Great Passage', 'POSITIF', 'DATA LATIH', 'Dibungkus oleh tone hangat dan selipan joke ringan, perjalanan pembuatan kamus ala Yuta menjadi  sebuah proses menyenangkan, dan ketika klimaksnya datang menjemput, ada sebuah perasaan haru dan emosional melihat bagaimana pada akhirnya semua bisa tercapai setelah apa yang mereka lalui selama itu.'),
(358, 'The Grey', 'POSITIF', 'DATA LATIH', 'Naskahnya memang tidak istimewa, tapi bagaimana Joe Carnahan menyajikannya menjadi sebuah tontonan yang mencekam itulah yang menjadikan The Grey menarik. Dan Liam Nesson masih tampil garang dan lembut seperti biasanya memesona dengan karakternya yang garang dan lembut'),
(359, 'The Handmaiden', 'POSITIF', 'DATA LATIH', 'The Handmaiden menjadi tontonan menarik, tidak hanya karena ia dipenuhi oleh trademark Chan Wook, dari teknis artistik jempolan, sinematografi cantik, performa gemilang dari Kim Min Hee dan pendatang baru, Kim Tae Ri serta  tentu saja tidak ketinggalan darah dan kebrutalan dalam kanvas thriller yang gelap dan penuh belitan dan kejutan, tetapi The Handmaiden kemudian menjadi terasa lebih spesial karena ketika Chan Wook turut memasukkan tema lesbian nan kontroversial.'),
(360, 'The Hangover', 'POSITIF', 'DATA LATIH', 'The Hangover resmi menjadi salah satu film komedi favorit saya. Penyutradaraan yang bagus, naskah yang berkualitas, apalagi untuk ukuran film komedi, banyolan komikal serta rangkaian twist mengejutkan dan menyenangkan hingga jajaran pemain yang bermain gemilang menjadikan film ini sebuah paket hiburan lengkap.'),
(361, 'The Hateful Eight', 'POSITIF', 'DATA LATIH', 'Setiap dialog didukung oleh materi yang bagus termasuk di dalamnya isu-isu sensitif tentang ras pasca perang konfederasi dan pencarian keadilan yang mampu bersinergi lancar bersama joke-joke verbal menggelitik dan tensi ketegangan yang terjaga konsisten.'),
(362, 'The Help', 'POSITIF', 'DATA LATIH', 'The Help itu memiliki jajaran pemain luar biasa, bisa jadi ini adalah elemen yang paling kuat ketimbang naskahnya yang santai itu. Nyaris semua pemainnya mampu menghadirkan akting prima, lihat saja duo maut Viola Davis dan Octavia Spencer yang begitu hebat membawakan karakter para pembantu pemberani, tidak ketinggalan Jessica Chastain yang memesona, atau si cantik Bryce Dallas Howard yang secara mengejutkan juga bisa tampil sangat menyebalkan.'),
(363, 'The Hole', 'POSITIF', 'DATA LATIH', 'The Hole termasuk berhasil menjalankan tugasnya dengan baik. Dante mampu membangun dam mengeksekusi kisahnya yang sebenarnya sederhana menjadi sebuah sajian menghibur..'),
(364, 'The House of the Devil', 'POSITIF', 'DATA LATIH', 'The House of the Devil adalah sebuah horor menyenangkan, sebuah tontonan yang menghasilkan efek de javu manis dari seorang sutradara muda yang begitu mencintai horor-horor jadul, mengajak para penontonnya untuk kembali bernostalgia dengan keseraman dan ketegangan ala horor era ''80 lengkap dengan segala pernak-pernik pendukungnya'),
(365, 'The Hunt', 'POSITIF', 'DATA LATIH', 'Mads Mikkelsen lulus dengan nilai dekat dari sempurna dalam memerankan Lucas. Aktingnya sangat restrained, tetapi semua emosi seolah dipancarkan oleh mata dan bahasa tubuhnya.'),
(366, 'The Ice Man', 'POSITIF', 'DATA LATIH', 'Dua elemen yang bertolak belakang plus karisma dingin seorang Shannon kemudian sukses melebur menjadi satu dalam sebuah plot crime thriller intens nan cepat yang tersaji secara periodik dan penuh kejutan.'),
(367, 'The Illusionist', 'POSITIF', 'DATA LATIH', 'Meskipun tipis peluangnya untuk memenangkan animasi terbaik,  namun  menyenangkan sekali rasanya masih ada animasi 2D tradisional yang ternyata mampu berbicara banyak dalam ajang Oscar tahun ini di tengah gempuran animasi-animasi CGI berbasis 3D.  Yup, Sylvain Chomet lagi-lagi membuktikan hal tersebut lewat The Illusionist, sebuah animasi old school cantik dengan dukungan cerita powerful.'),
(368, 'The Innkeepers', 'POSITIF', 'DATA LATIH', 'The Innkeepers tetap adalah sajian horor rumah hantu old fashioned mencekam ala Ti West yang bagus. Tidak banyak momen mengerikan, berjalan lambat dan berpotensi menjemukan jika tidak terbiasa dengan karya West sebelumnya, tapi semuanya dibayar lunas oleh latar yang meyakinkan, penampilan apik Sarah Paxton  dan 20 menit akhir yang mengerikan.'),
(369, 'The Intern', 'POSITIF', 'DATA LATIH', 'The Intern punya casting hebat. Kombinasi apik tua-muda yang diwakilkan De Niro-Hathaway menjadi daya tarik terbesar The Intern. Secara keseluruhan The Intern adalah jenis film ringan yang sangat enak dinikmati.'),
(370, 'The Intouchables', 'POSITIF', 'DATA LATIH', 'Mungkin The Intouchables bukan drama teraplegic terbaik yang pernah saya tonton, tapi saya suka setiap kehangatannya, setiap keceriaan dan segala tawa serta chemistry solid yang dihadirkan Olivier Nakache dan ric Toledano beserta duo Cluzet-Sly. Ya, ini adalah tontonan  menyenangkan, sebuah feel-good movie tentang persahabatan, tentang perbedaan yang menguatkan dan juga menginspirasi.'),
(371, 'The Joneses', 'POSITIF', 'DATA LATIH', 'Premis yang diangkat dalam The Joneses termasuk sangat fresh dan orisinal. Film ini adalah sebuah drama komedi satir dengan sedikit unsur romance di dalamnya. Secara keseluruhan Borte bisa dibilang berhasil menyajikan sebuah tontonan drama ringan yang cukup berbobot.'),
(372, 'The Jungle Book', 'POSITIF', 'DATA LATIH', 'Narasinya sederhana dan bersahabat tanpa substansi macam-macam, humornya lucu dan enak dinikmati semua umur, petualangannya seru dan mendebarkan, sisi emosionalnya juga cukup mengena namun jika ada satu hal yang paling menonjol dari The Jungle Book selain visualnya yang ciamik itu adalah jajaran pengisi suaranya. Bukan hanya karena diisi oleh nama-nama besar saja namun bagaimana mereka memberi jiwa pada karakter-karakternya dengan sangat baik.'),
(373, 'The Kids Are All Right', 'POSITIF', 'DATA LATIH', 'Tampaknya tidak terlalu susah untuk menempatkan The Kids Are All Right sebagai salah satu drama terbaik tahun ini. Sebuah kisah keluarga yang berbeda dan sangat menarik yang berhasil disajikan dengan ringan oleh Lisa Cholodenko. Apalagi The Kids Are All Right juga didukung oleh jajaran aktris dan aktor kelas atas yang bermain dengan sangat fantastis disini.'),
(374, 'The Kings of Summer', 'POSITIF', 'DATA LATIH', 'Tidak hanya tangguh membuat para cast mudanya tampil brilian, Vogt-Roberts juga lihai membungkus kisah pendewasaan indie ini dengan teknis yang penuh dengan kepercayaan diri tinggi, terlebih untuk sutradara first timer sepertinya. Ada banyak gambar-gambar apik menyegarkan yang menguasai 94 menit durasinya.'),
(375, 'The King''s Speech', 'POSITIF', 'DATA LATIH', 'Dibuka dengan meyakinkan, berkembang dengan dinamis dan diakhiri dengan sangat emosional, itulah The Kings Speech, sebuah historical drama luar biasa yang diisi oleh orang-orang luar biasa. Sebuah film inspirasional dari seorang pemimpin hebat dalam usaha mencari kepercayaan dirinya.'),
(376, 'The Life of David Gale', 'POSITIF', 'DATA LATIH', 'Dukungan naskah yang kuat, presentasi yang bagus, akting prima dari para pemainnya serta ending yang mengejutkan sudah lebih dari cukup bagi saya untuk dapat menyukai film ini.'),
(377, 'The Little Prince', 'POSITIF', 'DATA LATIH', 'Mark Osborne mempresentasikan The Little Prince versinya dengan cukup baik, mungkin tidak sampai kelewat istimewa mengingat kualitas animasi, khususnya pada bagian cerita di dunia nyatanya terasa sedikit kurang menarik meski sebenarnya buat penonton yang lebih dewasa hal itu mungkin tidak terlalu menjadi masalah karena bisa ditutupi dengan kekuatan tema dan penceritaannya yang bagus.'),
(378, 'The Lobster', 'POSITIF', 'DATA LATIH', 'Ada elemen komedi hitam bekerja di dalamnya, membuat kita tersenyum getir ketika melihat Lanthimos. Sebuah satir tentang tragedi, komitmen dari sebuah cinta yang tersembunyi dalam keabsurdan premis fiksi ilmiahnya. Ada situasi kompleks di bawah permukaannya.'),
(379, 'The Lunchbox', 'POSITIF', 'DATA LATIH', 'Begitu sederhana namun begitu membekas. The Lunchbox diisi oleh dua karakter utamanya yang kuat.'),
(380, 'The Man from Earth', 'POSITIF', 'DATA LATIH', 'Saya selalu percaya kekuatan utama sebuah film itu berada di pundak narasinya, dan The Man from Earth membuktikan itu. Dengan sumber daya terbatas ia mampu memberikan sebuah suguhan drama fiksi ilmiah yang berbeda, menghipnotis dan membuatmu tercengang. Sebuah premis konyol yang mampu dieksekusi dengan sangat baik dengan balutan dialog-dialog cerdas.'),
(381, 'The Martian', 'POSITIF', 'DATA LATIH', 'Dengan durasi sepanjang ini, butuh sesuatu untuk membuat penontonnya betah berlama-lama di bangkunya, dan Scott tahu benar bagaimana menjaga pace The Martian dengan baik. Hampir tidak ada momen membosankan di dalamnya. Setiap adegan diisi dengan efektif dan jauh dari kesan lambat, belum lagi ditambah elemen humor yang memberi variasi santai di tone seriusnya.'),
(382, 'The Mechanic', 'POSITIF', 'DATA LATIH', 'Kombinasi West-Statham rupanya sanggup membuat The Mechanic tampil lebih baik yang dari saya perkirakan sebelumnya. Tidak istimewa memang, namun setidaknya tidak sampai terjebak dalam sajian action murahan kelas dua. The Mechanic bisa dibilang cukup berkelas. Saya sendiri  sangat menikmati bagaimana West mengemas tiap menitnya dalam dalam balutan visual menarik, tempo cepat dan jauh dari bertele-tele.'),
(383, 'The New World', 'POSITIF', 'DATA LATIH', 'Salah satu yang terbaik di genrenya. Setelah A Dirty Carnival butuh waktu 7 tahun untuk mendapatkan sebuah film  gangster ala negeri ginseng memuaskan yang tidak hanya menjual kekerasan dan segala tetek bengek dunia gelap mafia, namun juga sebuah plot cerdas yang kuat dan menegangkan tentang sisi mana yang kamu pilih dengan bumbu aksi berdarah-darah di sepanjang dua jam lebih plus dukungan para pemainnya yang bermain solid.'),
(384, 'The Past', 'POSITIF', 'DATA LATIH', 'Dibungkus dengan semangat kesederhanaan seperti film-film Farhadi lainnya yang juga mencerminkan sebuah realisme kental, nyaris tanpa manipulasi scoring dan dramatisasi berlebihan. Dalam perjalanannya kita akan banyak mendapati kejutan hebat yang sedikit demi sedikit membentuk wajah utuh The Past.'),
(385, 'The Raid', 'POSITIF', 'DATA LATIH', 'Gareth Evans jelas sudah mengerjakan pekerjaannya dengan sangat baik termasuk bagaimana ia memaksimalkan kemampuan dua pemainnya. Ya, The Raid mungkin sudah menjadi film aksi Indonesia terbaik yang pernah ada, bahkan dunia pun mengakuinya.'),
(386, 'The Reef', 'POSITIF', 'DATA LATIH', 'The Reef bisa jadi salah satu thriller tentang serangan hiu terbaik yang pernah dibuat setelah Jaws. Sedikit membosankan di awal, Andrew Traucki kemudian seakan-akan tidak mau membuang waktunya lagi dengan langsung memacu tensinya, memberikan penontonnya momen-momen penuh kengerian dan ketegangan yang efektif merangsang rasa takut kita tanpa harus terlihat berlebihan.'),
(387, 'The Runner', 'POSITIF', 'DATA LATIH', 'Hempasan debu, dan gersangnya iran ditampilkan dengan sempurna. Hampir tidak ada musik yang saya dengar muncul di film ini, dan juga banyaknya aktor dan aktris yang ada di film ini, inilah yang membuat film ini begitu dalam. saya sama sekali tidak melihat sang aktor berakting di sini, yang ada hanyalah benar-benar seorang Amiro. apalagi film ini mempunyai ending dramatis, yang bikin perasaan campur aduk sekaligus indah.'),
(388, 'The Sea of Trees', 'POSITIF', 'DATA LATIH', 'The Sea of Trees seakan membawa kita pada kisah haru biru perjuangan keduanya untuk tetap bertahan hidup dengan kondisi hutan yang terlihat berbahaya di malam hari, karena banyaknya jurang terjal yang tersembunyi dari pandangan, hingga hujan yang menerpa. Tak dinyana, makin ke ujung, alur cerita malah dibawa ke arah drama melankolis dengan penutup manis yang tidak disangka-sangka.'),
(389, 'The Shallows', 'POSITIF', 'DATA LATIH', 'Kemampuan Collet-Serra menghadirkan set piece dengan segala teknis yang luar biasa, lihat saja pengambilan gambarnya dan sound editing yang keren termasuk juga penggunaan CGI yang tepat guna, ini kemudian menjadikan The Shallows menjadi lebih istimewa, tentu saja juga tidak lepas dari akting solo hebat Blake Lively yang sukses berpadu padan sempurna, menghasilkan tensi ketegangan baik di atas maupun di dalam air yang luar biasa tinggi dan yang pasti juga sangat efektif mengguncang adrenalin penontonnya.'),
(390, 'The Shining', 'POSITIF', 'DATA LATIH', 'Tidak heran jika banyak penonton yang memasukkan The Shining dalam list film horror klasik favorit mereka, karena horror psikologis kolaborasi Kubrick-King ini memang yang terbaik di genrenya, bahkan sampai sekarang The Shining adalah salah satu obat manjur yang dapat membuat penontonnya bermimpi buruk setelah menontonnya.'),
(391, 'The Snow White Murder Case', 'POSITIF', 'DATA LATIH', 'Meskipun tidak menawarkan nada gelap seperti Confessions atau kebanyakan thriller-thriller tentang kasus pembunuhan lain,  The Snow White Murder Case masih bisa tetap tampil solid dengan pesonanya uniknya sendiri. Dukungan naskah gubahannya yang berakar plot misteri pembunuhan digarap sangat rapi, kreatif berbaur sempurna dengan penyutradaraan lambat namun memikat ala Nakamura yang tidak pernah lupa membawa ciri khasnya.'),
(392, 'The Social Network', 'POSITIF', 'DATA LATIH', 'Cerita berjalan dengan rapi tanpa ada paksaan, dengan tempo yang pas namun tidak membosankan, Fincher bukan hanya menyajikan cerita tapi juga mengajak kita untuk berpikir dan menganalisis  apa? dan mengapa? kepada setiap karakter yang muncul di film ini. Selain itu film ini juga dipenuhi dialog slapstick tajam dan cerdas.'),
(393, 'The Spectacular Now', 'POSITIF', 'DATA LATIH', 'Kunci keberhasilan The Spectacular Now adalah bagaimana Ponsoldt tidak membuatnya menjadi sebuah teen drama yang lebay, sebaliknya secara natural menjadikan semuanya membumi, termasuk setiap konfliknya, The Spectacular Now itu seperti karakter Aimee, polos tanpa makeup namun tetap cantik dilihat di sepanjang film termasuk adegan seksnya yang lugu". Sutter Keely yang dimainkan cemerlang oleh jebolan Rabbit Hole, Miles Teller adalah pusat segalanya.'),
(394, 'The Swimmer', 'POSITIF', 'DATA LATIH', 'Ada sebuah keseimbangan yang berhasil dihadirkan Sophon Sakdapisit di sini. Penceritaannya yang sederhana coba ditampilkan dengan cara tidak biasa ketika plotnya melompat-lompat dari masa lalu ke masa sekarang lalu kembali lagi ke masa lalu yang berpotensi membingungkan. Sementara kualitas horornya juga masih mampu dijaga dengan baik.'),
(395, 'The Terror Live', 'POSITIF', 'DATA LATIH', 'Thriller berbau aksi terorisme mungkin bukan barang baru untuk dipamerkan, tetapi dengan melakukan pendekatan berbeda siapa sangka kombinasi usang itu bisa menjadi sangat menggigit, coba lihat apa yang dilakukan Kim Byung Woo ketika ia berhasil memanfaatkan minimnya lokasi untuk menghasilkan teror maksimal.'),
(396, 'The Theory of Everything', 'POSITIF', 'DATA LATIH', 'The Theory of Everything itu punya tampilan secantik judulnya. Visual gloomy dari sinematografer veteran Benot Delhomme berbalut scoring magical dari nada-nada elegan dan melankolis garapan komposer Islandia Johann Johannsson, menghasilkan kombinasi momen-momen sentimentil romantis yang mendukung penceritaan James Marsh di paruh pertamanya yang diisi banyak cinta.'),
(397, 'The Town', 'POSITIF', 'DATA LATIH', 'Affleck memang terbukti sukses menyutradarai film berdurasi 2 jam lebih ini dengan sangat baik, namun tidak sebagai aktor karena ada Jeremy Renner disini yang berhasil menjadi scene stealer sebagai seorang badass yang mampu menyuguhkan akting kuat di sepanjang film.'),
(398, 'The Tree of Life', 'POSITIF', 'DATA LATIH', 'Tidak terlalu berlebihan jika saya kemudian menyebut The Tree of Life adalah mahakarya agung, sebuah puisi bergerak, perjalanan spiritual dari seorang pujangga hebat bernama Terrence Malick yang dibalut dengan teknis sinematik nyaris sempurna.'),
(399, 'The Troll Hunter', 'POSITIF', 'DATA LATIH', 'Karya Andre Ovredal  satu ini layak diberi acungan dua jempol, bukan hanya karena sukses menghadirkan premis yang orisinal dan menyegarkan, namun juga bagaimana Ovredal mengemasnya dengan apik, serealistis mungkin dan sangat menghibur.'),
(400, 'The Tunnel', 'POSITIF', 'DATA LATIH', 'Saya harus mengakui bagaimana usaha keras para sineas dan para pemainnya dalam menyajikan The Tunnel ini  serealistis mungkin, ya, mereka sudah melakukannya dengan cukup baik, termasuk menyelipkan beberapa sesi wawancara dari para pelakunya yang terlibat langsung guna memperkuat kesan real film berdurasi 90 menit ini.'),
(401, 'The Voices', 'POSITIF', 'DATA LATIH', 'Dengan menampilkan sajian multi genre, The Voices jelas adalah film yang penuh resiko buat sutradara manapun. Tidak mudah menggabungkan hal-hal serius dalam sebuah thriller psikologis seperti masalah kejiwaan dan pembunuhan dengan elemen-elemen romansa, komedi dan melodrama. Itu seperti perpaduan busana yang tak cocok namun tetap menggoda.'),
(402, 'The Walk', 'POSITIF', 'DATA LATIH', 'Ada perekrutan anggota, perencanaan matang dan tentu saja eksekusi yang semuanya berhasil disajikan dengan cara yang menarik dan menghibur, tetapi momen puncak The Walk ada pada 15 menit menjelang akhir, momen ketika Petit berada di atas kawat baja, berada di puncak dunia katanya, ya, itu adalah momen luar biasa, mungkin salah satu yang terbaik tahun ini.'),
(403, 'The Wall', 'POSITIF', 'DATA LATIH', 'Selain visual vegetasi cantik ia juga dihiasi oleh banyak metafora dan momen emosional depresif yang terjadi dalam suasana intens dan kelam. Performa solo Gedeck yang solid menguasai keseluruhan panggung juga menjadi alasan kenapa The Wall bisa tampil memesona. Melihat karakternya tumbuh, beradaptasi, berinteraksi dengan hewan peliharaannya yang berakting sama bagusnya itu adalah pengalaman paling mengesankan menonton The Wall selain menikmati indahnya visual puitis yang disuguhkan.'),
(404, 'The Way He Looks', 'POSITIF', 'DATA LATIH', 'Tidak ada momen yang terlewat frontal, sebaliknya Ribeiro dengan lembut memperlakukan narasi dan karakternya selembut dan sehangat orangtua Leonardo memperlakukan putra semata wayangnya itu.'),
(405, 'The Witch', 'POSITIF', 'DATA LATIH', 'Kekuatan The Witch adalah bagaimana Eggers mampu membangun dunianya dengan sangat-sangat kuat sejak menit-menit pertama ia bergulir. Pemilihan palet warna kelabu mendominasi visualnya, dikombinasikan dengan scoring garapan Mark Korven yang menyayat menghasilkan aroma suram pekat.'),
(406, 'The Wolf of Wallstreet', 'POSITIF', 'DATA LATIH', 'The Wolf of Wall Street menunjukkan kehandalan Scorsese dalam mengeksekusi sebuah premis sederhana dengan teknis sinematis tingkat tinggi yang eksplosif dan over dramatis, ya itu sudah jelas. Dan bersama naskah gubahan Terence Winter (Broadwalk Empire), Scorsese tahu benar bagaimana menghadirkan sebuah biopik bagus namun secara bersamaan ia juga sukses mengeksploitasi sub teks tentang hedonisme total.'),
(407, 'The Worlds End', 'POSITIF', 'DATA LATIH', 'Sebagai bagian penutup dari sebuah trilogi, The Worlds End jelas diharapkan menjadi sebuah closure hebat untuk dua film sebelumnya, dan ia memang berhasil menjadi sebuah akhir yang bagus meskipun kualitasnya sedikit masih berada di bawah Shaun of the Dead yang punya tema serupa.'),
(408, '2014', 'NEGATIF', 'DATA LATIH', 'Saya tidak bisa memaafkan apa yang terjadi di 20 menit akhir. Ya, itu seperti sebuah lawakan besar dan konyol, sekonyol ketika 2014 masih menggunakan karakter banci untuk mengeksploitasi beberapa momen komedinya.'),
(409, '22 Jump Street', 'NEGATIF', 'DATA LATIH', 'Apa yang tersaji di sini menjadi membosankan, tidak hanya di plot yang minim kejutan namun juga kadar komedi yang bisa dibilang tidak segila dan sesegar seri pertamanya.'),
(410, '300: Rise of an Empire', 'NEGATIF', 'DATA LATIH', 'Sayang, jika kamu mengharapkan itu maka bersiaplah akan kecewa. Ya, memang ada proses bagaimana salah satu pemimpin Persia paling disegani itu terlahir kembali dari api dendam, tetapi ya, hanya sebatas perkenalan basa-basi biasa tanpa kedalaman, dan porsinya sama seperti yang terjadi di film pendahulunya'),
(411, '3SUM', 'NEGATIF', 'DATA LATIH', 'Saya juga merasa ketegangan dan kesan claustrophobic kurang terjaga setelah menonton kedua kalinya. Beberapa adegan juga terasa agak terlalu panjang dan beberapa lainnya terlalu repetitif.'),
(412, '47 Ronin', 'NEGATIF', 'DATA LATIH', 'Ini benar-benar terlihat medioker, tampak jelas seperti hasil pekerjaan seorang sutradara first timer yang hanya mencoba bermain aman dengan dukungan naskah yang sama lemahnya termasuk plotnya yang berjalan terseok-seok dan melelahkan apalagi ketika mereka mencoba memasukkan elemen romansa di dalamnya yang lagi-lagi tidak berhasil meninggalkan kesan.'),
(413, 'A Good Day to Die Hard', 'NEGATIF', 'DATA LATIH', 'A Good Day to Die Hard tampak benar-benar seperti sekuel sejati Die Hard, tetapi kamu hanya menemukan bagian terbaiknya muncul dan menghilang terlalu cepat digantikan dengan aksi-aksi membosankan dan naskah yang menggelikan.'),
(414, 'A Lonely Place to DIe', 'NEGATIF', 'DATA LATIH', 'Julian Gilbey memutuskan untuk membanting kemudi ceritanya dengan memasukkan dua penculik sebagai lawan mereka, meninggalkan lanskap pegunungan dan suasana pendakian dan mengubahnya menjadi sebuah slasher medioker yang mudah diprediksi ke mana arahnya lengkap dengan segala permainan kucing-tikusnya.'),
(415, 'A Nightmare on Elm Street', 'NEGATIF', 'DATA LATIH', 'Plot klise dan membosankan untuk ukuran film horor, terlebih bagi anda yang sudah menyaksikan versi aslinya. Minimnya jam terbang sutradara Samuel Bayer yang biasanya hanya menggarap video klip musik ini, dan yang paling parah adalah hilangnya sosok Englund semakin menambah dosa Platinum Dunes. Semoga saja suatu saat Michael Bay bertobat untuk tidak lagi menghancurkan horror-horror klasik..'),
(416, 'Adore', 'NEGATIF', 'DATA LATIH', 'Bukan tanpa kekurangan, Adore dihiasi banyak dialog-dialog cheesy,  beberapa momen emosinalnya terasa terlalu diberat-beratkan  dan ketika ia seharusnya bisa berhenti disatu titik,  Fontaine malah memilih untuk melanjutkan lagi lebih lama untuk memperpanjang dan memperjelas sesuatu yang sebenarnya tidak terlalu perlu.'),
(417, 'After Earth', 'NEGATIF', 'DATA LATIH', 'Semuanya terasa percuma ketika  Shyamalan tampak tidak terlalu percaya diri untuk membawanya ke mana. Yang terjadi kemudian After Earth malah terjebak antara drama tanpa emosi dan fiksi ilmiah yang kurang garam.'),
(418, 'After Life', 'NEGATIF', 'DATA LATIH', 'Overall, premis yang sangat menarik namun sayang tidak dibarengi dengan kekonsistenan cerita, sehingga membuat After Life harus menderita di paruh akhir, cerita menjadi kendur dan kurang greget.'),
(419, 'Allied', 'NEGATIF', 'DATA LATIH', 'Sulit memang untuk dibuat tak kecewa dengan hasil akhir Allied, apalagi melihat lemahnya naskah hingga plotnya yang kadang-kadang terasa begitu artifisial.'),
(420, 'Altitude', 'NEGATIF', 'DATA LATIH', 'Harus diakui secara teknis Altitude tampil mengecewakan, tidak jauh berbeda dari yang ditampilkan kebanyakan film-film kelas dua lainnya, lemah hampir di semua bagiannya.'),
(421, 'And Soon the Darkness', 'NEGATIF', 'DATA LATIH', 'And Soon the Darkness malah terjebak dalam sebuah thriller kosong tanpa jiwa, bisa dibilang seperti menyaksikan sebuah sajian thriller kelas B murahan lengkap dengan karakter-karakter bodoh, plot dangkal dan akting yang buruk.'),
(422, 'Annabelle', 'NEGATIF', 'DATA LATIH', 'Dosa besar Annabelle sebenarnya ada pada kualitas naskah garapan Gary Dauberman yang ngaco.  Oh, ya, saya belum menyebut bagaimana akhirnya. Percayalah, ending Annabelle adalah salah satu ending paling konyol dalam sejarah perhororan dunia.'),
(423, 'ATM', 'NEGATIF', 'DATA LATIH', 'Seperti kebanyakan thriller medioker lainnya, ATM punya cerita yang kelewat corny serta tidak luput dari rentetan kebodohan demi kebodohan, termasuk tipikal karakter pembunuh tanpa motif yang sok misterius dengan jaket tebal ala pembunuh dalam slasher Urban Legend.'),
(424, 'Attack on Titan', 'NEGATIF', 'DATA LATIH', 'Tidak semua terlihat keren, beberapa terkesan bodoh dan memaksa, namun overall, buat adegan aksinya, Attack on Titan tidak mengecewakan. Tetapi sayang di luar itu drama antar manusianya terkesan memble. Tidak ada pengembangan karakter, tidak ada konflik berarti di antara mereka dan kemudian memaksakan elemen cinta segitiga yang tanggung malah membuatnya semakin kacau dan membosankan.'),
(425, 'Bad Teacher', 'NEGATIF', 'DATA LATIH', 'Sungguh saya tidak pernah bisa mengetahui apa yang ingin disajikan di sini selain sebuah premis menarik dengan cerita kosong, super dangkal, rentetan pertunjukan kebodohan demi kebodohan dan wajah menyebalkan Diaz yang mendominasi di sepanjang 92 menit.'),
(426, 'Badoet', 'NEGATIF', 'DATA LATIH', 'Tidak ada yang salah memang mendaur ulang premis basi, tetapi ini seperti membuang percuma potensinya, belum lagi saya menyebut beberapa plot hole mencolok yang cukup mengganggu.'),
(427, 'Bangsal 13', 'NEGATIF', 'DATA LATIH', 'Sepertinya Ody terkesan terlalu serakah, tidak masalah jika kemudian hasilnya bisa bagus, nah ini malah sebaliknya. Lambat, berantakan, terlalu gelap, sok misterius dengan plot hole sebesar gajah di dalamnya.'),
(428, 'Battle: Los Angeles', 'NEGATIF', 'DATA LATIH', 'Sayang apa yang terjadi kemudian rupanya juga tidak berakhir sesuai ekspektasi kebanyakan orang, karena faktanya Battle: Los Angeles juga bukanlah sebuah film yang kelewat istimewa, tidak sedikit penonton dan kritikus-kritikus dunia yang terhormat mencapnya sebagai sebuah film buruk.'),
(429, 'Battleship', 'NEGATIF', 'DATA LATIH', 'Berg bisa jadi telah berhasil melakukan apa yang bisa dicapai Bay termasuk untuk bagian yang terburuknya macam kualitas naskah yang menyedihkan, rentetan plot hole, karakter-karakternya yang dangkal, rangkaian momen super berisik yang sayangnya, membosankan.'),
(430, 'Bel Ami', 'NEGATIF', 'DATA LATIH', 'Karakter Georges Duroy semestinya punya kedalaman dan kompleks, tapi yang ada, Pattinson malah menjadikannya seperti gigolo bodoh murahan di sepanjang film. Salahkan juga naskah yang ditulis Rachel Bennette. Seperti yang sudah saya bilang Bel Ami punya potensi yang kemudian dirusak dengan kualitas cerita dan dialog-dialog dangkalnya yang membosankan.'),
(431, 'Bidadari Terakhir', 'NEGATIF', 'DATA LATIH', 'Meski Priesnanda Dwisatria selaku penulis naskah berupaya untuk memodifikasi sana-sini lembaran novel Agnes agar tidak sampai berakhir menjadi melodrama yang terlalu dangkal, namun memang susah untuk bisa mengangkatnya lebih tinggi lagi.'),
(432, 'Big Eyes', 'NEGATIF', 'DATA LATIH', 'Mengecewakan? Tentu saja Big Eyes terasa mengecewakan untuk film kelas Burton, apalagi Burton sebenarnya punya modal cerita bagus ketika menyorot komentar sosial tentang posisi perempuan di dekade ''60. Masalahnya Big Eyes seperti nyaris tidak punya keistimewaan lain.'),
(433, 'Billy Lynn''s Long Halftime Walk', 'NEGATIF', 'DATA LATIH', 'Alwyn yang tergolong hijau di Hollywood seakan kewalahan dan terlihat amatir saat harus beradu akting dengan nama-nama yang lebih berpengalaman. Adegan-adegan spiritual yang menyertakan Diesel juga sekan mentah dan tak relevan dengan plot utamanya. Begitu pula saat plot dialihkan pada acara pertandingan football imitasi, semuanya terlihat tidak penting, membosankan dan dituturkan dengan bertele-tele.'),
(434, 'Blackhat', 'NEGATIF', 'DATA LATIH', 'Tidak hanya gagal di naskah, Blackhat malah bisa dibilang nyaris kacau di semua elemennya. Belum lagi saya menyebut pengembangan karakternya yang nyaris nol. Memang Mann masih menampilkan semua ciri khasnya seperti pengunaan beberapa sudut kamera dinamis yang ditambah dengan editing cepat, tetapi semuanya terlihat sudah mulai usang dan tidak bertenaga, bahkan di beberapa adegan aksinya terkesan seperti merupakan versi medioker dari apa yang pernah dilakukannya di film-filmnya sebelumnya. '),
(435, 'Blended', 'NEGATIF', 'DATA LATIH', 'Banyak olok-olokan slapstik yang sebenarnya tidak terlalu lucu, pesan-pesan kacau dan maksa tentang bagaimana menjadi orangtua dengan terlebih dahulu mengejek kelakuan anak-anak mereka, romansa yang tidak terlalu terasa romantisnya untuk ukuran romcom sebelum menutupnya dengan momen-momen cheesy dengan ending klise. '),
(436, 'Blind', 'NEGATIF', 'DATA LATIH', 'Kondisi psikologis Soo-Ah yang merasa bersalah atas kecelakaan yang membuat adiknya terbunuh tidak memberikan pengaruh terlalu besar terhadap jalan ceritanya, yang ada malah membuatnya terlihat sedikit cengeng terlebih untuk ukuran sebuah crime thriller, belum lagi diperparah paruh keduanya yang mengalami penurunan kualitas, dari satu jam pertama yang cerdas berubah menjadi sebuah thriller slasher corny yang tertebak tanpa sebuah penyelesaian yang bagus membuat Blind menjadi kurang greget di satu jam terakhirnya.'),
(437, 'Brooklyn''s Finest', 'NEGATIF', 'DATA LATIH', 'Cerita yang disajikan masih terkesan dangkal dan predictable khususnya pada bagian ending. Don Cheadle juga sebenarnya juga bermain cukup baik, sayang cerita miliknya terbilang biasa-biasa saja, terlalu banyak percakapan yang bertele-tele yang mungkin saja membuat penontonnya bosan. Richard Gere dan kisahnya mungkin yang bisa dibilang paling buruk.'),
(438, 'Bullet to the Head', 'NEGATIF', 'DATA LATIH', 'Bullet to the head adalah bagaimana untuk kesekian kalinya Sly berada di film yang salah. Kharisma besarnya jelas membantunya untuk menjadi daya tarik terbesar buat penontonnya untuk berbondong-bondong melihat sang Rambo kembali lagi terbang solo di layar lebar, tetapi tanpa bantuan teman-temannya Stallone terlihat begitu kepayahan dengan naskah yang lemah dan alur yang membosankan.'),
(439, 'Burning Bright', 'NEGATIF', 'DATA LATIH', 'Sayang memang ketidak becusan Brooks menjaga konsistensi yang sudah dibangun harus dirusak dengan banyaknya momen-momen tidak masuk akal yang terlalu dipaksakan. Andai saja Burning Bright dipegang oleh sutradara lain yang lebih kompeten tentu saja hasilnya bisa jauh lebih baik dari sekarang, tidak hanya menjadi sebuah thriller yang hanya meninggalkan premis menariknya semata'),
(440, 'Camp X-Ray', 'NEGATIF', 'DATA LATIH', 'Yang cukup mengganggu adalah bagaimana ketidak konsistenan yang dilakukan Sattler di akhir-akhir film. Itu seperti sebuah blunder yang bisa saja merusak apa yang sudah dibuatnya dengan baik sejak awal. Ya, sayang memang Sattler harus sedikit mencederai debutnya dengan bermain curang untuk menguatkan pesan tetang kemanusiaannya meskipun sebenarnya juga tidak sampai benar-benar menghancurkannya.'),
(441, 'Cargo', 'NEGATIF', 'DATA LATIH', 'Entah kenapa Engler dan Etter pada kenyataannya tidak mampu menjaga ritme ceritanya dengan baik, membuat penontonnya terjebak dalam kebosanan dengan alurnya yang bertele-tele dan terkesan dipanjang-panjangkan serta membuang percuma sisi teknis yang sudah dikemas dengan sangat baik. Pada akhirnya Cargo menjadi tidak lebih dari sebuah thriller medioker yang dengan mudah dilupakan oleh penontonnya.'),
(442, 'Cars 2', 'NEGATIF', 'DATA LATIH', 'Kali ini para penggemar animasi pixar harus menyaksikan pertama kalinya film Pixar mendapat tomat busuk pertama di website rottentomatoes, wow ! Bayangkan orang dewasa penggemar Pixar berbondong bondong ke bioskop tanpa membawa anaknya, berharap cerita menyentuh dan penuh adegan emosional namun ternyata film ini memang diperuntukkan untuk anak-anak! Benar-benar di luar dugaan tapi inilah yang terjadi.\r\n'),
(443, 'Chappie', 'NEGATIF', 'DATA LATIH', 'Chappie memang punya konsep usang yang telah dimodifikasi sana-sini, namun masalah terbesar Chappie bukan karena premis familiernya yang sudah bolak-balik di pakai atau template Blomkamp yang itu-itu saja, namun ada pada kualitas naskahnya itu sendiri yang ditulis Blomkamp bersama Terri Tatchell. Memanjangkan narasinya dari sebuah film pendek menjadi feature film itu jelas penuh resiko, salah salah akan merusak dan sayangnya ini yang terjadi pada Chappie. Entah mungkin karena saya yang terlalu sok kritis, tetapi melihat bagaimana narasi olahan Blomkamp buaf film panjang Tetra Vaal itu terkesan sangat compang-camping dan kacau. '),
(444, 'Chloe', 'NEGATIF', 'DATA LATIH', 'Apa yang ditampilkan Chloe selama 96 menit ini rupanya juga tidak jauh berbeda dari formula-formula erotic thriller lawas. Bedanya cerita yang ditampilkan dalam Chloe ini terlalu lemah , predictable dan terkesan flat, bahkan jauh sebelum klimaks akhir muncul, penonton pun sudah dapat mengetahui apa yang akan terjadi nanti. '),
(445, 'Your Highness', 'NEGATIF', 'DATA LATIH', 'Your Highness tidak lebih dari komedi dangkal, tidak terlalu jauh dengan komedi-komedi lain yang judulnya berakhiran Movie. Ia terlihat jorok, kotor dan menjijikkan di saat bersamaan. Ya, sungguh mengecewakan.'),
(446, 'Wrath of the Titans', 'NEGATIF', 'DATA LATIH', 'Harus diakui untuk kualitas naskahnya, ia masih sama buruknya dengan pendahulunya, tapi toh, sekali lagi hanya orang-orang bodoh yang kemudian ribut mempermasalahkan segala tetek bengek plot dan kedalaman ceritanya yang jelas-jelas memang sengaja di nomor sekiankan.'),
(447, 'Wild Card', 'NEGATIF', 'DATA LATIH', 'Untuk sebuah film yang mengandung kata Wild di dalamnya, Wild Card tidak sampai seliar itu, malah bisa dibilang ia adalah salah satu film aksi Statham yang jinak dengan sekuens action yang meskipun cukup badass tetapi bisa dihitung jari sebelah tangan. Dan untuk film yang mengandung kata Card di dalamnya, Wild Card gagal menyajikan dunia judi yang mendalam.'),
(448, 'When In Rome', 'NEGATIF', 'DATA LATIH', 'Klise adalah kata yang paling pas untuk menggambarkan rom-com satu ini. Selalu dan tidak pernah bosan-bosannya terjebak dalam formula yang itu lagi-itu lagi.  Seperti belum cukup, dialog-dialognya yang jayus dan beberapa lelucon slapstik nan garing seakan-akan melengkapi derita film ini. Salah satu kisah komedi terburuk tahun 2010 ini.'),
(449, 'What If', 'NEGATIF', 'DATA LATIH', 'Setiap adegan terasa hambar bukan karena hanya plotnya yang mendadak klise namun juga karena chemistry lemah dari Radcliffe dan Kazan.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(450, 'Wedding Dress', 'NEGATIF', 'DATA LATIH', 'Cerita yang terlalu umum dan sederhana, plot jelas tertebak sejak di sepertiga awal film, disaat Kwon Hyeong Jin sudah menghadirkan penyakit mematikan buat karakter Go Eun. Sisanya kita akan diajak melihat rangkaian adegan dramatis nan corny bagaimana Go Eun melakukan penebusan dosanya untuk membahagiakan So Ra.'),
(451, 'Water for Elephants', 'NEGATIF', 'DATA LATIH', 'Ini adalah sebuah kisah cinta segi tiga yang terlalu datar, sedatar chemistry yang dibangun Pattinson dan Witherspoon yang juga menjadi salah satu titik terlemah film ini. Banyak problematika di sini yang ingin dituangkan sekaligus, masalahnya, ini terlalu terkesan menggampangkan plus minim momen emosional, menjadikan kisah Water for Elephants kurang berbobot dan harus menderita cukup banyak di bagian penting satu ini.'),
(452, 'Warcraft: The Beginning', 'NEGATIF', 'DATA LATIH', 'Apa yang disajikan Duncan Jones mungkin tidak istimewa secara premis, penonton awam hanya menganggap ini hanya sekedar sajian fantasi konvensional yang mengekor kebesaran franchise milik Peter Jackson itu,  tetapi sekali lagi, dari mata awam, Warcraft: The Beginning hanya menjadi sekedar film hiburan tanpa kesan apa-apa.'),
(453, 'Victor Frankenstein', 'NEGATIF', 'DATA LATIH', 'Masalah Victor Frankenstein ada pada penyutradaraan dan naskah yang tidak konsisten. Dalam perjalanannya daya tarik mulai luntur seiring ketidak mampuan McGuigan menjaga ritmenya. Narasinya sendiri juga terkesan terburu-buru untuk mencapai tujuan utama membuat mayat hidup, melupakan bentukan jalinan karakter yang sebenarnya bisa dieksplorasi lebih jauh lagi, ujung-ujungnya tidak jauh dari action hingar bingar yang membuang potensinya.'),
(454, 'Veronica Mars', 'NEGATIF', 'DATA LATIH', 'Hasilnya memang terlihat murahan dan terlalu tv series sentris untuk ukuran film yang dibuat untuk layar lebar. Tetapi sepertinya memang itu tujuannya, sebuah penghormatan buat versi televisinya dan tentu saja penghormatan buat para fans fanatiknya.'),
(455, 'Vehicle 19', 'NEGATIF', 'DATA LATIH', 'Pada akhirnya Vehicle 19 terjangkit dengan banyak plot hole mengganggu, dialog-dialog cheesy, plot yang familiar dan klimaks yang tanggung di mana sedikit banyak sudah melukai keasyikan menonton, belum lagi saya menyebut karakter menyebalkan yang dibawakan Walker.'),
(456, 'Underworld: Blood Wars', 'NEGATIF', 'DATA LATIH', 'Bukan berarti tidak ada sesuatu yang baru di sini, ada, hanya saja bukan sesuatu yang sampai bisa membuat Blood Wars menjadi seri yang lebih  ketimbang pendahulunya, Tidak dengan kehadiran Tobias Menzies sebagai komandan baru para lycan atau Lara Pulver sebagai Semira yang licik,  termasuk kejutan di ujung cerita yang tampak sekali terkesan terlalu dipaksakan tanpa memberi penjelasan yang cukup.'),
(457, 'Underworld: Awakening', 'NEGATIF', 'DATA LATIH', 'Kalau mau jujur, ini menjadi seri Underworld dengan cerita yang paling buruk dan terlihat terlalu memaksa untuk membuatnya tetap berlanjut ke seri-seri selanjutnya.'),
(458, 'Tuyul Part 1', 'NEGATIF', 'DATA LATIH', 'Pakemnya sendiri memang tidak menawarkan sesuatu yang baru. Formulanya masih berada di wilayah horor generik yang terlalu mengandalkan teror audio-visual basi dan kaget-kagetan usang plus beberapa adegan yang terlihat konyol dan bodoh.'),
(459, 'Tusk', 'NEGATIF', 'DATA LATIH', 'Transformasi habis-habisan Wallace menjadi Mr. Tusk tidak didukung kostum dan makeup meyakinkan, sehingga imbasnya, Tusk terkesan menjadi horor bodoh yang murahan.'),
(460, 'Trespass', 'NEGATIF', 'DATA LATIH', 'Untuk film yang dibintangi oleh duet maut kelas A, Trespass juga mengecewakan, khususnya untuk Nicolas Cage, sorry pak, anda sungguh sangat annoying dan cerewet di sini, bahkan saya berharap para perampok itu seharusnya membunuh karakter anda secepat mungkin.'),
(461, 'Transformers: Dark of the Moon', 'NEGATIF', 'DATA LATIH', 'Yang paling mengganggu adalah peran Ken Jeong yang lebih menghancurkan suasana ketimbang komedinya meskipun tampil secuil saja di sini. Ya pada akhirnya mungkin film ini adalah akhir dari franchise Transformers, dan mungkin saja film ini akan mudah dilupakan penontonnya.'),
(462, 'Transformers: Age of Extinction', 'NEGATIF', 'DATA LATIH', 'Kualitasnya masih sama dangkalnya, masih sama membosankan dengan segudang plot hole mengganggu. Dan tidak lupa, selalu ada komedi di sela-sela peperangan para robot yang untung saja kali ini tidak sampai senorak Dark of The Moon yang seperti ingin menjadi film komedi ketimbang aksi.'),
(463, 'Transcendence', 'NEGATIF', 'DATA LATIH', 'Selain menyia-nyiakan beberapa pemainnya macam Morgan Freeman dan Cillian Murphy, yang jelas terlihat adalah bentukan plotnya yang berjalan lambat, terutama pada pembukaan sampai 20 hingga 30 menit selanjutnya, Ya, itu sedikit membosankan dan minim emosi belum lagi premisnya yang sedikit berat. '),
(464, 'Tower Heist', 'NEGATIF', 'DATA LATIH', 'Menginjak sepertiga akhir terlalu banyak adegan-adegan serba memaksa, seperti terlalu diatur untuk menjadi lucu, termasuk lubang besar di sana sini yang mungkin membuat penontonnya mengerutkan dahi. Yah, tapi sekali lagi karena ini komedi anda harus memaklumi kalau ia berlaku bodoh, sengaja ataupun tidak.'),
(465, 'Tower Block', 'NEGATIF', 'DATA LATIH', 'Jujur saja penyajian yang dihadirkan oleh James Nunn dan Ronnie Thompson terasa kurang matang, masih banyak sebenarnya potensi-potensi untuk membuatnya menjadi jauh lebih baik dan lebih cerdas lagi. Hasilnya, apa yang terjadi mungkin tidak akan membekas terlalu lama di ingatanmu setelah beberapa hari kamu menontonnya.'),
(466, 'Tomorrowland', 'NEGATIF', 'DATA LATIH', 'Brad Bird seperti tidak mampu mengolah ide besar yang dimilikinya menjadi sebuah penceritaan yang mulus. Terkadang ia begitu mudah dimengerti namun terkadang ia terasa susah dicerna, apalagi buat penonton muda yang tidak memahami konsepnya. Pace yang sedikit tidak konsisten mungkin membuat beberapa bagiannya terkesan terseok-seok dan membosankan,'),
(467, 'To the Wonder', 'NEGATIF', 'DATA LATIH', 'Tidak ada plot yang kuat, narasinya tampak mengambang di dalam akuarium yang indah bersama ikan-ikan yang hampa, membuatnya seperti video klip indah yang panjang dengan mood dan momen yang lebih intim nan personal. Ya, mungkin saja kali ini Malick terlalu cepat merilis karyanya.'),
(468, 'This Means War', 'NEGATIF', 'DATA LATIH', 'This Means War ringan dan cukup menghibur walaupun pada kenyataannya ia sama bodohnya dengan lainnya, tidak peduli ada nama Simon Kinberg yang pernah menghasilkan naskah Sherlock Holmes 2009 lalu.'),
(469, 'The Woman in Black', 'NEGATIF', 'DATA LATIH', 'Pada akhirnya The Woman in Black tidak lebih dari sekedar horor rumah hantu konvensional yang tugas utamanya hanya satu, menakut-nakuti penontonnya sesering dengan trik-trik oldschool yang mungkin sudah sering kita lihat di puluhan film sejenis macam benda-benda bergerak sendiri, kelebatan bayangan, penampakan hantu wanita,  padahal jika mau, Watkins dan Goldman bisa saja memberi ruang lebih banyak untuk perkembangan karakter Radcliffe.'),
(470, 'The Wind Rises', 'NEGATIF', 'DATA LATIH', 'Joe Hisaishi sedikit banyak mengingatkan saya pada Porco Rosso yang luar biasa itu, hanya saja, tidak ada cerita seru tentang pilot babi yang dikutuk di sini, digantikan dengan sesuatu yang lebih membosankan, cerita tentang hidup, ambisi, cita-cita dan romansa Jiro Horikoshi yang lambat dan datar.'),
(471, 'The Whistleblower', 'NEGATIF', 'DATA LATIH', 'Pada akhirnya The Whistleblower hanya menjadi sebuah thriller politik medioker yang akan dengan mudah terlupakan dikarenakan Kondracki gagal untuk memanfaatkan sebaik mungkin modal besar kisah nyata yang diberikan kepadanya, menjadikan film yang seharusnya bisa menarik ini menjadi sedatar permukaan meja makan.'),
(472, 'The Wave', 'NEGATIF', 'DATA LATIH', 'CGI tsunaminya sendiri tidak buruk, meski sajian yang ditunggu-tunggu itu hanya berlangsung cepat dan sebentar. Sayang setelah konflik semua menjadi tidak lebih baik. Tensinya menurun drastis, plotnya menjadi sangat klise, kita tahu persis apa yang akan terjadi dan kenyataannya memang benar-benar sesuai perkiraan.'),
(473, 'The Warrior''s Way', 'NEGATIF', 'DATA LATIH', 'Yah, lupakan saja memang soal bagaimana kisahnya bisa digarap selemah ini. Song Moo Lee tampaknya terlalu rakus menghidangkan terlalu banyak menu konflik tanpa mampu menghabiskan semuanya dengan bersih. Di samping itu juga terlalu banyak karakter yang berpotensi untuk dikembangkan lebih jauh yang pada akhirnya malah terbuang percuma begitu saja, tidak lebih menjadi karakter penghibur, mengisi kisah percintaan Yang dan Lynne yang membosankan, apalagi kisah roman picisan tersebut nyaris mendominasi keseluruhan film berdurasi 100 menit ini.'),
(474, 'The Visit', 'NEGATIF', 'DATA LATIH', 'Kalau mau jujur, momen-momen horor yang ditawarkan The Visit tidak sampai taraf sangat menakutkan, berbeda dengan karya-karya horor  mungkin kombinasi antara seram sakaligus konyol.'),
(475, 'The Vatican Tapes', 'NEGATIF', 'DATA LATIH', 'Ya, sebenarnya masih ada momen-momen creepy di dalamnya, tetapi jumlahnya tak banyak bahkan levelnya bisa dibilang hanya sekedar  untuk menakut-nakuti anak ingusan. Misterinya tidak diperlakukan dengan baik, tidak ada permulaan yang jelas, tiba-tiba saja BOOOM! Semua terjadi. Memang ada sedikit penjelasan yang menyangkut latar belakang tokoh Angela yang kemudian dihubungkan dengan tema bilbical, tetapi tetap saja prosesnya tidak jelas.'),
(476, 'The Twilight Saga: Eclipse', 'NEGATIF', 'DATA LATIH', 'Eclipse adalah seri Twilight yang paling membosankan, bahkan dari New Moon yang dianggap paling buruk sekalipun. Memang harus diakui selama kurang lebih dua jam penonton akan disuguhi dialog-dialog monoton dan tidak berbobot yang keluar di antara 3 karakter utamanya, entah apa memang seperti itu juga dialog-dialog yang terdapat dalam novelnya?'),
(477, 'The Tower', 'NEGATIF', 'DATA LATIH', 'The Tower tampaknya memang didesain sedemikian rupa dengan tujuan murni untuk hiburan. Jadi kamu hanya melihat bagaimana para manusianya berusaha bertahan hidup di kurang lebih dua jam durasinya sementara dukungan efek mahal dengan segala tetek bengek ketegangan dan aksi-aksi penyelamatan heroik yang mungkin terasa berlebihan kemudian memegang kendali sepenuhnya, dan tentu saja tidak lupa bumbu melodrama khas Korea kemudian diselipkan di dalamnya untuk memberikan sebuah luapan emosi di tengah kerusakan besar, sayang hal itu tidak terlalu bekerja dengan baik.'),
(478, 'The Tourist', 'NEGATIF', 'DATA LATIH', 'Naskah buruk, performa mengecewakan dari kedua pemainnya membuat The Tourist seakan-akan menjadi sebuah action-thriller yang serba tanggung. Jika ada satu-satunya yang bisa dinikmati di sepanjang kurang lebih satu jam setengah ini mungkin adalah pemandangan Venesia. Sisanya, yah, seperti yang sudah saya katakan, tanggung.'),
(479, 'The Suspect', 'NEGATIF', 'DATA LATIH', 'Banyak shaky cam ala Paul Greengrass dengan editing cepat dam scoring mendebarkan yang sayangnya, terasa lebih berantakan dan memusingkan. The Suspect terlihat terlalu dangkal, terlalu lama dan bertele-tele sepanjang 137 menit dan berakhir sedikit cengeng di balik segala konspirasi politik, kemachoan dan konflik balas dendamnya.'),
(480, 'The Stepfather', 'NEGATIF', 'DATA LATIH', 'Jujur saja pendekatan yang dilakukan film ini secara tidak langsung merusak film ini secara keseluruhan, karena siapa sebenarnya sosok David Harris sudah diperlihatkan dengan gamblang dari menit-menit awal sehingga kesan misteriusnya sudah berkurang. Selanjutnya bisa dibilang cerita film yang didistribusikan oleh Screen Gems ini sangat klise dan mudah sekali ditebak bahkan untuk bagian akhirnya sekalipun.'),
(481, 'The Sorcerers Apprentice', 'NEGATIF', 'DATA LATIH', 'Sayang lagi-lagi seperti sudah menjadi penyakit film-film popcorn kebanyakan, The Sorcerers Apprentice pun tidak lepas dari kelemahan mendasar, Ya, plot yang terlalu sederhana dan klise layaknya dongeng-dongeng klasik tiga babak buatan Disney yang dapat kita tebak bagaimana cerita tersebut berakhir tanpa harus repot-repot berpikir keras. Ya, The Sorcerers Apprentice, tidak ada plot njelimet dan berlapis-lapis yang memusingkan di sini.'),
(482, 'The Saint', 'NEGATIF', 'DATA LATIH', 'Pendek kata, The Saint versi Noyce ini terasa hanya menumpang ketenaran serial televisinya saja tanpa adanya kedalaman cerita, bahkan untuk ukuran film aksi spionase film ini juga tidak menawarkan adegan aksi yang wah, semuanya serba standar dan lurus-lurus saja kalau tidak mau dibilang buruk, belum lagi aksi jual tampang Val Kilmer yang cukup mengganggu sepanjang 116 menit.'),
(483, 'The Rite', 'NEGATIF', 'DATA LATIH', 'The Rite mungkin tidak lebih dari horror bertema exorcism biasa. Menghibur namun tidak istimewa, bahkan cenderung membosankan buat anda yang kurang menggemari horror beralur lambat, kecuali anda adalah fans berat dan sudah rindu dengan penampilan dingin dari seorang Sir Anthony Hopkins.'),
(484, 'The Resident', 'NEGATIF', 'DATA LATIH', 'Mencari sesuatu yang menarik di The Resident, mungkin anda hanya menemukan nama Hillary Swank di dalamnya, karena jika nama besar itu dicabut maka sisanya hanya sebuah thriller medioker klise dari seorang sutradara video klip  yang sudah bersusah payah agar debut film panjangnya ini dapat laku di pasaran.'),
(485, 'The Quiet Ones', 'NEGATIF', 'DATA LATIH', 'Pouge kembali ke pakem lama yang melibatkan sedikit sentuhan modern dari elemen mockumentary. Tetapi sayang, semua kesenangan-kesenangan itu tidak dibarengi dengan kehadiran aura mencekam, semuanya tampak datar, tidak menakutkan dan bisa dibilang membosankan.'),
(486, 'The Purge: Anarchy', 'NEGATIF', 'DATA LATIH', 'Apa yang terjadi setelah 20 menit, Anarchy kembali mengulangi kesalahan yang sama yang pernah dibuat pendahulunya: membuang percuma tema besarnya dan segala elemen pendukung yang seharusnya membuat sekuelnya ini menjadi lebih baik, sayang apa yang terjadi  di lapangan tidak lebih dari sebuah thriller aksi survival kosong kelas dua yang dihiasi dengan kebisingan tanpa arti dan pertempuran murahan dengan kadar gore yang disunat.'),
(487, 'The Purge', 'NEGATIF', 'DATA LATIH', 'Sebuah konsep gila yang punya potensi menjadi besar dan dalam, sayangnya pada akhirnya DeMonaco entah terlalu malas atau tidak tahu bagaimana mengembangkannya, The Purge kemudian hanya menjadi sajian home invasion thriller yang sering kamu lihat dengan segala aspek bertahan hidupnya yang juga familiar.'),
(488, 'The Perfect House', 'NEGATIF', 'DATA LATIH', 'Ceritanya yang juga tidak lagi terlalu orisinal ini bergerak begitu lambat dan sedikit membosankan dengan rentetan misteri-misteri yang tidak mampu disembunyikan dengan aman. Sungguh teka-teki yang disajikan oleh The Perfect House  gagal mempermainkan saya. Tentu saja imbas dari kekurangan-kekurangan di atas membuat ending The Perfect House yang seharusnya bisa mengejutkan menjadi cacat dan terasa hambar, anggap saja seperti menonton thriller untuk pemula.'),
(489, 'The Other Woman', 'NEGATIF', 'DATA LATIH', 'Seperti kebanyakan romcom lainnya, ia akan memulainya dengan sesuatu yang cukup menyegarkan sampai kemudian berakhir cheesy, termasuk penyutradaraan Cassavetes junior yang juga tidak istimewa terutama ketika ia terlalu memaksakan memasukkan beberapa gambar-gambar melankolis yang terasa tidak cocok.'),
(490, 'The Ninth Gate', 'NEGATIF', 'DATA LATIH', 'Endingnya buruk, terlalu cepat, absurd dan tidak memberikan banyak jawaban dari pertanyaan-pertanyaan yang ada, seperti siapa sebenarnya wanita misterius itu? Apa hubungan adegan bunuh diri di awal film dengan buku itu sendiri, dan beberapa lubang lain di ceritanya. Banyak kritikus yang menganggap The Ninth Gate sebagai salah satu kesalahan besar Polanski.'),
(491, 'The New Daughter', 'NEGATIF', 'DATA LATIH', 'Seperti ingin menyertai kegagalan film ini, nama Kevin Costner yang didapuk sebagai nilai jual juga kembali gagal menampilkan peran terbaiknya. Overall, premis usang ditambah dengan eksekusinya yang payah dan ditutup dengan ending buruk jelas membuat The New Daughter bukanlah sajian horror yang dapat diharapkan dapat memuaskan para penggemarnya'),
(492, 'The Mothman Prophecies', 'NEGATIF', 'DATA LATIH', 'Nama Richard Gare jelas di dapuk untuk menjadi daya pikat The Mothman Prophecies namun apa daya aktor yang memiliki cir khas berambut putih ini gagal memainkan perannya, Pada akhirnya The Mothman Prophecies menjadi sebuah thriller misteri yang garing.'),
(493, 'The Mermaid', 'NEGATIF', 'DATA LATIH', 'Sementara unsur romansanya dibentuk secara paksa dan kasar, transisi untuk membangun rasa cinta terasa terlalu cepat, hanya melalui acara makan ayam panggang dan bersenang-senang beberapa jam di taman bermain. Dan terakhir soal CGI,  kualitas CGI The Mermaid itu buruk, sangat buruk bahkan untuk sekedar dibandingkan dengan Shaolin Soccer atau Kung Fu Hustle sekalipun.'),
(494, 'The Machine', 'NEGATIF', 'DATA LATIH', 'Naskah besutan James bukan hanya terlalu klise dengan segala cerita tentang bagaimana robot yang ingin menjadi manusia, namun juga ia tidak pernah benar-benar kuat membentuk segala urusan moral, termasuk sentuhan dramanya yang juga gagal menciptakan emosi yang semestinya.'),
(495, 'The Love of Siam', 'NEGATIF', 'DATA LATIH', 'Faktor minus terbesar adalah ketika The Love of Siam bergerak terlalu bertele-tele dan  terasa lama, sesuatu yang tidak baik untuk sebuah drama yang berdurasi dua jam setengah benar-benar perjuangan yang melelahkan ketika menontonnya. Sakveerakul sepertinya kebingungan untuk bagaimana mengembangkan kisahnya lebih lanjut, dan apa yang terjadi kemudian ia malah menambahkan sub plot lain yang parahnya terlalu opera sabun alias terlalu sinetron dan tidak penting.'),
(496, 'The Losers', 'NEGATIF', 'DATA LATIH', 'Santai sajalah menikmati The Losers, tidak perlu pusing dengan plotnya yang simpel dan klise, toh filmnya sendiri memang diperuntukkan sebagai hiburan semata.'),
(497, 'The Lorax', 'NEGATIF', 'DATA LATIH', 'Yang salah bisa jadi adalah naskah yang ditulis Ken Daurio dan Cinco Paul, bukan masalah bagaimana mereka sudah memodifikasinya sana-sini, membuat karakter The Lorax yang semestinya menjadi tokoh sentral mendapat porsi lebih sedikit ketimbang tokoh Ted. Tapi yang menjadi persoalan adalah plotnya yang terlalu lurus, khususnya untuk penonton dewasa, efeknya bisa membosankan terlebih ketika homor-humor di paruh pertamanya sudah tidak lagi terlalu lucu ketika menginjak pertengahan film hingga kemudian ia berakhir klise.'),
(498, 'The Legend of Tarzan', 'NEGATIF', 'DATA LATIH', 'Robbie dan karakter-karakter lain seperti terbuang percuma oleh peran mereka karena naskah yang tidak pernah mampu membuat mereka berkembang dari sekedar karakter hore-hore semata.'),
(499, 'The Lazarus Effect', 'NEGATIF', 'DATA LATIH', 'Masalahnya sedikit momen seram tidak mampu menutupi kekacauan yang akan hadir selanjutnya. Seiring dengan semakin jauhnya durasinya berjalan, The Lazarus Effect menjadi melempem. Ia seperti sedang kebingungan untuk memilih satu tema utama, sialnya itu tidak terjadi.  Dan berbicara soal bagian akhirnya, percayalah, apa yang terjadi di ujungnya itu tidak lebih dari sebuah kekonyolan luar biasa seakan-akan melengkapi setiap bencana yang terjadi.'),
(500, 'The Last Witch Hunter', 'NEGATIF', 'DATA LATIH', 'Tidak ada kedalaman, tidak ada pengembangan ceria berarti, termasuk karakter-karakternya yang terasa teralu datar dan tidak tergali dengan baik meski sebenarnya ada sedikit potensi yang sebenarnya bisa dikembangkan dalam karakter Klauder dengan sejumput masa lalunya yang suram. Toh, pada akhirnya film-film jenis ini kembali terjebak dalam pakem lama yang lebih menonjolkan otot dalam aksi pertarungan dan visual dalam CGI mahal seharga 90 juta dollar.'),
(501, 'The Last Song', 'NEGATIF', 'DATA LATIH', 'Setelah Dear John yang tampil kurang greget dan banyak mendapatkan respon negatif dari para kritikus, kali ini The Last Song pun nasibnya tidak jauh berbeda dari pendahulunya itu, malah bisa dibilang film ini adalah film adaptasi novel Nicholas Spark terburuk yang pernah dibuat. Plot tidak menarik, datar dan membosankan, konfilk-konflik yang kurang digali serta tempo yang terlalu cepat menjadi penyebab kegagalan The Last Song.  So, jika anda bukan salah satu penggemar berat Miley Cyrus, lebih baik hindari saja film membosankan satu ini. Ya, The Last Song benar-benar tampil sangat mengecewakan hampir di semua bagian, salah satu yang terburuk di tahun 2010 ini.'),
(502, 'The Last Exorcism Part 2', 'NEGATIF', 'DATA LATIH', 'Presentasinya buruk, alurnya kelewat lambat di awal-awal dan beberapa repetisi terasa hambar ketimbang menakutkan, ini lebih pantas kamu masukan dalam format yang lebih kecil macam FTV atau home video ketimbang film layar lebar.'),
(503, 'The Intruders', 'NEGATIF', 'DATA LATIH', 'Ya, untuk ukuran sebuah horor The Intruders jelas gagal melaksanakan tugasnya dengan baik. Selain naskahnya yang lemah, penyutradaraan Fresnadillo juga tidak maksimal dengan segala pace lambatnya yang terkesan terseok-seok, repetitif dan membosankan termasuk yang paling parah adalah  gagal menghadirkan aura menakutkan untuk memberikan teror kepada penontonnya.'),
(504, 'The Incite Mills', 'NEGATIF', 'DATA LATIH', 'Ironisnya, dengan rentetan misteri semenarik itu, Nakata bisa dibilang gagal membangun tensi suspense alias ketegangannya, belum lagi saya menyebut beberapa plot hole yang mengganggu. Meskipun banyak dihiasi dengan kematian mengerikan tapi Incite Mill tidak pernah mencapai titik didih semestinya untuk sebuah thriller psikologis. Bahkan bumbu krisis kepercayaan dan survival juga terasa sedikit hambar.'),
(505, 'The Huntsman: Winter''s War', 'NEGATIF', 'DATA LATIH', 'Kombinasi konsep dongeng modifikasi tanggung, petualangan yang tidak terlalu greget, romansa gombal dan penyutradaraan lembek dari seorang debutan macam Cedric Nicolas-Troyan memang menjadi luka-luka besar buat The Huntsman: Winters War.'),
(506, 'The Human Centipede: First Sequence', 'NEGATIF', 'DATA LATIH', 'Lemah di plot dan didukung dengan penyajiannya yang serba tanggung dan sangat predictable membuat The Human Centipede sudah kalah di bagian yang bisa dibilang cukup vital ini. Dan hal itu masih diperparah dengan minimnya adegan gore dan disturbing yang ternyata juga tidak ditampilkan secara eksplisit.'),
(507, 'The Human Centipede 3: Final Sequence', 'NEGATIF', 'DATA LATIH', 'Ini bisa dibilang adalah seri terburuk, paling mengecewakan. Tidak hanya punya kualitas narasi palik jelek,  namun Six memindahkan jalurnya dari horor/thriller ke ranah dark comedy yang sedikit banyak sudah menghilangkan kesan seriusnya. Hasilnya, Final Sequence seperti parade sirkus bodoh yang dipimpin oleh cast dan plot yang sama bodohnya. Sementara Laurence R. Harvey pun tidak kalah buruknya, melihat Six sudah membuat penampilannya begitu berbeda dengan karakternya di Full Sequence jelas mengecewakan.\r\n'),
(508, 'The Human Centipede 2: Full Sequence', 'NEGATIF', 'DATA LATIH', 'Apa yang dilakukan Martin Lomax di sini terangkai dalam gambar-gambar yang cukup frontal dan tidak bermoral, nyaris tanpa sensor, membuat penonton yang lemah hati bisa jadi akan dibuat sakit jantung dan mual.'),
(509, 'The Himalayas', 'NEGATIF', 'DATA LATIH', 'Tetapi di balik segala sumber dayanya yang mewah dan pesan kepahlawanan yang luar biasa itu tidak sulit untuk mengatakan bahwa The Himalayas adalah sebuah drama cengeng yang konyol. Kenapa konyol? Pikir saja secara logika sehat, misi membawa pulang jenazah dari puncak Everest yang mematikan bisa dibilang adalah sebuah tindakan bunuh diri yang bodoh dan tidak masuk akal, coba saja kamu tanyakan kepada pendaki profesional paling hebat sekalipun saya berani bertaruh ia tidak akan berpikir dua kali untuk menolaknya.'),
(510, 'The Hangover Part 2', 'NEGATIF', 'DATA LATIH', 'Mungkin The Hangover 2008 lalu sudah membuat batasan begitu tinggi bagi Phillips yang membuatnya kesulitan untuk melanjutkannya ke sekuel-sekuel selanjutnya. Yang terjadi dengan kepercayaan yang begitu tinggi pada akhirnya adalah bencana di seri keduanya, dan The Hangover Part III yang dipaksakan untuk dilanjutkan sebagai penutup juga bukan sekuel yang bagus, namun setidaknya ini masih lebih baik ketimbang part deux yang malas itu.'),
(511, 'The Green Inferno', 'NEGATIF', 'DATA LATIH', 'Eli Roth memang belum pernah membuat horor-horor yang luar biasa bagus dalam hal bercerita, dalam kasus The Green Inferno, Roth memulainya dengan banyak basa-basi tak perlu yang terlalu lama, dipenuhi narasi dan karakterisasi cheesy. Tetapi jika kamu hanya ingin sekedar mencari hiburan sederhana dalam bentuk blood and gore dengan sedikit bumbu humor gelap yang efektif maka kamu sudah berada di  tangan orang yang tepat. '),
(512, 'The Giver', 'NEGATIF', 'DATA LATIH', 'Ya, The Giver jelas punya modal kuat dari novelnya tetapi Michael Mitnick dan Robert B. Weide rupanya memilih untuk bermain aman dengan banyak memangkas segalanya, menyederhanakan narasi kompleksnya, membuang bagian-bagian penting untuk dijadikan tontonan yang benar-benar terasa seperti sebuah sajian young adult klise nan cheesy ala Hollywood ketimbang fiksi ilmiah pintar yang dipenuhi dengan kedalaman metafora, filosofi dan sindiran sosial. Ya, sayang memang setelah seperempat durasi awal yang cukup menyakinkan lengkap dengan sebuah proses perubahan warna ala Pleasentville, The Giver jatuh menjadi tontonan sci-fi remaja tumpul yang terlalu panjang dan membosankan oleh beberapa momen tak perlu yang seperti diulang-ulang. Lalu ada banyak casting bagus yang terasa mubazir karena minimnya porsi yang diberikan.'),
(513, 'The Forest', 'NEGATIF', 'DATA LATIH', 'Implentasi psikologis bisa dibilang gagal total dalam memberikan sebuah pengalaman horor yang kompleks, hasilnya, terlebih dengan ending yang terlalu mudah diprediksi, The Forest tidak lebih dari sebuah horor medioker yang berlindung di balik premis kisah nyatanya yang harus diakui jauh lebih  mampu membuatmu bergidik.'),
(514, 'The Flowers of War', 'NEGATIF', 'DATA LATIH', 'The Flowers of War jelas bukan pencapaian terbaik seorang Zhang Yimou, narasinya tidak sekuat temanya, tidak ada emosi yang dalam kecuali anda adalah penonton oversensitif, hanya ada gambar-gambar bagus dan adengan perang hebat di 20 menit pertamanya dan Christian Bale dengan akting pas-pasan, jauh jika dibandingkan karya-karya hebat Yimaou yang lain macam Raise the Red Lantern, Hero atau To Live yang luar biasa itu, mengecewakan memang untuk ukuran Yimaou tapi setidaknya saya masih bisa menikmatinya hingga akhir.'),
(515, 'The Expendables 3', 'NEGATIF', 'DATA LATIH', 'Berbeda dengan dua seri sebelumnya, seri ketiganya ini mungkin akan sedikit mengecewakan karena beberapa hal. Pertama, ia kembali mengulang formula plot yang sama, semuanya persis seperti yang sudah pernah kamu lihat, dimulai dengan opening heboh, misi yang gagal dan ditutup dengan pembalasan yang setimpal lengkap dengan guyonan-guyonan one liner-nya. Kedua, ia kembali menjadi terlalu serius dan lembek, padahal seri ke-dua nya sempat berhasil tampil lepas menghamburkan komedi dan aksinya dengan porsi sama asiknya, menjadi tontonan aksi yang super gila-gilaan. Ketiga, dengan memilih untuk menurunkan ratingnya menjadi PG-13, segala kekerasannya disunat habis-habisan, tidak ada lagi darah bermuncratan, kepala pecah dan anggota tubuh yang terlepas, ya, ini seperti The Expendebles versi Disney.'),
(516, 'The Disappearance of Eleanor Rigby', 'NEGATIF', 'DATA LATIH', 'Untuk sebuah film yang berlebel romansa , The Disappearance of Eleanor Rigby terasa begitu dingin di balik segala kehangatan sinematografinya. Tidak hanya kontennya, namun bagaimana Beson mempersentasikan narasinya juga begitu depresif. Plotnya seperti berjalan terseok-seok, terasa begitu lama dan menjemukan terlebih Beson memilih untuk membiarkan kedukaanya bertahan begitu panjang dan terkesan repetitif tanpa memberi solusi bagaimana karakter di dalamnya berusaha menyembuhkan diri mereka.'),
(517, 'The Descent', 'NEGATIF', 'DATA LATIH', 'Para cast dimana semuanya perempuan juga tampil tidak mengecewakan, mereka tidak hanya bermodalkan tampang cantik yang bisanya cuma teriak2 saja, karakter mereka juga berkembang seiring berjalannya film. Sayang dibeberapa adegan banyak hal2 yang sepertinya dipaksakan dan sedikit tidak masuk akal. Para  mahluk2  juga digambarkan terlalu sederhana, kurang cukup menakutkan. namun setidaknya kekurangan2 tersebut ditutup dengan ending yang menurut saya cukup keren walau sepertinya agak sedikit memaksa.'),
(518, 'The Collection', 'NEGATIF', 'DATA LATIH', 'Yang terjadi di The Collection adalah ia nampak terlalu berupaya seperti Saw namun gagal. Ia kemudian juga menjadi terlalu action, membuang banyak ketegangan dan keintiman personalnya, termasuk terlalu berfokus pada jebakan-jebakan dan gore-nya ketimbang unsur survivor yang dihadirkan karakternya, dan itu bisa menjadi sangat menghibur namun jelas ia juga sudah kehilangan banyak elemen horornya yang membuat tensinya jauh menurun ketimbang pendahulunya.'),
(519, 'The Cold Light of Day', 'NEGATIF', 'DATA LATIH', 'Trailernya menarik, seperti menjanjikan tontonan spy thriller konspirasi tingkat tinggi yang seru ala trilogi Bourne, tapi fakta di lapangan berkata lain, The Cold Light of Day tidak lebih seperti sebuah B Movie dengan bintang kelas satu dari seorang sutradara medioker, Mabrouk El Mechri yang sebelumnya juga pernah membuat JCVD, semi-biografi aktor laga lawas Jean-Claude Van Damme. Ya, ini seperti parodi buruk dari Bourne, melihat si bakal Manusia baja, Henry Cavill berlari ke sana kemari di lorong-lorong kota Madrid dan di kejar-kejar oleh pihak-pihak yang ingin membunhnya seharusnya bisa menjadi sajian pemacu adrenalin yang mendebarkan, sayang El Mechri tidak lihai menghadirkannya. Setiap momennya terasa sangat lembek dan datar, tidak peduli seberapa keras scoring  Lucas Vidal memacunya, tidak peduli ada dua gaek, Bruce Wills dan Sigourney Weaver di sini. Rangkaian plot hole dan Naskahnya yang buruk juga menjadi salah satu faktor yang menghancurkannya.'),
(520, 'The Call', 'NEGATIF', 'DATA LATIH', 'Semuanya berjalan lancar sampai kemudian klimaksnya menjadi terlalu familiar dan dipaksakan. Tanpa perlu menjadi jenius kita sudah tahu apa yang akan terjadi dan seberapa kerasnya usaha Anderson untuk membuat endingnya terlihat berbeda, toh itu tidak terlalu berhasil, but still, The Call adalah tontonan crime thriller menyenangkan, tidak terlalu berat namun juga tidak sampai menjadi terlalu bodoh, Helle Berry bermain kuat sebagai operator 911 sementara Breslin juga tidak buruk.'),
(521, 'The Butler', 'NEGATIF', 'DATA LATIH', 'Yang menjadi masalah adalah narasinya yang tidak terlalu kuat itu terlalu banyak bergantung dengan kisah-kisah di luar Gedung Putih. Mungkin saja cerita aslinya terlalu membosankan dan tidak  menarik sampai-sampai Lee Daniels bersama Strong harus banyak melakukan permak sana sini dengan mengandalkan banyak sisipan sejarah yang dipaksa .'),
(522, 'The Boy', 'NEGATIF', 'DATA LATIH', 'Dalam perjalanannya misteri yang tampak menjanjikan di awal film berangsur-angsur menguap dan kehilangan daya cengkeramannya. Jangan salah, dari segi akting Lauren Cohan sendiri tampil baik, sama ketika Natalie Dormer menjadi bintang di The Forest, namun sayang Bell membuat karakternya menjadi terlihat bodoh dengan pemilihan dialog dan pengambilan keputusan yang konyol. Sementara pencarian petunjuk dan penemuan fakta-fakta dari masa lalu seperti menjadi terbuang percuma ketika twist yang dihadirkan Bell malah berakhir antiklimaks.'),
(523, 'The Berlin File', 'NEGATIF', 'DATA LATIH', 'Menderita cukup hebat pada pembukannya dengan segala konflik, motivasi dan sub plot yang cukup membuat penontonnya bertanya-tanya. The Berlin File mulai sedikit membaik ketika Seung-wa kemudian mengurangi segala kerumitannya di pertengahan film, menjadikannya jauh lebih sederhana bersama melodrama dan suspense khas Korea Selatan yang dibungkus dengan adegan-adegan aksi cepat dan berkelas. Mungkin susah untuk menyebutnya sebagai Bourne-nya Korea Selatan, tetapi setidaknya Seung-wa sudah mencoba menghadirkan sesuatu yang berbeda meskipun, yah, tidak sesuai ekspektasi.'),
(524, 'The Astronauts WIfe', 'NEGATIF', 'DATA LATIH', 'Seperti yang sudah dijelaskan sedikit diatas, film ini memang hanya sebatas menjual premis dan dua nama besar pemainnya saja, terlihat dari bagaimana ketidakmampuan Ravich memperpanjang premis tersebut menjadi sebuah plot yang solid dan menarik, alih-alih tampil kuat, The Astronauts Wife malah tampil dengan segala kedangkalan cerita dan lubang-lubang besar disepanjang 109 menit yang membuat misteri-misteri yang dihadirkan menjadi terasa hambar. belum lagi ending yang buruk dan klise semakin membuat film ini terasa seperti thriller murahan yang hanya mengumbar banyak adegan tidak perlu yang semata-mata hanya agar membuat film ini terlihat sebagai sebuah film thriller'),
(525, 'The Accused', 'NEGATIF', 'DATA LATIH', 'The Accused punya modal yang bagus untuk menjadikan dirinya sebuah drama pengadilan yang solid, apalagi ia punya Jodie Foster yang tampil baik, sayang kenyataannya tidak. Penyutradaraan dan naskah yang terlalu datar dan klise membuatnya tidak mampu meninggalkan kesan. Satu-satunya yang mungkin akan anda ingat adalah adegan mengerikan yang terjadi di atas mesin pinball itu.'),
(526, 'The 5th Wave', 'NEGATIF', 'DATA LATIH', 'Tetapi kegembiraan itu tidak berlangsung lama, dengan cepat setelah paruh pertama berakhir, The 5th Wave memasuki bagian paling buruknya, tercebur dalam kubangan drama remaja dengan segala romantika picisan yang kelewat familiar. Tidak hanya terasa generik namun sangat payah. Bagaimana Cassie sampai jatuh hati dengan Evan Walker (Alex Roe), penyelamat hidupnya yang misterius  juga tidak pernah melewati sebuah proses yang wajar. Terjadi begitu cepat, hanya dengan sedikit obrolan dengan mudah benci berubah menjadi cinta segampang membalikan telapak tangan.'),
(527, 'Focus', 'NEGATIF', 'DATA LATIH', 'Seperti dua sisi koin, begitu banyak twist bisa jadi menyenangkan, namun di sisi lain juga bisa menjadi bumerang ketika ternyata Focus menjadi teralalu asik  memusatkan segalanya pada elemen kejutannya, terlalu banyak tipu sana tipu sini sehingga penontonnya mungkin tidak tahu lagi bagaimana harus mempercayai jalan ceritanya yang bisa dipastikan selalu ada rekayasa baru, selalu ada desain bohong lagi yang ironisnya terasa repetitif dan menjadi mudah tertebak langkah demi langkahnya, ujung-ujungnya Focus menjadi tidak sefokus judulnya, tidak mengerti tujuannya, tidak mengerti apa yang sebenarnya ingin dicapai karena terlalu sibuk mempertontonkan trik-triknya muktakhirnya dari awal sampai akhir. Sementara kadar romansa dan komedinya sendiri tidak pernah benar-benar disentuh dengan baik meskipun harus diakui pesona besar Smith dan Robbie masih mampu memberikan penampilan dan chemistry mereka dengan cukup intim.'),
(528, 'Frankenstein''s Army', 'NEGATIF', 'DATA LATIH', 'Mungkin teknis mokumentarinya kacau dan naskahnya juga sama berantakannya dengan presentasi ala dokumenternya yang terlalu memusingkan, tetapi pada dasarnya Frankensteins Army memang dimaksudkan sebagai tontonan yang ringan, ia tidak pernah terlalu serius namun masih sanggup memberikanmu sebuah keasikan horor found footage indie orisnil dengan sekarung potongan tubuh, galonan darah segar dan sajian utamanya: monster-monster keren mematikan.'),
(529, 'Colombiana', 'NEGATIF', 'DATA LATIH', 'Ini bukan salah satu yang terbaik dari soerang Luc Besson. Skrip lemah, penuh lubang sana-sini, subplot romansanya yang konyol, karakterisasi yang seharusnya bisa berkembang, peran-peran yang mubazir dan penyutradaraan yang payah dari Megaton membuat Colombiana babak belur bak sajian action kelas dua, '),
(530, 'Crush', 'NEGATIF', 'DATA LATIH', 'Cerita standar, kengerian yang minim, darah dan kesadisan yang kelewat sedikit dan karakter yang tidak dipoles dengan baik serta penyajian ala kadarnya, Crush tampak seperti sinetron thriller yang tumpul dan membosankan, usaha untuk membuatnya menjadi berbeda dengan memunculkan twist di klimaksnya juga gagal. Ya, ini seperti tontonan thriller buat anak-anak. Bahkan posternya saja sudah membocorkan semuanya.'),
(531, 'Dead Man Down', 'NEGATIF', 'DATA LATIH', 'Mungkin tidak terlalu kuat di sektor naskahnya, tetapi pengaruh eropa yang  tenang plus sedikit suspense dan drama yang  dibawa Oplev untuk membungkus setiap momennya membuat Dead Man Down mampu tampil menghanyutkan yang sayangnya harus dirusak oleh ending yang terlalu Hollywood. Ya, klimaks di penghujungnya menjadikan Dead Man Down seperti dua film yang berbeda, begitu tenang dan terlihat solid di hampir keseluruhan tetapi penutupnya seperti membuang segala hal-hal yang bagus itu ke tempat sampah dan menghancurkan dirinya sendiri.'),
(532, 'Death Tube', 'NEGATIF', 'DATA LATIH', 'Death Tube sepertinya hanya meninggalkan konsep yang ambius tanpa dibarengi eksekusi yang mumpuni, menjadikannya sebuah horror-thriller yang membosankan tanpa tahu mau dibawa kemana tujuan akhir film ini, padahal kalau mau jujur ia memiliki potensi untuk dapat berkembang lebih jauh.'),
(533, 'Deliver Us From Evil', 'NEGATIF', 'DATA LATIH', 'Apa yang dilakukan Derrickson adalah sebuah antiklimaks, terlepas dari sekuens exorcism medebarkan di ujungnya, Ia seperti memilih bermain aman dan terkesan malas memberi sentuhan akhir berupa penjelasan setimpal yang semestinya bisa membuat Deliver Us From Evil tidak berakhir menjadi horor medioker yang begitu saja berlalu tanpa kesan apa-apa.'),
(534, 'Devil''s Pass', 'NEGATIF', 'DATA LATIH', 'Kombinasi realisme found footage, setting yang meyakinkan dan kandungan misterinya yang berujung narasi kompleks dan twist membuat Devils Pass milik Harlin sebenarnya tidak terlalu buruk andai saja ia tahu bagaimana menghindari beberapa kesalahan macam yang paling fatal, ketidak konsistenan pengunaan kameranya yang terkadang terasa janggal untuk ukuran film dengan tampilan dokumenter. Belum lagi penyakit lama dari horor jenis ini yang seperti terlalu memaksakan kameranya untuk harus terus merekam segalanya, apapun yang terjadi, seakan-akan  membuat keselamatan kamera lebih penting dari nyawa mereka sendiri, terasa aneh dan mengganggu memang.'),
(535, 'Dream House', 'NEGATIF', 'DATA LATIH', 'Ini mungkin yang terburuk dari Sheridan, tapi hasilnya bisa jadi akan berbeda andai saja pihak Morgan Creek tidak pernah turut campur tangan dalam urusan naskahnya. Ya, konon terjadi perselisihan antara Sheridan dan Morgan Creek selaku studio produksi yang berujung dengan tidak pernah digunakannya naskah Sheridan yang dirasa tidak komersil itu. Ironisnya perubahan yang dilakukan sepihak tersebut ternyata juga tidak membuahkan hasil berarti, selain filmnya sendiri banyak dicerca di sana sini termasuk oleh Sheridan, Craig dan Weisz sendiri yang sampai-sampai tidak mau mempromosikannya,  hasilnya box-ofiice nya pun anjlok, menjadikannya salah satu horor-thriller paling mengecewakan tahun ini.'),
(536, 'Drive Angry', 'NEGATIF', 'DATA LATIH', 'Drive Angry sepertinya berusaha keras untuk menjadi sebuah film aksi tanpa otak gila-gilaan yang sayangnya tidak berjalan dengan baik. Patrick Lussier seakan-akan tidak rela jika filmnya terlihat terlalu murahan namun disisi lain ia juga tidak ingin menjadikannya terlalu serius, nah kegalauan inilah yang  malah membuat Drive Angry menjadi sebuah film aksi banci yang terkesan masih malu-malu menunjukan kegilaannya'),
(537, 'Due Date', 'NEGATIF', 'DATA LATIH', 'Kesalahan Todd Philips adalah improvisasinya menghancurkan segalanya, kalau di perhatikan ia lupa mau di kemanakan dua aktor ini. padahal chemistry dua orang yang berlawanan arah seharusnya menjadi daya tarik yang bagus, di suatu adegan Robert Downey kembali reuni dengan Jamie foxx (The Soloist) meskipun cuma tampil sebentar di sini, namun sekali lagi yang saya sayangkan kehadiran Jamie Fox sama sekali tak berpengaruh apa apa bagi film ini.'),
(538, 'Dumplings', 'NEGATIF', 'DATA LATIH', 'Walaupun dalam segi penceritaanya masih terdapat banyak lubang di sana sini, setidaknya Chan punya pesan yang ingin diangkat, tidak melulu menghadirkan horor yang berisi kesadisan dan kegilaan semata. Sentilan kecil di dalamnya tentang fenomena sosial yang sering kali terjadi dalam masyarakat Cina daratan dan obsesi manusia dalam usahanya untuk mencari kecantikan abadi, termasuk dengan cara yang paling menjijikan sekalipun.'),
(539, 'Everest', 'NEGATIF', 'DATA LATIH', 'Kuat di teknis tidak diikuti dengan penceritaan yang mengesankan. Mencoba membuat Everest untuk tampil humble dan juga sebisa mungkin setia dengan sumber aslinya sedikit banyak sudah memaksa Kormkur untuk mengurangi kadar dramatisasinya, bukan berati naskah Everest sampai menjadi buruk dan tak layak tonton. Kamu mungkin bisa menyebutnya sebagai sajian dokudrama yang lebih memfokuskan pada kronologis peristiwa, masalahnya hal ini terkadang akan menjadi terasa lama dan membosankan, setidaknya itu yang saya rasakan di paruh awal film yang terlalu banyak menghabiskan waktu untuk memperkenalkan karakter-karakter utamanya.'),
(540, 'Exodus: Gods and Kings', 'NEGATIF', 'DATA LATIH', 'Untuk ukuran film reliji, Exodus tergolong terlalu bermain aman. Tidak ada upanya maksimal mengiring rasa emosi dan spiritual penontonnya, apa yang tersaji di sepanjang dua jam setengah Exodus terasa seperti film sejarah membosankan dengan sedikit adegan spektakuler yang tidak sebanding dengan kesabaran para penonton yang tersiksa menunggunya, termasuk adegan penting yang berada di ujung film. Tidak hanya membuang banyak waktu untuk sesuatu yang kurang penting, Exodus bisa jadi adalah salah satu film yang memubazirkan jajaran pemainnya.'),
(541, 'Fantastic Four', 'NEGATIF', 'DATA LATIH', 'Memang untuk ukuran film superhero, 62 juta Dollar bukan budget yang kelewat besar, tetapi jika ia mampu mengubah 12 juta menjadi tontonan sekelas Chronicle, secara logika dengan dukungan dana yang mencapai lima kali lipat, Trank seharusnya bisa melakukan sesuatu yang jauh lebih baik dan lebih besar, tetapi seperti yang bisa kamu lihat Fantastic Four miliknya punya ruang lingkup yang sesempit narasinya. Tidak ada set besar, semua pemandangan yang terlihat hanya melibatkan gudang besar dan banyak layar hijau untuk menampilkan scene Planet Zero yang gersang, gelap dan sepi, bahkan yang lebih mengecewakan dari cerita yang buruk adalah kualitas aksi yang medioker, tanpa greget, tensi dan emosi, sungguh sangat disayangkan franchise sebesar Fantastic Four harus dimulai lagi dengan start yang buruk.'),
(542, 'Fatal Frame', 'NEGATIF', 'DATA LATIH', 'Ya, harus diakui beberapa momen masih berhasil menghadirkan sebuah atmosfer kelam mencekam, setiap koridor gelap dari bagunan asrama masih memberikan efek tidak nyaman, namun untuk ukuran J-horor, Fatal Frame masih berada di wilayah aman buat penonton penakut, tidak sampai terlalu mengerikan, malah bisa dibilang ia membosankan karena alurnya bergerak terlalu pelan. Sementara narasinya sendiri sebenarnya tidak terlalu buruk. Plot Fatal Frame meskipun lemah namun ia masih mampu menghadirkan rasa penasaran penontonnya untuk mengetahui tentang apa yang sebenarnya terjadi termasuk dengan kejutan di akhir film.'),
(543, 'Gangster Squad', 'NEGATIF', 'DATA LATIH', 'Ini mungkin film gangster dengan cerita dan karakterisasi terlemah yang pernah saya tonton, tetapi jika kamu adalah salah satu audiens yang tidak pernah peduli soal hal-hal penting itu maka Gangster Squad akan memuaskanmu dengan parade aksi seru nan brutal, sedikit komedi lengkap dengan segala aroma gangster ala Amerika  klasik yang kuat dipresentasinya, plus ensemble cast yang sudah sedikit banyak memberikan pesona terbesar untuk film yang sebenarnya tidak istimewa ini.'),
(544, 'Ghastly', 'NEGATIF', 'DATA LATIH', 'Pertama, untuk ukuran horor dengan tema klasik, rumah hantu ia tidak  menakutkan. Tidak ada sesuatu yang benar-benar sampai membuat bergidik di sini kecuali mungkin ketika melihat sosok Bin, bocah yatim-piatu yang diperankan dengan baik aktor cilik Hyung-Suk. Kedua, Yun-Ho sudah kerap menipu penontonnya dengan cara yang sama sekali tidak elegan, lihat saja ketika ia terlalu banyak  melibatkan adegan mengerikan yang ternyata hanya jelmaan mimpi dari tokoh-tokoh didalamnya, benar-benar sebuah cara yang bodoh. Dan ketiga, yang paling fatal adalah kualitas naskahnya. Ceritanya begitu lemah dan dipaksakan, terlalu banyak lubang-lubang besar di sana-sini yang sangat mengganggu.'),
(545, 'Grand Piano', 'NEGATIF', 'DATA LATIH', 'Masalahnya adalah motif. Karakter Cusack tidak seidealis dan tidak sepintar yang kita kira, tidak seperti karakter yang dimainkan Kiefer Sutherland di Phone Booth ketika ia mengancam Colin Farell yang bermulut besar. Mungkin dari awal kita akan mengira bahwa ia seorang fans fanantik yang kecewa dengan pertunjukan terakhir Selznick, tetapi pada akhirnya kita tahu bahwa tujuannya sangat sederhana dan sangat cheesy, dan itu sedikit banyak sudah merusak segalanya, belum lagi mengetahui bahwa sang villain ternyata terlihat bodoh dan tidak pernah konsisten dengan ancamannya, lalu klimaksnya di atas panggung itu bisa dibilang konyol.'),
(546, 'Green Lantern', 'NEGATIF', 'DATA LATIH', 'Sebagai sebuah sugguhan superhero Green Lantern sebenarnya memiliki semua potensi untuk melebihi atau setidaknya menyaingi jagoan-jagoan Marvel tahun ini. Sayang ia tidak pernah mencapai titik puncak kepuasan menonton sebuah sajian pahlawan super karena harus menderita oleh kualitas naskah yang buruk, penggarapan yang pas-pasan, CGI yang terlihat cantik namun terlalu berlebihan termask juga kehadiran Ryan Reinolds yang overatted. Sepertinya untuk saat ini DC Comics lebih baik memfokuskan saja kepada reboot Superman atau The Dark Knight Rises yang mudah-mudahan bisa mengambalikan kejayaan mereka lagi.'),
(547, 'Green Zone', 'NEGATIF', 'DATA LATIH', 'Perang Irak memang bukanlah tema yang bersahabat untuk diangkat dalam sebuah film, walaupun kuat secara kualitas cerita namun jelas tidak menjamin film tersebut akan sukses di pasaran, contoh paling gampang adalah The Hurt Locker, yang di puji habis-habisan oleh para kritikus bahkan sampai mendapat Oscar sebagai film terbaik namun hasil box-office nya bisa dibilang biasa saja. Dan sepertinya kutukan itu kembali menerpa Green Zone, walaupun sudah memasang duet maut Greengrass-Damon dan didukung oleh penulis naskah Brian Helgeland (L.A. Confidential, Robin Hood) tampaknya untuk dapat balik modal saja sudah bagus. Memang kalau mau jujur walaupun cerita yang diangkat cukup menarik dan penuh dengan sindiran-sindiran dan intrik-intrik politik kental namun sepertinya masih terlalu berat untuk dinikmati sebagai sebuah film hiburan.'),
(548, 'Gulliver''s Travel', 'NEGATIF', 'DATA LATIH', 'Overall, tampaknya daripada menghadirkan daur ulang sebuah dongeng klasik ke dalam versi modern, Gullivers Travels malah lebih condong menjadi ajang Jack Black mempertontonkan segala kenarsisaan dan kegilaannya. Ya, film ini memang hanya sekedar menghibur, itupun kalau anda memang fans seorang Jack Black yang terbiasa dengan segala guyonannya yang nyeleh, jika tidak lebih baik lewatkan saja film satu ini, toh, anda tidak akan rugi apa-apa.'),
(549, 'Guru Bangsa Tjokroaminoto', 'NEGATIF', 'DATA LATIH', 'Dengan durasi kejam yang hampir menyentuh tiga jam tanpa kekuatan bercerita yang benar-benar bisa mengikat itu jelas adalah sebuah sikasaan tersendiri. Pesona teknis luar biasa dan dukungan ensemble cast-nya yang bermain gemilang hanya memberi rasa takjub instan yang perlahan memudar digerus durasi panjang nan memelahkan. Tidak ada momen yang benar-benar menghentak atau sampai emosional yang merengsek rasa patriotisme penontonnya, bahkan konflik demi konfliknya pun terasa lempeng dan dipanjang-panjangkan, termasuk penambahan karakter fiktif macam Stella yang tidak terlalu penting meskipun kenyataanya Chelsea Islan bermain fantastis.'),
(550, 'Haeundae', 'NEGATIF', 'DATA LATIH', 'Belum cukup dengan plot dan akting yang buruk, bak tsunami yang dahsyat film ini masih akan menerjang penontonnya dengan luapan besar kesalahan2 alias bloopers2 yang kelewatan banget terlihat, bukan hanya sekali dua kali, namun hampir disetiap adegan2 yang melibatkan bencana dipastikan diwarnai dengan adegan2 bodoh, tidak masuk akal dan sangat teramat dipaksakan, maksud hati sih ingin menghadirkan sebuah ketegangan yang mencekam namun hasilnya malah konyol.\r\nOverall, buruk adalah kata yang pas untuk menggambarkan keseluruhan film disaster Korea Selatan satu ini, bahkan 2012 yang notabene sudah terbilang mengecewakan terlihat jauh lebih baik dan masuk akal jika dibandingkan dengan film satu ini. benar2 membuang buang waktu saja.'),
(551, 'Halloween II', 'NEGATIF', 'DATA LATIH', 'Overall, walaupun masih bisa dibilang cukup Halloween II sukses menuai keuntungan secara komersil namun secara kualitas seri keduanya ini mengalami penurunan cukup besar, terutama pada bagian cerita yang tidak sebaik predesornya. Terlepas dari kelemahan2nya tersebut, ucapan terima kasih tetap layak diberikan oleh Rob Zombie yang mampu menghadirkan sosok baru sang legenda, Michael Mayers menjadi lebih baik dari versi orisinilnya.'),
(552, 'Haunt', 'NEGATIF', 'DATA LATIH', 'Sementara apa yang kamu dapat dalam Haunt bukan hanya sekedar sajian horor rumah angker dengan pakem basi yang kembali diulang tanpa modifikasi berarti namun juga sebuah kebingungan untuk menjabarkan narasi dan misterinya. Hasilnya Haunt tidak lebih dari horor medioker dengan beberapa kebodohan (keluarga yang menempati rumahnya tahu bahwa tempat itu bekas dari kejadian-kejadian mengerikan dan mereka seperti tidak pernah terpengaruh sama sekali), cerita percintaan remaja maksa yang bertele-tele dan belum lagi gangguan plot hole..');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(553, 'Headshot', 'NEGATIF', 'DATA LATIH', 'Headshot menderita banyak di berbagai sisi, cerita tentu saja salah satu yang paling mencolok. Narasi tentang balas dendam dari penjahat insaf dan pencarian identitas mungkin bukan konsep baru di ranah ini, Headshot sedikit banyak mengingatkan saya pada Kill Bill Vol. 1 milik Tarantino. Namun klise bukan masalah utamanya, adalah tidak adanya pengembangan yang cukup untuk membuat penontonnya bisa terlibat lebih dalam dengan konflik dan karakternya yang membuat naskah Headshot terasa dangkal dan compang-camping, padahal jujur saja, meski terasa familiar, premis ini sangat mungkin diolah lebih baik lagi guna menghasilkan tonjokan lebih emosional, apalagi kemudian ia membawa embel-embel romansa di dalamnya dengan melibatkan relasi antara Ishmael dan Ailin yang sayang lagi-lagi juga tidak pernah bisa dikemas dengan sempurna.'),
(554, 'Hide and Seek', 'NEGATIF', 'DATA LATIH', 'Sayang ketimbang memilih untuk tampil sederhana dan to the point layaknya thriller home invasion kebanyakan, Huh Jung berusaha membuat ceritanya menjadi lebih berbelit dengan memberikan karakter utamanya bermasalah dengan OCD. Nah, sejak itu Hide and Seek mulai rusak. Ia terjebak dalam upayanya ingin mengalihkan perhatian penontonnya ke sesuatu yang lain, sialnya, semuanya terlalu dipaksakan, dan kebodohan fatal Huh Jung membocorkan identitas pelaku terlalu dini.'),
(555, 'High Tension', 'NEGATIF', 'DATA LATIH', 'Mungkin yang sangat disayangkan adalah bagaimana Aja menutup kisah ini. Alih-alih menghadirkan sebuah twist-shocking ending yang cerdas ala The Sixth Sense, Aja malah seakan-akan memaksa penontonnya tertipu dengan cara yang terbilang murahan. Saya sendiri tidak percaya sutradara sekelas Aja bisa juga membuat ending seperti ini. Layaknya mencomot bagian penutup dari film lain dan menempelkannya disini, apa yang tersaji di klimaks ini begitu penuh kontrdiksi dengan apa yang sudah dihadirkan sepanjang film, sebuah plot hole besar yang seharusnya tidak perlu terjadi jika Aja memilih untuk menyelesaikan film ini dengan cara yang lebih normal.'),
(556, 'Hitman: Agent 47', 'NEGATIF', 'DATA LATIH', 'Tetapi akan menjadi kasus berbeda jika kamu datang memosisikan dirimu sebagai penonton awam yang tidak membawa ekspektasi apa-apa, ya, hasilnya Hitman: Agen 47 tidak terlalu buruk. Untuk sekelas sutradara iklan komersial, Basch sebenarnya cukup berhasil menghadirkan sebuah sensasi brainless action thriller yang seru dan enjoyable. Plot-nya mungkin sedikit berantakan, lemah dan tidak konsisten, beberapa elemen cerita akan terlihat tidak masuk akal dan menantang logika namun mengingat ini adalah cerita seorang agen super dari sebuah percobaan biologi rahasia yang mampu membuat jagoan kita lebih pintar, lebih cepat dan lebih mematikan dari manusia normal maka hal-hal yang terasa berlebihan tersebut masih bisa dibilang cukup wajar. Ya, ini adalah jenis film yang tidak perlu diambil pusing soal penceritaannya, tentang kenapa dan mengapa yang ujung-ujungnya nanti malah membuatmu tambah pusing.'),
(557, 'Home', 'NEGATIF', 'DATA LATIH', 'Jadi kenapa dengan materi teknis semenjanjikan itu Home malah tampil melempem? Pertama, melihat deretan animasi-animasi besutan Johnson, tentu saja ada rasa pesimis akan keberhasilan Home menjadi kartun yang bagus. Antz, Sinbad: Legend of the Seven Seas dan Over The Hedge jelas bukan termasuk dalam animasi panas Dreamworks, malah bisa dibilang secara kualitas mereka termasuk kelas medioker dibandingkan franchise besar Dreamworks lain macam Shrek, Kung-Fu Panda dan How to Train Your Dragon. Dan apa yang terjadi di Home semakin memperkuat posisi Johnson sebagai sutradara animasi kelas dua-nya Dreamworks. Johnson lagi-lagi gagal menghadirkan sesuatu yang spesial, termasuk desian karakternya untuk bisa tinggal lama di ingatan penontonnya. Narasinya terlalu generik, meskipun punya premis menarik yang meliputi petualangan intergalaksi, namun materinya sendiri terasa terlalu dipanjang-panjangkan untuk ukuran film dengan durasi 94 menit. Home dengan mudah menjadi membosankan dalam perjalannya menuju akhir.'),
(558, 'Horsemen', 'NEGATIF', 'DATA LATIH', 'Harus diakui memang setengah jam pertama Horsemen tampil sangat menjanjikan akan sebuah sajian thriller yang menarik. Atmosfer gelap dan mencekam serta misteri-misteri tentang peristiwa pembunuhan berantai misterius berhasil digarap dengan baik, sehingga membuat penontonnya tentu berharap banyak untuk mendapatkan sebuah kejutan di satu jam kedepan, namun apa yang terjadi adalah sebuah bencana. Cerita yang begitu menjanjikan di awal-awal film menjadi babak belur. Entah kenapa cerita menarik tersebut menjadi terlihat bodoh, penuh dengan penjelasan yang tidak jelas, dangkal dan terkesan dipaksakan, belum lagi ending-nya yang sangat mengecewakan. Kesemuanya itu masih diperparah lagi dengan akting Zhang Ziyi yang luar biasa buruk. Alih-alih tampil mengesankan sebagai seorang wanita misterius, aktris asal Cina ini malah lebih terlihat seperti pelacur murahan yang sedang merayu pelanggannya dengan bahasa Inggris-nya yang pas-pasan.\r\nOverall, Mencari sebuah crime-thriller yang pintar dan mencekam? Horseman jelas bukanlah sebuah pilihan yang bijak, karena film ini dijamin akan menghabiskan percuma waktu anda dengan sajian yang jauh dari berkualitas.'),
(559, 'Hostel Part III', 'NEGATIF', 'DATA LATIH', 'Sayang selain adegan menguliti wajah otomatis tidak ada lagi hal mengerikan yang bisa ditawarkan Spiegel. Ya, menggunakan kecoa-kecoa Madagaskar sebesar kepalan tangan anak kecil atau tembakan-tembakan anak panah besi untuk menyiksa korbannya jelas bukan cara yang kreatif untuk ukuran sebuah torture porn sekelas Hostel, parahanya lagi adegan-adegan tersebut terlihat begitu lembek, begitu cupu, jelas merusak apa yang sudah dibuat Roth sebelumnya. Satu-satunya yang mungkin sukses disiksa disini mungkin hanya para penontonnya yang harus duduk menyaksikan segala jeritan-jeritan sumbang dan kebodohan demi kebodohan,  membuat durasi 88 menit terasa berjam-jam.'),
(560, 'House at the End of the Street', 'NEGATIF', 'DATA LATIH', 'Ya, tidak butuh lama untuk membuat penontonnya bisa membenci HATES. Setelah opening yang menyakinkan, narasi garapan David Loucka (Dream House) dan Jonathan Mostow (Surrogates) ini perlahan namun pasti mulai terjun bebas ke jurang kehancuran. Dosis suspense-nya ompong, misterinya tiga babaknya tidak pernah terasa kuat dan menggigit, kamu dengan mudah melihat akhirnya jauh sebelum filmnya sendiri berakhir, terutama ketika karakter Ryan muncul dan membeberkan segalanya.\r\nTwist ending-nya sebenarnya bagus, hanya saja proses menuju ke sana itu adalah sebuah kekacauan ditambah lagi selain penampilan apik J-Law yang lovable, karakter-karakter pendukung lainnya tidak pernah diberi porsi lebih dalam, mereka tampak lebih seperti figuran tanpa arti ketimbang membantu menggerakan plotnya. Memang Elizabeth Sue mampu menjalin relasi ibu-anak dengan Lawrence dengan cukup baik, tetapi hanya itu saja. Subplot lainnya seperti diada-adakan untuk memperpanjang narasinya yang sebenarnya bisa saja diakhiri setengah jam lebih cepat.'),
(561, 'I, Frankenstein', 'NEGATIF', 'DATA LATIH', 'Tetapi,  jujur saja, I, Frankenstein itu lebih kacau dari franchise Underworld dan Blade yang buat saya sudah termasuk medioker, bahkan parade pertarungan penuh CGI mewah antara pasukan Gargoyle pimpinan Miranda Otto dan iblis yang dikomandani oleh sang pangeran kegelapan dalam wujud Bill Nighy itu akan menjadi cepat usang dan membosankan.'),
(562, 'If I Stay', 'NEGATIF', 'DATA LATIH', 'Memang cerita tentang arwah cantik penasaran dalam drama bukan sekali ini saja dipakai. Meskipun sedikit basi tetapi segmen penuh dengan aroma sedih dan kecemasan ini ini jelas jauh lebih menarik dan emosional ketimbang harus melihat banyak flashback membosankan tetang kehidupan bahagia Mia pra tragedi yang diisi banyak momen cheesy dalam iring-iringan musik cantik , nyaris tanpa konflik berarti. Mungkin bukan sepenuhnya salah sutradara spesialis dokumenter R. J. Cutler yang memulai debutnya di sini atau penulis naskahnya, Shauna Cross, mungkin saja memang novel Gayle Forman bukan live action material yang bisa dengan mudah dibuat versi filmnya dengan segala detil yang tak mungkin terangkut dalam 106 durasinya. '),
(563, 'Immortals', 'NEGATIF', 'DATA LATIH', 'Ya, film fantasi yang juga menjadi pembuka dalam ajang iNAFFF 2011kemarin ini memang gagal menghadirkan sebuah epik mitologi sendal dan pedang yang bagus dari segi kualitas cerita. Terlalu banyak modifikasi ekstrem di sana sini yang membuatnya malah terlihat konyol, lihat saja bagaimana Singh menurunkan derajat Theseus dari manusia setengah dewa menjadi tukan batu yang terlahir dari seorang ibu tanpa ayah, menggambarkan para Titan yang alih-alih berukuran raksasa sesuai namanya mereka malah terlihat mengelikan termasuk juga para dewa-dewanya. Ya, menjadi berbeda itu boleh-boleh saja, tetapi bukan berati harus konyol. Tapi di sisi lain Immortals punya daya tarik tersendiri selain visualnya yang luar biasa itu, tingkat kesadisan yang cukup frontal, membuatnya jelas bukan tontonan anak-anak seperti Clash of The Titans, lihat saja ketika Apollo menghabisi para anak buah Hyperion. Sebuah kombinasi tidak wajar, menggabungkan segala kecantikan dan kebrutalan penuh darah dan banyak kepala hancur menjadi kesatuan yang keren, ya, seperti 300, tapi tidak banyak editing  berlebihan yang dilakukan oleh Sighn di sini.'),
(564, 'Imperium', 'NEGATIF', 'DATA LATIH', 'Ya, di atas kertas Imperium menjanjikan sajian thriller yang menarik, tetapi narasinya yang tidak kuat membuatnya hanya terasa angker pada premis tidak dengan keseluruhan plotnya. Memang ada beberapa adegan yang terasa mendebarkan, kebanyakan melibatkan nyaris terbongkarnya penyamaran Nate Foster, tetapi secera keseluruhan Imperium bisa dibilang adalah thriller yang masih bermain di wilayah aman tanpa benar-benar punya keberanian lebih untuk menelusuri konsep kontroversialnya dengan lebih terbuka, terlebih dari interaksi antar karakternya yang terasa terlalu mudah dan memaksakan diri.'),
(565, 'In the Heart of the Sea', 'NEGATIF', 'DATA LATIH', 'Dengan durasi yang menyentuh 2 jam, Howard sebenarnya punya cukup banyak waktu untuk mengolah relasi antar karakternya, potensinya besar terutama ketika kita bisa melihat konsep rivalitas dan clash antara Owen Chase dan George Pollard, Jr yang sedikit banyak mengingatkan saya pada Niki Lauda dan James Hunt di Rush. Dari situ sebenarnya Howard bisa saja memperkuat naskah garapan Charles Leavitt (Blood Diamond) dan segala pergolakan emosi dengan modal perseteruan dua karakternya utamanya, sayang, nyatanya tidak demikian. Howard tampak lebih sibuk memperhatikan segala urusan teknis untuk bagaimana membuat In The Heart of The Sea secantik dan semegah mungkin, namun tanpa jiwa dan emosi.'),
(566, 'In Time', 'NEGATIF', 'DATA LATIH', 'Sungguh premis yang menjanjikan. Ketika pertama kali saya mendengarkan cerita film ini, apalagi mengetahui kalau Andrew Niccol yang menyutradarai sekaligus menulis ceritanya, saya langsung girang. Gattaca adalah salah satu film scifi favorit saya walaupun agak underrated. Selain Gattaca, Andrew Niccol juga menulis The Terminal, The Truman Show dan Lord of War yang juga termasuk dalam daftar film-film yang saya sukai. Tetapi In Time sayangnya menjadi film dengan ide yang sangat menarik tetapi eksekusi yang mengecewakan.'),
(567, 'Indigenous', 'NEGATIF', 'DATA LATIH', 'Jadi ketimbang lebih memusatkan segalanya pada pesona Chupacabra itu sendiri, Orr malah seperti lebih asik bermain-main dengan karakter-karakternya. Masalahnya, seperti Chupacabra, setiap tokohnya juga tidak mendapatkan perlakuan yang lebih baik. Mereka tidak jauh dari tipikal tokoh-tokoh sterotip dalam banyak sajian horor yang lebih cenderung bodoh, terutama dalam mengambil keputusan. Tidak jarang mereka menganggap remeh larangan yang ada. Ya, sepertinya dalam dunia horor peraturan, larangan atau himbauan itu memang paling asik untuk dilanggar, selanjutnya, bisa ditebak, sebuah penyesalan yang datang terlambat.\r\nIndigenous tidak hanya diisi oleh banyak karakter bodoh, namun juga presentasinya yang seperti tidak mau kalah. Naskahnya sudah bisa diduga, dangkal. padahal kalau mau sedikit lebih rajin, Max Roberts sang penulis bisa memberi lebih banyak.'),
(568, 'Into the Mirror', 'NEGATIF', 'DATA LATIH', 'Menginjak paruh kedua kesan mengerikan pun perlahan mulai kedodoran, sampai akhirnya menginjak klimaks yang ternyata hanya terkesan begitu saja , walaupun harus diakui ending film ini sangat mengejutkan.\r\nOverall, entah karena sudah menonton versi Alexandre Aja atau kenapa, saya merasa Into The Mirror tampil tidak maksimal. Premis yang sebenarnya menarik harus terbuang begitu saja dikarenakan pengolahan cerita yang lemah. Untung saja Alexandre Aja mengetahui kekurangan ini dan mampu membuat Mirrors versinya menjadi jauh lebih menarik.'),
(569, 'Into the Strom', 'NEGATIF', 'DATA LATIH', 'Dibandingkan Twister, Into The Strom memang menderita banyak di narasinya. Terlalu cheesy dan klise, penulis naskah John Swetnam memang seperti tidak terlalu ingin membuat ceritanya terlalu rumit, toh ini adalah jenis film cenderung untuk dilihat ketimbang disimak. Jadi kamu akan menemukan pengenalan karakter yang kelewat standar dan pergerakan plot yang terlalu mudah dikenali, singkatnya, lupakan saja ceritanya, setidaknya meskipun dangkal, ia masih enak dinikmati tentu saja tidak lepas karena faktor lainnya.'),
(570, 'Jack and Jill', 'NEGATIF', 'DATA LATIH', 'Ya, Jack and Jill  sudah menjadi pengalaman menonton komedi yang mengerikan, selain harus menyaksikan karakter Sandler berwujud wanita dengan wig, payudara palsu lengkap dengan suara palsunya yang mengganggu dan tingkah lakunya yang super bodoh nan menjijikkan itu di selama satu jam setengah, naskah yang dikeroyok Sandler bersama tiga teman penulisnya juga terbilang sangat buruk, sama buruknya dengan segala humor-humor serta dialog-dialog garing, kurang ajar, jorok dan kasar ala Sandler yang kali ini sama sekali tidak berhasil membuat saya sulit untuk sekedar menyunggingkan senyum.'),
(571, 'Jack Reacher', 'NEGATIF', 'DATA LATIH', 'Sayang McQuarrie sepertinya tidak terlalu pintar mengeksekusi naskahnya menjadi sebuah kesatuan thirller yang solid, seperti yang pernah dilakukannya pada Valkyrie lalu. Intensitas keteganganya terasa labil, ketika di satu titik ia berhasil mencapai puncak (adegan kejar-kejaran mobil) di titik selanjutnya ia seperti terjun bebas menjadi menjemukan dan terseok-seok dengan segala dialog-dialognya yang lemah dan itu sering terjadi berulang-ulang, termasuk membuang percuma performa apik para peran pembantunya macam Warner Herzog yang tampil dingin sebagai The Zec atau Robert Duvall,  sampai kemudian ia diakhiri dengan ending antiklimaks yang masih belum menjawab sepenuhnya siapa sebenarnya sosok Jack Reacher itu (mungkin jika sukses akan dijelaskan dalam sekuel-sekuelnya).\r\nSaya kira ini bisa ditutup dengan pintar , ternyata saya salah, Jack Reacher tidak lebih dari sebuah thriller kriminal yang berusaha keras untu terlihat cerdas dan seru sama baiknya, sayang itu tidak terjadi di sini. Hanya terlihat bagus di 20 menit pertama selanjutnya kita hanya melihat McQuarrie lebih mengantungkan semuanya  kepada pesona bintang seorang Tom Cruise.'),
(572, 'Jack the Giant Slayer', 'NEGATIF', 'DATA LATIH', 'Tentu saja mengecewakan untuk ukuran sutradara sekaliber Bryan Singer terlebih dengan budget sebesar itu dan banyak nama-nama aktor kelas satu di dalamnya, Jack the Giant Slayer harusnya bisa lebih dari sekedar sebuah dongeng fantasi daur ulang untuk kelas film keluarga dengan CGI pas-pasan. Tetapi sekali lagi, saya masih sanggup menikmatinya, yah, setidaknya saya lebih suka yang satu ini ketimbang Hansel & Gratel: Witchs Hunter .'),
(573, 'Java Heat', 'NEGATIF', 'DATA LATIH', 'Eksploitasi besar-besaran kota Jogjakarta plus Candi Borobudur dengan segala kegemerlapan acara Waisak-nya mungkin hanya satu-satunya hal positif yang berhasil di garap Conor, sisanya Java Heat bak sebuah bencana berisik berbiaya besar yang gagal di semua sektornya, termasuk membuang percuma premis dan sumber daya utamanya. Kecuali ada fans film aksi kelas B tanpa otak, saya sarankan untuk menghindari Java Heat yang tidak ada panas-panasnya ini.'),
(574, 'Jessabelle', 'NEGATIF', 'DATA LATIH', 'Mencampur elemen haunted house dan sihir-sihir voodoo lama dari selatan Amerika, Jessabelle tidak pernah tampil semeyakinkan posternya sejak menit-menit awal bergulir. Tentu saja ada misteri yang butuh jawaban sejak kaset-kaset VHS tua itu mulai diputar oleh Jessie yang malang, tentu saja ada banyak pertanyaan tentang siapa itu dan mengapa ini yang sedikit banyak sudah memaksa penontonnya untuk duduk bersabar menanti akhir, melewati serangkaian serangan lemah berupa jump scare murahan, akting pas-pasan dari artis Australia Sarah Snook, aroma creepy yang tak pernah mencapai titik didih dan kualitas narasi lembek dan bisa dibilang jauh lebih dangkal ketimbang selokan depan rumahmu lengkap dengan banyak basa-basi tak perlu kecuali mungkin untuk memanjangkan durasinya.'),
(575, 'Jonah Hex', 'NEGATIF', 'DATA LATIH', 'Seperti yang sudah saya singgung di atas, tidak usah terlalu pusing memikirkan plot-nya yang memang berantakan. Jonah Hex jelas tidak menawarkan sesuatu yang spesial pada ceritanya, semuanya serba instan, klise, bahkan bisa dibilang jauh dibawah rata-rata film superhero yang paling standart sekalipun. '),
(576, 'Joy', 'NEGATIF', 'DATA LATIH', 'Russell memang masih mempertahankan segala ciri khasnya dari momen-momen depresi yang dibungkus humor, namun ia gagal menghadirkan sebuah proses yang masuk akal apalagi untuk ukuran drama berdasar kisah nyata. Transisi dari sebuah kegagalan menuju kesuksesan terasa digampangkan tanpa adanya sebuah penjelasan. Poof! seperti sulap, semua rintangan  mendadak dengan cepat menghilang ketika Joy menginginkannya. Proses transisi yang ajaib ini malah menghilangkan kesan realistisnya, membuatnya menjadi semacam fantasi yang tentu saja terasa aneh.'),
(577, 'Jupiter Ascending', 'NEGATIF', 'DATA LATIH', 'Tidak butuh waktu lama buat saya untuk segera merasakan kejenuhan,  Wachowskis mengulangi lagi dan lagi sekuen yang sama dengan setting berbeda dengan suasana yang semakin berisik, hal negatif ini kemudian diperparah dengan kualitas narasi yang sama membosankannya. Konsep yang ditawarkan memang terlihat besar dan ambisius, bahkan Lana sesumbar ada elemen spritual bekerja di dalamnya. Masalahnya, entah saya tidak peka atau memang pesannya tidak berhasil tersampaikan dengan baik. Alih-alih menjadi versi baru The Matrix dan Cloud Atlas, Jupiter Ascending dengan cepat jatuh menjadi sajian sci-fi action garing dengan naskah kelas medioker. '),
(578, 'Jurassic World', 'NEGATIF', 'DATA LATIH', 'Lantas apa yang kemudian ditawarkan Jurassic World? Ia bahkan hanya ditangani oleh sutradara sekaliber Colin Trevorrow yang terakhir menggarap sci-fi indie Safety Not Guaranteed. Ya, di dalamnya kita memang akan menemukan spesies baru dino yang lebih ganas, lebih kuat, lebih cerdas dan memiliki lebih banyak gigi dari T-rex bernama konyol; Indominus rex. Indominus rex pula lah yang kemudian menjadi alasan kenapa naskah dangkal Jurassic World masih bisa berjalan. Ada petualangan mendebarkan, khususnya di paruh ketiga dan momen puncaknya ketika karakter-karakter utamanya berusaha bertahan hidup dari serangan Indominus rex yang mengerikan, tentu saja semuanya itu dibungkus bersama adegan-adegan aksi dan kejar-kejaran seru nan mendebarkan dalam balutan CGI yang keren dan visual megah khas film musim panas yang mahal, plus tambahan gimmick efek 3D yang sayang tidak bekerja terlalu maksimal, sama tidak maksimalnya dengan pengembangan karakter yang terkesan apa adanya.'),
(579, 'Kata Hati', 'NEGATIF', 'DATA LATIH', 'Naskahnya lemah dan cenderung terlalu lurus, tidak peduli kemudian ia diberikan penghalang berupa seorang cantik bernama Kimberly Rider yang muncul ditengah-tengah dua hati yang sedang saling mengobati dan memperburuk keadaan toh ia tidak pernah menjadi terlalu rumit, bahkan kita bisa mencium endingnya dari kejauhan tanpa harus menjadi anjing pelacak tapi sekali lagi bukan hanya itu masalahnya. Ekskusi yang dilakukan Iqbal Rais juga semakin memperparah segalanya. Alurnya lambat, terlalu bertele-tele tidak peduli ketika ia bersama DOP-nya berhasil menangkap gambar-gambar cantik kota Jogja atau bagaimana Andhika Triyadi mampu membungkusnya dengan soundtrack-soundtrack romantis, ini sama sekali tidak bekerja dengan baik, itu saya belum menyebut dua karakter utamanya yang tidak punya cukup chemistry untuk membuatmu percaya bahwa ada banyak cinta di dalamnya. Lalu ada sub plot bodoh tentang adik Fila yang sama sekali tidak penting kecuali untuk memperpanjang durasinya.'),
(580, 'Kidnapper', 'NEGATIF', 'DATA LATIH', 'Meskipun dimulai dengan berantakan, toh saya tetap harus melanjutkan film ini hingga habis karena sudah terlanjur penasaran dengan bagaimana nasib sang anak. Untung saja selanjutnya ternyata not so bad. Beberapa adegan tersaji cukup menarik dan menegangkan dengan tempo naik turun, plus beberapa momen melodrama yang (seharusnya) mengaharukan, namun tetap saja harus diakui adegan-adegan tersebut terkesan terlalu lebay atau berlebih-lebihan dalam penggarapannya sehingga cukup menganggu kenyamanan menonton.'),
(581, 'Killer Joe', 'NEGATIF', 'DATA LATIH', 'Masih beranggapan saya berlebihan? Ya, ini adalah jenis film yang menawarkan premis yang buruk (dalam artian positif), kotor dan cabul dengan banyak menampilkan gambar-gambar vulgar, lalu kamu akan tahu kenapa film jenis ini dibatasi dengan rating NC-17 di A.S sana yang jelas membuatnya sulit untuk mendapatkan banyak penonton, tetapi ini memang bukan film yang pantas untuk ditonton oleh banyak orang.'),
(582, 'Ladda Land', 'NEGATIF', 'DATA LATIH', 'Ketika drama keluarga dengan segala tetek bengek melodrama dan isu-isu sosialnya bisa tersaji lebih kuat dan menarik, Ladda Land malah harus menderita pada sisi horornya, malah membuat elemen yang seharunya mendapatkan porsi paling besar ini terkesan sebagai sebuah subplot tambahan yang buruk termasuk dengan hadirnya rentetan plot hole yang tidak pernah terungkap dan juga terkesan terlalu dipaksakan hanya untuk memenuhi tujuannya untuk menakut-nakuti penontonnya dengan cara murahan tanpa memberikan asas cerita yang kuat. Bukan berarti saya mengatakan Sukdapisit gagal total dalam menghadirkan segala momen mencekam dan atmosfer creepynya. Di beberapa bagian Ladda Land masih mampu memberikan terapi kejut yang efektif, sayang klimaksnya sedikit tertebak tetapi saya menyukai bagaimana kemudian Sukdapisit memilih sentuhan drama ketimbang horor untuk menutup kisahnya.'),
(583, 'Letters to Juliet', 'NEGATIF', 'DATA LATIH', 'Tidak ada yang terlalu istimewa dalam Letters to Juliet, semuanya tersaji serba standart, tidak sampai terlalu mengecewakan memang namun masih jauh juga untuk dikatakan sebagai sebuah film yang bagus. tipikal drama romantis Hollywood yang hanya mejual keindahan kulit luar ketimbang kedalaman ceritanya.'),
(584, 'Love, Rosie', 'NEGATIF', 'DATA LATIH', 'Tidak peduli seberapa memesonanya penampilan cantik Lily Collins dengan alis tebalnya itu, naskah Towhidi dengan cepat dan pasti membuatnya  menjadi tidak lebih dari karakter perempuan bodoh yang insecure, haus akan cinta yang tak kunjung datang, membuatnya seperti terlihat selalu putus asa dalam mengambil setiap keputusan yang kemudian di sesalinya. Tetapi penampilan Collins bisa dibilang terlihat jauh lebih baik ketimbang ketika narasinya memperlakukan tokoh Alex yang dibawakan jebolan The Hunger Games, Sam Claflin. Alex adalah jenis manusia yang jauh lebih menyedihkan ketimbang Rosie. Punya banyak kesempatan untuk mengakhiri konfliknya lebih cepat, namun yang terjadi adalah sebuah kebodohan demi kebodohan yang membuatnya seperti tidak pantas menjadi pria yang ditunggu selama 12 tahun.'),
(585, 'Man on a Ledge', 'NEGATIF', 'DATA LATIH', 'Man on a Ledge, thriller dengan premis menarik, eksekusi yang tidak terlalu buruk dan deretan bintang-bintang besar, sayang ia harus dirusak dengan kualitas naskah menyedihkan. Yah, masih untung ia tidak berakhir membosankan, dan sekali lagi mungkin anda harus menutup sebelah mata untuk benar-benar bisa merasakan segala kebodohannya yang menghibur itu.'),
(586, 'Me Before You', 'NEGATIF', 'DATA LATIH', 'Di luar dari kepiawaian Clarke yang membawakan peran gadis kikuk manisnya, Me Before You juga untungnya didukung chemistry yang lumayan sepadan dari duet Clarke dan Claflin. Keduanya cukup mampu menjaga laju filmnya yang beralur lemah dan kelewat enteng. Sebagai sajian komedi romantis, Me Before You sudah memenuhi semua kriteria film mainstream sejenis, dari dua pemeran utama yang berwajah sedap dipandang, tempat-tempat berpanorama elok di mata, hingga lantunan lagu-lagu yang sedap didengar. Kurangnya ada di naskah tulisan Moyes sendiri yang berasa kelewat manis dan ringan bak gula kapas arumanis. Sebegitu manisnya hingga terkadang membuat enek, isu sensitif euthanasia yang bisa digali dengan mendalam juga dijadikan sekedar tempelan belaka di penghujung plotnya. Di tangan sineas Inggris, Thea Sharrock, Me Before You juga terkesan main aman. Tak berani bermain-main keluar dari zona aman stereotype komedi romantis kontemporer yang belakangan ini mulai terasa menjemukan.'),
(587, 'Minions', 'NEGATIF', 'DATA LATIH', 'Coffin seperti sudah kehabisan amunisi untuk menghadirkan lelucon baru buat para minion, hasilnya, kelucuan yang dihadirkan Minions perlahan namun pasti menjadi garing dan annoying. Setiap lelucon kemudian hanya sebatas menghasilkan sedikit senyum ketimbang tawa lepas.'),
(588, 'Miss Bala', 'NEGATIF', 'DATA LATIH', 'Narasinya menjebak anda untuk ikut tersesat seperti halnya Laura yang terombang ambing didalamnya, dimulai sejak peristiwa di klub malam itu, selanjutnya akan banyak kejutan tidak terduga yang membuat anda tetap terjaga, menantikan apa yang kira-kira akan terjadi kemudian pada Laura yang berada di tempat dan waktu yang salah. Sayang Naranjo menghadirkan film yang mewakili Meksiko dalam ajang Oscar 2012 ini sedikit bertele-tele dan terkesan repetitif. Pesannya sendiri juga tidak pernah mencapai sasaran kecuali satu hal, Meksiko itu memang keras bung! Tidak ada karakter yang benar-benar baik di sini, bahkan polisi sampai jenderal sekalipun semuanya korup, tapi selain itu kita benar-benar dibuat bingung apa yang sebenarnya ingin disampaikan Naranjo, tidak ada klimaks, bahkan terdapat beberapa bagian yang nampak konyol dan tidak masuk akal. '),
(589, 'Money Monster', 'NEGATIF', 'DATA LATIH', 'Memang di menit-menit awal Money Monster terasa menjanjikan ketika Foster memilih untuk tidak menjadikannya The Big Short versi 2.0 yang cerewet berbicara soal uang dan ekonomi dan langsung tancap gas ke konflik utamanya. Lalu presentasi thriller ruang sempitnya juga tidak buruk, perpindahan antara adegan di panggung dan di ruang kontrol digarap dengan baik. Di bagian ini Foster cukup pintar memberikan momen intensnya meski buat saya efek tegangnya dengan cepat berlalu bersama penampilan tokoh-tokohnya yang kurang bersimpati serta transisi antara komedi dan dramanya yang kacau, kecuali mungkin Julia Roberts yang bermain cukup oke sebagai director Money Monster meski ia selalu berada di belakang layar. Bagian terburuk Money Monster ada pada third act-nya, itu bukan sebuah puncak yang bagus, terkesan memaksakan diri dengan segala konklusi yang datang secara kebetulan dan bersamaan. Tetapi sekali lagi ini bukan tontonan yang buruk, setidaknya saya menikmati apa yang ditawarkan Foster di sini terlepas dari segala kekurangannya'),
(590, 'Monsters', 'NEGATIF', 'DATA LATIH', 'Beberapa kekurangan lain seperti dialog yang tidak berkembang disaat memasuki pertengahan film dan lemahnya chemistry yang terjalin antara Scoot McNairy dan Whitney Able menjadi catatan tersendiri disini. Cukup mengejutkan memang, mengingat keduanya sebenarnya juga adalah pasangan di dunia nyata namun  kenyataannya mereka tidak mampu menghasilkan pendekatan satu sama lain dengan meyakinkan.'),
(591, 'Mr. Go', 'NEGATIF', 'DATA LATIH', 'Jelas ini adalah film besar, lihat konsepnya, lihat budgetnya, lihat distribusi masalnya, lihat bagaimana para tim spesial efeknya berhasil melakukan pekerjaan rumah mereka dengan menciptakan gorilla CGI menggemaskan yang nyaris sempurna sebagai daya pikat terbesarnya, lalu memberikannya baseball sebagai pertunjukan utama. Tetapi yang terjadi pada narasinya bisa dikatakan berbanding terbalik dengan segala teknis canggihnya. Entah terlalu sibuk memfokuskan semuanya untuk menciptakan sosok gorilla sebagus mungkin (mereka bahkan membuat setiap helai bulu Ling Ling yang berjumlah 3,8 juta),  Kim Yong-hwa melupakan bahwa Mr. Go juga memerlukan kualitas cerita yang bagus, atau setidaknya tidak sampai sedangkal dan semudah ini.'),
(592, 'Negeri van Oranje', 'NEGATIF', 'DATA LATIH', 'Jujur saja, mudah kok untuk menebak siapa yang menjadi pilihan lintang, toh, ini bukan film Christopher Nolan yang njelimet atau Terrence Malick yang absurd. Petunjuk-petunjuknya sudah tersebar jelas di sepanjang film, dengan karakter Lintang yang cenderung serius dan sedikit manja, kandidat calon suami langsung mengerucut ke dua orang, belum lagi twist menjelang akhir film semakin memperjelas siapa yang akhirnya bersanding di pelaminan bersamanya. Mungkin saya tidak terlalu memusingkan pertanyaan siapa, itu mudah, namun dengan potensi premis yang sebenarnya menjanjikan akan sebuah proses pengenalan karakter yang dalam ternyata disia-siakan oleh Endri Pelita. Memang ada pengenalan satu per satu karakternya, namun itu masih dirasa terlalu minim dan hanya menyentuh permukaannya saja.'),
(593, 'Nine Dead', 'NEGATIF', 'DATA LATIH', 'Hampir sepanjang 1 jam setengah tidak ada sesuatu yang istimewa yang ditawarkan disini, semuanya terkesan plain, membosankan, belum lagi akting-akting bodoh yang ditampilkan para pemainnya membuat saya berharap film ini untuk secepat mungkin berakhir dan berharap secepat mungkin menyaksikan ending-nya yang mungkin saja akan membuat saya terbangun. namun apa yang ditunggu ternyata jauh diluar dugaan. Jujur saja saya terkejut namun bukan dalam arti yang postif, saya terkejut karena seumur hidup belum pernah saya menonton sebuah thriller dengan ending sebodoh ini, bahkan hanya dengan membaca judulnya saja kita akan tahu bagaimana akhir film kelas B satu ini.'),
(594, 'No Escape', 'NEGATIF', 'DATA LATIH', 'Sementara kemunculan tokoh Hammond yang dimainkan Pierce Brosnan alih-alih menjadi daya tarik malah melemahkan. Tidak ada kejelasan karakter Hammond, siapa ia dan apa tugasnya Hammond muncul seenaknya dengan kharisma khas Brosnan, selalu di saat dan momen yang terlalu pas, membuat No Escape kehilangan elemen realistisnya. Karakter Hammond sama tidak jelas dengan latar belakang narasi utamanya yang sama sekali tidak pernah membahas mengapa dan kenapa situasi politik bisa memanas, yang kita tahu para pemberontak tidak terima karena Amerika menguasai sumber air dan mendirikan perusahaan di sana, masalahnya, apakah itu bisa menjadi motif kuat untuk memicu sebuah aksi pemberontakan. Meski set waktunya berlangsung cepat, terhitung hanya satu malam, tetapi melihat bagaimana pemerintah yang nyaris tidak bereaksi dan hanya muncul di awal konflik itu jelas menjadi sebuah plot hole yang mengganggu.'),
(595, 'Nurse 3D', 'NEGATIF', 'DATA LATIH', 'Masalah utama Nurse 3D bukan pada lemahnya naskah yang memang sangat-sangat cheesy atau efek 3D yang norak, soal itu sudah sangat bisa dimaklumi, tetapi bagaimana ketidak konsistenan penyutradaraan Aarniokoski. Di awal-awal ia seperti ingin membungkus Nurse dengan kemasan grindhouse seksi dan erotis bersama segala unsur gotik yang penyajiannya seakan-akan sengaja dibentuk dalam kemasan horor/thriller murahan,  namun dalam perjalanannya semua itu menguap, dan ironisnya, menjadikan Nurse benar-benar terasa murahan.'),
(596, 'Odd Thomas', 'NEGATIF', 'DATA LATIH', 'Ada hal-hal yang tidak konsisten dan dipaksakan dalam perjalannya menuju akhir yang membuat plotnya berlubang di beberapa bagian, belum lagi karakter-karakter baru yang seperti selalu muncul silih berganti, seperti ingin membuat penontonnya bingung untuk menebak siapa pelakunya tanpa adanya latar belakang yang jelas. Entah karena Sommers tidak lihai mengubah narasi novelnya ke naskah film tanpa dukungan Koontz (FYI, Sommers menulis sendiri naskahnya setelah membaca novelnya karena tidak mendapatkan hak cipta dari Dean Koontz sebelum akhirnya diberikan pada juni 2012 lalu ) atau sederhana, memang novelnya sendiri yang tidak kuat (saya tidak terlalu percaya yang ini), menjadikan Odd Thomas kedodoran di setengah jam terakhir, plus twist ending yang memaksa.'),
(597, 'Ondine', 'NEGATIF', 'DATA LATIH', 'Tempo yang dibangun sudah pas, tidak terlalu lambat dan tidak kelewat cepat, namun entah kenapa masih terkesan dangkal dan kurang menyentuh. Mitos tentang Celtic creature yang menjadi tema utama sepertinya hanya dijadikan pajangan disepanjang film. Pertanyaan tentang siapa sebenarnya Ondine memang terjawab di akhir film, namun sekali lagi tidak membuat film ini menjadi istimewa karenanya.'),
(598, 'Only You', 'NEGATIF', 'DATA LATIH', 'Bukan pilihan romcom yang tepat untuk menghabiskan malam valentine bersama pasanganmu, terlalu medioker dan mudah dilupakan tanpa sebuah romantisme dan chemistry yang kuat. Untung saja masih ada Italia dan wajah cantik Tomei yang setidaknya mampu membuat saya, atau mungkin penonton pria lainnya mampu bertahan menyaksikan Only You sampai akhir.'),
(599, 'Open Grave', 'NEGATIF', 'DATA LATIH', 'Pasca opening-nya tensinya langsung melorot drastis meskipun tidak sampai mengerucutkan niatmu untuk melihat akhirnya. Lpez-Gallego jelas harus banyak berterima kasih kepada Sharlto Copley yang menjadi alasan besar kenapa Open Grave masih layak ditonton selain misterinya, dan tentu saja ending yang kamu tunggu-tunggu. Sebenarnya tidak perlu menunggu sampai habis untuk mencerna semuanya, toh Lpez-Gallego terlalu baik untuk memberikan banyak petunjuk dan flashback tentang apa yang sebenarnya terjadi. Dan ketika akhir itu datang hasilnya tidak terlalu mengejutkan lagi, sebuah akhir yang ternyata sangat familiar hanya saja seperti nasib para karakternya, kita seperti dibuat tidak tahu apa-apa dari awal.'),
(600, 'Paranormal Activity: The Marked Ones', 'NEGATIF', 'DATA LATIH', 'Jujur, meskipun mengakui sebagai fans beratnya saya tidak pernah berharap banyak pada instalemen terbaru PA ini, apalagi mengingat ini sebuah spin-off. Dan benar saja, The Marked Ones mengecewakan, termasuk buat penonton yang memuja franchise ini macam saya. Tidak ada hal baru di sini, seperti berjalan di tempat yang sama, semuanya sudah pernah kamu lihat, parahnya The Marked Ones tersaji dengan kualitas keangkeran yang menurun jauh , bahkan dari seri ke-empatnya sekalipun yang digadang-gadang sebagai seri terburuk.'),
(601, 'Passion', 'NEGATIF', 'DATA LATIH', 'Passion jelas kurang unsur erotisnya, ia terasa lebih berat ke arah misteri dan crime yang sempit termasuk mengeksploitasi pesona McAdams dan Repace namun sayang  karakter-karakter mereka seperti kurang punya motivasi dan datar. Passion  terasa kecil.  Belum lagi saya menyebut banyak kejutan-kejutan murahan macam sekuen mimpi yang berulang-ulang dan twist yang bisa dikatakan sedikit bodoh. '),
(602, 'Pitch Perfect', 'NEGATIF', 'DATA LATIH', 'Jujur saya menikmati setiap lagu-lagu modifikasi (tidak pernah menyangka bahwa The Sign legendarisnyaAce of Base bisa dimodif seperti itu) yang dihadirkan di sini, mereka sungguh terdengar keren, dan itu jelas adalah bagian terbaiknya, tetapi tetap saja sebagai sebuah film utuh ia tidak boleh hanya bergantung pada satu elemen saja sementara elemen lainnya tidak bekerja maksimal. Maka inilah Pitch Perfect, sebuah drama komedi kompetisi dengan cerita tipis yang punya humor-humor garing, romansa dangkal dan banyak karakter-karakter bodoh. Tetapi jika kamu mencari tontonan seringan kapas dan sedangkal selokan depan rumah dengan kualitas musikalitas yang bagus, silahkan.'),
(603, 'Pitch Perfect 2', 'NEGATIF', 'DATA LATIH', 'Tidak ada spirit dan antusiasme besar dari para Bellas seperti yang pernah dihadirkan di seri pertamanya, semua terkesan canggung termasuk beberapa guyonan garing yang masih mengandalkan Rabel Wilson dan beberapa anggota Bellas macam Lilly Onakurama, pendatang baru si anak hispanik, Flo  dengan segala keanehan komedinya.'),
(604, 'Pixels', 'NEGATIF', 'DATA LATIH', 'Harus diakui narasinya setipis kertas dan pengembangan karakternya nyaris nol, termasuk di dalamnya romansa antara Sam Brenner dan Lieutenant Colonel Violet van Patten yang dimainkan Michelle Monaghan, tetapi ini bukan jenis film yang mesti kamu anggap terlalu serius dari segi penceritaan apalagi karakter.'),
(605, 'Priest', 'NEGATIF', 'DATA LATIH', 'Ah, sayang sekali Scott Steward tampaknya terlalu percaya dengan diri membuang sebagaian besar elemen-elemen penting dalam komiknya, meninggalkan Priest telanjang dengan segala  kekurangan-kekurangannya, baik dalam naskah maupun bagaimana menghadirkan momen-momen aksinya yang seharusnya bisa menjadi bagian paling menghibur disini. Yah, untuk menghibur anda, Priest setidaknya sedikit lebih baik dari Legion.'),
(606, 'Primal Fear', 'NEGATIF', 'DATA LATIH', 'Jujur saja, untuk sebuah film yang diadaptasi dari novel, secara keseluruhan (terlepas dari twist2nya) cerita Primal Fear memiliki lubang yang cukup banyak, walaupun itu terbatas hanya pada subplotnya saja namun cukup menganggu. Banyak hal2 yang ditinggalkan mengambang tanpa penjelasan begitu saja, seakan2 akan, subplot2 tersebut hanya digunakan untuk memperpanjang durasi film tanpa berpengaruh besar pada cerita utamanya.'),
(607, 'PVC-1', 'NEGATIF', 'DATA LATIH', 'Dengan premis yang menantang dan teknis sinematik serumit dan semengagumkan itu itu PVC-1 seharusnya bisa tampil perkasa, sayang pada akhirnya thriller satu ini tidak pernah berhasil membuat kita benar-benar merasakan sebuah sensai ketegangan yang seharusnya di sepanjang kurang lebih satu jam setengah durasinya. Ya, Jujur saja saya memang kagum dengan bagaimana Stathoulopoulos mempresentasikannya tapi disaat bersamaan ia juga berhasil membuat saya cukup frustasi disaat menontonnya.'),
(608, 'R.I.P.D.', 'NEGATIF', 'DATA LATIH', 'Lalu datanglah bencana itu. Dipertengahan naskahnya menjadi amburadul. Entah apa yang terjadi ketika Robert Schwentke mencoba mencampurkan alam baka dan dunia manusia menjadi satu. Ya, manusia dapat melihat apa yang dilakukan R.I.P.D meskipun senjata mereka terlihat seperti pisang, dan yang lebih para dari CGI setengah matang untuk ukuran film berbiaya ratusan juta dan momen aksi yang mudah terlupakan adalah plot hole besar.'),
(609, 'Ragini MMS', 'NEGATIF', 'DATA LATIH', 'Jujur saja horor satu ini termasuk salah satu mockumentary yang buruk. Pawan Kripalani sebagai sutradara telah gagal mengeksekusi setiap momen didalamnya. Niatnya sih boleh saja besar, ingin menampilkan Ragini MMS layaknya sebuah crossover antara Paranormal Activity dan The Blair Witch Project dengan berusaha  menampilkan tampilan Indoor maupun Outdoor se creepy mungkin, sayang usahanya tidak berhasil. Semua yang disajikan disini terkesan terburu-buru, asal-asalan dan terlihat murahan. Penempatan kamera-kamera cctv kelewat banyak dan  tidak logis malah menambah kesan tidak realistis. Penampakan mahkluk halusnya beserta segala gangguan-gangguannya terlalu diobral habis-habisan sejak keduanya menginjak rumah itu sedari pertama kali,  parahnya lagi Kripalani juga nyaris tidak mampu menghadirkan sesuatu yang menakutkan disini, kecuali setting rumah itu sendiri.'),
(610, 'REC 2', 'NEGATIF', 'DATA LATIH', 'Overall, [REC]2 mungkin adalah salah satu dari sekian banyak sequel mengecewakan yang juga seharusnya tidak perlu dibuat, karena film pertamanya sebenarnya sudah berhasil ditutup dengan sangat baik. Namun apa daya, lagi-lagi faktor komersial untuk mengeruk untung lebih banyak dengan tidak diimbangi dengan kualitas yang memadai menjadi noda besar pada film ini. Mudah-mudahan saja nanti seri ke-3 nya bisa tampil lebih baik dari seri keduanya ini.'),
(611, 'Remember Me', 'NEGATIF', 'DATA LATIH', 'Bagaimana dengan ceritanya? seperti yang sudah dijelaskan sedikit diatas, tema cerita seperti ini sudah sering diangkat dalam sebuah film oleh sineas-sineas dunia, sehingga tidak ada sesuatu yang bisa diandalkan dalam ceritanya kalau tidak mau dibilang membosankan dan tidak fokus terhadap masalah yang ingin disampaikan. Mungkin satu-satunya yang menyelamatkan film ini sehingga masih layak ditonton hingga akhir adalah endingnya yang cukup powerfull. Ya, akhir yang luar biasa untuk ukuran film yang tergolong biasa-biasa ini benar-benar membuat penontonnya bak tersengat listrik dan membangunkan mereka dari kebosanan yang melanda hampir kurang lebih 2 jam.\r\nOverall, untuk sebuah film yang tidak isitmewa yang hanya mengandalkan seorang Robert Pattinson semata sebagai nilai jual terbesar, Remember Me tampil terlalu lama dan membosankan. Tampaknya R-Pratz masih harus giat belajar akting lebih banyak lagi jika tidak mau dibilang sebagai aktor yang hanya mengandalkan tampang semata.'),
(612, 'Resident Evil: Afterlife', 'NEGATIF', 'DATA LATIH', 'Jadi dengan menurunkan ekpektasi saya serendah-rendahnya saya membaranikan diri untuk duduk dan menonton kisah terbaru petualangan Alice di negeri para Zombie ini. Seperti yang sudah bisa ditebak memang tidak ada hal yang baru yang ditawarkan Anderson dalam Resident Evil: Afterlife, terutama dari segi cerita yang seakan-akan mengulang kembali formula yang sama dengan seri-seri sebelumnya, yah seperti yang sudah saya bilang tadi saya sama sekali tidak terkejut dan sangat memaklumi kekonsistenan Anderson dalam menggarap ceritan dan dialog-dialog yang sangat dangkal dan klise ini, bahkan judul Resident Evil sendiri sepertinya sama sekali tidak mewakili kisah di versi game-nya, jadi kita langsung saja membahas senjata utama film yang membuat film ini terasa istimewa, yaitu pengunaan 3D Fusion Camera System.'),
(613, 'Retreat', 'NEGATIF', 'DATA LATIH', 'Ya, Retreat membosankan dan terlalu lama bergerak, naskahnya tidak sekuat idenya. Eksekusinya lemah hingga ia tidak pernah mampu mencapai potensi ketegangan yang semestinya bisa jauh lebih baik, walaupun harus diakui juga Tibbets sempat membuat saya mengalami keraguan sejenak tentang kebenaran kabar kiamat yang dihebuskan oleh karakter Jack disini, dan senang mengetahui endingnya mampu mengobati kekecewaan saya dengan sedikit twist yang cerdas. Tidak ada yang menonjol dari ketiga karakter utamanya. Cillian Murphy nyaris bermain tanpa emosi dan pemilihan Jamie Bell adalah sebuah kesalahan, bukan karena aktingnya buruk tapi ia terlalu lugu untuk kemudian didapuk sebagai tokoh antagonis disini.'),
(614, 'Riddick', 'NEGATIF', 'DATA LATIH', 'Kualitas narasinya mungkin bukan yang terbaik, namun sudah cukup untuk menegaskan kembali franchise ini masih punya daya tarik, dan ia tidak sebodoh seri keduanya. Riddick juga banyak dihiasi dengan dialog-dialog canggung, tetapi kamu pastinya tidak menonton Riddick untuk mencari dialog pintar bukan? Terlalu banyak karakter tanpa ada waktu memberikan mereka kedalaman, tidak seperti Pitch Black yang membaginya sama rata, di sini hanya Riddick yang berkuasa penuh.'),
(615, 'Sabotage', 'NEGATIF', 'DATA LATIH', 'Ya, memang Sabotage sendiri memang masih tidak jauh-jauh dari otot, senjata berat, dialog humor one liner dan sedikit aksi, tetapi Ayer ingin menjual misteri dan sisi psikologis karakternya ketimbang parade aksi, hasilnya, Sabotage dengan kandungan misteri gelap dan kadar violence cukup vulgar terlihat seperti sebuah horor slasher beralut kemachoan yang sayang tidak mampu berjalan beriringan dengan sempurna.'),
(616, 'Sadako vs Kayako', 'NEGATIF', 'DATA LATIH', 'Tidak usahlah membahas plotnya yang tipis dan serba memaksakan diri, kita tahu benar dari awal bahwa Sadako vs. Kayako memang akan berakhir menggelikan ketimbang mengerikan, bersama humor-humor yang datang dari celetukan-celetukan bodoh karakternya serta momen-momen kematian yang terkesan berlebihan alias over the top.'),
(617, 'Safe', 'NEGATIF', 'DATA LATIH', 'Polisi korup, uang kotor, gengster, baku hantam, peluru di mana mana dan kejar-kejaran dengan kualitas cerita apa adanya, Safe seperti kebanyakan film Statham lainnya, yang memang didesain cepat untuk sekedar menjadi suguhan murni hiburan buat penontonnya, sayang tidak bekerja terlalu baik, bahkan untuk sekedar menikmati porsi aksi tanpa otaknya yang tak pernah bisa mencapai kadar maksimumnya.'),
(620, 'Samsara', 'POSITIF', 'DATA UJI', 'Jika kamu menyukai Baraka, dapat saya pastikan kamu akan menyukai Samsara. Baik Baraka ataupun Samsara, keduanya merupakan sebuah masterpiece yang jangan sampai di lewatkan. Sebuah paket pengalaman sinematik yang tak bisa kamu saksikan satu kali saja. Akhir kata Samsara adalah salah satu film dengan visual yang memukau dalam sejarah perfilman dunia.'),
(621, 'Season of the Witch', 'NEGATIF', 'DATA UJI', 'Season of the Witch sesungguhnya tidak lebih dari sebuah kisah fantasi medioker yang lemah nyaris di semua sisinya. Sebuah film akan dengan mudah dilupakan penontonnya, sama persis seperti apa yang pernah dilakukan Cena terhadap Kate Beckinsale pada Whiteout 2009 lalu, meskipun kali ini tidaklah sampai seburuk itu.'),
(622, 'Silent Hill: Revelation 3D', 'NEGATIF', 'DATA UJI', 'Sekuel yang buruk dari seri terbaik. Jika kamu bukan fans berat video game-nya mungkin akan sulit menikmati apa yang akan tersaji di 94 menit durasinya yang diisi oleh naskah yang compang camping, horor yang lembek, 3D yang tidak bekerja dan karakter yang lemah. Kabar baiknya, open ending-nya membuka kemungkinan sekuel lagi di masa depan,'),
(624, 'Seru', 'NEGATIF', 'DATA UJI', 'Mocku horor yang terlalu ambisius, eksekusi buruk, membosankan, akting murahan sama sekali tidak mencerminkan judulnya, bahkan negara-negara tetangganya saja mampu memberikan tontonan yang lebih baik ketimbang ini, lihat Haunted Changi (Singapura) atau Keramat dari negara kita. Yah, sisi positifnya, setidaknya Nayato dan Terekam miliknya akan mendapat saingan tangguh kali ini.'),
(625, 'Being Elmo', 'POSITIF', 'DATA UJI', 'Ini bukan sekedar kisah hidup menarik tentang seorang pawang boneka bernama Kevin Clash dan bagaimana ia menjadi Elmo yang fenomenal itu, tapi Being Elmo: A Puppeteers Journey juga sebuah sajian dokumentar inspiratif, manis yang tersaji dengan sederhana namun mampu menyentuh hati para penontonnya.'),
(626, 'Soekarno', 'NEGATIF', 'DATA UJI', 'Story percintaan yang bermasalah masih diperparah dengan penampilan Ario Bayu yang mengecewakan. Fisik dan parasnya mungkin menunjang, tetapi pemeran Satrio dalam Catatan Harian si Boy itu gagal menghadirkan kharisma besar seorang pemimpin bangsa yang disegani hingga sekarang. Kecuali pada bagian rayu-merayunya, Ario Bayu tidak pernah berhasil mengundang rasa simpati dalam setiap momennya.'),
(627, 'Spectre', 'NEGATIF', 'DATA UJI', 'Harapan akan suguhan Bond pemungkas era Craig yang berkesan sepertinya gagal dihadirkan Mendes kali ini. Ya, ekspektasi akan narasi yang lebih dalam dari para pendahulunya ternyata tidak terbukti meski sebenarnya potensi menjadi besar ada di dalamnya. Coba cek, trailer yang menampilkan suasana suram yang seakan-akan menitik beratkan pada pribadi dan masa lalu Bond serta rahasia besar yang akan terkuak nanti, tetapi dalam perjalanannya tidak demikian. Setelah 15-20 menit penontonnya perlahan akan menyadari bahwa naskah keroyokan garapan John Logan, Neal Purvis, Robert Wade dan Jez Butterworth ini menjadi terlalu dangkal, jauh dari yang diharapkan'),
(628, 'The Body', 'POSITIF', 'DATA UJI', 'Pertunjukan utamanya memang misteri dan twistnya, tetapi bukan berarti tidak ada karakter menarik di dalamnya. Setiap tokohnya punya motif terselubung, setiap karakternya punya masa lalu yang ingin dihilangkan. Sayang Belen Rueda tidak maksimal karena tuntutan perannya yang harus membuatnya terkesan misterius. Namun perseteruan  Jose Coronado dan Hugo Silva di sepanjang film itu bisa menjadi highlight tersendiri terutama bagaimana satu dengan yang lainnya berusaha adu pintar dengan motif berbeda.'),
(629, 'The Boy Next Door', 'NEGATIF', 'DATA UJI', 'Sebenarnya tidak ada yang salah dengan perubahan plot-nya yang menghilangkan unsur sesualitasnya sama sekali pada akhirnya, bahkan kalau mau jujur J.lo pun bermain tidak buruk, jauh lebih baik dari penampilan cast lain, tetapi apa yang dilakukan Cohen ini adalah kesalahan fatal ketika ia seperti terlalu cepat merubah narasi The Boy Next Door dari thriller erotis menjadi sekedar thriller medioker semata tanpa proses yang kuat.'),
(630, 'The Cat', 'NEGATIF', 'DATA UJI', 'Sesuai judulnya The Cat akan dipenuhi dengan banyak kucing bertampang lucu nan menggemaskan namun mereka juga terlihat mengerikan disaat bersamaan. Ada hantu juga disini yang semakin memeriahkan horor Seung-Wook ini. Tapi naas, selain premisnya yang menarik, misteri yang membuat penasaran atau akting hebat dari para kucing, ya, serius, mereka tampil lebih baik dari para pemain manusia, tidak ada lagi yang bisa ditawarkan salah satu entri iNAFFF 2011 ini, dengan segera ia akan mudah dilupakan begitu anda selesai menontonnya.'),
(631, 'The Caller', 'POSITIF', 'DATA UJI', 'Konsepnya bagus, memadukan horor supranatural, time travel, dan slasher walau tidak lagi baru tapi yang terpenting The Caller sudah bekerja baik memberikan tontonan yang memikat, efektif dalam menghadirkan teror dan kengerian layakya horor sejati. Ya, masih ada kekurangan-kekurangan didalamnya, tidak menjadi masalah besar jika anda tidak terlalu serius memikirkannya, siapa juga sih yang bisa membuat film sempurna? Apalagi untuk sebuah horor.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(633, 'The Chronicles of Narnia: Voyage of the Dawn Treader', 'POSITIF', 'DATA UJI', 'Overall, The Chronicles of Narnia: The Voyage of the Dawn Treader mungkin terlihat jauh lebih sederhana ketimbang dua predesesornya, namun tidak membuat epik petualangan fantasi satu ini kehilangan pesonanya sebagai sebuah sajian ringan dan menghibur yang dapat dengan mudah disantap oleh seluruh anggota keluarga. Sayangnya kita harus berpisah dengan Lucy dan Edmund disini, karakter-karakter manusia terakhir yang menjadi benang merah di dua instalemen sebelumnya, namun setidaknya suka tidak suka, kita sudah diperkenalkan oleh seorang pahlawan baru, penerus kisah Narnia dalam diri Eustace.'),
(634, '9', 'POSITIF', 'DATA UJI', 'Sekali lagi Tim Burton membuktikan kapasitasnya sebagai penghasil film berkualitas, walaupun hanya menjadi produser namun jelas sekali sentuhannya cukup dominan disini, membuat 9 menjadi salah satu animasi terbaik dan beda pada tahun 2009 lalu.'),
(635, '10 Promises to My Dog', 'POSITIF', 'DATA UJI', 'Layaknya kebanyakan film drama Jepang, kisah 10 promises to My Dog juga mengalir pelan dan lembut, dipenuhi dengan visual dan sinematografi indah, dan lantunan musik-musik klasik penggugah emosi. Dukungan akting dari pemain-pemainnya seperti artis cantik Rena Tanaka sebagai sang majikan juga membuat film satu ini berjalan dengan manis hingga akhir.'),
(636, '1,778 Stories of Me and My Wife', 'POSITIF', 'DATA UJI', 'Pada akhirnya 1,778 Stories of Me and My Wife tidak terlalu berbeda jauh dengan kebanyakan melodrama tearjerker lainnya. Ia mampu bergerak  indah, lembut, dengan segala kisah cintanya, mengharu biru melukiskan perjuangan seorang suami untuk membahagiakan istri tercintanya yang sekarat dengan caranya sendiri yang tidak biasa, walaupun berujung klise, dan jika ada satu-satunya yang kemudian menjadi garis pembeda dengan kebanyakan film bertema sama lainnya adalah bagaimana dasar kisah nyata menarik dan sangat romantis serta bagaimana unsur fiksi ilmiah yang berperan besar didalamnya.'),
(637, '3 Srikandi', 'POSITIF', 'DATA UJI', 'Menarik tentu memilih cabang olahraga tak terkenal untuk dijadikan bahan jualannya, bahkan seingat saya, Hollywood pun tidak punya persediaan sport movie macam ini. Jadi sekali lagi ini menarik, secara konsep ia memang tidak jauh-jauh dari drama-drama olahraga kebanyakan, mengusung cerita perjuangan untuk menjadi yang terbaik, namun kombinasi kisah nyata dan casting bagus bisa membuat 3 Srikandi menjadi istimewa.'),
(638, '50-50', 'POSITIF', 'DATA UJI', 'Naskah juara dari Will Reiser dan Joseph Gordon-Levitt adalah sang bintang  di sini yang mampu melebur sempurna dalam penyutradaraan apik dari Jonathan Levine  membuat 50/50 tidak hanya sukses membuat anda tertawa ringan dengan joke-joke gelap-segarnya, namun juga mampu menyentil hati anda ketika melihat bagaimana suka duka pengidap kanker dalam bertahan hidup yang tersaji dengan sangat baik di sepanjang 100 menit durasinya. Ya, ini adalah film yang bagus.'),
(639, 'A Girl Walks Home Alone at Night', 'POSITIF', 'DATA UJI', 'Tidak banyak dialog terucap di sepanjang 1 jam 44 menit durasinya. Amipour memilih kesunyian untuk menegaskan tema horornya dan memperbanyak permainan bahasa tubuh dan mimik untuk berbicara, menunjukkan emosi dan cinta terselubung dalam interaksi antar karakternya. Sementara di balik setiap momennya, tidak ketinggalan Amipour menyelipkan soundtrack-soundtrack pop-rock alternatif pilihan yang sukses menghasilkan sebuah kesan tersendiri buat jati dirinya yang unik.'),
(640, 'About Time', 'POSITIF', 'DATA UJI', 'Alurnya sendiri bergerak cepat dan mulus dalam tone gembira. Seiring berjalannya waktu kita tahu bahwa ini tidak hanya melulu bercerita soal cinta sejati dari kekasih impianmu. Ada hubungan ayah-anak dan adik-kakak yang berusaha disandingkan Curtis bersama elemen cinta dan time travel dengan cakupan hidup karakternya yang disajikan secara periodik dalam balutan gambar-gambar cantik dan pilihan soundtrack asyik. Hasilnya bisa dibilang cukup menyentuh terutama pada bagian ayah-anaknya yang kalau mau jujur, adalah  romance utama film ini,'),
(641, 'Amores Perros', 'POSITIF', 'DATA UJI', 'Overall, mencari sebuah film dengan kisah cinta yang tidak biasa baik dalam cerita maupun penyajiannya? Amores Perros mungkin pilihan yang tepat, sebuah karya terbaik dari seorang Alejandro Gonzalez Inarritu yang wajib ditonton.'),
(642, 'Big Hero 6', 'POSITIF', 'DATA UJI', 'Big Hero 6 punya daya magis pada kesederhanaan plotnya, dan besarnya hati yang ditawarkan seperti kebanyakan film-film Disney dengan segala kekuatan moralnya. Dan layaknya film superhero, tentu saja ceritanya tidak jauh-jauh dari pertempuran antara kebaikan melawan kejahatan yang kemudian dipoles lagi dengan sentuhan hangat cerita persahabatan dan relasi adik-kakak, coming of age dan penciptaan sebuah origin.'),
(643, 'Carandiru', 'POSITIF', 'DATA UJI', ' Carandiru, film yang diangkat dari kisah nyata ini mampu tampil solid di semua sisi, dan mampu memberikan gambaran yang cukup realistis dari salah satu peristiwa sejarah yang paling berdarah yang pernah terjadi dalam sejarah lembaga pemasyarakatan modern di Brasil maupun di dunia.'),
(644, 'Cold Eyes', 'POSITIF', 'DATA UJI', 'Plotnya digeber secepat mungkin dari menit-menit awal guna menetapkan tone mendebarkannya. Lalu narasi cerdas garapan Jo Ui Seok membuat thriller spionase yang tayang perdana di festival film Toronto lalu ini seperti tidak pernah berhenti mencengkerammu bersama sedikit bumbu komedi dan dramanya serta kejutan di ending sebagai bentuk tribut buat versi aslinya'),
(645, 'Dead End', 'POSITIF', 'DATA UJI', 'Wow!!  Saya tidak pernah menyangka sebelumnya bahwa Dead End ternyata mampu menjadi sebuah suguhan horror-misteri yang sangat menarik dan mencekam. Premisnya sendiri sebenarnya sederhana, hanya bercerita tentang sekelompok keluarga yang tersesat, namun hebatnya duet sutradara Jean-Baptiste Andrea dan Fabrice Canepa ini mampu memberikan sebuah pengalaman misteri yang membuat penontonnya bertanya tanya apa yang sebenarnya terjadi di jalan yang sepi itu.'),
(646, 'DIvergent', 'POSITIF', 'DATA UJI', 'Sesi perkenalan buat karakter Tris berlangsung mulus dengan akting dan pesona Woodley yang berhasil menjual tokohnya dengan baik dari seorang Abnegation yang membosankan menjadi Dauntless tanpa rasa takut dan tubuh bertato. Pergolakan batin, pencarian jati diri dan porsi asmaranya ditampilkan berimbang tanpa terkesan terburu-buru.'),
(647, 'Earthlings', 'POSITIF', 'DATA UJI', 'Film ini mungkin saja mengubah penontonnya jadi vegetarian, tapi itulah inti dari film ini. Untuk menimbulkan reaksi penontonnya, dan itupun efektif, ditambah narasi yang dibawakan sangat bagus oleh Joaquin Phoenix. Saya salut sama dokumenter ini,'),
(648, 'Evil Dead 2', 'POSITIF', 'DATA UJI', 'Evil Dead 2 jelas adalah sebuah sekuel solid yang setidaknya mampu menyamai pesona seri pertamanya. Memang ia terlalu banyak bercanda, tapi Raimi tetap setia menghadirkan kengerian klasik ala horor-horor jadul dengan segala elemen-elemen teknis pendukungnya, termasuk melebarkan lagi lebih jauh ceritanya, memaksimalkan akting kuat Bruce Campbell yang mengasyikkan dan juga menggelikan. Ya, ini memang sebuah sekuel dari horor sejati.'),
(649, 'Filth', 'POSITIF', 'DATA UJI', 'McAvoy adalah jagoan kita,  sosok anti-hero brengsek, mudah dibenci dengan segala tindakan amoralnya, namun narasi Braid bersama kombinasi performa apik McAvoy juga sanggup menghadirkan simpati yang sama besarnya. Kita tahu kapasitas McAvoy, pria Skotlandia ini sudah mencoba semuanya, dari  faun, superhero komik, pemimpin mutant populer sampai polisi korup.  Di sini McAvoy tidak hanya memesona ia adalah alasan mengapa Filth bisa tampil sekotor ini.'),
(650, 'Final Destination 5', 'POSITIF', 'DATA UJI', 'selain masih menghadirkan kematian-kematian yang kreatif, canggih dan menghibur, termasuk bagaimana efek 3D yang mampu digarap dengan sangat baik, instalemen kelima dari saga mencurangi kematian ini rupanya juga menyimpan kejutan yang tak disangka-sangka di penghujung ceritanya,'),
(651, 'FInding Dory', 'POSITIF', 'DATA UJI', 'Finding Nemo bisa dikatakan adalah salah satu animasi paling cantik yang pernah dibuat, kini dalam Finding Dory, para animator-animator jenius Pixar tetap mempertahankan segala yang terbaik dari Finding Nemo kemudian memolesnya, menaikkan tingkatannya lebih tinggi dengan teknologi yang lebih canggih dan baru dan tentu saja lebih mahal. Lihat saja bagaimana animasi airnya yang semakin nyata, teknis pencahayaan dan photorealistic yang menghasilkan tekstur sempurna'),
(652, 'Fury', 'POSITIF', 'DATA UJI', 'Setiap adegan yang melibatkan Fury dan Nazi hadir dalam sebuah ketegangan luar biasa dan juga brutal tanpa ampun. Spesial efeknya meyakinkan, sound editing fantastis, suara yang dihasilkan dari setiap peluru yang terhambur bak perang laser yang intens dengan, dan dentuman meriam Sherman itu terasa begitu spektakuler.'),
(653, 'Habibie & Ainun', 'POSITIF', 'DATA UJI', 'Habibie & Ainun adalah sebuah biopik yang bagus, jarang ada film-film lokal berkualitas yang menghadirkan sosok besar yang dikenal masyarakat luar kita jelajahi melalui sisi lainnya, dalam hal ini sisi romantisme yang kental, dan itu bekerja dengan sangat baik termasuk akting yang luar biasa dan juga teknis yang mendukung,'),
(654, 'Haunters', 'POSITIF', 'DATA UJI', 'Haunters, tontonan superhero ala Korea Selatan ini harus diakui memang sangat menghibur dan enjoyable dari start sampai finish. Tidak memiliki kualitas naskah yang bagus memang dengan beberapa lubang sana sininya yang sedikit mengganggu, tapi tidak ada film yang sempurna, dan saya sangat memaklumi hal itu karena sekali lagi Haunters sudah mampu memberikan tontonan aksi fantasi good vs evil yang sangat keren plus pesona hebat dari kedua aktor utamanya.'),
(655, 'Hijab', 'POSITIF', 'DATA UJI', 'Satu hal yang saya suka dari Hanung di sini adalah ia tidak pernah menjadi Tuhan untuk memaksakan akan adanya sebuah konklusi ajaib, tidak ada dramatisasi berlebihan yang sampai harus menggoyang kepercayaan karakternya akan sesuatu paham yang dipegangnya teguh, sebaliknya Hanung membiarkan semuanya mengalir apa adanya dengan sebuah akhir yang bisa menyenangkan semua pihak, sesuatu yang jarang dilakukan Hanung ketika membuat film-film dakwah seperti ini.'),
(656, 'Kumiko, The Treasure Hunter', 'POSITIF', 'DATA UJI', 'Butuh waktu untuk bisa benar-benar menikmati Kumiko, The Treasure Hunter. Sebagai sebuah drama slow burn, Zellner tidak pernah terlalu terburu-buru menggerajkan plot-nya, sebaliknya ia mencoba memperkenalkan siapa Kumiko kepada penontonnya, membiarkan audiens merasakan setiap tingkah laku dan kenyentrikannya yang terbungkus dalam visual cantik namun dingin dan nuansa depresi kental yang mungkin akan menyesakkan.'),
(657, 'Last Shift', 'POSITIF', 'DATA UJI', 'DiBlasi sukses menghadirkan sebuah pengalaman berbeda menonton horor rumah hantu. Secara keseluruhan Last Shift punya kadar kengerian dan ketegangan yang digarap dengan sangat baik. Aroma sesak bercampur misteri pekat kemudian menyelimuti 90 menit durasinya bersama pergerakan kamera yang pintar dan scoring eerie yang menyayat.'),
(658, 'Lights Out', 'POSITIF', 'DATA UJI', 'Sandberg dengan sangat-sangat lihai membangun tensinya, menjaganya dengan baik antara drama ibu-anak dan fenomena supranatural hingga akhir bersama banyak jump-scare tak terduga yang akan membuatmu gelisah hingga menjerit keras dengan sangat efektif.'),
(659, 'London Has Fallen', 'POSITIF', 'DATA UJI', 'Semua cast utamanya kembali pada posisinya masing-masing termasuk Morgan Freeman dan Angela Bassett yang selalu pantas memerankan karakter staf pemerintahan dengan pakaian rapi  dan yang paling tentu saja penampilan Gerard Butler yang semakin sangar sebagai Mike Banning.'),
(660, 'Machete', 'POSITIF', 'DATA UJI', 'Ya, inilah salah satu fim paling menghibur dan paling kreatif di 2010. Robert Rodriguez tahu benar bagaimana menghadirkan sebuah paket brainless action movie dengan gaya B movie yang kental. Machete jelas bukan film untuk semua orang tapi jelas it works for me.'),
(661, 'Memories of Murder', 'POSITIF', 'DATA UJI', 'Bong Joon Ho benar-benar menyajikan plot dan koflik-konfliknya dengan sangat cerdas dan enjoyable serta tensi ketegangan mampu dijaga dengan baik, belum lagi hadirnya twist-twist yang dijamin akan banyak mengejutkan kita dari awal hingga akhir. Satu elemen lagi yang membuat film berdurasi 127 menit ini menjadi berbeda adalah masuknya unsur-unsur komedi, jadi selain mencekam film ini juga akan membuat kita tersenyum bahkan tertawa melihat tingkah laku yang dibuat para karakternya, khususnya karakter Detektif Park Doo Man.'),
(662, 'Metropolis', 'POSITIF', 'DATA UJI', 'Yang membuat film ini mendapat nilai tinggi bukan karena cerita dan plotnya tapi karena visi yang di sampaikan Firtz Lang kepada penonton  disebut-sebut sebagai salah satu film yang sangat berpengaruh, yang menginspirasi sebagian besar film-film fiksi ilmiah seperti Coruscant di Star Wars, Blade Runner, Dark City dan The Fifth Element. Visual effect yang disajikan Firtz Lang begitu brutal walau 83 tahun lebih sudah umur film ini masih tetap terlihat inovatif dan memukau.'),
(663, 'Midnight in Paris', 'POSITIF', 'DATA UJI', 'Dari semua karya Woody Allen yang sudah saya tonton, bisa jadi Midnight in Paris adalah film Allen yang paling ringan dan juga yang paling memesona, lihat saja dialog-dialog cerdasnya yang dibungkus dengan banyak percakapan santai itu atau ia dengan suksesnya mengeksploitasi setiap sudut kota Paris yang berkilauan itu dengan sangat baik, menghadirkan aura romansa, fantasi dan nostalgia yang menghipnotis melalui lensa Darius Khondji dan Johanne Debas. Dengan pendekatan yang hebat itu Allen sudah seperti seorang tour guide yang seakan-akan sudah mengajak kita berkeliling Paris,'),
(664, 'Mission Impossible: Ghost Protocol', 'POSITIF', 'DATA UJI', 'Bagi saya inilah film Mission Impossible seharusnya, Tidak seperti film-film sebelumnya yang hanya menitik beratkan ego seorang Ethan Hunt, sebuah perfect popcorn movie akhir tahun yang tidak hanya mengandalkan one man show dari seorang aktor Tom Cruise, tapi sebuah kerja team yang solid baik dari para pemainnya dan kru yang terlibat, ya tidak bisa dimungkiri kalau saya bilang dalam kategori film aksi terbaik tahun ini, Ghost Protocol berada di puncaknya.'),
(665, 'Moana', 'POSITIF', 'DATA UJI', 'Seperti judulnya, Moana mendominasi narasinya bersama desain karakter princess  baru Disney yang loveable lengkap dengan karakteristiknya yang penuh semangat, tangguh, ceria sekaligus berani. Disuarakan sempurna oleh pendatang baru Auli Cravalho yang juga turut bernyanyi. Sementara daya tarik di jajaran cast utamanya ada pada suara Maui yang disuarakan Dwayne Johnson.'),
(666, 'Monsters University', 'POSITIF', 'DATA UJI', 'MU bisa menjadi tontonan yang cukup menghibur sekaligus ajang bernostalgia dengan Wazowski dan Sulley yang lucu sekaligus menjadi saksi bagaimana keduanya bertemu untuk pertama kali, plus jangan lewatkan film pendek Blue Umbrela, cameo-cameo menarik dari monster-monster di film pertamanya dan tentu saja pencarian mobil Pizza Planet yang legendaris itu.'),
(667, 'Mother', 'POSITIF', 'DATA UJI', 'Gambar-gambar yang cantik dari perkampungan yang seharusnya nampak kumuh pun membuat cerita lebih menyenangkan untuk diikuti. Tentunya dengan pay-off yang luar biasa. Satu-satunya yang saya sesali dari menonton film ini adalah mengapa saya harus menunggu begitu lama.'),
(668, 'My Left Foot: The Story of Christy Brown', 'POSITIF', 'DATA UJI', 'Overall, debut penyutradaran hebat dari Jim Sheridan dan dukungan akting gemilang dari Daniel Day-Lewis menjadi kombinasi hebat yang membuat My Left Foot: The Story of Christy Brown menjadi sebuah biopik manis, kuat dan inspiratif. Sebuah kisah hebat yang jelas akan tinggal dan membekas cukup lama di benak setiap penontonnya.'),
(669, 'Mysterious Skin', 'POSITIF', 'DATA UJI', 'Overall, Mysterious Skin adalah sebuah drama luar biasa yang mampu menyampaikan pesannya dengan kuat, walaupun tema yang diangkat terbilang kontroversial namun pada kenyataanya film ini mampu membuka mata para penontonnya tentang kenyataan yang memang sering terjadi disekeliling kita, sebuah kenyataan yang suka atau tidak suka harus kita hadapi dengan besar hati'),
(670, 'Nebraska', 'POSITIF', 'DATA UJI', 'Pelan namun pasti, Payne bersama Nebraska membuatmu terasa akrab dengan ceritanya yang sendu. Kamu akan memahami narasinya seperti tokoh David yang sedikit demi sedikit memahami ayahnya. Ada rasa haru dan iba melihat Woody dan bagaimana David berusaha menjadi anak baik buat ayahnya. Emosinya memuncak pada adegan David bertanya tentang apa yang akan dilakukan Woody dengan uang satu juta itu sampai kemudian salah satu ending paling hangat tahun lalu menutup kisahnya. Sementara kadar dramanya digarap bagus, Payne tentu saja tidak melupakan komedinya. Seperti biasa, ada guyonan komedi hitam bersemayam di dalamnya,'),
(671, 'No Mercy', 'POSITIF', 'DATA UJI', 'bisa dibilang untuk tahun ini No Mercy yang notabene kurang terdengar gaungnya ini adalah salah satu thriller terbaik Korea Selatan. Dengan balutan plot cerdas, menggabungkan elemen-elemen investigasi ala penyelidik forensik seperti pada serial televisi Amerika Serikat, CSI atau Bones pada menit-menit awalnya kemudian langsung berbelok tajam di saat memasuki konflik utamanya. Rangkaian adegan-adegan berpacu dengan waktu yang dikombinasikan dengan kemampuan villain utama mengendalikan permainan menjadikan film ini terasa semakin menarik saja dan itu masih ditambah lagi dengan kehadiran twist demi twist berlapis yang mengejutkan di pertengahan hingga klimaks.'),
(672, 'Noriko''s DInner Table', 'POSITIF', 'DATA UJI', 'Tidak peduli seberapa jauh anda dapat mencerna film ini, tidak peduli bagaimana anda akan menilai film absurd satu ini. Norikos Dinner Table jelas berpotensi besar menjadikan anda seperti orang bodoh, namun bagi saya pribadi Norikos Dinner Table sudah sukses menorehkan bekas cukup dalam pikiran saya. Semuanya tidak lepas dari tangan dingin Sono berhasil menggodok premisnya dengan sangat baik, memberikan sebuah pesan masalah sosial yang berlaku di masyarakat dengan cara yang sama sekali tidak biasa.'),
(673, 'Nuovo Cinema Paradiso', 'POSITIF', 'DATA UJI', 'Overall, Nuovo Cinema Paradiso jelas adalah salah satu film terbaik Italia, atau mungkin salah satu film terbaik di dunia. Sebuah film yang mampu membuat penontonya terbius dengan kisahnya yang luar biasa. Definitely A Masterpiece!!'),
(674, 'Only God Forgives', 'POSITIF', 'DATA UJI', 'Only God Forgives adalah sebuah karya yang mistis dan divisif. Winding Refn seakan hanya mengeksplor gaya aestetik filmmaking-nya tanpa memperhatikan aspek-aspek lain yang membuat sebuah film menjadi karya yang memuaskan. Saya tetap akan merekomendasikan Only God Forgives sebagai sebuah pelajaran unik dalam auteur filmmaking. Tetapi, terlepas dari gaya yang ditonjolkan olehnya, Only God Forgives juga masih menyisakan banyak hal yang dapat dianalisa dan didiskusikan.'),
(675, 'Percy Jackson & the Olympians: The Lightning Thief', 'POSITIF', 'DATA UJI', 'Overall, Percy Jackson & the Olympians: The Lightning Thief memang tidak akan sefenomenal Harry Potter series, namun setidaknya Columbus sekali lagi berhasil menghadirkan adaptasi novel laris dengan lumayan baik sehingga mampu menjadikan film ini menjadi sebuah film keluarga yang ringan dan menghibur, setidaknya bagi anak-anak dan para remaja.'),
(676, 'Robocop', 'POSITIF', 'DATA UJI', 'Kita tahu riwayat Padilha dengan senjata dan tembakan di filmnya, dan RoboCop miliknya mendapatkan porsi aksi yang pantas. Mungkin tidak sampai terlalu spektakuler untuk ukuran film berbiaya 120 juta Dollar, tetapi apa yang tersaji sudah lebih dari cukup untuk memamerkan kekuatan RoboCop yang baru. Pertarungannya dengan versi anyar ED-209 cukup mengesankan dan menghasilkan aroma nostalgia'),
(677, 'Sad Movie', 'POSITIF', 'DATA UJI', 'Sesuai judulnya, Sad Movie memang adalah sebuah film yang menjual melodrama romantis tingkat tinggi layaknya film-film drama romantis Korea Selatan sejenis dengan akhir yang sudah bisa ditebak seperti apa. Namun setidaknya film ini berani tampil beda dengan menyajikan sebuah drama multiplot yang digarap dengan presentasi dan elemen teknis cukup baik, khususnya visualnya yang indah dan memanjakan mata penontonnya.'),
(678, 'Shaolin', 'POSITIF', 'DATA UJI', 'Sebuah film bertemakan aksi laga klasik, Shaolin di bawah asuhan  Benny Chan ini sudah sukses menghadirkan sebuah paket hiburan lengkap dengan tidak lupa menyelipkan petuah-petuah dan ajaran-ajaran moral didalamnya.'),
(679, 'Soul Surfer', 'POSITIF', 'DATA UJI', 'Dengan berbekal kisah nyata yang luar biasa mengispirasi tampaknya sutradara Sean McNamara tidak mengalami kesulitan berarti untuk menghadirkan Soul Surfer sebagai sebuah drama keluarga menarik dengan kandungan pesan moral yang cukup tinggi'),
(680, 'Sully', 'POSITIF', 'DATA UJI', 'Selain faktor Hanks yang tampil meyakinkan, untungnya di menit-menit emosional, Sully cukup berhasil menggugah perasaan penontonnya. Aksi gagah berani sang Kapten juga bisa ditampilkan dengan baik dan sanggup memberi ketegangan tersendiri di detik-detik pendaratan yang menjadi aksi yang dikenang dunia hingga kini. Intinya, walaupun tidak sampai pada taraf mengesankan layaknya United 93 dari Paul Greengrass atau serumit Flight dari Robert Zemeckis, Sully yang terasa terlalu singkat dan tidak padat ini,  masih memberikan pesan heroik-humanis, terutama pada adegan klimaks yang cukup menguras emosi tersebut.'),
(681, 'The Armstrong Lie', 'POSITIF', 'DATA UJI', 'Gibeney punya cara untuk tetap memberikan penghormatan buat atlet favoritnya dengan cara yang elegan, memberikan penontonnya sisi lain Big Tex yang posfitif, bagaimana kecintaannya pada olahraga sepeda yang begitu besar, bagaimana perjuangannya menghadapi kanker ganas mampu memberi kekuatan buat banyak orang putus asa bersama yayasan kanker Livestrong yang didirikannya.'),
(682, 'The Hobbit: The Battle of Five Armies', 'POSITIF', 'DATA UJI', 'Salah satu elemen terbaik dari trilogi The Hobbit ia punya dukungan ensemble cast yang solid. Martin Freeman masih konsisten membawakan karakter Bilbo Baggins sebagai daya tarik utama narasinya sejak seri pertama digulirkan. Tidak ada konflik personal sebesar dua seri pertamanya, tetapi Bilbo seperti hobbit-hobbit dalam franchise middle-earth, selalu memegang kunci utama untuk menggerakkan plotnya, meskipun kalau mau jujur, sebenarnya adalah Richard Armitage yang benar-benar tampil bersinar sampai seri pemungkasnya ini.'),
(683, 'The Ides of March', 'POSITIF', 'DATA UJI', 'The Ides of March bisa jadi karya terbaik George Clooney di belakang kamera sekaligus pemain setelah Good Night, and Good Luck yang luar biasa itu. Duetnya dengan Gosling seakan-akan menunjukkan kepada penontonnya bagaimana cara kerja politisi-politisi berjas mahal dan bermulut manis itu sampai mereka bisa terpilih nantinya dalam balutan thriller politik paling cerdas, berliku dan kompleks tahun ini.'),
(684, 'The Kid With a Bike', 'POSITIF', 'DATA UJI', 'Ya, luar biasa memang karya Dardenne satu ini, di balik kesederhanaan premisnya mereka mampu menghadirkan sebuah narasi coming of age bocah 11 tahun yang hebat dengan teknis penyutradaraan gemilang dan performa hebat dari aktor ciliknya. Sebuah dongeng realistis dengan hati yang besar.'),
(685, 'The Lives of Others', 'POSITIF', 'DATA UJI', 'Sepertinya tidak terlalu mengejutkan ketika Florian Henckel von Donnersmarck dengan The Lives of Others miliknya ini berhasil membawa pulang penghargaan prestisius sebagai film berbahasa asing terbaik pada ajang Oscar 2007 lalu. Ya, selain menawarkan sebuah drama thriller berbasis sosial politik historis yang menarik, Florian Henckel juga mengajak penontonnya untuk menyaksikan sebuah kisah kuat dan menyentuh'),
(686, 'The Loved Ones', 'POSITIF', 'DATA UJI', 'Overall, perfilman Australia membuktikan bahwa mereka juga mampu menghadirkan sebuah torture porn yang tidak kalah mengerikannya dengan yang dibuat Hollywood. Tidak hanya kejam dan penuh darah, The Loved Ones juga sukses menghadirkan ikon psikopat baru dalam sosok cantik bernama Lola Stone.'),
(687, 'The Man With the Iron Fists', 'POSITIF', 'DATA UJI', 'Setidaknya saya harus angkat jempol atas keberaniannya menampilkan sesuatu yang berbeda dengan caranya sendiri, mungkin sedikit terlalu ambisius dan berlebihan, namun setidaknya The Man With The Iron Fists masih cukup menyenangkan untuk ditonton, terlebih jika kamu juga adalah fans karya-karya jadul Shaw Brothers atau kungfu klasik Wu-Tang.'),
(688, 'The Passion of the Christ', 'POSITIF', 'DATA UJI', 'Jadi apakah The Passion of the Christ adalah sebuah film yang bagus? Jika anda menanyakannya pada saya, tentu saya akan menjawab Ya. Terlepas dari berbagai kontroversi yang menerpanya, saya tetap menganggap bahwa Mel Gibson sudah melakukan sebuah pekerjaan yang hebat. Membawa saya dan mungkin para penonton lainnya kedalam sebuah perjalanan spiritual luar biasa dan emosional,'),
(689, 'The Revenant', 'POSITIF', 'DATA UJI', 'Dari menit pertama ia bergulir, Inarritu sudah langsung menetapkan tone The Revenant. Ya, ini adalah sebuah drama survival historis yang panjang, kelam, brutal, tragis dan dingin sekaligus sangat cantik di saat bersamaan ketika lagi-lagi si kambing Emmanuel Lubezki berhasil menghadirkan visual menggetarkan. Ya, tidak ada yang meragukan kemampuan sinematografer jempolan satu ini dalam menangkap gambar-gambar indah nan puitis'),
(690, 'The Ruins', 'POSITIF', 'DATA UJI', 'Overall, The Ruins jelas bukanlah tontonan horror yang istimewa, namun setidaknya film yang disutradarai oleh Carter Smith ini memiliki cerita yang cukup orisinil yang membuatnya sedikit berbeda dari kebanyakan film bertema sama lainnya.'),
(691, 'The Skin I Live In', 'POSITIF', 'DATA UJI', 'The Skin I Live In menghadirkan performa solid dari dua pemain utamanya. Ada Antonio Banderas yang bermain gemilang, memaksanya untuk mengeluarkan segala kemampuan beraktingnya. Karakter Banderas jelas menarik, sebagai seorang dokter bedah jenius ia mencoba bersembunyi dalam kedok ilmu pengetahuan untuk memenuhi ambisi pribadinya, menentang segala hukum yang berlaku untuk membuat sosok wanita sempurna dari nol bagi kepentingannya sendiri, seperti yang dilakukan Dokter Frankenstein disaat ia terobesesi membuat monster ciptaannya. Sang monster sendiri dibawakan oleh Elena Anaya dengan kencatikan dan keanggunannya yang luar biasa menjadikannya karakter wanita sempurna'),
(692, 'The Tale of Princess Kaguya', 'POSITIF', 'DATA UJI', 'Didominasi dengan teknik gambar tangan, bersama nuansa pastel yang mengalir dinamis, visual The Tale of Princess Kaguya itu tampil fantastis di atas kanvas putih dengan gayanya sendiri yang artistik dan menggetarkan.'),
(693, 'The Twilight Saga: Breaking Dawn Part II', 'POSITIF', 'DATA UJI', 'Ya, The Twilight Saga: Breaking Dawn  Part II memang susah untuk disebut sebagai salah satu yang terbaik tahun ini, tetapi dengan klimaks yang memuaskan seperti yang sudah tersaji tentu saja saya tidak berlebihan mengatakan bahwa ini adalah yang terbaik dari seluruh instalemen saga Twilight.'),
(694, 'The Way Way Back', 'POSITIF', 'DATA UJI', 'Setting pinggir pantai Cape Cod di New England lengkap dengan keceriaan Water Park menjadi tempat sempurna buat kisah perjalan menuju kedewasaan karakter utamanya, dalam kasus ini ada si  Duncan yang dimainkan apik oleh Liam James sebagai remaja canggung 14 tahun'),
(695, 'These Final Hours', 'POSITIF', 'DATA UJI', 'Menyimpan spesial efeknya untuk benar-benar digunakan di akhir film, Hilditch tahu benar bagaimana tetap mengakali filmnya untuk menjaga kadar ketegangannya dari awal ketika film dibuka dengan informasi bahwa meteor raksasa telah mendarat dengan sempurna di belahan bumi lain yang kemudian menjadikan plotnya intens seperti sedang menunggu hitungan mundur sebuah bom waktu. Menjadikan daerah suburbia Perth sebagai panggungnya, Hilditch berhasil mengakali keterbatasan sumber daya.'),
(696, 'Train to Busan', 'POSITIF', 'DATA UJI', 'Seperti kebanyakan film Korea, Sang Ho memberi banyak melodrama di dalamnya selain teror dan kengerian. Cerita tentang relasi ayah-anak, kemanusiaan, kepedulian terhadap sesama, pengorbanan hebat sampai krisis kepercayaan yang kemudian bercampur aduk dengan ketegangannya, menghasilkan pertunjukan roller coaster emosi.'),
(697, 'Trust', 'POSITIF', 'DATA UJI', 'Trust, sebagai sebuah drama tragedi yang mengusung fenomena sosial aktual yang kerap terjadi di keseharian kita dalam kehidupan modern ini sudah mampu menyampaikan pesannya dengan telanjang bulat, bahkan ia mampu tampil cukup manusiawi dan tidak terlihat seperti orangtua yang sedang menasehati anaknya tentang mana yang benar dan mana yang salah. Apalagi dukungan akting hebat dari artis mudanya, Liana Liberato membuat Trust menjadi semakin menarik.'),
(698, 'Undertow', 'POSITIF', 'DATA UJI', 'Dengan caranya yang sederhana, sensual, dan puitis plus dukungan sinematografi cantik yang mampu mengeksploitasi keindahan lanskap Cabo Blanco, akting hebat dan berani dari para pemainnya, khususnya Cristian Mercado dan Manolo Cardona yang mengesankan serta iringan scoring minimalis nan emosional, Undertow sudah tanpa sadar mampu menyentil hati kita dari dalam, merasakan bagaimana rasanya kekuatan cinta sejati.'),
(699, 'Vanishing on 7th Street', 'POSITIF', 'DATA UJI', 'Bagi saya pribadi Anderson sudah melakukan pekerjaanya dengan baik, membuat sebuah post-apocalyptic horror yang tidak hanya mencekam dan penuh misteri di dalamnya namun juga meninggalkan sebuah pesan besar tentang eksistensi manusia di bumi ini.'),
(700, 'War Horse', 'POSITIF', 'DATA UJI', 'So, War Horse, tipikal film keluarga ala Spielberg yang ringan, inspiratif, penuh melodrama tentang perjuangan dan persahabatan antara manusia dan kuda dengan dukungan kualitas sinematik tingkat tinggi. Memang bukan yang terbaik dari Spielberg, tidak sampai terlalu menyentuh, setidaknya buat saya, tapi jelas ini adalah pilihan film yang tepat jika anda mencari sebuah tontonan bersahabat untuk ditonton bersama-sama.'),
(701, 'White God', 'POSITIF', 'DATA UJI', 'Melihat perjuangan Hagen dalam bertahan hidup melalui serangkaian momen emosional dan brutal bisa jadi adalah bagian terbaik dari White God.'),
(702, 'World War Z', 'POSITIF', 'DATA UJI', 'Ini adalah salah satu film zombie terbaik yang pernah ada, bukan hanya karena menawarkan skala super besar, efek CGI canggih dengan budget raksasa serta disutradarai sutradara sekaliber Marc Forster dengan bintang Brad Pitt saja namun ini adalah semua kombinasi maut dari semua keasyikan yang kamu temukan dalam film-film zombie dengan polesan ketegangan dan keseruan yang jempolan.'),
(703, 'X-Men: Days of Future Past', 'POSITIF', 'DATA UJI', 'Sedikit komedi dari mulut lancang Logan dan terutama adegan yang melibatkan momen Quick Silver lengkap dengan efek slowmo kerennya membuat DOFP terasa lebih segar sebelum semuanya kembali menjadi gelap dan gelap sampai di penghujungnya.'),
(704, 'Y Tu Mama Tambien', 'POSITIF', 'DATA UJI', 'Overall, Y Tu Mama Tambien menjadi contoh nyata bagaimana road movie yang baik dan unik itu dibuat. Tidak hanya mampu menghibur namun juga memberikan inspirasi bagi para penontonnya tentang bagaimana menjadi pribadi yang dewasa. Bahkan salah satu film Indonesia, 3 Hari Untuk Selamanya terinspirasi dari film terbaik Alfonso Cuaron ini. '),
(705, 'You''re Next', 'POSITIF', 'DATA UJI', 'Sebuah kombinasi aneh yang lucunya, bekerja!. Kedua, kehadiran sosok heroine tangguh dalam diri Erin Harson yang dimainkan oleh alumnus Step Up 3, Sharni Vinson. Ya, ini mungkin faktor paling keren di sini, jarang-jarang dalam sebuah slasher, khususnya home invasion seperti ini bisa melihat sang korban, terutama wanita mampu melawan balik dengan kekuatan sama sadisnya'),
(706, 'Z for Zachariah', 'POSITIF', 'DATA UJI', 'Pemilihan cast cukup kuat untuk sebuah film kecil. Ada Margot Robbie yang belakangan tengah naik daun harus merelakan dirinya tampil jauh dari kesan glamor, namun jujur ia bermain bagus sebagai seorang gadis desa. '),
(707, '3AM', 'NEGATIF', 'DATA UJI', 'The Wig tidak menawarkan sesuatu yang istimewa, narasinya dangkal dan tingkat keseramannya rendah, seperti menonton horor dari sutradara amatiran yang baru saja membuat horor pertamanya, itu saya masih belum menyebut twistnya yang konyol.'),
(708, 'Ae Dil Hai Mushkil', 'NEGATIF', 'DATA UJI', 'Sayangnya keriaan di sepertiga plotnya, lalu digantikan dengan melodrama yang awalnya cukup mengaduk-aduk emosi, walaupun berasa klise, namun makin ke belakang makin terksesan laiknya opera sabun. Konfliknya begitu murahan, dan intrik cinta tak berbalas ala the boy falls in love but the girl doesnt juga serasa berlebihan. Hal ini ikut dirusak dengan karakter Ayan yang terkadang tampil mengganggu dengan sikap tak dewasanya,'),
(709, 'Apollo 18', 'NEGATIF', 'DATA UJI', 'Ketika Apollo 18 harus kehilangan segala keakraban dengan penontonnya, di saat bersamaan Gallego juga memperparahnya dengan gagal memberikan sentuhan ketegangan maksimal. Alurnya terasa bergerak begitu lama dan melelahkan untuk ukuran film berdurasi singkat (90 menit).'),
(710, 'Big Bad Wolves', 'NEGATIF', 'DATA UJI', 'Sedikit berantakan di menit-menit awal, Big Bad Wolves secara perlahan namun pasti kemudian menemukan ritmenya.'),
(711, 'Blitz', 'NEGATIF', 'DATA UJI', 'Buruknya Blitz tentu saja murni bukan kesalahan Statham, ia tetap tampil segarang biasanya walaupun kadar sangarnya sudah disunat habis-habisan, hanya meninggalkan tatapan wajah tak bersahabat dan guyonan-guyonan basi dan sedikit baku hantam sana sini,  bisa jadi karena faktor Statham  lah sebagai aktor laga nomor satu saat ini yang mungkin membuat saya dan sebagian penontonnya masih mau repot-repot untuk menonton,'),
(712, 'Carrie', 'NEGATIF', 'DATA UJI', 'Versi remake ini seperti mentah-mentah sedang melakukan copas dari milik De Palma di banyak beberapa adegan per adegannya. Bagi yang belum pernah menonton versi aslinya mungkin tidak masalah, namun buat penonton veterannya apa yang dilakukan Peirce terkesan malas,'),
(713, 'Delivery Man', 'NEGATIF', 'DATA UJI', 'Delivery Man terasa lebih orisinil dari kebanyakan komedi yang dibintangi Vaughn, tidak peduli pada akhirnya apakah kamu akan menyukainya atau tidak, ending yang cheesy itu dan beberapa subplot tak penting. Scott seperti nyaris tidak mengubah apa-apa pada narasinya.'),
(714, 'Dont Be Afraid of the Dark', 'NEGATIF', 'DATA UJI', 'Banyak yang tidak puas dengan naskah yang dibuat Del Toro kali ini, terlalu klise dan banyak plot hole kata mereka.'),
(715, 'Ender''s Game', 'NEGATIF', 'DATA UJI', 'Seperti kebanyakan penyakit lama dari kasus-kasus adaptasi novel ke film, Enders Game pun tidak lepas dari hal-hal yang sama;  menderita akibat kurangnya detil-detil penting yang dipilih sang sutradara untuk tidak diangkut dari novelnya, alasannya klasik, tidak ada cukup waktu untuk memindahkan 384 halamannya ke media yang hanya berdurasi 114 menit. Jadi yang terjadi kemudian selain plotyang berantakan adalah beberapa lubang besar yang membuat penonton awamnya bertanya-tanya, '),
(716, 'Fast & Furious 6 ', 'NEGATIF', 'DATA UJI', 'Secara keseluruhan keasikan level Fast & Furious 6 masih sedikit berada di bawah seri terdahulunya. Ya,  sulit untuk menandingi keasyikan lepas tanpa beban personal yang sudah dibuat Lin di seri ke limanya,'),
(717, 'Goosebumps', 'NEGATIF', 'DATA UJI', 'Kalau mau jujur presentasinya lebih terasa ke aroma FTV ketimbang film layar lebar dengan segala tetek bengek parade CGI murah untuk menghasilkan efek-efek dan monster-monsternya. Tetapi harus diakui juga ia punya tensi cepat yang terjaga setelah perkenalan dan sedikit basa-basi di 20 menit pertamanya,'),
(718, 'Hansel and Gretel: Witch Hunters', 'NEGATIF', 'DATA UJI', 'Hansel and Gretel: Witch Hunters hanya ingin menjual banyak adegan aksi tanpa otaknya bersama balutan blood and gore yang tidak terlalu nendang plus dua bintang utamanya yang tampil tanpa greget juga tanpa kedalaman cerita yang sebenanya punya potensi untuk dijadikan franchise baru jika digarap lebih serius. Hansel and Gretel: Witch Hunters adalah film yang dengan mudah akan kamu lupakan begitu end credit bergulir.'),
(719, 'Hercules', 'NEGATIF', 'DATA UJI', 'Ia punya Dwyne Johnson sebagai ikon film-film seru macam ini, namun sayang sekali lagi momen action juga sama mediokernya. Ya, ada banyak adegan pertempuran masif, tetapi semuanya digarap setengah-setengah tanpa dukungan spesial efek dan CGI yang mumpuni, memang tidak sampai terasa murahan namun apa yang tersaji masih terasa kecil dari harapan'),
(720, 'Hereafter', 'NEGATIF', 'DATA UJI', 'Singkat kata meskipun dari luar Hereafter terlihat begitu percaya diri menjunjung tema after life, namun sayang pada kenyataannya naskah yang ditulis oleh Peter Morgan ini tampak kurang berdiri kuat, datar dan sedikit kedodoran pada eksekusinya.'),
(721, 'I Am Number Four', 'NEGATIF', 'DATA UJI', 'I Am Number Four memulai franchise dengan kurang meyakinkan, ia tampak seperti sebuah serial televisi dengan durasi panjang ketimbang sebuah film. Kali ini harus diakui Caruso gagal mengolah adegan per adegannya dengan maksimal, masih terlalu banyak momen datar, repetitif, membosankan dan cheesy di 3/4 durasinya,'),
(722, 'Miracle in Cell No. 7', 'NEGATIF', 'DATA UJI', 'Beberapa momennya terasa terlalu berlebihan, saya masih belum menyebut plot hole dan ketidak konsistenan yang bertaburan di sana sini, tetapi saya percaya penontonnya terlalu sibuk memofuskan semuanya pada Lee Yong Gu dan Ye Sung sampai lupa untuk memikirkan bagaimana sebuah penjara dapat semudah itu dibuat keluar masuk.'),
(723, 'Mr. Poppers Penguins', 'NEGATIF', 'DATA UJI', 'Mr. Poppers Penguins, seperti bukunya ia memang ditujukan buat ranah penonton anak-anak, atau setidaknya ditonton bersama anak-anak, adik atau keponakan anda. Tidak ada yang istimewa di sini, ceritanya yang ringan terlalu mudah ditebak, guyonannya datar, termasuk dengan ada atau tidak adanya nama besar Jim Carrey sekalipun'),
(724, 'Now You See Me 2', 'NEGATIF', 'DATA UJI', 'Ya, sebagai sebuah sekuel, Now You See Me 2 memang boleh lebih besar dan lebih meriah, tetapi apalah arti itu semua jika kamu terus menguap di satu jam pertamanya dengan segala pengulangan plot yang harus diakui, kualitasnya jauh lebih buruk dari seri pertamanya. Entah apa yang ingin ditonjolkan di sini.'),
(725, 'Pride and Prejudice and Zombies', 'NEGATIF', 'DATA UJI', ' Ya, kamu bisa saja memotong elemen horornya, dan ia tetap akan bisa berjalan normal layaknya puluhan adaptasi Pride and Prejudice lainnya, tetapi itu bukan pujian, apalagi ternyata dominasi Jane Austen juga tidak bekerja dengan baik, hasilnya, hambar dan membosankan.'),
(726, 'REC 4: Apocalypse', 'NEGATIF', 'DATA UJI', 'Memang masih ada momen intens di dalamnya yang melibatkan serangan mayat hidup yang agresif yang melibatkan darah dan gore, tetapi tidak ada yang benar-benar meninggalkan kesan berarti, belum lagi saya menyebutkan hampir semua karakternya sangat bodoh  disaat mereka mengambil keputusan yang seharusnya bisa dengan sangat mudah dilakukan, terutama menjelang akhir yang kacau dan menggelikan serta kemunculan twist yang serba memaksa.'),
(727, 'Rubber', 'NEGATIF', 'DATA UJI', 'Sangat disayangkan Dupieux tidak mampu menjaga ritme film ini dengan baik. Segera setelah 10 menit yang sangat menghibur itu berlalu, Rubber seakan-akan kehilangan arah menjadi sebuah film tanpa tujuan dengan cerita yang tidak jelas dan hanya berputar-putar di tempat, adegan yang terkesan  diulang-ulang. Bahkan  seburuk-buruknya horror kelas B saja masih bisa tampil lebih baik dalam bercerita ketimbang horror produksi Perancis satu ini. Semua itu masih diperparah  lagi dengan rangkaian plot hole yang bertebaran di sepanjang film,  apalagi di saat bersamaan  Dupieux memaksakan dunia nyata dan fantasi bercampur menjadi satu, menghasilkan sebuah kisah yang terkesan amburadul dengan guyonan black comedy yang super datar, membosankan dan diakhiri dengan ending yang sangat buruk.\r\n'),
(728, 'Scream 4', 'NEGATIF', 'DATA UJI', 'Tidak peduli seberapa usangnya formula yang diusung, seberapa cheesy dan klise adegan-adegan yang disajikan, atau dangkalnya naskah plus semakin banyaknya komedi yang disuguhkan, harus diakui Scream 4 tetap memberikan sebuah tontonan slasher menghibur sekaligus mengobati rasa kangen sebagian penontonnya'),
(729, 'Southpaw', 'NEGATIF', 'DATA UJI', 'Tanpa embel-embel kisah nyata seharusnya naskah garapan kreator serial televisi Sons of Anarchy, Kurt Sutter ini bisa menghadirkan sesuatu yang setidaknya bisa sedikit keluar dari zona nyaman, sekali lagi itu bukan masalah besar. Menggunakan formula tradisional yang sama yang sudah bolak-balik dipakai memang imbasnya membuat Southpaw menjadi begitu klise. '),
(730, 'Step Up 3D', 'NEGATIF', 'DATA UJI', 'Film ini memang hanya sekedar hiburan murni yang hanya, sekali lagi hanya menjual tarian-tarian semata jadi tidak usah protes jika kualitas akting dan ceritanya terbilang sangat standar jika tidak mau dikatakan buruk.'),
(731, 'Ted 2', 'NEGATIF', 'DATA UJI', 'Ketimbang memperhatikan plot yang semestinya bisa memberi kekuatan dan hati tersendiri dengan segala usaha Ted membuktikan kemanusiaannya dan persamaan hak, MacFarlane malah terlalu sibuk menyajikan canda gurau dan kekonyolan toilet yang sayang seperti saya bilang di atas, basi, garing dan tidak sampai seofensif dulu'),
(732, 'The Awakening', 'NEGATIF', 'DATA UJI', 'Kalau mau jujur, horor produksi BBC Films ini sebenarnya tidak terlalu menakutkan,  setidaknya buat saya ia, tampak terlalu familiar, kejutan-kejutannya tampak terlalu teratur termasuk twist endingnya sendiri, seperti modifkasi dari yang pernah ada bahkan kita  sudah bisa melihat bagaimana ia akan berakhir dari kejauhan.'),
(733, 'The Darkest Hour', 'NEGATIF', 'DATA UJI', 'Kehilangan ritmenya di paruh keduanya, karakter-karakter yang tidak menarik dan rentetan plot hole menganga menjadikannya bulan-bulanan cacian dan hinaan dari kebanyakan penontonnya. Untung saja saya tidak sekejam mereka, saya masih dapat menikmatinya dengan baik, menutup sebelah mata saya terhadap segala kekurangannya, kecuali penampakan aliennya yang buruk itu.'),
(734, 'The Green Hornet', 'NEGATIF', 'DATA UJI', 'jika anda salah satu penonton yang protes mengenai lemahnya kualitas cerita The Green Hornet jangan melulu menyalahkan Gondry, salahkan saja Seth Rogen dan Evan Goldberg, orang paling bertanggung jawab dibalik penulisan naskah film ini. Goldberg yang sebelumnya sudah bolak balik bekerja sama dengan Rogen yang  juga mengambil alih peran utama sebagai karakter Britt Reid disini sepertinya berupaya keras mencoba menghadirkan kisah superhero yang berbeda dan lebih manusiawi dibanding versi radio maupun serial televisinya, dengan tidak lupa banyak memasukan unsur-unsur komedi khas Rogen yang mungkin akan terasa garing bagi sebagian penontonnya.'),
(735, 'The Ledge', 'NEGATIF', 'DATA UJI', 'Ia juga dapat membuat beberapa penontonnya merasa tidak nyaman, terutama ketika Champan terlalu berlebihan mengekspos semangat anti agama di dalamnya melalui rangkaian dialog-dialognya yang tajam.'),
(736, 'The Place Beyond the Pines', 'NEGATIF', 'DATA UJI', 'Untuk ukuran sebuah crime drama, Pines terasa terlalu panjang meskipun tidak sampai bertele-tele. Namun pesonanya mulai luntur setelah Cianfrance dengan berani menghilangkan Gosling  terlalu cepat tepat di saat karakter yang dimainkannya itu tengah mencapai puncaknya.'),
(737, 'The Sylvian Experiments', 'NEGATIF', 'DATA UJI', 'Takahashi sepertinya tidak ingin memberikannya begitu saja karena apa yang terjadi di paruh kedua adalah rentetan ketidakjelasan demi ketidakjelasan, alih-alih semakin menarik The Sylvian Experiments malah berpotensi menjadi tontonan yang aneh, membingungkan dan membosankan,'),
(738, 'Thor: The Dark World', 'NEGATIF', 'DATA UJI', 'Sebenarnya kalau mau jujur, The Dark World mungkin sedikit berada di bawah ekpektasi saya, dan ini juga mungkin dirasakan oleh penonton yang lain terlebih sebelumnya sudah menonton trailernya terlebih dahulu.'),
(739, 'Warkop DKI Reborn Part I', 'NEGATIF', 'DATA UJI', 'Jujur saja, susah buat saya bisa untuk menikmatinya. Untuk kualitas cerita yang digarap Anggy berserta Andi Awwe Wijaya, Bene Dion Rajagukguk terasa terlalu absurd dan tanpa arah yang jelas, bahkan film-film Warkop terdahulu saja tidak sampai seaneh, seliar dan senorak ini dengan segala macam kehebohan yang tak wajar dan lebih parah,'),
(740, 'We Are What We Are', 'NEGATIF', 'DATA UJI', 'Berjalan dalam tempo lambat, dengan aura depressing yang kental serta pengunaan teknik long take dan kamera statis yang banyak mendominasi setiap adegannya, We Are What We Are jelas menjadi tidak mudah dikonsumsi oleh semua penontonnya terutama bagi mereka yang  terlalu berharap banyak akan suguhan kekerasan berlebih, atau sebuah torture porn dan gore fest konvensional.'),
(741, 'X-Men Apocaplypse', 'NEGATIF', 'DATA UJI', 'Sayang lagi-lagi sayang, sebagai fokus cerita sosok Apocalypse sendiri terbilang mengecewakan mengingat kebesaran namanya sebagai mutan pertama dan terkuat, tidak ada motif yang jelas selain kehancuran total, tidak ada kekejaman luar biasa'),
(742, '7500', 'POSITIF', 'DATA LATIH', 'Shimizu mulai unjuk gigi. Ia membawa teror horor ala asia, khususnya J-horror ke dalam kabin pesawat komersial Amerika yang sempit, mempermainkan rasa penasaran penontonnya untuk mengulik misteri tentang apa yang sebenarnya terjadi bersama rentetan teror yang dibangun merayap.'),
(743, '45 Years', 'POSITIF', 'DATA LATIH', 'Setiap ketenangan tanpa dialog menciptakan rasa tak nyaman dan gelisah, setiap emosi dihadirkan Haigh begitu nyata tanpa manipulasi, terbentuk dari setiap gestur tubuh dan tatapan mata yang berhasil dibawakan dengan sangat luar biasa oleh Charlotte Rampling dan Tom Courtenay sebagai pasangan lansia.'),
(744, '5 cm', 'POSITIF', 'DATA LATIH', 'Persahabatan, cinta dan perjalanan hebat, ya, 5 cm punya semua hal-hal bagus untuk menjadikannya sebuah drama adaptasi yang keren, bahkan teknisnya pun juga fantastis. Yang paling terlihat adalan bagaimana Rizal bersama DOP, Yudi Datau dan penata artistik Vida Sylvia tahu benar bagaimana mengeksploitasi gambar-gambar cantik nan puitis.'),
(745, 'A Dangerous Method', 'POSITIF', 'DATA LATIH', 'Michael Fassbender pun memerankan Jung dengan sangat mengesankan. Timing dalam melontarkan dialog dalam debat dan diskusinya dengan Emma Jung(Sarah Gadon) juga Freud dan Spielrein sangat relatable dan juga membuat hati saya berbunga-bunga (saya rasa jika Anda familiar dengan teori-teori Jung akan merasakan hal yang sama).'),
(746, 'A Simple Life', 'POSITIF', 'DATA LATIH', 'Maka inilah, A Simple Life, sebuah drama sederhana berhati besar yang begitu banyak menawarkan kehangatan, kasih sayang dan cinta dari sosok yang begitu dekat dengan kita dan bagaimana kita membalas dengan sepantasnya. Ya, saya suka bagaimana ia akan menguras  sisi emosionalmu tanpa harus menjadi kelewat sentimentil.'),
(747, 'All the Boys Love Mandy Lane', 'POSITIF', 'DATA LATIH', 'Adakah sesuatu yang membedakan All the Boys Love Mandy Lane dengan film-film setipe? Ada, dan itu ada dalam karakter Mandy Lane yang diperankan dengan sangat baik oleh si cantik Amber Hard. Ya, sutradara Jonathan Levine sukses memaksimalkan keunggulan fisik dan akting artis 24 tahun ini dalam membawakan karakter Mandy Lane dengan pengambilan sudut-sudut kamera cantik yang sepertinya memang sengaja ditempatkan untuk lebih menyorot sosok Mandy Lane yang jelita.'),
(748, 'Avatar', 'POSITIF', 'DATA LATIH', 'Cameron bisa dengan bebas untuk mengekspresikan kreasinya dan imajinasinya dalam teknologi komputer yang super canggih dan juga super mahal ini. Avatar jelas adalah sebuah film yang layak dimasukan dalam daftar film terbaik 2009 anda, atau mungkin salah satu film terbaik sepanjang masa, dengan segala kelebihannya yang luar biasa,'),
(749, 'Babi Buta yang Ingin Terbang', 'POSITIF', 'DATA LATIH', 'Tidak terlalu frontal memang dalam usahanya menyampaikan pesan-pesan tentang isu sensitifnya, bahkan harus diakui ia masih terlihat malu-malu, tapi bagaimanapun itu ia sudah berhasil membuat saya menyukai film ini, bukan karena saya ingin terlihat sebagai seorang penonton sok cerdas yang bisa menginterpretasi dengan mudah setiap momen absurd di dalamnya, bukan, bahkan saya masih harus melihat referensi dari para reviewer lain untuk itu.'),
(750, 'Bedevilled', 'POSITIF', 'DATA LATIH', 'Kudos jelas pantas disematkan kepada kedua pemain utamanya, khususnya bagi Yeong Hie Seo yang bermain luar biasa di sini. Perannya sebagai wanita yang tertindas sukses dibawakannya dengan apik, sampai-sampai membuat pesona dan kecantikan Ji Sung Won seakan-akan tenggelam dibawah bayang-bayangnya. Tidak salah berkat akting fenomenalnya di sini, Yeong Hie Seo kemudian banyak mendapatkan penghargaan sebagai artis terbaik di ajang-ajang festival film bergengsi.'),
(751, 'Blue is the Warmest Color', 'POSITIF', 'DATA LATIH', 'Pada akhirnya semua keberanian tabu itu berhasil diselaraskan dengan penampilan apik nan emosional dari kedua pemainnya, khususnya buat Exarchopoulos yang tampil luar biasa mengesankan menggerakkan narasi sederhana Kechiche  bersama setiap kerapuhan, kegelisahan dan energi yang dibawa karakternya dari ia remaja sampai menuju kedewasaan dalam sebuah proses transformasi yang meyakinkan,'),
(752, 'Bridesmaids', 'POSITIF', 'DATA LATIH', 'Di balik segala kegilaannya itu Bridemaids masih punya hati sebagai sebuah komedi menarik yang memberikan penontonnya sebuah kisah persahabatan yang tulus dan bagaimana kisah perjuangan seorang wanita yang menderita krisis usia 30 mencari jati dirinya.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(753, 'Eva', 'POSITIF', 'DATA LATIH', 'Dari awal film disuguhkan visualisasi robot-robot yang sangat realistis (membuat saya mengkhayal mengenai universe di mana semua hal itu benar ada), film ini tidak secara literal mereferensi 3 Laws of Robotic dari Isaac Asimov, tetapi jika ditilik secara keseluruhan masih ada secara implisit mengacu ke sana.'),
(754, 'Evil Things', 'POSITIF', 'DATA LATIH', 'Perez menggarapnya dengan cukup apik, terlebih untuk horor indie berbudget murah seperti ini ia mampu terlihat meyakinkan, di shoot dengan baik, tidak terkesan terlalu memaksakan dalam penggunaan kameranya,'),
(755, 'Exists', 'POSITIF', 'DATA LATIH', 'Setiap ketegangan berhasil digarap dengan baik, tensi terus meningkat sampai klimaksnya.  Pengunaan kamera termasuk kamera olahraga go pro yang menawarkan berbagai  sudut pandang orang pertama masih mampu memberikan pengalaman suspense langsung.'),
(756, 'Extremely Loud & Incredibly Close', 'POSITIF', 'DATA LATIH', 'Drama milik  Stephen Daldry punya segalanya untuk menjadikan dirinya pantas bersaing dengan kandidat film-film terbaik lainnya di ajang paling bergengsi untuk dunia perfilman itu. Kombinasi dari kejadian nyata dan drama emosional nan menyentuh  plus presentasi apik serta akting kuat dari aktor ciliknya menjadikan Extremely Loud & Incredibly Close salah satu drama  terbaik tahun lalu.'),
(757, 'F', 'POSITIF', 'DATA LATIH', 'Johannes Roberts, sang sutradara juga terbilang cukup lihai membangun atmosfer eerie yang menakutkan ketimbang menegangkan. Sepanjang film penonton akan merasakan bagaimana pergerakan kamera dan iringan scoring mengerikan menjadi kombinasi maut yang meneror indra penglihatan dan pendengaran kita. Ya, inilah bagian terbaik dari film produksi Inggris ini.'),
(758, 'Sausage Party', 'POSITIF', 'DATA LATIH', 'Duet sutradara Conrad Vernon dan Greg Tiernan tahu benar bagaimana mengimplementasikan kegilaan naskah yang ditulis Rogen dan Golberg yang turut dibantu Kyle Hunter dan Ariel Shaffir menjadi sebuah gelaran animasi dalam balutan elemen petualangan dan romantika yang menyenangkan sekaligus disturbing.'),
(759, 'Saving Mr Banks', 'POSITIF', 'DATA LATIH', 'Proses menarik dihadirkan dengan mulus, penuh kehangatan oleh Hancock bersama segala set Los Angeles dekade 60 yang menyakinkan, dan , tentu saja kebesaran pesona Thompson sendiri termasuk juga pengaruh besar dari karakter-karakter lain,'),
(760, 'Sherlock Holmes: A Game of Shadow', 'POSITIF', 'DATA LATIH', 'Ya, ini sekuel yang bagus. Ritchie sudah membuat A Game of Shadow lebih baik dari prekuelnya, setidaknya terlihat dari aspek hiburannya yang lebih dahsyat. Dengan alur cepat, penyutradaraan apik, bromance solid dan kehadiran villain tangguh, A Game of Shadow jelas adalah peningkatan signifikan untuk franchise detektif terpopuler sepanjang masa ini.'),
(761, 'Submarine', 'POSITIF', 'DATA LATIH', 'Submarine menjadi coming of age-teen romance yang meyenangkan, tidak menyangka jika film ini dibuat oleh sutradara yang belum pernah menghasilkan film layar lebar sebelumnya. Eksekusi yang keren, dialog cerdas, karakterisasi kuat dan balutan visual dan soundtrack yang tidak biasa cukup menutupi kisahnya yang sederhana.'),
(762, 'Talvar', 'POSITIF', 'DATA LATIH', 'Di jajaran pemain Irrfan Khan masih tampil bagus seperti biasanya. Didapuk menjadi karakter sentral penyelidik CBI Ashwin Kumar karismatik. Irfan Khan punya cukup keseriusan dan humor untuk membuat karakternya mudah disukai, belum lagi Gulzar juga memberinya masalah pribadi dalam sebuah sub plot rumah tangga yang sebenarnya tidak terlalu penting dan berhubungan dengan plot utamanya namun memberi sentuhan manusiawi buat perannya.'),
(763, 'Tampan Tailor', 'POSITIF', 'DATA LATIH', 'Jadi secara keseluruhan, Tampan Tailor sudah memberikan sebuah drama inspiratif emosional yang menarik dengan segala profesi tukang jahit, hubungan ayah-anak dan perjuangan dalam menjalani kehidupan dengan semangat pantang menyerah.'),
(764, 'Teddy Bear', 'POSITIF', 'DATA LATIH', 'Salah satu romance terbaik tahun ini. Saya suka ceritanya yang sederhana, memilih untuk menggunakan karakter tidak biasa untuk dijadikan pesona utamanya, karakter bayi raksasa yang mencari cinta, jati diri dan berharap dapat berkembang di usianya yang hendak mencapai paruh baya,  semuanya mampu dikemas simpel, hangat namun tidak sampai berakhir terlalu sentimentil namun masih mampu menghadirkan sebuah tontonan drama romantis yang manis.'),
(765, 'Temple Grandin', 'POSITIF', 'DATA LATIH', 'Meskipun hanya ukuran sebuah film televisi, Temple Grandin di luar dugaan ternyata mampu memberikan sebuah tontonan luar biasa. Tidak hanya menghibur namun juga memberikan inspirasi dan movitasi begitu besar bagi setiap orang yang menontonnya, apalagi didukung dengan performa hebat dari Claire Danes menjadikan film ini salah satu film drama terbaik untuk tahun 2010 ini.'),
(766, 'Tenggelamnya Kapal Van Der Wijck', 'POSITIF', 'DATA LATIH', 'Kekuatan Tenggelamnya Kapal Van Der Wijck sudah terlihat dari awal, ketika film dibuka, atau jika kamu sudah melihat trailernya jauh-jauh hari, ya, visual dan teknisnya. Digarap dengan sinematografi ciamik, kombinasi maut penyutradaraan Sunil, DoP  Pinky Mirror dan kameramen Yudi Datau yang tahu benar bagaimana mengeksploitasi lanskap cantik yang mampu menjadi bahasa visual tersendiri'),
(767, 'The Battery', 'POSITIF', 'DATA LATIH', 'Chemistry lepas Gardner dan Cronheim memberi banyak keceriaan untuk sub genre horor yang seharusnya kelam ini. Perbincangan santai mereka akan hobi, makanan sampai wanita memberi sentuhan manusiawi pada narasinya lengkap dengan iring-iringan playlist musik country dari pemutar musik milik Mickey.'),
(768, 'The Crazies', 'POSITIF', 'DATA LATIH', 'Breck Eisner sukses menghadirkan sebuah horror penuh ketegangan dan mengasyikkan tanpa terlalu banyak basa-basi dan tensi yang terjaga dengan baik dari awal hingga akhir. Dengan ceritanya yang sederhana dan ringan kita benar-benar diajak kedalam dunia The Crazies yang sunyi dan gelap'),
(769, 'The Croods', 'POSITIF', 'DATA LATIH', 'Kualitas animasi yang bagus, komedi yang sukses menghadirkan gelak tawa, 3D menawan, lanskap, karakter unik serta segudang pesan moral dan ini bukan Disney dengan Pixar nya. Ya, sekali lagi Dreamworks Animation membuktikan bawha mereka juga sanggup menghadirkan sebuah kualitas animasi jempolan yang dapat dinikmati semua umur seperti rival abadinya itu.'),
(770, 'The East', 'POSITIF', 'DATA LATIH', 'Saya senang bagaimana karakter Sarah Moss milik Marling berkembang dari A-Z di sepanjang filmnya, bagaimana secara perlahan namun pasti terjadi pergelutan antara kepentingan yang saling tarik menarik dan benturan moral, krisis identitas serta elemen romance yang sedikit banyak sudah mengubah dirinya, dan kamu tahu, lagi-lagi Marling membawakan setiap detik karakternya bersama akting memesona'),
(771, 'The Final Girls', 'POSITIF', 'DATA LATIH', ' Di balik segala konsep homage brilian yang digabungkan dengan elemen fantasi kreatif, tersembunyi drama relasi ibu-anak, drama tentang duka dan tentang kehilangan orang tercinta serta bagaimana melanjutkan hidup yang  secara  mengejutkan mampu menghadirkan emosi tersendiri. Kudos buat penampilan apik Taissa Farmiga dan Malin Akerman yang memberikan hati dan emosi buat The Final Girls dengan chemistry anak-ibu yang kuat,'),
(772, 'The Good Dinosaur', 'POSITIF', 'DATA LATIH', 'Ya, kita tahu Pixar adalah jagonya membuat animasi menakjubkan dan The Good Dinosaurs adalah salah satu mahakarya terbaik mereka ketika berbicara soal bagaimana visualnya dihadirkan. Lanskap-lanskap Amerika Utara pra sejarah dengan sedikit sentuhan western tergambar tidak hanya begitu detil, namun juga begitu cantik dan nyaris terlihat nyata, lihat saja rendering photo-realistic air dan vegetasinya yang sempurna,'),
(773, 'The Hidden Fortress', 'POSITIF', 'DATA LATIH', 'The Hidden Fortress merupakan salah satu film hitam putih yang nyaman dan enak untuk di tonton oleh semua kalangan, bukan hanya ceritanya yang mudah diikuti tapi juga mempunyai banyak pesan moral. Setting film yang di gunakan juga sangat luar biasa.'),
(774, 'The Host', 'POSITIF', 'DATA LATIH', 'Secara keseluruhan ini adalah adaptasi yang baik, bahkan lebih baik dengan keempat seri Twilight sekalipun jika digabungkan. Pesonanya ada pada sosok alien berjiwa murni yang dibawakan Ronan dengan solid, lalu ditambah naskah berisi dan penyutradaraan Niccol yang pas plus sinematografi cantik menjadikan The Host salah satu drama fiksi ilmiah yang bagus di genrenya.'),
(775, 'The Hunger Games: Catching Fire', 'POSITIF', 'DATA LATIH', 'Layaknya sebuah sekuel, Catching Fire tampil lebih meriah, tidak hanya karena budget yang dinaikkan sampai dua kali lipat, arena yang lebih mematikan, atau parade kostum-kostumnya yang lebih keren, namun juga karena diisi dengan para cast jempolan.'),
(776, 'The Imitation Game', 'POSITIF', 'DATA LATIH', 'Berbekal sisi rumit karakternya, dan bagaimana Turing menjalin hubungan dengan teman-temannya macam rekan wanitanya Joan Clarke (Keira Knightley) yang menjadi sahabat dalam suka dan dukanya. Plot The Imitation Game menjadi lebih menarik karena elemen-elemen pribadi dan psikologisnya ini mampu bersatu kuat dengan premis utamanya yang kemudian pada akhirnya menjadi bagian tak terpisahkan dalam pergerakan alurnya menginjak akhir film yang emosional itu.'),
(777, 'The Impossible', 'POSITIF', 'DATA LATIH', 'The Impossible tidak hanya bagaimana seorang J.A. Bayona dengan meyakinkan menggambarkan sebuah tragedi terbesar yang pernah terjadi dalam sejarah manusia itu pernah terjadi dengan segala elemen-elemen dramatisasi tingkat tingginya, namun ada sesuatu yang lebih dalam dari itu ketika sebuah semangat juang, kekuatan dan harapan luar biasa yang tidak pernah padam dalam diri manusia-manusianya'),
(778, 'The Imposter', 'POSITIF', 'DATA LATIH', 'Sebuah sajian intens mengasyikkan dengan kejutan-kejutan yang menghentak, ya, The Imposter mungkin saja membuatmu lupa bahwa ini bahwa ini bukan sebuah thriller fiksi, ini adalah sebuah dokumenter. Berterima kasihlah kepada Layton yang mampu membuat kisah kuatnya menjadi lebih kuat dengan penyajian yang juga sama kuatnya dengan dasar cerita nyatanya itu sendiri.'),
(779, 'The Man from Nowhere', 'POSITIF', 'DATA LATIH', 'The Man from Nowhere harus diakui berhasil menyajikan sebuah sajian action thriller yang menarik dan seru hingga akhir, apalagi ditunjang dengan penampilan seorang Won Bin yang sukses menampilkankehebatannya di sini dengan balutan aksi baku hantam dan tembak menembak tingkat tinggi yang jelas sangat menghibur.'),
(780, 'The Man from U.N.C.L.E', 'POSITIF', 'DATA LATIH', 'Kombinasi unik antara timur dan barat yang bertolak belakang ditambah juga dengan kahadiran Alicia Vikander di tengah-tengahnya kemudian berhasil memunculkan dinamika yang unik buat versi anyar The Man from U.N.C.L.E . Chemistry trio Cavill-Hammer-Vikander mungkin tidak terlampau kuat, namun apa yang dibuat Ritchie berhasil menghasilkan dampak besar dari perpaduan ketiganya tidak jarang menghasilkan sebuah humor tersendiri yang cukup memancing tawa.'),
(781, 'The Neon Demon', 'POSITIF', 'DATA LATIH', 'Elle Fanning bisa dibilang sukses memancarkan sosok gadis muda lengkap bersama kecantikan natural yang menghipnotis. Ada kesan rapuh sekaligus misterius dari karakter Jesse yang kerap berada di antara realita dan mimpi.'),
(782, 'The Perks of Being a Wallflower', 'POSITIF', 'DATA LATIH', 'Mungkin ini salah satu teenflick terbaik setelah St. Elmos Fire. Sebuah coming-of age dengan segala bumbu persahabatan, cinta dan segala suka duka masa remaja yang terbungkus dalam presentasi yang apik dan manis dari Stephen Chbosky; sang empunya cerita. The Perks of Being a Wallflower tidak hanya memberikanmu kesenangan sebuah romcom remaja, namun di sisi lain ia juga mampu menyentuh nurani ketika dihadapkan dengan konflik kelam pribadi karakter-karakter utamanya yang sukses dibawakan dengan gemilang. Salah satu yang terbaik tahun ini.'),
(783, 'The Raid 2: Berandal', 'POSITIF', 'DATA LATIH', 'Set piece Evans pun mengalami peningkatan luar biasa. Dari visual sinematografi yang semakin ciamik dan artsy, membuat setiap momennya terasa begitu membius dan puitis, editing yang super cepat dan taktis tanpa harus kehilangan pesona dari setiap adegannya, dan saya masih belum menyebut pergerakan banyak kamera liar dari Matt Flannery dan Dimas Imam Subhono.'),
(784, 'The Red Turtle', 'POSITIF', 'DATA LATIH', 'Ya, menarik memang bagaimana de Wit menyulap tema bertahan hidupnya menjadi drama yang lebih personal, penonton kemudian diajak melihat bagaimana kehidupan laki-laki itu di sana dengan selipan romansa,  bagaimana ia kemudian menyesuaikan diri dengan alam dan sekitarnya serta belajar tentang hidup dan cinta.'),
(785, 'The Sacrament', 'POSITIF', 'DATA LATIH', 'The Sacrement mungkin bukan benar-benar murni sebuah horor, tetapi ada atmosfer mencekam tersendiri yang membuat penontonnya merasa tidak nyaman. Ada rasa penasaran ketika melihat bagaimana para jemaat Eden Parish memancarkan kebahagiaan yang aneh, ada teror tak terlihat ketika Father yang dimainkan apik oleh Gene Jones muncul diiringi dengan sorak-sorai berlebihan dari pengikutnya.'),
(786, 'The Shrine', 'POSITIF', 'DATA LATIH', 'Menyenangkan sekali mengetahui bahwa sebuah horror low budget sepert The Shrine ini ternyata mampu berbicara lebih banyak dari dugaan saya sebelumnya. Tidak hanya menghibur dengan segala kesederhanaan bertutur namun di saat bersamaan tetap efektif menghadirkan suasana mengerikan, dan yang terpenting ia juga mampu memberikan kejutan menarik di penghujung ceritanya'),
(787, 'The Silent House', 'POSITIF', 'DATA LATIH', 'Penggunaan teknik long take yang rumit dari awal hingga akhir tentu saja dibutuhkan dedikasi luar biasa dari pemainnya, dan Florencia Colucci sudah mengemban tanggung jawab sulit itu dengan fantastis. Ini adalah sebuah one woman show dari Colucci, aktingnya sempurna, emosinya keluar secara natural membuat penontonnya dengan mudah merasakan apa yang dirasakannya bahkan transformasi karakternya di penghujung cerita juga luar biasa'),
(788, 'The Source Code', 'POSITIF', 'DATA LATIH', 'Tidak bisa dipungkiri dibawah tangan dingin seorang Duncan Jones Source Code telah sukses menjadi sebuah sajian drama thriller . Tidak hanya menegangkan,  ia juga cerdas, penuh kejutan demi kejutan hingga akhir , emosional dengan segala dilema moral dan petuah-petuah kehidupannya plus dukungan akting prima dari para pemainnya. Yes, Source Code akan membawa anda kembali merasakan sebuah mind blowing experience yang akhir-akhir ini sudah jarang kita dapatkan. Fantastis!'),
(789, 'The Treatment', 'POSITIF', 'DATA LATIH', 'Tidak ada yang lebih nikmat daripada mencicipi crime thriller dengan bumbu personal, David Fincher adalah ahlinya mencampur urusan kerja dan urusan pribadi pada karakternya, dan sutradara Belgia, Hans Herbots pun tahu benar bagaimana elemen personal akan membuat jalinan ceritanya menjadi semakin menarik dan intim.'),
(790, 'The Vow', 'POSITIF', 'DATA LATIH', 'Ya, kisah nyata yang melandasinya menambah lebih nilainya, sedikit mejauhkan dari kesan opera sabun. Meskipun skripnya terkesan canggung, tetapi The Vow  di bawah arahan Michael Sucsy ini punya semua yang dibutuhkan untuk menghadirkan sebuah romansa yang efektif, ringan dan tentu saja sangat manis.'),
(791, 'The Ward', 'POSITIF', 'DATA LATIH', 'The Ward menjadi sebuah come back yang cukup meyakinkan dari seorang Joh Carpenter setelah 10 tahun ini sudah terlelap dalam tidur panjangnya. Jelas bukanlah performa terbaiknya dalam melahirkan karya horor,  tapi bagaimanapun juga harus diakui berkat sentuhan-sentuhan klasiknya termasuk memaksimalkan potensi fisik dan akting si cantik Amber Heard yang bermain cukup baik disini, The Ward masih mampu menjadi sebuah suguhan terror ala Carpenter'),
(792, 'Them', 'POSITIF', 'DATA LATIH', 'Overall, Them adalah sebuah sajian thriller mencekam yang digarap dengan efektif untuk membuat penontonnya duduk diam sembari menikmati menit demi menit momen-momen penuh ketegangan dan ketakutan. Semuanya tersaji rapi dengan durasi yang tidak terlalu lama.'),
(793, 'Thor', 'POSITIF', 'DATA LATIH', 'Bukan film superhero terbaik yang pernah saya tonton memang, tapi dengan segala kombinasi kemagisan mitologi kunonya, aksi seru yang mengasyikkan, spesial efek cantik, naskah menarik plus balutan eksekusi cepat nan memukau, Thor jelas dengan mudah dapat memenangi hati penontonnya seperti di saat ia juga dengan mudah memenangi hati Jane Foster untuk menjadi sebuah suguhan action superhero flick renyah dan menghibur.'),
(794, 'Toy Story 3', 'POSITIF', 'DATA LATIH', 'Tidak dapat dipungkiri lagi jika Toy Story 3 adalah seri terbaik dari dua seri pendahulunya. Melalui film ini Pixar semakin mengukuhkan bahwa mereka memang adalah raja animasi 3D yang tidak pernah kehabisan akal dan ide kreatif untuk menghibur para penggemarnya setiap tahunnya. Toy Story 3 jelas adalah sebuah paket hiburan animasi 3D berkualitas tinggi yang sangat lengkap, penuh dengan adegan-adegan petualangan yang menghibur dan menegangkan serta ditutup dengan sebuah ending yang manis dan mengharukan.'),
(795, 'Ugly', 'POSITIF', 'DATA LATIH', 'Menarik melihat bagaimana Kashyap mempersiapkan Ugly sebagai sebuah perangkap besar yang tidak hanya berisi materi kriminal, namun juga sebuah studi karakter dan sosial untuk menjebak penontonnya yang sebelumnya sudah terseret dalam pusaran misteri,'),
(796, 'Unfriended', 'POSITIF', 'DATA LATIH', 'Bagian terbaik Unfriended adalah presentasinya yang unik. 83 menit durasinya hanya berlangsung dalam layar MacBook milik Blaire bersama aplikasi Skype, Youtube, iTunes dan Safari, singkatnya Unfriended adalah teror ruang sempit dalam kemasan baru yang benar-benar tahu bagaimana mengeksploitasi ide horor dan budaya digital di era internet saat ini dengan sangat baik, kreatif, efektif dan efisien'),
(797, 'Uzumaki', 'POSITIF', 'DATA LATIH', 'Uzumaki punya Higuchinsky yang sepertinya tahu benar bagaimana memperlakukan versi filmnya dengan sangat baik tanpa harus kehilangan semangat komiknya.'),
(798, 'Victoria', 'POSITIF', 'DATA LATIH', 'Bagian terbaik Victoria tidak hanya pada kekuatan teknisnya, namun juga bagaimana Schipper berhasil memadukan gaya penceritaan kompleksnya dengan narasi penuh kejutan dan tentu saja kekuatan akting para pemainnya. Setiap dialog terasa natural dan hangat, terbentuk dari improvisasi hebat para castyang bermain gemilang,'),
(799, 'Voices', 'POSITIF', 'DATA LATIH', 'Dan menariknya ketika Hwan oh kemudian membeberkan semua misteri  Voices itu pada endingnya. Sebenarnya tidak ada kejutan yang kelewat drastis di sana karena ini bukan tipe twist yang datangnya tiba-tiba, bak jatuh dari langit dan hebatnya lagi ia masih terkesan relevan dengan alur kompleks yang sudah dibangun Hwan Oh dari awal,'),
(800, 'We Bought a Zoo', 'POSITIF', 'DATA LATIH', 'Premisnya menarik untuk sebuah family movie, plotnya bersahabat untuk ditonton semua umur. Crowe sudah berhasil membuat sebuah drama keluarga yang manis, inspirasional, hangat dan begitu menyentuh d ibalik setiap kehilangan, di balik setiap keberanian'),
(801, 'We Need to Talk About Kevin', 'POSITIF', 'DATA LATIH', 'Ramsey dengan cerdas menghadirkan kengerian tanpa wujud di setiap adegannya, bermain-main melalui imajinasi penontonnya melalui narasi tumpang tindih, aroma depresif kental dan performa hebat Tilda Swinton.'),
(802, 'What Maisie Knew', 'POSITIF', 'DATA LATIH', 'McGehee dan Siegel mungkin wajib berterima kasih kepada pendatang baru Onata Aprile yang bermain fantastis, menjadi bagian terpenting dalam What Maisie Knew melebihi nama-nama besar di sekelilingnya, mengisi bagian-bagian sentimentilnya.'),
(803, 'Where the Wild Things Are', 'POSITIF', 'DATA LATIH', 'Overall, Mungkin tidak terlalu berlebihan jika Where the Wild Things Are dapat dimasukkan dalam salah satu drama fantasi terbaik di 2009 lalu, atau mungkin yang salah satu yang terbaik dari film-film sejenisnya. Tampil dengan keindahan visual dan kisahnya yang sederhana namun kuat, film yang diproduseri oleh Tom Hanks ini adalah tontonan wajib bagi siapa saja yang menyukai film pertualangan fantasi yang unik.'),
(804, 'Who Am I: No System is Safe', 'POSITIF', 'DATA LATIH', 'Harus diakui naskah Who Am I sendiri punya kelas yang sedikit lebih tinggi dari tecno-thriller kebanyakan. Seperti yang saya katakan, ia cerdas sekaligus manipulatif,  Odar menggerakkan narasinya melalui presentasi yang kecepatannya mampu dijaga dengan baik.'),
(805, 'Why Dont You Play in Hell?', 'POSITIF', 'DATA LATIH', 'Menonton Why Dont You Play in Hell? itu adalah pengalaman yang susah dicari tandingannya, ia menghipnotis seperti jingle iklan. Ini adalah jenis film yang serius tapi santai, Sono menginjeksinya dengan kekerasan frontal yang menjadi ciri khasnya'),
(806, 'You Are The Apple of My Eye', 'POSITIF', 'DATA LATIH', 'Cerita sederhana tentang pahit-manisnya cinta, kenakalan masa-masa SMU dan perjalanan mencari sebuah kedewasaan dengan sedikit komedi terhampar dengan baik di sepanjang 109 menit. Ditambah karakter- karakternya yang loveable plus ending yang membekas menjadikan You Are The Apple of My Eye sebuah tontonan menyenangkan buat siapa saja yang pernah merasakan manisnya apa itu yang disebut cinta monyet.'),
(807, '...Ing', 'NEGATIF', 'DATA LATIH', 'Tidak ada yang terlalu istimewa atau unik, seunik judulnya. Ing tidak lebih dari another melodrama penguras air mata Korea Selatan yang indah, lembut,  manis dan yang pasti menyentuh namun sayang tidak ada yang baru alias basi.'),
(808, '30 Minutes or Less', 'NEGATIF', 'DATA LATIH', 'Kosong, begitulah saya menggambarkan 30 Minutes or Less, komedi yang tidak punya tujuan, garing dan juga bodoh, sebodoh tampang Danny McBride yang menyebalkan, jelas tidak lebih baik dari Zombieland. Tidak peduli apakah Ruben Fleischer  memang terinspirasi dari peristiwa nyata yang mengerikan itu atau tidak,  30 Minutes or Less bagi saya sama sekali tidak berkesan, atau saya bisa menyebutnya buruk.'),
(809, '7 Hari 24 Jam', 'NEGATIF', 'DATA LATIH', 'Ada rasa canggung dan tidak lepas terlihat di layar, ada batasan tak terlihat yang seperti membuat mereka tidak maksimal menjadi pasangan suami istri yang sudah menikah lima tahun. Entah salah skenario atau Fajar Nugros yang tak maksimal memanfaatkan talenta mereka, yang pasti saya tidak merasakan keintiman pasutri yang seharusnya'),
(810, 'A Barefoot Dream', 'NEGATIF', 'DATA LATIH', 'Overall, A Barefoot Dream tidak lebih hanya sebuah film olahraga biasa. Ya, memang diangkat dari kisah nyata, tapi semua itu sudah bukan barang baru lagi alias basi.'),
(811, 'Ada Apa Dengan CInta 2', 'NEGATIF', 'DATA LATIH', 'Tidak ada dasar cerita yang kuat untuk menjelaskan kenapa hubungan Rangga dan Cinta kandas di tengah jalan. Meski pada akhirnya dijelaskan di sini tetapi saya tidak menemukan itu adalah alasan kuat yang cukup masuk di logika. AADC? 2 harus diakui memulainya dengan sedikit canggung dan lambat.'),
(812, 'Alice in Wonderland', 'NEGATIF', 'DATA LATIH', 'Namun sayang Alice in Wonderland versi Burton ini rupanya tidak bisa dibilang karya terbaik sutradara yang sering tampil dalam rambut berantakan ini, khususnya pada bagian storyline yang lemah dan terkesan datar-datar saja. Burton gagal membuat kisah petualangan kedua Alice dalam negeri ajaib ini menjadi sebuah kisah yang dapat dinikmati semua kalangan, konflik-konflik yang disajikan terbilang terlalu biasa, kurang nendang dan kelewat bersahabat,'),
(813, 'Before We Go', 'NEGATIF', 'DATA LATIH', 'Menderita banyak di karakterisasi, naskah yang lemah dan dialog-dialog yang ngalor-ngidul membosankan, beruntung Evans punya DoP John Guleserian yang mampu menjalankan tugasnya. Sementara beberapa kali terdengar soundtrack rock indie membantu menciptakan emosi yang gagal dihadirkan oleh narasi dan karakternya,'),
(814, 'Berberian Sound Studio', 'NEGATIF', 'DATA LATIH', 'Horor-thriller arthouse dengan aroma horor Italia yang berjalan menjadi semakin rumit. Dibutuhkan perjuangan ekstra untuk melewati tidak hanya teror fisiknya yang berupa atmosfer creepy yang dipenuhi dengan ketakutan mental dan teror klaustrofobik  namun juga bungkusan narasi dan presentasi ambigu.'),
(815, 'Big Game', 'NEGATIF', 'DATA LATIH', 'Big Game harus diakui memang menarik meskipun terasa konyol dalam praktiknya. Banyak terinspirasi dari action dekade 80 sampai 90, rangkaian aksinya dengan mudah dikunyah dan ditelan penontonnya begitu  saja. Tetapi beberapa bagian semestinya bisa mendapatkan polesan lagi, misalnya Helender bisa memasukkan lebih banyak unsur survival daripada sekedar aksi cepat yang dangkal.'),
(816, 'Blue Ruin', 'NEGATIF', 'DATA LATIH', 'Sulneir kemudian melanjutkan plotnya menjadi semakin kelam ke belakang, merubah semuanya menjadi lebih buruk lagi ketika semakin banyak kekacauan tak terkendali yang seperti tak berujung.'),
(817, 'Burnt', 'NEGATIF', 'DATA LATIH', 'Ini jelas mengecewakan, meski faktanya, Wells masih memberikan penontonnya banyak penampakan-penampakan hidangan lezat. Hampir di sepanjang durasinya kita hanya menyaksikan Adam yang terjatuh dan terjatuh lagi  karena ego dan temperamental kemudian berusaha bangkit dan bangkit lagi. Ini seperti drama pencarian jati diri seorang laki-laki labil yang gagal move on dari masa lalu dengan kedok kuliner yang terkadang terlalu pretensius dan klise.'),
(818, 'Circle', 'NEGATIF', 'DATA LATIH', 'Presentasinya terasa monoton, momen ruang sempitnya menjadi senjata makan tua nketika narasinya harus memenjarakan mobilitas para karakternya, Adegan demi adegannya terasa repetitif, temanya bergeser tidak konsisten dari misteri survival menjadi debat kusir tentang moral, dan yang lebih mengecewakan lagi adalah akhir yang antiklimaks. Ya, setelah mimpi buruk yang dilalui para tokohnya, Hann dan Miscione memilih untuk menutupnya dengan cara yang bisa dibilang terlalu menggampangkan, mereka seperti terlalu malas untuk memberi penjelasan panjang lebar, alih-alih keduanya malah memilih ending macam itu untuk menutup misterinya  dengan cara murahan.'),
(819, 'Despicable Me 2', 'NEGATIF', 'DATA LATIH', 'Despicable Me 2 sesungguhnya masih sama saja payahnya dalam hal bercerita, tidak peduli ketika duet penulis naskah Cinco Paul dan Ken Daurio memberikan lebih banyak cinta di dalamnya atau kehadiran nama-nama baru macam Kristen Wigg atau Benjamin Bratt yang menggantikan Al Pacino yang mundur karena perbedaan pandangan.'),
(820, 'Dolphin Tale', 'NEGATIF', 'DATA LATIH', 'Sayangnya Dolphin Tale digarap terlalu biasa dengan penyajian ala film televisi anak-anak Disney yang banyak menjual banyak keajaiban instan, kebetulan-kebetulan bodoh ala sinetron dengan konflik-konflik yang terlalu dilebih-lebihkan ketimbang sebuah film layar lebar yang sudah menghabiskan biaya 37 juta Dollar.'),
(821, 'Earth to Echo', 'NEGATIF', 'DATA LATIH', 'Kalau mau jujur si Echo jarang digunakan Green dalam penceritaannya, sebaliknya ia lebih memfokuskan segalanya kepada kuartet anak-anak Clark Country yang jujur saja buat saya terbilang gagal menghadirkan chemistry, Dan minimnya jalinan emosional antar karakter manusia dan alien membuat Echo to Earth terkesan datar-datar saja dari awal hingga akhir dalam balutan narasi garapan Henry Gayden yang  menggampangkan segalanya.'),
(822, 'Epic', 'NEGATIF', 'DATA LATIH', 'Sayang karakter-karakter yang disuarakan mereka sama sekali tidak mampu meninggalkan kesan dikarenakan Wedge tampak lebih sibuk mengurus bagaimana Epic bisa tampil mulus ketimbang memikirkan kedalaman karakternya yang ironisnya juga dipresentasikan biasa saja kalau tidak mau disebut kaku.'),
(823, 'Fifty Shades of Grey', 'NEGATIF', 'DATA LATIH', 'Penonton seperti hanya diajak menyaksikan segala penyimpangan seksnya yang terkesan seperti bahan jualan murahan tanpa adanya kesan, ia seperti tempelan kosong tanpa jiwa, tanpa kemampuan untuk merangsang imajinasi liar penontonnya dari dalam, hanya sebatas godaan visual yang bekerja tidak maksimal. Belum saya menyebut romansa klise dengan segala bumbu tarik ulurnya yang tidak jelas juntrungnya.\r\n'),
(824, 'G.I Joe: Retaliation', 'NEGATIF', 'DATA LATIH', 'Saya bukan salah satu penggemar mainan ini jadi imbasnya saya cukup menikmati setiap menit yang dihadirkan Chu. Ya, Retaliation memang tidak jauh berbeda dengan pendahulunya, sama-sama menyajikan sebuah pop corn movie tanpa otak berisik yang di saat bersamaan akan memanjakan matamu. Chu juga tampaknya tidak pernah mencoba untuk mengendurkan tensinya termasuk menyuguhkan scene pertarungan antara Snake Eyes dan rival abadinya Storm Shadow berlanjut pada baku hantam di Himalaya, hingga akhirnya sebuah klimaks klise bersama Bruce Willis kemudian menutup aksi heroik nan klise.'),
(825, 'Garuda di Dadaku', 'NEGATIF', 'DATA LATIH', 'Rudi Soedjarwo tampak lebih banyak menyorot karakternya terlalu dekat ketimbang permainan sepak bola itu sendiri. Adegannya terlalu cepat untuk dapat dinikmati dengan baik, dan endingnya, ya, mengapa harus dengan tendangan salto? Bukankah itu terlihat murahan, seperti melihat iklan televisi.'),
(826, 'Gnomeo and Juliet', 'NEGATIF', 'DATA LATIH', 'Sayang meskipun cukup lucu dan didukung kualitas animasi yang jauh dari kata memalukan, harus diakui semua itu hanya berada dalam batasan hiburan ringan belaka, di mana begitu selesai menontonnya, dijamin dengan mudah anda melupakan animasi berdurasi 84 menit ini sesegera mungkin.'),
(827, 'Gods of Egypt', 'NEGATIF', 'DATA LATIH', 'Di satu sisi melihat segala kehebohan dan kekacauan yang dihasilkan bisa menjadi sebuah tontonan berskala besar namun di sisi lain ia tidak jarang terlihat murahan dan konyol, tak jarang kita menertawakan segala kebodohan narasi dan karakternya, belum lagi beberapa visual efeknya yang kasar, seperti proses transformasi yang buruk dan pertarungan yang jauh dari kata mulus.'),
(828, 'Hotel Transylvania 2', 'NEGATIF', 'DATA LATIH', 'Tidak ada konflik berarti, kecuali mungkin kedatangan Vlad si vampir tua di penghujung film yang sedikit mengacaukan suasana, secara keseluruhan Hotel Transylvania 2 bermain kelewat aman dengan potensi premis yang sebenarnya bisa dikembangkan lagi.'),
(829, 'Ip Man 3', 'NEGATIF', 'DATA LATIH', 'Paruh pertama Ip Man 3 adalah kekacauan luar biasa. Narasinya buruk dan tidak konsisten yang kemudian diperparah dengan banyak adegan pertarungan keroyokan yang tidak berkesan dan membosankan. Mike Tyson mengecewakan sesuai perkiraan. Tyson nyaris tidak bisa berakting, dialog-dialognya konyol, gerak-geriknya  canggung sekaku kayu jati tua, ini diperburuk dengan naskah yang tidak memberinya latar belakang cukup, motif rakusnya begitu klise'),
(830, 'Iron Man 3', 'NEGATIF', 'DATA LATIH', 'Entah apa yang dipikirkan Black dan Pearce ketika menghadirkan sebuah twist yang menjungkir balikkan ekspektasi banyak orang, baik fan boys atau tidak. Ya, itu adalah kejutan yang sangat konyol jika tidak mau disebut dengan kebodohan luar biasa, membuang percuma salah satu talenta yang sebenarnya sangat berpotensi.'),
(831, 'The Internship', 'NEGATIF', 'DATA LATIH', 'Besarnya tema tentang Google membuat premis utama dan komedinya menjadi sedikit tenggelam. Dominasi Google yang sangat ditonjolkan menjadikan The Internship terlihat seperti video iklan panjang dari perusahaan internet raksasa tersebut dengan bintang Vince Vaughn dan Owen Wilson.'),
(832, 'The Interview', 'NEGATIF', 'DATA LATIH', 'Muatan yang dibawa The Interview jelas terlalu vulgar. Mengolok-olok negara sensitif Korea Utara dengan paradigma komunisnya yang tebal termasuk upaya membunuh pemimpin tertingginya yang punya gaya rambut ajaib dalam sebuah acara talk show murahan, jelas Sony sudah melakukan sebuah kebodohan besar ketika mereka nekat tetap meneruskan proyek provokatif ini.'),
(833, 'The Lovely Bones', 'NEGATIF', 'DATA LATIH', 'Namun sayang film berbiaya 65 juta dollar ini hasilnya ternyata jauh di bawah ekspektasi atau bisa dibilang cukup mengecewakan, apalagi untuk film garapan seorang Peter Jackson.'),
(834, 'The Other Side of The Door', 'NEGATIF', 'DATA LATIH', 'Yang menjadi pertanyaan apakah film ini menakutkan? Jika kamu bukan veteran horor atau mungkin hanya berhati lemah, ya, The Other Side of the Door mampu memberimu sedikit ancaman yang cukup  sekedar menggedor jantungmu. Jika mungkin akhirnya ia menjadi horor yang lembek pun setidaknya melihat kembali penampilan  Sarah Wayne Callies setelah serial Prison Break dan The Walking Dead sedikit banyak memberikan pengalaman tersendiri.'),
(835, 'The Sorcerer and the White Snake', 'NEGATIF', 'DATA LATIH', 'Ironis melihat bagaimana spesial efek yang begitu diagung-agungkan Ching sebelumnya ternyata terlihat begitu berlebihan, begitu kasar, begitu murahan dan begitu mendominasi nyaris seluruh durasi The Sorcerer and the White Snake, akibatnya fatal, karena ceritanya sendiri harus rela dikebiri sana-sini untuk memberikan banyak spot lebih pada segala tetek bengek CGI yang memalukan itu'),
(836, 'The Wolverine', 'NEGATIF', 'DATA LATIH', 'Sementara  sekuens aksinya juga tidak terlalu buruk sayang tidak semua momen pertarungannya mampu meninggalkan kesan seperti halnya pertarungan di atas kereta api yang melaju kencang itu, termasuk adegan puncaknya yang mempertemukan Logan dengan salah satu musuh besarnya, Silver Samurai berakhir terlalu cepat.'),
(837, 'Tracks', 'NEGATIF', 'DATA LATIH', 'Ini mungkin akan lebih terasa ke sebuah drama psikologis yang sedikit lemah ketimbang road trip survival yang seharusnya bisa lebih dramatis lagi'),
(838, 'Under the Skin', 'NEGATIF', 'DATA LATIH', 'Masih ada banyak pertanyaan-pertanyaan misalnya siapa sebenarnya karakter Johansson, siapa pengendara motor misterius yang bolak-balik membersihkan pekerjaanya, apa tujuan mereka dengan pria-pria Glasgow itu? Namun jika kamu menunggu jawaban pasti di akhir nanti, bersiaplah kecewa berat karena Glazer tidak memberikanmu apa-apa kecuali sebuah ending mengerikan dan lebih banyak lagi pertanyaan mengganggu.'),
(839, 'Were The Millers', 'NEGATIF', 'DATA LATIH', 'Were The Millers tergolong biasa saja, predictable, cheesy dan bahkan bisa dikatakan  nanggung, dalam artian ia takut untuk berani bermain kotor namun di saat bersamaan ia juga tidak mau bermain terlalu aman.'),
(840, 'Wolf Creek 2', 'NEGATIF', 'DATA LATIH', 'Ketimbang film pertamanya, McLean terlihat sedikit mengurangi kadar creepy, toh wajar saja karena kini penontonnya sudah tahu misterinya, tahu apa yang dihadapi para turis asing itu memang bukan alien atau hantu penunggu kawah Wolf Creek melainkan psikopat edan.'),
(841, 'Hachiko: A Dog''s Story', 'NEGATIF', 'DATA LATIH', 'Untuk versi Jepangnya kisah Hachi digambarkan lebih tragis dan depressing. Minimnya adegan melodrama mengurangi kemampuan film ini untuk menguras habis emosi penontonnya,.'),
(842, 'Confessions', 'POSITIF', 'DATA UJI', 'Ah, menarik sekali mengetahui bahwa Tetsuya Nakashima ternyata masih belum kehilangan sentuhan magisnya. Lewat Confessions ini, Nakashima kembali sukses memadu padankan sebuah pengalaman sinematik yang tidak terlupakan, sebuah thriller psikologis  provokatif, menyesakkan dan juga emosional dengan balutan teknis visual tingkat tinggi.'),
(843, 'Crazy Little Thing Called Love', 'POSITIF', 'DATA UJI', 'Menginjak paruh kedua bisa dibilang segalanya menjadi lebih baik. Ya, memang kisah terkesan menjadi lebih serius dan melankolis, meninggalkan segala kelucuannya di belakang. Mengajak para penontonnya untuk turut melebur dalam kegundahan yang dirasakan Nam kepada Chon. Tidak peduli jika Nan sudah berhasil tampil sempurna dari segi fisik, toh tidak membuat kisah cintanya menjadi lebih mulus, karena bagaimana pun Nan tetap adalah Nan, gadis lugu yang masih belajar bagaimana merasakan cinta. '),
(844, 'Defendor', 'POSITIF', 'DATA UJI', 'So, Defendor tidak hanya mampu menjadi sebuah suguhan yang menghibur namun juga mampu memberikan inspirasi dan pesan moral tentang bagaimana menjadi sosok superhero sejati melalui semangat yang ditunjukkan oleh Arthur Poppington.'),
(845, 'Eddie the Eagle', 'POSITIF', 'DATA UJI', 'Kudos buat penampilan apik Taron Egerton. Tidak hanya bermodal transformasi dari make up dan penampilan yang membuat pangling, namun bagaimana Egerton mampu membuat tokoh Eddie si Elang dengan mudah untuk disukai penontonnya. Ia mampu menyeimbangkan sisi polos Eddie sama kuatnya dengan optimisme yang luar biasa. Sementara Hugh Jackman tetap memesona dengan gaya khasnya.'),
(846, 'Flight', 'POSITIF', 'DATA UJI', 'Flight jelas adalah sebuah persembahan drama yang bagus. Jangan tertipu dengan premis atau trailernya, karena Flight jauh lebih rumit dan lebih dalam dari sekedar bagaimana seorang pilot alkoholik yang menjungkir balikkan pesawatnya'),
(847, 'Florence Foster Jenkins', 'POSITIF', 'DATA UJI', 'Naskah tulisan Nicholas Martin yang ringan tapi menghibur berhasil menawarkan tontonan yang menyenangkan sekaligus sedikit kontemplatif. Dengan sokongan pelakon yang kuat hingga pengarahan Frears yang santai namun cukup berisi, Florence Foster Jenkins berhasil meninggalkan kesan dan pesan yang cukup mengena di hati.'),
(848, 'The Insider', 'POSITIF', 'DATA UJI', 'Overall. Di antara film-filmnya, The Insider jelas adalah yang terbaik dari seorang Michael Mann. Meninggalkan segala ciri khasnya, Mann ternyata masih mampu menghadirkan sebuah suguhan film cerdas dengan premis yang kuat, apalagi Ia cukup beruntung karena dua aktor kaliber Oscar sekelas Russel Crowe dan Al Pacino berhasil menampilkan salah satu penampilan terbaik mereka dalam film ini.'),
(849, 'The Kite  Runner', 'POSITIF', 'DATA UJI', 'Overall, sejauh ini The Kite Runner adalah karya terbaik dari seorang Marc Forster, Berbekal pengalamannya menggarap film-film drama berkualitas seperti Monsters Ball, Finding Neverland dan Stranger Than Fiction, secara tidak langsung mampu menjadikan The Kite Runner menjadi salah satu film terbaik di genrenya.'),
(850, 'The Lord of the Rings: The Fellowship of the Ring', 'POSITIF', 'DATA UJI', 'Sebagai volume pembuka dari rangkaian epik trilogi The Lord of the Rings, The Fellowship of the Ring jelas sudah memulainya dengan sangat baik.  Peter Jackson sepertinya tahu benar bagaimana menjadikan kisah klasik abadi milik Tolkien ini sebagai sebuah sajian live action fantasi modern yang mampu dicintai oleh setiap penontonnya, '),
(851, 'The Road', 'POSITIF', 'DATA UJI', 'Berbekal dari kisah novelnya yang menarik, The Road terbilang berhasil menghadirkan sebuah post apocalyptic drama yang berbeda dan terbilang fresh dari film-film bertema sama kebanyakan. Pesan yang kuat tentang ketegaran dan perjuangan hidup juga berhasil disampaikan dengan baik oleh film yang juga dibintangi Charlize Theron ini.'),
(852, 'The Secret in Their Eyes', 'POSITIF', 'DATA UJI', 'Memadukan kisah menarik tentang kasus pembunuhan, satir politik, romansa dan karakter-karakter yang kuat, kamu bisa menyebut The Secret in Their Eyes sebagai sebuah romantic crime thriller ala Argentina yang lengkap. Ada begitu banyak kejutan menarik di dalamnya yang dibungkus dengan kualitas naskah dan penggarapan yang apik. Sulit buat saya untuk tidak menyukainya.'),
(853, 'The Secret Life of Walter Mitty', 'POSITIF', 'DATA UJI', 'Stiller bersama kekuatan imajinasinya memberi sedikit sentuhan komedi untuk memancing tawa dan hiburan seru dalam setiap aksinya. Kriten Wiig mungkin tidak tampil terlalu kuat sebagai love interest, namun cukup pas memberikan sentuhan romansa ke dalamnya, memberikan Walter keberanian melompat ke helikopter dengan lantunan apik Major Tom. Sementara di sudut jauh ada San Penn yang jarang terlihat, namun karakternya mampu menghadirkan sisi kemisteriusan tersendiri.'),
(854, 'Unthinkable', 'POSITIF', 'DATA UJI', 'Unthinkable benar-benar tampil diluar dugaan. Tidak hanya menghibur sebagai sebuah film secara keseluruhan, namun juga mampu menyampaikan pesan yang dalam akan sebuah konsekuensi besar yang harus ditanggung di saat mengambil sebuah keputus asaan.'),
(855, 'The Hunger Games', 'NEGATIF', 'DATA UJI', 'Gary Ross tampak terlalu bermain aman dengan rating remajanya, tujuannya jelas untuk dapat merangkul lebih banyak audiens, tapi imbasnya membuat film ini terasa lembek terlebih Ross tidak mampu memaksimalkan durasinya yang panjang.'),
(856, 'The Last Day on Mars', 'NEGATIF', 'DATA UJI', 'Naskah dan penyutradaraan seperti bergerak dalam jalur klise horor yang sudah bolak balik kamu dapati. Tetapi sebenarnya jika hanya klise itu tidak terlalu masalah, hanya saja Robinson kurang berhasil mengeksplorasi unsur terpentingnya: horor.'),
(857, 'The Mortal Instrumet: City of Bones', 'NEGATIF', 'DATA UJI', 'Mortal Instrument hanya punya sutradara sekelas Harald Zwart yang pernah menghasilkan remake buruk The Karate Kid untuk menerjemahkan skrip adaptasi screenwriter debutan Jessica Postigo Paquette yang kualitasnya juga sama menyedihkan dengan kualitas penyutradaraan Zwart.'),
(858, 'The Twilight Saga: Breaking Dawn Part I', 'NEGATIF', 'DATA UJI', 'Apa yang terjadi kemudian adalah sangat mengecewakan. Bisa jadi momen pernikahan Bella-Edward itu menjadi salah satu adegan pernikahan paling membosankan yang pernah saya lihat dalam sebuah film, sayang tidak ada emosi di dalamnya menjadikannya sama-sama membosankan..'),
(859, 'Turbo', 'NEGATIF', 'DATA UJI', 'Yang menjadi masalah besar adalah seberapa keras usaha para animator Dreamworks membuat karakternya menjadi lucu, para siput-siput kecil itu susah untuk dapat menempel lama pada benak penontonnya. Lamu akan dengan mudah melupakannya begitu end credit bergulir.'),
(860, 'White Bird in A Blizzard', 'NEGATIF', 'DATA UJI', 'Araki seperti melupakan elemen thriller, membuatnya hanya menjadi tempelan dari kisah perjalanan teen romance Kat yang galau menuju kedewasaan dengan cara yang aneh, sehingga apa yang terjadi selanjutnya penonton menjadi tidak lagi terlalu peduli dengan keberadaan sosok Eve yang perlahan seperti terlupakan.'),
(861, 'White: The Curse Of The Melody', 'NEGATIF', 'DATA UJI', 'Begitu memasukinya lebih dalam anda akan menemukan bahwa ia tidak ubahnya seperti sajian horor kelas dua lainnya yang terlalu kelewat biasa (baca: buruk). Naskah yang super lemah, akting yang buruk, kandungan misteri yang terkesan dipaksakan bahkan dalam menjalankan amanah utamanya untuk meneror mental penontonnya pun ia gagal.'),
(862, '127 Hours', 'POSITIF', 'DATA LATIH', 'Berbeda dengan Into the Wild, film survival ini berakhir bahagia karena karakter utama selamat serta memotivasi penontonnya untuk memberikan pelajaran berharga Dont Give Up ,film survival yang wajib tonton buat kita semua, ini bukan hanya film tapi juga sebuah pengalaman unik terjebak di kesempitan canyon.'),
(863, '2 Guns', 'POSITIF', 'DATA LATIH', 'Jadi dua cast karismatik yang bergabung dalam buddie movie santai yang berisi aksi, perampokan, misi penyamaran, kekerasan dan Paula Patton yang bertelanjang dada, sepertinya agak susah menolak pesona 2 Guns terlebih ketika elemen bromance bekerja dengan baik,'),
(864, '21 Jump Street', 'POSITIF', 'DATA LATIH', 'Ini adalah start baru yang menyegarkan untuk franchise 21 Jump Street yang legendaris itu. Duo Phil Lord dan Chris Miller jelas sudah menjalankan tugasnya dengan baik membuat versi mereka sendiri agar mudah disukai penonton barunya sebagai suguhan komedi aksi yang menghibur dan meyegarkan. Kudos juga patut diberikan kepada dynamic duo Jonah Hill dan Channing Tattum yang tampil kompak dan kocak di sepanjang film.'),
(865, 'Ain''t Them Bodies Saint', 'POSITIF', 'DATA LATIH', 'Ada banyak yang dilakukan elemen teknisnya yang sanggup membuat romansa crime klasiknya bisa terasa begitu emosional. Pertama, kualitas sinematografinya. menampilkan permainan siraman cahaya matahari lembut nan hangat yang dibalut dengan sudut-sudut kamera memikat dan narasi puitis. Kedua, ada parade scoring luar biasa garapan Daniel Hart yang berkontribusi banyak memancarkan kekuatan emosi tak terlihat yang sukses menempel ketat dengan visualnya, menciptakan kombinasi teknis solid dan mood gloomy yang menggetarkan.'),
(866, 'Babies', 'POSITIF', 'DATA LATIH', 'Para bayi memang memiliki pesonanya sendiri. Dibalik setiap kepolosan merekactersimpan sebuah kekuatan magis yang mampu membuat setiap penontonnya tersenyum bahkan tertawa lepas melihat tingkah laku mereka. Dan beruntung bagi kita para orangtua dan siapaun yang mencintai anal-anak karena masih ada Thomas Balmes yang menghadirkan dunia malaikat-malaikat kecil tersebut dalam Babies.'),
(867, 'Black Death', 'POSITIF', 'DATA LATIH', 'Di bawah asuhan Christopher Smith, film ini dapat menjelma menjadi sebuah tontonan menarik dan menegangkan. Apalagi Smith mampu menyajikan setiap adegannya serealistis mungkin dengan dukungan cerita dan pesan moral yang kuat.'),
(868, 'Black Lightning', 'POSITIF', 'DATA LATIH', 'So, rupanya tidak hanya Hollywood yang mampu membuat film superhero ringan dan menghibur, Black Lightning produksi Rusia ini setidaknya sudah membuktikan mereka juga mampu.'),
(869, 'Brooklyn', 'POSITIF', 'DATA LATIH', 'Presentasi yang dihadirkan Brooklyn itu bisa dibilang sama kalem dan cantiknya dengan karakter utamanya, Eilis Lacey. Ya, dari desain produksi sampai penyutradaraan, John Crowley bisa dibilang telah melakukan pekerjaannya dengan sangat baik ketika berhasil mengolah narasi Brooklyn menjadi sajian  drama periodik yang mengalir dengan mulus dan enak ditonton.'),
(870, 'Captain Fantastic', 'POSITIF', 'DATA LATIH', 'Captain Fantastic bisa bekerja dengan baik bukan hanya karena ia menawarkan premis drama keluarga yang unik dan berbeda semata atau penyutradaraan hangat Ross namun juga bagaimana sinergi dengan kegemilangan penampilan para pemainnya.  Senang melihat Viggo Mortensen kembali. Sementara casting para anak-anak keluarga Cash pun tak kalah memesonanya. Setiap karakter memberikan ragam kepribadian yang menarik.'),
(871, 'Carnage', 'POSITIF', 'DATA LATIH', 'Jarang menemukan komedi semenarik dan seunik ini. Carnage tidak butuh adegan-adegan slapstik untuk dapat membuat penontonnya terus tersenyum bahkan tertawa lepas di sepanjang film. Ia memiliki premis sederhana, tapi semua elemen simpelnya itu rupanya mampu dimaksimalkan Polanski dengan sangat baik  untuk menjadikannya sebuah komedi hitam yang cerdas dan juga sangat menyenangkan untuk ditonton.'),
(872, 'Cyrus', 'POSITIF', 'DATA LATIH', 'Overall, Cyrus adalah sebuah kisah cinta unik dan menarik, terlebih lagi dua bersaudara Duplass sukses menyelipkan unsur-unsur komedi satirnya dengan takaran yang pas dan tidak terlalu berlebihan tanpa harus kehilangan pesan-pesan yang ingin disampaikan, plus dukungan akting apik dari para pemainnya membuat Cyrus tampil cukup memuaskan.'),
(873, 'Dark City', 'POSITIF', 'DATA LATIH', 'Satu lagi film fiksi ilmiah dengan cerita yang sangat orisinil, unik dan luar biasa keren. Sang sutradara Alex Proyas dengan jenius memadukan unsur-unsur film noir gelap, thriller dan fiksi ilmiah yang jarang ditemukan di film-film lain. Kita dibuat penasaran sepanjang film dengan siapa sebenarnya karakter John di mana nantinya kita menemukan sebuah penjelasan yang mencengangkan.'),
(874, 'Epitaph', 'POSITIF', 'DATA LATIH', 'Senang rasanya menemukan ada satu lagi horor Korea Selatan yang mampu berbicara sebaik A Tale of Two Sisters. Jung bersaudara sudah berhasil menghadirkan sebuah thriller psikologis dengan balutan puisi kematiannya yang indah dan mengerikan, hasilnya? Ia tidak hanya mampu bermain-main dengan rasa takut kita melalui momen-momen horor atmosferik dan eerie di dalamnya namun disaat bersamaan ia juga menyentuh pikiran, hati dan perut penontonnya sekaligus.'),
(875, 'Fantastic Beasts and Where to Find Them', 'POSITIF', 'DATA LATIH', 'Sebagai pencerita yang ulung, ia tahu bagaimana harus menggulirkan narasinya dengan baik. Walaupun sebagai awal dari bakal waralaba besar ke depannya, Rowling menuturkannya dengan begitu sederhana dan terkendala durasi film yang relatif pendek untuk banyak detil yang terabaikan, tapi Fantastic Beasts and Where to Find Them  sudah meletakkan fondasinya dengan lumayan baik dan berhasil menghibur serta mengobati kerinduan kita akan dunia sihir ala Rowling yang masyhur itu.'),
(876, 'Frances Ha', 'POSITIF', 'DATA LATIH', 'Tone yang ditawarkan Frances Ha sebenarnya tidaklah jauh berbeda dengan The Squid and the Whale,  masih dipenuhi dengan semangat indie kental dan soundtrack-soundtrack bagus, hanya saja untuk yang terbaru ini mungkin terasa lebih girly dan monokrom. Ya, keunikan Frances Ha yang paling mencolok tentu saja adalah 86 menit durasinya dikuasai oleh presentasi hitam putih yang terinspirasi dari drama-drama Perancis new wave,'),
(877, 'Goodnight Mommy', 'POSITIF', 'DATA LATIH', 'Plotnya mampu berjalan dari sesuatu yang simpel menjadi rumit dan menghentak di klimaksnya dengan akselerasi tensi yang terjaga dengan sangat baik. Akting si kembar yang dingin plus beberapa momen body horor dan penampakan-penampakan yang cukup menghentak itu kemudian menjadikan Goodbye Mother tampil solid dalam usahanya menjadi gelaran horor psikologis yang menawan.'),
(878, 'Hardcore Henry', 'POSITIF', 'DATA LATIH', 'Naishuller menggandengnya dengan dukungan cast yang bagus dari Sharlto Copley sebagai Jimmy yang sukses menghadirkan sisi komedi tersendiri di setiap kehadirannya. Sementara tidak banyak yang bisa digali dari karakter lain. Haley Bennett tetap cantik dan seksi sejak saya pertama kali melihatnya dalam horor The Hole 2009 silam, lalu ada Tim Roth yang tampil sebentar sebagai ayah Henry, sisanya Danila Kozlovsky tampil cukup oke sebagai villain utama,'),
(879, 'Helpless', 'POSITIF', 'DATA LATIH', 'Premisnya sendiri sebenarnya sudah cukup kuat untuk menjadikan Helpless sebagai thriller misteri noir modern yang menarik, termasuk ketika  mampu membuat penontonnya terus terjaga, menebak dan menunggu apa yang sebenarnya terjadi bersama rentetan twist demi twist.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(880, 'Hot Tub Time Machine', 'POSITIF', 'DATA LATIH', 'Steve Pink sang sutradara yang juga pernah menghasilkan komedi berjudul Accepted, bisa dibilang berhasil menciptakan sebuah sajian komedi yang unik, ringan dan sederhana namun cukup efektif untuk mengocok perut penontonnya, terutama bagi mereka penggemar komedi-komedi dewasa yang pernah juga merasakan kejayaan era dekade 80.'),
(881, 'Ilo Ilo', 'POSITIF', 'DATA LATIH', 'Ya, apa yang tersaji di sepanjang kurang lebih satu jam setengah durasinya sungguh menyenangkan. Ada komedi ringan, drama feel good sampai heartbreaking yang melebur dalam kesatuan penyutradaraan dan akting natural dari Chen serta jajaran pemain yang bermain gemilang.'),
(882, 'I''m Here', 'POSITIF', 'DATA LATIH', 'Sebuah bittersweet love story 30 menit dari Spike Jones yang banyak mengajarkan penontonnya tentang makna sebuah cinta sejati dan bagaimana mempertahankan keutuhannya meskipun itu harus dengan melakukan pengorbanan luar biasa. Ya,  mungkin terlihat aneh, namun bagaimana Jonze membuatnya menjadi senormal mungkin dengan balutan kisah manis nan menyentuh, itulah yang menjadikannya sangat berkesan.'),
(883, 'Insidious: Chapter 2', 'POSITIF', 'DATA LATIH', 'Masa lalu sangat berperan penting pada Chapter 2 ini untuk mengungkap beberapa fakta. Ada juga elemen time travel yang dimasukkan Wan dan harus diakui bagaimana dengan cerdas Wan memanfaatkan perjalanan waktunya untuk menempel dengan sekuen-sekuen seri pertamanya, menjadikan kedua seri ini  seperti satu paket horor yang tidak terlepaskan satu sama lain.'),
(884, 'Ju-On: Old Lady in White', 'POSITIF', 'DATA LATIH', 'Walaupun tidak sehebat pedahulunya, tetap saja kehadiran  Old Lady in White ini masih terbilang efektif sebagai alat senam jantung anda, walaupun patut disayangkan ketidak hadiran si cantik Kayako cukup berdampak besar pada film ini.'),
(885, 'Kung Fu Panda 3', 'POSITIF', 'DATA LATIH', 'Seperti yang saya katakan di atas, kekuatan utama dari Kung Fu Panda sejak kemunculan perdananya 2008 silam  adalah perpaduan olahan humor kocak dari dialog sampai fisik, aksi martial arts spektakuler dan pemilihan karakter yang kuat dan kombinasi itu yang lagi-lagi kita dapatkan di seri ketiganya ini.'),
(886, 'Let the Right One In', 'POSITIF', 'DATA LATIH', 'Tanpa ada sepatah kata pun diucapkan oleh para pemain, ending di film ini benar benar mindblowing dan ditutup dengan adegan manis,  Overall film ini sudah mengangkat film bertemakan vampire ke level brilian, bahkan dibuat versi remake oleh Hollywood yang berjudul sama dengan novel aslinya Let Me In.'),
(887, 'Man of Steel', 'POSITIF', 'DATA LATIH', 'Zack Snyder dengan dukungan nama-nama besar di balik kesuksesan reboot Batman membawa kembali kisah si Manusia Baja kembali ke awal, memodifikasinya dengan sentuhan modern dan mencoba menyeimbangkan drama tentang pencarian jati diri yang manusiawi dan parade action dahsyat, meskipun kombinasinya terasa bekerja di satu sisi saja, namun ini adalah awal yang bagus dari franchise sebesar Superman.'),
(888, 'Martha Marcy May Marlene', 'POSITIF', 'DATA LATIH', 'Sean Durkin dengan gemilang telah menghadirkan potret depresi dan kesedihan luar biasa seorang anak manusia yang tenggelam dalam jurang kehancuran melalui akting kelas atas seorang pendatang baru bernama Elizabeth Olsen.'),
(889, 'Mr. Peabody & Sherman', 'POSITIF', 'DATA LATIH', 'Harus diakui, narasi time travel tetap menyenangkan untuk diikuti. Dukungan pengisi suaranya juga sedikit banyak membantu. Ada Ty Burell, aktor jebolan sitkom televisi Modern Family mengisi jiwa Mr. Peabody yang canggih, sedikit sombong namun penuh kasih sayang dan perhatian, sementara Sherman dikuasai oleh keceriaan Max Charles.'),
(890, 'Mustang', 'POSITIF', 'DATA LATIH', 'Setiap momen yang disajikan Ergven melalui pendekatan natural, membuat kita mudah untuk dekat dengan karakter-karakternya dan bersimpati kepada mereka. Plotnya bergerak perlahan namun pasti dari keceriaan penuh tawa menjadi lebih gelap. Seperti sebuah dongeng hitam yang terus menggerogoti emosi di mana putri-putri cantik di dalamnya terus bermimpi mencari sebuah akhir yang bahagia.'),
(891, 'My Stupid Boss', 'POSITIF', 'DATA LATIH', 'Ya, kamu jelas tidak bisa menyangkal bahwa My Stupid Boss digerakkan oleh kemampuan akting fantastis Reza Rahardian yang entah bagaimana selalu berhasil menembus batasan.  Bossman adalah karakter yang spesial, dan hanya aktor spesial macam Reza yang mampu menghadirkan sisi paling unik sama hebatnya dengan sisi baiknya lengkap dengan segala improvisasinya yang luar biasa.'),
(892, 'My Week with Marilyn', 'POSITIF', 'DATA LATIH', ' Ya, saya mungkin bukan fans berat Marilyn, tapi melihat bagaimana ia dalam wujud Michelle Williams tampil begitu memesona, sulit rasanya tidak cemburu ketika ia mengucapkan I love you pada Colin dan kemudian menciumnya, tidak peduli apakah ia benar-benar tulus melakukannya atau tidak.'),
(893, 'Nada untuk Asa', 'POSITIF', 'DATA LATIH', 'setiap pemainnya mampu tampil solid membawakan karakternya dengan sangat baik, misalnya seperti apa yang sudah dilakukan Marsha Timothy. Ya, aktris cantik yang juga istri dari aktor Vino G. Bastian ini tampil dalam performa terbaiknya, begitu sangat menjiwai peran Nada.'),
(894, 'Nokas', 'POSITIF', 'DATA LATIH', 'Nokas bisa jadi adalah salah satu contoh film bertema perampokan paling realistis yang pernah ada. Semua digambarkan Erik Skjoldbjrg seotentik mungkin dengan kejadian aslinya plus dukungan teknik kamera tingkat tinggi yang sanggup memberikan saya sebuah kepuasan tersendiri dalam menikmati setiap menitnya yang mengesankan.'),
(895, 'Noroi', 'POSITIF', 'DATA LATIH', 'Overall, jika menyukai film horror, terutama horror Asia yang sedikit berbeda, Noroi mungkin bisa memberikan sebuah pengalaman tersendiri, walaupun konsep yang diangkat bukanlah sebuah konsep baru namun jalinan cerita dan atmosfer yang ditampilkan di sini cukup membuat penggemar horror sejati tersenyum bahagia, bukan karena film ini lucu, namun karena film ini mampu memberikan gambaran bagaimana sebuah film horror yang baik dan berkualitas itu dibuat.'),
(896, 'Oculus', 'POSITIF', 'DATA LATIH', 'Bagian terbaiknya adalah ketika Flanagan tahu benar memperlakukan sang cermin, tidak hanya sebagai objek namun ia adalah bintang utama Oculus yang mengikat segalanya. Ada aktris cantik Karen Gillan yang berkolaborasi dengan aktor muda Brenton Thwaites.'),
(897, 'Ouija: Origin of Evil', 'POSITIF', 'DATA LATIH', 'Set, kostum dan make up semua terasa sempurna untuk mewakili sub urban Los Angeles di dekade 60, termasuk pemilihan soundtrack jadul yang semakin menambah kesan vintage. Kudos buat penampilan kuat pemainnya'),
(898, 'Oz, the Great and Powerful', 'POSITIF', 'DATA LATIH', 'Selain banyak meminjam pernak pernik klasik Oz, Raimi juga membuat dunianya sendiri yang luar biasa dengan segala macam tumpahan warna-warni dan tentu saja bagian terbaiknya ketika ia mampu memaksimalkan bagian gelapnya dengan sentuhan klasik. Ini seperti memasuki wahana Oz yang baru, dengan lebih banyak warna, CGI dan 3D yang tidak terlalu sempurna.'),
(899, 'Parental Guidance', 'POSITIF', 'DATA LATIH', 'Ya, saya suka Parental Guidance. Ia lucu dan hangat. Bisa ditebak hampir semua tawa berasal dari satu sumber utama bernama Billy Crystal bersama dialog-dialog dan guyonan-guyonan improvisasinya yang kocak. Bersama Bette Midler yang juga tak kalah kocaknya, Kombinasi keduanya dengan premis sederhana menjadi sebuah persembahan film keluarga menyenangkan.'),
(900, 'Pontypool', 'POSITIF', 'DATA LATIH', 'McDonald diam-diam sudah mengikatmu erat dengan narasi dan karakter-karakternya yang kuat bersama ruang lingkup stasiun radio plus segala hal yang berhubungan dengan proses penyiaran yang menempel erat pada premisnya dan tidak pernah melepaskanmu sedikit pun.'),
(901, 'Psycho', 'POSITIF', 'DATA LATIH', 'Ya, tidak bisa dipungkiri Pyscho jelas adalah salah satu karya terbaik yang pernah dibuat oleh Alfred Hitchcock. Sebuah psychological thriller hebat yang tidak hanya menawarkan ketegangan dan kengerian semata namun juga cerita yang menarik dan pintar serta penuh kejutan di dalamnya. Inilah mahakarya dari sutradara legendaris Alfred Hitchcock.'),
(902, 'Rare Exports: A Christmas Tale', 'POSITIF', 'DATA LATIH', 'Harus saya akui Helander sudah memberikan sesuatu yang besar pada film kecilnya ini, sebuah christmas tale yang tidak ada duanya, unik, gelap dan juga menghibur yang jelas sulit kita dapatkan dalam film-film buatan Hollywood sekalipun.'),
(903, 'Real Steel', 'POSITIF', 'DATA LATIH', 'Disertai suguhan spesial efek canggih beserta adegan-adegan aksinya yang dahsyat dan menghibur, Shawn Levy sudah memberinya jiwa dalam balutan kisah hubungan ayah-anaknya yang menyentuh.'),
(904, 'Rebirth', 'POSITIF', 'DATA LATIH', 'Rebirth adalah film yang mengesankan dan layak disimak. Tidak mengherankan bila Rebirth menyabet 10 penghargaan dalam ajang Japanese Academy tahun 2012, termasuk di antaranya Film Terbaik, Sutradara Terbaik, dan Aktris Terbaik.'),
(905, 'Ruby Sparks', 'POSITIF', 'DATA LATIH', 'Tentu saja hampir seluruh durasinya dikuasai oleh Dano yang tampil bagus membawakan kaakternya yang kebingungan, lalu kemudian ketika Kazan datang Dano mampu melebur dengan baik bersamanya dengan chemistry yang kuat, tidak terlalu mengejutkan karena mereka juga pasangan di kehidupan nyata.'),
(906, 'Side Effects', 'POSITIF', 'DATA LATIH', 'Berada di teritori yang sama dengan Contagion, tetapi Side Effects punya ruang lingkup yang lebih sempit dengan kadar misteri dan kompleksitas yang lebih tinggi. Rooney Mara tampil bagus sebagai wanita kesepian yang stres dengan tingkat kemisteriusan yang sanggup membuat Jude Law menjadi detektif dadakan untuk menyelamatkan kariernya.'),
(907, 'Song of the Sea', 'POSITIF', 'DATA LATIH', 'Song of The Sea memilih untuk memeluk semua penontonnya, tentu saja termasuk penonton anak-anak untuk dapat menikmati setiap menit kualitas animasi yang diisi dengan kombinasi kuat antara narasi dan teknis tanpa harus kehilangan kelucuan sekaligus elemen tragedi yang berhasil dikamuflasekan Moore dengan sangat cantik.'),
(908, 'Star Trek: Into Darkness', 'POSITIF', 'DATA LATIH', 'Semua keasyikan itu masih dibungkus oleh spesial efek canggih yang tidak pernah terkesan berlebihan dengan segala unsur ilmiah Trek yang masih dipertahankan Abrams plus bonusnya; disyut dalam format raksasa IMAX untuk dapat memberikan sebuah kepuasan maksimal.'),
(909, 'Starred Up', 'POSITIF', 'DATA LATIH', 'Ini adalah elemen paling kuat yang menggerakkan narasinya pada akhirnya, sebuah momen emosional mendebarkan adalah klimaks dari Starred Up, kejadian itu seperti sebuah kulminasi dari peristiwa-peristiwa sebelumnya yang diperkuat oleh performa hebat Ben Mendelsohn sebagai ayah yang harus mengorbankan segalanya demi sang putra,'),
(910, 'Surat dari Praha', 'POSITIF', 'DATA LATIH', 'Ya, interaksi antara Larasati dan Jaya adalah daya pikat terbesar Surat Dari Praha, susah untuk tidak terpesona melihat bagaimana  mereka sukses menggerakkan naskah garapan Irfan Ramli. Keduanya memang bukan pasangan ideal dalam term romansa mengingat perbedaan umur yang terlampau jauh, namun berbagi  orang tercinta membuat keduanya menjadi dekat,'),
(911, 'Swades', 'POSITIF', 'DATA LATIH', 'Ya, Swades menjadi sebuah drama sederhana nan inspirasional. Tema membumi dengan dukungan skrip berani yang tepat sasaran berbalut musik latar enerjik dan teknik penyutradaraan hebat dari Ashutosh Gowariker yang juga mampu memaksimalkan pesona seorang Shahrukh Khan dengan sangat baik di sini.'),
(912, 'Take Shelter', 'POSITIF', 'DATA LATIH', 'Ya, ini sebuah film indie hebat dari sutradara muda visioner yang berani dan cerdas dalam menggabungkan berbagai tema provokatif menjadi sebuah kesatuan sempurna plus penampilan mengkilap dari Michael Shannon menjadikan Take Shelter sebagai salah satu drama terbaik 2011 lalu.'),
(913, 'The 400 Blows', 'POSITIF', 'DATA LATIH', 'Dengan cerita yang mengalir natural dengan dialog yang mudah di mengerti film ini berhasil menceritakan seorang remaja dalam menghadapi pencarian jati dirinya serta kasih sayang.'),
(914, 'The Avengers', 'POSITIF', 'DATA LATIH', 'The Avengers jelas adalah suguhan pembuka summer blockbuster yang sangat menghibur dan memuaskan segala ekspektasi liar anda akan kolaborasi superhero. Berterima kasihlah kepada Joss Whedon yang tahu benar bagaimana meramu narasinya, menggabungkan banyak pahlawan super dengan keseimbangan antara kualitas cerita, ensemble cast dan adegan-adegan spektakuler yang digarap dengan apik.'),
(915, 'The Beaver', 'POSITIF', 'DATA LATIH', 'Foster tampaknya lebih ingin memfokuskan kepada proses pencarian sebuah kebenaran ketimbang terlalu banyak bermain-main dalam area itu, menjadikan The Beaver kemudian berakhir sebagai sebuah drama menarik dengan kandungan pesan cukup kuat  yang disampaikan dengan cara yang tidak biasa dan lembut oleh seorang Jodie Foster.'),
(916, 'The Billionaire', 'POSITIF', 'DATA LATIH', 'So, The Billionaire, sebuah biopik yang menyenangkan dan menyegarkan untuk perfilman Thailand secara keseluruhan.'),
(917, 'The Blair Witch Project', 'POSITIF', 'DATA LATIH', 'Overall, sebagai pionir film horor mockumentary, The Blair Witch Project tampil fresh dengan orisinalitas yang mampu memberikan sebuah pengalaman baru dalam menonton sebuah film horror.'),
(918, 'The Conjuring 2', 'POSITIF', 'DATA LATIH', 'Berbicara soal narasi, naskah yang digarap Wan mengalami perbaikan dari seri sebelumnya. The Conjuring 2 mencoba tampil lebih kompleks dengan selipan drama yang lebih sentimentil. Ikatan kuat antara Ed dan Lorraine yang sudah bagus di seri pertamanya kini semakin ditingkatkan.'),
(919, 'The Descendants', 'POSITIF', 'DATA LATIH', 'Sebuah naskah adaptasi hebat, setting cantik, penyutradaraan gemilang dan akting memukau menjadikan The Descendants sebuah paket lengkap drama keluarga dengan elemen komedi satir ala Alexander Payne yang tampaknya masih belum kehilangan sentuhan emasnya meskipun sudah absen selama 7 tahun. Ya, ini adalah tontonan drama yang menarik nan menyentuh.'),
(920, 'The Flu', 'POSITIF', 'DATA LATIH', 'Saya cukup menikmatinya, itupun karena ia punya pencuri perhatian dalam sosok kecil Park Min Ha yang tampil fantastis untuk ukuran aktris yang masih bocah terutama ketika momen puncaknya yang menegangkan itu.'),
(921, 'The Hobbit: An Unexpected Journey', 'POSITIF', 'DATA LATIH', 'Nyaris tidak ada perubahan berarti di segi teknisnya, masih sama-sama memukau, masih sama-sama menghadirkan sebuah petualangan seru dan menakjubkan, petualangan kecil yang nantinya akan menjadi akar kuat buat kebesaran trilogi TLOTR'),
(922, 'The Hobbit: Desolation of the Smaug', 'POSITIF', 'DATA LATIH', 'Kita tahu bagaimana kualitas Peter Jackson dalam menjaga ritmenya untuk tetap membuatmu betah berlama-lama, terlebih skala keasyikan dan keseruannya ditingkatkan sampai dua kali lipat lebih besar ketimbang An Unexpected Journey dengan lebih banyak kejutan yang menunggumu. Jadi meskipun kamu merasa beberapa bagiannya yang sedikit draggy tetapi Jackson kemudian membayarnya lunas melalui setiap sekuens aksi spektakulernya.'),
(923, 'The Last Exorcism', 'POSITIF', 'DATA LATIH', 'Overall, saya sangat menikmati setiap menitnya. Semua elemen-elemen mockumentary berhasil dieksekusi dengan baik, menghadirkan sebuah sensasi horror bertema pengusiran setan yang belum pernah saya lihat sebelumnya. Mencekam dengan ending yang keren.'),
(924, 'The Midnight Meat Train', 'POSITIF', 'DATA LATIH', 'Sebuah rating yang terbilang bagus untuk ukuran horror seperti ini, menjadikan The Midnight Meat Train berpotensi besar untuk mendapatkan predikat cult horror di masa yang akan datang'),
(925, 'The Thing', 'POSITIF', 'DATA LATIH', 'Ini tetap adalah tontonan sci-fi horor yang bagus buat mereka yang masih penasaran bagaimana kisah dari salah satu horor klasik terbaik ini dimulai, terlebih buat anda, penonton yang baru akan mengenal franchise The Thing.'),
(926, 'Total Recall', 'POSITIF', 'DATA LATIH', 'Total Recall memiliki modal pondasi plot solid untuk dapat bergerak kuat ke depannya. Material menarik seperti spionase, konspirasi, dunia virtual hingga satir sosial politik berhasil melebur menjadi satu. Banyak kejutan-kejutan kecil yang menjadikan film yang juga sukses di tangga box office ini menjadi semakin menarik dan menarik. '),
(927, 'Wendy and Lucy', 'POSITIF', 'DATA LATIH', 'Siapa yang menyangka sebuah drama sederhana yang bergerak pelan dan begitu tenang bisa mampu menghadirkan kadar emosional dan depresi yang kuat dengan segala penyajian ala Kelly Reichardt  yang sangat realistis,  Belum lagi ada Michelle Williams bermain sangat apik di sepanjang film.'),
(928, 'A Serbian Film', 'NEGATIF', 'DATA LATIH', 'Tapi ada satu jaminan, hal-hal yang terjadi di film ini jauh lebih bejat dan memuakkan dari semua film yang saya sebutkan di atas. Ini mendorong batas-batas sampai tingkat lebih ekstrem, anda pasti akan meringis melihat kebejatan film ini meskipun singkat dan agak buruk dalam FX.'),
(929, 'A Walk among the Tombstones', 'NEGATIF', 'DATA LATIH', 'Kadar suspense yang dibangun Frank di sini tidak terlalu menggigit meskipun ya, harus diakui, ada satu-dua momen mendebarkan, tetapi itu tidak benar-benar cukup untuk membangunkan beberapa penontonnya yang mungkin lupa minum kopi dari tidurnya.'),
(930, 'Attack on Titan: End of the World', 'NEGATIF', 'DATA LATIH', 'End of the World terlalu buruk, cenderung konyol dengan segala parade spesial efek kelas dua dan karakter-karakter dangkal.'),
(931, 'Batman v Superman', 'NEGATIF', 'DATA LATIH', 'Paruh pertama bergerak begitu lurus dan membosankan dengan karakter-karakter yang berbicara tanpa adanya kedalaman dan interaksi satu sama lain yang berarti . Plotnya terasa acak, melompat dari satu tempat ke tempat lain dengan kasar,'),
(932, 'Beautiful Creatures', 'NEGATIF', 'DATA LATIH', 'Dengan formula yang nyaris sama dengan Twilight, Beautiful Creatures jelas punya potensi dibenci sama besarnya. Jika kamu buang semua atribut fantasi dan sihirnya, ini akan menjadi sebuah kisah lain dari Romeo & Juliet baru yang klise dan cheesy dengan deretan soundtrack yang bagus.'),
(933, 'Big Trouble in Little China', 'NEGATIF', 'DATA LATIH', 'Satu hal yang perlu dicermati dalam menonton film ini adalah tidak perlu terlalu serius dan diambil pusing dengan ceritanya yang aneh, penuh dengan plot hole dan adegan-adegan aksi yang cupu layaknya sebuah film kelas B.'),
(934, 'Bridget Jones''s Baby', 'NEGATIF', 'DATA LATIH', 'Secara alur, naskah tulisan Fielding, Emma Thompson, dan Dan Mazer terkesan repetitif dari prekuelnya, beberapa adegan tampak tersendat-sendat dan tentu saja mengabaikan logika.'),
(935, 'Captain America: The First Avenger', 'NEGATIF', 'DATA LATIH', 'Captain America: The First Avenger bisa jadi merupakan bagian terlemah dari rangkaian Marvel Cinematic Universe. Ia sedikit membosankan dan terlalu lama berbasa-basi untuk ukuran sebuah kisah superhero Marvel yang biasanya disajikan cepat dan penuh hingar bingar.'),
(936, 'Carjacked', 'NEGATIF', 'DATA LATIH', 'Hasilnya seperti yang saya bilang di atas, kebodohan demi kebodohan, tidak hanya terjadi pada karakter Lorraine, tapi juga menular ke karakter Roy. Saya belum lagi menyebut lubang-lubang menganga pada naskahnya yang kemudian  menjadikan Carjacked hancur lebur dibuatnya, bahkan jauh sebelum 90 menit berakhir.'),
(937, 'Ju-On: The Beginning', 'NEGATIF', 'DATA LATIH', 'Hasilnya, The Beginning hanya seperti pengulangan demi pengulangan yang membosankan dengan beberapa modifkasi cerita dan origins tentang keluarga Saeki yang sama mengecewakannya dengan setting rumah yang kelewat terlalu terang.'),
(938, 'Ju-On: The Girl in Black', 'NEGATIF', 'DATA LATIH', 'Plot yang lemah , dipaksakan dan terlihat kacau dan hantu-hantu yang tidak seram sama sekali menjadi faktor-faktor utama gagalnya film ini membuat penontonnya terkesan,'),
(939, 'Keanu', 'NEGATIF', 'DATA LATIH', 'Baiklah, secara garis besar naskah Keanu yg turut ditulis oleh Peele memanglah lemah, mengulang formula komedi sejawat yang mengandalkan kesalah pahaman, kepura-puraan dua karakternya menjadi orang lain, hingga serangkaian adegan aksi tak masuk akal berujung slapstick.'),
(940, 'Knock, Knock', 'NEGATIF', 'DATA LATIH', 'Namun yang terjadi di lapangan ia malah terlihat konyol dan menggelikan, khususnya di paruh kedua di mana ia diharuskan untuk terlihat takut. Dan semakin menggelikan ketika ia lalu dipaksa harus terus menjerit minta tolong, terdengar sangat annoying.'),
(941, 'Legend of the Guardians: The Owls of Ga''hoole', 'NEGATIF', 'DATA LATIH', 'Tema Good vs Evil, from zero to hero klise sudah banyak ditampilkan dalam film-film lain, bahkan tanpa harus berpikir keras saja kita sudah dapat menerka ending jauh sebelum film berdurasi 90 menit ini berakhir. Banyaknya karakter yang muncul seiring berjalannya waktu rupanya juga menjadi titik lemah film ini.'),
(942, 'Miss Peregrines Home for Peculiar Children', 'NEGATIF', 'DATA LATIH', 'Pada akhirnya, Miss Peregrines Home for Peculiar Children tak lebih halnya Dark Shadows jilid II dari Burton. Film bertabur bintang yang lumayan memberi keriaan sesaat namun terlupakan dengan banyak kekurangannya.'),
(943, 'Miss You Already', 'NEGATIF', 'DATA LATIH', 'Ia masih terasa manipulatif layaknya drama-drama cengeng sejenis dalam usaha untuk memaksa emosi penontonnya, khususnya pada bagian akhir. Sementara di tempat lain, kadar komedinya sendiri tidak pernah benar-benar memberikan perbedaan berarti dalam tugasnya memberi kesenangan yang semestinya bisa lebih baik lagi.'),
(944, 'Monsters: The Dark Continent', 'NEGATIF', 'DATA LATIH', 'Dengan kecepatan penuh, The Dark Continent yang sempat memberikan harapan di openinga langsung jatuh ke dalam kubangan film perang medioker, seperti KW 2 dari The Hurt Locker yang belepotan lumpur. Karakterisasinya di awal-awal film bertransformasi menjadi kosong melompong tak berguna.'),
(945, 'Noah', 'NEGATIF', 'DATA LATIH', 'Tetapi sekali lagi, terlepas dari cerita banjir besar, bahtera raksasa, seperti judulnya, semua gravitasi berpusat pada Nuh yang coba digambarkan Aronofsky sebagai manusia biasa ketimbang seorang Nabi besar yang menanggung beban ilahi berat.'),
(946, 'Percy Jackson & the Olympians: Sea of Monsters', 'NEGATIF', 'DATA LATIH', 'Sea of Monsters jelas punya potensi untuk melebihi pendahulunya, tetapi seperti yang saya bilang ini boring dan datar bahkan ketika kamu sudah menurunkan ekspektasimu serendah mungkin.'),
(947, 'San Andreas', 'NEGATIF', 'DATA LATIH', 'Pastinya ketika kamu memutuskan untuk menonton film macam San Andreas ini dari awal seharusnya sudah dapat mengantisipasi kualitas naskahnya yang kelewat familiar bersama tambahan tema-tema ilmiah yang coba dipaksakan masuk di dalamnya.'),
(948, 'Sanctum', 'NEGATIF', 'DATA LATIH', 'Overall,  Sanctum tidak lebih dari sebuah thriller adventure medioker belaka dengan cerita lemah, akting pas-pasan dan penyutradaraan yang buruk. jadi ada atau tidaknya pengaruh seorang James Cameron di dalamnya tetap saja membuat film satu ini dengan mudah dilupakan penontonnya.'),
(949, 'Skyline', 'NEGATIF', 'DATA LATIH', 'Overall, Skyline memang bukanlah sebuah sci-fi istimewa, jelas masih banyak kekurangan besar di sana sini, namun bagi untuk ukuran sebuah film murah seperti ini Strause bersaudara sudah terbilang cukup, meskipun hampir semua penonton memaki, mencaci dan sepakat mengatakan film ini adalah sebuah kegagalan total.'),
(950, 'Snitch', 'NEGATIF', 'DATA LATIH', 'Sekali lagi Snitch bukan tipe film yang membutuhkan terlalu banyak otot dan senjata dalam penyelesaiannya, Waugh bisa saja membuatnya menjadi crime thriller ketimbang action medioker yang berisik, tetapi sekali lagi itu akan menjadi hal yang mubazir ketika kamu memasang seorang Dwayne Johnson di dalamnya.'),
(951, 'The Beauty Inside', 'NEGATIF', 'DATA LATIH', 'Menjadi melodramatis dan sentimentil bukanlah dosa terbesar The Beauty Inside, beberapa penonton membutuhkan asupan dramatis yang bahkan cenderung cengeng, namun yang menjadi masalah adalah ketidak konsistenan menjaga beberapa elemen dalam premisnya yang sedikit banyak sudah melemahkan narasinya.'),
(952, 'The Clinic', 'NEGATIF', 'DATA LATIH', 'Seperti sebuah pepatah yang berbunyi karena nila setitik, rusak susu sebelanga ya, seperti itulah kira-kira saya menggambarkan The Clinic. Dibuka dengan meyakinkan, namun sayang harus diakhiri dengan ending mengecewakan.'),
(953, 'The Conspirator', 'NEGATIF', 'DATA LATIH', 'Di sisi lain Redford juga terlalu banyak memfokuskan karakternya pada seorang James McAvoy semata, padahal karakter Mary Surratt yang dibawakan Robin Wright memiliki potensi sama besar untuk menjadikan The Conspirator lebih berwarna, sayang karakternya hanya lebih banyak diam di sepanjang film.'),
(954, 'The Devil Inside', 'NEGATIF', 'DATA LATIH', 'The Devil Inside tidak sampai seburuk yang dibicarakan, tapi untuk endingnya saya setuju kalau ia memang mengecewakan, ending tiba-tiba yang seakan-akan meninggalkan penontonnya begitu saja.'),
(955, 'The Finest Hours ', 'NEGATIF', 'DATA LATIH', 'Hasilnya, 117 menit The Finest Hours terasa begitu sangat panjang dan melelahkan.'),
(956, 'The Guest', 'NEGATIF', 'DATA LATIH', 'Kerusakan luar biasa ala action thriller kelas B yang di upgrade, serta akhir klise ketika Wingard membawa genrenya berubah menjadi slasher klasik dengan setting wahana rumah hantu.'),
(957, 'The Hunger Games: Mockingjay Part I', 'NEGATIF', 'DATA LATIH', 'Bukan salah siapapun jika pada akhirnya adaptasi bagian pertama Mockingjay berakhir antiklimaks. Materi buku Suzanne Collins memaksa Francis Lawrence dan duo penulis naskah Danny Strong dan Peter Craig memutar otak untuk tetap bisa meneruskan pertunjukannya.'),
(958, 'The Hunger Games: Mockingjay Part II', 'NEGATIF', 'DATA LATIH', 'Relasi cinta segitiganya juga tetap sama flat dengan pendahulunya, tidak ada dilema yang bisa dirasakan dari dua pilhan, bahkan saga Twilight saja masih lebih baik soal ini. Sementara di tempat lain juga terlalu banyak cast terbuang karena olahan naskah yang kerdil.'),
(959, 'The Maze Runner', 'NEGATIF', 'DATA LATIH', 'Sayang lagi-lagi penyakit lain dari sub-genre ini kembali muncul ketika sutradanya tidak mampu menggali lebih dalam masalah di novelnya. Penulis naskah yang terdiri dari trio Noah Oppenheim, Grant Pierce Myers danT.S. Nowlin memilih untuk menyederhanakan konflik internalnya, tidak ada ikatan terbentuk dari interaksi karakternya membuat momen di luar labirin bisa dibilang membosankan.'),
(960, 'The Woman in Black: Angel of Death', 'NEGATIF', 'DATA LATIH', 'Yang menjadi masalah besar mungkin bukan terletak pada naskahnya yang repetitif, namun pada presentasinya. Angel of Death terlalu bergantung pada rentetan momen kaget-kagetan murahan lengkap dengan scoring jreng-jreng yang kelewat lebai dan terlalu predictable.'),
(961, 'Tron: Legacy', 'NEGATIF', 'DATA LATIH', 'Tidak hanya itu, selain kisahnya yang datar dan kurang greget, dan minim konflik, penonton juga disuguhkan dengan buruknya kualitas dialog-dialog yang terlewat sederhana (baca: bodoh) dari para karakter-karakternya yang juga tampil tidak kalah mengecewakannya,'),
(962, 'A Hard Day', 'POSITIF', 'DATA UJI', 'Semua yang kamu butuhkan dalam sebuah thriller ada di sini. Sejak detik pertama bergulir, dengan begitu mudah A Hard Day langsung membuat penontonnya untuk duduk manis, terjebak dalam pusaran arus deras premis thriller yang ditawarkannya. Kudos buat penyutradaraan cepat dan juga naskah efektif Kim Seong Hun'),
(963, 'Adam', 'POSITIF', 'DATA UJI', 'Overall, bagi penggemar drama romantis, Adam mungkin bisa dijadikan alternatif pilihan menonton, memang film indie satu ini tidak menampilkan sesuatu yang baru pada ceritanya, namun tetap saja kisah percintaan antara dua orang yang bertolak belakang selalu menarik untuk ditonton.'),
(964, 'American Mary', 'POSITIF', 'DATA UJI', 'Mereka mampu mengeksplorasi lebih dalam karakter Mary yang dibawakan dengan cemerlang oleh Katherine Isabelle, bagaimana transformasinya dari sosok yang manis dan polos menjadi tukang bedah handal dengan luka besar di jiwanya yang rapuh, dan kita sebagai penonton diajak untuk bersimpati dengan segala tindakan yang dilakukannya'),
(965, 'Barking Dogs Never Bite', 'POSITIF', 'DATA UJI', 'Overall, Barking Dogs Never Bite adalah sebuah sajian komedi hitam ala Korea Selatan yang sangat menarik, segar dan yang pasti menghibur. Apalagi sebagai sutradara dan penulis Bong Joon Ho sukses menghadirkan karya debutnya ini dengan penyajian yang unik yang dijamin akan meninggalkan kesan mendalam di benak penontonnya.'),
(966, 'Black Sea', 'POSITIF', 'DATA UJI', 'Saya suka bagaimana McDonald menghadirkan tensi ketegangan yang mampu terjaga dengan baik di sepanjang 115 menit durasinya. Tidak banyak basa-basi, McDonald langsung menyajikan permasalahan dari awal dengan cepat.'),
(967, 'Borgman', 'POSITIF', 'DATA UJI', 'Film yang dikirimkan Belanda untuk bertempur diajang film-film asing terbaik Oscar tahun depan ini begitu percaya diri melabeli dirinya dengan sebutan horor dan thriller, bahkan kamu bisa memasukkan lebih banyak lagi sub-genre ke dalam nadinya'),
(968, 'Byzantium', 'POSITIF', 'DATA UJI', 'Byzantium adalah sebuah usaha yang bagus dari Neil Jordan dalam usahanya mempertahankan sisi old-school sebuah vampir movie baik dari sisi teknis dan narasi modifikasi yang diisi dengan kisah kelam para wanita cantik penghisap darah dengan kejutan-kejutan yang menarik dan sedikit romansa terlarangnya.'),
(969, 'Cheap Thrills', 'POSITIF', 'DATA UJI', 'Debut penyutradaraan E.L. Katz ini adalah thriller yang lucu, pintar, penuh kejutan, komedi gelap dan pertanyaan-pertanyaan tentang moral.'),
(970, 'Chico & Rita', 'POSITIF', 'DATA UJI', 'Chico & Rita itu animasi yang jarang ada. Perpaduan manis antara romansa dewasanya yang manis-pahit, parade soundtrack yang menawan serta penyajian animasinya yang tidak biasa menjadikannya istimewa.'),
(971, 'Crimson Peak', 'POSITIF', 'DATA UJI', 'Kudos buat penyutradaraan apik del Toro temasuk di dalamnya desain produksinya yang luar biasa cantik. Dari set, kostum sampai make up semua berhasil dimaksimalkan dalam sentuhan gotik modern megah ala del Toro bersama visual indah DoP Dan Laustsen'),
(972, 'Devil', 'POSITIF', 'DATA UJI', 'Ya, Devil adalah sebuah horror thriller supranatural dengan premis yang terbilang orisinil dan menyegarkan, simpel namun tricky. Sutradara John Erick Dowdle (Quarantine) bersama penulis naskah Brian Nelson sepertinya tahu benar bagaimana mewujudkan sebuah claustrophobic terror dan kengerian ala Shyamalan dengan intensitas cerita yang terjaga dengan baik'),
(973, 'Driving Miss Daisy', 'POSITIF', 'DATA UJI', 'Driving Miss Daisy adalah sebuah film berkualitas yang ringan, menghibur dan menyentuh serta sarat makna tentang arti sebuah persahabatan yang kental. Sebuah kisah persahabatan yang mampu menjadi inspirasi bagi para penontonnya.'),
(974, 'The Square', 'POSITIF', 'DATA UJI', 'Saya suka ceritanya, tidak percuma memang Edgerton menggodoknya sampai tujuh tahun karena hasilnya sangat solid dan efektif.'),
(975, 'The BFG', 'NEGATIF', 'DATA UJI', 'Sayang naskah garapan mendiang Melissa Mathison yang konon sebelumnya sudah sempat diutak-atik selama 25 tahun tidak memberikan kesan mendalam, terlalu lurus, terlalu aman dan tanpa kejutan berarti,'),
(976, 'The Book of Eli', 'NEGATIF', 'DATA UJI', 'Banyak halyang terkesan dangkal dan dipaksakan di sepanjang film berdurasi 118 menit ini. Beberapa adegan pertarungan memang terlihat menarik, namun semua itu seakan akan tidak mampu menutupi kelemahan-kelemahan dalam ceritanya yang cukup mengganggu.'),
(977, 'The Company You Keep', 'NEGATIF', 'DATA UJI', 'The Company You Keep malah menjadi sebuah antiklimaks, tontonan yang membosankan dan bertele-tele. Film ini jelas jauh dari menegangkan, menjadi semakin buruk ketika Redford bersama penulis naskah Lem Dobbs mencoba memasukkan semua konflik dari adaptasi aslinya tanpa tahu harus membawanya ke mana.'),
(978, 'The Crimson Rivers', 'NEGATIF', 'DATA UJI', 'Jadi pendek kata Kassovitz dengan sengaja menghilangkan sebagain besar adegan-adegan berisi penjelasan hanya karena tidak mau membuat penontonnya menjadi bosan, bagi saya itu adalah sebuah kesalahan besar, karena lebih baik sedikit bosan ketimbang harus menonton sebuah film tanpa cerita yang jelas.'),
(979, 'DIvergent: Allegiant', 'NEGATIF', 'DATA UJI', 'Ini juga berakhir sama payahnya dengan kualitas cerita dan karakternya, sama-sama kacau, meski harus diakui kali ini ada lebih banyak teknologi baru yang belum pernah ada di seri-seri sebelumnya tetapi lagi-lagi semua terlihat palsu dan plastik.'),
(980, 'The Double', 'NEGATIF', 'DATA UJI', 'Plotnya yang beputar-putar jelas akan membingungkan, adegan demi adegan yang berulang memudarkan antara realita dan kenyataan, dan komedinya sama anehnya dengan presentasinya.'),
(981, 'The Hangover: Part III', 'NEGATIF', 'DATA UJI', 'Yang terjadi dengan kepercayaan yang begitu tinggi pada akhirnya adalah bencana di seri keduanya, dan The Hangover Part III yang dipaksakan untuk dilanjutkan sebagai penutup juga bukan sekuel yang bagus, namun setidaknya ini masih lebih baik ketimbang part deux yang malas itu.'),
(982, 'An American Crime', 'POSITIF', 'DATA LATIH', 'Akhir kata, An American Crime adalah sebuah suguhan drama kriminal yang menarik, mengerikan namun juga emosional di sisi lain, bukan hanya karena faktor diangkat dari kejadian nyata, namun juga bagaimana sutradara Tommy OHaver mampu menghadirkannya dengan baik, membungkusnya dengan elemen-elemen drama artistik plus dukungan prima dari para pemainnya, sehingga membuat film yang tidak beredar di bioskop ini meninggalkan kesan cukup mendalam di benak setiap penontonnya.'),
(983, 'Blackfish', 'POSITIF', 'DATA LATIH', 'Semua fakta itu secara gamblang disajikan oleh Cowperthwaite dalam alur bercerita yang terjaga rapi dan sistematis tanpa mengurangi unsur ketegangan di saat beberapa rekaman-rekaman menghadirkan momen horor dengan nuansa thriller psikologis kental.'),
(984, 'Blair Witch', 'POSITIF', 'DATA LATIH', 'Wingard tahu benar memainkan rasa takut penontonnya dan sesuatu yang tak terlihat bisa jauh lebih menakutkan dalam kegelapan, mengekspos wajah-wajah putus asa dari para pemaiannya yang bermain hebat, hingga penampakan sekilas Blair yang tersohor itu.'),
(985, 'Chef', 'POSITIF', 'DATA LATIH', 'Favreau mengolahnya dengan aroma hangat dan penuh kesederhanaan serta sebuah kedekatan yang kuat, dan bagaimana ia turut memasukkan elemen modern macam media sosial melalui jejaring sosial macam twitter sampai youtube yang mampu terjalin baik dengan narasinya itu juga menjadikan Chef menjadi semakin menarik. ya tentu saja pesona utamanya tetap ada pada setiap masakan-masakan lezat yang dibuat sang juru masak.'),
(986, ' Chungking Express', 'POSITIF', 'DATA LATIH', ' Chungking Express jelas bukan sebuah film cinta biasa, Wong Kar Wai dengan kejeniusannya berhasil menghipnotis dan membawa kita ke dalam sebuah pengalaman sinematik yang unik, tidak biasa dan juga indah yang berhasil mengeksplorasi persamaan dan perbedaan manusia dalam berkomunikasi dan mengungkapkan perasaannya akan cinta.'),
(987, 'cin(T)a', 'POSITIF', 'DATA LATIH', 'Pertanyaan tentang apakah kekuatan cinta dapat mengatasi segala perbedaan dan pertanyaan-pertanyaan tentang eksistensi Tuhan dan Agama itu pun dijawab dengan manis oleh film berdurasi 79 menit ini melalui dialog-dialognya yang cerdas, kritis, lucu walaupun masih terkesan menggurui penontonnya.'),
(988, 'Cinderella', 'POSITIF', 'DATA LATIH', 'Ya, Branagh bisa dibilang sukses memoles dongeng sebelum tidur legendaris ini dalam sebuah penyajian yang memadukan unsur klasik dan kontemporer dalam porsi yang berimbang.  Branagh memberi sentuhan dramatis ala Shakespearean yang lebih manusiawi sekaligus elegan pada Cinderella miliknya dengan penggunaan spesial efek cantik yang menegaskan unsur fantasi yang diisi pesan keberanian dan kebaikan.'),
(989, 'Dead Girl', 'POSITIF', 'DATA LATIH', 'Dead Girl menjadi salah satunya yang cukup cerdas dan kreatif dalam mengemas segala kelebihan temanya itu dengan komposisi drama ABG dan horor-zombie yang seimbang plus bumbu dilema moralnya yang mampu bekerja baik untuk menjadikannya sebuah tontonan horor yang menyegarkan'),
(990, 'Dead Set', 'POSITIF', 'DATA LATIH', 'Dead Set jelas melebihi segala ekpektasi penontonnya. Ia mampu menjelma menjadi sajian 5 episode horor-thriller zombie grade A yang bergerak cepat nan efektif dalam menjangkiti tiap penontonnya dengan segala kengerian dan kebrutalan yang berhasil dibangun apik di dalamnya.'),
(991, 'Deadpool', 'POSITIF', 'DATA LATIH', 'Menonton Deadpool berarti kamu harus mempersiapkan dirimu untuk menghadapi 108 menit penuh kejutan dan kegilaan yang seperti tanpa batas. Siapa yang menyangka bahwa  spesialis spesial efek yang didapuk menjadi sutradara macam Tim Miller ini bisa memberikan batasan begitu tinggi dalam menghadirkan sajian superhero komedi, bahkan ini adalah film pertamanya.'),
(992, 'Dracula', 'POSITIF', 'DATA LATIH', 'Dracula adalah contoh bagaimana kisah romantisme vampire dan manusia berhasil dibuat dengan luar biasa tanpa harus kehilangan jati dirinya sebagai sebuah film horror sejati yang menawarkan kengerian dan ketegangan dengan dukungan elemen-elemen teknis dan art berkualitas.'),
(993, 'Dracula Untold', 'POSITIF', 'DATA LATIH', 'Dracula Untold digarap bagus lengkap bersama efek ribuan kelelawar keren dan sentuhan tone kelam yang seperti ingin menegaskan gelapnya jalan yang dipilihnya. Luke Evans yang didapuk menjadi tokoh sentralnya juga berhasil mengemban pesona besar Drakula bersama tatapan dinginnya yang menusuk namun di sisi lain ia juga memancarkan kehangatan seorang ayah dan suami buat keluarga tercintanya.'),
(994, 'Filosofi Kopi', 'POSITIF', 'DATA LATIH', 'Kedua karakter bak bumi dan langit ini rupanya berhasil disatukan dengan sempurna oleh Angga Dwimas Sasongko. Baik Chicco Jericho dan Rio Dewanto sudah menjalankan tugas mereka dengan fantastis, menghadirkan chemistry duo sahabat karib yang kuat sekaligus hangat'),
(995, 'Frozen', 'POSITIF', 'DATA LATIH', 'Seperti judulnya, atomosfer dingin dengan salju putih berkilauan mendominasi 108 menit durasinya dengan detil-detil animasi cantik. Setting dinginnya terbungkus oleh kehangatan kisah sederhana tentang sisterhood, true love dan petualangan mendebarkan melintasi pegunungan bersalju.'),
(996, 'Gett: The Trial of Viviane Amsalem', 'POSITIF', 'DATA LATIH', 'Ya, premisnya boleh saja terlihat simpel, tetapi siapa sangka dalam perjalanannya ia menjadi jauh lebih kompleks, tidak ketinggalan sebuah subteks kuat tentang dominasi kaum pria yang berhasil disajikan dengan sangat pintar dan menggigit.'),
(997, 'Grave Encounters', 'POSITIF', 'DATA LATIH', 'Buat saya Grave Encounters sudah berhasil menjalankan misi utamanya, menghadirkan sebuah pengalaman menonton horor mockumentary yang tidak hanya bergerak cepat tanpa basa-basi tapi juga menakutkan di saat bersamaan.'),
(998, 'Grown Ups', 'POSITIF', 'DATA LATIH', 'Seperti kebanyakan komedi-komedi Sandler lainnya, Grown Ups pun tidak hanya menampilkan kelucuan semata, Komedian jebolan Saturday Night Live ini pun tidak lupa menyelipkan pesan-pesan moral tetang pentingnya keluarga dan masa kanak-kanak yang mampu membuat film ini menjadi (sedikit) lebih berkesan.'),
(999, 'Hansel & Gratel', 'POSITIF', 'DATA LATIH', 'Tidak semua dongeng itu indah dan penuh dengan kebahagiaan, melalui Hansel & Gretel kita diajak memasuki sebuah fabel kelam nan tragis di mana melalui kisahnya yang kompleks dan penuh dengan misteri itu ia mampu mengusik rasa penasaran kita untuk terus penasaran mengikuti ke mana jejak remah-remah roti ini berakhir.'),
(1000, 'Harry Potter and the Deadly Hallows: Part II', 'POSITIF', 'DATA LATIH', 'Duel-duel sihir spektakuler menjadi pemandangan yang akan sering kita lihat menginjak paruh akhir The Deathly Hallows: Part 2, termasuk pertarungan pemuncak antara Harry dan Pangeran kegelapan yang tersaji begitu cantiknya, hingga kemudian ditutup dengan sebuah ending manis dan sedikit menggelikan.'),
(1001, 'Hello Ghost', 'POSITIF', 'DATA LATIH', 'Biarkanlah sentuhan melodramatik mengalir di sela sela adegan komedinya dan siapkan tissue karena endingnya akan menjawab segalanya. Hello Ghost sukses menjadi Box Office di negaranya, tak hanya itu sutradara Chris Colombus pun berminat untuk membuat remake film ini ke Hollywood, kalau anda ingin film yang menghibur sekaligus mempunyai pesan moral yang kuat, maka saya sarankan untuk menonton film ini bersama keluarga anda.'),
(1002, 'Hobo with a Shotgun', 'POSITIF', 'DATA LATIH', 'Menjadikan Rutger Hauer sebagai sosok vigilante tua dengan shotgun simpatik memang pilihan sangat tepat, tapi bukan itu saja yang kemudian menjadikan Hobo with a Shotgun terasa istimewa, bukan juga tampilan apik film kelas dua yang digarap hebat atau kemunculan duo Plague yang keren itu, ada tujuan mulia disini di balik setiap cipratan darah segar dari senjata hobo dan mulut kotornya.'),
(1003, 'Horns', 'POSITIF', 'DATA LATIH', 'Satu hal yang paling menarik dalam Horns selain tanduk setan, pembunuhan, Juno Tampel yang manis dan polos serta romansanya, tentu saja adalah penampilan Daniel Radcliffe yang prima. Sejak meninggalkan Hogwarts, baru kali ini saya merasa Radcliffe benar-benar tampil lepas, menanggalkan alamamater kebesarannya, bertransformasi cantik menjadi sosok anti-hero depresi dengan tanggung jawab dari kekuatannya yang menakutkan.'),
(1004, 'I Origins', 'POSITIF', 'DATA LATIH', 'Pada akhirnya meski klimaks I Origins mungkin tidak sampai sedahsyat Another Earth, tetapi Cahill tahu benar bagaimana menutupnya dengan memuaskan. Ada emosi yang tumpah ruah di ujungnya berkat pondasi kuat di paruh pertamanya, bersama konklusi dan twist sederhana namun menusuk yang misterinya memang sengaja tidak dijawab sepenuhnya.'),
(1005, 'I Saw the Devil', 'POSITIF', 'DATA LATIH', 'Dengan balutan sinematografi jempolan yang dieksekusi dengan sangat baik serta ditambah rangkaian adegan-adegan super sadis membuat saya berani mengukuhkan bahwa I Saw the Devil adalah thriller terbaik Korea Selatan tahun ini.'),
(1006, 'Im Not Scared', 'POSITIF', 'DATA LATIH', 'Overall, Im Not Scared adalah sebuah film sederhana namun sarat dengan keindahan di balik premisnya yang sebenarnya gelap. Sebuah kisah kepahlawanan serta proses menuju kedewasaan yang digarap dengan sangat baik, menarik dan juga realistis.'),
(1007, 'In Fear', 'POSITIF', 'DATA LATIH', 'In Fear berhasil menguatkan judulnya. Ia punya teknis jempolan yang berhasil memberikan sebuah sajian teror psikologis melalui aroma klaustrofobik kental dan scoring mendebarkan, menghadirkan rasa tidak nyaman bagi penontonnya ketika dipaksa harus menjelajahi set hutan Cornwall, Irlandia.'),
(1008, 'In Her Skin', 'POSITIF', 'DATA LATIH', 'Untuk ukuran sebuah drama thriller indie, In Her Skin tergolong sebuah film yang cukup bagus. Sutradara Simone North telah bekerja dengan baik mengubah naskahnya menjadi sebuah sajian drama tragedi yang emosional hingga kemudian mengeksekusi setiap adegan di dalamnya dengan sentuhan visual yang indah, bahkan dari menit pertama saya langsung merasa bahwa In Her Skin akan menawarkan sesuatu yang depressing di balik gambar-gambarnya yang cantik itu.'),
(1009, 'Infection', 'POSITIF', 'DATA LATIH', 'Overall, dengan mengandalkan kerumitan ceritanya dan suasananya yang suram dan menakutkan, Kansen / Infection mampu menghadirkan sebuah J-horror yang menarik dan menghibur bahkan setelah closing credit selesai pun kita dijamin akan tetap memikirkan film satu ini.'),
(1010, 'Inside Llewyn Davis', 'POSITIF', 'DATA LATIH', 'Tentu saja pada akhirnya karakter Llewyn Davis lah yang menjadi sentralnya dan aktor sekaligus penyanyi, Oscar Isaac sukses mengisi jiwa Davis dengan sempurna bersama tatapan sendu dan suara tenor merdunya'),
(1011, 'Insidious', 'POSITIF', 'DATA LATIH', 'Simpel namun efektif memberikan sebuah sensasi kengerian yang menghibur, cepat dan tidak bertele-tele dalam menghadirkan konfliknya, menjadikan 100 menit serasa berlalu begitu cepatnya. Sekali lagi kolaborasi James Wan dan Leigh Whannell  berhasil memberikan sebuah tontonan horror yang berkualitas dan menghibur.'),
(1012, 'Ip Man 2', 'POSITIF', 'DATA LATIH', 'Overall, Ip Man 2 bisa dibilang adalah sebuah sekuel yang sangat memuaskan, sebuah kisah lanjutan yang mampu mengimbangi kehebatan film pertamanya, sebuah kisah lanjutan yang dikemas secara apik dan menghibur khususnya bagi penggemar kisah aksi bela diri kualitas tinggi. Jadi buat yang sudah menonton dan menyukai kisah pertamanya, film ini wajib hukumnya untuk ditonton.'),
(1013, 'Ive Loved You So Long', 'POSITIF', 'DATA LATIH', 'Ive Loved You So Long adalah contoh sebuah drama kuat dan menyentuh yang berisi kompilasi tema tentang hubungan kakak-adik, tentang pencarian jati diri, tentang perjuangan untuk bisa diterima kembali, bagaimana berdamai dengan masa lalu agar dapat terus maju. Semua itu juga berhasil tidak lepas dari dukungan naskah dan eksekusi yang baik dari Philippe Claudel plus akting luar biasa dari para pemainnya.'),
(1014, 'Johnny English Reborn', 'POSITIF', 'DATA LATIH', 'Oliver Parker bisa dibilang berhasil menghadirkan sajian komedi pelepas penat efektif sama atau mungkin tampil sedikit lebih baik dari pendahulunya. Tentu saja faktor X bernama Rowan Atkinson masih mendominasi dan menjadi nilai jual terbesar dari komedi parodi satu ini.'),
(1015, 'Kill List', 'POSITIF', 'DATA LATIH', 'Ya, Kill List  memang brutal dan gelap, ada sisi psikologis dari karakter utamanya yang dimainkan dengan sangat baik oleh Neil Maskell berperan besar disini, menghadirkan sebuah kengerian tidak terlihat yang juga terpancar dari scoring menyayatnya yang membuat adegan tenang terasa menakutkan hingga kemudian mencapai puncaknya pada adegan kejar-kejaran dalam terowongan gelap'),
(1016, 'Kubo and the Two Strings', 'POSITIF', 'DATA LATIH', 'Di sini mereka berhasil membuat semua penonton termasuk penonton dewasa bisa begitu menikmati setiap menitnya. Ada humor yang cukup untuk membuatmu tertawa atau paling tidak tersenyum, ada kehangatan dari cerita cinta, keluarga dan tradisi, desain karakter yang loveable, ada petualangan seru dengan monster dan beberapa kejutan cerita yang menyenangkan.'),
(1017, 'Law Abiding Citizen', 'POSITIF', 'DATA LATIH', 'Menarik memang melihat adu pintar antara kedua karakter utamanya dan juga menanti apa kejutan-kejutan yang akan dilakukan karakter Clyde selanjutnya. Ia mampu menghibur karena disajikan dengan cukup bervariasi.'),
(1018, 'Les Miserables', 'POSITIF', 'DATA LATIH', 'Jadi apa yang dilakukan Hooper di sini seperti memindahkan versi panggung Broadway- ke medium film dengan segala aransemen ulang musik dan lagu-lagunya yang luar biasa serta teknis penyajian yang jempolan. Lihat setting,, lihat sinematografinya, bersama kekuatan akting para pemainnya dan musikalitas tingkat tingginya semua sukses melebur menjadi sebuah kesatuan harmoni yang cantik nan emosional.'),
(1019, 'Loft', 'POSITIF', 'DATA LATIH', 'Tidak heran jika faktanya Loft mampu menjadi film yang paling sukses di Belgia sana. Lihat saja bertaburnya bintang-bintang hebat Belgia yang tampil apik, atau kualitas naskah dan penyutradaraan solid dari Erik Van Looy sudah memanjakan para penggemar kisah-kisah crime thriller berkualitas.'),
(1020, 'Megamind', 'POSITIF', 'DATA LATIH', 'Tema Superhero memang selalu menarik untuk ditonton, apalagi Film Animasi ini cocok di tonton oleh tua dan muda. Megamind murni sebagai animasi penutup tahun 2010 yang sangat menghibur, ya meskipun belum mampu menandingi kedahsyatan How To Train Your Dragon dan Toy Story 3, namun film ini cukup saja dengan kata Menghibur.'),
(1021, 'Million Dollar Arm', 'POSITIF', 'DATA LATIH', 'Gillespie tahu benar bagaimana dengan sabar menyajikannya dalam balutan kehangatan sebuah drama keluarga bersama bumbu komedi segar yang tak henti-hentinya menghadirkan senyum.'),
(1022, 'Need for Speed', 'POSITIF', 'DATA LATIH', 'Dan apa yang saya suka dari versi live action garapan Scott Waugh adalah ia tahu bagaimana memindahkan setiap elemen terbaik dari gamea ke versi live actiondengan editing cepat, scoring enerjik, stunt-stunt berbahaya minim CGI yang semuanya dibalut dalam penggunaan sudut-sudut kamera dinamis yang menghasilkan rentetan sekuen spektakuler.'),
(1023, 'Nikita', 'POSITIF', 'DATA LATIH', 'Overall, Untuk sebuah film bergenre action thriller, Nikita memang tidak banyak mengobral adegan-adegan aksi menegangkan pemacu adrenalin layaknya film Besson kebanyakan, namun menjadi istimewa ketika sutradara asal Perancis satu ini mampu membawa kisah seorang pembunuh ini ke area yg lebih personal.'),
(1024, 'Omar', 'POSITIF', 'DATA LATIH', 'Sebuah teknis ala sineas-sineas timur tengah yang dipenuhi dengan kesederhanaan dan realisme yang kuat yang terpancar dari pergerakan kamera, momen dramatis yang melibatkan kejar-kejaran ala Bourne melewati setiap gang sempit dan tentu saja akting kuat aktor-aktor non-profesionalnya.'),
(1025, 'Paranormal Activity 2', 'POSITIF', 'DATA LATIH', 'Dukungan naskah yang ditulis oleh Michael R. Perry, Christopher Landon, Tom Pabst dan Oren Peli sendiri sedikit banyak membuat Paranormal Activity 2 ini mengalami banyak kemajuan berarti dalam ceritanya. Menariknya, kisah yang disajikan ini lebih ke sebuah prekuel ketimbang sekuel.'),
(1026, 'Pieta', 'POSITIF', 'DATA LATIH', 'Ia punya plot yang cerdas, karakterisasi yang kuat dan susah untuk tidak menyukai kandungannya yang berisi banyak hal tentang bagaimana proses penebusan dosa yang ekstrem, tentang kasih sayang yang menyembuhkan dan juga menghancurkan, tentang kelembutan di balik kebrutalan, tentang kebencian yang berujung balas dendam.'),
(1027, 'Predators', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah sajian fiksi ilmiah dengan balutan thriller dan action di dalamnya, Predators mungkin masih tidak sebaik pendahulunya, namun tetap saja ini adalah sebuah sekuel yang baik, setidaknya bagi saya, fans berat film pertamanya yang cukup terhibur melihat pertarungan para manusia dengan para predator kali ini.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(1028, 'Predestination', 'POSITIF', 'DATA LATIH', 'Hampir kurang lebih 40 menit sub-plot emosional dari Unmarried Mother yang dimainkan gemilang oleh bintang Jessabelle, Sarah Snook yang nyaris tidak dikenali di awal film kemudian menjadi bagian tidak terpisahkan dari keseluruhan cerita,'),
(1029, 'RED 2', 'POSITIF', 'DATA LATIH', 'Resep action comedy yang sama dengan koki berbeda dan porsi kelucuan dan ledakan yang ditambah dan hasilnya masih sama lezatnya dengan pendahulunya, terlebih kali ini ada lebih banyak personel dengan nama besar dan hasilnya, RED 2 adalah film yang menyenangkan ditonton.'),
(1030, 'Requiem for a Dream', 'POSITIF', 'DATA LATIH', 'Penggunaan teknik montages mendominasi hampir keseluruhan film sepanjang 102 menit ini, membuat film ini terasa unik dan berbeda dari film-film sejenis. Seperti masih belum cukup menghadirkan kegilaan lewat visual-visualnya, lantunan irama Lux Aeterna yang legendaris dan menyayat hati garapan Clint Mansell pun membuat kisah tragis ini semakin menjadi-jadi.'),
(1031, 'Rurouni Kenshin: The Legend Ends', 'POSITIF', 'DATA LATIH', 'Kenshin Vs. Soujiro dipenuhi dengan kecepatan dan kelincahan sebuah adu pedang cantik, sebuah rematch yang fantastis. Sementara foursome battle antara Kenshin and the gank melawan Shisio itu sulit untuk dilukiskan dengan kata-kata.'),
(1032, 'Scott Pilgrim vs. The World', 'POSITIF', 'DATA LATIH', 'Overall, Scott Pilgrim vs. The World menjadi penyegar di akhir-akhir summer movies 2010 dan tak lupa musik-musik yang hadir di film ini asyik sekali, patut dikoleksi.'),
(1033, 'Solomon Kane', 'POSITIF', 'DATA LATIH', 'Nikmati saja kisahnya yang sederhana niscaya anda akan terhibur seperti saya sambil sekalian berharap sekuelnya nanti akan lebih baik dari yang ditampilkan sekarang.'),
(1034, 'Stand by Me', 'POSITIF', 'DATA LATIH', 'Stand by Me punya kedalaman, efek poping dan motion yang mumpuni dalam menghadirkan pengalaman sinematik modern yang menghibur, sementara menginjak paruh kedua dominasi cahaya matahari sore memberi kesan sentimentil guna mendukung narasi perpisahan dengan lantuan lembut Himawari no Yakusoku yang memberi efek melodrama luar biasa.'),
(1035, 'Star Wars Episode VII: The Force Awakens', 'POSITIF', 'DATA LATIH', 'The Force Awakens tampil juga tampil perkasa di sini, bahkan bisa dibilang ia sedikit berada di bawah Empire Strike Back yang punya kekuatan dan twist yang hampir sama gilanya. Setiap kejutan berakhir dengan letupan emosi, terutama buat para penonton veterannya. Setiap sesuatu yang familiar memunculkan sebuah nostalgia dan romantisme yang begitu kuat,'),
(1036, 'The Admiral: Roaring Currents', 'POSITIF', 'DATA LATIH', 'Tentu saja pertempuran dahsyatnya melibatkan banyak kerusakan yang mendebarkan, tetapi bagian terbaiknya tidak hanya sampai di sana. Kim Han Min menyelipkan banyak kejutan dari strategi cerdas yang melibatkan kekuatan alam dan juga sebuah drama heroisme dan patriotisme penuh keberanian yang menginspirasi dari seorang pemimpin besar.'),
(1037, 'The Broken Circle Breakdown', 'POSITIF', 'DATA LATIH', 'Jarang ada drama dengan elemen musik yang tidak hanya digarap bagus namun di sisi lain sekaligus berfungsi sebagai penguat narasinya. Dari awal saja ketika lagu yang dibawakan dengan apik oleh Johan Heldenberg, itu seperti sebuah pertanyaan pembuka merdu, Apakah lingkaran itu bisa tidak tersambung kembali? Apakah ada kehidupan setelah kematian?" Lalu masih ada banyak lagi tembang-tembang country bluegrass bertema pahit-manis didendangkan bersama duet Johan Heldenbergh dan Veerle Baetens dengan kekuatan chemistry yang sama solidnya ketika keduanya menghadirkan romansa, kesenangan dan segala luka kehidupannya.'),
(1038, 'The Debt', 'POSITIF', 'DATA LATIH', 'The Debt mungkin bukan thriller spionase yang sempurna. Tapi bagaimanpaun film yang didistribusikan oleh Focus Features dan Miramax Films ini adalah remake yang bagus, apalagi ketika Madden mampu mengemasnya dengan baik setiap momen-momen penuh kejutan dan ketegangan di dalamnya, termasuk dukungan akting hebat dalam diri Helen Mirren dan Jessica Chastain.'),
(1039, 'The Fault in Our Star', 'POSITIF', 'DATA LATIH', 'Josh Boone sudah melakukan pekerjaan bagus ketika bersama penulis naskah Scott Neustadter dan Michael H. Weber tahu benar bagaimana mengangkut bagian-bagian terbaik dari novelnya meskipun tentu saja tidak semuanya yang ada di versi live action akan selengkap novelnya,'),
(1040, 'The Gallows', 'POSITIF', 'DATA LATIH', 'Satu hal yang harus diperhatikan dalam membuat sebuah horor mockumentary adalah tingkat kerealistisannya. Memang sekarang gimmick-gimmick kisah nyata, rekaman nyata dan pelaku nyata sudah tidak lagi mempan buat penonton yang sudah tahu jika ini adalah pertunjukan horor. Tetapi kesan nyata itu tetap harus ada di sub genre ini karena di sanalah kekuatannya.'),
(1041, 'The Greatest', 'POSITIF', 'DATA LATIH', 'Overall, The Greatest memang bukanlah drama istimewa, terutama kisahnya yang memang biasa-biasa saja dan sudah sering diangkat di film-film lain, namun setidaknya film satu ini dapat mewakili sebuah kesedihan dan kedukaan mendalam sebuah keluarga lewat akting kuat dari para pemainnya, sehingga mungkin tanpa sadar momen-momen menyentuh di dalamnya akan menggugah emosi penontonnya.'),
(1042, 'The Heat', 'POSITIF', 'DATA LATIH', 'Kombinasi duet maut yang bak bumi-langit dengan kandungan esterogen tingkat tinggi ini menjadi daya pikat terbesar The Heat. Paul Feig memberi banyak waktu untuk McCarthy dan Bullock membangun chemistry kuat mereka, mengenali satu sama lain, mengisi setiap kekurangan dengan kelebihan mereka,'),
(1043, 'The Iron Lady', 'POSITIF', 'DATA LATIH', 'Tidak diragukan bahwa Streep yang membawa film ini dari stempel ordinary ke extraordinary. Patut diakui juga akting pemain pendukung Olivia Colman sebagai putrinya, Carol. Saya tidak heran jika Meryl Streep memenangkan Oscar lagi di film ini. Walaupun saya juga menjagokan Viola Davis.'),
(1044, 'The Judge', 'POSITIF', 'DATA LATIH', 'Dobkin jelas beruntung punya dua pemain hebat macam Downey Jr. dan Duvall yang mampu menggerakkan ceritanya. Hubungan yang terjalin menghadirkan aroma dingin yang perlahan meleleh ketika kedua manusia ia mulai belajar berdamai dengan satu sama lain dan dengan masa lalu mereka yang sempat memisahkan.'),
(1045, 'The Karate Kid', 'POSITIF', 'DATA LATIH', 'Film ini cocok di tonton semua kalangan meskipun film ini jauh dari sempurna ada beberapa adegan yang menyentuh, saya salut buat Jackie Chan yang bisa membimbing Jaden Smith menjadi seorang aktor yang tidak hanya bisa berakting namun bisa juga beraksi di depan kamera meskipun ia baru belajar dan jika anda menyukai film pendahulunya anda pasti suka dengan yang ini'),
(1046, 'The Last Stand', 'POSITIF', 'DATA LATIH', 'Sebuah film  laga Hollywood bernuansa western-modern yang disajikan dengan presentasi penuh gaya dan kebrutalan tingkat tinggi dari seorang sutradara beken Korea Selatan yang baru saja memulai debut film berbahasa Inggrisnya, plus daya pikat utamanya, Arnold Schwarzenegger. Ya, The Last Stand menawarkan keasyikan sebuah action movie dengan kombinasi timur dan barat yang apik, semua elemen aksi, humor dan naskahnya yang ringan sukses melebur menjadi satu kesatuan yang menyenangkan.'),
(1047, 'Avengers: Age of Ultron', 'NEGATIF', 'DATA LATIH', 'Meskipun terlihat berat dan rumit di atas kertas, Age of Ultron tidak pernah terjebak untuk menghadirkan plot yang kelewat njelimet atau terlampau dark seperti rivalnya, DC.'),
(1048, 'Beastly', 'NEGATIF', 'DATA LATIH', 'Maka sambutlah salah satu kandidat film terburuk tahun ini, Beastly yang tidak hanya gagal menceritakan kembali dongeng cinta berusia ratusan tahun dalam versi modern ini dengan baik, ia juga gagal nyaris di semua sisi teknisnya.'),
(1049, 'Cowboys vs Alien', 'NEGATIF', 'DATA LATIH', 'Tidak ada kedalaman naskah atau dialog-dialog menarik, komedinya garing, malah kalau mau jujur ia sedikit membosankan dengan durasinya yang hampir menyentuh dua jam itu, belum lagi saya menyebutkan adegan klimaks manusia vs. alien yang konyol itu.'),
(1050, 'Dark Skies', 'NEGATIF', 'DATA LATIH', 'Yang menjadi masalah adalah bagaimana kemudian kita menunggu Stewart untuk memberikan jawaban. Dan apa yang terjadi di ujungnya adalah sebuah antiklimaks. Tidak ada sesuatu yang mengejutkan, semuanya persis seperti apa yang kita perkirakan sebelumnya dan hal ini diperparah dengan banyaknya plot hole mengganggu'),
(1051, 'Everly', 'NEGATIF', 'DATA LATIH', 'Sayang tidak ada momen yang benar-benar mencapai titik didih tertinggi, meskipun harus diakui, setiap aksinya tidak pernah terasa membosankan , belum lagi saya menyebut sekarung besar blooper yang sedikit banyak membuat dahi kita berkerut.'),
(1052, 'Faces in the Crowd', 'NEGATIF', 'DATA LATIH', 'Satu lagi film yang akan dengan mudah dilupakan penontonnya karena rentetan kelemahan di dalamnya. Ah, andai saja cerita ini diberikan kepada Christopher Nolan atau mungkin David Fincher, saya yakin Faces in the Crowd tidak akan membuang waktu berharga saya seperti ini.'),
(1053, 'Faster', 'NEGATIF', 'DATA LATIH', 'Ada atau tidak adanya seorang Dwayne Johnson di dalamnya, tetap saja tidak mampu mengubah fakta bahwa Faster tetap adalah sebuah film aksi medioker tanpa kualitas cerita, bahkan adegan aksi yang seharusnya bisa menjadi nilai lebih pun tidak digarap dengan maksimal, menjadikan Faster sebuah film yang serba nanggung'),
(1054, 'Finding Srimulat', 'NEGATIF', 'DATA LATIH', 'Terlalu banyak kekikukan dan hal-hal yang memaksa di sepanjang film yang membuatnya terasa aneh, misalnya elemen musikal yang muncul tiba-tiba, plot yang dangkal, beberapa dialog kaku dan akting-akting buruk dari para anggota Srimulat.'),
(1055, 'Godzilla', 'NEGATIF', 'DATA LATIH', 'Karakter-karakternya macam Juliette Binoche dan Bryan Cranston membawa drama manusianya menjadi tidak lagi berarti dan yang paling fatal, membosankan dengan penampilan Aaron Taylor-Johnson sebagai karakter sentral manusianya.'),
(1056, 'Harmony', 'NEGATIF', 'DATA LATIH', 'Harmony terlalu banyak menjual mimpi, atau dengan kata lain penontonnya sering dijejali momen-momen tidak realistis yang tentu saja membuat kita bertanya-tanya Apakah ada penjara setentram dan seharmonis di dunia ini? dan lucunya lagi, nyaris semua karakternya dibuat seolah-olah menjadi korban dari kesalahan orang lain.'),
(1057, 'Haywire', 'NEGATIF', 'DATA LATIH', 'Saya bukan anti art house, hanya saja eksperimen yang dilakukan Soderbergh di film aksi terbarunya ini terasa  berlebihan dan tidak bekerja dengan baik, khususnya terhadap penonton-penonton awam. Ya, cukup mengecewakan memang,'),
(1058, 'Homefront', 'NEGATIF', 'DATA LATIH', 'Sayang kualitas naskah adaptasinya kacau dan dangkal, seperti film-film yang ditulis Stallone paska Rocky tiga dekade lalu, tetapi jangan melulu salahkan si Rambo yang tidak becus mengolah naskah, atau Fleder yang menyutradarainya, toh ini adalah film Statham,'),
(1059, 'Hours', 'NEGATIF', 'DATA LATIH', 'Di beberapa momen ia terasa terlalu lambat, hambar dan malas untuk ukuran premis yang membutuhkan kecepatan.'),
(1060, 'Insidious: Chapter 3', 'NEGATIF', 'DATA LATIH', 'Whannell terlihat kesulitan mengikuti jejak Wan mempresentasikan horor menakutkan ala seri-seri Insidious sebelumnya. Jump scare milik Whannell terkesan murahan dan malas. Seperti beberapa kali berusaha menipu penontonnya dengan adegan kosong, toh, pada akhirnya selalu muncul dengan cara yang sama sekali tidak berkelas, '),
(1061, 'Jack Reacher: Never Go Back', 'NEGATIF', 'DATA LATIH', 'Di satu sisi lainnya, Never Go Back juga berasa datar, ketinggalan zaman, dan kurang seru sebagai sajian hiburan. Begitu banyak lubang pada alur ceritanya, dan semuanya terlihat digampangkan dalam naskah tulisan Zwick, Richard Wenk, dan Marshall Herskovitz ini.'),
(1062, 'Jack Ryan: Shadow Recruit', 'NEGATIF', 'DATA LATIH', 'Pada akhirnya karakternya berakhir antiklimaks, dan Shadow of Recruit sendiri tidak lebih dari sajian aksi Hollywood nan cheesy yang masih belum cukup memberikan pondasi kuat untuk franchise spy thriller ini.'),
(1063, 'John Carter', 'NEGATIF', 'DATA LATIH', 'Naskahnya lemah, CGI yang sayangnya tidak terlalu berkesan, akting pas-pasan, humor garing dan 3D yang buruk menjadikan John Carter tidak lebih seperti sebuah fiksi ilmiah medioker Disney dengan budget luar biasa yang sulit untuk bisa dikenang lama.'),
(1064, 'Lucy', 'NEGATIF', 'DATA LATIH', 'Besson seperti meninggalkan potensi yang dimiliki oleh aktor veteran Korea Selatan, Choi Min Sik dengan sia-sia. Min Sik tidak mendapatkan karakter villain sepatutnya. Di adegan pembuka karakter Mr. Jang memang sanggup memancarkan aura sadis, sayang dalam perjalanannya ia menjadi tidak lebih dari karakter musuh yang kelewat dangkal.'),
(1065, 'Maggie', 'NEGATIF', 'DATA LATIH', 'Maggie terasa seperti sebuah tontonan yang berat sebelah, unggul di teknis namun lemah di relasi antar tokohnya, ibarat sebuah masakan yang terlihat lezat namun menjadi hambar ketika dicicipi.'),
(1066, 'Seventh Son', 'NEGATIF', 'DATA LATIH', 'Namun kabar yang lebih buruk dari sekedar naskah, penyutradaraan dan CGI yang super medioker adalah bagaimana mengecewakannya kualitas dari casting besar yang paling tidak bisa menutupi kekurangannya di sana sini itu.'),
(1067, 'Shark Night 3D', 'NEGATIF', 'DATA LATIH', 'Lupakan naskahnya yang buruk, adegan-adegan super konyol dan bodoh atau tidak adanya nama-nama beken di jajaranpemainnya, kecuali mungkin anda akan mendapati ada finalis American Idol, Katharine McPhee yang turut meramaikan parade teror ini karena Ellis tampaknya tidak terlalu ambil pusing dengan hal-hal tersebut.'),
(1068, 'Shelter', 'NEGATIF', 'DATA LATIH', 'Overall, untuk ukuran horror psikologis seharusnya Shelter bisa tampil jauh lebih baik dari ini. Namun sayang kenyataan di lapangan berbicara lain, cukup meyakinkan di awal malah harus melempem di ujungnya, menjadikan film ini dengan mudah terlupakan.'),
(1069, 'Sinister 2', 'NEGATIF', 'DATA LATIH', 'Kesalahan besar lain adalah membiarkan terlalu banyak narasinya diambil dari sudut pandang anak-anak, dalam kasus ini ada pada karakter Zach dan Dylan yang dalam prosesnya malah melemahkan. Menjadi semakin konyol ketika anak-anak tersebut terlalu mudah terjebak dalam bujuk rayu Bhugull.'),
(1070, 'Something Borrowed', 'NEGATIF', 'DATA LATIH', 'Ia jelas masih terjebak dalam segala penyakit klise seperti yang banyak diderita koleganya. Setidaknya untuk ukuran sutradara sekelas Greenfield, ini bukanlah pencapaian yang buruk. Saya pribadi masih bisa menikmati segala kisahnya yang usang, penyajiannya yang terlalu biasa, bahkan tidak perlu menjadi peramal ulung untuk melihat bagaimana nasib karakter utamanya nanti di penghujung cerita.'),
(1071, 'Son of God', 'NEGATIF', 'DATA LATIH', 'Sayangnya drama biblical garapan Christopher Spencer ini begitu datar, ia tidak punya pesona sinematik layaknya sebuah film layar lebar seharusnya. Ia terlihat kerdil, seperti benar-benar sebuah serial televisi panjang yang dipaksa disesakkan menjadi 138 menit untuk ditonton bocah-bocah sekolah Minggu,'),
(1072, 'Speedy Scandal', 'NEGATIF', 'DATA LATIH', 'Sayang Speedy Scandal harus sedikit kedodoran di satu jam akhir, tidak ada lagi yang spesial seperti di 40 menit awal. Semuanya menjadi klise dan sedikit dipaksakan, kita jelas tahu bagaimana ia akan berakhir nantinya.'),
(1073, 'Stone', 'NEGATIF', 'DATA LATIH', 'Overall, Stone mungkin bukan sebuah suspense thriller konvensional yang sering di jumpai sehari-hari. Film ini jelas berpotensi membosankan dan membingungkan bagi sebagian penontonnya, namun tidak berarti film ini buruk.'),
(1074, 'Sucker Punch', 'NEGATIF', 'DATA LATIH', 'Ya, terlalu banyak lubang sana-sini di sepanjang kurang lebih 2 jam, semuanya seperti disajikan mentah-mentah kepada penontonnya, lalu dengan seenaknya dan seabsurdnya Snyder  berulang-ulang mengajak kita melompat lompat antara dunia nyata dan dunia fantasi'),
(1075, 'Talak 3', 'NEGATIF', 'DATA LATIH', 'Bukan berarti komedi romantis tidak bisa serius, namun dalam term romcom dibutuhkan sebuah proses transisi mulus bukan kasar seperti ini, atau yang kata orang Jawa, njomplang, yang terjadi kemudian malah seperti dua film yang sama sekali berbeda digabungkan menjadi satu dan hasilnya jadi kurang memuaskan.'),
(1076, 'Teenage Mutant Ninja Turtles', 'NEGATIF', 'DATA LATIH', ' Sedikit mengecewakan adalah tidak semua personilnya mendapatkan porsi seimbang. Leonardo sang pempimpin seperti tak punya wibawa dan Donatello terlalu pasif ketimbang dua saudaranya. Sementara  penampilan dari sang villain utama, Shredder yang dimodif dengan armor hi-tec berlebihan yang malah membuat terasa aneh,'),
(1077, 'Terpana', 'NEGATIF', 'DATA LATIH', 'Ditutup dengan adegan di lapangan golf, Terpana mungkin hanya menawarkan tontonan alternatif yang berbeda dan mengundang banyak kernyit di dahi dengan temanya yang ganjil dan penuturan Richard Oh yang tak biasa.'),
(1078, 'Texas Chainsaw', 'NEGATIF', 'DATA LATIH', 'Naskahnya buruk dan yang lebih parah terornya berkurang cukup banyak ketimbang seri-seri sebelumnya, bahkan John Luessenhop membuat Si Muka Kulit menjadi sedikit lembek.'),
(1079, 'The Adjustment Bureau', 'NEGATIF', 'DATA LATIH', 'The Adjustment Bureau masih menderita beberapa lubang sana-sini seperti kenapa di sepanjang film berlangsung kita hanya melihat Damon yang berlari sana kemari? Hei! bukankah Blunt juga memendam perasaan yang sama besarnya, bahkan sampai-sampai membuatnya batal menikahi tunangannya?'),
(1080, 'The Amazing Spider-Man 2', 'NEGATIF', 'DATA LATIH', 'Sayang Rhino sendiri sebenarnya tidak mendapatkan porsi besar di sini. Villain besar satu itu tampak seperti hanya sekedar sparring patner santai buat Spider-Man, toh, tidak usah terlalu heran, mengingat sub judul yang dipilih adalah Rise of Electro, bukan Rise of Rhino.'),
(1081, 'The Bling Ring', 'NEGATIF', 'DATA LATIH', 'Pencurian amatir, remaja-remaja narsis, produk-porduk branded, pesta memabukkan dan dentuman keras musik hip hop yang anehnya tanpa kehadiran bumbu seks sama sekali, sesuatu yang aneh mengingat semua elemen tentang rusaknya budaya sebuah generasi sudah dimasukkan ke dalamnya.'),
(1082, 'Alice Through the Looking Glass', 'POSITIF', 'DATA UJI', 'Set-set dunia baru seperti istana jam raksasa milik Time dan segala pernak-perniknya digambarkan dengan memukau, elemen time travel mungkin tidak terasa kompleks namun tetap mengasyikan melihat Alice bolak-balik ke masa lalu untuk menyelamatkan keluarga Hatter.'),
(1083, 'Another Earth', 'POSITIF', 'DATA UJI', 'Naskah yang bagus dari Chaill dibantu penulis muda berbakat, Brit Marling sukses berpadu padan dengan semangat indie kental Cahill, menghasilkan sebuah eksekusi ala semi dokumenter menarik dengan pengambilan sudut-sudut kamera cantik yang hampir semuanya diambil dengan kamera genggam'),
(1084, 'Rurouni Kenshin: Kyoto Inferno', 'POSITIF', 'DATA UJI', 'Momen aksinya juga sudah jelas mengalami upgrade besar-besaran tanpa harus mengorbankan sisi manusiawi dari film pertamanya. Tidak hanya menghadirkan duel pedang yang seru dengan koreografi yang lebih baik seperti yang terlihat ketika Kenshin bertarung cepat dengan tangan kanan Shishio , Hiko Seijuro atau ketika Kenshin menghajar si Sword Hunter, Sawagejo Cho.'),
(1085, 'Salt', 'POSITIF', 'DATA UJI', 'Overall, Ini bukan Bond, ini bukan juga Bourne, ini adalah SALT, sosok heroin baru yang siap menghibur dan merebut hati para penggemar film-film aksi spionase dengan kecantikan dan sepak terjangnya yang luar biasa dalam menumpas siapa saja yang menghalangi misinya.'),
(1086, 'Siti', 'POSITIF', 'DATA UJI', 'Presentasi natural ini digarap dengan sangat baik oleh Eddie Cahyono, bahkan sejak menit-menit pertama ia bergulir ada rasa keintiman yang langsung memikat hati melalui akting luar biasa debutan Sekar Sari yang tampil begitu jujur, lengkap dengan dialog-dialog Jawa Tengah kental yang membuatnya segalanya semakin nyata.'),
(1087, 'Southbound', 'POSITIF', 'DATA UJI', 'Hampir setiap segmen harus diakui digarap dengan bagus dengan cara yang berbeda-beda. Hampir semua berlokasi di jalan-jalan sepi luar kota, atmosfer creepy memancar pekat di setiap babak dengan elemen variasi horor menarik yang semuanya beraroma mistis ala serial horor klasik Twilight Zone.'),
(1088, 'Spring', 'POSITIF', 'DATA UJI', 'Mengutamakan kekuatan chemistry dari dua tokoh utamanya yang mendominasi nyaris seluruh durasinya, Spring mungkin tidak menghadirkan keintiman luar biasa seperti yang dilakukan Jesse dan Celine di trilogi Before, tetapi relasi manis-pahit yang berhasil dibentuk dari setiap perbincangan hangat mereka, canda tawa riang bekerja begitu baik dan terlihat tulus untuk ukuran sebuah film yang bukan sepenuhnya drama percintaan,'),
(1089, 'Stake Land', 'POSITIF', 'DATA UJI', 'Momen-momen emosionalnya seperti relasi setiap karakternya yang terjalin cukup baik, serta kemudian dibungkus segi teknik visualnya yang  didukung dengan sinematografi dan scoring cantik dan kelam membuat aroma kehancuran dan kematian dalam dunia paska kiamat terlihat begitu meyakinkan,'),
(1090, 'The ABC''s of Death', 'POSITIF', 'DATA UJI', 'Ungkapan save the best for the last sepertinya patut disematkan buat The ABCs of Death ketika ia menyimpan tiga segmen terbaiknya di akhir durasi. Dimulai dengan X is for Xyolophone dengan kandungan plot simpel dan gore maksimal yang dengan mudah menjadi segmen favorit.'),
(1091, 'The Babadook', 'POSITIF', 'DATA UJI', 'Ya, hubungan ibu-anak adalah salah satu senjata utama The Badabook dalam menghadirkan emosi tersendiri. Teror psikologis dari jiwa-jiwa yang terluka bersanding manis dengan ancaman dari luar berupa kemunculan sosok tinggi gelap yang dengan cerdas dimunculkan oleh Kent.'),
(1092, 'The Diving Bell and the Butterfly', 'POSITIF', 'DATA UJI', 'Overall, sekali lagi perfilman Perancis membuktikan bahwa mereka tidak pernah berhenti memberikan kejutan-kejutan, dan melalui The Diving Bell and the Butterfly ini kita dihadapkan kepada sebuah kisah seorang manusia yang luar biasa, penuh dengan inspirasi dan pesan moral yang kuat yang digambarkan dengan indah melalui sinematografinya yang cantik.'),
(1093, 'The Equalizer', 'POSITIF', 'DATA UJI', 'The Equalizer pastinya punya banyak persedian momen aksi yang cepat, ekonomis dan efektif menghasilkan sensasi mendebarkan tersendiri. Meskipun kita tahu kemana plotnya bergerak, dan karakter McCall bisa dibilang terlalu tangguh dan terlalu pintar, tetapi setiap adegan yang melibatkan McCall dalam usahanya menegakkan keadilan disajikan dengan sebaik mungkin oleh Fuqua adalah tontonan yang sangat menghibur.'),
(1094, 'The Girl with all the Gifts', 'POSITIF', 'DATA UJI', 'Tentu saja sebagai sebuah zombie movie  unsur survival menjadi salah satu kekuatannya dan kemudian mampu menjadi lebih solid ketika proses bertahan hidup itu kemudian berpadu padan dengan tema pendewasaan diri dalam bungkusan drama dan horor yang sama kuatnya.'),
(1095, 'Demi Ucok', 'NEGATIF', 'DATA UJI', 'Teknisnya buruk. Demi Ucok punya kualitas penyajian dan editing amatiran yang kelewat mentah untuk ukuran indie sekalipun.'),
(1096, 'Fallen', 'NEGATIF', 'DATA UJI', 'Sayangnya, selain temanya yang basi, Fallen juga memiliki naskah yang sangat payah. Trio Nichole Millard, Kathryn Price, dan Michael Ross menggulirkan alurnya dengan begitu pelan, datar dan menjemukan.'),
(1097, 'Furious 7', 'NEGATIF', 'DATA UJI', 'Klimaks yang seharusnya bisa baik malah berakhir antiklimaks, terlalu banyak adegan yang memaksakan diri termasuk ledakan-ledakan generik mewarnai hiruk-pikuk yang ditimbulkan di Los Angeles itu, meskipun tidak sampai terasa janggal seperti sekuen landasan pesawat terbang tanpa ujung di Fast 6, namun untuk ukuran adegan penutup, Furious 7 gagal menutupnya'),
(1098, 'Haunter', 'NEGATIF', 'DATA UJI', 'Beberapa plot hole cukup mengganggu, meninggalkan penjelasan yang tak pernah terjawab sampai akhir film. Haunter memang menghadirkan suasana sunyi, tapi semua itu dibungkus dengan elemen horor dan jump scare cheesy ala Hollywood.'),
(1099, 'How I Live Now', 'NEGATIF', 'DATA UJI', 'Di separuh awal MacDonalds terlalu lama dan sering bermain dengan Ronan bersama segala konflik remaja 16 tahun itu, meninggalkan lawan mainnya, George MacKay seorang diri. Lalu ketika keduanya harus jatuh cinta. itu semua menjadi terasa hambar, terlalu instan dan juga dipaksakan.'),
(1100, 'Identity Thief', 'NEGATIF', 'DATA UJI', 'Sayang baik Gordon maupun Mazin tidak pernah berani untuk mengeksplorasi lebih dalam premisnya, meninggalkannya begitu saja di pertengahan film dan menggantikannya dengan rentetan komedi-komedi dengan kadar tawa yang rendah dan drama yang memaksakan diri.'),
(1101, 'Independence Day: Resurgence', 'NEGATIF', 'DATA UJI', 'Tetapi jika kamu bisa melewati segala kebodohannya bercerita serta penokohannya yang kosong, mungkin pada akhirnya kamu bisa benar-benar menikmati fisik Resurgence.'),
(1102, 'Ant-Man', 'POSITIF', 'DATA LATIH', 'Ya, komedi dan humor-humor segar bisa jadi adalah andalan salah satu faktor penting mengapa Ant-Man bisa begitu menghibur. Reed tahu benar kapan dan  bagaimana memunculkan joke-joke baik verbal maupun fisik dengan memanfaatkan pesona komedi Paul Rudd yang di sini tampil charming sebagai si manusia semut,'),
(1103, 'Arisan! 2', 'POSITIF', 'DATA LATIH', 'Ini bukan hanya sekedar sekuel biasa, tapi juga reuni manis dan pendewasaan dari sebuah kisah  persahabatan hebat yang begitu memesona 8 tahun lalu. Ya, harus diakui Arisan! 2 tidak sekuat pendahulunya, tapi Nia Dinata tetap mampu menjadikannya sebuah tontonan menyenangkan, menghibur bahkan menyentuh.'),
(1104, 'As Above, SO Below', 'POSITIF', 'DATA LATIH', 'Tidak hanya berbekal paras cantik dan akting meyakinkan sebagai seorang alchemist, Dowdle memberi protagonisnya itu kecerdasan dan obsesi berlebih guna memenuhi ambisinya. Tidak hanya karakter Scarlett yang pintar, ia ditemani teman sekaligus love interest, George yang tidak kalah cerdasnya.'),
(1105, 'Attack the Block', 'POSITIF', 'DATA LATIH', 'Oke, sekali lagi Attack the Block membuktikan bahwa imajinasi dan kadar kekreatifan itu jauh lebih dahsyat dari sekedar besarnya biaya produksi. Ya, ini adalah salah satu contoh suguhan fiksi ilmiah sederhana yang mungkin paling keren dan paling menyenangkan yang pernah saya tonton. Premis cerdas dengan balutan naskah yang solid, enerjik plus dukungan karakterisasi luar biasa termasuk didalamnya kombinasi manis dari serunya sebuah invasi alien.'),
(1106, 'Begin Again', 'POSITIF', 'DATA LATIH', 'Seperti Once juga, kesan yang dihadirkan terasa realistis dan jujur. Emosi hadir melalui setiap sorotan mata, bahasa tubuh dan dialog-dialog, melalui setiap pendekatan perlahan yang dibangun manis dan lembut oleh kedua karakter utamanya yang berusaha move on dari masa lalu.'),
(1107, 'Black Water', 'POSITIF', 'DATA LATIH', 'Ya, justru dengan segala kesederhanaannya itu yang membedakan Black Water dengan film sejenis. Andrew Traucki dan David Nerlichin tahu benar bagaimana memanfaatkan embel-embel kisah nyata yang mendasari kisahnya untuk kemudian mendukung atmosfer ketegangan realistis yang mampu dikemas apik, baik secara sinematografi dan scoring yang eerie, termasuk di dalamnya tensi yang terjaga konsisten hingga akhir.'),
(1108, 'Brothers', 'POSITIF', 'DATA LATIH', 'Overall, Brothers jelas adalah sebuah film yang menyentuh, penuh emosi dengan cerita yang dinamis dan pengembangan karakter yang hebat. membuat film Susanne Bier satu ini mampu memberikan kesan yang mendalam bagi para penontonnya, khususnya para penggemar drama berkualitas.'),
(1109, 'Buried', 'POSITIF', 'DATA LATIH', 'Overall, Buried adalah contoh luar biasa bagaimana sebuah thiller indie minimalis mampu memberikan dampak psikologis yang begitu besar kepada penontonnya. Ya, inilah pengalaman sinematik fantastis yang akan memberikan sebuah sensasi ketegangan dan momen emosional'),
(1110, 'Cahaya dari Timur: Beta Maluku', 'POSITIF', 'DATA LATIH', 'Dan tentu saja tidak ketinggalan akting mantap dari Chicco Jericho sebagai veri ganteng Sani Tawainella. Ya,  di luar dugaan aktor 29 tahun yang juga pasangan kekasih Laudya Chintya Bella ini mampu tampil solid mengisi jiwa Sani, tukang ojek pecinta bola asal Tuhelu.'),
(1111, 'Cannibal Holocaust', 'POSITIF', 'DATA LATIH', 'Scoring Riz Ortolani begitu menghantui saya di setiap adegan, indah sekaligus menimbulkan perasaan mengganggu, apakah anda pernah dengar musik seindah ini di film-film exploitasi lainnya? Jelas tidak, saya pun terheran-heran ada scoring sebagus ini dipakai untuk film exploitasi.'),
(1112, 'Captain America: Civil War', 'POSITIF', 'DATA LATIH', 'Civil War di bawah arahan Anthony Russo dan Joe Russo yang kembali dipercaya setelah pekerjaan bagus mereka di The Winter Soldier sukses menghadirkan sekuen pertarungan terbaik sejauh ini dalam sejarah adaptasi superhero layar lebar. Setiap set pieces dihadirkan duo Russo dengan fantastis, humor, aksi dan spesial efek melebur menjadi sebuah kesatuan kesenangan yang diharapkan tidak pernah berakhir.'),
(1113, 'Catatan Harian si Boy', 'POSITIF', 'DATA LATIH', 'Berkat kelihaian Ilya Sigma dan Priesnanda Dwisatria menggodok dialog-dialog asyik di dalamnya termasuk pemilihan guyonan-guyonan yang menghibur sudah secara tidak langsung menambah poin plus dari CHSB. Saya juga menyukai bagaimana Tuta mengeksekusi dan mengalirkan dengan lancar setiap momen di dalamnya, dari start sampai finish semua berjalan cukup mulus,'),
(1114, 'Catfish', 'POSITIF', 'DATA LATIH', 'Catfish memilih untuk meyuguhkan bagaimana dampak dari berkembangnya situs jejaring pertemanan fenomenal tersebut. Tenang saja, saya jamin dokumenter satu ini akan sangat menarik, mungkin yang terbaik di 2010 lalu,'),
(1115, 'Children of Heaven', 'POSITIF', 'DATA LATIH', 'Overall, Children of Heaven memang pantas mendapatkan pujian di mana-mana, apalagi untuk ukuran sebuah film keluarga, karya Majidi satu ini terbilang sangat efektif dan efisien memberikan pengaruh positif kepada para penontonnya di balik segala kesederhanaannya,.'),
(1116, 'City Island', 'POSITIF', 'DATA LATIH', 'Drama-drama bertema keluarga disfungsional memang selalu menjadi sebuah suguhan tontonan menarik. Apalagi dalam film indie satu ini, sang sutradara Raymond De Felitta sukses meramu berbagai elemen-elemen unik dan fresh di dalamnya menjadi sebuah sajian hiburan yang luar biasa enjoyable.'),
(1117, 'Close Encounters of the Third Kind', 'POSITIF', 'DATA LATIH', 'Sebuah sajian fiksi ilmiah klasik sejati tentang bagaimana manusia menjalin hubungan dengan makhluk asing berhasil digambarkan dalam sebuah drama manis, penuh dengan misteri dan kejutan menarik di setiap adegannya dan tentunya tidak ketinggalan parade spesial efek spektakuler nan indah yang membuat film ini meninggalkan kesan cukup dalam di benak para penontonnya.'),
(1118, 'Cloud Atlas', 'POSITIF', 'DATA LATIH', 'Cloud Atlas tetap adalah sebuah film yang indah dengan dukungan teknis sinematografi dan scoring megah yang berpadu padan dengan spesial efek memukau.'),
(1119, 'Coherence', 'POSITIF', 'DATA LATIH', 'Untuk menambah kadar kelamnya, Byrkit menyuntiknya dengan atmosfer creepy bersama scoring minimalis yang menakutkan. Sementara elemen fiksi ilmiah misterinya berhasil bekerja maksimal memaksa pikiran kita bekerja keras menyusun gambar utuh dari petunjuk yang ada sampai nanti ditutup oleh ending yang mengejutkan,'),
(1120, 'Cold Fish', 'POSITIF', 'DATA LATIH', 'Karakterisasi memegang peranan penting dalam berkembangnya cerita. Dan untuk bagian satu ini saya harus angkat dua jempol pada penampilan para pemainnya, khususnya buat aktor yang juga komedian senior Jepang, Dendem yang sudah membawakan karakter Murata dengan sangat apik. Ya, Murata jelas menjadi daya tarik hebat sejak kemunculannya pertama kali dengan segala kehangatan, kebaikan dan semangatnya.'),
(1121, 'Contact', 'POSITIF', 'DATA LATIH', 'Robert Zemeckis sudah mengerjakan tugasnya dengan baik dalam menerjemahkan kembali lembar demi lembar naskah kuat dan cerdas beserta visual-visual hebat di dalamnya. Apa yang kemudian menjadikan Contact sebuah sajian fiksi ilmiah yang istimewa adalah ketika ia kemudian menjejalkan beberapa tema menarik menjadi satu kesatuan kokoh dalam rangkaian drama penuh kejutan-kejutan manis sepanjang hampir 2 jam.'),
(1122, 'Contagion', 'POSITIF', 'DATA LATIH', 'Soderbergh sudah melakukan pekerjaannya dengan bagus, rapi dan sangat meyakinkan dalam mensimulasikan kiamat versinya itu dengan dukungan bintang-bintang kelas 1 nya yang bermain bagus,'),
(1123, 'Conviction', 'POSITIF', 'DATA LATIH', 'Overall, Conviction adalah sebuah film inspirasional yang menyentuh dan emosional. Goldwyn sukses meramu premis sederhana ini menjadi sebuah tontonan menarik, apalagi didukung dengan performa apik para pemainnya.'),
(1124, 'Crazy Stupid Love', 'POSITIF', 'DATA LATIH', 'Senang rasanya menemukan satu lagi komedi bagus tahun ini. Crazy Stupid Love telah memenuhi semua kriteria sebuah sajian komedi romantis yang menarik, tidak hanya lucu, manis dan menyimpan kejutan-kejutan tak terduga, tapi ia juga punya hati dan menawarkan banyak cinta di dalamnya untuk diperjuangkan bersama jajaran pemainnya yang luar biasa.'),
(1125, 'Dallas Buyers Club', 'POSITIF', 'DATA LATIH', 'Tentu saja sebuah biopik bagus harus punya jagoan hebat di dalamnya sebagai sentral berceritanya, dalam kasus ini ada McConaughey yang sudah melakukan sesuatu yang besar, bahkan mungkin yang paling besar, melebihi apa yang pernah kamu lihat di sepanjang kariernya.'),
(1126, 'Dawn of the Planet of the Apes', 'POSITIF', 'DATA LATIH', 'Setiap emosi yang terpancar dari wajah Caesar itu nyata milik Serkis sampai-sampai membuat Reeves memuji Serkins setinggi langit dan menganggap performanya itu layak diganjar Oscar.'),
(1127, 'Daybreakers', 'POSITIF', 'DATA LATIH', 'Overall, kehadiran Daybreakers bisa dibilang menjadi obat bagi mereka yang selama ini merindukan genre vampire yang berbalut adegan-adegan action menarik, apalagi film yang didistribusikan Lionsgate ini juga memiliki konsep yang terbilang orisinil dari kebanyakan film bertema sama lainnya.'),
(1128, 'Dead Snow', 'POSITIF', 'DATA LATIH', 'Dead Snow menjadi kejutan menyenangkan tersendiri buat para fans horor. horor komedi produksi Norwegia itu memberikan sensasi menonton genre zombie yang menyegarkan.'),
(1129, 'Deepwater Horizon', 'POSITIF', 'DATA LATIH', 'Disokong Wahlberg dan nama-nama lain, Deepwater Horizon bisa jadi film berondong jagung yang efektif, menghibur dan diimbuhi sedikit pesan humanis yang berhasil menutup filmnya dengan cukup mengaduk-aduk nurani.'),
(1130, 'Departures', 'POSITIF', 'DATA LATIH', 'Departures menurut saya adalah film Jepang terbaik di tahun 2008, memang tak salah film ini menang Oscar untuk film berbahasa asing terbaik. Kematian di sini digambarkan dengan indah, penuh kelembutan dan penuh dengan emosi, diiringi dengan music score yang sangat menyentuh khas film drama Jepang yang mampu menambah makna film ini.'),
(1131, 'Despicable Me', 'POSITIF', 'DATA LATIH', 'Sampai tulisan ini dibuat, Despicable Me sudah meraup 125 juta Dollar di tangga Box Office, serta banyak mendapatkan sambutan positif dari moviegoers dunia, jelas sebuah pencapaian fantastis untuk ukuran animasi yang hanya memiliki budget 69 juta Dollar ini.'),
(1132, 'Devil''s Backbone', 'POSITIF', 'DATA LATIH', 'Ya, Guillermo del Toro memang sutradara spesial, melalui film yang juga diproduserinya bersama Pedro Almodovar ini, ia sukses menghadirkan sebuah kisah hantu berkualitas. Disajikan dengan pendekatan yang meyakinkan, realisitis, indah namun juga tragis secara bersamaan.'),
(1133, 'Devil''s Due', 'POSITIF', 'DATA LATIH', 'Saya menikmati setiap menitnya, menyaksikan bagaimana interaksi para karakternya dibangun dengan cukup baik, bagaimana Bettinelli-Olpin dan Gillett  menjaga misteri dan atmosfernya secara konsisten dari start hingga finish. Beberapa spesial efeknya digarap bagus untuk ukuran horor dan tentu saja klimaksnya, menjadi bagian terbaik yang patut kamu tunggu.'),
(1134, 'Disconnect', 'POSITIF', 'DATA LATIH', 'Ya, ini adalah sesuatu yang jarang kamu dapatkan dalam sebuah film yang disesaki dengan banyak karakter penting di mana setiap karakter berakting baik dan yang paling utama adalah mereka mendapatkan kesempatan untuk mengembangkan karakternya.'),
(1135, 'Django Unchained', 'POSITIF', 'DATA LATIH', 'Sulit untuk tidak jatuh cinta dengan Django Unchained. Apalagi untuk ukuran sebuah western movie yang biasa dijadikan tontonan nomor dua, Tarantino sudah melakukan sebuah usaha fantastis untuk menaikkan pamor genre klasik ini dengan caranya sendiri tanpa harus menghilangkan semangat baratnya, terlebih kamu akan kembali bertemu dengan seorang Christoph Waltz yang lagi-lagi tampil bagus.'),
(1136, 'Doctor Strange', 'POSITIF', 'DATA LATIH', 'Jajaran pemainnya yang berkaliber Oscar hingga tampilan Mads Mikkelsen sebagai antagonis serta Cumberbatch yang mumpuni sebagai Strange menjadi poin lebih yang memikat di layar.'),
(1137, 'Dog Soldiers', 'POSITIF', 'DATA LATIH', 'Neil Marshall bisa dikatakan telah berhasil memodifikasi sub genre horor werewolf dengan sangat baik dan efektif, baik dari naskah maupun sisi teknisnya dengan sentuhan klasik-modern dan sedikit humor gelap untuk menjadikannya sebagai salah satu cult horor yang patut ditonton bagi setiap penggemar genre ini.'),
(1138, 'Don Jon', 'POSITIF', 'DATA LATIH', 'Gordon-Levitt mencoba membuat filmnya seatraktif mungkin dengan melibatkan banyak narasi, editing cepat nan enerjik dan tentu saja komedi-komedi seks yang melibatkan dialog-dialog kocak, Ya, itu berhasil memang. Secara teknis penyutradaraan Gordon-Levitt sudah melakukan pekerjaan bagus untuk seorang debutan.'),
(1139, 'Dream Home', 'POSITIF', 'DATA LATIH', 'Dream Home ternyata mampu menyajikannya segala kesadisan dan tumpahan darah tersebut dengan dosis tinggi, sehingga hasilnya adalah rangkaian adegan pembunuhan yang berhasil disajikan dengan kreatif dan rapi, bahkan terlihat sangat realistis berkat dukungan spesial efek dan make up yang luar biasa.'),
(1140, 'Dredd', 'POSITIF', 'DATA LATIH', 'Usaha yang dilakukan Karl Urban dalam menjadikan dirinya sebagai Judge Dredd yang baru jelas patut mendapatkan acungan jempol. Tidak seperti Stallone, Urban sudah mengembalikan sosok sang hakim ke jalan yang benar. '),
(1141, 'Dumb and Dumber To', 'POSITIF', 'DATA LATIH', 'Farrely membiarkan Carrey dan Daniels menguasai panggung dengan segala sisa-sisa energi mereka, membiarkan para penonton veterannya merasakan sensasi yang pernah mereka rasakan dua dekade lalu ketika melihat duet maut ini berhasil mengocok perutmu sampai sakit lengkap dengan segala cameo menghibur termasuk cameo dari van anjing legendaris mereka.'),
(1142, 'Elle', 'POSITIF', 'DATA LATIH', 'Ah, intinya Elle adalah sebuah pengalaman menonton yang tak biasa, disajikan dengan berkelas dan menampilkan salah satu performa terbaik tahun ini melalui akting prima Huppert. Dan Verhoeven di usianya yang tak lagi muda sukses bereksplorasi dengan tema yang dahulu membesarkan namanya, namun disajikannya tanpa dibuat-buat dan berkesan karena kesederhanaannya yang kuat.'),
(1143, 'Enough Said', 'POSITIF', 'DATA LATIH', 'Gandolfini bermain bagus sebagai duda dengan selera humor dan kehangatan yang menyenangkan. Bisa dibilang ini adalah pertunjukan perpisahan manis dan berkesan dari seorang Gandolfini . Sementara bintang serial televisi Julia Louis-Dreyfus punya chemistry dengan Gandolfini terutama di saat melibatkan guyonan-guyonan cerdas,'),
(1144, 'Event Horizon', 'POSITIF', 'DATA LATIH', 'Overall, Event Horizon bisa dibilang sukses mengkombinasikan dengan baik elemen-elemen fiksi ilmiah dan horror dengan sangat baik. Kengerian visual maupun psikologis benar-benar dieksploitasi habis-habisan oleh Paul Anderson, hasilnya adalah sebuah horror luar angkasa yang siap memberikan teror mental bagi para penontonnya.'),
(1145, 'Frequently Asked Questions About Time Travel', 'POSITIF', 'DATA LATIH', 'Untuk ukuran sebuah film televisi, Frequently Asked Questions About Time Travel ternyata dapat melebihi dari yang saya kira sebelumnya. Jarang-jarang ada fiksi ilmiah komedi sekocak dak sekomplit ini yang tidak hanya menampilkan humor semata namun secara bersamaan diikuti dengan dukungan kisah yang seru dan menarik, pemilihan dialog yang cerdas, dan kekuatan chemistry ketiga tokoh utamanya yang bermain solid.'),
(1146, 'From Dusk Till Dawn', 'POSITIF', 'DATA LATIH', 'Overall, From Dusk Till Dawn mungkin bukan karya terbaik dari seorang Robert Rodriguez, namun seperti ciri khas film-film lain miliknya, From Dusk Till Dawn juga tidak ketinggalan menghibur penontonnya dengan ciri khasnya sendiri. Sebuah suguhan B movie yang menyenangkan untuk ditonton, tentunya dengan pikiran terbuka.'),
(1147, 'Ghostbusters', 'POSITIF', 'DATA LATIH', 'Tidak hanya para demit yang tampil lebih oke, presentasi Feig dalam hal action juga tidak kalah hebatnya, menghasilkan tontonan berburu hantu yang sangat fun di sepanjang 116 menit durasinya.'),
(1148, 'Killers', 'POSITIF', 'DATA LATIH', 'Menyenangkan melihat bagaimana duo Mo naik kelas. Jika Rumah Dara seperti sarana mereka untuk bersenang-senang sekaligus membuktikan kecintaan mereka pada blood and gore, maka Killers adalah bagaimana keduanya melangkah lebih jauh ke dalam sebuah sajian thriller yang lebih kompleks namun tetap begitu menyenangkan untuk ditonton bersama balutan sekuen-sekuen mendebarkan.'),
(1149, 'Kingsglaive: Final Fantasy XV', 'POSITIF', 'DATA LATIH', 'Kesan pertama ketika menancapkan pandangan kepada Kingsglaive adalah, ini animasi yang luar biasa indah. Secara teknis apa yang dilakukan oleh suradara Takeshi Nozue dan para animator Square Enix dalam menghadirkan dunia Final Fantasy XV sulit untuk dilukiskan dengan kata-kata bahkan buat saya pribadi yang sudah sering melihat kualitas CGI yang dibuat mereka di karya-karya sebelumnya'),
(1150, 'Mari Lari', 'POSITIF', 'DATA LATIH', 'Tidak pernah mudah membuat sebuah drama olahraga yang bagus secara teknis dan bersamaan juga terasa informatif, real dan sentimentil, semua itu bisa terjadi karena Delon Tio yang juga bagian dari komunitas Indorunners dengan cerdik memanfaatkan dua even lari di dunia nyata untuk disatukan dengan filmnya.'),
(1151, 'Maze Runners: The Scorch Trial', 'POSITIF', 'DATA LATIH', 'Ball mampu memainkan ritmenya dengan baik, memaksimalkan pesona para cast mudanya yang berhasil membangun jalinan chemistry yang ok, antagonis mengancam dalam diri Aidan Gillen , jebolan seri Game of Thrones yang karismatik dan yang satu hal yang  adalah pasti bagaimana Ball menutup The Scorch Trial dengan pidato yang bagus dari Thomas itu sedikit banyak sudah berhasil menghadirkan rasa penasaran untuk menantikan seri finalnya.'),
(1152, 'Neerja', 'POSITIF', 'DATA LATIH', 'Neerja masih punya segala elemen thriller yang mencekam. Kelompok teroris Pakistan yang beranggotakan empat orang bersenjata memberi cukup ancaman guna menghadirkan situasi intens dalam pesawat bersama segala kekejaman dan kebrutalan mereka.'),
(1153, 'Ngenest', 'POSITIF', 'DATA LATIH', 'Yang terpenting adalah membuat penontonnya enjoy dan terhibur. Ya, Ernest bisa dibilang sukses untuk misi yang satu ini. Kekuatan terbesar Ngenest selain pada premis menantang tentang usaha seorang keturunan Cina mencari pasangan hidup pribumi untuk kehidupan yang lebih baik, pastinya ada pada unsur komedinya.'),
(1154, 'Night at the Museum: Secret of Tomb', 'POSITIF', 'DATA LATIH', 'Shawn Levy masih bisa membungkus semuanya dengan kehangatan dari karakter-karakternya serta lagi-lagi kualitas CGI mumpuni yang menampilkan banyak karakter baru dari para pajangan di British Museum of Natural History dan komedi segar dengan kombinasi slapstik, gag dan dialog-dialog yang rupanya masih sanggup menghadirkan tawa renyah buat pesta perpisahan para penghuni museum.'),
(1155, 'Olympus Has Fallen', 'POSITIF', 'DATA LATIH', 'Olympus Has Fallen menawarkan sebuah premis menarik yang diisi oleh banyak hingar bingar, kehancuran dan patriotisme yang menghibur. Bukan film yang pintar namun siapa yang peduli jika pada akhirnya kita dihajar habis-habisan oleh rentetan aksi seru menegangkan sebuah action thriller tanpa otak yang mengasyikkan.'),
(1156, 'Pee Mak', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah komedi horor, Pee Mak bisa dibilang sukses menjalankan tugasnya dengan baik. Dipenuhi dengan plot twist yang lucunya masih efektif untuk memberikan sebuah sajian yang menghibur dan sedikit menakutkan.'),
(1157, 'Pendekar Tongkat Emas', 'POSITIF', 'DATA LATIH', 'Selama 113 menit Pendekar Tongkat Emas dibawakan lewat presentasi teknis dan kru-kru yang berbakat, dan Ifa Ifansyah selaku sutradara mengeksploitasi keindahan alam Sumba secara maksimal. Ya film ini memang bukan hanya menjual jajaran cast yang bersinar, namun juga menjual keindahan landscape pulau Sumba. Sinematografi ciamik yang diarahkan oleh Unay Nimpuno yang piawai mengeksploitasi pemandangan alam Sumba di setiap sudutnya.'),
(1158, 'Pete''s Dragon', 'POSITIF', 'DATA LATIH', 'Kudos buat penyutradaraan apik Lowrey yang mampu mengemas ceritanya yang tipis dengan presentasi yang manis, seru, cantik sekaligus penuh kehangatan tanpa melupakan pesan-pesan dan esensi moral khas drama keluarga Disney tentang hubungan orang tua-anak serta mempercayai keajaiban,'),
(1159, 'Police Story 2013', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah drama thriller psikologis, ini masih berada dalam kategori film yang layak tonton. Sutradara Little Big Soldier, Ding Sheng masih mampu menyeimbangkan antara narasi, aksi menegangkan dan drama emosionalnya dalam takaran yang pas.'),
(1160, 'Poltergeist', 'POSITIF', 'DATA LATIH', 'Para pemain ciliknya cukup bersinar, Kyle Catlett memberikan penampilan apik sebagai Griffin putra tengah keluarga Bowen, tetapi bintang utamanya berada di Kennedi Clements yang super imut, sedikit banyak ia sudah mengingatkan penonton veterannya pada Heather ORourke.'),
(1161, 'Remember', 'POSITIF', 'DATA LATIH', 'Egoyan sedikit demi sedikit mengupas lembaran demi lembaran misterinya sembari memaksimalkan pesona seorang Christopher Plummer dalam salah satu akting terbaiknya. Ada kejutan di setiap perjumpaan yang  tidak jarang menciptakan situasi intens dan emosional tersendiri.'),
(1162, 'Rio', 'POSITIF', 'DATA LATIH', 'Lihat saja bagaimana mereka mengkonversi lanskap kota Rio de Jeniro beserta segala keindahan alamnya dan tempat wisatanya dengan fantastis. Atau bagaimana mereka menciptakan kembali adegan karnaval kota Rio yang rumit itu, karena tidak hanya melibatkan banyak karakter, namun juga bagaimana menghadirkan detil luar biasa di dalamnya.'),
(1163, 'Ronin', 'POSITIF', 'DATA LATIH', 'Overall, Ronin memang bukanlah sebuah action-thriller yang luar biasa, namun setidaknya dengan adegan-adegan aksinya yang berhasil digarap dengan hebat itu jelas membuat film satu ini akan selalu tetap dikenang dalam memori para penontonnya.'),
(1164, 'Snowpiercer', 'POSITIF', 'DATA LATIH', 'Apa yang menurut saya mengesankan di sini adalah bagaimana usaha Bong Joon Ho untuk tetap menjaga orisinalitas di debut internasional ini kendati pengaruh-pengaruh komersil yang begitu menggoda.'),
(1165, 'Splice', 'POSITIF', 'DATA LATIH', 'Efek khusus film ini ditangani orang- orang Guillermo del Toro yang dulu menangani Hellboy dan Pans Labyrinth dengan rapinya membentuk CGI yang renderingnya sangat solid dan yang lebih mengesankan lagi  Vincenzo Natali mampu melakukannya dengan biaya 26 juta saja ditambah memenangkan Efek Khusus Terbaik di Sitges Film Festival 2009'),
(1166, 'Spy', 'POSITIF', 'DATA LATIH', 'Melissa McCarthy tentu saja daya pikat utama Spy. Meski sedikit tampil lebih sopan di sini karena tuntunan skenario, McCarthy tetap memancarkan aroma kegilaan yang maksimal, apalagi didukung dengan deretan cast bagus yang membuat Spy menjadi semakin meriah,'),
(1167, 'Inferno', 'NEGATIF', 'DATA LATIH', 'Unsur perpaduan Hanks dan Jones pun serasa salah dan tak sesuai, sehingga ketika sebuah kejutan di antara keduanya dihadirkan, penonton tak begitu perduli walaupun harusnya memberikan efek perangah, juga berasa hambar saja.'),
(1168, 'Insurgent', 'NEGATIF', 'DATA LATIH', 'Ya, dua jam menonton Insurgent itu terasa seperti dua hari lamanya, presentasi yang dihadirkan seperti berjalan terseok-seok, tidak peduli terkadang Schwentke menyelipkan beberapa adegan aksi di sela-selanya,  alhasil, isu-isu yang semestinya bisa dibuat lebih baik malah terasa melempem masuk angin karena terlalu lama bergerak.'),
(1169, 'Jobs', 'NEGATIF', 'DATA LATIH', 'Oke, meskipun tampil tidak buruk tetapi casting utamanya bisa dibilang miss, jadi saya berharap pada naskah yang bisa meyakinkan kita bahwa biopik yang kita tonton memang benar menceritakan kisah hidup Steve Jobs, sayang departemen satu ini juga mengecewakan.'),
(1170, 'Julia''s Eyes', 'NEGATIF', 'DATA LATIH', 'Ya, sejak saat  itulah secara tidak langsung membuat horror yang memiliki judul asli Los ojos de Julia ini langsung terjebak dalam formula horror klise yang cheesy,'),
(1171, 'Ju-On: The Final Curse', 'NEGATIF', 'DATA LATIH', 'Sayang berakhir mengecewakan baik dari kualitas narasi maupun ancaman horornya itu sendiri. Tidak terlalu mengherankan sih, karena chapter penutupnya masih mengandalkan beberapa nama lama yang menjadi biang kerok dari lembeknya The Beginning of the End.'),
(1172, 'Kick-Ass 2', 'NEGATIF', 'DATA LATIH', 'Tentu saja kamu akan membandingkannya dengan film pertamanya, itu sudah pasti, dan kabar buruknya, Kick Ass 2 memang harus diakui mengalami penurunan dibanding pendahulunya di beberapa sektor penting.'),
(1173, 'Mission Impossible: Rogue Nation', 'NEGATIF', 'DATA LATIH', 'Satu hal yang fatal di sini mungkin selain plotnya yang kurang greget, adalah penampilan Tom Cruise sendiri. Bukan berarti ia menjadi lambat atau kurang jago, yang kurang adalah ketika narasi McQuarri tidak memberi Hunt konflik internal pelik seperti seri-seri sebelumnya.'),
(1174, 'Modus Anomali', 'NEGATIF', 'DATA LATIH', 'Jika saya tidak menyukai ending Pintu Terlarang yang terlalu instan, untuk Modus saya tidak suka karena kelewat gamblang.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(1175, 'One Day', 'NEGATIF', 'DATA LATIH', 'Ya, jujur saja, One Day itu sangat bertele-tele, termasuk di dalamnya rangkaian dialog-dialognya yang membosankan. Gemas rasanya melihat karakter-karakternya yang cukup bodoh untuk terus menerus mau terjebak dalam tarik ulur hubungan cinta mereka yang semestinya bisa bersatu dengan mudahnya.'),
(1176, 'Only Lovers Left Alive', 'NEGATIF', 'DATA LATIH', 'Dengan plot yang dibilang datar, Only Lovers Left Alive tentu akan membuat sebagian penontonnya yang berharap banyak dari kisah para vampir konvensional akan kecewa.'),
(1177, 'Oshin', 'NEGATIF', 'DATA LATIH', 'Ini seperti menonton beberapa episode pertamanya yang dijahit dengan kasar dan terkesan repetitif. Kita melihat Oshin dibully, tersungkur dan kembali bangun sampai beberapa kali dengan kadar tearjerker yang nanggung, tidak cukup membuatmu mewek namun tidak sampai membuatmu tidak peduli.'),
(1178, 'Ouija', 'NEGATIF', 'DATA LATIH', 'Bagian terburuk Ouija bukan berada pada banyaknya jump scare berkualitas murahan atau penampakan-penampakan cupu yang muncul dari koridor-koridor gelapnya, naskah yang buruk adalah dosa terbesarnya ketika White bersama koleganya Juliet Snowden seperti memakan buah simalakama.'),
(1179, 'Our Kind of Traitor', 'NEGATIF', 'DATA LATIH', 'Sayangnya konklusinya terlalu hambar dan kurang jeli mengembangkan materi yang sebenarnya menjanjikan. Lakon para aktornya yang sudah tampil tak mengecewakan juga tersia-siakan oleh penutupnya yang memble tersebut.'),
(1180, 'Paranormal Activity: The Ghost Dimension', 'NEGATIF', 'DATA LATIH', 'Jujur, potensi membuat kisah The Ghost Dimension menjadi lebih besar dari seri-seri sebelumnya jelas terbuka lebar, tetapi kenyataannya para penulisnya memilih untuk menyederhanakan semuanya, dan yang lebih parah jika kamu mengharapkan sebuah konklusi akhir dari rentetan panjang misteri besar Paranormal Activity bersiap saja kecewa.'),
(1181, 'Paranormal Activity: Tokyo Night', 'NEGATIF', 'DATA LATIH', 'So, Paranormal Activity 2: Tokyo Night terlihat hanya menjadi ajang aji mumpung bagi Paramount Pictures untuk dapat melebarkan dominasinya, khususnya di pasar Asia. Karena sesungguhnya tidak ada yang baru yang ditawarkan dalam sajian horror mockumentary ini selain pengulangan demi pengulangan kembali formula yang sudah basi.'),
(1182, 'Parker', 'NEGATIF', 'DATA LATIH', 'Parker memang masih menawarkan rangkaian aksi tetapi hanya satu yang paling mudah diingat; ketika Statham berduel brutal dengan Daniel Bernhardt di sebuah hotel, sisanya Statham tampak terlalu malas untuk menggerakkan otot-ototnya.'),
(1183, 'Pirates of the Caribbean: On Stranger Tides', 'NEGATIF', 'DATA LATIH', 'Ya, walaupun harus diakui juga kadar petualangan yang disajikan oleh Marshall mungkin tidak pernah mencapai titik seseru para pendahulunya, bahkan mungkin saja berpotensi membosankan penontonnya.'),
(1184, 'Prince of Persia: The Sands of Time', 'NEGATIF', 'DATA LATIH', 'Tidak bisa dipungkiri plot yang ditampilkan film berdurasi 116 menit ini juga terkesan cheesy seperti popcorn movie kebanyakan. Selain ceritanya yang standar dan klise, beberapa elemen dari game juga kurang digarap dengan maksimal.'),
(1185, 'Project Hasima', 'NEGATIF', 'DATA LATIH', 'Tidak hanya premisnya yang cheesy, bahkan keseluruhan film adalah sebuah pertunjukan horor kadaluarsa dengan segala parade penampakan hantu dan jump scares murahannya. Dan ketika ia benar-benar membuat kita terloncat itu juga dengan cara yang sama bodoh dan murahannya dengan kelakuan para karakter remaja tanggungnya.'),
(1186, 'Robin Hood', 'NEGATIF', 'DATA LATIH', 'Secara kualitas Robin Hood terbilang gagal memenuhi ekspektasi besar para penontonnya, bahkan untuk saya pribadi karya Ridley Scott lainnya yang beraroma sama, Kingdom of Heaven masih tampil jauh lebih baik.'),
(1187, 'Ronaldo', 'NEGATIF', 'DATA LATIH', 'Ini seperti dokumenter yang hanya membahas Cristiano Ronaldo dari satu sisi sempit saja, sisi di saat ia sudah menjadi besar tanpa adanya konflik berarti yang mestinya,'),
(1188, 'Runner Runner', 'NEGATIF', 'DATA LATIH', 'Apa daya, Runner Runner hanya memfokuskan semuanya pada karakter Richie yang naif (baca: bodoh) senaif narasi garapan duo Brian Koppelman dan David Levien yang disajikan dengan plot sedatar jalan tol tanpa adanya ketegangan berarti untuk ukuran sebuah thriller.'),
(1189, 'Sector 7', 'NEGATIF', 'DATA LATIH', 'Hampir di setengah jam pertamanya  penontonnya hanya dijejali banyak adegan tidak penting nan melelahkan, bahkan banyak di antaranya yang terkesan berlebihan, sama berlebihannya seperti akting bintang Secret Garden, Ha Ji Won.'),
(1190, 'Self/Less', 'NEGATIF', 'DATA LATIH', 'Ya, apa yang terjadi kemudian adalah bencana. Singh dan dua Pastor bersaudara David dan lex yang bertanggung jawab menuliskan naskahnya seperti melempar semua  keluar jendela, membuatnya sampai ke titik menyedihkan lalu bermain-main lebih aman dengan membentuknya dalam wujud action-thriller dengan segala momen-momen kekar-kejaran serta adu tembak yang terasa serba cheesy dan medioker,'),
(1191, 'Session 9', 'NEGATIF', 'DATA LATIH', 'Sayang saya tidak terlalu menyukai endingnya, walaupun masih meninggalkan sedikit kejutan tapi twist ending seperti ini terlalu sering dipakai.'),
(1192, 'Shadow', 'NEGATIF', 'DATA LATIH', 'Zampaglione merusak semuanya dengan twist endingnya yang maksa itu. Ya, harus diakui penyelesaiannya memang cukup membuat saya terkejut, tapi menipu penontonnya mentah-mentah dengan cara seperti itu jelas buruk.'),
(1193, 'Stoker', 'NEGATIF', 'DATA LATIH', 'Banyak menderita di naskahnya yang terlalu generik meskipun kemudian kualitas penyajian yang dihadirkan Park Chan Wook mampu sedikit menyelamatkan Stoker dari sebuah kehancuran total.'),
(1194, 'Strawberry Surprise', 'NEGATIF', 'DATA LATIH', 'Jujur saja itu sama menyebalkannya dengan karakter Aggi yang di sepanjang film seperti minta ditampar, tidak peduli jika kamu memasang lagu Raisa yang paling ngetop sekalipun tetapi jika penggunaannya sampai menabrak adegan dan dialog-dialognya, itu terlihat seperti pekerjaan amatiran.'),
(1195, 'Suicide Squad', 'NEGATIF', 'DATA LATIH', 'Kamu akan menyaksikan rentetan momen aksi murahan tanpa didukung set-piece yang baik, humor-humor one-liner yang terasa terlalu memaksakan diri untuk terlihat lucu.'),
(1196, 'Super 8', 'NEGATIF', 'DATA LATIH', 'Sayangnya saya merasa Super 8 bergerak terlalu lama dan sedikit bertele-tele pada satu jam pertama. Tidak ada emosi di sini, semuanya dihadirkan dalam takaran yang serba berkecukupan, bahkan elemen misterinya juga harus berakhir antiklimaks, begitu saja tanpa mampu meninggalkan kesan berarti.'),
(1197, 'Survivor', 'NEGATIF', 'DATA LATIH', 'Alih-alih menjadi sajian thriller, Survivor malah terjerembab dalam kubangan action kelas dua dengan kualitas narasi yang menyedihkan plus ketidak konsistenan plot yang sangat mengganggu.'),
(1198, 'Taken 3', 'NEGATIF', 'DATA LATIH', 'Tidak hanya menderita di naskah dan alurnya yang semakin terseok-seok membosankan, porsi action mengalami downgrade termasuk pace yang menjadi semakin lambat, selambat karakter Bryan Mills yang tampak mulai kelelahan.'),
(1199, 'Tendangan dari Langit', 'NEGATIF', 'DATA LATIH', 'Munculnya beberapa lubang cerita yang cukup mengganggu, konflik-konflik yang muncul terkesan terlalu digampangakn dalam penyelesaiannya, karakter-karakter yang kurang bisa dimanfaatkan menjadi dosa-dosa terbesar di film ini.'),
(1200, 'Terekam', 'NEGATIF', 'DATA LATIH', 'Tidak peduli seberapa kerasnya usaha yang dilakukan ketiga pemainnya, tetap saja mereka gagal, termasuk dengan menghadirkan wawancara terpisah pada awal dan akhir film. Bukan hanya karena kualitas akting yang sangat buruk, namun kehadiran mereka, yang notabene adalah publik figurlah yang menjadikan nuansa real film ini langsung lenyap begitu saja.'),
(1201, 'The Great Gatsby', 'NEGATIF', 'DATA LATIH', 'Gatsby terasa terlalu lama dan seperti berputar-putar untuk mencapai titik yang ingin dituju, namun masalah terbesarnya bukan pada durasi yang panjang, plot dragging atau dialog-dialog membosankannya, tetapi ketika Luhrmaan gagal menghadirkan sisi emosional yang seharusnya bisa tergali lebih dalam lagi.'),
(1202, 'Cloudy with a Chance of Meatball 2', 'POSITIF', 'DATA UJI', 'Seperti kita ketahui, film pertamanya punya premis kuat dan beda untuk ukuran sebuah animasi yang sanggup menjadi daya tarik utama. Namun tidak adanya lagi badai makanan-makanan yang lezat rupanya tidak membuat Cloudy with a Chance of Meatballs 2 kehilangan pesonanya. Di bawah komando baru duo sutradara barunya, hujan bakso dan kuliner lain diganti menjadi pulau makanan dengan segala macam food animals yang digarap dengan sangat kreatif dan juga lucu oleh tangan-tangan handal animator Sony Pictures Animation.'),
(1203, 'Grave of the Fireflies', 'POSITIF', 'DATA UJI', 'Overall, Grave of the Fireflies berhasil menampilkan sebuah kisah sederhana, realistis dan menyentuh yang mampu memberikan efek besar bagi para penontonnya. Tidak terlalu berlebihan rasanya jika Roger Ebert menganggap animasi satu ini adalah salah satu the most powerful anti-war movies ever made, bahkan mereka pun berani menyandingkannya dengan karya hebat Steven Spielberg.'),
(1204, 'Haunted Changi', 'POSITIF', 'DATA UJI', 'Ya, perpaduan urban legend yang dipadu padankan dengan style mockumentary masih terbukti efektif untuk memberikan penontonnya sebuah sensasi menonton horror penuh kengerian.'),
(1205, 'How to Train Your Dragon 2', 'POSITIF', 'DATA UJI', 'Plotnya sendiri berkembang dinamis, masih berisi elemen coming of age, buddy movie dan kesetiaan, serta kali ini ada tambahan sebuah reuni keluarga yang manis. Tetapi yang istimewa dari naskah How to Train Your Dragon 2 adalah bagaimana Dean DeBlois menghadirkan kadar emosinya. '),
(1206, 'Hummingbird', 'POSITIF', 'DATA UJI', 'Seorang biarawati Polandia lembut dan baik hati yang dimainkan dengan sangat baik oleh Agata Buzek. Kombinasi karakter yang bak bumi dan langit ini kemudian saling mengisi satu sama lain yang meskipun tidak sepenuhnya berjalan terlalu mulus namun sudah lebih dari cukup untuk memberikan sebuah hubungan unik yang menarik.'),
(1207, 'I Am Hero', 'POSITIF', 'DATA UJI', 'Layaknya sebuah zombie survival, ada begitu banyak momen mendebarkan di sini yang didominasi dengan serbuan masif para pelahap otak itu dan bagaimana Sato mampu mengemasnya dengan sangat baik menyeimbangkan antara horor, komedi dan drama. Menariknya, para zombie digambarkan tidak hanya terlihat mengerikan namun juga unik dengan karakteristik berbeda-beda,'),
(1208, 'I Am Yours', 'POSITIF', 'DATA UJI', 'Acharia bisa dibilang adalah kekuatan utama I Am Yours. Ia sukses menggerakkan naskah kompleks Haq, mengisi perannya dengan sisi perpaduan sensualitas yang sama kuatnya dengan kerapuhannya sebagai manusia yang terbuang dari lingkungannya.'),
(1209, 'I Spit on Your Grave', 'POSITIF', 'DATA UJI', 'Meskipun tidak sampai serealistis dan sekontroversial versi aslinya, setidaknya sebagai sutradara, Monroe sudah memberikan sebuah suguhan thriller balas dendam yang lumayan menghibur dan cukup ejoyable untuk ditonton.'),
(1210, 'In a Better World', 'POSITIF', 'DATA UJI', 'Sussanne Bier sudah melakukan pekerjaannya dengan sangat baik dengan menghadirkan sebuah melodrama emosional sederhana dengan balutan naskah kuat, yang juga didukung teknik penyutradaraan prima dan akting apik dari setiap pemainnya.'),
(1211, 'In Your Eyes', 'POSITIF', 'DATA UJI', 'Kombinasi nama besar Whedon, premis cinta yang unik dan kehadiran kembali si manis Zoe Kazan memang membuat In Your Eyes punya kekuatannya sendiri.'),
(1212, 'Independence Day', 'POSITIF', 'DATA UJI', 'Duo Emmerich-Develin telah sukses melakukan pekerjaannya dalam upaya mereka menghadirkan sebuah sajian sci-fi paling menghibur yang tidak akan pernah jemu saya tonton berulang kali.'),
(1213, 'Innocent Voices', 'POSITIF', 'DATA UJI', 'Overall, Innocent Voices adalah salah satu anti war movie terbaik yang pernah dibuat, sebuah film yang perlu disaksikan semua orang di seluruh dunia agar mereka dapat memberikan kesempatan bagi anak-anak untuk menjalani hidupnya sebagaimana layaknya anak kecil, yaitu penuh canda dan tawa.'),
(1214, 'Kisah 3 Titik', 'POSITIF', 'DATA UJI', 'Setiap cerita punya daya tarik masing-masing, meskipun tidak semuanya tersaji kuat namun bagaimana kemudian mereka saling bersinggungan satu sama lain itu menjadi daya tarik tersendiri. Departemen akting tampil bagus, khususnya Ririn Ekawati yang bermain total.'),
(1215, 'Lebanon', 'POSITIF', 'DATA UJI', 'Lebanon bisa dibilang adalah sebuah film anti perang yang unik  jika dibandingkan dengan kebanyakan sejenisnya. Salah satu faktor utama yang membuat film ini berbeda adalah setting yang sangat terbatas.'),
(1216, 'Lilya-4-Ever', 'POSITIF', 'DATA UJI', 'Sutradara dan penulis naskah Lukas Moodysson sukses menghasilkan sebuah drama kemanusiaan realistis dengan dukungan akting natural dari semua pemainnya. Dukungan soundtrack yang powerful juga menjadi daya tarik tersendiri bagi Lilya 4 Ever.'),
(1217, 'Kung Fu Panda 2', 'NEGATIF', 'DATA UJI', 'Elemen komedi repetitif kembali mengeksploitasi habis-habisan sosok Po dengan segala tingkah laku, kecerobohannya serta dominasi suara Jack Black dan Gary Oldman sepanjang 91 menit yang pada akhirnya membuat personil Furious Five lain (kecuali Tigress) terlantar.'),
(1218, 'Last Summer', 'NEGATIF', 'DATA UJI', 'Idenya sudah dipakai berulang kali, sungguh benar-benar tidak ada sesuatu yang baru ditawarkan Last Summer, dan yang lebih parah dari premis basi tentang arwah marah yang balas dendam adalah presentasi dan narasi buruk.'),
(1219, 'Machine Gun Preacher', 'NEGATIF', 'DATA UJI', 'Terlalu lama berputar-putar, membosankan, repetitif dengan karakter-karakternya yang menggelikan, Machine Gun Preacher jelas bukan biopik yang bagus.'),
(1220, 'Maleficent', 'NEGATIF', 'DATA UJI', 'Ya, pastinya akan sulit menghadirkan porsi cerita lebih banyak buat sang antagonis yang di sumber aslinya juga sebenarnya tidak banyak muncul, tetapi memolesnya dengan cara kurang ajar seperti ini bisa dibilang adalah sebuah penghinaan, sebuah lelucon konyol.'),
(1221, 'Red Riding Hood', 'NEGATIF', 'DATA UJI', 'Horror yang tidak menakutkan, romansa nanggung, akting datar, dialog cheesy termasuk di dalamnya beberapa momen konyol dan plot hole, sepertinya dengan segala borok tersebut Red Riding Hood mudah untuk kemudian menjadi sasaran empuk caci para penontonnya.'),
(1222, 'Rudy Habibie', 'NEGATIF', 'DATA UJI', 'Tidak ada yang salah dengan segala dramatisasi dalam sebuah film, tetapi memberondongnya dengan berlebihan dan serba memaksakan diri itu juga bukan sesuatu yang baik, yang ada malah perasaan ilfil karena terasa terlalu lebay.');
